INSERT INTO `consultations` (`id`, `booking_id`, `consultation_slot_id`, `user_id`, `consultation_notes`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 1, 2, 2, 'Remember that your automatic mechanism can as easily function as a \"Failure Mechansim\" as a \"Success Mechanism,\" depending upon the data you give it to process, and the goals you set for it. It is basically a goal-striving mechanism. The goals it works upon are up to you. Many of us unconsciously and unwittingly, by holding negative attitudes and habitually picturing failure to ourselves in our imagination—set up goals of failure.', NULL, '2025-01-05 16:47:43', '2025-01-05 16:47:43'),
(2, 2, 1, 2, 'Also remember that your automatic mechanism does\nnot reason about, nor question, the data you feed it. It\nmerely processes it and reacts appropriately to it.\nIt is very important that the automatic mechanism be\ngiven true facts concerning the environment. This is the\njob of conscious rational thought: to know the truth, to\nform correct evaluations, estimations, opinions. ', NULL, '2025-01-05 16:51:49', '2025-01-05 16:51:49');
