INSERT INTO `customer_contacts` (`id`, `user_id`, `call_notes`, `call_outcome`, `next_call_date`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 3, 'The client sounded anxious, looking to get clarity on their general direction of life. This call focused on doing a pre-assessment that will be used to plan for the client\'s outcomes. The next call should focus on working on the client\'s treatment plan through a confirmed and paid for booking.', 'The call was successful, with the client looking to book for an appointment in the coming few days. A follow-up call was scheduled, in the next two days.', '2025-01-08 10:00:00', NULL, '2025-01-06 10:29:29', '2025-01-06 10:29:29');
INSERT INTO `c_y_c_applications` (`id`, `participant_id`, `sdg_response`, `challenge_response`, `representation_experience`, `representation_details`, `leadership_experience`, `motivation`, `cv_upload`, `supporting_documents`, `deleted_at`, `created_at`, `updated_at`) VALUES
(32, 1204, 'I am most passionate about:\n\nSDG 5: Gender Equality\n\nSDG 13: Climate Action\n\nSDG 8: Decent Work and Economic Growth\n\nThese goals align closely with the Commonwealth’s commitment to empowering young people, promoting equality, and ensuring sustainable development. SDG 5 reflects the Commonwealth’s priority on inclusivity and youth-led gender advocacy. SDG 13 speaks directly to youth mobilization on climate action a major theme in recent Commonwealth youth forums. Lastly, SDG 8 emphasizes youth entrepreneurship and innovation, which the Commonwealth supports through programs aimed at economic empowerment.', 'One of the biggest challenges facing the youth in Eswatini is limited access to meaningful employment and entrepreneurial support. Many young people have the passion and ideas but lack resources, mentorship, and exposure. At the Commonwealth level, I would advocate for:\n\nPartnerships that provide skills training and mentorship\n\nFunding and exchange opportunities for youth-led startups\n\nI would also lobby for Commonwealth youth grants and innovation hubs to be extended to underserved areas of Eswatini', '0', NULL, 'While I do not have formal leadership or advocacy experience yet, I am currently a committed member of a student-led sustainable development club called Eco Pioneer recently formed at the university of Eswatini luyengo campus. Through this, I’ve taken part in discussions and activities focused on environmental awareness, and I’m learning how young people can make a difference in their communities.\nThis experience has motivated me to become more active in youth development and climate action.', 'I may be new to youth engagement work, but I am passionate, open-minded, and eager to represent the unheard voices of many young people like me. I bring the perspective of a young person who is still learning, still growing and fully committed to making a difference.\nIf given the opportunity, I would work hard to represent Eswatini with honesty and passion, while also gaining knowledge and building networks that I can bring back to benefit other youth in my country.', '[\"cvc-applications\\/cvs\\/inbound5500636816879063936.pdf\"]', '[]', NULL, '2025-07-19 11:25:03', '2025-07-19 11:25:03'),
(4, 461, '1. Leadership is one major that is influential to the society and I want to influence the society positively.\n2. Being a voice for the voiceless is in my wish list and alot globally are not able to voice out their concerns and I believe one day I will be their voice\n3. Grabbing opportunities is my wish that everyone can without being in doubt.', 'Unemployment in the country is the main problem amd I believe Commonwealth can provide resources that the youth can use to lower the Unemployment rate. Lack of vocational institutions is also the problem in the country and blocking the youth into showing their skills ', '1', NULL, 'I am an aspiring teacher and focusing more in teenagers and I have influenced them in show casing their skills and talents since they can be used in their livelihood and earn a living through them', 'I want to be the voice for the voice less and further influence the society which is very important in nowadays and I believe being chosen will help the society because I will come back and be a vessel that will pour into others', '[\"cvc-applications\\/cvs\\/Screenshot_20250715_110613_Resume Maker.jpg\"]', '[\"cvc-applications\\/supporting\\/202100818-8.pdf\"]', NULL, '2025-07-18 20:08:50', '2025-07-18 20:08:50'),
(5, 1139, 'SDG 5 – Gender Equality\n\nWhy I’m passionate:\nI believe that equal rights, safety, and opportunities for all genders—especially for women and LGBTQI+ individuals—are fundamental to building a just society. Many people still face discrimination and violence simply because of who they are.\n', 'Biggest Challenge: Youth Unemployment and Limited Opportunities\n\nOne of the most pressing challenges facing the youth of Eswatini is high unemployment and limited access to meaningful opportunities—especially in rural areas. Despite being educated and ambitious, many young people struggle to find jobs, start businesses, or access platforms where their voices are heard. This often leads to frustration, poverty, migration, and even mental health struggles.\n', '1', ' I have actively participated in youth-led initiatives focused on empowering marginalized groups, especially the LGBTQI+ community and young women in Eswatini. Through workshops, awareness campaigns, and school outreach programs, I’ve helped raise awareness about gender-based violence, mental health, and inclusive education.\n', 'I have actively participated in youth-led initiatives focused on empowering marginalized groups, especially the LGBTQI+ community and young women in Eswatini. Through workshops, awareness campaigns, and school outreach programs, I’ve helped raise awareness about gender-based violence, mental health, and inclusive education.\n', 'I believe I should be chosen to represent Eswatini at the Commonwealth Youth Council because I am deeply committed to advocating for inclusive, youth-led change that reflects the real needs of young people in my country. I bring a strong voice grounded in lived experience—particularly in areas like gender equality, mental health, unemployment, and the rights of marginalized groups, including the LGBTQI+ community.\n\nI have a passion for community engagement, the drive to lead, and the empathy to listen. My background in youth advocacy has taught me how to speak with both grassroots communities and decision-makers, bridging the gap between policy and reality. I am not only ready to represent Eswatini’s youth at an international level, but I am also prepared to bring back knowledge, networks, and opportunities that benefit others.\n\nBeing part of the Commonwealth Youth Council would allow me to contribute meaningfully to regional collaboration, propose solutions, and ensure that Eswatini’s youth voices are heard, respected, and acted upon.', '[\"cvc-applications\\/cvs\\/inbound3673723991022646021.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound5163340581781549706.jpg\"]', NULL, '2025-07-18 20:19:12', '2025-07-18 20:19:12'),
(6, 1140, 'Climate action \nZero hunger\nReduced inequality \n', 'The biggest challenge faced by the youth of Eswatini is a lack of opportunities to funding and employment. I would advocate for inclusiveness and equality at Commonwealth level.', '1', NULL, 'I have functioned as a lay leader to young and interested farmers, advocating that they partake in crop and vegetable production. I have been able to inspire dozens of aspiring farmers partake in agriculture and entrepreneurship.', 'I have tonnes of entreprenial experience; I have been a gadgets dealer and farmer over the past five years, this experience and advise could prove valuable to young propective farmers and entrepreneurs. I have worked at the largest agricultural firm in the kingdom of Eswatini both as an intern and a general labour; I am aware of the difficulty to make it up the ladder especially as a young person. Having grown without my parents and fending of for myself most of my youth years: I believe I am relatable to a majority of the youth.', '[\"cvc-applications\\/cvs\\/Classic cv-2.pdf\"]', '[]', NULL, '2025-07-18 20:26:51', '2025-07-18 20:26:51'),
(7, 699, '1. Good health and Well being Goal\n2. Quality Education Goal\n3. Gender equality Goal\n\nThese SDGs align well with the Commonwealth mandate as with Good heath there is better social development and Quality education helps in economic development as one can be able to develop one’s self with a well educated mind. For example with quality education one will be able to make wiser decisions in terms on developing their own self.\nThen lastly gender equality, in terms of political development everyone is equal and their voices matter no matter the gender.', 'The biggest challenge that there youth is facing is unemployment.\nI would advocate for change through educating the youth. Quality education does not mean expensive education instead for me it means necessary training and skills to help one make better and wiser decisions.\nHow so? In this case I would educate the youth to shift their focus more on what they can and are capable of doing. Find and know your skill then put your focus on it, grow in it than putting your mind on what you can learn and know but not help you in the future.', '1', NULL, 'I have recently been appointed as a youth representative in my local Inkhundla. ', 'I am a young passionate, goal driven, committed and very active young lady always ready to learn new skills and develop in them.\nI am very flexible in terms of moving from one place to another serving my purpose. I am sociable and friendly which is a great quality when working or representing the youth as they need to voice their concerns to someone of that calibre.\nLastly, I do my best when it comes to public speaking. Respect and honesty are my principles.', '[\"cvc-applications\\/cvs\\/Buhle CV.docx\"]', '[\"cvc-applications\\/supporting\\/Screenshot 2025-07-16 at 12.43.37.png\"]', NULL, '2025-07-18 20:27:11', '2025-07-18 20:27:11'),
(8, 1150, 'Climate Action\nDecent Work and economic growth \nQuality Education ', 'High Youth unemployment and limited economic opportunities \nI can advocate by raising Eswatini’s youth voices internationally \nChampion youth centered economic policies \nAs well as build partnerships for local impact', '1', 'As a youth leader, I have led several community-based initiatives focused on education, climate awareness, and youth empowerment. I served as a communicationspersonnel for Sisonke Green Movement, where I mobilized volunteers, and engaged with local stakeholders to implement impactful programs. My leadership style is collaborative and inclusive, and I am passionate about creating platforms where young voices drive change.', 'As a youth leader, I have led several community-based initiatives focused on education, climate awareness, and youth empowerment. I served as communication person, where I mobilized volunteers, and engaged with local stakeholders to implement impactful programs. My leadership style is collaborative and inclusive, and I am passionate about creating platforms where young voices drive change.\n', 'I believe I should be chosen to represent Eswatini at the Commonwealth Youth Council because I am deeply committed to amplifying the voices of young people and driving solutions to the challenges we face—particularly unemployment, education gaps, and climate vulnerability. I bring leadership experience, a strong understanding of youth policy, and a passion for inclusive development. I will work to ensure Eswatini’s youth priorities are heard at the global level, while also bringing back opportunities, partnerships, and practical solutions that benefit young people at home.', '[\"cvc-applications\\/cvs\\/inbound2440132896671307912.docx\"]', '[]', NULL, '2025-07-18 21:04:50', '2025-07-18 21:04:50'),
(9, 1151, '1. Quality education- commonwealth seeks to empower the youth with Quality education with necessary and updated skills to minimise the unemployment.\n2. Industry innovation and infrastructure- Commonwealth also seeks to help the youth to get into the digital space to be able to be creative and innovative.\n3. Gender Equality- Males opportunities should be equal to those of women, no gender is superior to the other.', 'The quality of education is the biggest challenge we facing as a youth in Eswatini. It is currently very poor, no enough practical lessons, no creativity and innovation subjects in schools, no enough gadgets for digital space, the list is endless. I would advocate for the introduction of more practical lessons from primary to secondary till tertiary and a must have enough digital tools in all schools and entrepreneurship programmes and subject from primary to tertiary level ', '1', NULL, 'Transformational leadership- I believe in turning followers into great leaders that will do better than what I have accomplished.', 'Because I am passionate about the welfare of our youth and I would really love to see a change to minimise poverty and the rate of unemployment. Rather than creating employees for a change let us create creative and innovative individuals who will create jobs for many.', '[\"cvc-applications\\/cvs\\/inbound4025075024067104245.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound1355600571126293530.pdf\"]', NULL, '2025-07-18 21:12:16', '2025-07-18 21:12:16'),
(10, 656, '1.GENDER EQUALITY \nI am passionate about advocating for elimination of GBV among our youth.Commonwealth aligns by promoting the full participation of women in everything that affects life ensuring that their rights are protected.\n\n2.GOOD HEALTH AND WELL BEING \nI am passionate about promoting youth friendly health services.Commonwealth aligns by building accessible health systems and ensuring that all people have access to essential health services.\n\n3.QUALITY EDUCATION \nI have always been passionate about peer education and commonwealth concentrates on fair education,youth empowerment and skills development.', 'Having seen the challenges our youth is facing in the country which includes high teenage pregnancy I can advocate for change by using data to highlight the issue creating urgency making issue to be noticed and dealt with.Moreover ,I can advocate for comprehensive sexual education in school through policies and engaging other stakeholders.Lastly ,I can empower youth voices by organising peer led campaigns and dialogues.', '1', NULL, 'I began as a mentor with SWAGAA, guiding young girls through personal and social challenges. I then worked as a Change Agent with Save the Children, advocating for safer communities and youth development. From 2022 to 2024, I served as a Peer Navigator with Georgetown University, leading health education sessions on SRHR. Currently, I am a SAM4SRHR Champion with SAfAIDS, where I advocate for youth-friendly health services, gender equality, and the rights of young people in Eswatini. Through these roles, I’ve led peer engagements, community dialogues, and awareness campaigns, making sure youth voices are heard and included in decision making process.It has been an amazing journey  and I have learnt a lot when it comes to advocacy and I believe I am a valuable asset when it comes to  any programs focused on improving the lives of our youth', 'I believe I should be chosen to represent Eswatini at the Commonwealth Youth Council because of my  experience of working directly with young people in rural communities, especially girls and young women. My roles as a mentor with SWAGAA, a change agent with Save the Children, a peer navigator with Georgetown University, and currently as a SRH champion with SAfAIDS shows my commitment to youth empowerment, gender equality, and health education.\n\nThroughout my journey, I have gained  insight into the challenges facing Eswatini\'s youth, including teenage pregnancy,HIV prevalence rates among our youth,access to education, sexual and reproductive health services, and gender based violence. I have led peer sessions, mentored girls, and engaged with stakeholders to promote inclusive, youth driven solutions. These experiences have equipped me with leadership, communication, and advocacy skills that are essential for meaningful representation at a regional level.\n\nI am eager to use my voice and experience to inspire change to the youth in our country and communities.', '[\"cvc-applications\\/cvs\\/Bikwaphi Silela_CV (2).pdf\"]', '[\"cvc-applications\\/supporting\\/in collaboration with.pdf\"]', NULL, '2025-07-18 21:18:05', '2025-07-18 21:18:05'),
(11, 648, '1. SDG 4: Quality Education: Education is a fundamental right and a key driver of social and economic development. I am passionate about ensuring inclusive and equitable quality education for all.\nAlignment: The Commonwealth promotes education as a means to empower individuals and communities, fostering a more educated populace that can contribute to democratic governance and sustainable development.\n2. DG 5: Gender Equality: Achieving gender equality is essential for creating a just society. I am committed to advocating for women\'s rights and empowering girls.\nAlignment: The Commonwealth emphasizes gender equality and women\'s empowerment as crucial for sustainable development, recognizing that inclusive societies are more resilient and prosperous.\n3. SDG 13: Climate Action: Addressing climate change is imperative for future generations. I am dedicated to promoting sustainable practices and policies to mitigate its effects.\nAlignment: The Commonwealth focuses on climate resilience, particularly in small island developing states, and supports collective action to combat climate change, aligning with global efforts to protect the environment.\nThese SDGs not only reflect personal passions but also resonate deeply with the Commonwealth\'s goals of promoting peace, democracy, and sustainable development across member states.', 'The biggest challenge facing the youth of Eswatini is high unemployment, particularly among young graduates. This situation is exacerbated by limited job opportunities, skills mismatch, and economic instability. Advocate for the establishment of programs to enhance vocational training and entrepreneurship among youth.\nAction: Collaborate with Commonwealth member states to share best practices and develop targeted initiatives that focus on job creation and skill. ', '1', 'Yes, I have represented youth at local level, I served as a youth representative on a community council, where I advocated for programs addressing youth unemployment and education. I organized forums that allowed local youth to voice their concerns and needs, ensuring their perspectives were considered in community planning.\n', 'I have gained valuable leadership and advocacy experience through various roles and initiatives:\n1. Youth Community Organizer:\nI organized community workshops focused on youth empowerment, facilitating discussions on education, employment, and mental health. This role honed my skills in mobilizing young people and fostering a sense of community.\n2. Leadership in Student Organizations: As a leader in student organizations at my institution, I coordinated events and initiatives aimed at enhancing student engagement and fostering a supportive environment. This experience taught me the importance of teamwork and effective communication.\nThrough these experiences, I have developed a strong foundation in leadership and advocacy, equipping me to effectively represent and champion the interests of youth in Eswatini.', 'I believe I should be chosen to represent Eswatini at the Commonwealth Youth Council for several key reasons:\n1. Passion for Youth Empowerment:\nI am deeply committed to advocating for the rights and needs of young people in Eswatini. My passion drives me to work tirelessly for initiatives that promote education, employment, and social inclusion.\n2. Understanding of Local Challenges: Having firsthand experience with the challenges facing our youth, including unemployment and limited access to resources, I can bring valuable insights to the Commonwealth discussions. My understanding of these issues enables me to represent the voices of young people effectively.\n3. Strong Communication Skills: I possess strong communication and interpersonal skills, which are essential for engaging with diverse stakeholders. I can articulate the needs of Eswatini\'s youth clearly and advocate for actionable solutions at the Commonwealth level.\n4. Commitment to Collaboration:\nI believe in the power of collaboration and partnership. By working with other youth leaders in the Commonwealth, I can foster shared initiatives and innovative solutions that benefit our communities.\nIn conclusion, my passion, understanding of local issues, communication skills, commitment to collaboration, and vision for change make me a strong candidate to effectively represent Eswatini at the Commonwealth Youth Council.', '[\"cvc-applications\\/cvs\\/Nosipho Application (1).pdf\",\"cvc-applications\\/cvs\\/inbound6040381363343313857.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound6774661536794031659.pdf\",\"cvc-applications\\/supporting\\/inbound6546116595371026650.pdf\",\"cvc-applications\\/supporting\\/inbound7912219807872652087.pdf\"]', NULL, '2025-07-18 21:19:58', '2025-07-18 22:00:09'),
(12, 899, 'Good Health and Well-being (SDG 3)\n\nEducation and Skills Development (SDG 4)\n\nPeace, Justice, and Strong Institutions (SDG 16)', 'Youth unemployment in Eswatini is a serious and growing challenge. A large percentage of young people, especially those aged 18–35, struggle to find formal employment. This is driven by:\n\nA mismatch between skills and job market needs: Many graduates lack skills required in high-demand sectors like ICT, green economy, or technical trades.\n\nLimited job opportunities: The formal economy is small, and job creation is slow, especially in rural areas.\n\nDependence on the informal sector: Many young people turn to informal work, which is often unstable and low-paying.\n\n\nThis situation increases social risks like poverty, crime, and mental health issues. Addressing it requires investment in education, skills development, entrepreneurship support, and youth-friendly employment policies.', '1', NULL, 'I actively represented young people in Eswatini across national and regional platforms. I participated in the ECSA Ministerial Conference in Zambia alongside key national leaders, voicing youth leadership concerns. During the World AIDS Day commemoration in Shiselweni, i delivered a youth call to action focused on closing gaps in universal access to sexual and reproductive health services. Through the Global Fund’s Her Voice Fund, i presented at ICASA 2023 in Zimbabwe, highlighting youth engagement in decision-making through the CCM. Additionally, she\n\n\nI contributed to the Local Government workshop at Sibayeni Lodge, advocating for young people’s involvement via the National Youth Council.', 'I believe I should be chosen to be part of the Commonwealth Youth initiatives because I have demonstrated consistent leadership and advocacy representing young people in Eswatini at both national and regional levels. I have had the opportunity to voice youth priorities during high-level platforms such as the ECSA Ministerial Conference in Zambia, where I spoke alongside national leaders on youth leadership issues. I also delivered a call to action during the World AIDS Day commemoration in Shiselweni, advocating for the closing of gaps in access to sexual and reproductive health services for young people. Through the Global Fund’s Her Voice Fund, I presented at ICASA 2023 in Zimbabwe, sharing how young people in Eswatini are actively involved in decision-making processes through the CCM.\n\nMy experience engaging with local government structures through the National Youth Council has strengthened my ability to advocate for inclusive governance. I am confident that my background, skills, and passion for youth development would make a meaningful contribution to the Commonwealth Youth platforms.', '[\"cvc-applications\\/cvs\\/inbound5897598017193021527.docx\"]', '[\"cvc-applications\\/supporting\\/inbound1952725946721086456.jpg\",\"cvc-applications\\/supporting\\/inbound5482361118844582603.pdf\",\"cvc-applications\\/supporting\\/inbound3711662983156314985.pdf\",\"cvc-applications\\/supporting\\/inbound2450181670684155735.pdf\",\"cvc-applications\\/supporting\\/inbound8899229505663674848.jpg\"]', NULL, '2025-07-18 21:25:29', '2025-07-18 21:25:29'),
(13, 871, '1. SDG 4: Quality Education\nI believe education is the most powerful tool to transform individuals, communities, and nations. My background as a student-teacher and my experience as an SRHR (Sexual and Reproductive Health and Rights) advocate have allowed me to work directly with young people, helping them access inclusive and equitable learning opportunities. This directly aligns with the Commonwealth\'s commitment to promoting education for all, especially marginalized youth, by encouraging digital innovation, inclusivity, and lifelong learning.\n\n2. SDG 5: Gender Equality\nGender equality is not just a human right—it is a foundation for a peaceful, prosperous, and sustainable world. As an advocate under the Her Voice Project with SAFAIDS, I have been actively involved in promoting gender-responsive education, challenging harmful norms, and supporting young girls and women to speak up and claim their space. This aligns with the Commonwealth\'s efforts to advance gender equality and empower women and girls through policy advocacy, youth engagement, and capacity building across its member countries.\n\n3. SDG 3: Good Health and Well-being\nHealthy youth are productive youth. Through my SRHR work, I have promoted access to reproductive health information and services among adolescents, helping them make informed decisions about their bodies and futures. This aligns with the Commonwealth\'s mandate to promote health and well-being, especially for vulnerable populations, by supporting youth-led solutions and integrating health education into community and school programs.', 'One of the biggest challenges facing the youth of Eswatini today is unemployment and lack of meaningful economic opportunities. Despite being educated and full of potential, many young people are unable to access decent jobs or create sustainable livelihoods. This has led to a sense of hopelessness, increased poverty, mental health issues, and in some cases, risky behaviors such as crime or early marriages, particularly among vulnerable groups like young women.\n\nThis challenge is made worse by limited access to skills training, entrepreneurship support, digital inclusion, and platforms where youth voices are meaningfully heard in national policy-making.\n\nAs a young leader passionate about youth empowerment, I would use the Commonwealth platform to:\n\nAmplify the voices of Eswatini youth by participating in youth-led dialogues, presenting lived experiences, and advocating for inclusive policies that support employment, skills development, and innovation.\n\nPush for increased investment in youth entrepreneurship by encouraging the Commonwealth and its partners to support incubators, digital training programs, and funding opportunities that are accessible to rural and urban youth alike.\n\nPromote skills development aligned with 21st-century needs, such as green jobs, tech-based skills, and creative industries, by sharing successful grassroots initiatives that can be scaled up.\n\nEncourage youth-led accountability, ensuring young people are meaningfully included in policy design, implementation, and monitoring at both national and Commonwealth levels.\n\nUltimately, addressing youth unemployment in Eswatini requires both local action and international collaboration. By being a proactive youth advocate within the Commonwealth framework, I aim to bridge the gap between policy and reality—and champion solutions that create long-term, youth-centered change.', '1', 'I have actively represented the youth through various platforms, especially in my role as an SRHR (Sexual and Reproductive Health and Rights) advocate under the Her Voice Project with SAFAIDS. In this position, I worked closely with young people in schools and communities, facilitating sessions on topics such as HIV prevention, menstrual health, gender-based violence, and access to youth-friendly health services. I created safe spaces where young people could express themselves, learn about their rights, and gain confidence to make informed decisions about their health.\n\nAs part of this advocacy, I also engaged with key stakeholders and policymakers during national SRHR forums and youth dialogues. I represented the voices of young people, highlighting the challenges they face and advocating for inclusive, youth-centered policies and better health service delivery. My contributions focused on ensuring that the needs of adolescents, especially girls, are addressed in national strategies.\n\nIn addition to my advocacy work, I completed a teaching internship at a local high school, where I mentored and supported students both academically and socially. I used this opportunity to integrate SRHR education into my interactions with learners, encouraging discussions around self-esteem, goal setting, and leadership. My role in the school environment allowed me to better understand the lived realities of young people and to advocate for their needs from an informed perspective.\n\nI also participated in youth development conferences hosted by the Eswatini National Youth Council, where I collaborated with fellow youth leaders and engaged in national conversations about development, empowerment, and policy reform. These experiences have strengthened my ability to represent young people meaningfully and work toward lasting change.', 'I have strong leadership and advocacy experience, particularly in youth empowerment and community engagement. I served as an SRHR advocate under the Her Voice Project with SAFAIDS, where I led awareness campaigns, facilitated peer education sessions, and collaborated with local leaders to address issues affecting young people, such as gender-based violence and access to sexual health services. I also took on a leadership role during my internship as a high school teacher, where I mentored learners, organized extracurricular activities, and promoted positive behavior change. These experiences have equipped me with skills in communication, teamwork, and mobilizing youth for social impact.', 'I should be chosen to represent Eswatini at the Commonwealth Youth Council because I am a passionate, committed, and action-driven young leader who understands the challenges faced by the youth in our country and is ready to be their voice on a global platform. My experience as an SRHR advocate under the Her Voice Project with SAFAIDS has allowed me to engage with young people at the grassroots level, promoting health rights, gender equality, and mindset change. Additionally, my background as a student-teacher has given me firsthand insight into the educational and socio-economic barriers affecting youth development.\n\nI possess the leadership skills, communication ability, and sense of responsibility needed to represent Eswatini effectively. I believe in inclusive development and I am committed to advancing the Sustainable Development Goals (SDGs), especially those related to quality education, gender equality, and youth employment. Representing Eswatini is not just an opportunity for me, but a responsibility I take seriously—to bring forward the stories, aspirations, and solutions of our youth to the Commonwealth stage and ensure they are included in decisions that affect their future.\n\nMoreover, participating in youth development conferences hosted by the Eswatini National Youth Council significantly broadened my exposure to national youth issues and equipped me with strategic advocacy tools. These platforms allowed me to collaborate with other passionate young leaders, learn from policy influencers, and understand how national development aligns with youth empowerment. It also reinforced my belief that mindset change must be rooted in a collective vision that promotes inclusion, innovation, and resilience.', '[\"cvc-applications\\/cvs\\/inbound3384158901504156483.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound5682297355620799767.pdf\"]', NULL, '2025-07-18 21:34:10', '2025-07-18 21:34:10'),
(14, 512, 'SDG 4: Quality education \nThe commonwealth advocates for quality education and skills development among young people across the Commonwealth. They recognise education as a fundamental right and a crucial tool for empowering youth to become active citizens and contribute to national development.\nSDG 8: Decent Work & Economic growth \nThe commonwealth takes this SDG as one of their core pillars, youth economic empowerment. They actively speak for policies and programs that create opportunities for decent work, foster entrepreneurship and address youth unemployment. They also promote innovation and skills development that are in demand, particularly in emerging sectors.\nSDG 3: Good Health and Wellbeing \nThe Commonwealth prioritises a holistic - well being of young people including physical, mental and social health. Crucially, the CYC put an emphasis on mental health awareness and support. To destigmatize mental health issues and ensure young people have appropriate access to care.', 'The biggest challenge that the youth of Eswatini is facing is based on unemployment. They have difficulties in practicing structured financial planning and the risk of post-graduate poverty due to lack of savings habits. In addition, this leads to: 1. Violence Exposure: A staggering 79% of children aged 1-14 have experienced physical violence, which significantly impacts their development, cognitive ability, and academic performance, leading to low self-esteem, emotional distress, and depression. Violence is also a driver of HIV/AIDS, exacerbating mental health challenges.\n\n2. Substance Abuse: There\'s a strong correlation between unemployment, inactivity, and engagement in drug and alcohol abuse as coping mechanisms. This further deteriorates mental well-being. A significant cause of poor mental health among youth is the high rate of unemployment. 47% of youth (15-24 years) are unemployed, and this lack of economic prospects, recreational facilities, and support systems leads to feelings of worthlessness, lack of purpose, and engagement in risky behaviors.', '1', 'My first experience was last year (2024) in my previous high School Vulamasango High School as a Motivational speaker to both students and parents.\nThe other situation was this year\'s Career Expo in both the Shiselweni Region and Mbabane as an Enactus Ambassador from Eswatini College of Technology.', '1. Motivational speaking: engaged in a position of influence and guidance for young people where I shared my experience, gave insights and shared a vision for their potential in my previous high school.\n2. \nIntroducing Enactus Eswatini to high School students during this year\'s Career Expo.', 'My compelling reasons to be chosen to represent Eswatini at Commonwealth Youth Council are:\n1. Lived Experience and Resilience: my personal journey including being without a family, past substance abuser, and admission to a juvenile facility showcases immense resilience and deep understanding of the vulnerabilities and challenges faced by a significant portion of Eswatini\'s youth. This lived experience provides an authentic and powerful voice that resonates with the Commonwealth Youth Council\'s focus on inclusivity and support for marginalized communities. In addition, I am currently studying for a National Diploma in Electrical and Electronics engineering from Eswatini College of Technology and I have a strong belief in entrepreneurship. I am willing to leverage my experience in addressing structured financial planning and the risk of post-graduate poverty. Last but not least, my experience in past substance use and subsequent recovery positions me as an impactful advocate especially for youth who may lack family support.', '[\"cvc-applications\\/cvs\\/inbound7344495849040683264.pdf\"]', '[\"cvc-applications\\/supporting\\/Lungelo Goodman Ngwenya.pdf\"]', NULL, '2025-07-18 21:40:56', '2025-07-19 05:21:31'),
(15, 1158, '1️⃣ SDG 4: Quality Education\n\nI believe that education is the foundation for empowerment, innovation, and long-term social transformation. As an educator, I’ve seen firsthand how equitable, inclusive, and relevant education can unlock the potential of young people. My commitment to SDG 4 aligns with the Commonwealth’s emphasis on building knowledge-based societies where youth have the skills and capacity to contribute meaningfully to their communities and the global economy.\n\n⸻\n\n2️⃣ SDG 8: Decent Work and Economic Growth\n\nYouth unemployment remains a major challenge in Eswatini and across many Commonwealth nations. I am passionate about advocating for entrepreneurship, digital skills, and vocational training programs that prepare young people for the future of work. This supports the Commonwealth’s agenda to promote economic empowerment and opportunities for all, especially for marginalized and underrepresented youth.\n\n⸻\n\n3️⃣ SDG 13: Climate Action\n\nYoung people have a critical role to play in addressing the climate crisis. I am committed to climate education and mobilizing youth-led action to build resilient, sustainable communities. The Commonwealth has been a strong voice in climate negotiations, and through platforms like the Commonwealth Youth Council, we can drive greater awareness, accountability, and climate justice efforts from the grassroots up.\n', 'One of the biggest challenges facing the youth of Eswatini is youth unemployment and lack of economic opportunities. Despite being educated and motivated, many young people struggle to find meaningful work or support to start their own businesses. This has contributed to feelings of hopelessness, underutilization of talent, and rising social issues such as substance abuse and poverty.\n\nTo advocate for change at the Commonwealth level, I would:\n\n✅ 1. Amplify Youth Voices\n\nI would ensure that the real experiences and stories of Eswatini’s youth are heard on global platforms. By engaging in Commonwealth forums, policy dialogues, and youth summits, I will represent their needs and propose actionable solutions such as support for youth entrepreneurship, innovation hubs, and skills development initiatives.\n\n✅ 2. Push for Investment in Skills Development\n\nI will lobby for increased Commonwealth support for TVET (Technical and Vocational Education and Training), digital literacy, and future-ready skills programs. These can bridge the gap between education and employment, especially in under-resourced areas.\n\n✅ 3. Advocate for Equitable Funding & Partnerships\n\nI will advocate for the establishment of youth innovation funds and start-up incubators through Commonwealth networks. These platforms can provide financial and mentorship support to young entrepreneurs in Eswatini and other developing nations.\n✅ 4. Promote Regional Collaboration\n\nBy building partnerships between Eswatini and other Commonwealth youth councils, I will promote the sharing of best practices in tackling unemployment, such as youth cooperatives, social enterprises, and sustainable community projects.\nConclusion:\nThrough active advocacy, collaborative dialogue, and evidence-based proposals, I am committed to turning youth challenges into opportunities for sustainable growth and empowerment—not just for Eswatini, but for all Commonwealth nations facing similar struggles.', '1', NULL, 'As a youth leader at my church, I have had the opportunity to guide, mentor, and inspire fellow young people through both spiritual and practical development. I’ve led youth meetings, organized community outreach programs, and facilitated workshops on life skills, values, and leadership.\n\nThrough this role, I’ve advocated for the inclusion of youth voices in church decision-making and promoted positive youth engagement by encouraging service, responsibility, and unity. This experience has strengthened my communication, organization, and teamwork skills, and has given me a solid foundation in values-based leadership that I now seek to extend to national and international platforms.', 'I believe I should be chosen to represent Eswatini at the Commonwealth Youth Council because I am a committed, solutions-driven young leader who is passionate about advancing the voice, rights, and development of youth at both national and international levels.\n\nAs a youth from Eswatini, I understand the unique challenges our generation faces—ranging from unemployment and limited access to opportunities, to mental health struggles and lack of representation in key decision-making spaces. Through my academic background, leadership experience, and community involvement, I have consistently worked to empower others by promoting education, dialogue, and meaningful engagement.\n\nWhat sets me apart is my ability to listen, collaborate, and advocate with purpose. I am fluent in English, confident in policy engagement, and experienced in youth development work. I also value teamwork and inclusion, which are essential traits for representing a diverse nation like Eswatini on a global platform.\n\nIf chosen, I will not only be a voice for Eswatini’s youth but also a bridge—connecting grassroots realities to global conversations. I will bring fresh ideas, a strong sense of responsibility, and an unwavering commitment to promoting positive, lasting change for young people in the Kingdom and beyond.', '[\"cvc-applications\\/cvs\\/hlony cvvvvvv.docx\"]', '[\"cvc-applications\\/supporting\\/WhatsApp Image 2025-07-18 at 19.00.39_159571f7.jpg\"]', NULL, '2025-07-18 21:46:16', '2025-07-18 21:46:16'),
(16, 119, 'There are passionate about ensuring a healthy life and promoting well being for all ages  because they are concerned of fighting against poverty ', 'The big challenge that we are facing as youth is jobless , most of young people have studied and have certificates but there is no opportunities where can be employed ', '1', NULL, 'I was leading in my community the sakha kwetfu society club we used to help  young people at school who are not able to meet there basic needs, those they lost their family and the elders by take care of them ', 'Am a young strong child of God, who knows that as we are young we are the bright future of the Country. Am a young business man that can encourage a lot of young people that can achieve their goals by starting there own business rather than waiting to be employed ', '[\"cvc-applications\\/cvs\\/inbound1279704331044757853.jpg\"]', '[\"cvc-applications\\/supporting\\/inbound2829487729620216059.jpg\",\"cvc-applications\\/supporting\\/inbound417919579940811254.jpg\"]', NULL, '2025-07-18 21:47:56', '2025-07-18 21:47:56'),
(17, 1164, 'My top 3 SDGs are SDG number 3-good health and well being, 4- quality education and 13- climate change. These SGDs align to the commonwealth mandate largely because the main values of the Commonwealth include emphasizing social inclusion and environmental sustainability. A nation that acquires quality education and good health is a thriving one especially if all will have access to these regardless of who they are and where they come from, this speaks to social inclusion. With environmental sustainability, with the surge of climate changes that is happening, both the SDGs and the Commonwealth share a common goal which is to make our environment sustainable and safer for all to live in.', 'The biggest challenge the youth of Eswatini is facing is the issue of unemployment and the lack of opportunities. The best way I can advocate for change at Commonwealth level is by advocating for the partnership with youth led organizations and engaging with them, this will not only promote participation among youth but it will also allow stakeholders to get the problems and solutions directly from the sources which are the youth. I can also advocate for leveraging the Commonwealth Charter values and participate in initiatives that that focus on youth employment.', '1', NULL, 'I had the pleasure of being a member of the UNICEF youth advisory board. The main objective of the board was to advise UNICEF on how best to handle the issues that are affecting the youth. Attending events like the Day Of The African Child and The International Day of the child opened my eyes to the horrors that children go through out there. This was an opportunity for us as the board to be a voice for the voiceless children out there and making sure their needs are heard and taken care of.', 'I believe I should be chosen to represent Eswatini at The Commonwealth Youth Council because of the passion I have for the advancement of the lives of young people. This passion is what drives me to be able to speak up for the youth. I also believe that by improving the lives of young people it\'s not only them that benefit but the country at large, young people no longer the \"future\" of the country but the \"now\" of our country.', '[\"cvc-applications\\/cvs\\/inbound7690826227008117886.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound4039934694057819191.pdf\"]', NULL, '2025-07-18 23:06:54', '2025-07-18 23:06:54'),
(18, 755, '1 Ending poverty in all its forms everywhere\n2 Zero hunger for all and improved nutrition while adopting sustainable agricultural practices\n8 Decent work and economic growth   for all', 'Unemployment is the biggest challenge.\nOpportunities like skills training and provision of start up kits for all skilled youth can help alleviate the impact of unemployment.\nIndustrialization of Eswatini production for mass production and selling to international market can also help Eswatini Youth.', '1', NULL, 'I have not represented the youth yet but I look forward to this opportunity since I have had experience working with the youth instructing them at a Vocational Skills Training Centre.', 'Being a Swati youth from the countryside I have experienced most of the difficulties of the country\'s youth hence I believe I can represent the country very well since I have a clear understanding of the roots of our problems and can modify well a route to relevant solutions.', '[\"cvc-applications\\/cvs\\/inbound5252278668367209300.docx\"]', '[\"cvc-applications\\/supporting\\/inbound3708798495815160399.pdf\"]', NULL, '2025-07-18 23:35:30', '2025-07-18 23:35:30'),
(19, 1154, '1. SDG 8. Decent Work and Economic Growth -this includes empowering unemployed youth in Eswatini to learn new skills and entrepreneurship to ensure job creation as  the Commonwealth  emphasizes youth development, education, and the sharing of knowledge  amongst its members \n2. SDG1. No poverty -By being an advocate for young people living in poverty for social protection and to make sure they are included in economic growth activities or projects.\n3. SDG16. Peace, Justice and Strong Institutions - by promoting active youth participation in decision making and global governance as it is the Commonwealth\'s mandate that every voice is heard.', 'The education system struggles to equip young people with market-relevant skills, contributing to skill mismatches and poor job prospects. I would advocate for the introduction of a curriculum in schools and universities that would meet the gap in the market and that young people are given a fair chance to start up big businesses', '1', NULL, 'For the past 2 years , I have represented young people in my community as an HIV prevention ambassador under a program that was offered by Mosaic to address barriers to  the use and update of HIV prevention measures amongst Adolescent Girls and Young Women in my community. I also participated in the Young African Leaders Initiative RCL-SA programme Cohort 19 under the Civic leadership programme which equipped me with advocacy and leadership skills.', 'I would champion youth livelihoods through advocating for entrepreneurship training and advocating for a change in the educationsystem in support of SDG 8 – Decent Work and Economic Growth. I will empower unemployed young people in Eswatini by lobbying for skills development, supporting startups, and strengthening economic inclusion.', '[\"cvc-applications\\/cvs\\/inbound8686388187863247451.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound4735327488738127972.pdf\",\"cvc-applications\\/supporting\\/inbound8663402976649790603.pdf\",\"cvc-applications\\/supporting\\/inbound4275272417726427673.pdf\",\"cvc-applications\\/supporting\\/inbound731495501400231346.pdf\",\"cvc-applications\\/supporting\\/inbound440435988152815898.pdf\",\"cvc-applications\\/supporting\\/inbound1194096172740306430.pdf\"]', NULL, '2025-07-18 23:42:36', '2025-07-18 23:42:36');
INSERT INTO `c_y_c_applications` (`id`, `participant_id`, `sdg_response`, `challenge_response`, `representation_experience`, `representation_details`, `leadership_experience`, `motivation`, `cv_upload`, `supporting_documents`, `deleted_at`, `created_at`, `updated_at`) VALUES
(20, 547, 'SDG 3 – Good Health and Well-being:\nI\'m passionate about mental health awareness and access to care, especially for young people. This supports the Commonwealth’s goal of building inclusive, healthy societies.\n\n2. SDG 4 – Quality Education:\nI believe in equal access to education as a tool for empowerment. My volunteer work in early learning aligns with the Commonwealth’s focus on youth development and learning.\n\n3. SDG 8 – Decent Work and Economic Growth:\nI support youth employment and rural entrepreneurship, which reflects the Commonwealth’s aim to create fair opportunities for all.', 'Youth in Eswatini face high unemployment and limited opportunities perpetuating poverty and mentalhealth problems. I would advocate at Commonwealth level by pushing for youth-focused relevant skills training, entrepreneurship support, and greater investment in youth-led initiatives.\n', '1', 'Yes. I have represented the youth at the local level through community outreach programs, afterschool activities, and health education initiatives. I have also facilitated health talks for young people, organized awareness campaigns, and volunteered with NGOs to support early childhood development, these efforts gave youth a voice on issues affecting them, especially around mental health and education.\n\n', 'I’ve led afterschool programs, facilitated health talks, and taken part in community outreach focused on education, early childhood development, and mental health. These experiences have shaped my leadership and strengthened my advocacy for youth and community well-being.\n', 'I should be chosen because I’m deeply committed to youth development, mental health advocacy, and community empowerment. Through hands-on experience in outreach, afterschool programs, and health education, I’ve seen the challenges youth face and have actively worked to address them. I’m ready to represent Eswatini with purpose, passion, and a drive to create real change at Commonwealth level.', '[\"cvc-applications\\/cvs\\/inbound2814586612341088519.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound5942516768496686130.pdf\",\"cvc-applications\\/supporting\\/inbound3383033767298422694.pdf\"]', NULL, '2025-07-18 23:48:02', '2025-07-18 23:48:02'),
(21, 1179, 'SDG 4: Quality Education\nEducation is a fundamental right and a key driver of sustainable development. By advocating for equitable access to quality education, I align with the Commonwealth’s commitment to promoting inclusive education and lifelong learning opportunities for all. This goal empowers youth to acquire the skills necessary for meaningful participation in society.\n\nSDG 5: Gender Equality\nAchieving gender equality is essential for sustainable development and aligns with the Commonwealth’s focus on empowering women and girls. I am dedicated to advocating for equal rights and opportunities, ensuring that young women can fully participate in decision-making processes and leadership roles.\n\nSDG 13: Climate Action\nAddressing climate change is crucial for the future of our planet. This goal resonates with the Commonwealth’s commitment to environmental sustainability and resilience. I am passionate about mobilizing youth to engage in climate advocacy, promoting sustainable practices, and pushing for policies that mitigate climate impacts.', 'Youth Employment Initiatives: I would advocate for the establishment of programs that promote entrepreneurship and vocational training tailored to the needs of the local job market. By sharing successful models from other Commonwealth countries, we can create actionable frameworks for youth employment.\n\nPolicy Influence: Engaging with Commonwealth leaders to emphasize the importance of youth-focused policies that prioritize job creation, skills development, and mentorship programs. I would work to ensure that youth voices are included in policy discussions and decision-making processes.\n\nNetworking and Collaboration: Leveraging the Commonwealth platform to connect with other youth leaders and organizations that have successfully tackled similar challenges. This collaboration can lead to the exchange of ideas, resources, and best practices that can be adapted for Eswatini.\n\nAwareness Campaigns: Launching campaigns to raise awareness about the importance of youth employment and to mobilize support from government, private sector, and civil society to invest in youth development initiatives.', '1', NULL, 'Yes, I have represented youth at all three levels:\n\nLocal Level: I have actively participated in community-based initiatives in Eswatini, particularly through Lomahasha Youth, where I serve as a volunteer and advocate for youth involvement in climate action and sustainable development.\n\nNational Level: I was selected as a UNDP Student Ambassador in Eswatini, a role that involved engaging youth across the country in climate justice, innovation, and advocacy campaigns. I also collaborated with national stakeholders to amplify youth voices in sustainable development policies.\n\nInternational Level: I represented Eswatini in Kenya during a two-week Climate Justice and Advocacy training, where I worked with youth leaders from different African countries to build strategies for addressing climate-related challenges across the continent. Additionally, I am part of the ISO/TC 207 Young Leaders Group (YLG), contributing to international standards on environmental management from a youth perspective.', 'I should be chosen to represent Eswatini at the Commonwealth Youth Council because I am a passionate and committed youth leader who actively advocates for climate justice, youth empowerment, and sustainable development. My work at the local level with Lomahasha Youth and at the national level as a UNDP Student Ambassador has given me firsthand experience in mobilizing young people and engaging with policy-makers to ensure youth voices are heard in national dialogues.\n\nInternationally, I have represented Eswatini in Kenya during a Climate Justice and Advocacy training and I currently contribute to global discussions as a member of the ISO/TC 207 Young Leaders Group, focusing on environmental standards. These experiences have equipped me with strong leadership, advocacy, and intercultural communication skills.\n\nI am driven by a vision of an inclusive and resilient Eswatini where young people are recognized as key agents of change. Through the Commonwealth Youth Council, I will champion the priorities of Eswatini’s youth, build partnerships across the Commonwealth, and bring back practical solutions and opportunities that can empower youth at home.', '[\"cvc-applications\\/cvs\\/Phumlani Magagula ENYC CV.pdf\"]', '[\"cvc-applications\\/supporting\\/P. MAGAGULA - EGCSE (1) (1).pdf\",\"cvc-applications\\/supporting\\/Phumlani Magagula Uneswa Results.pdf\",\"cvc-applications\\/supporting\\/Phumlani_Magagula.docx (1).pdf\",\"cvc-applications\\/supporting\\/Phumlani Magagula.pdf\"]', NULL, '2025-07-18 23:50:15', '2025-07-18 23:50:15'),
(22, 794, 'I am particularly passionate about the following Sustainable Development Goals (SDGs):\n\n1. Quality Education - Ensuring inclusive and equitable quality education is vital for empowering youth. It aligns with the Commonwealth\'s commitment to education as a fundamental right and a catalyst for development.\n\n2.Decent Work and Economic Growth - Promoting sustained economic growth and full employment is crucial for addressing youth unemployment in Eswatini. The Commonwealth emphasizes economic development as key to fostering peace and prosperity among member states.\n\n3. Reduced Inequalities - Reducing inequality within and among countries is essential for creating a fair society where all youth have equal opportunities. The Commonwealth champions social justice and equality, making this goal particularly relevant.\n\nThese SDGs resonate with my advocacy efforts and align with the Commonwealth’s mandate to support sustainable development, social inclusion, and economic empowerment for young people.', 'The biggest challenge facing the youth of Eswatini is high unemployment and underemployment, which exacerbates social inequalities and limits opportunities for personal and professional growth. This issue is compounded by a lack of access to quality education and vocational training, which leaves many young people ill-equipped for the job market. \n\nTo advocate for change at the Commonwealth level, I would focus on creating partnerships between governments, educational institutions, and the private sector to develop comprehensive youth employment programs. This could include initiatives that promote entrepreneurship, enhance vocational training, and facilitate internships and apprenticeships. Additionally, I would work to raise awareness about the importance of youth participation in policy-making processes, ensuring that their voices are heard in discussions about economic development and employment strategies.', '1', 'Yes, I have represented the youth at both local and national levels. I served as the chairperson of the Tinkhundla Youth Association, where I acted as their voice in meetings with constituency leaders. In this role, I advocated for various youth issues, including unemployment, teenage pregnancy, and access to education. \n\nAdditionally, I participated in national youth forums where I engaged with policymakers and other stakeholders to discuss pressing issues affecting young people in Eswatini. Through these platforms, I was able to raise awareness about the challenges faced by youth and propose actionable solutions to address them. My involvement has allowed me to build networks and collaborate with other youth leaders, amplifying our collective voice on critical matters.', 'I have extensive leadership and advocacy experience, having served as a peer educator under the Youth Action Movement, where I engaged my peers on issues such as health, education, and rights awareness. I was also elected by my constituency to represent them as a member of parliament in Shiselweni 1 twice. In my first attempt, I won the primary by-elections at the age of 24, marking a significant milestone in my political journey. During my second try, I placed third in the secondary by-elections, and in the most recent elections, I was just one vote away from winning second place in the primary elections. Throughout my tenure, I have been a steadfast voice for the youth in my community, advocating for their needs and aspirations.', 'I should be chosen to represent Eswatini at the Commonwealth Youth Council because of my proven track record of leadership, advocacy, and commitment to youth empowerment. My experiences as a peer educator and elected representative have equipped me with the skills to effectively engage with diverse stakeholders and advocate for meaningful change. I am passionate about creating opportunities for young people and believe that my insights into the challenges faced by youth in Eswatini can contribute to shaping policies that benefit young people across the Commonwealth. Furthermore, my dedication to fostering collaboration among youth leaders will help amplify our collective voice on critical issues.', '[\"cvc-applications\\/cvs\\/inbound8434329447625897328.docx\"]', '[\"cvc-applications\\/supporting\\/inbound8430658021183183947.pdf\",\"cvc-applications\\/supporting\\/inbound7747163908586278481.pdf\"]', NULL, '2025-07-18 23:53:05', '2025-07-19 00:03:51'),
(23, 1180, '1. No poverty \n2. No hunger\n3. Good health and wellbeing ', 'Unemployment, which probably our youth need to consider entrepreneurship, and also our countries\' leaders create job opportunities for the local community.', '0', NULL, 'I have no quite a good experience, but under JA job shadowing, I learnt dealing with people of different minds and character since I was the Director of the school program.', 'After a thorough research and understanding of youth health, I learnt that majority of the youth suffer because they lack knowledge, maybe even skills. We tend to fix our focus on what we have studied for, yet there are some other opportunities to thrive on. So that is the message I have. Also considering the rate of suicide and drug administration I feel like we need to highlight the dangers and consequences of such. As a Health and Safety person, I think it\'s important to address such in international level.', '[\"cvc-applications\\/cvs\\/inbound5794257664020086687.png\"]', '[\"cvc-applications\\/supporting\\/inbound4317913686267645240.png\"]', NULL, '2025-07-18 23:54:31', '2025-07-18 23:54:31'),
(24, 893, 'No poverty - this aligns with the Commonwealth Mandate in the sense that it is bringing together different countries that are both developed and developing. By bringing countries together, the Commonwealth is trying to inspire the countries under development and give them hope that it is possible to get to the place where the developed countries are already at. This is to say, bringing diverse communities of people to ensure collaboration and sharing of ideas.\n\nZero hunger - it aligns with the Commonwealth as it is about aligning the best leading countries like Canada and Australia with countries like Ghana and Ivory Coast as they are facing challenges when it comes to agriculture. With the use of agriculture, the Commonwealth is trying to bridge a gap of food insecurity thus achieve food sovereignty and food sustainability. Ensuring enough food is available in every country means lessening hunger everywhere.\n\nReduced inequality - in many cases, the developed countries look down upon the less developed countries. Thus the Commonwealth Mandate tries to align these country groups into 1 so to reduce the inequality. By reducing inequality, the world can be a better place. ', 'Thirteen years ago, I had no doubt that by now I will be married, a housewife and probably raising one or two kids or even a high school dropout. But I was wrong. Actually, somehow I was right because most of the girls I grew up with are now either married, housewives and raising one or two kids or high school dropouts raising one or two kids. Growing up in a rural area, everyone knew very well that was the fate of any girl in the community. As young girls, we have actually seen these things happening girls either getting married, being housewives and raising one or two kids or dropping out of school to raise their kids. This was what was happening around us and it was what was expected of us. Nobody had to spell out that to us. These girls who grew ahead of us were our role models, whatever they were doing we were also destined to do it. By that time, we didn’t have any TV’s, magazines or books where we can see or read that what was happening in the community was not the only option for girls, there were other options. Thus, that was our only option, to get married, become housewives and raise kids. We couldn’t become what we didn’t know or what we didn’t see. \nComing from a disadvantaged background, I know that the environmental influence in rural areas is not as inspiring as in urban areas. When you are in the rural areas, you are not exposed to my things, like seeing people driving nice cars or beautiful houses so that you can be motivated to work hard. Thus, even the performance of most rural schools is not comparable with the elite urban schools, so most of students from rural areas don’t make it to tertiary institutions because these institutions always require good academic performance.  This is not because students from rural areas are not capable of achieving great results but just of the environment they find themselves in and that was my case.\nI envision a world where every young person will have an equal opportunity to access quality education that will help all young people to achieve their dreams, no matter of their background. What has been constantly worrying me is the increasing number of young people who don’t make it to tertiary institutions resulting to a large number of unemployed youth in my country. A majority of these young people who don’t make in to tertiary institutions not because they are incapable but because of the environment they grew up in. I believe that all young people who have completed their high school education should be given a chance to further their education. These students end up being chucked out of the educational system.\nTherefore, being awarded the opportunity and participating at the Commonwealth Youth Council will help me to get mentorship and guidance to support me as I tackle these challenges. I believe spending time with other council members will enable us to share ideas and solutions to problems faced in our countries, that I will take back with me and help in achieving my goal; and also to learn about the different cultures and way of life of other countries in the Commonwealth.\n\n\n', '0', NULL, 'I have not. However I do have the experience of being the first Kukhanyeni Inkhundla young female to be trained in tunnel farming which was hosted at Riders Ranch July - September 2024 by Woman Farmer Foundation. I believe in the duration of the training, I was able to share and collaborate great ideas with the other youth from various parts of the country. ', 'I believe in the transformative power of youth engagement in addressing critical issues facing the African continent. This opportunity aligns perfectly with my passion for Information Communications and Technology (ICT) issues, as well as my strong desire to make a positive impact in my community and beyond.\nI want to become a Commonwealth Youth Council member because I am deeply committed to driving positive change in Africa, particularly in the areas of STEM (Information Communication and Technology), environmental sustainability, and community development. Coming from a disadvantaged background, witnessing firsthand challenges in the education sector, has fueled my determination to contribute to solutions that address such pressing issues. As a commonwealth member, I see the potential to collaborate with like-minded individuals, share knowledge, and work collectively towards development of the Commonwealth on a larger scale. I believe that my commitment as a council member will provide me with a unique platform to amplify my efforts and learn from diverse perspectives, ultimately enabling me to make a more significant and lasting impact.\n\nMy dedication to creating positive change, coupled with my track record of initiating and executing successful projects, sets me apart as a strong candidate for the position. My experience in setting up an online learning centre where young people who have finished high school but didn’t qualify to go to tertiary institutions get a chance to do online courses offered by online learning platforms like Coursera, Khan Academy, Skillshare and Udacity.Com demonstrates my ability to identify problems and implement effective solutions. This project not only improved access to higher education to young people who want to develop and equip themselves with skills but also contributed to education equality in rural and urban areas.\nFurthermore, my academic background in Information Communication and Technology equips me with a solid foundation in understanding Science, Technology, Engineering and Mathematics (STEM) principles. I am a quick learner, an excellent communicator, and possess strong analytical skills—all of which will be invaluable in collaborating with diverse stakeholders and implementing projects during my tenure as a member.\nIn joining the Commonwealth Youth Council, I bring a range of skills that will be beneficial for both personal and collective growth. These include:\nResearch and Analytical Skills: My experience in working in research projects has honed my ability to gather and analyze data effectively, enabling evidence-based decision-making.\nProject Management: I have a proven track record of successfully managing projects from inception to completion, which will be crucial for executing initiatives that address the needs of the community and align with the Commonwealth objectives.\nCommunity Engagement: My work with the youth project taught me the importance of engaging and collaborating with local communities. I am adept at building relationships and working closely with diverse groups to achieve common goals.\nInformation Communications Technology Expertise: With my background in ICT, I bring a strong understanding of ICT practices, which will be valuable in addressing challenges faced by young girls in rural schools.\nAdaptability and Innovation: Growing up in challenging circumstances taught me to be adaptable and innovative in finding solutions. I view problems as opportunities and believe in continuously seeking better ways to achieve results.\nIn conclusion, I am excited about the opportunity to contribute my skills, experiences, and passion for positive change as a Commonwealth Youth Council member. I am confident that this experience will not only allow me to grow personally but also enable me to make a meaningful and lasting impact on the communities I serve. I look forward to the possibility of working alongside fellow organizations to advance the goals of the Commonwealth and promote sustainable development in Africa.', '[\"cvc-applications\\/cvs\\/inbound6818314305664026204.jpg\"]', '[\"cvc-applications\\/supporting\\/inbound8565551969346583840.jpg\"]', NULL, '2025-07-19 00:00:18', '2025-07-21 02:22:41'),
(25, 1085, '1. Peace, Justice and Strong Institutions which promotes peaceful and inclusive societies, access to justice and effective institutions. This goal resonates with the Commonwealth\'s values of promoting democracy, human rights and the rule of law.\n\n2.Decent Work and Economic Growth, which focuses on promoting sustained economic growth,  full employment and decent work as one of the Commonwealth\'s SDGs is to promote economic development, trade and investment. \n\n3. Partnerships For The Goals,  which emphasizes the importance of global partnership and cooperation to achieve the SDGs. The Commonwealth\'s collaborative approach to addressing development challenges aligns with this goal.\n\n4. Gender Equality which seeks to empower women and girls and achieve gender Equality.', 'The biggest challenge of Eswatini\'s Youth is unemployment and I would advocate for change by collaborating with organizations like the United Nations Development Programme ( UNDP) and the United Nations Population Fund that are working to address youth unemployment and promote youth empowerment, I would advocate for policy change by encouraging policymakers to implement policies that that support youth employment, education and entrepreneurship and lastly by providing platforms for youth voices to share their ideas and solutions to the challenges they face.', '1', NULL, 'As a youth representative,  I advocated for Pads Taxation, Sexual Reproductive Health and Rights,and HIV prevention at the local level. I effectively communicated the needs and concerns of young people,  promoting awareness and understanding of SRHR issues. Through this experience, I developed strong public speaking and advocacy skills,  engaging with community stakeholders to drive positive change and empower young people to make informed decisions about their health. ', 'With experience representing the youth at local level, I have successfully advocated for crucial issues such as SRHR,  HIV prevention and menstrual health,  specifically campaigning for removal of pads taxation to promote equity,  My advocacy work has not only raised awareness but also driven tangible change in my community. I am committed to amplifying youth voices and promoting sustainable development in Eswatini and across Commonwealth. As a representative,  I would leverage my leadership skills,  passion and experience to contribute to the council\'s mission and foster a brighter future for young people. ', '[\"cvc-applications\\/cvs\\/inbound7459765234394877418.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound7871441226351152527.jpg\",\"cvc-applications\\/supporting\\/inbound1178457877908538305.jpg\"]', NULL, '2025-07-19 00:07:49', '2025-07-19 00:07:49'),
(26, 523, 'Self esteem, independence, intelligence.A confident country is not afraid to think out of the box,and can not be intimidated.independence teaches us stability,focused and improves the output.hence intelligence opens bigger and better ways to live.', 'The youth of eswatini is faced with a challenge in employment.The opportunities are few hence most are left unemployed and depressed.I am to educate emaswati about entrepreneurship which will not only provide financial freedom but more jobs for the youth.', '1', NULL, 'I have been privileged to represent my previous secondary school in school competitions or in representing the school in educational events.i have also been privileged to represent the international youth fellowship as the main actress .', 'I am very much devoted in improving my country.I might have not been offered the chance to prove my commitment to eswatini as a whole but my determination while surely pull through, because I\'m not an individual who grabs at opportunities that come for the sake of personal gain.My goal is to see eswatini youth gaining confidence and opening bigger doors which we were once doubted for .', '[\"cvc-applications\\/cvs\\/IMG_20250715_124651.jpg\"]', '[\"cvc-applications\\/supporting\\/IMG_20250715_131842.jpg\",\"cvc-applications\\/supporting\\/IMG_20250715_130719.jpg\",\"cvc-applications\\/supporting\\/IMG-20250714-WA0003.jpeg\",\"cvc-applications\\/supporting\\/IMG_20250715_130741.jpg\"]', NULL, '2025-07-19 00:18:04', '2025-07-19 00:18:04'),
(27, 1186, 'I am particularly passionate about.\nSDG 4 (Quality Education),SDG 8 (Decent Work and Economic Growth)\n andSDG 10 (Reduced Inequalities)\n\nSDG 4 resonates with me as education is crucial for empowering the youth of Eswatini. I believe that access to quality education aligns with the Commonwealth\'s commitment to fostering inclusive and equitable learning opportunities.\nSDG 8 is vital in addressing youth unemployment in my country. Promoting decent work opportunities for young people aligns with the Commonwealth\'s goals of sustainable economic growth and development.\nSDG 10 speaks to my belief in social justice. Reducing inequalities aligns with the Commonwealth\'s values of inclusion and respect for diversity, ensuring that every young person has a voice.', 'The biggest challenge facing the youth of Eswatini is high unemployment rates, particularly among graduates. Many young people struggle to find meaningful work, leading to frustration and disillusionment.\n\nTo advocate for change at the Commonwealth level, I would emphasize the need for programs that promote entrepreneurship and skills training. I would engage with Commonwealth networks to promote initiatives that support job creation and vocational training, ensuring that the voices of Eswatini\'s youth are heard in policy discussions.', '1', NULL, 'I have served as national co-ordinator for a local youth organization(Good Society Redemption), where I led initiatives to promote mental health awareness among young people. This role involved organizing workshops and collaborating with local schools. Additionally, I was involved in a campaign to advocate for better educational resources. These experiences have honed my leadership skills and deepened my commitment to advocating for youth empowerment.', 'I strongly believe that I\'m a best candidate to represent eswatini at the commonwealth because I\'m nót only passionate with the above SDG I\'m also fluent in English, and I have been doing presentation to a number of youth in different local societies and I got their feedback about my representations about changing their lives ', '[\"cvc-applications\\/cvs\\/inbound6425793479873917055.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound6445008263419554213.pdf\",\"cvc-applications\\/supporting\\/inbound583636387100586936.pdf\"]', NULL, '2025-07-19 01:17:36', '2025-07-19 01:17:36'),
(28, 952, 'Top 3 SDGs that l am passionate about:\n\nSDG 4 – Quality Education:\nPromotes inclusive and equitable quality education and lifelong learning opportunities. It aligns with the Commonwealth\'s emphasis on education as a foundation for development, fostering informed, skilled populations across member countries.\n\nSDG 13 – Climate Action:\nAddresses urgent action to combat climate change and its impacts. The Commonwealth focuses on sustainable development and resilience, recognizing that climate change disproportionately affects member countries, especially Small Island Developing States.\n\nSDG 5 – Gender Equality:\nStrives to achieve gender equality and empower all women and girls. The Commonwealth promotes gender equality as a core principle, supporting inclusive societies and economic development.\n', 'Unemployment is a serious problem for the Youth of eSwatini, most of the Youth is struggling to get employment.  I can advocate at Commonwealth level to come up with ways and policies that will promote the Youth to be self employed and become entrepreneurs and also find other ways to create employment for the Youth if eSwatini. ', '1', 'I have represented the Youth at International level where l was a SADC Youth Parliamentarian representing eSwatini in SADC Youth Parliament. Recently 25 to 28 March 2025 l was at Johannesburg, where we had our first physical sitting as SADC Youth Parliamentarian together with the 16 SADC countries,   l was representing the Kingdom of Eswatini and l advocated for Policies that will improve the Youth in the SADC Region especially unemployment and health and l urged them to start by ESwatini as we are still a developing country. As l do this l follow the Strategy of \"Nkwe\"', 'I am a SADC Youth Parliamentarian representing eSwatini and also serve as the Chairperson for Natural Resources Governance, Agriculture, Environment and Climate Change Standing Committee in SADC Youth Parliament.  In addition to that I am also a Human Resource Manager for Enactus Good Shepherd Catholic College of Health Sciences.  I have advocated For Policies that benefits the Youth of eSwatini in the SADC Youth parliament.  I have also advocated and encouraged entrepreneurship for the Youth of eSwatini in Enactus club', 'I have to be chosen to represent ESwatini because l met all the requirements for this possible and l am working with the Youth at national and international level to improve Youth. ', '[\"cvc-applications\\/cvs\\/inbound4641753210210143005.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound7551127080224910491.jpg\"]', NULL, '2025-07-19 01:40:31', '2025-07-19 01:40:31'),
(29, 1193, 'Top 3 SDGs I Am Passionate About and Their Alignment with the Commonwealth Mandate\n\n1. SDG 5: Gender Equality\nAs a youth leader working with women-led initiatives like Lunwali Feeds, I advocate for equal access to opportunities for young women in business and leadership. This aligns with the Commonwealth’s commitment to advancing gender equality and empowering women and girls by breaking down systemic barriers and creating inclusive spaces for participation and decision-making.\n\n\n2. SDG 13: Climate Action\nMy background in environmental health fuels my passion for climate resilience and sustainable practices. Projects I lead emphasize eco-friendly innovations, such as upcycling agricultural waste into livestock feed. This supports the Commonwealth’s focus on climate change mitigation and adaptation, particularly through youth-driven solutions that build sustainable communities.\n\n\n3. SDG 8: Decent Work and Economic Growth\nThrough entrepreneurship and youth empowerment, I promote job creation, especially in rural communities. By encouraging social enterprises and youth-led innovation, I contribute to the Commonwealth’s aim of boosting inclusive economic growth, reducing youth unemployment, and supporting decent work across member nations.', 'One of the biggest challenges facing the youth of Eswatini is youth unemployment, driven by limited access to economic opportunities, entrepreneurial support, and practical skills development. Many young people have talent and drive but lack platforms that allow them to fully explore their potential.\n\nAs a young leader, I want to give the youth of Eswatini a chance to maximize what they can do best to earn a living, whether it’s through agriculture, innovation, digital work, or creative industries.\n\nHere’s how I would advocate for change at the Commonwealth level:\n\n1. Amplify Youth Voices\nI would use Commonwealth platforms to raise awareness of the real issues Eswatini’s youth face, while showcasing grassroots innovations and success stories that prove young people can lead sustainable change when given the chance.\n\n\n2. Teach Problem-Solving for Profitability\nI will actively create programs that teach young people how to identify everyday problems and turn them into profitable, socially impactful solutions. This will foster a generation of change makers who are not only solving issues in their communities but also creating jobs.\n\n\n3. Promote Inclusive and Youth-Centered Policies\nI would advocate for more investment in skills training, entrepreneurship incubation, and mental health support, particularly for young women and rural youth, in alignment with Commonwealth development goals.\n\n\n4. Facilitate Skills Exchange Across Borders\nI want to introduce initiatives like a Commonwealth Youth Skills Exchange Program, where youth from Eswatini can collaborate and learn from their peers in other member states. This kind of cross-cultural learning will strengthen entrepreneurship, boost employability, and contribute to building a better, more connected economy.\n\n\n\nThrough these efforts, I aim to ensure that the youth of Eswatini are empowered to earn with dignity, lead with purpose, and build solutions that benefit both people and planet, while actively contributing to the Commonwealth’s shared vision of development and equity.', '1', NULL, 'I serve as the CEO of Enactus UNESWA Mbabane Campus, where I lead youth-driven projects focused on mental health, climate action, and entrepreneurship. I co-founded Lunwali Feeds, a women-led agribusiness that upcycles waste into livestock feed. As a UNDP Student Ambassador and advocate, I promote sustainable development and youth empowerment. Under the EU Global Youth Mobilization initiative, I serve as a Youth Panellist and a Project Report Reviewer, helping assess and support youth-led solutions worldwide. My mission is to equip young people to identify local challenges and turn them into profitable, impactful solutions.', 'I should be chosen to represent Eswatini at the Commonwealth Youth Council because I bring a proven track record of youth leadership, grassroots impact, and global advocacy. As CEO of Enactus UNESWA Mbabane Campus and co-founder of Lunwali Feeds, I lead youth-led initiatives that create jobs, promote gender equality, address climate change, and support mental health, all aligned with the Commonwealth’s core priorities.\n\nI also represent Eswatini on international platforms, including as a UNDP Student Ambassador and as a Youth Panellist and Project Report Reviewer under the EU Global Youth Mobilization. These roles have equipped me with the skills to collaborate across cultures, influence policy, and amplify the voices of underrepresented youth, especially from rural and marginalized communities.\n\nMy vision is to give young people in Eswatini the chance to maximize their potential, turn community problems into profitable solutions, and participate in skills exchange opportunities across the Commonwealth. I believe in action that is youth-led, locally grounded, and globally connected and I’m ready to represent Eswatini with integrity, innovation, and impact.', '[\"cvc-applications\\/cvs\\/Bandile Mnisi CW application.docx\"]', '[]', NULL, '2025-07-19 04:16:02', '2025-07-19 04:16:02'),
(30, 1196, 'Climate change, No poverty and decent work and economic growth having strong climate resilience techniques by reducing greenhouse gases emissions will ensure that we have adequate water and clean energy also increasing yield and reducing poverty leading to an improved or enhanced economy ', 'Not having a youth representatives according to each region, we must have annual reports concerning the youth suggestions and queries submitted to the government by a youth member in each region in alignment with the country goals and allocation of resources must not be so complicated to access', '1', 'It was on a UNDP meeting where we where addressing the challenges faced by the youth in local communities under the Ministry of economic planning and development i was an intern and issues affecting the youth i made sure am fully engaged ', 'Am one of the leaders of Agricultural economics and agribusiness society and I have learned that trust Group Leaders are selected based on aptitude and interpersonal strength, not seniority. We deliver agronomic education, business skills, and financial literacy tailored to local needs, aligning tasks with individuals’ strengths and influence.', 'As a citizen of this country i have represented the youth mostly the agricultural sector in ensuring their voices are heard by the government as far as Subsidies and low inputs cost', '[\"cvc-applications\\/cvs\\/IMG_3250.png\"]', '[\"cvc-applications\\/supporting\\/202200788.pdf\"]', NULL, '2025-07-19 06:43:24', '2025-07-19 07:04:48'),
(31, 1198, 'The currency situation is very low in the country, actually the GAZETTE is not good a living in this century.', 'No jobs offered, No Grant, No funders ', '1', NULL, 'Community youth leader ', 'I want to ancarage every young person to get into business.', '[\"cvc-applications\\/cvs\\/inbound2049926367795767993.pdf\",\"cvc-applications\\/cvs\\/inbound7552056285197526731.pdf\",\"cvc-applications\\/cvs\\/inbound7761128469591811415.pdf\",\"cvc-applications\\/cvs\\/inbound51102822565834318.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound7087765250859045951.pdf\"]', NULL, '2025-07-19 07:20:41', '2025-07-19 07:21:25'),
(33, 861, 'Firstly being good health and well being. As a former peer educator i have worked closely with young people on issues related to HIV, self care and mental health. This actually aligns with the Commonwealth’s focus on youth empowerment by promoting access to health information and services.\nSecondly, Quality Education. I believe in empowering young people through knowledge especially those in underserved communities. I love ensuring that young people are informed about their rights, health and opportunities which also aligns with the commonwealth’s goal of building capacity among youth for better future.\nLastly, it is Gender Equality. Through my involvement in the Umhlanga Ceremony i have advocated for their safety and protection and empowerment for young women and girls. The Commonwealth’s commitment is to human rights and social inclusion.', 'The biggest challenge youth of ESwatini face is comprehensive youth friendly education particularly in the rural areas. This lead to high rates of teenage pregnancy and gender based violenc. At the Commonwealth level i would lobby for more platforms where rural youth voices can be heard and integrated.', '1', NULL, 'I have been active in cultural leadership during the annual Umhlanga ceremony for the past 6 years guiding young people and advocating for their safety and empowerment . I have represented youth locally through my work with Khulisa Umntfwana Organization. I have also participated in national youth activities contributing to discussions around cultural preservation and youth empowerment. I have provided one-on-one support to young women and girls on health and social issues and also led outreach programs. My experience has shaped me into a confident, compassionate youth leader with strong communication skills.', 'I should be chosen because i bring both lived experience and a deep commitment to empowering young people especially those who are often left behind. I have demonstrated leadership at the grassroots level through health education, cultural mentorship and community mobilization. I fully understand the challenges young people in Eswatini face, particularly in the rural areas and i am ready to amplify their voices on the Commonwealth stage. I am passionate, reliable and ready to collaborate with other youth leaders to bring meaningful change.', '[\"cvc-applications\\/cvs\\/Philiswadlamini CV.pdf\"]', '[\"cvc-applications\\/supporting\\/c58c134e-ed74-47a3-81ec-b3064adc6901.jpeg\"]', NULL, '2025-07-19 11:41:28', '2025-07-19 11:41:28'),
(34, 1205, 'SDG 4 Quality Education,  5 Gender Equality,  13 climate action. Mandates  to promote sustainable development,  empower youth and foster cooperation and partnerships', 'Unemployment,  educational problem, teenage pregnancy. I can empower the youth  on how to make money and become  your own boss, by using your own skill , be an entrepreneur  and make relationships with business partners  undergo some trainings under business management.  The dependence women who have been pregnancy by old man ,boy bring hope to start afresh with life in become independent personnel under gender balance last but not list for those who need education backup still there can be a way through  the bridge of CYC ', '1', 'In my community,  church and at IDM Training with JA and GU ', 'Youth need to be inspired and well motivated  be able to change their status , bring hope to those who lost it along the way, be able to bring light n see the part they are walking with you , mentor along the way , do follow up love n understand  their situation  and do something  about it , they have potential, goals they have a germ in them power and development,  skillful I have experience alot , to think beyond them ', 'I will be able to inspire and motivate young people who have lost hope in the those who have give up on their  life thinking that it the end but they will see the beginning  Isaiah 60 vs 1 Rise and shine the time is now, activate their faith ', '[\"cvc-applications\\/cvs\\/inbound7637023224134528958.jpg\"]', '[\"cvc-applications\\/supporting\\/inbound6087456684269477226.jpg\"]', NULL, '2025-07-19 12:54:08', '2025-07-19 13:03:30'),
(35, 606, '1. Quality education and Job opportunities\n2. Gender equality \n3. Involvement of youth in state decision making ', 'Unemployment \n1. Make agreement with companies to give youth first level entry jobs\n2. Retrench works over 60 to open more job for the youth \n3. Attract more investors into the country ', '1', NULL, 'I worked as a volunteer at Family Life Association of Eswatini under the youth department as an outreach coordinator\n1. Work with youth to bring exposure about available service in the Flas facility and other institutions in the country \n2. Provided a safe space for youth to talk about anything they wished with supervision ', 'I have experience social difficulties incurred by youth due to neglect of the government.\nI would like to bring back trust to the youth about their government.\nI would like to give youth the equal chance to job opportunities available in the country ', '[\"cvc-applications\\/cvs\\/SIMELANE TEBENGUNI NOMVUYO_123852.pdf\"]', '[\"cvc-applications\\/supporting\\/20250703121441746.pdf\"]', NULL, '2025-07-19 14:40:27', '2025-07-19 14:40:27'),
(36, 1208, 'I am passionate about SDG 4: Quality Education, SDG 5 : Gender Equality, and SDG 8: Decent Work & Economic Growth.\n\nThrough my volunteer work at SOS Children’s Village, I’ve seen how education transforms lives, aligning with the Commonwealth’s focus on inclusive development.\nI advocate for gender equality, creating spaces for young women to lead, which supports the Commonwealth’s mission of equity.\nI believe in tackling youth unemployment through entrepreneurship and innovation, a priority for many Commonwealth nations.\nAs a youth representative, I would amplify these goals by sharing Eswatini’s realities, fostering partnerships, and driving collaborative initiatives.', 'The biggest challenge is high youth unemployment and limited economic opportunities, worsened by skills gaps and lack of mentorship.\n\nAt Commonwealth level, I would:\n\nAdvocate for skills exchange, mentorship, and entrepreneurship programs.\nPush for youth centered policies that prioritise employment and innovation.\nUse my platform as a youth media specialist to highlight Eswatini’s challenges and link local youth to global opportunities.', '1', 'Yes.\n\nInternationally, I was a WiSci Girls STEAM Camp Namibia 2018 alumna, engaging with young leaders on STEM and gender equality.\nNationally, I’ve worked as a youth media broadcaster, amplifying youth voices on education, employment, and social issues.\nLocally, I’ve volunteered with SOS Children’s Village and Salvation Army, supporting vulnerable communities.\nI was recently selected as a media specialist to represent Eswatini at Durban July, showcasing my country on a global stage.', 'I’ve combined community service, youth media, and advocacy to create impact.\n\nAs a youth broadcaster and voice artist, I’ve highlighted young people’s stories, including animation work for SOS Children’s Village.\nThrough volunteering at SOS and Salvation Army, I supported vulnerable children and communities.\nI’ve participated in leadership dialogues, like the session with CDA Caitlin Piper, enhancing my understanding of youth governance.\nThese experiences have built my ability to communicate, collaborate, and advocate for change.  \nDuring my internship at the Ministry of Public Service, I gained first hand experience in governance structures and public administration, deepening my perspective on policy and youth development.\n', 'I should be chosen because I’m committed to amplifying Eswatini youth voices globally and connecting them to opportunities within the Commonwealth.\n\nI bring proven advocacy experience, strong communication skills from my work as a youth broadcaster and media specialist, and a track record of representation from WiSci Namibia 2018 to Durban July 2025.\n\nI will be a bridge between Eswatini youth and the Commonwealth, ensuring our priorities like education, gender equality, and employment are heard and acted upon.', '[\"cvc-applications\\/cvs\\/Chuki CV.docx\"]', '[\"cvc-applications\\/supporting\\/Chuki Media Diploma.pdf\",\"cvc-applications\\/supporting\\/Chuki Form 5.pdf\",\"cvc-applications\\/supporting\\/Chuki Wisci.pdf\",\"cvc-applications\\/supporting\\/Chuki Matric.pdf\"]', NULL, '2025-07-19 14:45:12', '2025-07-19 14:45:12'),
(37, 1156, '1. Quality Education: Commonwealth promotes education & youth empowerment as key tools for sustainable development.\n2. Climate Action: The Commonwealth Climate Finance Hub helps vulnerable nations access international Climate Finance.\n3. Peace , Justice & Strong Institutions: it provides election observation missions & legal reform initiatives.', 'Unemployment.\nAdvocacy: I can coordinate joint campaigns calling for inclusion of youth unemployment on the Commonwealth wealth agenda. Track the Commonwealth response, then engage with follow -up mechanisms or technical working groups & finally keep the conversation going by updating stakeholders regularly with progress reports & new research.', '1', 'I was part of the youth committee in my home area that was selected to lead the Peer Education initiative for young girls.I contacted organisations like World Vision seeking any help to sustain that initiative.', 'I was part of the youth committee in my area that was selected to lead the Peer Education initiative that was aimed to educate young girls on how to navigate through the challenges they face while growing up & how to overcome them. ', 'I  am a  passionate and committed youth advocate with a proven track record of leadership in community development & youth empowerment initiatives in Eswatini. My ability to effectively engaged diverse stakeholders and drive collaborative solutions makes me a strong representative for the country\'s youth on the international stage. I bring a deep understanding of the challenges facing young people in ESwatini, coupled with innovative ideas to influence policy and foster inclusive growth. With strong communication skills & a vision for sustainable youth development, I am ready to amplify ESwatin\'s voice and contribute meaningfully to the Commonwealth Youth Council.', '[\"cvc-applications\\/cvs\\/inbound2317383166285844953.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound5741936814329016504.pdf\"]', NULL, '2025-07-19 15:00:46', '2025-07-19 15:24:04');
INSERT INTO `c_y_c_applications` (`id`, `participant_id`, `sdg_response`, `challenge_response`, `representation_experience`, `representation_details`, `leadership_experience`, `motivation`, `cv_upload`, `supporting_documents`, `deleted_at`, `created_at`, `updated_at`) VALUES
(38, 1173, 'As a conceptual photographer and artist from the Kingdom of Eswatini, I am deeply passionate about using visual storytelling to advocate for social justice, environmental consciousness, and inclusive representation. My work strongly aligns with the Commonwealth’s commitment to democracy, sustainable development, gender equality, human rights, and cultural exchange. The top three Sustainable Development Goals (SDGs) I am most passionate about are:\n\n1. SDG 5 – Gender Equality\nMy creative practice consistently advocates for gender equality and the rights of women and girls. I was one of ten artists featured in a fundraising exhibition on gender-based violence (GBV) hosted by Yebo Art Gallery in partnership with the European Union. The exhibition raised funds for organizations supporting GBV survivors in Eswatini and offered visual responses to the crisis.\n\nMy artwork Nomathemba, showcased by the Youth Sustainable Development Council, addresses the inequality in nationality laws emphasizing that women should have equal rights to pass citizenship to their children. The work was later selected by CASA Africa based in Spain during the global 16 Days of Activism campaign, highlighting its global resonance.\n\nI’ve also created visual stories that promote sisterhood and inclusion. My photography portraying women with albinism challenges stigma, while a separate series celebrating individuals living with vitiligo was featured in Yapper Magazine based in Morocco during Black History Month 2025. These works aim to affirm dignity, representation, and belonging for all women and men. \n\n.2. SDG 10 – Reduced Inequalities\nThrough my art, I strive to dismantle social barriers and elevate marginalized voices whether addressing gender, disability, migration, or skin conditions. My photograph Running Home, which won first place in the 2025, Center for Migration Studies in collaboration with the University of British Columbia, Canada, contest, explored themes of displacement, home, and identity, humanizing the experiences of migrants and those living on society’s margins.This commitment to social justice and inclusion strongly aligns with the Commonwealth’s principles of equality, diversity, and the protection of human rights across its member states. I aim to amplify unheard voices and tell stories that foster empathy and policy change.\n\n3. SDG 13 – Climate Action\nMy work also speaks to the urgent need for environmental sustainability and climate action. During an art residency with Jendalma Art and Design in Senegal, I created Hlobisile, a photographic series featuring a woman wearing a dress made from plastic waste, set in Eswatini’s marketplaces. Inspired by the theme “Imagining African Cities in 2050,” the work provokes dialogue around sustainability, consumer waste, and the environmental futures of African urban spaces. It was showcased internationally on Artsy during Black History Month, engaging global audiences in conversations on climate justice and African resilience.\n\nIn 2020, I received the African Union x AfroChampions Social Justice Prize, a recognition of my commitment to equity and sustainability through the arts. I was also featured by Unearthodox, based in Switzerland, in their Regenerative series, which highlighted my piece Ataraxy (A Head Full of Stars Not in Constellation Yet). This work reflects the harmonious and healing relationship between nature and artistic creation. Ataraxy was born out of my personal journey, I have always felt nature has always been my place of solace, healing, and serenity during life’s most difficult moments.Much of my creative practice, including my submitted piece, draws inspiration from nature and reinforces the importance of preserving, appreciating, and living in harmony with the natural world. This reflects not only my own story, but also the broader need for a regenerative relationship between humanity and the environment.\n\nThrough photography and conceptual art, I address some of the most pressing social, political, and environmental challenges of our time. My work aligns deeply with the Commonwealth’s values and contributes to a more just, inclusive, and sustainable future for all.', 'As a creative who engages deeply with social justice and storytelling, I believe one of the biggest challenges facing the youth of Eswatini today is youth unemployment and lack of economic opportunitya crisis that fuels hopelessness, mental health struggles, and social unrest.Despite being a majority in the population, many young people in Eswatini face limited access to meaningful work, creative industries, quality education, and mentorship.\n\n The absence of sustainable job creation, especially in rural and under-resourced areas, leaves youth vulnerable to poverty, exploitation, and disengagement from civic life. Additionally, systemic issues such as gender inequality, political exclusion, and limited platforms for youth expression further deepen this challenge.As an artist, I use my photography to spotlight the lived experiences, resilience, and creativity of young people. I believe that visual storytelling has the power to challenge stereotypes, humanize statistics, and influence policy. \n\nAt the Commonwealth level, I would advocate for\n:Increased Investment in Creative Economies: \n\nThe Commonwealth can support programs that empower youth through the arts, digital innovation, and entrepreneurship. Young creatives in Eswatini often lack access to training, tools, or international exposure yet creativity is one of our richest untapped resources.\n\nCross-Cultural Exchange and Mentorship: As part of the Commonwealth, Eswatini’s youth should benefit from regional and international mentorship opportunities, residencies, and knowledge-sharing platforms. These initiatives help break cycles of isolation and build the confidence and capacity of young leaders and artists alike.Through my art, I seek to amplify youth voices that are often unheard, telling stories that call for dignity, opportunity, and justice. By partnering with Commonwealth initiatives, I can contribute to a movement where Eswatini’s youth are not only seen but truly supported as changemakers of today and tomorrow.', '1', NULL, '\nAs a conceptual photographer and artist from Eswatini, I have consistently used visual art as a powerful tool for advocacy and social change. Since 2018, I have participated in the Eswatini Now group exhibitions at Yebo Art Gallery, which reveal the true realities of life in the Kingdom through compelling visual storytelling. These exhibitions provide an important platform to raise awareness about critical issues such as gender-based violence, inequality, and social justice.\n\nI was also featured in a fundraising exhibition on gender-based violence hosted by Yebo Art Gallery in partnership with the European Union, which supported survivors in Eswatini. My artwork Nomathemba was selected by CASA Africa during the global 16 Days of Activism campaign, furthering advocacy for women’s rights and equal citizenship laws.\n\nIn 2020, I received the African Union x AfroChampions Social Justice Prize, recognizing my contributions to social justice through art. My award-winning photograph Running Home won first place in the 2025 Center for Migration Studies contest, highlighting themes of migration, identity, and displacement.\n\nIn September, I will exhibit a new photographic series focused on youth unemployment in Eswatini which is a topic deeply personal to me as a two-time unemployed graduate. This series explores the quiet vulnerability of men through moments of solitude, silent prayers, and emotional fragility often hidden beneath societal expectations. Through minimalistic compositions and symbolic imagery, the work invites reflection on what it means to be broken yet repairable, discarded yet valuable to both individuals and society confronting its challenges with quiet strengthproject is important to me because I relate directly to the struggles it portrays, and I hope it will spark empathy and urgent conversations about resilience and solutions for youth unemployment.\n\nThrough \n exhibitions,collaborations, and storytelling, I continue to use my art as a platform to amplify marginalized voices, foster empathy, and advocate for meaningful social and policy change.', 'I believe I should be chosen to represent Eswatini at the Commonwealth Youth Council because I bring a unique and authentic voice rooted in lived experience, creativity, and a deep commitment to social justice. As a self-taught photographer and visual artist, I have harnessed the power of art as a meaningful tool to amplify underrepresented narratives, challenge societal norms, and advocate for positive change in my community and beyond.\n\nMy work consistently addresses critical issues facing Eswatini’s youth, including gender inequality, migration, climate action, and youth unemployment, topics that align closely with the Commonwealth’s values and Sustainable Development Goals. Having personally experienced the challenges of being a two-time unemployed graduate, I bring not only empathy but also urgency and determination to uplift youth voices and foster solutions.\n\nThrough exhibitions, awards, and international collaborations, I have demonstrated leadership by creating platforms where marginalized stories can be seen and heard. I am passionate about using creative storytelling to build bridges between communities, inspire dialogue, and influence policy qualities that are essential for effective representation at the Commonwealth Youth Council.\n\nI am ready to contribute my perspective, artistic skills, and advocacy experience to help shape inclusive and sustainable youth policies across the Commonwealth, ensuring that the diverse voices of Eswatini’s youth are truly represented on the global stage.', '[\"cvc-applications\\/cvs\\/Sinenkosi Msomi Leadership and Advocacy Curriculum Vitae.pdf\"]', '[\"cvc-applications\\/supporting\\/Sinenkosi Msomi Associate Degree certificate.pdf\",\"cvc-applications\\/supporting\\/Sinenkosi Msomi Bachelors of Commerce in Marketing certificate.pdf\",\"cvc-applications\\/supporting\\/Sinenkosi Msomi Kickstart initiative winner certificate .pdf\"]', NULL, '2025-07-19 17:02:41', '2025-07-19 17:02:41'),
(39, 1215, '1. SDG 5 Gender Equality. The drive for fairness is central to the Commonwealth\'s soul. Its mandate champions women empowerment, leadership and ending the prevalent gender based violence in the country. The Commonwealth through shared legal frameworks promotes  advocacy and practical programs across its 56nations.\n\n2. SDG 4 Quality Education. The Commonwealth fosters  collaboration between members countries to improve teacher training, share best practices and promote inclusive education to both males and females.\n\n3. SDG 3: Good health and Well-being. The Commonwealth puts people\'s health at the core of its humanity, especially across vulnerable regions. It has over the years amplified actions on epidemics like malaria and HIV/AIDS, strengthens health systems for maternal and child care and confront issues like mental health education.', 'The biggest challenge we face as the youth in Eswatini is youth unemployment. It\'s crushing. I see it every single day, brilliant , educated friends struggling to find any work,dreams fading, and that hopelessness sometimes leading down dangerous paths. Nearly half of us young people are jobless. That\'s why im taking our struggle to the Commonwealth. I\'ll use my voice in Commonwealth Youth Network and at their forums to demand concrete action, push for targeted investments in green jobs and tech hubs for Eswatini, advocate fiercely for real funding and mentorship for youth led businesses and tell our story to connect our unemployment crisis to the bigger fights for trade justice and climate resilience. It\'s not about handouts uts about unlocking our potential and demanding our rightful place in the Commonwealth\'s future.', '1', NULL, 'I\'ve organised youth dialogues in Mbabane, uniting peers to draft community-led solutions for job creation and skills gap. I use my social media platform to advocate for mental health, hygiene and social issues in the country.\nThrough the grooming from Youth Action Movement I have been sharpen to eloquently speak on behalf of the under served populations like women,young adolescents and also unemployed citizens because our hustle is Eswatini’s future.', '1. I embody the resilience of Eswatini\'s youth turning unemployment and frustration into organized action,mobilising peers in Mbabane to draft solutions not wait for them \n\n2. With my advocacy and voice i can pressure leaders here at home to invest in our hustle, from agri-tech to digital startups, because i know potential isn\'t theoretical its in the soil, the code, the grit of my people.\n\n3  choosing me means Eswatini\'s struggles will not be a footnotes in Commonwealth halls, I\'ll force our reality onto the agenda and turn your policies into tangible change for us.', '[\"cvc-applications\\/cvs\\/IMG-20250719-WA0000.jpg\"]', '[\"cvc-applications\\/supporting\\/IMG-20250717-WA0008.jpg\",\"cvc-applications\\/supporting\\/IMG-20250717-WA0012.jpg\",\"cvc-applications\\/supporting\\/IMG-20250717-WA0014.jpg\"]', NULL, '2025-07-19 17:20:47', '2025-07-19 17:20:47'),
(40, 356, 'I am passionate about SDG 4 the quality of education-as I\'m also passionate in sills based education,i also helped few youth in carpentry based practical explanation n also promoting of ENYC  application for startup kits and start bussinesses which aligns with Commonwealth education and empowerment drive\n\nAlso passionate about SDG13 which involve climate action-growing up in Eswatini make me to see and  realise the growth of environmental waste threat.I was in environmental community clean-up campaign which helped in management of waste that aligns with commonwealth environmental protection and sustanability\n\nMoreover I\'m passionate in SDG 8 of Decent work and Economic growth as it was my plan to introduce to youth meetings about employement though green jobs and entrepreneurship especially recycling and environmental conversation sectors.', 'The biggest challenge facing the youth in Eswatini is unemployment coupled with a lack of access to practical skills development and resources. Many young people struggle to find opportunities that equip them with the competencies required in today\'s economy, especially in rural and underprivileged areas.\n\nAt the Commonwealth level, I will advocate for:\n\nIncreased investment in skills training programs, particularly in sustainable industries like recycling and construction.\n\nSupport for green entrepreneurship, providing youth with tools to turn waste into wealth.\n\nPolicy exchanges and collaborations among Commonwealth countries to replicate successful youth economic empowerment models. By amplifying these solutions, we can create pathways that equip Eswatini’s youth with skills to thrive in a competitive, green economy.\n\nDrop outs at school due to many challenges and short comings in youth while undergoing the process of their education level either primary,secondary/tertiary level.', '1', 'I\'m currently repesenting Youth from International Youth Fellowship organisation based at Manzini for three months as there are too many programmes i had to attend in presenting the Eswatini Youth from June to August 2025 whreby in July there\'s a  youth world camp people from all over the contry are invited to share and discuss about youth leadership and many more.Also as a skilled artisan  I\'ve got the opportunity to experience top world tools and advanced machines used in the world thus visited and also take practical feel of two recycling companies in Korea.Moreover  Agricultural Youth workshop at manzini region were mostly attended by me and also take part in Junior Achievement Eswatini wherby i was also presenting on many topics that were discussed there.', 'Since at my secondary levels I\'ve been nominated to represent Design and Technology department and national school fairs .Thus at my primary higher level i was also in part of welcoming SADC representatives that had to host their meeting in the country. I have been part of organized and led environmental awareness campaigns, sharing the importance of sustainability in Eswatini. Furthermore, I have shared importance of skills in young people on basic carpentry and construction skills, sharing knowledge that empowers them to build their own livelihoods. These experiences have strengthened my leadership, communication, and advocacy capabilities, especially within community-based projects.\n', 'I should be chosen because I bring a practical, community-driven perspective on addressing youth unemployment and environmental challenges in Eswatini. My experience in leading recycling initiatives, youth skills training, and advocating for sustainability uniquely positions me to represent Eswatini’s youth at the Commonwealth level. I aim to ensure that the voices of young people, especially from rural and underserved communities, are heard and that effective, actionable solutions are proposed to benefit not just Eswatini but the broader Commonwealth youth community. Also having my experience in South Korea in representing the Youth of Eswatini in one of the international organasations based in Eswatini make to have more insight of youth gatherings and discussions beyond national presentations. ', '[\"cvc-applications\\/cvs\\/inbound4674452490147034216.docx\"]', '[\"cvc-applications\\/supporting\\/inbound4126327170333607616.jpg\",\"cvc-applications\\/supporting\\/inbound6234460130868710677.jpg\",\"cvc-applications\\/supporting\\/inbound7715844975231146959.jpg\",\"cvc-applications\\/supporting\\/inbound1342705569978412887.jpg\",\"cvc-applications\\/supporting\\/inbound2403058784144712462.jpg\"]', NULL, '2025-07-19 17:55:17', '2025-07-20 15:49:49'),
(41, 1130, 'SDG 1 (No Poverty) – Economic freedom is a gateway to empowerment, unlocking opportunities in every facet of life. According to Maslow’s hierarchy of needs, meeting basic needs—such as food, shelter, and safety—is foundational. When these are satisfied, individuals can pursue higher-level goals like education, innovation, and ultimately, self-actualization. Thus, eradicating poverty doesn’t just address material deprivation, but enables people to fully realize their potential, contribute their talents, and drive collective progress. Ending poverty fuels greater economic growth and creates vibrant communities, as more people can participate in, and benefit from, social and economic development. This ambition is echoed in Commonwealth Principle 9, which affirms a commitment to sustainable development.\nSDG 5 (Gender Equality)- Regressive gender norms affect women and girls\' lives at all levels- creating barriers to their equal and meaningful participation. They affect how women and girls experience the world, themselves and how others perceive- then treat- them. Thus, achieving gender equality is key to achieving development that leaves no one behind. This aligns with the Commonwealth’s pillar on gender equality which recognizes that gender equality and women’s empowerment are essential components of human development and basic human rights.\nSDG 10 (Reduced Inequalities) – Historical injustices and structural disparities continue to shape outcomes for vulnerable populations, limiting access to opportunities and entrenching cycles of disadvantage. These inequalities, rooted in past events and perpetuated by current systems, affect how individuals experience society and can undermine community cohesion. Addressing such disparities is foundational to the Commonwealth’s vision—reflected in Principle 15, which recognizes the unique needs of vulnerable states shaped by history, and Principle 2, affirming a commitment to human rights. In Eswatini, tackling local inequalities is essential for ensuring inclusive development that enables all emaSwati to fully participate and thrive. Reducing inequalities is thus not only a matter of justice but a prerequisite for sustainable progress that benefits society as a whole.', 'The greatest challenge facing the youth of Eswatini is that, despite a desire to engage in sustainable development initiatives and achieve sustainable livelihoods, they lack the relevant skills and knowledge needed to participate effectively and achieve meaningful results. The National Skills Anticipation Report 2025 confirms that \"Eswatini continues to face significant skills mismatches and shortages across all priority sectors.” For instance, 85% of ICT employers and over 60% of agricultural employers report struggling to find candidates with the required expertise, while only a small fraction of training institutions offer programs tailored to the needs of emerging industries. Despite incremental improvements in youth unemployment, at 48.7% it remains alarmingly high—evidence of structural barriers still in place. This skills gap, compounded by a mismatch between industry needs and the qualifications young people possess, results in many youths becoming disillusioned and uninspired as they face multiple, compounding hurdles while navigating life. Furthermore, pervasive stereotypes and the absence of youth-friendly policies and platforms severely limit meaningful youth participation, leading to negative outcomes such as deviant behaviors and the marginalization of youth in decision-making platforms- despite them being a majority demographic. At the Commonwealth level, I will advocate for the creation and strengthening of youth-friendly policies, inclusive interventions, and platforms that promote meaningful engagement, supported by inter-generational dialogue. By championing the development of relevant skills, knowledge, and opportunities for youth to contribute as equal partners, I believe we can foster empowered young people with improved decision-making capabilities who drive positive development locally, nationally, and globally. My approach will be intersectional, recognizing the diverse experiences of youth and ensuring that all voices are represented and valued.', '1', '1.	The Country Coordinating Mechanism of Eswatini Board, Youth Representative: I actively coordinate and facilitate youth engagement meetings, collecting youth voices then using their inputs to engage stakeholders and advocate for youth needs at CCM All-level. \n2.	Youth Sustainable Development Centre, Projects Officer: Develop and implement strategies and initiatives aimed at engaging youth in advocacy work, and empowering them with relevant skills and knowledge for them to achieve sustainable and resilient livelihoods and communities.\n3.	Liphimbo Labomake, Secretary General- I provide strategic oversight, strengthen partnerships and develop coordinated efforts to promote women and girl’s rights\n4.	SADC- I represented women and girls’ voices in Eswatini during the development of the Regional Youth Peace and Security framework in recognition of the work I did on the WPS.\n5.	AU- I was nominated as one of the Eswatini delegates to represent women and girls during the AU’s 5th WPS Forum \n6.	Global Campaign for Equal Nationality Rights, Global Youth Summit Speaker: I attended the first global youth summit hosted by the GCENR network on ending gender discriminatory laws and presented on developing and running effective youth advocacy campaigns. I further shared on the work done by youth in Eswatini at a later global webinar series.', 'My advocacy and leadership work is centered around advocating for, and ensuring youth have equal access and opportunity to engage in fostering sustainable development. I further recognize the diversity in youth experiences, factoring the various ways women and female youth, and youth in rural communities face greater vulnerabilities, thus disproportionately limiting their agency and voice. My goal in life is fostering resilient communities in Eswatini, and the African continent at large- contributing to a world where one’s gender or age is no longer a barrier to African people’s ability to live dignified lives.\nI have contributed to this goal through my role as the Projects Officer at YSDC, a youth-led and youth centered NGO aimed at increasing youth participation in advocacy initiatives, and sustainable development initiatives at large. There, I have designed and implemented youth advocacy campaigns using art, community engagements, social media campaigns, engagement of key-decision-makers and more- leading me to present on our work at a youth global summit in Turkey in 2024. Furthermore, in 2022, through the women’s coalition in Eswatini, a non-partisan collective of women’s groups, I coordinated an advocacy campaign to mainstream women in promoting and achieving peace in Eswatini, organising multi-stakeholder engagements, dialogues and training workshops reaching over 25,000 emaSwati both physically and through social media campaigns. My leadership in this initiative led me to being elected to the coalitions’ national executive committee where I currently serve as the Secretary General. Further testament to the quality of work I do is:\n1.	Beating over 1500 applicants across the continent to be selected among 150 gifted African youth for a full-ride leadership scholarship\n2.	 Selected to partake in the YALI Southern Africa Program\n3.	Elected as the Youth Representative of the Country Coordinating Mechanism Board, advocating for youth interests in SRH programming\n4.	Shortlisted for the Mandela Washing Program', 'I believe I am an ideal candidate to serve as Eswatini’s representative for the Commonwealth Youth Council because I am an agile, dynamic youth leader who has already made significant strides in the youth advocacy space. I have dedicated myself not only to amplifying youth voices but also to driving tangible change that uplifts my peers and community.\nMy journey in advocacy has always centered on collective, not individual, goals. I am committed to the vision of building a stronger, more vibrant youth population in Eswatini: one that is empowered with the skills, knowledge, and agency to actively shape our nation’s future. Through initiatives I have led and participated in, I have seen firsthand the transformative power of informed, organized youth action. Whether by organizing community forums, leading skills development workshops, or collaborating with local organizations, my focus has been to ensure that young emaSwati are positioned to create dignified lives—both for themselves and those around them.\n\nMy academic background in Social Science has equipped me with a nuanced understanding of the principles underpinning equality, sustainable development, and effective advocacy. I am well-versed in participatory approaches and the importance of intersectionality in development work, thanks to my education and practical experience. These have informed my ability to design inclusive, impactful programs, and to work effectively with diverse groups of young people.\nImportantly, my achievements in the youth advocacy sphere—as detailed in the paragraph above—demonstrate my sustained commitment and growing influence. I bring not only vision but also practical skills in mobilization, communication, and collaboration.\nAs Eswatini’s representative, I will advocate relentlessly for expanding opportunities for youth, ensuring they have access to the resources and knowledge necessary for meaningful participation in sustainable development- aligning with the goals of the Commonwealth. My goal is to see young emaSwati leading confidently—enabling our youth to drive positive change that will shape a brighter, more equitable future for our nation and the Commonwealth as a whole.', '[\"cvc-applications\\/cvs\\/MPUMALANGA ZWANE 2024 RESUME.pdf\",\"cvc-applications\\/cvs\\/Recommendation Letter - Sihle Mpumalanga Zwane.pdf\"]', '[\"cvc-applications\\/supporting\\/Hons Degree Mpumalanga.pdf\",\"cvc-applications\\/supporting\\/Leadership and Development Certificate_ Mpumalanga Zwane.pdf\",\"cvc-applications\\/supporting\\/ALU.Mpumalanga.pdf\",\"cvc-applications\\/supporting\\/Cordaid Conflict and Gender Certificate_ Mpumalanga Zwane.pdf\",\"cvc-applications\\/supporting\\/Business and Human Rights Certificate_ Mpumalanga Zwane.pdf\"]', NULL, '2025-07-19 20:45:23', '2025-07-19 21:00:09'),
(42, 1172, 'Firstly,SDG1 Poverty reduction. The Commonwealth has a long-standing commitment to poverty reduction,particularly in developing countries such as Eswatini within the organisation.It does this by working on financial inclusion,social protection and sustainable livehoods directly supports this goal.\nSecondly,SDG4 Quality Education,it has a strong focus on education including,promoting access to quality education at all levels.\nLastly,SDG5 Gender Equality.The Commonwealth actively works to promote gender equality and empower women and girls.They address issues like gender based violence and promotes women\'s participation in decision-making and ensuring access to education and economic opportunities.', 'The Eswatini youth is facing high youth unemployment and they are skyrocketed by limited skills training and restricted political voice.Since the Commonwealth has several youth led organisations that influence policy and development. I will use such an opportunity to engage with youth from other countries and deliberate about this pressing issues facing us as the youth.I will eloquently amplify the voice of young people in such meetings. In such an esteemed level I can confidently present issues and propose policy changes.', '0', NULL, 'I have led as a project manager under a Junior Achievement Compay programme. I was groomed and perfected then I was chosen as a School Prefect and Head of Cleaning Department at Mhlatane High School. I led with dertimination and a strong sense of purpose. As a Prefect and Head I eloquently voiced out students grievances and suggestions. I led a green environment initiative where we started to sort out our waste at school.', 'I am a passionate agent of change by advocating for an inclusive space where all young people regardless of  gender ,ability can thrive. I envision a different and more inclusive Eswatini, when it comes to decisions affecting us as the youth.I exhibit excellent interpersonal skills such as that I can navigate disagreements and conflicts constructively, this will ensure successful interactions with fellow Commonwealth Youth Council members. I believe I am more than ready to represent Eswatini at the Commonwealth Youth Council because I bring a combination of leadership experience from my high school years .Moreover, I have a deep understanding of youth development issues and a strong desire to advance the interest of young people in our country and across Commonwealth. I see this as an opportunity not just to speak but to listen ,learn and bring fresh actionable ideas that reflect the aspirations of Eswatini\'s youth. To sum up, I am fully aware of the responsibility that comes with representing a nation. I will bring professionalism, cultural sensitivity and unwavering dedication to the role.My goal is not only to make Eswatini proud but also to contribute meaningfully to the Council\'s work in building a stronger, more united youth voice across the Commonwealth.,', '[\"cvc-applications\\/cvs\\/inbound3869981701102830516.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound5720880123582142388.pdf\"]', NULL, '2025-07-19 23:12:57', '2025-07-19 23:12:57'),
(43, 666, '1. SDG3- Good Health and Wellbeing, thsi is important because it seeks to ensure that there is a good quality Health standards across all the 56 member states. This will ensure that there is equality to Healthcare across members. 2. Quality Education,This is relevant because the Commonwealth has a standard carriculum for all member states this is done to ensure equality in the standard of education. 3. SDG 13- Climate Action, this is important because it calls for all member states to come up with strategies to counter the impact of global warming. Also for all countries to take responsibility of carbon emitions. ', 'The biggest challenge that affect the Eswatini Youth is the issues of unemployment. So my participation on the commonwealth platform, I would ensure that I advocate for the commonwealth to put it at the center of their agenda to help assist member states from the low to middle income countries on issues of youth unemployment. Further more I would advocate for the learning exchange. Furthermore I will advocate for the restructuring of the programs of training so that youth are equipped with skills that are needed by the industry. Further more I would advocate for the ease of exportation of youth products with lesser exportation tarrifs. ', '0', NULL, 'I have been part of various youth leadership interventions in my community. I have been a peer Educator working on issues of health for the youth. I have been working with the youth in the church a cross the Manzini region. I have been a Youth Steering Committee Member from MenEngage-SD Network, where we were responsible for driving the country programs that were targeting the youth. ', 'As a youth that have the first hand experience of what the Eswatini Youth is going through that makes me to be better positioned to tell the story of the Eswatini Youth. Further more my participation on ENYC career expo in the different part of the country have exposed me to the realities of the Youth across different communities in Eswatini. ', '[\"cvc-applications\\/cvs\\/inbound8772529620094507852.jpg\"]', '[\"cvc-applications\\/supporting\\/inbound1887887892418986887.jpg\"]', NULL, '2025-07-19 23:36:22', '2025-07-19 23:36:22'),
(44, 1225, '1. No unemployment\n2. Smart Cities\n3. Excellent Health and Well being\n\nThese goals are all in inline with the Commonwealth Mandate as they deeply promote social, economic and environmental sustainability. ', 'The biggest challenge is right now is unemployment. In Eswatini we have a lot of graduates who end up unemployment or working in an industry that isn\'t relevant to their field of study. In Eswatini we have brilliant minds and very little access to the right resources  that can actually change our lives. With the Commonwealth involved, we can Soar to new heights in Eswatini because so many job and business  opportunities await in the process of developing Eswatini into a first World country. ', '0', NULL, 'I have worked for non governmental organizations such as National Tuberculosis Control Program where I had to not only lead the youth but my community at large into a better health lifestyle and a better treatment plan for those living with Tuberculosis. In such a job, I had to teach people of different age groups, different backgrounds and different nationalities at times. ', 'Because I have encountered and interacted with so many different people across the country. I have met graduates while earning my own tertiary certificate. I know the struggle one has to go through to get their qualification. I  have experienced what it feels like to then be unemployed after so much hard work, or be employed in hard labour as that is only job available at the time. I have helped elderly people who can no longer support themselves. I have encountered I\'ll people who refuse to accept that they need help. I have seen life from different perspectives and through it all, I am motivated to take the stand and make changes that will impact Eswatini in the most positive manner than it has ever been. ', '[\"cvc-applications\\/cvs\\/Mayibongwe Mahlalela Resume.pdf\"]', '[\"cvc-applications\\/supporting\\/Certificate.pdf\"]', NULL, '2025-07-19 23:59:19', '2025-07-19 23:59:19'),
(45, 1228, 'The Sustainable Development Goals (SDGs) of Quality Education (SDG 4), Gender Equality (SDG 5), and Climate Action (SDG 13) closely align with the Commonwealth Mandate. SDG 4 emphasizes inclusive and equitable education, which resonates with the Commonwealth\'s commitment to empowering youth and fostering informed citizens. SDG 5 advocates for gender equality and women\'s empowerment, reflecting the Commonwealth’s dedication to promoting human rights and justice. Lastly, SDG 13 calls for urgent climate action, aligning with the Commonwealth\'s focus on environmental sustainability and collaborative efforts to address climate change. Together, these goals underscore a shared vision for a fair and sustainable future.', 'One of the biggest challenges youth face today is unemployment and lack of economic opportunities, particularly in countries like Eswatini. To advocate for this issue at the Commonwealth level, one can raise awareness at youth forums, propose initiatives such as mentorship and internship programs, and collaborate with member states to share successful strategies. Engaging in policy dialogue with decision-makers can also help influence the creation of supportive policies and funding for youth employment initiatives. By addressing youth unemployment through these efforts, advocates can help ensure that young people have the skills and opportunities needed to thrive.', '1', NULL, 'In 2024, I served as a Peer Educator, actively fostering youth engagement and promoting mental health awareness through workshops and community dialogues. My role involved organizing educational events to empower young people, addressing issues such as well-being and coping mechanisms. Currently, as a Social Worker at the Sifiso Mental Health Foundation, I provide counseling and therapy services, responding to emergencies and advocating for mental health awareness. Am also a Youth Action Movement active member, tackling issues of youth development.My interests include community service, youth advocacy, and mental health promotion, which drive my commitment to creating positive change.\nCollaborated with Municipal Council of Mbabane in planning Youth Day events. Went to Schools empowering on Career development. Collaboration with Woman Unlimited tackling issues of GBV. These experiences have equipped me with strong leadership skills and a deep dedication to supporting and empowering my community.', 'I am deeply passionate about empowering young people and fostering positive change in our communities. Having worked as a peer educator at the Family Life Association, I have firsthand experience in engaging with youth, addressing their needs, and facilitating discussions on critical topics. This program aligns perfectly with my dedication to supporting young individuals in their personal and social development. I believe I am the best candidate for this role for several reasons. Firstly, my background in peer education has equipped me with essential skills in communication, empathy, and leadership. I have successfully led workshops and support groups that encouraged open dialogue and critical thinking among participants. This experience has honed my ability to connect with young people, understand their perspectives, and facilitate discussions that empower them to make informed choices.Also, my educational qualifications, including my completion of Form 5 and ongoing studies of Bachelor of Social Work, provide me with a solid foundation to contribute effectively to the program. I am eager to leverage my academic knowledge and practical experience to create engaging training sessions that resonate with youth. My commitment to continuous learning and personal growth further underscores my suitability for this role. I possess a strong understanding of the challenges faced by young people today, including issues related to mental health, peer pressure, and identity. My experience working in diverse environments has given me the ability to adapt my approach to meet the unique needs of different groups. I am particularly drawn to the opportunity to address these challenges through the Mindset Change Trainer Programme, where I can help young people develop resilience and a positive outlook on life. I believe that knowledge-sharing and teamwork are vital for creating impactful programs that resonate with youth. My enthusiasm for fostering a supportive learning environment will enhance the overall effectiveness of the training and the program as a whole.', '[\"cvc-applications\\/cvs\\/inbound8890815673612131937.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound3108634410464547564.jpg\",\"cvc-applications\\/supporting\\/inbound7959999008498004644.jpg\",\"cvc-applications\\/supporting\\/inbound6473828396042587043.jpg\"]', NULL, '2025-07-20 00:57:16', '2025-07-20 00:57:16'),
(46, 650, 'The Sustainable Development Goals (SDGs) I am most passionate about are – SDG 1, No Poverty and SDG 2, Zero Hunger. I want to become an advocate for Food Poverty and educate communities on how they can grow their own food and feed their families, cook healthy meals and prevent food waste in a way that is affordable to all. Third oneQuality Education. This can be achieved by working with local government agencies and organisations to run education, training courses and classes that are available, accessible & affordable to all ', 'Unemployment at staggering levels, many young people are unable to find meaningful work despite their qualifications. The disconnect between education and economic opportunities has left a generation feeling betrayed by a system that promises growth but delivers stagnation. Compounding this frustration is the monarchy’s extravagant spending, which stands in stark contrast to the struggles of ordinary citizens. Young Swazis see their future being squandered by a government that prioritizes wealth for the elite over opportunities for its people. Plead for funding from international community, civil society organizations, and older generations who share their vision to see young people move the train.', '1', ' I Represented the youth on an online platform which took 4 months.In essence, BRACE programs in Africa are designed to ensure that youth are not just recipients of aid, but active agents of change, equipped with the knowledge, skills, and resources to lead the transformation towards resilient and sustainable agricultural systems.', 'My \"leadership\" role involved empowering agripreneurs with critical information and analytical tools. I  synthesized vast datasets on climate change impacts, climate-smart agricultural practices, and available financing opportunities, making complex information accessible to those who need it most. By providing comprehensive insights into market trends, innovative solutions, and policy landscapes, I can help agripreneurs make informed, strategic decisions to \"green\" their businesses and enhance their resilience.', 'I believe I am the ideal candidate to represent Eswatini at the Commonwealth Youth Council because my hands-on entrepreneurial experience, coupled with my proven communication and advocacy skills, positions me to effectively champion the voice of Eswatini\'s youth.\nAs the owner and operator of a hatchery business in Eswatini, I bring invaluable real-world experience to the table. This isn\'t just a theoretical understanding of economic development or food security; it\'s practical, daily engagement in a vital sector. My hatchery contributes directly to food security and economic diversification within our nation. This experience has given me a unique perspective on the challenges and opportunities within Eswatini\'s agricultural landscape, especially in adapting to climate change and fostering sustainable growth for young farmers. It showcases my initiative, problem-solving abilities, and commitment to creating tangible impact.\nFurthermore, my ability to pitch and present fluently, even to funders, is a crucial asset for this representative role. I can effectively articulate Eswatini\'s youth priorities, share our successes and challenges, and advocate for the resources and partnerships necessary to empower more young people in our country. This skill set is essential for engaging with diverse stakeholders, influencing policy, and securing support for youth-led initiatives on a global platform.\nAs a young entrepreneur, I don\'t just speak for the youth; I speak as one. I deeply understand the aspirations, struggles, and innovative spirit of young Emaswati. My background directly aligns with the Commonwealth Youth Council\'s mission to amplify youth voices and drive sustainable development, particularly in critical areas like agriculture and entrepreneurship. I am ready to leverage my experience to bring Eswatini\'s unique perspective to the forefront of Commonwealth discussions and to inspire action that benefits young people across all member states.', '[\"cvc-applications\\/cvs\\/inbound2823693571076847631.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound801831487831039256.jpg\",\"cvc-applications\\/supporting\\/inbound9149027970742718332.pdf\"]', NULL, '2025-07-20 02:27:59', '2025-07-20 02:30:15');
INSERT INTO `c_y_c_applications` (`id`, `participant_id`, `sdg_response`, `challenge_response`, `representation_experience`, `representation_details`, `leadership_experience`, `motivation`, `cv_upload`, `supporting_documents`, `deleted_at`, `created_at`, `updated_at`) VALUES
(47, 1099, '1. SDG 1: No Poverty\nGrowing up in Mbabane and experiencing the harsh realities of financial struggles, I am deeply passionate about SDG 1 – No Poverty. My journey has taught me the importance of creating opportunities for people from disadvantaged backgrounds to break the cycle of poverty through skills development, entrepreneurship, and sustainable livelihoods. This aligns with the Commonwealth’s mandate of promoting equitable and inclusive societies by empowering young people and marginalized communities through practical initiatives that improve their economic well-being.\n\n2. SDG 4: Quality Education\nI am also passionate about SDG 4 – Quality Education because I understand firsthand the challenges faced by young people in accessing education due to financial constraints. I have been involved in training young people on using their talents to create income and running workshops that build entrepreneurial and creative skills. This reflects the Commonwealth’s commitment to youth development, education, and skills advancement as tools to foster sustainable development and create future leaders.\n\n3. SDG 8: Decent Work and Economic Growth\nLastly, SDG 8 – Decent Work and Economic Growth resonates with me as I am currently engaged in small business activities that contribute to local economic growth, such as interior decor services and graphic design. I believe in promoting self-employment, creativity, and entrepreneurship, especially for young people in Eswatini, to reduce unemployment and create sustainable incomes. This perfectly aligns with the Commonwealth’s vision of building strong economies through innovation, entrepreneurship, and job creation.\n', 'The Biggest Challenge Facing the Youth of Eswatini:\nOne of the biggest challenges the youth of Eswatini face today is high unemployment and limited access to meaningful economic opportunities. Despite having talent, creativity, and potential, many young people struggle to secure jobs or start sustainable businesses due to a lack of funding, mentorship, and practical skills training. This often leads to frustration, hopelessness, and a reliance on informal or unstable means of income.\n\nHow I Can Advocate for Change at Commonwealth Level:\nAt the Commonwealth level, I would advocate for policies and initiatives that prioritize youth empowerment through entrepreneurship, digital skills development, and access to finance. I would push for increased investment in youth-led businesses, creative industries, and innovation hubs that align with both local needs and global trends.\n\nFurthermore, I would promote stronger partnerships between the Commonwealth, governments, and private sector stakeholders to create platforms for young people in Eswatini to showcase their skills, access mentorship, and receive the resources needed to turn ideas into sustainable livelihoods.\n\nBy representing these challenges through storytelling, data, and collaboration with other Commonwealth youth advocates, I would help ensure that the voice of Eswatini’s youth is heard and that action is taken to create lasting solutions that promote economic inclusion and dignity for young people.\n', '0', NULL, 'I have leadership and advocacy experience through my involvement with the Inspirational Biblical Approach (IBA), where I presented in schools, inspiring young people through the Word of God. My focus was on empowering youth with biblical teachings about purpose, integrity, hard work, and faith.\n\nDuring my presentations, I encouraged students to believe in themselves and to understand that God has a unique plan for each of them, as stated in Jeremiah 29:11: “For I know the plans I have for you, declares the Lord, plans to prosper you and not to harm you, plans to give you hope and a future.”\n\nThrough IBA, I used my platform to remind young people that no matter their background or current struggles, they are capable of rising above challenges when they combine faith with action. This experience has helped me grow as a youth advocate and strengthened my leadership in motivating others through both biblical wisdom and practical life guidance.\n', 'I believe I should be chosen to represent Eswatini at the Commonwealth Youth Council because of my lived experience, my passion for youth empowerment, and my commitment to driving meaningful change for young people in my country. Having grown up in Mbabane and faced the realities of financial hardship, I understand the challenges that many young people in Eswatini experience — from unemployment to lack of opportunities and limited platforms to express their ideas and talents.\n\nThrough my leadership and advocacy work, particularly with Inspirational Biblical Approach (IBA), I have actively engaged with young people in schools, encouraging them to believe in their potential, embrace entrepreneurship, and stay grounded in values of faith, hard work, and resilience. My experiences in public speaking, mentoring, and promoting youth-driven initiatives have strengthened my ability to advocate for policies that address the needs of young people, especially in areas of education, skills development, and economic empowerment.\n\nI am passionate about aligning my efforts with the Commonwealth’s vision of a more inclusive, prosperous, and youth-driven future. I would bring a strong, authentic voice from Eswatini — one that represents not only my own journey but also the aspirations of countless other young people who are striving for opportunities, recognition, and meaningful participation in shaping their future.\n\nGiven this opportunity, I will work diligently to ensure that Eswatini’s youth are heard, empowered, and inspired to become active contributors to both national and Commonwealth-level progress.', '[\"cvc-applications\\/cvs\\/Njabuliso_Ntimane_CV.pdf\"]', '[\"cvc-applications\\/supporting\\/NJABULISO NTIMANE.pdf\",\"cvc-applications\\/supporting\\/Njabuliso Ntimane.pdf\"]', NULL, '2025-07-20 09:47:44', '2025-07-20 09:47:44'),
(48, 1174, 'The three Sustainable Development Goals that most strongly align with my work and passion are SDG 4: Quality Education, SDG 8: Decent Work and Economic Growth, and SDG 9: Industry, Innovation and Infrastructure. These goals are not just theoretical frameworks for me; they have defined my personal mission and shaped every project I have undertaken in service to young people in Eswatini.\n\nMy passion for SDG 4 stems from the belief that equitable, quality education is the key to unlocking long-term opportunity and transforming marginalized communities. During my time working with the Eswatini Coding School (2023–2025), I helped lead digital hygiene and media literacy campaigns that impacted over 405 young people, many of whom had never received structured digital education before. These programs empowered youth with the knowledge and tools to participate safely and meaningfully in the digital world — a necessity in the Commonwealth\'s vision for informed and active citizens.\n\nSDG 8 is personal to me because I’ve seen first-hand how economic exclusion keeps talented youth from building dignified lives. Through my leadership as CEO of Enactus ECOT (2022–2023), I worked with a student-led team to develop innovative projects that directly impacted nearly 100 households and 300 individuals in Mankayane, focusing on sustainable livelihoods. We empowered these families with practical solutions and community-based development models.\n\nMeanwhile, SDG 9 reflects the digital future I’m helping build through Code for Change, a tech-driven initiative I co-founded in 2025. So far, we have supported 4 NGOs and 1 SME by equipping them with websites, digital strategy, and e-commerce tools, and our goal is to reach 25 organizations within the year. We believe that every community-based organization deserves a digital presence that amplifies its work. This mission aligns directly with the Commonwealth’s push for innovation and sustainable infrastructure that leaves no one behind.\n\nThrough these efforts, I have lived the values of the Commonwealth: equity, innovation, and youth-led development. My journey reflects what is possible when young people are given the tools and platforms to lead.', 'Young people across the Commonwealth can take concrete, collective action to address pressing global challenges by building collaborative platforms, sharing scalable solutions, and leading grassroots change within their communities.\n\nOne effective way we can work together is by creating Commonwealth Youth Innovation Labs—spaces where young people from different countries co-develop practical solutions aligned with the Sustainable Development Goals (SDGs). For example, SDG 4 (Quality Education) and SDG 9 (Innovation and Infrastructure) are key areas where digital skills, coding, and access to online learning can bridge education gaps. Through the Code for Change campaign I co-founded, we’ve supported NGOs and SMEs in Eswatini by building websites, digital strategies, and hosting platforms. This model could be replicated across Commonwealth nations, with youth sharing resources, templates, and mentorship to accelerate local impact.\n\nWe can also establish a Commonwealth Digital Inclusion Taskforce, driven by youth, to tackle the digital divide and misinformation. From 2023 to 2025, I helped train over 400 youth in Eswatini on digital literacy and online safety. By sharing curricula and best practices across borders, we could empower thousands more young people to safely navigate and contribute to the digital world.\n\nAdditionally, we should form Commonwealth Social Impact Coalitions that connect youth-led organizations working on similar issues. My leadership experience in the Enactus ECOT dam project—serving 300+ individuals with water and livelihood support—could inform and inspire similar sustainable development initiatives in rural parts of other member states.\n\nLastly, we must ensure no one is left behind. Through regional volunteer programs and Commonwealth-wide youth service initiatives, such as food security campaigns or digital mentorship, we can uplift vulnerable groups. I’ve seen firsthand the power of community in my work with Lend A Hand Foundation, where we fed over 5,000 tertiary students—an approach that can be scaled with Commonwealth cooperation.\n\nBy working together—not just sharing ideas but building things together—we, as Commonwealth youth, can lead the charge toward an inclusive, resilient, and innovative future.\n\n', '1', NULL, 'My leadership journey has been defined by service, strategy, and the drive to create platforms for others. As CEO of Enactus ECOT, I led a student team that developed community-based projects rooted in sustainability and entrepreneurship. We directly impacted hundreds of individuals, worked with government partners, and built models that continue to inspire future leaders.\n\nAt Eswatini Coding School, I helped design and facilitate programs that empowered youth to take control of their digital lives. I mentored students, helped shape curriculum, and led sessions that turned uncertainty into opportunity.\n\nThrough Code for Change, I now lead a startup committed to closing the digital divide. Our work is creating real value for organizations that previously lacked any web presence. I am also a committed volunteer — having served at Lend A Hand Foundation, SOS Siteki, and other community initiatives.\n\nMy leadership is grounded in lived experience, technical skill (with a diploma in Computer Science and ongoing BSc studies), and a firm belief that youth-led innovation is not the future — it is the present.', 'I should be chosen because I represent the kind of leadership Eswatini — and the Commonwealth — needs today: grounded in community, skilled in innovation, and committed to transformative action.\n\nMy journey is not built on titles, but on impact: helping feed thousands of students in need, equipping hundreds of youth with digital skills, and building digital infrastructure for organizations who would otherwise be left behind. I bring a rare mix of grassroots credibility, technical expertise, and policy insight from my international exposure through YALI.\n\nThe Commonwealth Youth Council needs voices that understand the weight of inaction and the power of practical change. I am not just ready to serve — I am prepared to lead. Not just to speak on behalf of Eswatini’s youth — but to make their voices echo across every decision the Council takes.\n\nChoosing me is choosing a vision of Eswatini that is bold, digital, inclusive, and ready to contribute to the global youth agenda.', '[\"cvc-applications\\/cvs\\/Sihle_Mthembu_CV_CommonwealthApplication.pdf\"]', '[\"cvc-applications\\/supporting\\/Sihle_Mthembu_Certificates-min.pdf\"]', NULL, '2025-07-20 13:39:22', '2025-07-20 13:39:41'),
(49, 1226, 'The top three Sustainable Development Goals (SDGs) I am most passionate about are Quality Education (SDG 4), Reduced Inequalities (SDG 10), and Decent Work and Economic Growth (SDG 8). \n\nI am the Founder of Study Abroad Guide Eswatini (SAGE), an online platform dedicated to sharing valuable information on scholarship opportunities, application tips, pre-university programs, standardized testing, and the study abroad experience—specifically tailored for Swazi students. Through SAGE, I actively contribute to the Commonwealth\'s education goals by guiding and mentoring students towards global learning opportunities. This supports the Commonwealth’s commitment to empowering young people through access to quality education and skills development. \n\nIn alignment with Reduced Inequalities, SAGE operates as a free and accessible platform, primarily via TikTok under the handle @study.abroad.guide.sz, making critical educational resources available to all—regardless of socio-economic background. As an Allan Gray Orbis Foundation Candidate Fellow, I have personally experienced the life-changing impact of receiving a fully funded scholarship, which enabled me to pursue higher education despite financial limitations. This aligns with the Commonwealth\'s values of fairness, equity, and inclusion. \n\nLastly, in relation to Decent Work and Economic Growth, SAGE contributes to upskilling the youth by encouraging them to pursue tertiary education abroad. This investment in human capital development supports long-term national and regional economic growth—an essential pillar of the Commonwealth\'s strategic priorities.', 'One of the biggest challenges facing the youth of Eswatini is limited exposure and lack of awareness about opportunities—particularly in education, scholarships, and global programs. This lack of access to vital information often results in untapped potential and missed opportunities for many talented young people. \n\nThrough my platform, Study Abroad Guide Eswatini (SAGE), I aim to change that. By joining the Commonwealth Youth Council, I would advocate for change by drafting a policy brief highlighting this issue and presenting SAGE as a practical, community-driven solution. \n\nI would seek support—such as a laptop, transport funding, and data bundles—from the Commonwealth\'s wide network of driven individuals and partner organizations to help scale SAGE\'s impact. Additionally, I would aim to pitch to speak at Commonwealth summits, youth panels, and side events, using these platforms to raise awareness and boost SAGE’s visibility on a global scale. \n\nFinally, I plan to collaborate with local NGOs and youth organizations, leveraging the credibility gained through Commonwealth-level advocacy to expand SAGE’s reach and influence at home in Eswatini.\n', '0', NULL, 'At 20 years old, I have held five leadership positions that reflect my commitment to youth empowerment and service. I am the Founder of Study Abroad Guide Eswatini (SAGE), a digital platform where I mentor students and share educational content on scholarships, pre-university programs, and study abroad opportunities. I have spoken to student groups at the 2025 Career Expo held at both Mavuso Trade Centre and Prince of Wales Stadium, and I regularly assist students who reach out for guidance. \n\nAs Senior Prefect, I led by example through academic excellence and responsibility, supporting the Disciplinary Committee and serving as a role model to my peers. \n\nAs Founder and Chief Editor of my high school’s newsletter, I led a creative team and wrote articles on mental health, tackling sensitive issues like depression, bullying, and suicide ideation. \n\nAdditionally, I founded and chaired the Library Volunteering Club, where I worked with fellow students to maintain a clean, organized, and accessible school library. \n\nThese experiences demonstrate my dedication to leadership, advocacy, and creating spaces where young people can thrive.', 'I believe growth begins where comfort ends—and I am willing to do what scares me in pursuit of that growth. During my gap year, instead of remaining idle, I confronted one of my biggest fears: public speaking. I delivered talks at the 2025 Career Expo in both Manzini and Mbabane, and made a presentation on scholarship applications to the Form 6 class at St. Mark’s High School. \n\nI am also an Allan Gray Orbis Foundation Candidate Fellow. As part of this competitive process, I wrote and edited 10 essays, progressed through the interview stages, attended the Entrepreneurial Leadership Camp in Namibia, and was selected as one of only 4 recipients (from a cohort of about 20 finalists) to receive the fully funded scholarship that year. This journey has made me well-versed in scholarship applications—experience that adds credibility to my youth empowerment initiative, Study Abroad Guide Eswatini (SAGE). \n\nLastly, I am eager to collaborate with other youth leaders across the Commonwealth, exchange ideas, and expand SAGE’s reach through shared resources, partnerships, and global exposure.', '[\"cvc-applications\\/cvs\\/Swelihle Maziya CV.pdf\"]', '[\"cvc-applications\\/supporting\\/Swelihle Maziya Combined Results.pdf\"]', NULL, '2025-07-20 17:46:48', '2025-07-20 17:46:48'),
(50, 1236, 'SDG 8: Decent Work and Economic Growth\nMy passion for SDG 8 stems from my direct experience with the youth unemployment crisis in Eswatini, where youth unemployment stands at 48.7% despite recent improvements from 58.2% in 2021. Through my work as Executive Board Member of Seed Soil Harvest Ministry, I witnessed how unemployment devastates young lives, leading to mental health challenges and substance abuse. This aligns perfectly with the Commonwealth Charter\'s commitment to \"sustainable development to eradicate poverty by pursuing inclusive growth\" and the emphasis on \"creating opportunities for youth employment and entrepreneurship.\" My work at Seed Soil Harvest NGO and research focus on consumer behavior and market analysis directly supports the Commonwealth\'s vision of evidence-based policymaking for economic empowerment.\n\nSDG 4: Quality Education\nAs a liSwati from the countryside of Mshingshingini—my maternal home—and the slums of Msunduza, past Mgababa, Corinte, my paternal home, I understand education\'s transformative power.  It has been the vehicle of my achievements, creating an opportunity to learn across multiple educational contexts—from Mauritius to the United States through scholarly merits. Thus, I remain a strong advocate of equitable access to quality education and lifelong learning opportunities for youth. In Eswatini, the higher education system faces critical challenges with high dropout rates due to poverty (58.9% of the rural population living below the poverty line), overstretched government resources, and skills mismatches that leave graduates unemployable. By advocating for SDG 4, I support the Commonwealth Charter\'s emphasis on \"access to health, education, food, and shelter\" and support the Commonwealth\'s Strategic Plan goal of strengthening \"education systems\" to meet SDG targets. \n\nSDG 3: Good Health and Well-being\nMy research has centered on quantifying what truly matters to society: health and equity. My work has looked into promoting technology adoption for the prevention of HIV and type 2 diabetes risk using behavioral economics to address health crises. In Eswatini, where 27% HIV prevalence compounds youth mental health challenges—with 40% of mental illness patients being youth aged 15-35—this work is crucial. The Commonwealth Secretariat\'s recent partnership with ECSA-HC to \"improve mental health for African youth\" directly reflects this priority, aligning with the Charter\'s commitment to promoting \"health and well-being in combating communicable and non-communicable diseases.\"', 'The biggest challenge facing the youth of Eswatini is the interconnected crisis of high unemployment, overburdened healthcare systems, and poor mental health outcomes. The educational systems often prepare youth for jobs that don’t exist, while lacking in entrepreneurial and life skills training. This puts over half of Eswatini’s citizens unemployed, particularly the youth. Research shows that 53% of mental health cases involve youth aged 18-35, with unemployment directly linked to increased substance abuse, depression, and anxiety or emotional distress. Despite recent improvements in unemployment dropping from 58% to 48%, a majority of youth still remain economically inactive, creating a mental health emergency where 15% of teenagers have attempted suicide. In addition to that, critical healthcare touchpoints are eroding at a fast rate, with access to medication and healthcare services becoming more unavailable and exacerbating the challenges faced by youth. I anticipate the impacts of these challenges are likely to lead to a tenfold setback in sustainable economic growth, education, and health/well-being, reversing the Commonwealth\'s sustainable goals mandates progress. \n\nTo preserve these Commonwealth Charters would require addressing and advocacy for the following at the Commonwealth level:\n1. Elevate Youth Mental Health and Employment in Policy Forums: Champion Eswatini youth perspectives at the Commonwealth Youth Council by sharing data and real stories to inform cross-national responses.\n\n2. Promote Education Reform: Advocate for education systems that blend academic, vocational, and entrepreneurial skills, aligning curricula with the needs of local economies and the aspirations of youth.\n\n3. Leverage Commonwealth Platforms: Propose regional initiatives such as youth entrepreneur bootcamps, mentorship exchanges, and digital skills programs funded or co-sponsored by Commonwealth institutions.\n\n4. Data-Driven Decision-Making: Call for investment in mental health and employment data across Commonwealth youth to drive evidence-based policy innovations', '1', NULL, 'National Level - Eswatini:\nAs co-founder of the Seed Soil Harvest (SSH) NGO, I have led strategic planning for youth-focused agricultural development programs, sexual health, and environmental campaigns, representing rural youth voices in policy discussions with government agencies, including the Eswatini Environmental Authority and other NGOs. I have successfully hosted multiple panel talks and workshops that engaged the youth with farming initiatives and skill audit ventures. Further, I provide technical expertise to the NGO on youth employment strategies, translating complex economic research into actionable policy recommendations for rural youth development.\n\nInternational Level:\nMy academic research projects span across South Africa, Mauritius, and Eswatini and have centered on challenges that impact the global south, particularly Africa. Serving as a cultural liaison, I have presented my findings on health behavior and agricultural economics studies at the Southern Agricultural Economics Annual Conference and Minorities in Agriculture, Natural Resources, and Related Sciences (MANRRS) annual conference. My goal has been to represent the perspectives of Sub-Saharan African youth through research on agricultural technology adoption and consumer behavior to international academic and policy audiences.', 'My commitment to the Commonwealth Charter values of democracy, human rights, and sustainable development, combined with proven leadership in addressing the exact challenges facing Commonwealth youth—unemployment, education gaps, and health vulnerabilities—makes me uniquely qualified to represent Eswatini\'s 400,000+ youth while contributing to the collective advancement of 1.5 billion Commonwealth young people.\n\nAs the Commonwealth celebrates its Year of Youth and defines priorities for the next decade, I offer the vision, skills, and commitment needed to ensure youth voices drive meaningful change. My experience representing Eswatini youth and broadly African youth perspectives on international platforms, combined with my policy analysis expertise, positions me to effectively advocate for systemic change that addresses root causes rather than symptoms of youth marginalization across the Commonwealth.', '[\"cvc-applications\\/cvs\\/BESUTHU NKAMBULE RESUME (1).docx\"]', '[\"cvc-applications\\/supporting\\/Besuthu_Nkambule_ Qualifications.pdf\"]', NULL, '2025-07-20 22:24:57', '2025-07-20 22:24:57'),
(51, 1211, 'Sdg# 1 No Poverty \nSdg#13 Climate Action\nSdg#5 Gender Equality ', 'Unemployment \nMore than half of the out-of-school youth Eswatini are struggling to make ends meet due to financial constraints and lacking jobs. Unemployment is a parent to children namely;  poverty, drug abuse, suicide and depression. \n\nThe youth are the drivers of change, without them no action or change takes place. We have power and great infuence to the yound and old people around.', '1', 'Eswatini Youth Parliament on Climate Change.\nI was selected based on the interest and works as far as climate change is concerned to represent Shiselweni region. ', 'Youth Parliamentarian \n\nI represented Shiselweni region as a Youth Parliamentarian. I worked to implement the National Adaptation Plan in communities to raise awareness about climate change related issues. ', 'Firstly i meet all the requirements stated on the application.\nSecondly i have good communication skills; written and spoken which means i qulify for public speaking.\nI also think that i have gained exposure and experience while working with different stakeholders and NGOs across the country which makes my application even more competitive. ', '[\"cvc-applications\\/cvs\\/Melusi Lukhele CV..pdf\"]', '[\"cvc-applications\\/supporting\\/MelusiLukhele.jpg\"]', NULL, '2025-07-20 23:18:10', '2025-07-20 23:18:10'),
(52, 870, 'I am most passionate about the following Sustainable Development Goals: 1. SDG 4: Quality Education\nMy journey as President of the Junior Achievement Eswatini Alumni and Limkokwing University ambassador have shown me the transformative power of education. Education not only empowers individuals, but it is foundational to addressing many other social and economic issues.\n\n2.SDG 8: Decent Work and Economic Growth\nI believe strongly in promoting entrepreneurship and youth empowerment as pathways to employment and economic inclusion. My work supporting JA alumni and my participation in various entrepreneurship training initiatives align closely with this goal.\n\n3.SDG 16: Peace, Justice and Strong Institutions\nYouth engagement in governance and policy dialogue is crucial. During my time with the Mbabane Municipal Council, I gained valuable insight into how local governance can uplift communities. I aim to amplify youth voices in such spaces to promote accountability and social justice.\n\nThese goals reflect the Commonwealth Youth Council’s mandate to strengthen youth participation in governance, decision-making, and development processes across member states.', 'The biggest challenge youth in Eswatini face is youth unemployment and limited access to economic opportunities. Many young people struggle to find meaningful work or access funding for entrepreneurial ventures. This often leads to frustration, disempowerment, and increased vulnerability.\n\nAt the Commonwealth level, I would advocate for the following:\n•Increased investment in youth-led enterprises, by proposing regional funding models or mentorship exchanges among Commonwealth nations.\n•Youth entrepreneurship policy dialogues, allowing young people from Eswatini to share their perspectives and solutions at international platforms.\n•Technical and vocational education support, with best practices shared across Commonwealth states to enhance youth employability', '1', NULL, 'For 2 years I served as the President of the Alumni Network for Junior Achievement Eswatini, where I led initiatives that support youth entrepreneurs and advocate for youth-friendly economic policies. I also represented Eswatini internationally at the Global JA Alumni Summit in Porto, Portugal, and the Africa Alumni Leaders Bootcamp in Kampala, Uganda.\n\nThrough these platforms, I have built international networks, contributed to leadership conversations, and mentored fellow young leaders. Locally, my work with Imbita Women’s Finance Trust and my job-shadowing at the Mbabane Municipal Council have positioned me to understand community development from both grassroots and policy levels', 'I am passionate about the youth in Eswatini & I believe we are capable of achieving more than we are doing currently, I meet a lot of the youth in the four regions of Eswatini, I understand their perspectives, challenges and how we can improve. I bring a unique blend of grassroots experience, international exposure, and strategic vision. With a background in business management and practical experience in youth leadership and community empowerment, I have demonstrated a consistent commitment to driving change.\n\nWhat sets me apart is my ability to connect with the youth & the different stakeholders that are in the youth space, from local community members to international youth leaders — and my passion for advocacy, entrepreneurship, and leadership development. As a Limkokwing University Ambassador, I have also acted as a youth role model and changemaker.\n\nI am not only capable of representing the youth of Eswatini on a global stage but also of bringing back meaningful partnerships, policy ideas, and actionable initiatives that will benefit the country’s youth ecosystem. My vision is to help build a more connected, empowered, and economically resilient generation of young emaSwati.', '[\"cvc-applications\\/cvs\\/Curriculumn Vitae Bonginkosi Ntshalintshali.pdf\"]', '[\"cvc-applications\\/supporting\\/20250130144748.pdf\"]', NULL, '2025-07-21 01:46:56', '2025-07-21 01:46:56'),
(53, 1224, '1. No poverty, SDG 1: I am passionate about ending poverty through skills development and job creation, especially for rural youth and women.  My work in fashion design and agriculture supports community-level reliance. The commonwealth\'s focus on youth empowerment and sustainable development aligns with my passion to uplift underserved communities. \n2. Decent work and economical growth, SDG 8: my sewing and tunnel farming training equip me with practical skills to stimulate entrepreneurship among young people and women. This goal directly aligns with the commonwealth\'s mandate to promote inclusive economic growth and productive employment for youth.\n3. Gender equality, SDG 5: my experience with the women farmer foundation has inspired me to champion equal opportunities for young women in agriculture and vocational training. This echos the commonwealth\'s commitment to gender equity and women\'s empowerment. ', 'One of the biggest challenge faced by eswatini youth is limited access to skills development and job opportunities, particularly in rural areas. Many young people finish school but lack the resources or mentorship to build a sustainable future. At the commonwealth level I would advocate for: \n1. Increased funding for grassroots training programmes in technical and agricultural fields. \n2. Policy support for youth-led community enterprises. \n3. Platforms for you youth voices within international forums to ensure inclusivity and equitable development. ', '1', NULL, 'I was  mentor at CFI Finclude in Jubukweni vegetable cluster where I guided the local youth in financial inclusion and community development practices with the help of workshops and trainings that Finclude provided to help with the mentorship. I was also a women farmer foundation trainee where I promoted sustainable agriculture among young women and youth becoming a voice for inclusive agri-entrepreneurship. And I am also a sewing program graduate, which is where I supported fellow participants and helped raise awareness about vocational training benefits in my community. ', 'I should be chosen because I bring grassroots voice, lived experience and a strong commitment to empowering underrepresented youth. My journey reflects resilience, service and a belief in using practical skills for change. I aim to represent rural youth perspectives, to champion youth-focused policies and to bridge local needs with global opportunities. I am ready to serve as a catalyst for transformation,  ensuring that the voices of Eswatini\'s youth are heard and empowered across the commonwealth. ', '[\"cvc-applications\\/cvs\\/inbound9187713903663252915.docx\"]', '[\"cvc-applications\\/supporting\\/inbound3330084942585988553.jpg\",\"cvc-applications\\/supporting\\/inbound6830793232247598437.jpg\",\"cvc-applications\\/supporting\\/inbound4207932176919261777.pdf\"]', NULL, '2025-07-21 03:29:57', '2025-07-21 03:29:57'),
(54, 1216, 'The top 3 Sustainable Development Goals (SDG) qualities that I am passionate about are :\n1.	SDG 3: Good Health and Well-being – As someone passionate about biological sciences, I believe access to quality healthcare is fundamental for all. This aligns with the Commonwealth mandate to promote health equity and empower young people to advocate for better health systems, especially in under-resourced regions.\n2.	SDG 5: Gender Equality – I am deeply committed to empowering women and girls. Gender equality is central to the Commonwealth’s commitment to human rights, democracy, and inclusive development. Promoting equal opportunities for women aligns with building fair and resilient societies across member states.\n3.	SDG 4: Quality Education – I value education as a tool for change, especially in Africa, aligning with the Commonwealth’s goal to equip young people through learning and skills.', 'One of the biggest challenges youth in Eswatini face is high unemployment. Despite many being educated, job opportunities are limited, which leads to poverty, frustration, and mental health struggles. This also contributes to risky behaviors, early pregnancies, and migration.\n\nAt the Commonwealth level, I can advocate by:\n	1. Raising awareness of the need for youth-targeted economic policies and investment in skills development.\n	2. Pushing for partnerships between governments and private sectors to create internships, entrepreneurship programs, and job opportunities.\n	3. Highlighting the importance of innovation and digital skills for youth to thrive in today’s economy.\nBy being a voice for Eswatini’s youth, I can contribute to shaping inclusive and action-driven Commonwealth policies.', '1', 'I have been a class representative at my university(Southern Africa University) for 3 years (2022-2025). ', 'This role has helped to prune and shape me as leader, I have learnt how to be resilient, patient, optimistic, how to be a problem solver and teamwork skills.', 'I should be chosen to represent Eswatini at the Commonwealth Youth Council because I am passionate about youth development, especially in health, education, and gender equality. I’ve served as a class representative for three years at university, a role that taught me to be strong, resilient, and optimistic. It also helped me grow in confidence and communication skills that are essential for effective leadership and advocacy. I understand the real challenges that youth face, and I’m ready to represent their voices, push for meaningful change, and contribute to the Commonwealth’s mission of empowering young people across member states.', '[\"cvc-applications\\/cvs\\/Nelile_L_Manana_CV.pdf\",\"cvc-applications\\/cvs\\/Nelile_Manana_Motivational_Letter.pdf\",\"cvc-applications\\/cvs\\/Nelile_Manana_recommendation letter.pdf\"]', '[\"cvc-applications\\/supporting\\/Nelile __Manana.pdf\",\"cvc-applications\\/supporting\\/Nelile_ Manana.pdf\"]', NULL, '2025-07-21 08:59:00', '2025-07-21 08:59:00'),
(55, 654, 'SDG 4: Quality Education - Ensure inclusive and equitable quality education and promote lifelong learning opportunities for all.Education is a cornerstone of social development and a key enabler for achieving other SDGs. The Commonwealth strongly advocates for accessible and quality education across all its member states. It fosters exchange programs, develops curriculum frameworks for SDGs, and supports initiatives that strengthen education systems, thereby contributing to human capital development and democratic participation.\nSDG 5: Gender Equality - Achieve gender equality and empower all women and girls. Gender equality is a core principle enshrined in the Commonwealth Charter. The Commonwealth actively works to eliminate discrimination, combat gender-based violence, and promote women\'s economic and political empowerment. This aligns with its broader mandate of promoting human rights and ensuring inclusive societies where all citizens can contribute equally.\nSDG 8: Decent Work and Economic Growth - Promote sustained, inclusive and sustainable economic growth, full and productive employment and decent work for all.The Commonwealth aims to boost trade, foster economic growth, and address issues like unemployment, especially among youth. It supports member countries in developing policies that create decent work opportunities, strengthen economies, and reduce inequality, directly contributing to prosperity for its citizens.', 'Unemployment is the biggest challenge that the youth of Eswatini are facing I can advocate for change by implementing policies that will promote youth employment and promote skills by training the youth vocational skills that will empower them to make their lives better and improve their financial standing ', '0', NULL, 'I believe I strive to be the best in what my group and I are assigned to do. ', 'I believe everyone deserves a fair chance in representing the youth as I am part of the youth myself. I believe my advocacy skills will be improved as I am an aspiring social work student currently doing my third year at the university of Eswatini and I believe to be the best advocate for the youth I should be given a chance to experience and improve my skills on what an advocator is expected to do ', '[\"cvc-applications\\/cvs\\/inbound4377999660250677148.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound195209271795988287.pdf\"]', NULL, '2025-07-21 10:30:34', '2025-07-21 10:31:37'),
(56, 1233, '1. SDG 4: Quality Education\nEducation is the foundation for individual empowerment and societal progress. I believe it\'s the key to unlocking potential, fostering critical thinking, and equipping young people with the skills needed to navigate a rapidly changing world.\n\nHow it aligns with the Commonwealth Mandate:\nThe Commonwealth explicitly highlights \"access to education\" as a core principle and places \"special emphasis on supporting young people to design and drive youth-led initiatives\" related to education. Investing in quality education directly empowers young people to realize their full potential, a central tenet of the Commonwealth Youth Programme.\n\n2. SDG 8: Decent Work and Economic Growth\nYouth unemployment and underemployment are pressing issues in many Commonwealth nations, hindering development and leading to social challenges. I am passionate about creating opportunities for young people to gain meaningful employment, develop entrepreneurial skills, and contribute to their national economies.\n\nHow it aligns with the Commonwealth Mandate:\nThe Commonwealth supports initiatives like the Commonwealth Alliance of Young Entrepreneurs (CAYE), which focuses on building support for youth entrepreneurship and knowledge-sharing. This demonstrates a clear commitment to enabling young people to contribute to economic growth.', 'The biggest challenge facing the youth of Eswatini is high youth unemployment and the lack of meaningful economic opportunities. This challenge is multifaceted, stemming from a skills mismatch between education and industry needs, limited access to capital and mentorship for young entrepreneurs, and a job market that struggles to absorb the growing youth demographic. This leads to widespread frustration, underutilized potential, and can contribute to social issues.\n\nAt  the Commonwealth level, I would advocate for change by:\nLeveraging Commonwealth Platforms: Actively participate in forums like the Commonwealth Youth Forum (CYF) and the Commonwealth Youth Ministers Meeting (CYMM), using these platforms to present data-driven insights on Eswatini\'s youth unemployment challenge and propose concrete solutions. I would specifically highlight the need for targeted policies that address the unique economic contexts of small countries like Eswatini.\n\nPromoting Skills Development & Entrepreneurship: Advocate for enhanced Commonwealth-wide initiatives that focus on vocational training, digital literacy, and entrepreneurship incubators tailored for young people. I would push for the sharing of best practices and successful models from other Commonwealth nations that have made strides in youth employment, encouraging Eswatini to adopt and adapt these.\n\nFostering Youth-Led Solutions: Emphasize the importance of co-designing economic solutions with young people themselves. This means advocating for Commonwealth funding and support for youth-led enterprises and innovative projects that can create jobs and contribute to local economies, empowering young Swazis to be active participants in their economic future.', '1', NULL, 'Yes, I have represented the youth at an international level.\n\nIn 2022, I had the opportunity to attend an International Youth Connect (IYC) conference in Zambia, where I represented the youth of Eswatini alongside two other young people. Our primary objective was to engage in discussions and learn about developing youth-led initiatives, with the specific aim of establishing an IYC chapter in Eswatini upon our return.\n\nWhile the full implementation of the IYC chapter in Eswatini did not materialize as planned, this experience was incredibly valuable. It provided me with firsthand exposure to international youth collaboration, cross-cultural communication, and the practicalities of advocating for youth development on a broader scale. It deepened my understanding of the challenges and opportunities involved in translating global visions into local action, and reinforced my commitment to fostering youth leadership and engagement. This experience, though brief, served as an important foundational step in my journey of leadership and advocacy for young people.', 'I  should be chosen to represent Eswatini at the Commonwealth Youth Council because I possess a unique blend of sustained passion, practical experience within youth development, and a clear vision for how to champion the aspirations of Swazi youth on an international stage.\n\nMy dedication to youth empowerment is not recent; it\'s a deeply ingrained commitment that has evolved over several years. Since 2018, as an author, my writing has predominantly focused on youth-related themes, allowing me to delve into the challenges and triumphs faced by young people, articulate their perspectives, and advocate for their needs through the power of storytelling. This background has honed my research, communication, and advocacy skills.\n\nFurthermore, since October 2021, my professional involvement in youth organizations has provided invaluable hands-on experience. While my role has encompassed administrative duties, this direct engagement has given me an intimate understanding of the operational realities, pressing issues, and immense potential within youth-led initiatives. It has solidified my passion for effective youth programming and grassroots development.\n\nMy participation in the International Youth Connect Conference in Zambia, where I represented Eswatini, provided crucial international exposure. It ignited my understanding of global youth collaboration and the mechanisms required to translate shared visions into local impact, even if the subsequent local initiative didn\'t fully materialize. This experience taught me resilience and the complexities of advocacy beyond borders.\n\nI am particularly passionate about addressing key challenges facing Eswatini\'s youth, such as youth unemployment and the need for quality education and sustainable economic opportunities, issues that directly align with the Commonwealth\'s mandate for sustainable development and youth empowerment. My ability to articulate these local challenges within a global context, combined with my commitment to the SDGs, positions me as an effective voice for Eswatini.\n\nI am not merely seeking a position; I am seeking an opportunity to actively contribute to the Commonwealth Youth Council\'s mission. I am confident that my passion, my direct experience working within youth organizations, my advocacy through writing, and my international exposure make me a dedicated, articulate, and highly motivated representative ready to champion the cause of Eswatini\'s youth and contribute meaningfully to the Commonwealth\'s collective goals.', '[\"cvc-applications\\/cvs\\/CV- Mbali Masuku.pdf\"]', '[\"cvc-applications\\/supporting\\/Certified Certificate .pdf\"]', NULL, '2025-07-21 11:09:41', '2025-07-21 11:09:41'),
(57, 1242, 'SDG 1: Zero Hunger\nSDG 5: Gender equality\nSDG 13: Climate action\n\nThe Commonwealth strives for peace, prosperity and cooperation among its member states through collaboration. The 3 SDGs i mentioned above are the most widely affected across different member states of the Commonwealth, and I believe that tackling the 3, would improve billions of lives of the commwealth people.', 'The Youth of Eswatini is currently faced with high rates of unemployment, which have been hypothesized to have been caused by high skills supply, with limited positions as the country has invested more of its recources towards achieving a high education rate, and the entrepreneurial spirit which actually creates jobs, has suffered the good cause. At commonwealth level, i would advocate for the support and promotion of social entrepreneurship, an integration of the education system with job creation and fostering of skills in the current generation, and those to come.', '1', NULL, 'From as young as Primary school, i served as a class representative, school prefect through highschool and tertiary level as well. I have also engaged in extra curricular activities where i had to exercise my leadership skills being debate clubs president in both primary and high school. To perfect my leadership skills, in tertiary, i served in the Enactus program in the country where I served the ENACTUS UNESWA Mbabane campus team as Marketing Manager (2021/22), and team CEO (2022/2023). During my term as CEO, i led my team into victory as it was crowned the Enactus Eswatini National Champions of 2023. I also served as Vice chairperson of the Environmental Health Students Association in 2023, where we advocated for cleaner environments, climatic rehabilitation and protection through tree planting campaigns, advocation, clean up campaigns, and other environmental health activities. Im currently serving as CEO of Lunwali Feeds, a Swati owned startup business in the Lobamba area.', 'I am more than just a confident, and fluent public speaker, i believe in creating a better tomorrow for EmaSwati through actions not words, no matter how little they are, and i stand for what i believe in. I possess discipline, and professionalism that is remarkable, and brains that will harness as much useful information as the Kingdom needs.\nTo add on that, i am a young liSwati female, 24 years of age who has fearlessly stood on several stages, nationally and internationally, with hope and determination that one day, every young person will get equal rights to success, and peace shall reign, once again.', '[\"cvc-applications\\/cvs\\/CV Nokwethu.pdf\"]', '[\"cvc-applications\\/supporting\\/Academic certificate UNISWA.pdf\",\"cvc-applications\\/supporting\\/YALDI Certificate.pdf\",\"cvc-applications\\/supporting\\/NOKWETHU.pdf\"]', NULL, '2025-07-21 12:16:20', '2025-07-21 12:16:20');
INSERT INTO `c_y_c_applications` (`id`, `participant_id`, `sdg_response`, `challenge_response`, `representation_experience`, `representation_details`, `leadership_experience`, `motivation`, `cv_upload`, `supporting_documents`, `deleted_at`, `created_at`, `updated_at`) VALUES
(58, 1146, ' SDG 4: Quality Education\nI am passionate about advancing inclusive and transformative education that equips young people with relevant skills for life and work. Through my advocacy, I champion increased access to Technical and Vocational Education and Training (TVET) and digital literacy—especially for underserved youth. This aligns with the Commonwealth’s commitment to youth empowerment through education, as reflected in initiatives that enhance learning outcomes and prepare youth for active civic and economic participation.\n\n\n SDG 3: Good Health and Well-being\nAs a youth advocate working in Sexual and Reproductive Health and Rights (SRHR), I am committed to ensuring that young people have access to comprehensive, youth-friendly health services. My work focuses on mental health, HIV prevention, menstrual health, and ending gender-based violence. These priorities are in line with the Commonwealth Youth Council’s strategic pillars on health and well-being, as well as the Commonwealth’s broader agenda on supporting healthy populations and empowering youth as change agents in health systems.\n\n\nSDG 5: Gender Equality\nI strongly believe that gender equality is a prerequisite for sustainable development. My advocacy promotes inclusive policies that empower girls, women, and LGBTQ+ youth to thrive in safe and supportive environments. This is consistent with the Commonwealth’s long-standing commitment to gender equality and the protection of human rights, and I aim to amplify youth-led gender justice initiatives across member states.\n', 'The biggest challenge facing youth in Eswatini is limited access to comprehensive SRHR services and mental health support, compounded by high unemployment. These interconnected issues hinder young people’s ability to thrive academically, economically, and socially.\n\nAt Commonwealth level, I would advocate for the integration of youth SRHR and mental health into mainstream youth development programs, support the establishment of a regional youth SRHR taskforce under the Commonwealth Youth Council, and promote partnerships that fund youth-led, intersectional solutions. My goal is to ensure that youth voices from Eswatini and similar contexts shape inclusive, evidence-based policies across the Commonwealth.\n', '1', NULL, 'Yes, I have represented youth at local, national, regional, and international levels. Locally, I serve on the EU Eswatini Youth Advisory Board and as a Social Accountability Monitoring Champion for SRHR at SAfAIDS Eswatini. Regionally, I am the Country Representative for the UNITED! Movement, which fosters cross-country advocacy for youth-led SRHR and HIV networks across East and Southern Africa. Internationally, I am a CSE Academy Anchor with Rutgers and a Youth Expert Advisor for the Y!Participate initiative at the MHPSS Collaborative, where I help shape strategies, develop resources, and strengthen youth engagement in global mental health and SRHR spaces.\n', 'I should be chosen to represent Eswatini at the Commonwealth Youth Council because I bring a proven track record of youth leadership, policy advocacy, and grassroots engagement in areas that directly align with the Council’s mandate—particularly education, SRHR, mental health, and youth empowerment.\n\nThrough my roles with the EU Eswatini Youth Advisory Board, SAfAIDS, UNITED! Movement, Rutgers, and the MHPSS Collaborative, I have consistently championed inclusive, rights-based solutions for young people at local, regional, and international levels. I understand the lived realities of youth in Eswatini and have the experience, voice, and collaborative spirit needed to bridge them with global policy platforms.\n\nI am passionate about ensuring that Eswatini’s youth are not just spoken for, but meaningfully included in shaping the future of the Commonwealth. I bring both empathy and strategic insight, and I am ready to serve.', '[\"cvc-applications\\/cvs\\/inbound5386742976162685702.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound2771899345699019920.pdf\",\"cvc-applications\\/supporting\\/inbound7086900279776821909.pdf\",\"cvc-applications\\/supporting\\/inbound1227458658791076175.pdf\"]', NULL, '2025-07-21 12:46:40', '2025-07-21 12:46:40'),
(59, 995, '1. SDG 8 – Decent Work and Economic Growth\nI am deeply passionate about ensuring that young people, especially in Eswatini and across the Commonwealth, have access to decent jobs and economic opportunities. With youth unemployment being a major crisis, SDG 8 directly addresses the need to empower young people with skills, training, and sustainable jobs. The Commonwealth emphasizes youth empowerment, inclusive economic growth, and entrepreneurship.\n2. SDG 4 – Quality Education\nQuality, inclusive, and relevant education is the foundation of any prosperous society. In Eswatini, many young people face barriers to higher education, digital learning, and skills development  all critical to compete in the 21st-century economy. The Commonwealth prioritizes universal access to education and supports digital learning, teacher training, and curriculum development.\n3. SDG 5 – Gender Equality\nEmpowering girls and young women is essential to national development. In Eswatini, young women often face gender-based violence, early marriage, and limited leadership opportunities. The Commonwealth Charter is strongly committed to gender equality and the protection of women\'s rights.', 'The biggest challenge faced by the youth of Eswatini is unemployment. This issue is compounded by limited access to quality education, insufficient vocational training , and a lack of entrepreneurial support which then makes it quite difficult for young Emaswati to find or create sustainable livelihoods. The result is widespread poverty, frustration and social instability.', '1', 'i represented by schoolmates at high school and also when right now that i am at tertiary i had the opportunity to speak up for all my fellow students during a meeting with our lectures where i thought there was injustice happening around the school.', 'Trough out my high school years i have been a leader(school prefect) who was responsible for making sure all students adhere to English speaking. I would participate in different competitions; debate, science fair(robots),  at regional level. I learnt how to deal with a large number of students who have different perspectives.  Speaking on behalf of everyone at my current school really unleashed the true leader in me and to see that things changed after i had talked also made me realise i can be a voice to the voiceless.', 'I should be chosen to represent Eswatini at the Commonwealth Youth Council because I am deeply committed to being a voice for the voiceless, especially for the many young people in our country who feel excluded from national and international decision-making. As a young leader who understands the realities facing Eswatini’s youth  including high unemployment, limited access to quality education, gender inequality, and the urgent threat of climate change  I am passionate about turning these challenges into opportunities for change.', '[\"cvc-applications\\/cvs\\/inbound6873471320469027360.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound2227572281298343312.pdf\"]', NULL, '2025-07-21 15:02:36', '2025-07-21 15:02:36'),
(60, 1207, 'I am most passionate about SDG 8: Decent Work and Economic Growth, SDG 4: Quality Education, and SDG 5: Gender Equality. These goals resonate deeply with the Commonwealth\'s commitment to fostering economic growth, human capital development, and inclusion across member states. Promoting decent work opportunities through skills development and entrepreneurial empowerment aligns with the Commonwealth\'s agenda of youth participation in sustainable economic development. Additionally, advocating for equitable access to quality education and gender-balanced leadership directly supports the Commonwealth’s values of fairness, inclusion, and human rights.', 'The youth of Eswatini face high unemployment and limited access to sustainable economic opportunities. Despite being the majority demographic, young people struggle to access decent jobs, entrepreneurial financing, and capacity-building platforms, contributing to cycles of poverty and disempowerment.\n\nAt Commonwealth level, I can advocate for inclusive economic policies and youth-driven entrepreneurship programs, by sharing best practices from other member countries, proposing capacity development initiatives, and lobbying for stronger youth participation in policy formulation. Engaging in Commonwealth Youth Council platforms will allow me to represent Eswatini’s youth voice and drive dialogue on bridging the economic gap for young people in small states like Eswatini.', '1', NULL, 'currently serve within ESNYCA, supporting youth cooperatives and promoting youth economic empowerment in Eswatini. My leadership role includes coordinating capacity-building workshops, conducting needs assessments, and advocating for youth inclusion in cooperative development policies. My advocacy extends to digital platforms where I raise awareness on youth economic challenges and potential cooperative solutions. Through international conferences and local forums, I have developed skills in public speaking, negotiation, and collaborative leadership, strengthening my role as a youth advocate.', 'I should be chosen to represent Eswatini because of my practical experience in youth economic empowerment, cooperative development, and advocacy work. My background in Business Information Technology and cooperative management positions me to bridge digital solutions with policy advocacy for youth advancement. I bring a committed, grassroots perspective that reflects the real challenges and aspirations of young people in Eswatini. As a dedicated leader, I am ready to engage actively with Commonwealth structures, advocate for inclusive economic policies, and bring back valuable opportunities for Eswatini\'s youth', '[\"cvc-applications\\/cvs\\/Mnisi_Sindisiwe_Hlobsile_CV.docx\"]', '[\"cvc-applications\\/supporting\\/Sindisiwe Mnisi results .pdf\"]', NULL, '2025-07-21 17:18:08', '2025-07-21 17:18:08'),
(61, 829, 'The top 3 sustainable development goals that I am passionate about are; Firstly, it is poverty and hunger. The Commonwealth has a strong commitment to eradicating poverty and hunger, with a focus on achieving food security and promoting sustainable agriculture. Secondly, health and well being. The Commonwealth works to ensure healthy lives and to promote the well-being for all ages including access to quality healthcare and addressing issues like HIV/AIDS and other diseases. Furthermore, gender equality is also my favorite sustainable development goal and the common wealth is committed to achieving gender equality and empowering all women and girls including addressing issues like violence against women and girls.', 'The biggest challenge that the youth of Eswatini are facing is the escalating unemployment rate as well as the increase in teenage pregnancy and HIV infections particularly amongst varsity students. As the youth council representative from Eswatini, regarding the high unemployment rate amongst the youth. I will advocate that in schools, a new curriculum must be introduced which will not only teach students theory but also introduce them to artisans skills which will be a backup to their qualifications as well as their professions. I always tell my peers that having a skills is absolutely advantageous rather than having a qualification which will be useless once you\'re a pensioner. It is better to have a decent job just to help you cater for your bills and also to have a skill in a certain field to help you look after yourself. We are grateful to organizations like Kwakha Indvodza and Youth Enterprise Revolving Fund who are working tirelessly in ensuring that Eswatini youth are taught new skills as well as given funding to start their own businesses therefore I will sincerely urge the international community to introduce more skills programs which will be propitious for both schooling and out of school youth in Eswatini. Again, the tremendous increase in teenage pregnancy and HIV infections among the youth is so devastating. It is often said the the youth are the future leaders thus they must be given utmost care and attention. For instance, the varsity students are the most destitute victims  and some even turns to sex work as means of generating extra cash to sustain themselves. We are not just overlooking the splendid act of our government providing monthly allowances to the students. It is indeed a remarkable deed but it is not sufficient to cater and help the scholars cope with the expensive standard of living hence as a youth council ambassador from Eswatini. My first and foremost priority is to definitely to advocate the increase of the monthly allowances from the commonwealth for the varsity students as well as including mental health and reproductive health sessions and clubs in the universities to curb the increase of new HIV infections and suicidal thoughts amongst the students.', '0', NULL, 'Honestly I won\'t say I have being exposed more to leadership but I am more experienced with advocacy. Firstly as a volunteering office administrator for Kwakha Indvodza I was mandated to numerous duties which included conducting sessions with the participants as also invited various organizations to lecture about mental health and sexual reproductive health and enterprenuership to the youths and I was also designated in inviting the community leaders and authorities to clarify about the available funding opportunities for the youth mainly in the constituencies. It was in such sessions where I would advocate on behalf of the youth on certain issues like gender based violence and the high unemployment rate. Also as a key populations outreach worker and an energizer for Fhi 360 under the linkages project I was mandated to reach and link to  treatment hard to reach key populations especially the bisexuals and gays because they felt they were often judged and criticized when going to the various health facilities because of their sexuality. That eventually led me as the key populations outreach worker to advocate for equal rights and fair treatment of the key populations in all the health facilities. My responsibilities led me to be an active Prep and Art ambassador since I was encouraging the high risk clients to be either initiated with Prep or Art. Lastly, I was also  one of the directors of the Inhlangano Yemahlahlandlela organization which aims in providing extra lessons to students struggling with their academics even though we have not been operating due to funding. With all this experiences one can absolutely said that I have sufficient experience in leadership and advocacy.', 'I have always been enthusiastic with advocating for the rights and the gripes of the youth in Eswatini in the Commonwealth. Firstly if I can be selected to represent Eswatini at the commonwealth I will advocate for the introduction of a curriculum in schools which can promote the learning of skills in schools which will be additional to the current curriculum just to give the youth various options to explore skills as well as expose them to various organizations to aid them with funding and starter kits. Secondly, if I can be chosen as a representative I can also advocate for the increase of the monthly allowances for university student to cope with the increase of the standard of living from the international community as well as the introduction of mental health and sexual reproductive health sessions and clubs in the universities to cutnd the increase of new HIV infections and suicide issues. Furthermore, what makes me to be ideal for this opportunity it is my ability to form new networks not to mention that I am very good with learning new languages. Currently I can interact in; English, Portuguese, Spanish and French even though I\'m not fluent but I can converse in them.  ', '[\"cvc-applications\\/cvs\\/inbound6230578259350912447.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound2288255406604807418.pdf\",\"cvc-applications\\/supporting\\/inbound3819063117821322405.pdf\",\"cvc-applications\\/supporting\\/inbound8755222970559136147.pdf\",\"cvc-applications\\/supporting\\/inbound1388136449455329154.pdf\",\"cvc-applications\\/supporting\\/inbound7108484076906554738.pdf\",\"cvc-applications\\/supporting\\/inbound1084919275966819481.pdf\"]', NULL, '2025-07-21 17:37:48', '2025-07-21 17:37:48'),
(62, 1246, '1. Innovation of industry \n2. Health and wellbeing \n3. No Hunger ', 'Unemployment is an issue.we need to start our own business if Government can assist us financially ', '0', NULL, 'No I haven\'t had an opportunity to be a leader, but I wish to be ', 'I like helping and working with people ', '[\"cvc-applications\\/cvs\\/cv.sikelela.pdf\"]', '[\"cvc-applications\\/supporting\\/certificate .pdf\"]', NULL, '2025-07-21 17:59:56', '2025-07-21 17:59:56'),
(63, 1243, 'The Commonwealth’s mandate is closely aligned with the United Nations Sustainable Development Goals (SDGs) 13 (Climate Action), 5 (Gender Equality), and 4 (Quality Education). As outlined in the Commonwealth Charter and its strategic plans, the organization is committed to supporting inclusive, sustainable development among its 56 member states. SDG 13’s focus on climate action is advanced through Commonwealth initiatives such as the Commonwealth Sustainable Energy Transition (CSET) Agenda, which promotes clean energy, climate adaptation, and resilience, especially in vulnerable small island developing states. These efforts are designed to help members implement climate-related policies and strengthen disaster preparedness, thus fulfilling the Commonwealth’s mandate to foster environmental sustainability and resilience. In terms of SDG 5, the Commonwealth’s Gender Equality Policy and various platforms, such as the Women’s Affairs Ministers Meeting, demonstrate a strong, ongoing commitment to gender equality. The organization actively supports mainstreaming gender considerations across all policies and encourages intersectional approaches to ensure inclusive participation of women and girls in all spheres of development. For SDG 4, the Commonwealth prioritizes quality education by offering frameworks, benchmarks, and collaborative learning platforms—such as the Commonwealth Education Hub—to help member states improve educational outcomes and ensure inclusive, equitable lifelong learning opportunities. Through these strategies and programs, the Commonwealth not only reflects its values of democracy, equality, and sustainable development but also operationalizes its mandate via concrete action aligned with the SDGs, supporting members in their national and global development efforts.', 'The biggest challenge facing the youth of Eswatini today is high unemployment, which affects more than half of young people and is even more severe for young women. Alongside unemployment, many youth struggle with limited economic opportunities, a mismatch between education and the job market, and barriers to fully participating in decision-making processes. These challenges are compounded by issues such as poverty, mental health struggles, and vulnerability to exclusion and violence. To advocate for change at the Commonwealth level, I would focus on ensuring meaningful youth engagement in policy development, so that young people from Eswatini can directly influence the decisions and programs that impact their futures. This approach aligns closely with the Eswatini National Youth Policy, which emphasizes youth empowerment, inclusivity, and active participation. By leveraging Commonwealth platforms such as the Commonwealth Youth Council, I can amplify the voice of Eswatini’s youth and create regional and international opportunities for collaboration and support.\n\nIn my advocacy, I would align efforts with SDGs 13, 5, and 4. For SDG 13 (Climate Action), I would push for increased opportunities for youth-led climate initiatives and green entrepreneurship, giving young people the chance to contribute to environmental sustainability while developing skills and livelihoods. Regarding SDG 5 (Gender Equality), I would emphasize the removal of barriers that hold back young women from accessing education, employment, and leadership positions, and advocate for programs that support survivors of gender-based violence. For SDG 4 (Quality Education), I would campaign for improvements in education quality, digital skills, entrepreneurship training, and lifelong learning, all designed with input from youth to better prepare them for the workforce. My advocacy would be grounded in the principles of the Eswatini National Youth Policy—equity, empowerment, and inclusiveness—to ensure that initiatives respond to the diverse needs of our youth population.\n\nI also believe it is important to mainstream youth engagement across all sectors at both the national and Commonwealth levels. This means embedding youth participation in the planning, implementation, and evaluation of policies related to climate, gender, and education. By doing so, the interventions become more relevant and effective. I would encourage the Commonwealth to support peer learning, mentorship programs, and targeted funding to help Eswatini’s young people, especially those in rural and marginalized communities. In championing youth engagement that is inclusive, sustainable, and empowering, and aligning with SDGs 13, 5, and 4, I believe we can tackle unemployment, improve education, promote gender equality, and build resilience to climate change. By linking these efforts to the wider Commonwealth mandate, I can help amplify the voices and creativity of Eswatini’s youth, ensuring our challenges and solutions receive the attention they deserve on both a national and international stage.', '1', '1. Attending and Participating in International Climate Conventions: Enactus World Cup in San Jose, California, USA; Africa Green Waste and Energy Expo in Zimbabwe; UNFCCC COP26 in Scotland, Glasgow; Convocation in Climate and Hunger in Kenya; Africa Climate Summit in Kenya; Science Forum and Science Diplomacy in Pretoria, SA.\n2. Writing Articles for The NDC communications and being featured on newsletter, giving feedback on youth engagement on international conventions. \n3. Nationally: through the boards i get to serve in, i get to represent Eswatini youth and their interests. I have involved in youth diplomacy through the European Union. I have created programs for youth at the Institute of Waste Management\n4. I have also spoken on national and international levels, proposing solutions to engage youth, representing youth priorities and presenting the work we do. ', 'I have been actively engaging in advocacy for the past four years, through Hlumisa Youth Climate Network locally. My work has afforded me an opportunity to affiliate and collaborate with other youth organisations regionally and internationally. In these platforms I have participated in the advocacy for meaningful youth engagement, capacity development which strengthens the solutions and innovations from youth, as well as the technical and financial support of youth ensuring that the are systems supporting the growth of youth. Not only that but my engagement has also supported my personal development in advocacy and leadership, as exposure helps refines and structure our approach in the advocacy space, the privilege to interract with world and national leaders has empowered me and taught me best practices. At the moment i get to serve Eswatini through the institute of Waste Management as the secretary general, the chairperson of European Union YAB, the Executive director of Hlumisa Youth Climate Network and Regional Coordinator for Climate YES.', 'I believe I should be chosen to represent Eswatini in the Commonwealth Youth Council because of my extensive and active engagement in youth advocacy over the past four years, particularly through my work with the Hlumisa Youth Climate Network. This experience has given me the opportunity to collaborate with youth organizations at local, regional, and international levels, advocating for meaningful youth engagement, capacity development, and the establishment of technical and financial support systems that enable young people to grow and innovate. Through these platforms, I have not only contributed to strengthening youth-led solutions but have also developed personally in leadership and advocacy skills. Interacting with national and global leaders has refined my approach and empowered me with best practices that I bring back to my communities.\n\nCurrently, I proudly serve Eswatini in several key leadership roles, including Secretary General of the Institute of Waste Management, Chairperson of the European Union Youth Advisory Board, Executive Director of Hlumisa Youth Climate Network, and Regional Coordinator for Climate YES. These positions have deepened my abilities in leadership, coordination, and coalition building, while allowing me to consistently advocate for youth voices in decision-making spaces. My work aligns closely with the Eswatini National Youth Policy, which emphasizes youth participation, empowerment, and inclusivity, as well as with the Commonwealth’s focus on advancing Climate Action (SDG 13), Gender Equality (SDG 5), and Quality Education (SDG 4). I actively promote youth-led climate initiatives and environmentally sustainable entrepreneurship, champion gender equality with a focus on including young women in leadership, and support education and skills development initiatives that address gaps between schooling and employment.\n\nBy representing Eswatini in the Commonwealth Youth Council, I would bring a strong, experienced voice dedicated to empowering youth through meaningful engagement and sustainable development. My proven commitment, leadership experience, and ability to build networks position me well to contribute effectively to the Commonwealth’s youth agenda, while ensuring that the unique challenges and innovations of Eswatini’s youth are represented on a global stage.', '[\"cvc-applications\\/cvs\\/Curriculum Vitae- Busiswa Dlamini (1).pdf\"]', '[\"cvc-applications\\/supporting\\/BUSISWA DLAMINI -SANU Certificate.pdf\"]', NULL, '2025-07-21 18:13:53', '2025-07-21 18:19:01'),
(64, 615, 'SDG 2: Zero Hunger – Food Security for All, Including Persons with Disabilities\nI am passionate about SDG 2: Zero Hunger, with a focus on inclusive food security for vulnerable populations—especially persons with disabilities. Through Langaletfu Charity Organisation, I’ve led initiatives such as distributing seeds for backyard gardens and providing food parcels to families in need across Eswatini.\n\nOur goal is not just to provide short-term relief, but to empower communities—particularly those often excluded from traditional food systems. For persons with disabilities, these projects offer dignity, autonomy, and access to better nutrition, while reducing dependency.\n\nThis work aligns with the Commonwealth’s mandate to promote social development, inclusivity, and equal opportunity for all. Ensuring food security is foundational to health, education, and participation in economic life—all priorities shared by the Commonwealth and the youth it represents.\n\nAs a youth leader, I believe sustainable development must be inclusive by design. My vision is to scale these models, advocate for disability-inclusive food policies, and help shape a future where every person—regardless of ability—has access to safe, nutritious food and the means to grow it themselves.\n\nSDG 10: Reduced Inequalities – Promoting Equity for Persons with Disabilities\nI am also deeply committed to SDG 10: Reduced Inequalities, especially for persons living with disabilities who face systemic exclusion in Eswatini. At Langaletfu Charity Organisation, we integrate disability inclusion into all our initiatives, from home-based agriculture to direct food support. Our model views people with disabilities not as dependents, but as active change agents in their communities.\n\nBy promoting access to land, seeds, and skills training, we are creating pathways to independence and dignity. This approach mirrors the Commonwealth’s commitment to equality, diversity, and youth empowerment, especially for those often left behind.\n\nThrough this work, we challenge stigma, reduce social isolation, and empower marginalized youth to engage in meaningful development. I aim to bring these voices to the Commonwealth platform, advocating for inclusive policy-making and regional collaboration that uplifts all young people.\n\nInclusion is not charity—it’s justice. And justice lies at the heart of the Commonwealth’s mission.', 'The biggest challenge facing the youth of Eswatini is unemployment, driven by limited job opportunities, lack of access to capital, and insufficient support for youth-led enterprises. Many young people have innovative ideas but face systemic barriers to starting or scaling businesses.\n\nAs a Commonwealth Youth Council representative, I will advocate for change by working with the Commonwealth to lobby the Eswatini Government to increase investment in youth entrepreneurship. One key strategy is promoting localized and inclusive funding models, such as blended financing. This could involve offering a seed grant of E5,000 to support the launch of youth-led ventures, followed by access to scaling loans of up to E100,000 after a defined milestone period (e.g., 6 months of proven performance).\n\nBy leveraging Commonwealth influence and platforms, I aim to push for sustainable, youth-friendly financing policies that unlock potential, drive innovation, and reduce youth unemployment in Eswatini.', '1', NULL, 'I currently serve as the Chairperson of the Youth Committee in my chiefdom, a role that allows me to advocate for the needs and priorities of young people at the Inkhundla (constituency) level. In this position, I lead community dialogues, mobilize youth for development initiatives, and serve as a key voice in local decision-making structures. Additionally, I represent youth with disabilities, ensuring that their concerns are not overlooked in community planning and resource allocation. Through this dual role, I have gained hands-on experience in grassroots leadership, inclusive advocacy, and stakeholder engagement, which I intend to strengthen and scale through collaboration with regional and Commonwealth-level youth platforms.', 'I should be chosen to represent Eswatini at the Commonwealth Youth Council because I bring a proven track record of grassroots leadership, inclusive advocacy, and a vision rooted in justice and sustainable development.\n\nAs the Chairperson of the Youth Committee in my chiefdom, I advocate for youth development at the Inkhundla level, ensuring that both general youth concerns and issues affecting youth with disabilities are addressed in community planning. I also represent the Eswatini National Youth Council (ENYC) in engagements with international stakeholders such as UNDP and UNFPA, contributing to national dialogues on youth policy.\n\nIn my role as Director of Langaletfu Charity Organisation, I lead impactful projects aligned with SDG 2: Zero Hunger and SDG 10: Reduced Inequalities. These include distributing seeds for backyard gardens, food parcels, and agricultural training—particularly targeting young people with disabilities. We focus not on charity, but on empowering communities with tools for food security, dignity, and independence.\n\nAdditionally, I am passionate about tackling youth unemployment, the biggest challenge facing Eswatini’s young people. I plan to advocate at Commonwealth level for localized blended funding models, including seed grants (E5,000) and scaling loans (up to E100,000), to support youth-led enterprises. By influencing government and policy through the Commonwealth platform, I hope to help unlock capital, drive innovation, and create jobs for young people across Eswatini.\n\nMy leadership is driven by inclusion, equity, and action. I represent both urban and rural youth, those often unheard, especially youth with disabilities. The Commonwealth Youth Council needs leaders who are connected to the ground, passionate about change, and equipped with the experience to deliver impact. I am ready to serve, advocate, and amplify the voice of Eswatini’s youth on the global stage.', '[\"cvc-applications\\/cvs\\/Phumelele Zethu Gwebu.png\"]', '[\"cvc-applications\\/supporting\\/Phumelele Zethu Gwebu.png\"]', NULL, '2025-07-21 20:16:11', '2025-07-21 20:16:11'),
(65, 1232, 'SDG5:Gender Equality \nThe Commonwealths focus on education, health and economic opportunities for women and girls directly supports the achievement of this goal.\nSDG10:Reduced Inequalities \nThe Commonwealths commitment to inclusive development, particularly for small and vulnerable states, aligns with SDG 10.\nSDG16:Peace, Justice and strong institutions \nThe organization works to strengthen democratic institutions, promotes good governance and ensures access to justice for all.\n\n', 'The biggest obstacle faced by the Youth here in Eswatini is unemployment, exacerbated by lack of access to quality education and relevant skills training. To advocate for change at Commonwealth level, I would engage with organizations like the Commonwealth Foundation which supports initiatives that promote Youth development, participate in their programs and network with  other Youth organizations which would amplify voices and create opportunities for collective action. ', '1', 'Yes,I am visible physical in clean up campaigns that are constantly done in my home town by the Sithobela Youth Society, which I serve in it\'s executive leadership as project coordinator. ', 'I am active in organizing campaigns and events, such as the recent Clean -up campaign here in my hometown, Sithobela on the 12th of July 2025.It increased awareness on environmental health, particularly the need to eliminate plastic materials, such as plastic bags. Our town was left clean.\n\nI have poetically raised Gender Based Violence awareness through Social media platforms which has helped minimize cases of the act ,promoting gender equality. ', 'With me lies a clear vision for the future, as to how I can effectively contribute to the work of the Commonwealth Youth Council and advocate for the needs and aspirations of young people.Equally important, I clearly understand the Commonwealth values and principles, as well as specific issues facing young people.And well, I also have strong communication and interpersonal skills to effectively represent the Youth perspective and build consensus. \n', '[\"cvc-applications\\/cvs\\/Screenshot_20250721-191748_Office Mobile.jpg\"]', '[\"cvc-applications\\/supporting\\/results doc.pdf\"]', NULL, '2025-07-21 21:52:10', '2025-07-21 21:52:10'),
(66, 1247, 'The top SDGs that people are passionate about vary, but some of the most popular ones include :\n-Good Health and Well-being (SDG 3): Ensuring healthy lives, promoting well-being, and providing access to healthcare for all.\n- No Poverty (SDG 1): Eradicating poverty in all its forms, promoting economic growth, and ensuring access to basic resources.\n- Climate Action (SDG 13: Taking urgent action to combat climate change, promoting sustainable practices, and reducing greenhouse gas emissions.\n- Decent Work and Economic Growth (SDG 8): Promoting sustained, inclusive, and sustainable economic growth, full employment, and decent work for all.\n\nThese SDGs align with the Commonwealth mandate in several ways :\n- Promoting Sustainable Development: The Commonwealth aims to promote sustainable development, which is at the heart of the SDGs. By working together, countries can achieve economic growth, social inclusion, and environmental protection.\n- Reducing Inequality: The Commonwealth emphasizes reducing inequality within and among countries, which is reflected in SDGs like Reduced Inequalities (SDG 10).\n- Fostering Innovation and Partnerships: The Commonwealth encourages innovation, partnerships, and collaboration to achieve sustainable development, which is in line with SDGs like Industry, Innovation, and Infrastructure (SDG 9) and Partnerships for the Goals (SDG 17).\n\nThe Commonwealth mandate and SDGs share common goals, such as:\n- Peace, Justice, and Strong Institutions:  Promoting peaceful, just, and inclusive societies.\n- Sustainable Cities and Communities: Creating sustainable, resilient, and inclusive cities and communities.\n- Responsible Consumption and Production: Promoting sustainable consumption and production patterns.\n\nBy working together, countries and organizations can achieve these goals and create a more sustainable, equitable, and prosperous world.', 'The biggest challenges facing the youth of Eswatini are ¹:\n- Lack of Employment Opportunities: Many young people in Eswatini struggle to find jobs, leading to increased poverty, crime, and feelings of hopelessness. The country\'s economy is heavily dependent on the royal family, which owns a significant portion of the country\'s assets, limiting opportunities for others.\n- Limited Access to Quality Education: The education system in Eswatini faces numerous challenges, including a shortage of teachers and support staff, lack of basic supplies, and inadequate infrastructure. This affects the quality of education, particularly in rural areas.\n\nThe Commonwealth can advocate for the youth of Eswatini by :\n- Supporting Education and Economic Development: Providing assistance to improve access to quality education and promoting economic development initiatives that benefit the broader population, not just the royal family.\n- Encouraging Inclusive Governance: Supporting initiatives that promote inclusive governance, transparency, and accountability in government institutions.', '0', NULL, '\n\n- Leadership Skills: I have learnt to inspire and influence others, make strategic decisions, and navigate complex challenges with integrity and impact.\n- Negotiation Techniques:  l have developed strategies to achieve win-win outcomes, build strong relationships, and manage conflicts effectively in various settings.\n- Global Perspective: l  have gained sights into cultural sensitivity, geopolitical strategies, and conflict resolution to become a skilled diplomat.\n', '\n\nAs a young person from Eswatini, I am deeply committed to promoting the interests and empowerment of young people in my country and the Commonwealth.\"I believe that my leadership experience, passion for youth development, and understanding of Commonwealth values make me an ideal candidate to represent Eswatini on the Commonwealth Youth Council. I am excited about the opportunity to work with other young leaders from across the Commonwealth to address common challenges and promote sustainable development and youth empowerment.\"', '[\"cvc-applications\\/cvs\\/inbound1565256389199020013.pdf\"]', '[\"cvc-applications\\/supporting\\/inbound6951235812831443948.pdf\"]', NULL, '2025-07-22 13:06:27', '2025-07-22 13:06:27'),
(67, 1190, 'My top 3 SDGs have to be Quality education, no poverty and Industry, Innovation and Infrastructure. All of these SDGs aim at creating a better future for the people and plannet by the year 2030. Having these SDGs really improved and developed will bring about a cause to action in my country, ESwatini and other collaborative countries in the Commonwealth of Nations.This will guide the whole world to a more suitable and sustainable world. This will also foster development, democracy and peace and promote international understanding as per the Commonwealth mandate.', 'Eswatini youth faces mental issues. All the crime, the suicide, drug abuse, immorality and unemployment...well sometimes are a result of mental health issues. We cannot as a country solve for example drug abuse without solving the root and umbrella issue which is mental health. This calls for  serious educational reforms through syllabus and curriculum. On another note, the psychiatric facilities need to improve in terms of information and awareness. Admitted patients may be taken through classes and trainings so that when they leave these facilities they also help raise awareness and that will enable them employment opportunities since they end up having a bad record for employment. Lastly, the government needs to legislate an annual budget increment for specifically all mental health facilities, issues, events and everything through considering what WHO has to say about it.', '1', NULL, 'I am a plus size fashion model, and I am a voice and face for all plus size and obese woman in the beauty and fashion industry. Back in 2017, I was graced to attend the Anti crime workshop with was conducted by the Royal Swaziland Police Services and through that, I went back to my school to implement the formation of anti crime clubs, students formed this club to educate each other and have social gatherings to spread the gospel of anti crime. Students of Velebantfu High School also visited the Magistrate court for further education on Crime. I am also a 2017 alumni for Junior Achievement where at the end Of the programme I scored an award for being the best sales person, that speaks volumes to how well interact with people, convince and how up selling I am. I am also a make up artist, a popular one. My job is to advocate for beauty, in all spheres of women. Have I mentioned that I am a backing vocalist in the gospel music industry, I advocate integrity and God\'s gospel through music.', 'I have the confidence, the voice and my digital marketing skill are on steroids. I can work well collaboratively as I do in modelling and music. The world needs such boldness in dealing with mental health issues and the world needs a voice and face in all social media platforms and rest assured I am the girl to represent my country. Most importantly, I am innovative and very smart, this opportunity has made me to think out of the box how we can create jobs, come up with new ideas, while we solve issues of Mental Health.', '[\"cvc-applications\\/cvs\\/inbound2665852687041977341.docx\"]', '[\"cvc-applications\\/supporting\\/inbound5496527432744778404.pdf\"]', NULL, '2025-07-22 13:29:54', '2025-07-22 13:42:36'),
(68, 1254, '-Affordable and clean energy.\n-Climate action.\n-Good health and well-being.', 'Partnership for goals, most of the youth has dreams but it is very difficult to get people to reach to in order for their dreams to come true.', '0', NULL, 'I have been in leadership program learning and I participated in this leading people in Agriculture.', 'I\'m a passionate person who is willing for growth around my community.I am also a leader can be open-minded and a good listener.I also look for innovation everytime.', '[\"cvc-applications\\/cvs\\/Screenshot_20250722-141315.jpg\"]', '[\"cvc-applications\\/supporting\\/IMG_20250722_140951.jpg\",\"cvc-applications\\/supporting\\/IMG_20250722_140910.jpg\",\"cvc-applications\\/supporting\\/IMG_20250722_140940.jpg\",\"cvc-applications\\/supporting\\/IMG_20250722_140929.jpg\"]', NULL, '2025-07-22 19:28:50', '2025-07-22 19:28:50'),
(69, 746, '1. SDG 2 – Zero Hunger: As an agricultural professional with experience in livestock management and a strong academic background in animal science and agricultural economics, I am deeply committed to advancing sustainable food production systems. My work supports improved food security and rural livelihoods, aligning closely with the Commonwealth’s goal of reducing poverty and hunger across member states.\n\n2. SDG 4 – Quality Education: With a BSc in Agricultural Education and several years of teaching experience, I am dedicated to delivering inclusive and practical education. I have trained learners in both theoretical and field-based agricultural practices, in line with the Commonwealth’s focus on building human capital and enhancing educational outcomes.\n\n3. SDG 8 – Decent Work and Economic Growth: My work managing agricultural enterprises and my academic focus on rural development and production economics position me to support sustainable economic growth. I contribute to job creation, skills development, and enterprise management key pillars of the Commonwealth’s economic empowerment agenda.\n\n', 'The biggest challenge that young people in Eswatini are facing is unemployment. Many youths finish school or university but still cannot find jobs. In rural areas, it is even more difficult because there are fewer opportunities and not enough support for starting businesses. This leads to frustration, poverty, and loss of hope for a better future.\n\nAt the Commonwealth level, I can advocate for change by speaking about these challenges and suggesting programs that help youth gain skills for jobs or to start small businesses, especially in agriculture. I believe agriculture has many opportunities for youth if they get the right support, training, and access to resources.\n\nAlso, I would encourage the Commonwealth to support youth exchange programs, funding for agribusiness, and digital training that can help us become more independent and ready for the future. As someone working in agriculture and education, I will use my voice and experience to show that youth in Eswatini are ready to work hard, if given a fair chance.', '1', 'Yes, I have represented the youth at the local level. As an Agriculture Teacher and Farm Manager, I have worked closely with young people in my community, teaching them practical skills in farming and agribusiness. I have also organized and led school agricultural projects and training sessions that helped students and young farmers improve their knowledge and confidence in agriculture.', 'I have shown leadership through my work as an Agriculture Teacher and Farm Manager, where I guided students and young people in farming skills, agribusiness, and career development. I led school projects, practical demonstrations, and training that helped youth gain confidence and improve their skills.\n\nAs a farm manager, I also led a small team, made key decisions, and ensured proper care of livestock and farm operations. In both roles, I listened to others, solved problems, and encouraged teamwork.', 'I believe I should be chosen to represent Eswatini at the Commonwealth Youth Council because I am passionate about youth development, education, and agriculture. I have experience working with young people as a teacher and mentor, and I understand the challenges they face, especially in rural areas. My background in agricultural education and applied economics gives me both practical and academic knowledge that I can use to bring new ideas and solutions.\n\nI am committed, hardworking, and ready to be a voice for the youth of Eswatini. I can speak on their behalf and share their experiences, needs, and goals at the Commonwealth level. I also believe in teamwork, respect, and building strong partnerships. If given the opportunity, I will use this platform to create positive change and help build better opportunities for young people in Eswatini and across the Commonwealth.', '[\"cvc-applications\\/cvs\\/lunga updated CV.pdf\"]', '[\"cvc-applications\\/supporting\\/Lunga DATA anlaysis.pdf\",\"cvc-applications\\/supporting\\/online cert.pdf\",\"cvc-applications\\/supporting\\/Lunga BACHELOR OF SCIENCE IN AGRI.pdf\",\"cvc-applications\\/supporting\\/Lunga BACHELOR OF SCIENCE IN ANIMAL.pdf\"]', NULL, '2025-07-23 11:02:15', '2025-07-23 11:02:15'),
(70, 476, '2 zero hunger\n6 clean water and sanitation\n8 decent woek and economic growth', 'Unemployment rate is high that results in poor sanitation and hunger.\n\nOpening up of business opportunities and support of those from government levels inorder to open up more job opportunities through those businesses opening jobs for other youth', '0', NULL, 'I have none. However having seen the role a person can play in the lives of the youth in terms of support and listening i have gained knowledge in understanding the struggles that they face and how the voice of the youth isnt heard yet they want to be and they have so much to say that could change and shape the present and the future.', 'I am someone who has spent time to reflect on my own life and wished that someone could have taken their time to sit down and ask me what i needed and i believe that if the commonwealth could be present on an individual presence before national we could be able to discover the gems that are hidden below the earth. Someone needs to discover the potential hidden in each and every individual that could change the whole world at large.', '[\"cvc-applications\\/cvs\\/NELISWA A. KHUMALO RESUME.pdf\"]', '[\"cvc-applications\\/supporting\\/Degree (1).pdf\"]', NULL, '2025-07-25 22:40:10', '2025-07-25 22:40:10');
