INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(2, 455, '[\"documents\\/01K06M04F25XPFN45KNJQV19NM.pdf\",\"documents\\/01K06M04F8VWWKX341QQQS6Y5H.pdf\",\"documents\\/01K06M04FA8KYFVMG1QVP31XN9.pdf\"]', '[\"documents\\/01K06M04FHV2JV5DPSA9G46AZM.pdf\"]', 'Unemployed', 'I have a successfull background working with young people , I believe I am the best candidate for the role because I am passionate about helping others, especially through sharing accurate information and offering support in a respectful and relatable way. I have strong communication and interpersonal skills, which allow me to connect with people from different backgrounds and create a safe, non-judgmental space for learning and discussion.\n\nI also lead by example and practice the values I teach—whether it’s about health, behavior change, or positive decision-making. I’m reliable, approachable, and a good listener, which helps me understand the challenges my peers face and guide them effectively.', 'Yes', 'Young heroes organization and red cross organization', 'Mobilize and recruit young people for educational session, providing them with toiletries, mentoring them ', 'Yes', NULL, '2025-07-15 12:42:39', '2025-07-15 12:42:39'),
(3, 456, '[\"documents\\/01K06M3Q18G221PPQ2ZKJJFYC4.jpg\"]', '[\"documents\\/01K06M3Q1M5M3QEW01BW59XFGF.pdf\"]', 'Unemployed', 'I have the experience of being a peer educator and I have worked with people my age during peer tutoring at University. I also have worked with children during my teaching practise hence I have the abilities of standing in front of people. Anything that has to do with educating others is my specially since I am a qualified teacher and I am passionate about what I do. ', 'Yes', 'Khulisa Umntfwana ', 'Normally work as a peer educator for Imbali during umhlanga Reed dance ', 'Yes', NULL, '2025-07-15 12:44:36', '2025-07-15 12:44:36'),
(4, 457, '[\"documents\\/01K06MJH361JR51R26F137BBCY.pdf\"]', '[\"documents\\/01K06MJH3B68A84M1ZSVQTJNBQ.pdf\"]', 'Unemployed', 'I have applied because your vision aligns with my passion to work with young people, empower them, equip them. Also I think I am the best candidate for this job because im a dedicated and passionate Community Youth Facilitator and a Peer Educator with a strong background  in delivering HIV prevention, GBV awareness, Life Skills, adolescent mentorship,psychosocial support and sexual reproductive health education to adolescent girls and young women (AGYW). Known for excellent group facilitation skills, life skills education and the ability to connect with diverse groups. Highly organized, self-driven, and committed to making a positive impact in communities.Passionate about empowering young people  through tailored interventions and supportive mentorship.', 'Yes', 'World Vision', 'Identify and enroll young people and conduct risk vulnerability assessments\n-Facilitated small group sessions and provided one on one mentorship on HIV prevention, GBV ,Life Skills and SRH\n- Identify youth friendly outlets for condoms distribution\n-Identify,report and refer suspected GBV cases to Field Officer\n-Make referrals for clinical and social services\n-Perform data entry using mobile application\n-Identify and link to care new HIV cases in the mobile clinic and community stationary sites.', 'Yes', NULL, '2025-07-15 12:52:42', '2025-07-15 12:52:42'),
(5, 458, '[\"documents\\/01K06MTV589GPEX94KZ3WZ4FNY.pdf\"]', '[\"documents\\/01K06MTV5BBXK0VK7QWM05QSSQ.pdf\"]', 'Unemployed', 'I have applied for this opportunity because I am passionate about helping young people in my community grow, believe in themselves, and find direction in life. As a young person who is still trying to build a stable life, I understand the challenges many of our youth face — unemployment, lack of guidance, and limited opportunities. That is why I want to be part of a program that uplifts and empowers others.\n\nEven though I am not formally employed or established in business, I have always taken initiative to improve myself and others. I hold a teaching qualification and have experience volunteering, assisting others, and sharing knowledge wherever I can. I have strong communication skills, patience, and a desire to see people succeed. I believe these qualities are important for someone who wants to guide, train, and motivate others.\n\nI am the best candidate because I can relate to the struggles of the youth. I know what it means to try, fail, get up again, and keep pushing. I will bring real-life experience, empathy, and a genuine heart to this role. My goal is to be a source of hope and positive energy, especially to those who feel forgotten or discouraged.\n\nIf given this opportunity, I will work hard to deliver meaningful training, create safe learning spaces, and support every young person I engage with.', 'No', 'None ', 'None ', 'Yes', NULL, '2025-07-15 12:57:14', '2025-07-15 12:57:14'),
(6, 459, '[\"documents\\/01K06N9B6BM8SCTX1AT0JFB6E7.jpg\"]', '[\"documents\\/01K06N9B6DST4NEVFMXMJHMTXC.pdf\"]', 'Unemployed', 'I wish to work in this field because I\'m a youth and I spent most of the time with the youth in my society and I passionate ', 'No', NULL, 'I was always part of youth meetings and when they is help needed I always there ', 'Yes', NULL, '2025-07-15 13:05:09', '2025-07-15 13:05:09'),
(7, 460, '[\"documents\\/01K06NAQWZ9FXBG6RPSNPY20MW.jpg\"]', '[\"documents\\/01K06NAQX2G325SM170SSAH96P.pdf\"]', 'Unemployed', 'I believe I am the best candidate because I am very passionate and have the urge to help young people overcome life\'s obstacles.I have been a victim of so many life circumstances  as a young person,I have been a rape victim and I was a mother at a very young age this is to just name a few of the things I had to go through.So as I have mentioned, I would like to share my story and hopefully help any other young person going through a lot.', 'Yes', NULL, 'None', 'Yes', NULL, '2025-07-15 13:05:55', '2025-07-15 13:05:55'),
(8, 461, '[\"documents\\/01K06NTAAY69H30X44MWT66PGX.pdf\"]', '[\"documents\\/01K06NTAB21FZ9T48VJEMHNEPS.jpg\"]', 'Unemployed', 'My experience with learners made me feel like I am the best candidate and I have completed with my bachelor\'s Degree in Education specializing in psychology,administration and as well as life skills which are suitable for kids', 'Yes', 'Worked as a student teacher', 'I was a student teacher for 3 years and also participated in workshops for lifeskills which is part of the school curriculum. Dealing with learners is working with children which I am skilled and worked with them', 'Yes', NULL, '2025-07-15 13:14:26', '2025-07-15 13:14:26'),
(9, 462, '[\"documents\\/01K06P5M9T46KPX3MQDTJFCG5C.jpg\"]', '[\"documents\\/01K06P5M9X73BGK7P3E1B9T6JV.pdf\"]', 'Unemployed', 'It is my desire to lead the youth be of good character.It is my passion to help the youth,give back to the community as little as I can.And in whatever way I can, especially to the youth of my area Luyengo.It is up to us as the youth to bring change in our communities since we are the future.', 'Yes', 'Mr and Miss Luyengo 2025', 'I am the founder and organiser for the 1st edition of Mr and Miss Luyengo.Which is a youth based event intended to promote culture, leadership,confidence among the youth.It is also designed to prevent youth idleness which may lead to social issues such as drug abuse.It is also designed to promote youth talent.', 'Yes', NULL, '2025-07-15 13:20:36', '2025-07-15 13:20:36'),
(10, 463, '[\"documents\\/01K06P6N1ZYJKKB4F5QT7F79FB.pdf\"]', '[\"documents\\/01K06P6N27WP5Z8NVJJKXQ342P.pdf\"]', 'Unemployed', 'I have worked with adolescents of various backgrounds from in all the regions.I am so much passionate about working with young people and helping them whenever need be.I am also a sign language interpreter which helps in curbing communication barrier within the deaf community.', 'Yes', 'Flas', 'Wored under Sitakhela Likusasa project.Worked as an Hts counselor to adolescent girls ', 'Yes', NULL, '2025-07-15 13:21:10', '2025-07-15 13:21:10'),
(11, 464, '[\"documents\\/01K06P84DZN3SSFKCFBKZJBZ1V.jpg\"]', '[\"documents\\/01K06P84E0XDB2B37K6EK4ZPRA.pdf\"]', 'Unemployed', 'I applied because I im interested in helping the youth and I\'m the best candidate because I\'m aware of youth related problem and I can align well with the objectives of the organization.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 13:21:58', '2025-07-15 13:21:58'),
(12, 465, '[\"documents\\/01K06P8DY474CPYNKFNP154ZRA.pdf\"]', '[\"documents\\/01K06P8DY6HVFTV4617NNQWEF0.pdf\"]', 'Unemployed', 'I am excited to apply for the Training of Trainers position focused on adolescents because I am deeply committed to empowering young individuals, particularly young girls, to pursue their passions and succeed in their endeavors. With my associate degree in Business Information Technology and my ongoing pursuit of a bachelor’s degree in Business Administration, I possess a strong foundation in both technology and business principles, which I believe are essential for effective training and mentorship.\n\nMy previous experience with Women in Engineering has equipped me with insights into the challenges that young girls face when considering careers in STEM. During my time there, I actively encouraged young girls to explore these fields, providing them with the resources and support needed to visualize themselves in potential careers. This experience ignited my passion for guiding adolescents and has motivated me to seek opportunities where I can further support their development.\n\nIn addition to my advocacy work, I currently mentor students involved in robotics, leading them in competitions that foster teamwork, creativity, and critical thinking. This role has allowed me to enhance my leadership skills while demonstrating the importance of collaboration and resilience. I have seen firsthand the transformation that occurs when students are given the right tools and encouragement, which further fuels my desire to contribute to their growth through effective training.\n\nI believe I am the best candidate for this position because I combine my academic background with practical experience, a passion for empowering youth, and a proven track record of mentorship. I am dedicated to creating an inclusive environment where young minds can thrive.', 'Yes', 'Women in Engineering Eswatini and I-STEM Club Organization Eswatini ', 'At Women in Engineering Eswatini I introduced job shadow program, which gave our young girls an opportunity to interact and observe STEM professional performing their everyday duties,  therefore igniting tye passion to study a STEM profession. I also wrote a successful donor proposal, which help in financing the Saturday sessions that are held every month. The finances also help in paying transport when going to encourage young girls to pursue a STEM career in their various schools. \nAt I-STEM Club Organization Eswatini,  I provide mentorship on young males and females, while they are designing and programing their robotics.  I also make sure that they are ready for competitions (through providing assistance),which are usually help twice a year in different countries arround the world.', 'No', NULL, '2025-07-15 13:22:08', '2025-07-15 13:22:08'),
(13, 466, '[\"documents\\/01K06PMDK4C6SNGMGE1FHQPAQ7.pdf\",\"documents\\/01K06PMDK6D81NDSFE1QWA1FQ9.pdf\"]', '[\"documents\\/01K06PMDK9TWT4JJ5Y9F15MMXJ.pdf\"]', 'Self-Employed', 'I am the best candidate for the job because I am passionate about equipping young people with the knowledge, skills, and confidence they need to thrive. As someone with a Bachelor\'s degree in Horticulture and years of experience in community-based agricultural projects, youth mentorship, and education, I understand both the challenges youth face and the opportunities that can transform their lives when they are supported, trained, and empowered.\n\nI have served as a youth life skills mentor, Sunday school teacher, study facilitator for students, and a Project Officer responsible for leading training sessions for young people, women, and community leaders. These roles have taught me how to engage youth effectively, deliver relevant content, and build trust-based relationships that inspire growth. Whether in a classroom, a workshop, or the field, I know how to motivate and empower young people to take action in their own lives.\n\nWhat makes me the best candidate is not just my experience, but my deep commitment to youth development, my ability to communicate with clarity and empathy, and my practical skills in both education and agriculture. I am ready to bring energy, dedication, and a solution-oriented mindset to this role—helping youth not only learn, but lead.\n', 'Yes', 'ADRA, World Vision ', 'With world vision I was a lifeskill mentor, where I equipped the youth about issues affecting young people. I also became a Study Facilitator whereby I assisted school going pupils with their academics to improve their studies. ADRA I was an agricultural officer for care points where I trained OVC\'s, caregivers and farmers about sustainable ways of crop production ', 'No', NULL, '2025-07-15 13:28:41', '2025-07-15 13:28:41'),
(14, 467, '[\"documents\\/01K06PPHT2269RSCC7SJVJTAMX.pdf\"]', '[\"documents\\/01K06PPHT4G5E0BRWDFDP0QAKY.pdf\"]', 'Self-Employed', 'I would love to be a part of this initiative, as a young person I want to broaden my mind and learn new things than to be boxed in one area.It will also open my mind to other ventures and train me in leadership skills, time management, people management etc.I believe I am the best candidate because I am a determined young individual, ready to bring change and be of positive impact to my peers.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 13:29:51', '2025-07-15 13:31:01'),
(15, 468, '[\"documents\\/01K06PT0QWRS1TM8N630CMEER9.pdf\"]', '[\"documents\\/01K06PT0QYK26ZN9FY9RKZ0MGD.pdf\"]', 'Unemployed', 'I am a passionate and dedicated young woman with experience working as both an Assistant Livelihoods Officer and a community cadre. I was actively involved in the “Insika Yakusasa” project, where I facilitated workshops, conducted data collection and analysis, and motivated young women across rural and urban areas in Eswatini. With a Primary Teacher’s Diploma and strong community engagement skills, I am confident in connecting with youth from diverse backgrounds. My commitment to youth development and mindset change makes me a strong candidate for this training programme.', 'Yes', 'AMICAAL Eswatini ', 'At Amicaal Eswatini, I served as an Assistant Livelihoods Officer and community cadre under the \"Insika Yakusasa\" project, which was supported by NGOs including PEPFAR and USAID. My role involved facilitating monthly monitoring and evaluation meetings, organizing and documenting workshops, and supporting young women interested in becoming small business entrepreneurs. I conducted physical verification visits across rural, semi-urban, and urban areas, captured and analyzed data, and provided telephonic motivation to participants. As a community cadre, I also played a key role in equipping youth—particularly young girls—with sexual and reproductive health education to empower them to make informed life choices and take control of their futures.\n', 'Yes', NULL, '2025-07-15 13:31:44', '2025-07-15 13:31:44'),
(16, 469, '[\"documents\\/01K06PTS3MM4C1DJBEZZ2DC963.pdf\"]', '[\"documents\\/01K06PTS3QPMZYJQF2DB0W88X4.pdf\"]', 'Self-Employed', 'I have applied to become a peer educator because I deeply believe in the power of collaborative learning and the unique value that peer-to-peer support brings to the community. Through my own personal and academic journey, I\'ve experienced firsthand how a knowledgeable and empathetic peer can make complex concepts more accessible and create a supportive environment. I want to be that resource for other young people in building confidence in their abilities.\n\nI believe I am the best candidate for this role because I combine solid interpersonal skills and a genuine commitment to helping others succeed. I have consistently maintained credible personal and academic standards while actively participating in a challenging home situation. \n\nAdditionally, I bring the ability to explain complex ideas in simple terms, coupled with my patience and adaptability in addressing different learning styles, makes me well-suited for this position. Also, I am equipped with strong active listening skills and emotional intelligence, which are crucial for identifying when people are struggling and adapting my approach to meet their needs. I\'m also highly reliable, organized, and committed to continuous improvement – qualities that would allow me to be both an effective educator and a dependable team member.\n\nBeing a peer educator is not just about sharing knowledge; it\'s about being a supportive presence adolescents and youth peoples\' life journey. I understand this responsibility and am committed to maintaining high professional standards while creating an approachable and inclusive learning environment. My passion for education, combined with my interpersonal skills and academic capabilities, makes me an ideal candidate to take on this important role.', 'No', 'None', 'None.', 'No', NULL, '2025-07-15 13:32:09', '2025-07-15 13:32:09'),
(17, 470, '[\"documents\\/01K06PVBKH3TFC08RGMXFKQFHR.pdf\",\"documents\\/01K06PVBKKST8XB431STQC0WY9.pdf\"]', '[\"documents\\/01K06PVBKN6V037JVGZKV7ZH1Z.pdf\"]', 'Unemployed', 'It\'s because I love you people. I\'m someone who as a dream change most of the youth in my community from what they are right now. I\'m someone who also want to change the community so that youth can feel comfortable being in it', 'Yes', 'AIM ', 'I once organised soccer tournament for the young people. I also tried to make a team that may help the youth but it failed because I had financial problems', 'Yes', NULL, '2025-07-15 13:32:28', '2025-07-15 13:32:28'),
(18, 471, '[\"documents\\/01K06PWB2XD4VZ413MJQS37BYB.jpg\"]', '[\"documents\\/01K06PWB31N0EXGE5GVPGSP6KQ.pdf\"]', 'Self-Employed', 'I am passionate about empowering young people to reach their full potential and make a positive impact in the community. As a volunteer Youth Mindset Change Trainer, I\'d be honored to share my skills and experience to help shape the next generation of leaders. I\'m excited to learn from the team and contribute to creating a ripple effect of positive change.', 'Yes', 'YoungLife Organisation', 'Introduced Jesus Christ to the young people and helping them grow in their faith. I also, provided with mentorship, and health support.', 'Yes', NULL, '2025-07-15 13:33:00', '2025-07-15 13:33:00'),
(19, 472, '[\"documents\\/01K06QANZ2KT8AX58JC7ZRFQ3Q.pdf\"]', '[\"documents\\/01K06QANZ6G3086MC4H6J4WEVB.pdf\"]', 'Unemployed', 'I am a young dedicated girl who loves communicating to other people. I love being around young people and share my knowledge with them. I love sharing my my background with young people ensuring them that whatever situation they may encounter they can still make it in life.', 'No', 'N/A', 'None', 'Yes', NULL, '2025-07-15 13:40:50', '2025-07-15 13:40:50'),
(20, 473, '[\"documents\\/01K06QEAVE99SP5GAPJFG8G4QN.pdf\"]', '[\"documents\\/01K06QEAVGDQEWSPFEEQAWP3HB.pdf\"]', 'Unemployed', 'I applied and I am also the best candidate for the job because:\n1. Passion for youth development, my enthusiasm and commitment to empowering young people.\n2. Relevant skills and experience,my background in consumer sciences could be valuable in areas like program development, research, or community engagement.\n3. Leadership and teamwork, your ability to work collaboratively and lead initiatives.\n4. Understanding of community needs, my insight into the challenges and opportunities facing young people.', 'Yes', 'COSPE', 'At the organization we taught young people about the importance of nutrition, eating healthy and the benefits of traditional food. We also taught them about food preservation to avoid food waste and ensure that certain foods are available even when they are out of season. We also taught them skills of surviving or generating income. ', 'Yes', NULL, '2025-07-15 13:42:50', '2025-07-15 13:43:46'),
(21, 474, '[\"documents\\/01K06QSWW655MNP94EHNBWF75H.jpg\"]', '[\"documents\\/01K06QSWW86MRHQT6ZRPRNDKY8.pdf\"]', 'Unemployed', 'Having worked with young people while working under Khulisa umntfwana it has inspired me to want to get more indepth with issues affecting young people and I would like to be part of a positive change for young people.', 'Yes', 'Khulisa umntfwana ', 'I was a peer educator empowering young people on issues of gender based violence.', 'Yes', NULL, '2025-07-15 13:49:09', '2025-07-15 13:49:09'),
(22, 475, '[\"documents\\/01K06R0SGY0QPBDEEQ4ERE7YWM.pdf\"]', '[\"documents\\/01K06R0SH0MEW9SFGBVP0TRC97.pdf\"]', 'Unemployed', 'I am passionate about young people and any change that is good for them I would like to be part of it. As a big brother it is my duty to mentor my siblings and I do it in Church as well and I enjoy it. Also bringing positive change in my community makes me happy and I want to be part of that as the youth success affects the community in general. I am the best because there’s no one who loves interacting with people in a positive way the way that I do.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 13:52:55', '2025-07-15 13:52:55'),
(23, 476, '[\"documents\\/01K06R4DJP9X451A2MG0JXJSQQ.pdf\"]', '[\"documents\\/01K06R4DJS7Q1RNWNA4EY9RDBB.pdf\"]', 'Unemployed', 'Good day. The reason why i applied is because i have an understanding that young people need a guiding hand which i was blessed enough to have growing up and i know and have come to realise that without the right support in life you tend to make a whole lot of wrong decisions that put your future in jeopardy.\n\nI would love to basically impact the life of atlist one individual who is not me ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 13:54:54', '2025-07-15 13:54:54'),
(24, 477, '[\"documents\\/01K06R53CENRHB6AJECVT3BPVH.pdf\",\"documents\\/01K06R8G5SH9AWVMDJTF0K5PCM.pdf\"]', '[\"documents\\/01K06R53CKJRHSC9M73F4ZY592.pdf\"]', 'Unemployed', 'I come from a child headed family and i am currently unemployed. I am a hard worker who works with great passion and enthusiasm. I am willing to learn. I have been able to empower a lot of young people to be educated in my community but some even lost drive as they do not see the results as i have been unemployed since getting my Bachelor of Science in Environmental Health Science ', 'Yes', 'JUNIOR ACHIEVEMENT ESWATINI ', 'Empower the youth into education and being business innovative and it is so hard to start a find a job.\nTo formulate an organization that will be social and also ensure form collaboration with hence create a bridge to finding job opportunities\nTry and create abroad opportunities for the youth \nAdvocate for policies that prioritize the youth \n', 'No', NULL, '2025-07-15 13:55:16', '2025-07-15 13:57:07'),
(25, 478, '[\"documents\\/01K06RY3VZD4NSGE9RCBDBQEYS.pdf\",\"documents\\/01K06RY3W1EGS8G1EQE536X129.pdf\"]', '[\"documents\\/01K06RY3W475FK0VNB8HDNEG4W.pdf\"]', 'Unemployed', 'I am applying to be part of the Youth Mindset Change Trainer Programme because I am committed to promoting positive development and empowerment among young people in my community. I believe that equipping youth with the right mindset, information, and support is essential for long-term change. I previously served as a mentor at LUSWETI Eswatini, where I educated adolescents on key issues such as HIV prevention, teenage pregnancy, and general wellness. This experience strengthened my communication and facilitation skills, and deepened my passion for youth work. I am confident that my background in Business Finance and Accounting, combined with my community engagement, makes me a strong candidate to support the goals of this programme.', 'Yes', 'LUSWETI Eswatini ', 'At LUSWETI Eswatini, I served as a mentor, educating adolescents on important topics such as HIV prevention, teenage pregnancy, and COVID-19 awareness. I helped young people understand how to take care of themselves and make informed decisions about their health and well-being.\n', 'Yes', NULL, '2025-07-15 14:08:56', '2025-07-15 14:08:56'),
(26, 479, '[\"documents\\/01K06RZE2CM9W0929J5EN7H9J3.pdf\"]', '[\"documents\\/01K06RZE2F8VM41EEBJ8SR87VN.pdf\"]', 'Employed', '-I have more than 4 years experience of working with young women in 2 different tinkhundla \n-I am a team player who realises that each person\'s contribution is vital in achieving a set of common goals.\n-I can work under pressure with a minimum of supervision \n-I have good communication skills', 'Yes', 'Compationate Swaziland(Pact), Nazarene Compationate Ministries (Young Herios) and Georgetown university', 'I helped young woman by conducting sessions whereby we were discussing about their healthy and importance of having a healthy life.', 'Yes', NULL, '2025-07-15 14:09:39', '2025-07-15 14:09:39'),
(27, 480, '[\"documents\\/01K06S0R78EVMTF4CS2TV1Z69X.jpg\"]', '[\"documents\\/01K06S0R7AXEWJ9J2F0G6FPEA3.jpg\"]', 'Unemployed', 'I am a young person who relate well with other young people in my community. I also fellowship with other young people both at church and in my community- ball games. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 14:10:22', '2025-07-15 14:10:22'),
(28, 481, '[\"documents\\/01K06S4WBXMV8GDK324YYAH635.pdf\"]', '[\"documents\\/01K06S4WC0AKN4S9F1WDM7AM0E.pdf\"]', 'Unemployed', 'I\'ve applied for this role because I\'m passionate about empowering young people, particularly adolescent girls and young women. With 9 years of experience working with this demographic, I\'ve developed a deep understanding of their needs and challenges. My skills and experience align perfectly with this position, and I\'m confident I can make a valuable contribution to your team.\n\nI\'m confident I\'m the best candidate for this job because I possess a unique combination of primary and adult education, paired with extensive experience in facilitation, community engagement, and a deep understanding of community entry and structure. As a DREAMS coordinator, I\'ve demonstrated my ability to lead and deliver impactful programs, leveraging my skills in community mobilization and youth empowerment.\n\nMy experience has taught me the importance of tailored approaches, cultural sensitivity, and collaborative partnerships. I\'m well-equipped to navigate complex community dynamics and develop effective strategies that drive positive change. I\'m excited to bring my expertise and passion to this role and contribute to the success of your team.', 'Yes', 'Bantwana Initiative, Cabrini Ministries and Pact Eswatini ', 'I Developed and executed initiatives to empower adolescent girls and young women, focusing on education, health, and economic empowerment. Provided mentorship and support, offered guidance, counselling, and mentorship to help young people build confidence, develop life skills, and make informed decisions. Facilitated community engagement,  mobilised community stakeholders, including parents, teachers, and local leaders, to support and promote the well-being of young people.\n\nThrough these efforts, I helped young people,  improve their ability to make informed decisions, set goals, and navigate challenges. Increased their knowledge and utilization of health services, including sexual reproductive health. Empowered them to take control of their lives, make positive choices, and reach their full potential.\n\nMy work aimed to create a supportive environment where young people could thrive and reach their goals.', 'Yes', NULL, '2025-07-15 14:12:37', '2025-07-15 14:12:37'),
(29, 482, '[\"documents\\/01K06SA2SQ4YBHM7XYY8JTBRD0.pdf\"]', '[\"documents\\/01K06SA2SSG0YHMR4CWTPMS8HR.pdf\"]', 'Unemployed', 'I am a passionate advocate for community development, with a strong focus on empowering youth. With a background in youth structures and through grassroots initiatives, policy advocacy, and mentorship programs, my interests are to work to strengthen communities and amplify youth voices. I am also committed to collaboration and sustainable change, and believe in the power of collective action to build a brighter future for all.  ', 'Yes', 'Eswatini National Youth Council, Family Life Association\'s YAM', 'I facilitated on Life skills education and SRH as a Peer educator. Also, I attended Youth seminars and workshops focused on youth advocacy and development ', 'Yes', NULL, '2025-07-15 14:15:28', '2025-07-15 14:15:28'),
(30, 483, '[\"documents\\/01K06SAT5QG1C6C9E217R4GRGS.pdf\",\"documents\\/01K06SAT5SR4QVEH9MCK1NM5DD.pdf\"]', '[\"documents\\/01K06SAT5VM4GXBN91C2PK865S.pdf\"]', 'Unemployed', 'I have applied because I like helping people be it old or young. I believe we as people in this world we need someone to give us a hand at some point in life as we are unable to vent everything out to our everyday cycles as the world is full of judgements a new face is needed. \n\nI believe I am the best candidate for the job because I care about how the next person feels like, be it emotionally, physically or mentally as long as all your senses are on the right track we can conquer any challenges at hand. Furthermore, my experience with working with people puts me on a great advantage to be fit for the job. ', 'Yes', 'Women in Trade and Development ', 'In the organization we used to visit communities more often than calling the individuals to come to us. Our main focus was on the girl child but we wouldn\'t mind to go further on the boy child as well as everyone is destined for greatness. We used to do community works like gardening, cleaning most of the time. We also came with groceries as a token of appreciation for allowing us to spend the day with us. After the work was done we had a short meeting which made an individual to be able to open up because the bond between the two parties has been created. So in short the voice of the child was heard. ', 'Yes', NULL, '2025-07-15 14:15:52', '2025-07-15 14:15:52'),
(31, 484, '[\"documents\\/01K06SPJ9ZXDGBNKXM27B9DW46.jpg\"]', '[\"documents\\/01K06SPJA1Z3CYQFZD9FMT6NWR.pdf\"]', 'Unemployed', 'I have applied because, firstly I have been working with NGO\'S for the past 5 years in our constituency, so, I am well versed with the community and chiefdom structures, secondly, I grew up in the community which makes it easier to work with adolescents because the parents trust me withthem', 'Yes', 'Compassionate Swaziland, SWAGAA', 'I Mobilized young adolescents and facilitated classes on socio economic, Sexual health and Gender based violence.', 'Yes', NULL, '2025-07-15 14:22:17', '2025-07-15 14:22:17'),
(32, 485, '[\"documents\\/01K06ST00DNTYQAX6R4F7BHCQ4.pdf\"]', '[\"documents\\/01K06ST00GT83DA6N130VY5JYZ.pdf\"]', 'Unemployed', 'I love working with youth, I am a Sunday school teacher in my church hence I believe that I am a great candidate for this job as I have little experience, I\'m a dedicated, hardworking and professional individual which are quakities that are needed for this job.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 14:24:09', '2025-07-15 14:24:09'),
(33, 486, '[\"documents\\/01K06SVEDMS5929FYK8DVDMKAJ.jpg\"]', '[\"documents\\/01K06SVEDQNM2T7KS1GNJX9PF6.pdf\"]', 'Self-Employed', 'As a dedicated and self employed young lady, I have passion for development and youth development. I would excel as a peer educator as I can share my experience and the importance of starting something and defying the odds. Studying Community Development has also equipped me with the ability to connect with people in communities and facilitate meaningful discussions. I am excited to support others in their learning journey and contribute to a possitive community. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 14:24:57', '2025-07-15 14:24:57'),
(34, 487, '[\"documents\\/01K0A6X9Y18YBRS81ZDT6P2AAC.jpg\"]', '[\"documents\\/01K06SW9F5A88ZDSCZQBYW5RV1.jpg\"]', 'Unemployed', 'Actually I enjoy working with people. With my experience i think I am a suitable candidate for this job since I\'ve worked with all the groups of people ( poor and rich people ). Lastly I\'ve been exposed on remote areas and also on the country side so I will b able to work on urban and rural areas.', 'Yes', 'World vision - volunteer ', 'We were given a task by the Mahlangatja world Vision office to organise the youth and elderly, so often we use to meet the youth at sport ground teaching them about health, HIV/AIDS and empowering them keep themselves always fit. For the elderly group we use to teach them about hygiene at homes ( kitchen, bedrooms and toilet), and also emphasizing to those who take ARVs to continue without hesitation for their healthy.', 'No', NULL, '2025-07-15 14:25:24', '2025-07-16 22:10:53'),
(35, 488, '[\"documents\\/01K06SX40848J71N0S9Y4RY403.jpg\"]', '[\"documents\\/01K06SX4091P58NQD81J3NP2R6.pdf\"]', 'Unemployed', 'I am passionate about working on an organisation, i lead a youth in my church that made me feel the need of improving and gaining experience and new skills in young individuals, i am a very calm minded person who is very disciplined who adapt easily to new environment and I\'m easily approachable, what makes it more interesting is that I\'m good in confidentiality as some issues are better within a certain circumstance. I can\'t elaborate more but given an opportunity or a chance i know i will do my best. and ', 'No', 'none', 'I have previously contributed in church as a sunday school teacher then later a youth leader and currently I\'m a choir master that has made me closer working with different teams and age group, also i have previously worked as an insurance seller in different tikhundla for older and young people. ', 'Yes', NULL, '2025-07-15 14:25:52', '2025-07-15 14:25:52'),
(36, 489, '[\"documents\\/01K06T5QEF0A6XE04X51XN1GT3.jpg\"]', '[\"documents\\/01K06T5QEK6JDSQC7GG9A3K44A.jpg\"]', 'Unemployed', 'I am eager to contribute to initiatives that support youth growth and development. As a holder of Secondary teachers\'Diploma, I am passionate about working with youth particularly teenagers. I am confident that my passion for teaching will make me a strong candidate for this opportunity. ', 'No', 'None', 'None', 'No', NULL, '2025-07-15 14:30:34', '2025-07-15 14:30:34'),
(37, 490, '[\"documents\\/01K06TA8GD7RBTXD1GM18B128Z.pdf\"]', '[\"documents\\/01K06TA8GGW5MGW728NRMXFKV0.pdf\"]', 'Unemployed', 'I have worked with different youths at Tertiary Level, the experience I gained will help me to cope and understand how others need to be assisted in order to flow with other team members. I believe in teamwork and collaboration with positive work ethics and excellent communication skills', 'Yes', 'SACTS MULTIPURPOSE COOPERATIVE SOCIETY LIMITED', 'As tertiary students at SANU-Siteki Campus we form a Students Cooperative to inspire them open businesses within the school also promoting the spirit of saving. It is a credit and saving Cooperative registered under the Ministry of Commerce, Industry and Trade registration no. 1076. I was the Chairperson of the organisation when we completed our class attending lectures end of April 2025', 'Yes', NULL, '2025-07-15 14:33:02', '2025-07-15 14:33:02'),
(38, 491, '[\"documents\\/01K06TARVGSYWJ6VZ19Q4VXGB7.pdf\",\"documents\\/01K06TARWC6176AF8KBQEYHPMW.pdf\"]', '[\"documents\\/01K06TARX3M7VSDR502RR1HDDD.pdf\"]', 'Unemployed', 'I am confident that my unique blend of formal education, practical experience in youth development, and genuine passion for empowering young people makes me an ideal candidate for this Peer Educator position. I have  Qualifications which are, Diploma in Primary Education: My academic background in Primary Education has provided me with a robust understanding of pedagogy, child development, and effective communication strategies tailored for different age groups. This includes skills in curriculum development and building rapport .\nI also have Demonstrated Experience in Youth Development: I have actively engaged in helping youth grow, particularly through my involvement with a church-based group. In this role, I focused on critical areas such as drug prevention and teenage pregnancy. My contributions included, mentorship, proving healthy choices and creating safe space where youth felt comfortable in sharing this concerns\nI believe I qualify for this Peer Educator position because I possess the core competencies essential for success in this role:\n\nRelatability and Empathy: My recent, hands-on experience working directly with youth in Church allows me to connect with them on a genuine level. I understand their challenges, perspectives, and the specific pressures they face, which enables me to build trust and encourage open communication on sensitive topics. My empathetic approach ensures that youth feel heard and understood.\nPassion for Youth Empowerment: My dedication to helping young people avoid risky behaviors and achieve their full potential is not merely professional; it is a profound personal commitment. I am driven by a genuine desire to see the youth in our community thrive and become positive contributors to society.\n\n', 'Yes', 'Ekukhanye Free evangelical Christian fellowship Church ', 'Led a church-affiliated youth initiative dedicated to addressing substance abuse and teenage pregnancy. Designed and delivered educational sessions, fostered a supportive peer environment, and connected at-risk youth with resources, successfully guiding them towards healthier lifestyle choices and improved well-being.', 'Yes', NULL, '2025-07-15 14:33:19', '2025-07-15 14:37:20'),
(39, 492, '[\"documents\\/01K06TE3F0Y4WECSZSCD7KYHJF.pdf\"]', '[\"documents\\/01K06TE3FJDJRMXBMAWP25JVYB.pdf\"]', 'Unemployed', 'I would like to inspire the next generation to empower them and create jobs.', 'No', NULL, 'None', 'No', NULL, '2025-07-15 14:35:08', '2025-07-15 14:35:08'),
(40, 493, '[\"documents\\/01K06TF2GWF69MSM3AHHYQCAK1.jpg\"]', '[\"documents\\/01K06TF2GY6CGGAQ0EHXTTHSQZ.pdf\"]', 'Unemployed', 'I have a passion in helping you people grow. I belive I have the experience in community development and my skills include great communication, attention to detail, community development studies.', 'Yes', 'Khulisa Umntfwana Charity Organization', 'During my time at Khulisa Umntfwana we had to organize young boys and girls and conduct sessions talking about life issues. The sessions were conducted in group which was based on age. The topics covered include but not limited HIV/AIDS, GBV, STIs, SODV, and many more. What is more important is that I was one of the facilitators.', 'Yes', NULL, '2025-07-15 14:35:40', '2025-07-15 14:35:40'),
(41, 494, '[\"documents\\/01K06TJJSW2ZVZJBQ3T9C9TVFM.pdf\"]', '[\"documents\\/01K06TJJT73NDSN48C7X7T96A3.pdf\"]', 'Employed', 'I am currently in a project based job in accounting clerical work which elapses at the end of August and Since Graduation of my first degree in 2018 I haven\'t been able to secure permanent employment, I then decided to persue Education as a post graduate certificate and I fell in love with the career, it is a calling, so this opportunity would allow me to showcase my skills as I wait for the Teaching Service Commission (TSC) to grant me a post to teach Accounting and Economics in Senior Secondary Schools around Eswatini.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 14:37:35', '2025-07-15 14:40:06'),
(42, 495, '[\"documents\\/01K06TMG35K7SK62A0KXRVAKJ5.jpg\",\"documents\\/01K06TMG37WRK4TEXQH9WKNY54.jpg\"]', '[\"documents\\/01K06TMG3TX63XK2PM5XYAFTN6.pdf\"]', 'Unemployed', 'My strong background in mentoring and community engagement as a student teacher has given me the  experience i need in working with diverse youth population and equipping  me with the skills to foster positive relationships and create an inclusive environment. I am passionate about empowering young people to achieve their goals utilizing the resources they have at their disposal to enhance their personal and academic goals in the future. ', 'No', 'None ', 'None ', 'Yes', NULL, '2025-07-15 14:38:38', '2025-07-15 14:38:38'),
(43, 496, '[\"documents\\/01K06TSZ532PDHRP49VZGMGVP1.pdf\"]', '[\"documents\\/01K06TSZ57WW8D9DVC7ZXHZYMA.pdf\"]', 'Unemployed', 'I believe i am the best candidate because im eager to see the youth growing into a healthy community and helping the upcoming generation.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 14:41:37', '2025-07-15 14:41:37'),
(44, 497, '[\"documents\\/01K06TTZ6GRBCF0DAFNR5CRE93.pdf\",\"documents\\/01K06TTZ6K865XZ7N0WMAEEXV3.pdf\"]', '[\"documents\\/01K06TTZ6V5B41BEMEZSAHRWEC.pdf\"]', 'Unemployed', 'I am passionate about youth deceand I always find myself in a space where I work with young people. As such I currently volunteer as a Children\'s Ministry teacher in my church as a means to impact young lives. I have also worked in youth entrepreneurship where I was involved in the training of young people to discover their entrepreneurial ambitions. I also worked with youth in communities through the Ministry of Health LISTEN project where we discovered some of the drivers of HIV infections among the youth to be poverty and lack of skills. I would therefore like to be involved in influencing a paradigm shift in the status of young people. ', 'Yes', 'Junior Achievement Eswatini ', 'I worked with young people in at out of school youth in fostering an entrepreneurship mindset among the youth. I have also worked in enterprise facilitation where groups of young people in communities were group together as communities of practice and assist them identify practical solutions of ending unemployment and poverty through starting enterprises. ', 'No', NULL, '2025-07-15 14:42:10', '2025-07-15 14:42:10'),
(45, 498, '[\"documents\\/01K06TXBAE7GM6V1R96ND2XVWK.pdf\"]', '[\"documents\\/01K06TXBAGQPG8FNM2QZ3B1B9J.pdf\"]', 'Unemployed', 'As a growing young adult, I find it important to equip other like minds with my knowhow. I am outgoing and very sociable. Moreover, I am very passionate about young people. Seeing them thrive in all areas of life makes me happy. This is why I have devoted my time to assisting them with a career lift.', 'Yes', 'Siphila \'Nje Drama Society', 'I specialized in training the youth in theatre and also other life skills. I was part of a team tasked with ensuring everyone got to learn the traits of the industry. At times we had to offer bit part counselling to those in need and unsure of what career paths to pursue.', 'Yes', NULL, '2025-07-15 14:43:28', '2025-07-15 14:43:28'),
(46, 499, '[\"documents\\/01K06TYT0C7YV7HYQ7HXEE03ZN.pdf\"]', '[\"documents\\/01K06TYT0GH2BDK8CQ2MJP3PCJ.pdf\"]', 'Unemployed', 'I have pettion with young people and I am always will to help where I can and I also help some kids with school shoes.\nI am willing to help the youth grow and understand the importance of taking education seriously and also help them avoid getting into addictive habits.\nI also want to share with them on how to get good results.\nI applied because I believe that I can bring change to young people or I can bring a good impact to their lives.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 14:44:16', '2025-07-15 14:44:16'),
(47, 500, '[\"documents\\/01K06V0CZ8TYVBX2Y9VZ8FB5C6.pdf\"]', '[\"documents\\/01K06V0CZ9JRBM0MQZCYA1EQMS.pdf\"]', 'Employed', 'I can refer myself as the best candidate for the job as I\'m still young ambitious , dedicated form 5 and University graduate,I too while still in the job I\'m going to learn some of the important things I haven\'t learnt while I was still growing up as not everything you get to learn ,some you miss and you learn as you still move on.', 'No', 'None', 'None', 'No', NULL, '2025-07-15 14:45:08', '2025-07-15 14:45:08'),
(48, 501, '[\"documents\\/01K06V0EPBTMA12214C9660FY6.pdf\",\"documents\\/01K06V0EPEEBG2BV4Z755TZB06.pdf\"]', '[\"documents\\/01K06V0EPH7JQT81HA5JJAZ2T6.pdf\"]', 'Unemployed', 'I believe I am the best candidate for the Peer Educator position due to a combination of my relevant experience, passion for education, and strong interpersonal skills. I have previously volunteered as a mentor for younger students, where I developed effective communication strategies to engage and motivate them in their studies.', 'Yes', 'The Deputy Prime Minister’s Office under Young Heroes and SWAGAA ', 'I helped young people to see life in a different and helpful perspective. I was also there to provide solutions to every young people in different situations.', 'Yes', NULL, '2025-07-15 14:45:09', '2025-07-15 14:45:09'),
(49, 502, '[\"documents\\/01K06V3T061XR6EH2NMQS7G4BW.pdf\"]', '[\"documents\\/01K06V3T09T6VCE9M0TJYEBSC7.pdf\"]', 'Unemployed', 'I believe i can be a great asset to this program and through it I will also gain more knowledge and experience in the field of humanities and I am good with young people I have studies and been exposed to many situations where I have to communicate with young people and as one myself it would be easy for them to open up to me and i would receive their problems with a common mindset and be able to advice with a language they relate to. ', 'Yes', 'Little Minds big Dreams ', 'I was one of the Mentors in the programs to encourage young people to develop their skills and ideas and advising them on key programs as they go through higher education. And also social based issues as they are growing up in a society full of pressure and challenges.', 'Yes', NULL, '2025-07-15 14:46:59', '2025-07-15 14:46:59'),
(50, 503, '[\"documents\\/01K06V6J0SNAHT07R8A6SZ0GJD.pdf\"]', '[\"documents\\/01K06V6J0WXKKSYFV86VPSHZQY.pdf\"]', 'Unemployed', 'I am particularly interested in this role because it combines learning, teaching, and serving the community. I enjoy working with others, especially in environments where people are learning from one another and building confidence in themselves. Peer education is one of the most powerful tools for reaching young people and communities in a relatable, respectful, and effective way. I believe that people respond better when they feel seen and heard by someone who understands their reality and I’d like to be a part of ensuring that happens. As someone who grew up in Eswatini and understands the challenges many young people face I know how important it is to have someone who can listen, guide, and support without judgment.  I believe I am the best person for this opportunity because I am committed, grounded, and genuinely passionate about making a difference. I do not take lightly the responsibility that comes with being a peer educator trainer. It requires patience, empathy, and dedication, qualities I know I possess and am constantly working to strengthen. I am not only interested in what I can give to the role, but also in what I can learn and carry forward as I continue to grow in my professional career.This role aligns with my values, my interests, and the type of future I want to build. I am looking for a meaningful place where I can connect with people, be of service, and see real change happen in real time. Being selected for this role would not only allow me to start my professional journey, but also to contribute to a cause that truly matters to me.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 14:48:29', '2025-07-15 14:48:29'),
(51, 504, '[\"documents\\/01K06VS4BCHK0KWD7F6642G60B.pdf\"]', '[\"documents\\/01K06VS4BFKF5DJS3CGNH7X2SB.pdf\"]', 'Unemployed', 'I am young and passionate in working close to young people. My vision is to see them growing and flourishing  becoming better members of the society .', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 14:58:38', '2025-07-15 14:58:38'),
(52, 505, '[\"documents\\/01K06VTF6S5EQ6QX8YRMD0P8G6.heic\"]', '[\"documents\\/01K06VTF70Q09QH0B590P46FPV.pdf\"]', 'Unemployed', 'I am passionate about making a positive impact in the youth. I believe with my knowledge, skills and capabilities I would help them greatly.', 'Yes', 'Girls leading Our World (GLOW)', 'I encouraged learners to focus on their education , shared study tips and motivated them to be confident in who they are as well as respect themselves.', 'Yes', NULL, '2025-07-15 14:59:22', '2025-07-15 14:59:22'),
(53, 506, '[\"documents\\/01K06VTJ4TDR211W2SJY7PBMHG.jpg\"]', '[\"documents\\/01K06VTJ4XDT4GHJDM0DTTRYZY.jpg\"]', 'Unemployed', 'I\'m a hard worker and I am always willing to work as I know on how to interact with different kinds of people as I was a sales agent at mukuru company  I do have experience on communicating with people ', 'Yes', 'Flas', 'I was a peer educator helping young people to know on how to prevent them selves on getting HIV', 'Yes', NULL, '2025-07-15 14:59:25', '2025-07-15 14:59:25'),
(54, 507, '[\"documents\\/01K06W362WKC00CJVWF50EYRE7.pdf\"]', '[\"documents\\/01K06W3631SJ44JPBN49SYRZ4V.pdf\"]', 'Unemployed', 'I am a fast learner.I take care of a youth project in my community.I have have the right skills to help the youth in my community.I love to see the youth acquire more knowledge and help them with the challenges they face.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 15:04:08', '2025-07-15 15:04:08');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(55, 508, '[\"documents\\/01K06W7N949Q6PYRRE0NAK00BP.pdf\"]', '[\"documents\\/01K06W7N987TZBWYV4FJ5W879Y.pdf\"]', 'Unemployed', 'I applied so that I can gain more knowledge to help young people on how to shape their future. I am the best candidate because I am passionate about helping young people so that they can have a bright future and be confident in themselves always.', 'Yes', 'The uke Commission and FLAS Youth Action Movement ', 'At Youth Action Movement,we were distributing condoms together youth and teaching each other about how young adult should behave. At the Luke Commission I was restocking medication for outreaches, doing home visits for lost-to-follow-up teens and adults.', 'Yes', NULL, '2025-07-15 15:06:34', '2025-07-15 15:06:34'),
(56, 509, '[\"documents\\/01K06W9SDSJV0658V30882RHR0.heic\"]', '[\"documents\\/01K06W9SDWXA8BW5YTVHMEQ9G6.pdf\"]', 'Unemployed', 'I am applying for this position because I have a deep passion for working with youth and empowering them to reach their full potential. Growing up in my community, I have witnessed the many challenges that young people face, including lack of guidance, opportunities, and positive role models. I believe that with the right support, mentorship, and life skills, the youth can transform not only their own lives but also their communities.\n\nI am the right candidate for this role because I bring both experience and dedication. I have been actively involved in youth programs and health education through my work as a Peer Educator and my participation in community initiatives. Additionally, my training in Emergency Medical Care and Rescue has equipped me with skills to care for the wellbeing of others, especially in situations where health and safety are concerned, such as during the Bushfire Festival, where I assisted children and families.\n\nMoreover, I possess strong communication, facilitation, and mentorship skills that allow me to connect easily with young people. My ability to listen, guide, and support them in making positive life choices is something I take pride in. I am confident that my passion, combined with my hands-on experience and commitment to youth development, make me a valuable asset to your program.', 'Yes', '0113 ambulance at Bushfire festival 2025', 'Provided First Aid & Medical Assistance: Attended to children who experienced injuries, dehydration, or exhaustion, ensuring they received prompt care.\n\nCreated a Safe Space for Lost Children: Assisted in reuniting lost children with their parents or guardians, providing emotional support and a safe holding area.\n\nHealth Education: Advised children and their caregivers on basic health practices like hydration, sun protection, and safe movement in crowded spaces.\n\nEmotional Support: Offered comfort and reassurance to distressed or anxious children, especially those overwhelmed by the large crowds.\n\nSafety Awareness: Educated children and their families on safety tips within the festival grounds to prevent accidents and injuries.\n\n\nBenefits to the Children\n\nEnhanced Safety: Children were kept safe from physical harm due to quick medical interventions and preventative advice.\n\nReduced Anxiety: By providing care and reassurance, children felt less anxious and more secure during the festival.\n\nHealth Promotion: Through education on hydration and sun protection, children learned how to take care of themselves in public events.\n\nFamily Support: Parents felt more comfortable bringing children to public events, knowing that trained responders like you were present to assist.', 'No', NULL, '2025-07-15 15:07:44', '2025-07-17 15:08:24'),
(57, 510, '[\"documents\\/01K06WEV6THB6S33T4ZM3KT3MC.pdf\"]', '[\"documents\\/01K06WEV6YKH69W4GWP4FVWMQJ.pdf\"]', 'Unemployed', 'I see this post as an opportunity for me to contribute my humanitarian and heart for the youth.  Being youth myself who is solely invested in seeing positive change in the society l believe this is a great opportunity for me to learn, grow and bring positive change in the Youth of Eswatini and the kingdom at large.', 'Yes', 'UNESWA peer counselors & educators ', 'I have been a Peer counselor and Educator at the university of Eswatini kwaluseni campus currently l serve the role of chairperson .', 'No', NULL, '2025-07-15 15:10:30', '2025-07-15 15:10:30'),
(58, 511, '[\"documents\\/01K06WFGWHH0Z27MQ2HJBT0PJX.jpg\"]', '[\"documents\\/01K06WFGWNHKPSMJ2K2231GN5Q.pdf\"]', 'Self-Employed', 'I have applied because I want to help the youth on psychosocial and counselling,Raise awareness on them about,GBV,their rights also raising the  knowledgable youth about good choices in life and making the right decisions.Raising an anger free generation. ', 'Yes', 'Bantwana', 'Life mentor to the youth,Learning about HIV,growth and facing challenges in life', 'Yes', NULL, '2025-07-15 15:10:52', '2025-07-15 15:10:52'),
(59, 512, '[\"documents\\/01K06WM79E0CPK2CX7T9AMASCN.pdf\",\"documents\\/01K06WM79HVF6R1WJ67AHRP30E.jpg\"]', '[\"documents\\/01K06WM79KKWZRCVFN8X1B3HRD.pdf\"]', 'Unemployed', 'I believe I am the best candidate for the Job especially because of the circumstances I have overcame as a young person, as a result I feel like I am qualified by experiencing to help other young people nevigate their way to unlocking their potential. It is not like I want to show them how powerful I am I am but instead is to remind every young person of the hidden potential and power in sufferings. I also believe I possess the right mind-set, discipline and skills to be part of Eswatini National Youth Council. In addition, it can also help me archieve my goal of becoming part of the Commonwealth Youth Council which is an international youth-led initiative.\nThank you.', 'Yes', 'Family Life Association Eswatini and Youth Chamber of Commerce and Industries Eswatini', 'FLAS\n> I was part of the Youth Action Action Movement.\n>Facillitated health talks during the weekly youth meetings.\n>Raising awareness in terms health and reproduction safety practices like condom distribution in different localities.\nYCCIE\n>Marketing Manager (Volunteer), raising awareness of youth led business through entrepreneurship\n>Technical Manager (Volunteer), participated in youth oriented workshops.', 'Yes', NULL, '2025-07-15 15:13:26', '2025-07-15 15:13:26'),
(60, 513, '[\"documents\\/01K06WQ9WZ6BSJYG5XRDTDW4FY.pdf\"]', '[\"documents\\/01K06WQ9XDTB2NXAFSNPQT5GFQ.pdf\"]', 'Unemployed', 'I have applied for this youth empowerment training programme because I am deeply passionate about personal growth, community development, and creating positive change. I believe that young people have the potential to be powerful agents of transformation, and I want to be equipped with the skills, knowledge, and mindset to contribute meaningfully to that mission. This programme offers a unique opportunity to learn from experienced mentors, collaborate with like-minded peers, and gain practical tools that will help me become a more confident, capable, and impactful leader in my community. I am a highly motivated and purpose-driven individual who is committed to making a difference. I bring a strong sense of responsibility, creativity, and a willingness to learn and grow. I have already taken steps to empower myself and others through [insert any relevant experience—volunteering, school leadership, community projects, etc.], and I am eager to build on that foundation', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 15:15:08', '2025-07-15 15:15:08'),
(61, 514, '[\"documents\\/01K06WQB90VXXSHDJFK538D1HW.jpg\"]', '[\"documents\\/01K06WQB926SS0BGBC2JFT8NNV.jpg\"]', 'Unemployed', 'Working with young people is my passion. With my age and the things I have gone through I think my experience will guide young people\n', 'No', 'None', 'Helped during the construction of Mahebedla soup kitchen.', 'Yes', NULL, '2025-07-15 15:15:08', '2025-07-15 15:15:08'),
(62, 515, '[\"documents\\/01K06WX3Y0G6BD0DJCQ9TKCFDA.pdf\"]', '[\"documents\\/01K06WX3Y4MCGA47N65MXHZTDY.pdf\"]', 'Unemployed', 'I have applied because I am passionate about project coordination and contributing to impactful work that empowers communities. I believe I am the best candidate because I bring strong organizational skills, adaptability, and real experience as a Project Manager Support Intern, where I handled admin, team support, and helped drive tasks from planning to execution.', 'No', 'None', 'During university, I was involved in an entrepreneurship project where we engaged with youth and promoted business ideas. I also assisted fellow students with CV crafting, explained the importance of a strong CV, and helped others apply for jobs.', 'No', NULL, '2025-07-15 15:18:17', '2025-07-15 15:18:17'),
(63, 516, '[\"documents\\/01K06X4VCHRM0M16RQAD0QPM6W.PDF\"]', '[\"documents\\/01K06X4VCMKQ73CDHAMKDX1NE9.pdf\"]', 'Unemployed', 'I am passionate about empowering young people and creating safe, inclusive spaces where they feel heard, supported, and informed. This opportunity aligns perfectly with my values and the impact I strive to make in my community.\nAs a young person myself, I understand the importance of having peers who not only relate to your experiences but who can also guide you with empathy and accurate information. I believe I can be that person for others. I am confident in my ability to connect with diverse individuals, listen without judgment, and encourage meaningful conversations around issues that matter whether that’s mental health, relationships, academic stress, or self-esteem.\nI have volunteered in a young people based organization and been part of a leadership group which has strengthened my communication skills and ability to facilitate small group discussions. I also have a genuine interest in personal growth and education, and I am always open to learning new strategies for helping others.', 'Yes', 'Young Heroes Eswatini ', 'I was responsible for mobilising parents and their children (both kids and teens) and facilitating positive parenting sessions to them. The parenting sessions were very helpful to young people because In a positive parenting session, a parent might learn to replace yelling with calm but firm consequences, or how to validate their teen’s emotions while setting clear expectations. This reduces conflict and teaches the child healthier ways to handle challenges. The sessions also help improve parent-child relationships and may increase confidence and self-esteem of the young people. Positive parenting helps reduce the risk of anxiety, depression, and behavioral disorders. It creates a stable, nurturing environment that acts as a buffer against life’s stresses. Children raised with positive parenting learn empathy, cooperation, and respectful interaction, which helps them build healthier relationships with peers and adults.', 'Yes', NULL, '2025-07-15 15:22:31', '2025-07-15 15:22:31'),
(64, 517, '[\"documents\\/01K06X886AHGPVW7WNTZCTC5AN.pdf\"]', '[\"documents\\/01K06X886CQ5N7Z8J8FC4H43BM.pdf\"]', 'Unemployed', 'Being the well disciplined person who is self motivated  in working  effectively  with groups and individual .I think  could help for the betterment of the organization  and make a huge difference. I also a young energic guy who is a soccer player and a captain in my team, i think being the leader of the team or captain  made me strong in communication  within the team ,solving problems  of my teammates   and being their leader they can trust.By being the leader ,I led the team to go and compete in the Hhohho super league  in the Northen   stream in season 2022/2023.In addition I am  very good in communication  in SiSwati  and English.I am a very diligent  young person who is always ready to work ', 'No', 'None', 'None', 'No', NULL, '2025-07-15 15:24:22', '2025-07-15 15:24:22'),
(65, 518, '[\"documents\\/01K06XBVZK1ZV6WHG6T8RPDCJM.pdf\"]', '[\"documents\\/01K06XBVZPQK2V17WV1NZAS8J1.pdf\"]', 'Employed', 'I believe this training will help me a lot in Evolving my career and polish up my skills. I believe I\'m the best candidate for this job because I\'ll be enduring what I\'ve started in the community. Working in the community kept me believing that the is an impact on what I\'m engaging the youth with. Being a servant in the the community helps me understand which direction we are heading and striving for better life by not misusing resources. ', 'Yes', 'Kwakha Indvodza', 'Mentoring on many aspects like, financial independence which includes Goal setting, Personal branding and professionalism, Networking, CV writing and Entrepreneurship & Business Planning. On the other note I facilitated on GBV issues and Male Health. ', 'Yes', NULL, '2025-07-15 15:26:21', '2025-07-15 15:26:21'),
(66, 519, '[\"documents\\/01K06XF0HBPN0HY651NC0Z8217.jpg\",\"documents\\/01K06XF0HS1GSF9ZM8GC0D9ZPY.jpg\"]', '[\"documents\\/01K06XF0J5HRN9EDV0VD5S3BMP.pdf\"]', 'Unemployed', 'I believe I am the right candidate for the job because I am deeply committed to personal growth, community engagement, and developing the leadership skills necessary to make  a meaningful impact. I see this program as an opportunity to grow not just for myself, but for those I will serve and influence in the future. \nI bring in me a strong sense of responsibility, in a willingness learn, and a heart for service. I thrive in team settings and eager to work with others share a passion for empowering youth and strengthening our communities. My experience in church have helped me shape my ability to communicate effectively, solve problems creatively and leas with empathy and intergrity.\nThis program aligns closely with my goals of becoming a more capable leader, a positive role model, and contributing to youth development. I am confident that my dedication, attitude, and willingness to grow will allow me to make the most of this opportunity and respect your organization with excellence. \n\nYour consideration will be highly appreciated. Thank you in advance. ', 'Yes', 'Buhle bemakhrestu Church in Zion ', 'I worked  with Buhle bemakhrestu ( an organization which help the youth to live a righteous  and upright life, mind lectures, etc)It is a an organization that focused on zion youth across the country.I worked as a teacher of the youth where I would guide them on Sundays until they meet with other youth from the 4 regions during Youth camp on December. I also started a youth group where I stayed in Mhlaleni where I teach them about taking care of themselves, focusing on their education and their dreams. I also help them with homework if need be.Having them around me reminds me of how blessed the youth is because they can shape their future the way want it to be.ESwatink youth is blessed with many opportunities, they just need to focus', 'No', NULL, '2025-07-15 15:28:04', '2025-07-15 15:28:04'),
(67, 520, '[\"documents\\/01K06XF8ZX00QYE4ME48G8K8ZQ.png\",\"documents\\/01K06XF901C7H5TVX87WYZGQ8F.png\",\"documents\\/01K06XF903GJ3Y3C516AN2SCRJ.png\"]', '[\"documents\\/01K06XF908CVNBWAP3T9X59PPN.png\"]', 'Unemployed', 'Firstly, I am a relationship builder. I have developed strong interpersonal skills forming meaningful connection with young people. I am also a very patent person, working with young people can be a bit stressful because sometimes you’d plan to meet them and none of them would show up but you don’t give up you meet them again whenever they’re available. Thirdly, people I’ve worked with have seen me as a problem solver because I’ve helped young people overcome challenges by helping them demonstrate their resourcefulness to think critically. Moreover, I’m also empathetic. It’s not always where I should be listened to but  I am willing to listen and understand my team then we work together on finding solutions. My experience in leading small groups facilitating topics and discussing highlights have sparked that leadership role in me. Coaching a wide range of young people have made me a coach because I have the ability to guide and support them in their lives', 'Yes', 'Campus Crusade for Christ ', 'I have been working with campus Crusade for Christ as staff under the student led movement department. Here we work with students to help them excel academically and spiritually. We first evangelise to them then after they give their life to Christ we coach them, we make small groups where you meet them one on one and in groups. This approach also helps you to know the student better because sometimes as you get to know them you discover problems that they encounter at home and just anywhere then you help that student on how they can overcome such. Sometimes we’d read the Bible together, and discuss our highlights. Sometimes we’d go on trainings that’ll help them as young people. Topics facilitated include: setting goals, setting priorities, daily performance curve, being proactive from a range of topics. So basically you just become friends with your team as they start trusting you and they share their challenges with you they you can help them take decisions. ', 'No', NULL, '2025-07-15 15:28:12', '2025-07-15 15:28:12'),
(68, 521, '[\"documents\\/01K06XGH0S7ZPJK287P6J7N9EW.jpg\"]', '[\"documents\\/01K06XGH0VC8WM1KN1A5NF6ZPK.pdf\"]', 'Unemployed', 'I applied because currently I am unemployed and I\'m seeking employment. I\'m also eager to contribute my skills in mentorship, facilitation and youth empowerment to this initiative. My academic training in education has equipped me with strong communication, leadership, and organizational skills which align perfectly with the responsibilities of a peer educator.', 'No', 'None', 'I did a 3 months internship at Fundukuwela High School as a student teacher in Commercial subjects. I engaged with young people daily in the school.', 'Yes', NULL, '2025-07-15 15:28:53', '2025-07-15 15:28:53'),
