(70, 523, '[\"documents\\/01K06XK0PD477RZ8WZ1BZCX1DV.jpg\",\"documents\\/01K06XK0PFGJHG1NSHCNYNF1K2.jpg\",\"documents\\/01K06XK0PJS9JGWX3JBCX3T77T.jpeg\"]', '[\"documents\\/01K06XK0PPTMQ40PKZ44QBRBJD.jpg\"]', 'Unemployed', 'I firmly believe that I am the right candidate for this  job because I have lived in my community my whole life and I have not only observed the challenges the youth go through but I have also experienced it hence I am capable of providing guidance to my fellow community members.more over I have a passion in providing change to my community that will provide better output in terms of a challenging environment that can be tempting to the youth.i would love to be an influence in building a more confident,wise and courageous youth.my passion is stronger,dedicated and ambitious.i yearn to be more helpful no matter the time and effort that is required in this program.', 'Yes', 'International youth fellowship ', 'I was a volunteer and a main actress for the Easter and Christmas cantata', 'Yes', NULL, '2025-07-15 15:30:15', '2025-07-15 15:32:42'),
