(74, 527, '[\"documents\\/01K06XQHW5SZB661ANPAS009M9.pdf\"]', '[\"documents\\/01K06XQHW8QSD38HAF34Y1VSXK.pdf\"]', 'Unemployed', 'I am passionate about youth development and fostering positive change. Having worked as a youth leader and a high school teacher for seven years, I have first hand experience when it comes to issues that affect the youth. My exposure has also equipped me with strategies to employ when approaching the youth so to maximise positive reception. ', 'Yes', 'Anglican Youth of Eswatini ', 'I planned and implemented youth empowerment programs. Also collaborated with organizations like WomENg. to sensetise the youth on career choices, and the marketibility of STEM courses. Organised career expos where vocational institutions were invited. This was to ensure the youth thinks beyond academic career choices. Also ensured annual youth gatherings address issues like mental health, GBV,To name a few.', 'Yes', NULL, '2025-07-15 15:32:44', '2025-07-15 15:34:33'),
(75, 528, '[\"documents\\/01K06XSDQF2A53C363N3EHRGPD.heic\"]', '[\"documents\\/01K06XSDQKJVG4HQ6Q820VSCSY.pdf\"]', 'Self-Employed', 'I am passionate about empowering fellow youth with knowledge and skills that promote positive change', 'No', 'None', 'None', 'No', NULL, '2025-07-15 15:33:45', '2025-07-15 15:33:45'),
(76, 529, '[\"documents\\/01K06XSJADZBZ5WHR31Z6TZ9B9.jpg\"]', '[\"documents\\/01K06XSJAFA9E98BRTCH80YSKQ.pdf\"]', 'Unemployed', 'I have applied because I believe I am the right candidate as I believe, with my skills from teaching I can make a change in the youth. Previously I taught Grade 4 - 7 which made me experience working with adolescent children, I know how to tackle and understand them. Working with the youth has always been my passion since I relate in everything they go through as I was once a teenager myself. Given the chance I will out do every task given.', 'No', NULL, 'I have worked with adolescents as I was teaching them at school. I made a lot impact in them because my teaching was beyond the classroom environment but I also taught them about life in general, challenges they would face and how to tackle them.', 'Yes', NULL, '2025-07-15 15:33:50', '2025-07-15 15:33:50'),
(77, 530, '[\"documents\\/01K06XSYSSZRP89TW97CBVYSSH.pdf\"]', '[\"documents\\/01K06XSYSY8P2RSVQKX0BNVP0F.pdf\"]', 'Unemployed', 'I have applied for this job because I believe I am the right candidate to help young people. Since I am one of them, I know the struggles they undergo everyday because of unemployment in the country. Also  I have good communication skills which will help in the long run of the project. I pay attention to every detail making me ideal candidate for this job. I also work well under pressure.', 'Yes', 'World Vision ', 'I was a member and i used to mobilize students at Limkokwing University to go attend world vision\'s seminar at the campus. I used to encourage the youth about the importance of cooperation and sharing of ideas about life and sharing life experiences.\n', 'Yes', NULL, '2025-07-15 15:34:02', '2025-07-15 15:34:02'),
(78, 531, '[\"documents\\/01K06XTXBPXDKP9FEASZ49PQ8C.jpg\"]', '[\"documents\\/01K06XTXBVDQ113EJJNBVRQZC8.pdf\"]', 'Unemployed', 'I’ve always had a strong passion for supporting young people in their growth and development. I find it incredibly rewarding to help them build confidence, learn new skills, and discover their potential.I’m a strong communicator and a good listener, which helps me build meaningful connections with young people. I’m also patient, approachable, and able to adapt my approach to suit different personalities and needs, i also understand that this role requires being a positive role model, managing behavior constructively, and supporting young people emotionally and socially. I’m confident I can provide a safe, supportive environment where they can thrive.\n\n', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 15:34:34', '2025-07-15 15:34:34'),
(79, 532, '[\"documents\\/01K06XX9WQAWKBHZK3RWEX4DRZ.pdf\"]', '[\"documents\\/01K06XX9WY9JRQMY4ZBJYMN921.pdf\"]', 'Employed', 'I have applied because I am deeply passionate about supporting young people and creating safe spaces where they can learn, heal, and grow. Coming from a background where I faced stigma, abuse, and health challenges, I know firsthand what many young people are going through. This experience drives me to be a voice of hope and a leader who brings change.\n\nI am the best candidate because I bring more than just passion—I bring experience, creativity, and a deep understanding of youth needs. As a peer supporter under the READY+ project, I have worked directly with young people living with HIV, helping them with disclosure, adherence, and emotional support. I’ve also founded SoulLight Film’s and run the “Voices for Change” podcast, using media and storytelling to educate and empower youth.\n\nI believe in leading by example, and I’ve proven that I can connect with young people, inspire them, and help them find light even in dark situations. I am ready to give my full commitment, energy, and skills to this role.\n', 'Yes', 'Nazarene Compassionate Ministries ', 'RI have worked as a peer supporter under the READY+ project at Nazarene Compassionate Ministries, where I supported young people living with HIV. My role involved providing psychosocial support, organizing youth-friendly sessions, and helping them understand their medication, disclosure, and rights. I also encouraged treatment adherence and positive living.\n\nIn addition, I founded SoulLight Film’s, a platform that uses storytelling, film, and podcasting to bring light to deep issues faced by young people—especially topics often ignored, such as mental health, HIV stigma, abuse, and poverty. Through my podcast, “Voices for Change,” I give young people a voice, share educational content, and promote hope and resilience.\n\nBy sharing my own story of being born HIV positive and overcoming abuse and stigma, I inspire others to speak up, take control of their health, and never give up on their dreams.', 'Yes', NULL, '2025-07-15 15:35:52', '2025-07-15 15:35:52'),
(80, 533, '[\"documents\\/01K06XZD8Y0P6864JRWJHHA338.pdf\"]', '[\"documents\\/01K06XZD91T6SSDM5DM2D9ZHYJ.pdf\"]', 'Unemployed', 'I applied for the role so as to help enlighten the young people in my area about the different opportunities provided to them by different stakeholders and to further help them through various application processes. Moreover I am passionate about the mental wellbeing being of the youth, especially the unemployed youth who are prone to mental health challenges due to the stress and pressure of being unemployed.', 'Yes', 'Umhluma women and youth foundation ', 'I worked as a social worker helping young people who were mostly orphans that were victimised by elder family members forcefully taking away their inheritance. We helped these young people to get what is rightfully theirs and further empowered them with life skills that would help them sustain life.', 'Yes', NULL, '2025-07-15 15:37:01', '2025-07-15 15:37:01'),
(81, 534, '[\"documents\\/01K06Y022A25X71FYR7TMHKK0Q.pdf\"]', '[\"documents\\/01K06Y022CFX0CG5NZKPFJMVNQ.pdf\"]', 'Unemployed', 'Since the young one look up to us I want to be an example to them. I want to ensure that my peers in my community know that there is life after high school. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 15:37:22', '2025-07-15 15:37:22'),
(82, 535, '[\"documents\\/01K06Y1D1DWN2YNM0MMV0MY0SS.pdf\",\"documents\\/01K06Y1D1ESJZDBG8FKEZZ0AXN.pdf\",\"documents\\/01K06Y1D1GAGPBKHZTMBE932VJ.pdf\"]', '[\"documents\\/01K06Y1D1HT12T3BAZB4JEP0GV.pdf\"]', 'Unemployed', 'I am driven and motivated young woman with an ambition to grow my skill sets and positively impact the lives of those around me. Though I might not yet have been directly involved in an organization focused on young people, I have tried to make an impact in the lives of the young people around me. I have seen how much we as young people need to change our mindsets and outlook on life into a more positive, productive and proactive one which is why I have been a part of the youth committee in my church since 2019. While there, I have facilitated many programs aimed at young people, including a sports day once a year, for churches and young people around Ngwane Park and in the Manzini area. Moreover, I have facilitated training sessions before, on cyber security, to REPS and other institutions, so I am a proficient speaker and trainer.', 'No', NULL, 'None', 'No', NULL, '2025-07-15 15:38:06', '2025-07-15 16:10:55'),
(83, 536, '[\"documents\\/01K06Y4BP625EV9NQ3E9T316NY.pdf\"]', '[\"documents\\/01K06Y4BPADWKM6Q6DA5KQFXJN.pdf\"]', 'Unemployed', 'I am currently navigating unemployment and using this period to strengthen my mental well-being and deepen my knowledge. I view this as an opportunity to grow, especially in areas aligned with my career interests—particularly social change initiatives. I am passionate about creating a positive impact in society and aspire to help my community develop and implement sustainable social change programs in the future.', 'Yes', 'Youth Sustainable Development Centre ', 'As an Ambassador, I lead advocacy efforts for youth economic empowerment through the organization’s initiatives. I utilize social media to amplify campaigns and engage the public, while also representing the organization at live events. My role involves interacting with diverse stakeholders to explore collaborative strategies for achieving sustainable development—particularly focused on youth inclusion and empowerment.\n\n\n\n\n', 'Yes', NULL, '2025-07-15 15:39:43', '2025-07-15 15:39:43'),
(84, 537, '[\"documents\\/01K06Y4DF8790DW7WHCSB6ATTN.jpg\"]', '[\"documents\\/01K06Y4DFKNY74XN6W9H94D9F9.pdf\"]', 'Unemployed', 'Since I am a youth, I believe in sharing knowledge and ways to overcome some obstacles one may encounter due to the fact that we all come from different background. I am fast learner, very discipline and I have the right combination of skills required. I am also respected and trusted in my community. Furthermore I bring the additional quality of strong analytical and problem solving ability and understanding of community structure and will be very much dedicated to training sessions.', 'No', 'No', 'None', 'Yes', NULL, '2025-07-15 15:39:45', '2025-07-15 15:39:45'),
(85, 538, '[\"documents\\/01K06Y5R868MECHYY0PKFFDX2K.pdf\"]', '[\"documents\\/01K06Y5R87S7Y26961XSB1S8SE.pdf\"]', 'Employed', 'I am passionate about driving mindset transformation and empowering others, especially in my community through knowledge, empathy, and leadership. My personal experiences, strong communication skills, and history of mentoring and volunteering make me confident that I can inspire positive change and create safe spaces for learning and growth. I aim to focus on key issues such as self-confidence, mental health, and gender equality, helping young people build resilience and take ownership of their future. I believe I am the best candidate because I bring a strong sense of purpose, a commitment to service, and a vision for long-lasting, community-led transformation. ', 'Yes', 'Kwakha Indvodza ', 'I am part of a team that trains young people on life skills, entrepreneurship skill equipping them with valuable skills to conquer the world. ', 'Yes', NULL, '2025-07-15 15:40:29', '2025-07-15 15:40:29'),
(86, 539, '[\"documents\\/01K06Y5V6V7AFF6MSKZK1TQ8VN.jpeg\",\"documents\\/01K06Y5V6WPJGH2DKF93QNDR18.pdf\"]', '[\"documents\\/01K06Y5V6ZV83S17CTTNDG305Q.pdf\"]', 'Unemployed', 'First, to gain more experience and knowledge whilst sharing my experiences with the organization that will help grow and see the youth prosperous. \nI carry with me leadership, communication and team player skill hence I see my self a good candidate for the job. ', 'Yes', 'Youth Sustainable Development Center ', 'I was a project director, where I initiated the project of collecting and recycling waste. The project aimed at improving my community in terms of waste management and raising consciousness about waste to the community. ', 'Yes', NULL, '2025-07-15 15:40:32', '2025-07-15 15:40:32'),
(87, 540, '[\"documents\\/01K06Y67C45Q3DFN8GPN2RXBB1.pdf\",\"documents\\/01K06Y67C6514CZ9VZM9CQQ6YY.pdf\"]', '[\"documents\\/01K06Y67C90CFDWRNYA7RF6PEV.pdf\"]', 'Unemployed', 'As a dedicated social worker with a passion for empowering young people, I am confident that I am the best candidate for the peer educator position. My professional experience has equipped me with the skills and knowledge to effectively engage with youth, understand their struggles, and provide guidance and support.\n\nGrowing up in this community, I have witnessed firsthand the challenges that our youth face. I understand the complexities of their lives, the pressures they encounter, and the resilience they possess. This insight allows me to connect with them on a deeper level, build trust, and create a safe space for open dialogue.\n\nMy experience working with youth has been invaluable. I have had the privilege of working with young people from diverse backgrounds, each with their unique stories and struggles. Through my work, I have developed a keen understanding of the issues that affect them, from mental health and relationships to education and career aspirations.\n\nAs a social worker, I have honed my skills in active listening, empathy, and conflict resolution. I know how to create a supportive environment where young people feel comfortable sharing their concerns and aspirations. My professional training has also taught me how to design and implement programs that cater to the specific needs of our youth.\n\nWhat sets me apart from other candidates is my ability to relate to the youth in a way that is both authentic and professional. I am not just a social worker; I am a member of this community, and I understand the nuances of our culture and the challenges that come with it. I am committed to using my skills and experience to empower our youth, help them navigate the complexities of life, and support them in achieving their goals.\n', 'Yes', 'Selulasandla Children Village ', 'At the Village we conducted assessments for children and families to identify needs and develop individualized service plans to ensure that each child received the appropriate care and support. Secondly we assisted in maintaining case documentation and reporting to ensure compliance with state and federal regulations.\nWe were also able Collaborate with multidisciplinary teams including educators and healthcare providers from Linamandla to ensure that our children are healthy and safe.\nLastly we participated in regular supervision and training sessions to enhance professional development and also engaged in crisis intervention strategies to address immediate needs and ensure child safety.', 'Yes', NULL, '2025-07-15 15:40:44', '2025-07-15 15:40:44'),
(88, 541, '[\"documents\\/01K06YA0N27NQNSMWBSJH393J8.jpg\"]', '[\"documents\\/01K06YA0NACSNT5XGJAMQJVQ2E.jpg\"]', 'Unemployed', 'I am the best candidate because I am able to work well with people. I have worked with the youth before at the INgwenyama Cup where we were serving food to the VIP and the Royal Box.I gained experience on how to work with people. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 15:42:49', '2025-07-15 15:42:49'),
(89, 542, '[\"documents\\/01K06YBGH80V1AG06X0SREAQWR.pdf\",\"documents\\/01K06YBGHCJD67PZ76GT7VYQWH.pdf\"]', '[\"documents\\/01K06YBGHF8FBS29M35J392SY0.pdf\",\"documents\\/01K06YBGHHCW0BT69W4T88YG1K.jpg\"]', 'Unemployed', 'I simply applied because I\'ve noticed that the youth in country has great potential to do better and be better but unfortunately most lack basic knowledge. I just wish to be offered a chance to share my knowledge with other young people mainly on key areas such as innovation and entrepreneurship, gender equality, climate change, drugs and substance abuse, artificial intelligence and technology, sustainable development , agri-business and food security. But mostly important to be part of a young vibrant network that sees opportunities in various situations. In the midst of high unemployment rates, Young people need to be empowered and equipped to find balance in academics, skills and talents, and even entrepreneurship.', 'Yes', 'Eco-harmony Eswatini ', 'I\'m a new member of this Youth-led Environmental organisation that teaches youth on sustainable development and environmental stewardship thus making a meaningful impact on Eswatini’s environment and beyond.', 'Yes', NULL, '2025-07-15 15:43:38', '2025-07-15 15:43:38'),
(90, 543, '[\"documents\\/01K06YD17M4J1QCM866VQ1X7XC.pdf\"]', '[\"documents\\/01K06YD17P193TQHEMMT3G4R30.pdf\"]', 'Unemployed', 'The reason i have applied for this job is because,growing up, I have always loved teaching.I have always seen myself being upfront  helping, motivating, leading , uplifting and encouraging youngsters.I  love speaking and opening up ,mostly with young people.I have also applied because everytime i get to work with youngsters or teens, I become the older sister they need.I am able to open up and guide them.I am the best candidate for this job because I am sociable, leader and I work well with people.', 'Yes', 'Inspirational Biblical Approcah organization', 'I was a Social worker volunteer  at the IBA organization mostly focused on young people.What the organisation required was for me to reach out to the young people in  different schools by helping them discover their hidden talents( singing dancing cooking and other skills.I would equip and mentor them during sessions on how they can carry out all they want when it comes to skills, talents and life.', 'Yes', NULL, '2025-07-15 15:44:27', '2025-07-15 15:44:27'),
(91, 544, '[\"documents\\/01K06YDRM72J3Y4HS8KF81DQWW.pdf\"]', '[\"documents\\/01K06YDRM94SVZJXKS8V5431WH.pdf\"]', 'Unemployed', 'I applied as a peer educator because I\'m passionate about empowering my peers with knowledge and skills to make informed decisions. I believe that peer education can be a powerful tool for positive change, and I\'m excited about the opportunity to be part of it. I think I\'m a suitable candidate because I\'m a good communicator, a team player, and I\'m approachable. I\'m also passionate about the cause and willing to learn and grow. I\'m confident that my skills and experience make me a strong fit for this role, and I\'m excited to contribute to the team', 'Yes', 'Girls  Empowerment Club.(SWAGGA)', ' I was able to make a positive impact on the lives of young people and help them navigate challenges and achieve their goals.', 'Yes', NULL, '2025-07-15 15:44:51', '2025-07-15 15:44:51'),
(92, 545, '[\"documents\\/01K06YEYMJH1ND5KKVF49JDNX7.pdf\"]', '[\"documents\\/01K06YEYMM5H5JV2SMZ73PF03K.pdf\"]', 'Self-Employed', 'During my role as Youth Mentor,  I saw first hand what the mindset change program by ENYC can impact the youth. I believe that with the connection I have with the youth in Mankayane and my network with organizations including Mankayane Town Board and others outside town, I am in a good position to scale this impact to not just the youth in town, but also nearby communities. ', 'Yes', 'I\'ve worked as a Youth Mentor at Mankayane Town Board ', 'I supported entrepreneurship and SRHR initiatives for the youth in Mankayane through strategies including youth forums, community discussions, entrepreneurship trainings, etc. I also worked with the Board to ensure that the youth is well served and represented in decision-making and service delivery. ', 'No', NULL, '2025-07-15 15:45:30', '2025-07-15 15:45:30'),
(93, 546, '[\"documents\\/01K06YGSA30MJF7HG8PBYEXGZE.pdf\"]', '[\"documents\\/01K06YGSA6WJBVMAB404WESY0F.pdf\"]', 'Self-Employed', 'I have applied because the job aligns with my interests and experience. Having worked with young people, I learnt a lot from them, for example new trends that we are not familiar with. I enjoyed helping them by giving advice and solutions to their problems. So basically, we ( I and the adolescents) benefited from each other.', 'Yes', 'Young Heroes ', 'Program planning and delivery \nMentorship and support \nCollaboration and administration ', 'Yes', NULL, '2025-07-15 15:46:30', '2025-07-15 15:46:30'),
(94, 547, '[\"documents\\/01K06YGYQMNH9JV3ABT0EN7393.pdf\"]', '[\"documents\\/01K06YGYQPS690DPSXRY141VXC.pdf\"]', 'Unemployed', '\nI have applied for the Youth Mindset Change Trainer Programme because I am passionate about empowering young people and believe that mindset is the foundation of transformation. My background in psychology, along with my volunteer work in community development and youth outreach, has equipped me with the skills to connect with and guide others effectively. I have experience working with diverse groups and am committed to growth, learning, and being a reliable role model in my community. I believe I am the best candidate because I bring not only knowledge, but dedication, empathy, and a vision for lasting impact.', 'Yes', 'Taiwan & the Family Life Association Youth Action Movement ', 'Volunteered and facilitated Afterschool classes with high school students with Taiwan Fund. Did Early Childhood Development screening with Taiwan and part of YAM\'s health talks and condom distribution activities.', 'Yes', NULL, '2025-07-15 15:46:36', '2025-07-15 15:46:36'),
