(97, 550, '[\"documents\\/01K06YXH5T1Q8CERS424P82K32.jpg\"]', '[\"documents\\/01K06YXH5V3XPSMSAG4BXTZ0GN.pdf\"]', 'Self-Employed', 'I possess the right combination of skills and experience for the job and I can perform a wide range of duties that can benefit the youth in the long run. I also bring an additional quality of strong analytical and problem solving ability. Knowing the daily activities of the youth other my constituency puts me in better position to work with them effectively. ', 'Yes', 'Eswatini Multi-Purpose Cooperative Union ', 'Presentation on forms of business. \nBusiness registration. \nCompliance to the laws governing businesses in Eswatini.\nRecord keeping.\nBusiness planning.\n', 'Yes', NULL, '2025-07-15 15:53:28', '2025-07-15 15:53:28'),
(98, 551, '[\"documents\\/01K06YYNYTHZ3KJ9VGWCERC83G.pdf\"]', '[\"documents\\/01K06YYNZ1MCQZWRZ9ZQ1NC85J.pdf\"]', 'Unemployed', 'I came to Eswatini from Ethiopia in 2020 and recently completed my IT studies at the University of Eswatini. I enjoy coding, teaching others, and building real-world apps. I’ve developed a Smart Crop Management System, a video streaming platform, and other tools that solve everyday problems. I’m passionate about helping others grow and believe I can make a positive impact as a Peer Educator.', 'No', 'None', 'None', 'No', NULL, '2025-07-15 15:54:06', '2025-07-15 15:54:06'),
(99, 552, '[\"documents\\/01K06Z46W9V94DXGNX0YMP9TYM.pdf\"]', '[\"documents\\/01K06Z46WAVPND9QFATN5VGE7J.pdf\"]', 'Unemployed', 'I\'m motivated by my passion for helping others. I believe that knowledge is a powerful tool and sharing it with peers can make a difference in their learning journey. Furthermore, having been through similar experiences, I understand the challenges students face and can provide empathetic support. So this role aligns perfectly with my desire to contribute positively to my community while enhancing my own personal growth. ', 'Yes', 'Swaziland Action Group Against Abuse ', 'I was mentoring primary school going children. Basically, I was teaching them on how to take care of themselves, abuse and how to choose friends. ', 'Yes', NULL, '2025-07-15 15:57:07', '2025-07-15 15:57:07'),
(100, 553, '[\"documents\\/01K06Z8FRZ63PAWMYZG8RKS3B2.pdf\"]', '[\"documents\\/01K06Z8FS1K1QWFWA1X4SSBSTE.pdf\"]', 'Unemployed', 'Dear Hiring Manager \nI believe I am an excellent candidate for the Peer Educator position due to my extensive experience and skills developed during my time as a Sales Agent at Standard Bank Unayo. This role has equipped me with the ability to effectively communicate with individuals from diverse age groups and backgrounds, allowing me to connect with people on a personal level. \n\nMy experience has honed my interpersonal skills, enabling me to listen actively and respond empathetically to the needs of others. I have learned how to convey complex information in an accessible manner, which is essential for educating and inspiring community members. Additionally, my background in sales has instilled in me a strong sense of motivation and resilience, qualities that are vital for leading mindset transformation initiatives.\n\nI am passionate about empowering others and fostering positive change within my community. I am eager to leverage my skills and experiences to make a meaningful impact as a Peer Educator.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 15:59:27', '2025-07-15 15:59:27'),
(101, 554, '[\"documents\\/01K06Z93BTQY0PZZY7Y68YKD4C.pdf\"]', '[\"documents\\/01K06Z93BW1D5AVKBV1JA36G4C.pdf\"]', 'Unemployed', 'I have applied for this job because i wish to be given an opportunity to work with young people like myself,so to be able to change the world.As the saying goes\"young people are the future generation\" so if young people are trained to have a positive mindset,that means the future is in good hands.Moreover, i believe i am the best candidate for the job because,personally,ever since i completed my high education,i have faced so many challenges regarding employement,way of living ,etc as i had little knowlegde on how to tackle such challenges.So ,given this apportunity would allow me to share my challenges with the youth , as well as open my mind to learn more from others.This will give me an opportunity to gain more skills that i can use in the future and so will the others.Because not only will i be engaging with the community ,but i will be also learning as well.', 'No', 'N/A', 'None', 'Yes', NULL, '2025-07-15 15:59:47', '2025-07-15 15:59:47'),
(102, 555, '[\"documents\\/01K06Z9H7Y3J21GZ4X12AH3Z51.pdf\"]', '[\"documents\\/01K06Z9H81B6HRWDZX9CKA946B.pdf\"]', 'Employed', 'I am applying for this because I am good in working with people especially the youth group,as am corncen with the future of them which is vanishing as some don\'t get the basic needs due to some reason. \nFurthermore being given this opportunity will enable me showcase my talent of working with young people and making sure that I guide them towards achieving their goals and making them better leaders of the country.', 'No', 'N/A', 'I would help youth by providing them with some community services like embarking agriculture projects because lot of youth they struggle to have some meals ,so this project will long run towards the youth.Also I will provide some sports services to keep busy and away from bad habbits mention the few', 'No', NULL, '2025-07-15 16:00:01', '2025-07-15 16:00:01');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(103, 556, '[\"documents\\/01K06Z9JK2HFECZ3BCS1Q1ADP6.jpg\"]', '[\"documents\\/01K06Z9JK6BQGZBAQ2J2ADPSE1.jpg\",\"documents\\/01K06Z9JKEM0Z6N4AS8A2Y5BFK.jpg\"]', 'Unemployed', 'I am the best candidate for the job because I am passionate about young people, I love helping them where I can. Also looking at the career I have chosen I volunteered as teacher to help students do well academically and showing them the importance of education how it will better their lives. The willingness and passion to help I think singles me out as an ideal candidate ', 'Yes', 'The Gentlemen\'s talk', 'I worked as an assistant assisting young boys in various schools across the country. Assist by sharing insight to young boys in schools by sharing information on the importance of taking care of themselves from dangers of alcohol and drug abuse, the import of living a christ centered life which will in turn help them become a good citizen. I helped them by providing the proper information, providing them with the essential basic needs like clothes and food.', 'Yes', NULL, '2025-07-15 16:00:03', '2025-07-15 16:00:03'),
(104, 557, '[\"documents\\/01K06ZC0TT7SGRP217TD8P5XAY.jpg\"]', '[\"documents\\/01K06ZC0TYCR5NXAJ5Q90CSHR5.png\"]', 'Unemployed', 'I have applied for the Peer Educator position because I\'m deeply passionate about youth health, academic success, community wellbeing and mental health awareness. Also I believe I\'m best candidate for the Peer Educator position because I have experience in leading discussions a project team and giving presentations in class.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 16:01:23', '2025-07-15 16:01:23'),
(105, 558, '[\"documents\\/01K06ZZ2AK2B3FTDFPQ0ZF2SWC.pdf\"]', '[\"documents\\/01K06ZZ2ANJAZ93T53VCE1TF72.pdf\"]', 'Self-Employed', 'I have applied because I am passionate about youth empowerment and mindset transformation. As a former student teacher in Economics and Accounting, I developed strong facilitation and mentoring skills. I previously worked as a mobile money agent, helping people manage their finances, and I currently run a small lending business where I continue to support others in making informed financial decisions. These experiences have shaped me into a responsible, community-minded individual who understands youth challenges and is committed to creating positive change.', 'Yes', 'World Vision ', 'At World Vision, I was involved in youth group activities where I helped lead prayers, inspired and encouraged fellow young people, and supported the coordination of positive gatherings. This role allowed me to build confidence, uplift others spiritually and emotionally, and contribute to creating a supportive and motivated youth environment.', 'No', NULL, '2025-07-15 16:05:05', '2025-07-15 16:11:47'),
(106, 559, '[\"documents\\/01K06ZM9EBPWQ7GNB38CCFJ5T7.jpg\"]', '[\"documents\\/01K06ZM9EFD96RS6WASD05EXTR.jpg\"]', 'Unemployed', 'As I\'m also a young person, I\'m  best for this job so I can influence them myself based on my behaviour and my background. I believe in my self and I influence others with my behaviour and my ability to stand for what I believe in.\nI believe that the world would be different if young people can strongly believe in themselves and trust in what they believe in, by putting hardwork and resilience first.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 16:05:54', '2025-07-15 16:07:32'),
(107, 560, '[\"documents\\/01K06ZTEFFVBGDZ370FJX99HQS.jpg\"]', '[\"documents\\/01K06ZTEFKQZF2H7QJ38Z5B6Y5.jpg\"]', 'Unemployed', 'I am currently waiting for my graduation at the Institute of Development Management where I was doing a diploma in information technology. I am good in problem solving, time management, team player and good communication skills. I am a motivated person and willing to learn. I am respectful and cooperative to others. Confidence in interacting with different people. I can also listen and follow instructions.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 16:09:16', '2025-07-15 16:09:16'),
(108, 561, '[\"documents\\/01K06ZTYF4N9TWFHY8TW9MC4NC.jpg\"]', '[\"documents\\/01K06ZTYF8B3SA7EZ00ZM70KAW.pdf\"]', 'Unemployed', 'I have applied because I enjoy to work with the young people and also helping them to shape their future the right way. On top of that, I really love to see other people achieve better in life and knowingly that I played a role that\'s give me the strength to continue. On the other note, I am the best candidate because I have experience on being a Peer Educator and also that I am one person who is dedicated.', 'Yes', 'SOS Children\'s Village Eswatini ', 'I was a Peer Educator at SOS Children\'s Village based at Mbilaneni umphakatsi. I worked with young people on SRH related issues whereby we use to have dialogues, debates and also we did invite prossional nurses to present on the topics. In addition, we also talked about life related issues that affect the youth such as drug abuse, peer pressure and dating. ', 'Yes', NULL, '2025-07-15 16:09:32', '2025-07-15 16:09:32'),
(109, 562, '[\"documents\\/01K06ZVSK9NACCS195YPV4P2A1.pdf\",\"documents\\/01K06ZVSKDGVTHK9RH488HWG0X.pdf\"]', '[\"documents\\/01K06ZVSKHCDT992NJ4BZ4C0W3.pdf\"]', 'Unemployed', 'I have applied because I am passionate about helping young people more especially my peers that is what made me be part of the Peer Counselor and Educators Club at varsity.\n\nMy four years of volunteer experience as a mentor and \rpeer counselor at the University of Eswatini have equipped me with effective \rcommunication and leadership skills. I have dealt with yough people with different personalities, mindsets and from different backgrounds.This experience has reinforced my commitment to fostering inclusive learning environments.\nAbove all it could be an honor to be part of this great initiative as our greatest assets are the future leaders who are the youth. ', 'Yes', 'Sivusative Nengcebo Organization', 'I facilitated business sessions where I taught the teen moms basic entrepreneurship. I also taught sexual health and contraceptive methods in one of the sessions. I helped the young people by that I gave them ideas on having small businesses even if it is selling packet of chips or a small market by the road. Also they gained knowledge in business plans, budgeting, financing and also that there are organizations that help with startup capitals. Advocated taking care of themselves, and that abstaining is a better measure of protecting themselves from HIV, STIs and unwanted pregnancy and that if ever they find themselves engaging in sexual practices use protection. ', 'Yes', NULL, '2025-07-15 16:10:00', '2025-07-15 16:10:00'),
(110, 563, '[\"documents\\/01K06ZZATREBF99HG33YY14JBJ.pdf\",\"documents\\/01K06ZZAV9FRTYKHA28SWHPA0N.pdf\"]', '[\"documents\\/01K06ZZAVTH51TGN68H6KYSPEV.pdf\"]', 'Self-Employed', 'I have applied because I am passionate about youth development and eager to contribute to initiatives that empower young people in my community. My strong communication skills, dedication to teamwork, have prepared me to effectively serve and engage others. I am reliable, hardworking, and committed to learning and growing through this opportunity. I believe I can make a meaningful impact and represent my Inkhundla with pride and responsibility', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 16:11:56', '2025-07-15 16:11:56'),
(111, 564, '[\"documents\\/01K06ZZCVBG54QC0B4J5K8QGN3.pdf\"]', '[\"documents\\/01K06ZZCVEYG1CXQ4MP2G4S1E9.pdf\"]', 'Unemployed', 'I am deeply motivated to join ENYC as a trainee in the Training of Trainers program because I believe that sustainable empowerment begins when young people are equipped to lead and teach one another. In my role as Programs Officer and Trainer at Women in Trade and Development, I developed and delivered a comprehensive curriculum for programmes targeting young women focusing on entrepreneurship, financial literacy, leadership, and market linkages. I guided participants through business plan development, coached them in accessing local markets and mentorship networks, and helped launch/expand their businesses. To monitor impact, I implemented rigorous pre- and post-assessments, tracked business growth metrics, and tailored training based on those results an analytical, results-driven methodology that parallels ENYC’s own evaluative approach, as demonstrated in programs like the Insika Yelikusasa Lensha Eswatini empowerment project and its inclusion of mindset change, TVET training, and grant accelerators aimed at reducing youth vulnerability.\n\nMy leadership in program management and strong digital coordination skills will allow me to seamlessly align with ENYC’s systems and initiatives. I have experience utilizing digital tools for real-time monitoring and stakeholder engagement, which would translate seamlessly to ENYC’s programs designed to strengthen youth business capacities, psychosocial well-being, and vocational readiness.  Having grown up and currently residing in my Inkhundla, I possess nuanced insight into the specific challenges facing youth here especially concerning unemployment, teenage pregnancies, and limited entrepreneurial avenues. By blending grassroots understanding with structured training design, mentorship abilities, and evaluative rigor, I can help ENYC multiply its impact by preparing cohorts who not only learn but become trainers themselves, replicating sustainable development within their communities. I am fully available and committed, driven by ENYC’s mandate to coordinate youth activities, advocate through policy engagement, and promote socio-economic growth through youth-led innovation and leadership .', 'Yes', 'Women in Trade and Development ', 'As a Programs Officer and Trainer at Women in Trade and Development, I designed and facilitated training sessions for young women (17 –35), covering business planning, financial literacy, and leadership development. I coached participants through business plan creation, market engagement, and access to finance, which led to the launch of over ten participant-run micro-enterprises. My mentorship empowered participants to build confidence, economic resilience, and leadership skills.', 'Yes', NULL, '2025-07-15 16:11:58', '2025-07-15 16:11:58'),
(112, 565, '[\"documents\\/01K06ZZDY6HXSETPGE7DF195K8.JPG\"]', '[\"documents\\/01K06ZZDYE2DB2B910Z83FDCJ0.pdf\"]', 'Unemployed', 'I think I can be the best candidate for this role because I am a trusted and respected person in my community, I believe I can make a positive impact since I am confident, a quick learner and also a team player. I am eager to contribute my skills and experiences to drive success and grow with the organisation. I am also looking forward to learn more about this organisation.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 16:11:59', '2025-07-15 16:11:59'),
(113, 566, '[\"documents\\/01K06ZZPJZ6PBZB2WD2G9FMGVA.pdf\"]', '[\"documents\\/01K06ZZPK1HS7RBV6WM3PF1X4J.pdf\"]', 'Unemployed', 'I am applying for this role because I am deeply passionate about mentoring and supporting youth. Currently pursuing my Bachelor of Education (Secondary) in Business Education, I am eager to apply my knowledge and skills. While financial constraints have limited my opportunities, this position allows me to contribute meaningfully while gaining hands-on experience in youth development. I have a foundation on teaching strategies, communication skills and understanding of youth psychology. I thrive in connecting with youth, listening to their perspectives, and encouraging their growth. My patience, adaptability, and enthusiasm make me a strong fit for this role. Though I have not yet graduated, my dedication to education and youth empowerment drives me to learn quickly and make a positive impact on the youth. ', 'No', NULL, 'I once helped my mother at a local carepoint while she was still alive, we would cook for them and sometimes give out some bible lessons. I was also assisting some students at Lubuli High School with Accounting.', 'Yes', NULL, '2025-07-15 16:12:08', '2025-07-15 16:12:08'),
(114, 567, '[\"documents\\/01K0727YHJ0S2RFW168ZWJNEF3.pdf\",\"documents\\/01K0727YHNZ2GTN1V65YVEXATX.pdf\"]', '[\"documents\\/01K0727YHQZ23S4RD1WYVQ6PK2.pdf\",\"documents\\/01K0727YHRQNN0C5VK627939E3.pdf\",\"documents\\/01K0727YHZ8RT19WB4J6QT7GCZ.pdf\"]', 'Unemployed', 'I have applied because I am passionate about advocating for adolescent girls and young women on issues like sexual and reproductive health, HIV prevention, and gender-based violence, and I believe peer education is a powerful tool for change. Through my roles as a Her Voice Ambassador, DREAMS Representative, and Youth Advisory Committee Member, I have led awareness sessions, engaged youth on their challenges, and referred them to essential services, while also representing their voices in stakeholder meetings. My background in both advocacy and technology like supporting healthcare data systems at the Ministry of Health equips me with strong communication, problem-solving, and leadership skills. These experiences make me a well-prepared and committed candidate to lead mindset transformation and support my peers in making informed, healthy decisions.', 'Yes', 'AMIAALL and FHI360 ', 'As a Her Voice Fund Ambassador and DREAMS Representative with AMICAALL, I organized and facilitated sessions for adolescent girls and young women (AGYW) on HIV prevention methods such as PrEP, gender-based violence (GBV), and sexual and reproductive health (SRH). I supported young people by creating safe spaces where they could openly share challenges related to teenage pregnancy, unplanned pregnancies, and GBV, and referred those in need to mobile clinics and service providers for access to HIV prevention methods, SRH services, and psychosocial support. In addition to community sessions, I participated in stakeholder meetings, represented youth perspectives through the FHI360 Youth Advisory Committee, conducted parenting sessions with caregivers.', 'Yes', NULL, '2025-07-15 16:15:53', '2025-07-15 16:51:35'),
(115, 568, '[\"documents\\/01K0709PJEDQJ7206SFXK35XN1.jpg\"]', '[\"documents\\/01K0709PJN43DECFFWZHZW6VR4.jpg\"]', 'Unemployed', 'I apply for the job because am the best candidate with the best skill to communicate with young people.\nI am a hard work and work well with other people,I have good teamwork skills.Am also reliable and prioritize my work .\nI will add value with my experience and training that i had with Young Heroes and other \n skills I gained from the previous company I worked with.\n\nIt will be my honour to joining your organisation.\n\n\n', 'Yes', 'Young Heroes ', 'N/A', 'Yes', NULL, '2025-07-15 16:17:35', '2025-07-15 16:17:35'),
(116, 569, '[\"documents\\/01K070B0KF2X1SFWZYX2BD2JB7.jpg\"]', '[\"documents\\/01K070B0KHP82G95ZZXSYPVKZZ.pdf\"]', 'Unemployed', 'I have applied for this position because I think I have what it takes to engage with the youth. This comes with the experience I have of doing this job. I have seen how impactful I have been towards changing for the better the livelihoods of the AGYW I have engaged with.Also, the fact that I can easily relate to much of the things the youth experience nowadays makes it easy for me and them to engage.', 'Yes', 'World Vision Eswatini ', 'I was a home visitor under World Vision Eswatini organisation based in Mtfongwaneni constituency. Here, my duties that impacyed the youth included- having one on one sessions with an adolescent girl or young woman (AGYW) on HIV Prevention where they get to open up on issues that are related to the aforementioned, providing the necessary preventative measures PrEP and condoms, engage with AGYW in group settings for youth empowerment, helped youth get referrals for youth friendly health services in partner health centres and empower youth to start businesses to become independent.', 'Yes', NULL, '2025-07-15 16:18:18', '2025-07-15 16:18:18'),
(117, 570, '[\"documents\\/01K070BJV4A95K848B4C7BFXCW.PDF\"]', '[\"documents\\/01K070BJV7F67TD5805N3EJT5A.pdf\"]', 'Unemployed', 'Is a grow up I always wanted to help and develop the community working with youth. So I would be happy to work for the community', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 16:18:37', '2025-07-15 16:18:37'),
(118, 571, '[\"documents\\/01K070E0KY4YJSZ9MRARSSZ9J3.jpeg\"]', '[\"documents\\/01K070E0M1QJH7DBN3DR10HTG8.pdf\"]', 'Unemployed', 'My name is Temabhele Gwebu, a passionate and driven young woman from Eswatini who believes deeply in the power of mindset change and youth empowerment. I am applying for the Youth Mindset Change Trainer Program because I want to be part of a generation that uplifts, inspires, and transforms young lives, especially in communities where hope often feels distant. I believe that this programme is not just about training, but about healing, building, and shifting the way we see ourselves and our future. And that is a mission I hold close to my heart.\n\nHaving completed my Form 5 and obtained a diploma in Health and Safety, I understand the importance of structure, responsibility, and personal discipline. While I may not hold formal experience in a community development role, my real-life experiences, including overcoming long periods of unemployment, battling self-doubt, and learning resilience  have shaped me into someone who can truly relate to the young people this program hopes to reach. I’ve learned that our greatest strength often comes from our greatest struggle, and it is that very experience that gives me a voice of connection, empathy, and leadership.\n\nI am a natural communicator, a deep listener, and someone who values meaningful conversations. Through informal peer support, church involvement, and personal reflection, I have developed a strong sense of emotional intelligence and the ability to hold space for others. Many of my peers turn to me for encouragement and advice, and I’ve seen the difference that one kind word or perspective shift can make in someone’s life. I believe that mindset change is not about forcing ideas, it’s about helping others see the power within themselves. And that is exactly what I hope to do as a trainer.\n\nThis opportunity speaks to me because I know what it feels like to be young and lost, to scroll through social media and compare yourself to others, to question your worth, to wonder when your breakthrough will come. But even in those difficult moments, I’ve held onto a quiet belief that I was made for more that one day, my story would help someone else feel seen. That belief is why I’m applying now. I want to be equipped with the tools and training to channel my passion into impact.\n\nI am also very familiar with the importance of community structures and respecting the voices of local leaders and elders. I come from a family and culture where values, humility, and respect guide our actions. If given the chance, I will carry out my duties with professionalism, maturity, and deep cultural sensitivity. I am willing to commit fully to the entire training process and any volunteer responsibilities that follow because I do not take this opportunity lightly.\n\nWhat I bring to the table is not just a willingness to serve, but the ability to connect authentically. I don’t come with a perfect background, but I come with an open heart, a teachable spirit, and a burning desire to make a difference. I believe that young people relate to those who have walked through their same fears and frustrations, and I am one of them. I am not coming to change others from the outside; I want to walk with them, learn with them, and grow with them.\n\nI also bring creativity and digital awareness to the role. In this generation, youth are engaging on platforms like Instagram, TikTok, and Facebook. I understand how digital tools can be used to spread positive messages, host mindset campaigns, and connect with even the most unreachable young people. My interest in social media and content creation can support this programme’s outreach goals and inspire engagement in a language young people understand.\n\nTo me, being a Youth Mindset Change Trainer is not just a title, it’s a purpose. It’s about stepping into spaces where young people feel invisible and showing them that they matter. It’s about challenging limiting beliefs, introducing new perspectives, and lighting a spark that could change a life forever. If selected, I promise to carry this responsibility with integrity, passion, and excellence.\n\nThank you for considering me. I am ready to learn, ready to grow, and ready to give back.\n', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 16:19:57', '2025-07-15 16:19:57'),
(119, 572, '[\"documents\\/01K070KTNJM1XTE05KZHVW7E6R.jpg\",\"documents\\/01K070KTNT8PWSVHFZ4BT15XGV.jpg\",\"documents\\/01K070KTP3HRC2CA4D2QN34H9P.jpg\"]', '[\"documents\\/01K070KTPBZE18AGET7MA1D12Z.jpg\"]', 'Unemployed', 'Firstly I am also a youth and I have experience in working with youth related programs.\nI am capable of dealing with every youth related problems such as teenage pregnancy and peerpressure. ', 'Yes', 'PSI', '1. I was teaching young people about how to overcome teenage stage.\n2. Teaching young girls about teenage pregnancy and it\'s disadvantages. \n3. Teaching teenagers about drug abuse.', 'Yes', NULL, '2025-07-15 16:23:07', '2025-07-15 16:23:07'),
(120, 573, '[\"documents\\/01K070MH8T3JSTAC8RCST8V94M.pdf\",\"documents\\/01K070MH8XJQAAV7JFPH6WQMME.pdf\"]', '[\"documents\\/01K070MH8ZT7NT848T9QFJMZED.pdf\"]', 'Unemployed', 'I want to help young people become better members of society. As the current CEO of Thuluzobona Sport Club in Mhlangatane Inkhundla, I am working to help youth gain important skills for their futures. I believe that by mentoring and supporting them, I can make a positive difference in their lives. I am committed to creating a space where young people can grow and succeed.', 'Yes', 'Thuluzobona Football Club', 'I am passionate about transforming the youth into active contributors to a better society. As the current CEO of Thuluzobona Sport Club under Mhlangatane Inkhundla, I am actively helping young individuals secure valuable skills for their future. My commitment to mentoring and empowering youth drives me to create positive change in their lives. With my background in community engagement and leadership, I believe I can inspire others to take initiative and work towards a brighter future. I am dedicated to fostering an environment where youth can thrive and develop their potential.', 'Yes', NULL, '2025-07-15 16:23:30', '2025-07-15 16:23:30'),
(121, 574, '[\"documents\\/01K070TDNTN7Q1QHD3NS52C2EQ.pdf\"]', '[\"documents\\/01K070TDNXDJYAXXXBPQFMWTWJ.pdf\"]', 'Unemployed', 'I am applying for the Youth Mindset Change Trainer Programme because I am passionate about empowering young people and making a positive impact in my community. As a former student of William Pitcher Training College, with two completed teaching practices, I have experience working with youth from diverse backgrounds and a strong ability to connect, communicate, and lead. I believe my training, understanding of community structures, and commitment to personal growth make me a suitable candidate for this programme.', 'No', 'None', 'None.', 'Yes', NULL, '2025-07-15 16:26:43', '2025-07-15 16:27:12'),
(122, 575, '[\"documents\\/01K07184BKPYVT8CVFPAQYVHJT.pdf\",\"documents\\/01K07184BPWV850DEQ1J844PA6.pdf\"]', '[\"documents\\/01K07184BQCYFJTJA8NG4S52S8.pdf\"]', 'Unemployed', 'I want to be part of something positive and productive whilst also gaining useful skills that will be beneficial to me as well. Importantly I just want to be productive. \nI am the best candidate because I am hardworking ,energetic, good communicator and will always respect my workplace. ', 'No', 'None', 'None', 'No', NULL, '2025-07-15 16:34:12', '2025-07-15 16:34:12'),
(123, 576, '[\"documents\\/01K071AHDQQMGFEX6KGNS7J9B2.pdf\",\"documents\\/01K071AHE3MKTXF8MTENCA16AA.pdf\"]', '[\"documents\\/01K071AHEBS656SCBW1TR41YC0.pdf\"]', 'Unemployed', 'I have applied for this position to gain more experience. I believe I am the best candidate because I have worked with young people as a Social Welfare intern, hence I have experience on this  position. ', 'No', NULL, 'I was once a career guidance educator intern, where I would educate or advice students to make best career options. I also educated them on social issues and how to tackle them.', 'Yes', NULL, '2025-07-15 16:35:31', '2025-07-15 16:35:31'),
(124, 577, '[\"documents\\/01K071B5VGVKAFW6BTKWTVP0YG.pdf\"]', '[\"documents\\/01K071B5VK49YKDZZ5K02ZBK8A.pdf\"]', 'Unemployed', 'I have applied for this position because I am passionate about delivering excellent customer service and contributing to a positive shopping experience. I am drawn to your company’s reputation for professionalism and quality, and I am eager to be part of a dynamic team that values growth and efficiency.\n\nI believe I am the best candidate for the job because I bring a strong work ethic, reliability, and a positive attitude. I have previous experience in customer-facing roles, where I learned how to communicate clearly, handle pressure, and assist customers in a friendly and professional manner. I am also a fast learner, punctual, and always ready to go the extra mile to ensure the team’s success. My ability to adapt, combined with my commitment to providing excellent service, makes me confident that I can add value to your store from day one.\n\n', 'No', 'No', 'None', 'Yes', NULL, '2025-07-15 16:35:52', '2025-07-15 16:35:52'),
(125, 578, '[\"documents\\/01K071F7V493CJ1S885GFQPQGF.pdf\",\"documents\\/01K071F7V6W88SE2G8MJ33Z6FW.pdf\"]', '[\"documents\\/01K071F7V84PJ03BC6SSEH85HS.pdf\"]', 'Unemployed', 'I have applied for the Youth Mindset Change Trainer Programme because I am passionate about personal growth and believe that youth play a vital role in shaping better communities. Although I do not have prior experience in community programmes, I am eager to learn, committed to the training, and excited to begin making a difference. I am a good listener, dependable, and able to relate well with young people from different walks of life. This opportunity would be the perfect platform for me to grow and serve with purpose.', 'No', 'NONE', 'NONE', 'No', NULL, '2025-07-15 16:38:05', '2025-07-15 16:38:05'),
(126, 579, '[\"documents\\/01K071GCV6T7RTXAHHABKQV02E.jpg\"]', '[\"documents\\/01K071GCVGSRWRE3XC6QEV3NJ0.pdf\"]', 'Unemployed', 'I believe that I can be a great addition to your organisation as I bring a fresh perspective on most challenges faced by the youth hence the slow response to most Services offered to them like family planning and more. I believe that having a bit if experience in the field has armed me with knowledge in how to approach the youth to getting a better response from them in terms of drawing their attention and actually taking services offered to them.', 'Yes', 'Insika Yakusasa Pact project and Khulisa Umntfwana organisation USAID ', 'I helped in empowering young women and adolescents. I taught about PreP, GBV and registration of male voluntary medical circumcision services ', 'Yes', NULL, '2025-07-15 16:38:43', '2025-07-15 16:38:43'),
(127, 580, '[\"documents\\/01K071HWPMFB9Q6XZ01XSRACE6.pdf\"]', '[\"documents\\/01K071HWPRWDC3WDKEQBV2PBQ0.pdf\",\"documents\\/01K071XRY0RA03TXP6VZNXZBBY.pdf\"]', 'Unemployed', 'I am a young person who understands the challenges that us as young people face in our daily lives. I have been so fortunate to work with Junior Achievement Eswatini as well the Municipal Council of Mbabane in assisting young people who wishes to start their business by step by step guiding them in writing business plans. Moreover I was also privileged to join Global Youth Mobilisation as a youth penalty. My experience in working has widen my understanding for the needs of young people and the challenges we face.', 'Yes', 'Junior Achievement Eswatini ', 'I was assisting young people with writing of business plan also mentoring them.', 'Yes', NULL, '2025-07-15 16:39:32', '2025-07-15 16:46:02'),
(128, 581, '[\"documents\\/01K071M52CYB3K7QZ7J97BHPPB.pdf\",\"documents\\/01K071M52DAYDECFF504XAMPF1.pdf\",\"documents\\/01K071M52F4MWVNXPSYXVF5941.pdf\"]', '[\"documents\\/01K071M52H8NFCFEC2QNMDFA19.pdf\"]', 'Unemployed', 'Im passinate to see the future generation grow and become better people, in future my time working with UYSG taught me a lot  about the needs of many kids. The unemployment rate is high in our country so helping the youth about the mental healthy issues thats a bigger achievement for me and also encouraging them to start their businesses and work and assist each other. Ngoba simo lesibuhlungu kakhulu kungacashwa kwensha futsi loko kwenta insha bese seyingenelela etintfweni incumbi letibungoti ngoba kute labakwentako ngemphilo yabo, loko lokugcina kubanga lizinga lekukhulelisana eveni, kanye nebucala. Ngelwati lwami lengilutfole ngekuhamba imihlangano lebekwe tinhlangano letisita sive kutehlala kahle. Tinhlangano lokufaka ekhatsi UNDP COSpe, CANGO, EUROPEAN UNION  naletinye letiningi. Insha yakitsi ngitawuyitfutfukisa kulokuningi kute ikhona kuphila phindze itfutfuke ngekutimela ngaphandle ngekwenta kuganga.', 'Yes', 'United youth for sustainable globe Eswatini', 'I worked as an advocacy and communications to help the youth understand better about gender equality, GBV, and also i helped the youth in advocating for the mental health issues, and i was able to help many kids especially those who are unemployed just like me, to stay positive and never give up in life.', 'Yes', NULL, '2025-07-15 16:40:46', '2025-07-15 16:40:46'),
(129, 582, '[\"documents\\/01K071Q0RVXKRFGDS3H9M9KYP9.heic\"]', '[\"documents\\/01K071Q0S14536B536BH8W5HH3.jpg\"]', 'Unemployed', 'I have applied for this role because I am deeply passionate about empowering youth and driving mindset change to foster sustainable community development. My hands-on experience working with adolescents particularly adolescent girls and young women (AGYWs) and collaborating with community structures has equipped me with the insights and skills needed to contribute meaningfully to this program.  \n\nThroughout my work, I have advocated for youth empowerment, focusing on education, health, and socio-economic opportunities. For instance, while working on community projects, I engaged AGYWs in mentorship programs, addressing issues like gender inequality, HIV awareness, and financial literacy. This experience taught me how to design interventions that resonate with young people while navigating cultural and structural barriers. My ability to connect with youth, understand their challenges, and inspire change makes me a strong fit for this role.  \n\nAdditionally, my background in community mobilization has honed my ability to work with diverse stakeholders local leaders, NGOs, and government agencies to implement youth-focused initiatives. I tested a prototype in my community on a climate change and environment initiative  of a project that was international( IFRC Innovators)which won the Best Environmental community project. I understand how to leverage community structures to amplify impact, ensuring programs are inclusive and sustainable. For example, I coordinated a project that trained youth in vocational skills, partnering with local businesses to create job linkages. This not only shifted participants’ mindsets toward self-reliance but also strengthened community support systems.  \n\nWhat sets me apart is my combination of grassroots experience and a strategic approach. I don’t just implement programs; I listen to youth voices, adapt to their needs, and measure outcomes to ensure effectiveness. My advocacy work has also involved policy dialogue, where I highlighted youth issues to influence decision-making a skill critical for scaling mindset change initiatives.  \n\nFinally, my passion for youth development is personal. Having witnessed how transformative programs can break cycles of poverty and marginalization, I am committed to being a catalyst for such change. My blend of empathy, practical experience, and community engagement expertise makes me the best candidate to drive this program’s success.  \n', 'Yes', 'Baphalali Eswatini Red cross Society, Youthlet, SAfaids-Her voice fund', 'As an advocate for adolescent girls and young women (AGYWs), I worked to empower them through mentorship, health education, and skills training, addressing issues like gender-based violence and HIV prevention. I also served as a Participation, Gender, and Inclusion (PGI) Champion, ensuring youth programs were inclusive and equitable, particularly for marginalized groups.  \n\nAdditionally, I led a climate change and environmental project, mobilizing youth to participate in tree-planting drives, waste management initiatives, and awareness campaigns. Through workshops and community dialogues, I educated young people on sustainable practices while fostering their leadership in environmental advocacy.  \n\nMy approach combined grassroots engagement with strategic partnerships collaborating with local leaders, NGOs, and schools to amplify impact. By creating safe spaces for dialogue and action, I helped young people develop confidence, skills, and a sense of agency whether in gender equality, environmental stewardship, or community development. My work directly contributed to increased youth participation, improved awareness on critical issues, and tangible community change.', 'No', NULL, '2025-07-15 16:42:20', '2025-07-15 16:42:20'),
(130, 583, '[\"documents\\/01K071SWGFX7Y20W88CBV2Z2WQ.pdf\"]', '[\"documents\\/01K071SWGTH5FYK3DGQM3VRSP4.pdf\"]', 'Unemployed', 'I believe this programme will enhance my skills of promoting behaviour change as it align with my field of study.\nThe programme will give me an opportunity to contribute to social welfare of the youth in my constituency.\nI am confident that I work well with others to achieve shared goals. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 16:43:54', '2025-07-15 16:43:54'),
(131, 584, '[\"documents\\/01K071YMX45RYF8R3NWN8G83VY.pdf\"]', '[\"documents\\/01K071YMXE0M6HR1HWTS3WHCFA.pdf\"]', 'Unemployed', 'Am a good communicator, good listener. Have problem solving skills. Am empowered with knowledge. Physically fit hence i can walk long distances. I love working with people og my age group since we understand each other well. Have coping skills when working under pressure. In whatever i do am authentic ', 'Yes', 'World Vision Eswatini ', 'Facilitated group and individuals sessions about mental health issues and sexual reproductive health hence i empowered young people with knowledge.mentoring young people on starting business so to have source of income for those unemployed.education support structure for young people sponsored by the organization.health education for the community and engage community leaders. Encouraged young people on self independence.', 'Yes', NULL, '2025-07-15 16:46:30', '2025-07-15 16:46:30'),
(132, 585, '[\"documents\\/01K071ZCQYJ8J6X7GR0KX2PN2X.pdf\"]', '[\"documents\\/01K071ZCR16YNGDEC3W62S5PZ4.pdf\"]', 'Unemployed', 'I think I am fit candidate because i have worked with teenagers with disabilities . I was able to communicate and analyse their needs.Some were enrolled to school .Some were given medical attention and some got wheel chairs and diapers', 'Yes', 'Enrolling children between 0to 17 years with disability,promoting access to services', 'None', 'Yes', NULL, '2025-07-15 16:46:55', '2025-07-15 16:49:52'),
(133, 586, '[\"documents\\/01K07294QEZDTAPTJMPS6GMXDQ.jpg\"]', '[\"documents\\/01K07294QH7G0V9GV373DBX4YP.pdf\"]', 'Unemployed', 'I am really so thankful for this opportunity I applied here because here we talked about a Youth organization I have been trained as a youth minister organization in IYF two sticks Manzini.  To add to that we used to work with youth there training them the right mindset through mind education program giving them lecture . I went to Asia South Korea for the training of mind Education school And I like working with the youth.  Inconclusion I disld diploma in Theology so we did use the train the young people all over Eswatin training them to have the right mindset.', 'Yes', 'International Youth Fellowship ', 'I help the young people giving them mindset Education lectures ', 'Yes', NULL, '2025-07-15 16:52:14', '2025-07-15 16:52:14'),
(134, 587, '[\"documents\\/01K07294YB9BV1HP8JPM317VCF.jpeg\"]', '[\"documents\\/01K07294YMXYTHQETDYVKXWNKT.pdf\"]', 'Unemployed', 'Through the knowdgeand wisdom that I got from being a nember of such youth motivational organisations,\nI would love to share it to others .\nHaving passed my adolecent stage and knowing the concequences of peer pressure more especially with teenage dating and drug abuse.\nAlso, having done my tertiary studies , I am in a good position to encourage them on taking school serious and not give up on their dreams no matter the circumstances. \n', 'Yes', 'World Vision and Young Hereos', 'I was a member and had ideal lessons on how to prevent HIV and STDs\nWe were also tought on how to raise money with as little as E20 maybe by selling sweets at school. Again they tought us ways of saving money by the use of piggy banks and saving groups', 'Yes', NULL, '2025-07-15 16:52:14', '2025-07-15 16:55:32'),
(135, 588, '[\"documents\\/01K072S61MTWDGCA5BFSSTT8JC.pdf\"]', '[\"documents\\/01K072S61QF76JVJKDQB2FPRM8.pdf\"]', 'Unemployed', 'I possess strong interpersonal skills which enables me to communicate effectively with everyone \nat all level,my analyticalskill allows me t o provide data driven insights that support strategic\ndecision-making ', 'No', 'N/A', 'N/A', 'Yes', NULL, '2025-07-15 17:01:00', '2025-07-15 17:01:00'),
(136, 589, '[\"documents\\/01K072SEJQTVRW3SDZ5HKADB9E.heic\"]', '[\"documents\\/01K072SEK9CAEYZFSRZCAKC287.pdf\"]', 'Unemployed', 'I have applied because I am passionate about youth empowerment and community development. I am currently pursuing a Bachelor of Arts in Journalism and Mass Communication, majoring in Public Relations, which has equipped me with strong communication and organizational skills.\n\nAs Head of the Welfare Department at Save A Soul Foundation, I have coordinated programs that support vulnerable youth through food drives, mentorship, and emotional support. These experiences have taught me the value of leadership, empathy, and teamwork.\n\nI believe I am the best candidate because I combine academic knowledge with hands-on experience, and I am deeply committed to making a meaningful impact in the lives of young people.\n', 'Yes', 'Save A Soul Foundation ', 'At Save A Soul Foundation, I serve as the Head of the Welfare Department, where I oversee programs that provide emotional, social, and material support to vulnerable youth. I coordinate food drives, counseling sessions, and school support initiatives aimed at improving the well-being of young people and empowering them to reach their full potential.', 'No', NULL, '2025-07-15 17:01:09', '2025-07-15 17:01:09'),
(137, 590, '[\"documents\\/01K072VS85JA50SYX6BSRPWNFB.jpg\"]', '[\"documents\\/01K072VS88CNA5FF3834XA757F.jpg\",\"documents\\/01K072VS8APF5ZM4Q6Q9WCBSR1.jpg\"]', 'Unemployed', 'I am a teacher currently awaiting for certification results at William Pitcher College.\n I have a strong understanding of psychosocial challenges and the factors contributing to gender based violence (GBV). As a role model to my peers, I am passionate about fostering a safe and inclusive environment and believe that peer education is a powerful for positive change.\n My ability to engage peers and learners in open discussions, promote awareness and encourage healthh behaviors makes me a strong candidate for this role. Thank you in advance ', 'No', NULL, 'None ', 'Yes', NULL, '2025-07-15 17:02:25', '2025-07-15 17:02:25'),
