(139, 592, '[\"documents\\/01K072X5SC2DN6QT682FVS6B4M.jpg\",\"documents\\/01K072X5SERH834SBX4BWBBWKQ.jpg\"]', '[\"documents\\/01K072X5SH8MWNK6ZAZK0CE2BR.pdf\"]', 'Unemployed', 'I am passionate about youth empowering programs. I believe in positive change and personal development. Lastly, I have good communication and leadership skills. ', 'No', 'None', 'None ', 'Yes', NULL, '2025-07-15 17:03:11', '2025-07-15 17:03:11'),
(140, 593, '[\"documents\\/01K0730AQQW8GTVFHCGDTWBSEY.jpg\",\"documents\\/01K0730AQT7G15E7MXGJQQVM9V.jpg\"]', '[\"documents\\/01K0730AQYAABMEKTTQ6VEPZ46.pdf\"]', 'Unemployed', 'I have applied for this opportunity,  because I am passionate about making a positive change in my community. Also I believe that my background in Public Relations will help me, effectively connect with others. I am dedicated, enthusiastic individual who is eager to learn more about trading mindsets, to inspire my fellow youth. My strong communication skills and commitment to teamwork,  make me a great fit for the Eswatini National Youth Council. Lastly I am excited to use my talents to support the community and help drive positive change, and looking forward for this opportunity.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 17:04:54', '2025-07-15 17:04:54'),
(141, 594, '[\"documents\\/01K0730H1PFP79HDZA06MGR78Q.pdf\"]', '[\"documents\\/01K0730H1TCNYWYG8GRA1KQYNH.pdf\"]', 'Unemployed', 'I applied to work with youth because I am passionate about helping young people reach their full potential. I believe that supporting, guiding, and empowering youth can have a positive impact not only on their lives but also on their families and communities. I enjoy listening, encouraging, and helping young people make good decisions, build confidence, and develop skills they need for the future.\n\nI believe I am the best candidate for this job because I have the right attitude, patience, and communication skills to work well with youth. I am a good listener, I’m approachable, and I know how to motivate and support other people. I am responsible, dependable, and I understand the importance of creating a safe and supportive environment. I am also willing to learn and work with a team to achieve our goals.\n', 'No', NULL, 'None', 'No', NULL, '2025-07-15 17:05:01', '2025-07-15 17:05:01'),
(142, 595, '[\"documents\\/01K073349X8AHNY2QM0QE2Q29M.pdf\"]', '[\"documents\\/01K07334A0TB18EFYR59X11VXZ.pdf\"]', 'Unemployed', 'I am applying for this job because I am very passionate about the youth of my constituency and Eswatini at love. I love proving information and encouraging the youth. I find pleasure in working with people and knowing that I made a difference in someone\'s life.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 17:06:26', '2025-07-15 17:06:26'),
(143, 596, '[\"documents\\/01K0735A7ASQ4P6H1N2TKXAA46.pdf\"]', '[\"documents\\/01K0735A7ERN24C5M524M632RJ.pdf\"]', 'Unemployed', 'The reason on why I have applied for the role of  becoming a Peer Educator within your program is because ss someone who is passionate about youth empowerment, health education, and creating safe, inclusive spaces for learning and growth, I believe I can make a positive and lasting contribution to your team.\n\nI am particularly drawn to the role of Peer Educator because it offers the opportunity to support, inspire, and educate others through shared experiences. I have always valued open conversations around health, well-being, and personal development, and I am confident in my ability to connect with others, build trust, and provide accurate, respectful, and relatable guidance.\n\nBeing a Peer Educator is not just about providing information—it is about becoming a positive role model and a catalyst for change. I am ready and motivated to take on this role with dedication, respect, and enthusiasm.\n\n\n', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 17:07:37', '2025-07-15 17:07:37'),
(144, 597, '[\"documents\\/01K073669V4Z8V5CE7RT6E9ZCG.pdf\"]', '[\"documents\\/01K073669X0PM4CHMQHCT9MRMY.pdf\"]', 'Unemployed', ' I am passionate about youth empowerment thus I chose the Education career which will enable me to empower and educate young people. I believe I have the most vital skills for this role as I have  social interaction skills. I am intrinsically Motivated and I have great leadership skills. I believe I have good communication skills which is one of the vital skills needed in this role. With all that is said above  I believe am the right candidate for this role.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 17:08:06', '2025-07-15 17:17:33'),
(145, 598, '[\"documents\\/01K0739JH7NJWPVYB2Z7G1AAME.jpg\",\"documents\\/01K0739JHAQNPWB34XWNF1ARER.jpg\"]', '[\"documents\\/01K0739JHE43RW66N9FYVB05JP.jpg\",\"documents\\/01K0739JHG4P6YX6Q6VXA34A7T.jpg\"]', 'Unemployed', 'I believe I am the best candidate for this role because of my solid background in community focused work, particularly in the rural areas. With a BSc in Agricultural Extension and over two years of experience in both humanitarian and development work through my roles at World Vision and Guba Farm, I have led impactful community projects, educated households on sustainable practices, and facilitated livelihood programs that improved food security and resilience. My hands-on experience with both agricultural initiatives and community health outreach gives me a holistic understanding of the needs of the people we serve.\n\nI am inspired by ENYC’s commitment to empowering young people and communities in Eswatini through sustainable development and capacity building. I admire the organization\'s approach and emphasis on local solutions, which aligns closely with my values and professional experience. Joining ENYC would give me an opportunity to contribute meaningfully to national development while growing alongside a team that is dedicated to transformation. I see this as more than just a job but it\'s a chance to be part of a bigger movement that uplifts communities and nurtures future leaders.', 'Yes', 'World Vision ', 'At World Vision, I worked closely with youth and vulnerable groups through community outreach and education programs. I facilitated life skills and health education sessions focusing on HIV/AIDS, hygiene, and nutrition, empowering young people to make informed decisions. I supported youth-led households with sustainable agriculture training and income-generating activities, promoting self-reliance. I also helped establish youth clubs, led community mobilization efforts, and mentored young people through peer support structures. Lastly I also conducted monitoring and evaluation to ensure projects were impactful and transformed the lives of beneficiaries.', 'Yes', NULL, '2025-07-15 17:09:57', '2025-07-15 17:09:57'),
(146, 599, '[\"documents\\/01K073D74HD3XS53H7WWCS3MB4.jpg\"]', '[\"documents\\/01K073D74JF7TY3GMDS9A1W2QC.pdf\"]', 'Unemployed', 'The reason why I have applied is because I\'m passionate about helping the youth and groom them into more focused and goal driven individuals. An an aspiring Counsellor, I am driven to help solve part of the problems the youth majorly have such as anxiety and depression I believe that with the skills and knowledge that I have I can make a great impact to the organisation. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 17:11:56', '2025-07-15 17:11:56'),
(147, 600, '[\"documents\\/01K073G6J6CG1HEB193XDHBZTF.pdf\"]', '[\"documents\\/01K073G6J9WQAN4BTMJZWJHGGN.pdf\"]', 'Unemployed', 'I believe in myself and I align perfectly well with your goals', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 17:13:34', '2025-07-15 17:13:34'),
(148, 601, '[\"documents\\/01K073JRD62W818D1SDC05JC08.pdf\",\"documents\\/01K073JRD91G7KSBDS44K6852K.pdf\"]', '[\"documents\\/01K073JRDCQ4DBW1P3WV2FJWAD.pdf\"]', 'Unemployed', 'I am a youth who believes in empowering youth. I am a teacher by profession, working with young people is my passion. Currently I am trying to build a wellness team and getting youth together to make a sporting accademy in Mankayane. In addition to that, I am able to bring young people together. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 17:14:58', '2025-07-15 17:14:58'),
(149, 602, '[\"documents\\/01K073XV97TT9CHJ25XJ8XS25Y.jpg\"]', '[\"documents\\/01K073XV9CAY5YZG7712H95MZR.pdf\"]', 'Unemployed', 'I feel I am the best candidate because I have an experience with interacting and working with young children and know just exactly the way to sensitise and speak to them ,I also recorded each outcome from sessions held', 'Yes', 'SWAGAA', 'I raised awareness on topics around Gender based violence and had an experience of getting an interaction with them creating a safe space and conducive environment for them to be sensitized and open up', 'Yes', NULL, '2025-07-15 17:21:01', '2025-07-15 17:21:01');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(150, 603, '[\"documents\\/01K0741VQJYFD71MV13H77XGJH.pdf\",\"documents\\/01K0741VQTM0BJ3PQT81SMNN7R.pdf\",\"documents\\/01K0741VQXCNM10EXADTJ57539.pdf\"]', '[\"documents\\/01K0741VR2X8TK4GMZXW2GFX4N.pdf\"]', 'Employed', 'I have applied because I am passionate about youth empowerment and believe in the importance of mindset transformation for building stronger, more resilient communities. As a youth overseer at my church, I’ve seen how guidance and mentorship can change the lives of young people. I want to expand this impact beyond my church and contribute to national efforts that inspire positive behavior and personal growth among the youth.\n\nI am the best candidate because I bring strong communication and leadership skills, gained from over 8 years of professional experience in training, supervision, and team coordination. I am also highly committed, dependable, and able to relate well with people from different backgrounds. My blend of technical experience and community involvement makes me well-prepared to support and lead mindset change initiatives in my community.\n\n', 'No', NULL, 'Although I have not worked with a formal youth-focused organization, I am actively involved with the youth at my church, where I serve as a youth overseer. In this role, I guide and mentor young people, organize youth programs, support their personal and spiritual development, and encourage positive mindset change through group discussions, workshops, and community outreach activities.', 'Yes', NULL, '2025-07-15 17:23:13', '2025-07-15 17:23:13'),
(151, 604, '[\"documents\\/01K0745D9VPX6E0400WGGPAMMY.pdf\"]', '[\"documents\\/01K0745D9Y9FP7SC7XAT5NV4MN.pdf\"]', 'Unemployed', 'I am a young smart and responsible person. I take life seriously. I would appreciate seeing other pushing their best abilities in life in order to be better citizens of the Kingdom of Eswatini.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 17:25:09', '2025-07-15 17:25:09'),
(152, 605, '[\"documents\\/01K0746D7R9G5PBZGMDJAJYRJ3.pdf\",\"documents\\/01K0749AC76P93VPZEFZFZ3GNS.pdf\"]', '[\"documents\\/01K0746D7VMN0SC28JMMRGRE78.pdf\"]', 'Unemployed', 'I\'m applying to be trained as a trainee at ENYC because I really want to learn and grow. I\'m a young person who wants to be useful in my community and make a difference where I can. I\'ve always wanted to give back to the community that shaped me, and I see this as a great opportunity to start. I\'m an unemployed youth and I would like to use my time doing something meaningful, helping others while also learning new skills. I\'m not perfect, but I\'m willing to try, learn and give my best. I hope to gain experience and confidence, and maybe one day help others who are in the same shoes I am now. With the high rate of unemployment in the country ENYC has really been helpful to those I have seen taking part in your program and I\'d like for my name to be in the making of such greatness.\n Thank you for considering me.\n', 'No', 'None.', 'None.', 'Yes', NULL, '2025-07-15 17:25:42', '2025-07-15 17:27:17'),
(153, 606, '[\"documents\\/01K074BZ8A98QWWFA9C43YJ12S.pdf\"]', '[\"documents\\/01K074BZ8DRHDBQS44P8DK2W2N.pdf\"]', 'Unemployed', '\nI have applied to be in the youth mindset change trainer program, because the experience I acquired taught me how vital it is for young people to develop a growth mindset, especially in environments where they face social and economic challenges. I have seen firsthand how mindset shifts such as building self-confidence, resilience and purpose can transform lives. With all the above said it will be my honour to get the opportunity to gain structure tools and methodologies to help guide youth through meaningful change. To learn evidence based approach to mindset training and become more effective in designing workshops and engaging young audiences.\nI am the best candidate for the job because I am commitment to youth development, combined with my willingness to learn and grow. I will be honoured to contribute to a community of change makers and further develop my capacity to inspire positive transformation in others.\nThank you for considering my application. I look forward to the opportunity to learn, serve, and grow as part of your program.\nWarm regards \nSimelane Tebenguni ', 'Yes', 'Family Life Association of Eswatini ', 'I was an outreach coordinator,where\n1. I connected with young people in school or communities \n2. Building relationship and trust with young people \n3. Creating a safe and supportive environment for youth at the Flas facility \n4. Providing information about available service in the facility and other institutions and how to access them \n4. Program development and implementation \n5. Identify the specific needs and challenges faced by young people \n6. Advocate for youth with other agencies or institutions to ensure their needs are met\n7. Documentation and reporting ', 'Yes', NULL, '2025-07-15 17:28:44', '2025-07-15 17:28:44'),
(154, 607, '[\"documents\\/01K074WRMBM8KAW2ERWTNJ0ENV.pdf\",\"documents\\/01K074WRMEQ9M43FH0TEZKFVFE.pdf\",\"documents\\/01K074WRMHGNAQXGW7B0TTWZGS.pdf\"]', '[\"documents\\/01K074WRMKZ5K4A4DXNE0B6PV9.pdf\"]', 'Self-Employed', 'I have applied for this job because I am passionate about helping people in my community, especially young people, to change the way they see themselves and their future. I strongly believe that mindset transformation is the first step to solving many social challenges, including unemployment, low self-esteem, and risky behaviors. As a peer educator, I want to share positive knowledge and life skills, inspire hope, and encourage others to make better choices that improve their lives.\nI believe I am the best candidate because I understand the local challenges young people face and can relate to them as a peer. I am approachable, a good listener, and able to communicate messages in a way that is practical and motivating. I have experience working with youth groups where I developed teamwork and leadership skills. I am dedicated, responsible, and always open to learning, which helps me to grow and better support those I serve. My commitment to personal growth and positive change makes me ready and determined to lead mindset transformation among my peers.', 'Yes', 'Women in Trade and Development (WITAD), Young Life Eswatini, Young Heroes ', 'In women in Trade and Development (WITAD) I train women and youth digital skills in business and business plans. This helps the youth to know how to write a busines plan for themselves if they want funding. At Young Life Eswatini, I help the youth to grow in Christ, organising camps and clubs for the youth which helps the youth to know their identity. At Young Heroes, I taught  the youth and their guardians how to save money and how to maintain a healthy, safe relationship at home which helped some of the guardians and youth to stop doing unnecessary debts as they saved money for things they needed and they started to do businesss.', 'Yes', NULL, '2025-07-15 17:37:54', '2025-07-15 17:37:54'),
(155, 608, '[\"documents\\/01K074WT8A8GJJQ6TYCWGWR505.jpg\"]', '[\"documents\\/01K074WT8EMTMQDFTS2EE998Y6.jpg\"]', 'Unemployed', 'Willing to learn more and i believe working in this organization will help me achieve my career goal of becoming an expert in my field.', 'Yes', 'Sivusa Tive Nengcebo ', 'Motivating young people and also doing hand work e.g making liquid soap,sta-soft and many more', 'Yes', NULL, '2025-07-15 17:37:56', '2025-07-15 17:41:48'),
(156, 609, '[\"documents\\/01K07513YSYHDPF3871SZXGEKC.pdf\"]', '[\"documents\\/01K07513YXMJ6MJ8TG2J03N8CF.pdf\"]', 'Unemployed', 'With a background as a Social Worker and Youth Club Facilitator, I am well equipped with the skills and experience necessary to engage and educate individuals on social issues in a meaningful and impactful way. \nMy experience as a Youth Club Facilitator has honed my presentation, public speaking and communication skills allowing me to engage and inspire others. \nI am eager to contribute to your project mission of empowering individuals and fostering a more informed and socially conscious community.  ', 'Yes', 'BoMake Rural Projects organization ', 'As a Social Worker, I was doing community work and working in different projects for boMake Rural Projects.\nAs a facilitator, I am providing mentorship, guidance and support to high school students in their personal and academic development. \nWorking as an administrator, keeping records, general administrative support to staff and management as needed.\n', 'Yes', NULL, '2025-07-15 17:40:17', '2025-07-15 17:40:17'),
(157, 610, '[\"documents\\/01K0751ECTV7X6FQ1Z9CS3YD92.pdf\"]', '[\"documents\\/01K0751ED0WQ25D5MSEFFZGN72.pdf\"]', 'Unemployed', 'I believe that young people\'s lives can change with the right training and supervision.I believe that a changed and trained mind can bring a lot of positive change to communities.I would be honoured to be a part of the change that can be brought to my inkhundla through this programme .', 'Yes', 'Baylor College of Medicine Children\'s Foundation ', 'I worked under a project that focused on empowering teenage mother\'s with vocational training, monthly teen clubs and detergents training.', 'Yes', NULL, '2025-07-15 17:40:28', '2025-07-15 17:40:28'),
(158, 611, '[\"documents\\/01K0752A7XENHGDC42705QYQ15.jpg\"]', '[\"documents\\/01K0752A8083MZVYGTCMG36B6C.pdf\"]', 'Unemployed', 'I am applying for this Training of Trainers program because I am passionate about empowering young people and believe I possess the skills and experience necessary to effectively train and mentor them. My involvement with the Super Buddies youth organization provided me with firsthand experience in facilitating workshops, mentoring young individuals, and organizing community engagement activities. This experience has solidified my commitment to youth development and instilled in me a deep understanding of the challenges and opportunities facing young people today.\n\nFurthermore, my academic background in business management has equipped me with valuable organizational, communication, and problem-solving skills that are essential for effective training. I am confident in my ability to develop engaging training materials, deliver presentations effectively, and adapt my training style to meet the diverse needs of participants. I am a highly motivated and results-oriented individual with a strong work ethic and a proven track record of success. I am also a collaborative team player and am eager to learn from experienced trainers and contribute to a positive and supportive learning environment. I am confident that my passion for youth development, combined with my skills and experience, make me an ideal candidate for this program and that I can make a significant contribution to the training of future youth leaders.\n', 'Yes', 'Super Buddies ', 'During my time with the Super Buddies youth organization, which has since closed, I actively contributed to the positive development of young people. While there, I assisted in organizing and leading various activities and workshops designed to foster teamwork, leadership skills, and community engagement. I mentored younger members, providing guidance and support as they navigated challenges and explored their interests. I helped facilitate educational programs focused on topics such as financial literacy, career exploration, and healthy living. Furthermore, I played a role in coordinating community service projects, encouraging young people to give back to the community and develop a sense of social responsibility. My educational background in business management, specifically my associate degree and ongoing studies toward a bachelor\'s degree in business administration, equipped me with valuable organizational and problem-solving skills that I applied to these endeavors. I leveraged my knowledge to streamline operations, manage resources effectively, and ensure the smooth execution of programs, ultimately contributing to a positive and enriching experience for the youth involved.\n', 'Yes', NULL, '2025-07-15 17:40:56', '2025-07-15 17:40:56'),
(159, 612, '[\"documents\\/01K0753FT598N2YH3VX8BYAA5K.jpg\"]', '[\"documents\\/01K0753FT91J6MEY7K5D1EPZT9.pdf\"]', 'Employed', 'As a young adult and a young single mother I believe I can be the perfect example to my peers that loosing focus as a young person can ruin your entire life. ', 'No', 'None', 'I am part of girls committee at my local Church where by we learn an teach others young girls how to behave as girl. ', 'No', NULL, '2025-07-15 17:41:35', '2025-07-15 17:41:35'),
(160, 613, '[\"documents\\/01K0756077F6RVZD96TJV6KMBT.jpeg\"]', '[\"documents\\/01K075607AS40608D2V4CNF8EH.pdf\"]', 'Unemployed', 'I applied for the Peer Educator position because I\'m passionate about empowering young people with knowledge, skills, and confidence to make informed decisions about their lives. As someone who has experience working with youth, I believe I can make a positive impact on their lives and help them navigate challenges.I\'m the best candidate for this role because I possess a unique combination of skills, experience, and passion. My experience as a Youth Facilitator has equipped me with the ability to guide group discussions, facilitate workshops, and build relationships with young people. I\'m confident in my ability to create a safe, supportive, and inclusive environment where youth feel comfortable sharing their concerns and ideas.', 'Yes', 'Eswatini National Youth Council', 'As aYouth Facilitator had a direct impact on the lives of young people, helping them grow, learn, and thrive. Imotivated young people to get involved, participate, and develop their abilities.I built relationships and trust with young people I established strong connections with the youth, creating a safe and supportive environment.I Addressed challenges, concerns, and needs of youth I identified and responded to the unique needs and issues faced by young people, providing guidance and support.', 'Yes', NULL, '2025-07-15 17:42:57', '2025-07-15 17:42:57'),
(161, 614, '[\"documents\\/01K0759XDJ95BMH4MVX5DZQVWR.pdf\",\"documents\\/01K0759XDMR191YHTNZP7K62YQ.pdf\"]', '[\"documents\\/01K0759XDR6D4466RJMNHSZ64Z.pdf\"]', 'Unemployed', 'I really applied because I know I’m good for the poison and I really like working with the youth  or rather helping the youth, as I can see we don’t get much opportunity sometimes because we lake knowledge as people, I’m honestly the best candidate because I’m pertinent and willing  to learn also, which can also build me as a young girl.', 'Yes', 'Family life Association ', 'Was empowering young girls, motoring them in how to live as a young girl, I helped them understand their selves and life.', 'No', NULL, '2025-07-15 17:45:05', '2025-07-15 17:45:05'),
(162, 615, '[\"documents\\/01K075EEVNSE50RA80DVSFQKRA.pdf\"]', '[\"documents\\/01K075EEVR46A06NMDEM8M9NJZ.pdf\"]', 'Self-Employed', 'I am a perfect candidate for this job because I have experience working with young people from all walks of life, including those living with disabilities. Also, I am youth friendly with a down to earth personality, which will work in my favor when I am conducting the trainings.', 'Yes', 'FLAS, Kwakha Indvodza, Langalethu Charity Organization', '-Managing Manzini youth when doing peer to peer talks and outreach programmes\n-Organizing male discussion sessions on behalf of Kwakha Indvodza\n-Hosting youth focused events such as Expos, Sports Days, etc. Especially for youth with disabilities.', 'Yes', NULL, '2025-07-15 17:47:34', '2025-07-15 17:47:34'),
(163, 616, '[\"documents\\/01K075F8T2V5D46A31WMC3C0VG.pdf\",\"documents\\/01K075F8T4BN195FJNQYVRE9HV.pdf\"]', '[\"documents\\/01K075F8T60QFVPEMCPVX2PSWP.pdf\"]', 'Unemployed', 'Communication Skills. I have good communication skills which I can train youth to communicate clearly, assertively and respectively. I also have critical thinking snd problem solving skills which I can help young people to be able to identify and analyze problems, develop creative solutions, and make informed decisions. I have creative and innovative skills in which I can help the youth to think creatively and develop innovative solutions to problems. Also, challenging young people to think outside the box and inspire them to explore new ideas and perspectives. This can be especially valuable in today’s rapidly changing world, where creativity and innovation are highly valued.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 17:48:01', '2025-07-15 17:48:01'),
(164, 617, '[\"documents\\/01K075FFJ9FSKJPDNZ0ARGJSDB.pdf\"]', '[\"documents\\/01K075FFJBYQHM3VFTEPA7KXSJ.pdf\"]', 'Employed', 'I found joy in not only completing the task but in leading by example. I am the best candidate because my skills and qualities align with the job description. I am eager to bring fresh perspectives to the table and educate the youth\'s minds into bettering themselves. I strive to be the kind of role model who inspires others to excel, fostering a culture of positivity and growth.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-15 17:48:08', '2025-07-15 17:48:08'),
(165, 618, '[\"documents\\/01K075V42Y3ECMREFQSVK2Z347.jpg\"]', '[\"documents\\/01K075V4336BJQ42VQ7GPVPNPQ.pdf\"]', 'Self-Employed', 'I am a hard working individual who constantly demonstrate a strong attention to detail while providing excellent service.I also work well under pressure,have good interpersonal skills and willing to learn new skills that can help the youth of my community.As a self employed young person myself,I wish all the youth would start business and focus on building their legacy in this economy.I believe this program will teach me skills that I will share with the youth so we can grow together.', 'Yes', 'Zombodze Youth in Action ', 'Zombodze Youth in Action was all about helping the youth of Zombodze Emuva start their own businesses,earn money and stay away from crime.We also educate the youth the dangerous of sexual intercourse,HIV and also child birth.', 'Yes', NULL, '2025-07-15 17:54:29', '2025-07-15 17:54:29'),
(166, 619, '[\"documents\\/01K076BZ56PKN9QY23Y6D8D2WQ.jpg\",\"documents\\/01K076BZ5J7Y6YAZF5SKTF3088.jpg\",\"documents\\/01K076BZ60VHSVAEH697J43TJ6.jpg\"]', '[\"documents\\/01K076BZ6CM97J2CW72R2ZSEGM.jpg\"]', 'Unemployed', 'By profession I am a development facilitator for children and youth,so I feel it\'s my duty to help develop others', 'Yes', 'ACAT Lilima Eswatini', 'Educating Sibebe Community about organic farming ', 'Yes', NULL, '2025-07-15 18:03:41', '2025-07-15 18:03:41'),
(167, 620, '[\"documents\\/01K076DJBT8QK8YBFE1WE7MJSR.jpg\",\"documents\\/01K076DJBXFQP2HH3XNJ7A0CDK.jpg\"]', '[\"documents\\/01K076DJC00TS354K91QHJF7M5.jpg\",\"documents\\/01K076DJDBHFFX56R85F77KPM6.jpg\",\"documents\\/01K076DJDDERFZNRG065DAGDVM.jpg\",\"documents\\/01K076DJDGXB7E7RJY1SERVT94.jpg\",\"documents\\/01K076DJDJ2E6WRXTXETTA81F1.jpg\",\"documents\\/01K076DJDM2TXK5DRFV3CD95HN.jpg\"]', 'Employed', 'I am passionate about the youth, honestly looking back into my life if I had the knowledge that I have now I wouldn\'t have fell into certain traps. There is a lot of life fantasy amongst the youth of which that\'s is a gap that needs to be bridged with facts for them to be a wiser and stronger generation.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-15 18:04:34', '2025-07-15 18:04:34'),
(168, 621, '[\"documents\\/01K076NTDZ37NJB45KHXBR5M9Y.pdf\"]', '[\"documents\\/01K076NTEEZWMHARV6NNGQX576.pdf\"]', 'Unemployed', 'I have applied for the post since I\'m a young person who is unemployed yet have the skills, such as motivating and advising and mentoring a young person, as I\'ve got a Degree in secondary education.  These skills have given me an understanding of how important for a young person to be exposed through conversations and encouragements to the youth which could help one be a exceptional member of the community. I\'m the best candidate for the job because I\'m willing to see the youth grow, land even grow myself with the establishment in which I will provide the skills I\'ve acquired in university to put a star sign in everything I\'m put at task to.', 'No', NULL, 'I\'m a teacher by profession, therefore,  helping the youth is one of my greatest attributes at a young person. At Gebeni High school where I did my internship,  I was part of the Career Guidiance team which advice a young person to think of the future,  be it starting a business or choosing a good career path for one. In this team, we accompanied learners to the Career expo of 2024 which exposed learners to different opportunities in which they can choose from..', 'No', NULL, '2025-07-15 18:09:04', '2025-07-15 18:09:04'),
(169, 622, '[\"documents\\/01K076QPMSFG7BR1MEGDPD3TDZ.pdf\"]', '[\"documents\\/01K076QPMWPZF22E8Q1G0JQR6C.pdf\"]', 'Unemployed', 'I am excited to apply for the youth mindset trainer program because I have a strong passion for youth development, and I admire the organization’s commitment to youth work is guided by values such as inclusivity, empowerment, collaboration, and innovation—ensuring all young people have equitable access to opportunities while fostering creativity, leadership, and meaningful participation. Through advocacy, sustainability, excellence, and integrity, youth programs strive to make a lasting, ethical, and impactful difference in society. This position aligns perfectly with my career aspirations and offers an opportunity to contribute to a team that is making a significant impact.\n\nI believe I am the best candidate for this role due to my extensive experience in working with youth through HIV awareness and prevention.  My background in HIV prevention education has helped identifying and targeting these groups through strategic entry points, conducting mobile-based vulnerability assessments, and facilitating outreach activities, small group sessions, and one-on-one mentorship on HIV prevention has equipped me with the tools necessary to develop effective strategies that drive results.\n\nMoreover, I possess strong soft skills, such as communication, teamwork, or problem-solving that are essential for collaborating with colleagues and fostering a positive work environment. I am adept at managing multiple projects and thrive in dynamic settings.\n\nI am eager to bring my skills to this position and contribute to the organization’s mission of delivering exceptional value. Thank you for considering my application.\n\n\n', 'Yes', 'YOUNG HEROES', 'My recent experience as a Life Mentor at Young Heroes involved providing comprehensive HIV \nprevention support for Adolescent Girls (10-19) and Young Women (20-29). This included identifying \nand targeting these groups through strategic entry points, conducting mobile-based vulnerability \nassessments, and facilitating outreach activities, small group sessions, and one-on-one mentorship \non HIV prevention. I also made referrals for clinical services to mobile and local clinics. Furthermore, \nas a Peer Educator at Moya Centre, I helped teach peers life skills, health, and wellness at school. \nThese experiences have equipped me with valuable skills in peer education, support, and community \nengagement directly relevant to the work of a Peer Navigator.', 'Yes', NULL, '2025-07-15 18:10:06', '2025-07-15 18:10:06'),
(170, 623, '[\"documents\\/01K076WZCTET55G5J467BPZW9M.pdf\"]', '[\"documents\\/01K076WZD2ZPWRZ9WR5B1R69N4.pdf\",\"documents\\/01K076WZD35BQ15FP4R9S0VGSB.pdf\"]', 'Unemployed', 'I believe in the power of mindset to transform lives, especially among young people. As someone who has worked extensively with youth through entrepreneurship and agricultural development initiatives, I’ve seen firsthand how a shift in thinking can unlock potential, build resilience, and open doors to new opportunities. I also bring a unique combination of formal training, practical experience, and a deep commitment to youth development. Additionally, I am a strong communicator, comfortable working in diverse communities, and respected as someone who listens, motivates, and leads by example.', 'Yes', 'Youth Chamber of Commerce and Industries', 'Through my role as Volunteer Stakeholder Engagement Manager at the Youth Chamber of Commerce and Industries, and my background in agricultural science, I facilitated conversations and sessions that demystified agricultural concepts and policies. I helped young entrepreneurs understand how national and global agricultural policies impact their ventures and equipped them with simplified, practical knowledge to navigate the agricultural value chain.', 'Yes', NULL, '2025-07-15 18:12:58', '2025-07-15 18:12:58'),
(171, 624, '[\"documents\\/01K076XB3HGAER3WE0DYT6QM7C.pdf\"]', '[\"documents\\/01K076XB3KP6X01P8T4SPCYTX1.pdf\"]', 'Unemployed', 'I need the job, but mostly l should love to work with young people and empowering their mind.', 'No', 'Nonw', 'None ', 'Yes', NULL, '2025-07-15 18:13:10', '2025-07-15 18:13:10'),
(172, 625, '[\"documents\\/01K0770ZF3TJZF0R9CPH7ZBWYV.pdf\"]', '[\"documents\\/01K0770ZF7KY2AYF1JYGV7FMG6.pdf\"]', 'Unemployed', 'I have completed my tertiary secondary teachers deploma recently. In the journey of my proffetional development I have develop passion for the Youth as in my teaching practise of 12 weeks I was teaching career guidance and counseling which then put me to the spotlight to see all the challenges faced by young people. With the skill, it is to my believe that I can help young people to realise their goals and  potentials. I will also introduce to the importance of vocational skills which assist in financial stability of individuals and reduce unemployment. ', 'No', NULL, 'Help young people to focus on their dreams and help them to set goal and draw up steps to follow in order to achieve those goals. Many young people are involved in drugs abuse , I will assist them to withdraw from drugs and form a positive life. As an aspiring teacher I will motivate them to focus on improving their lifes physically, financially, Emotionally and Spiritually. ', 'Yes', NULL, '2025-07-15 18:15:10', '2025-07-15 18:17:51'),
(173, 626, '[\"documents\\/01K0776RM60XN1XXZGFT28DSED.pdf\"]', '[\"documents\\/01K0776RM9JRHEEMZEM43M8Y7N.pdf\"]', 'Unemployed', 'I am passionate with helping the youth as we grow at the same time widening my own horizon. Being an unemployed teacher has helped me to navigate through the world of the youth together with the problems that we face, especially those that start at a young tender age and in turn affecting the individual even on their youth stage. I believe i can be the best candidate because I believe in change, I will work out of my comfort zone to ensure a safe and welcoming world for the youth because we as the youth are the future, and we better prepare for it now so we have a better tomorrow. ', 'Yes', 'Church ', 'I joined a group of youth where we educated each other on matters that affect the youth, mentally, physically, emotionally and psychologically and how those factors relate with church. ', 'Yes', NULL, '2025-07-15 18:18:19', '2025-07-15 18:18:19'),
(174, 627, '[\"documents\\/01K0777SNS714TM1VH5NAC9K8Z.jpg\"]', '[\"documents\\/01K0777SP5PBPFVFBG8485FKFC.pdf\"]', 'Unemployed', 'I believe I am the best candidate because I am very passionate about working with and helping young people. I am currently working with the youth at my church which has exposed me to their problems quite a lot and this has helped me to be aware of the challenges that they face as I sometimes have to provide solutions and give advices in order to assist them. I also run a small business and my belief is that every young person needs to have a business of their own in order to survive, the opportunity to work with young people will help me empower them with the little knowledge and experience that I have to get them moving and aspiring for better. I also believe I possess the necessary personal attributes to work\n with young people ', 'Yes', 'UNICEF', 'I worked s a peer educator in this organization part of a team that educated young people on various subjects including sexual reproductive health and holistic health to give them the information they need to make better and informed decisions for themselves.', 'No', NULL, '2025-07-15 18:18:53', '2025-07-15 18:18:53'),
(175, 628, '[\"documents\\/01K077DMBGSR5CFEKWCDTJW06B.pdf\"]', '[\"documents\\/01K077DMBK7WN8CD4RGE7ANVX7.pdf\"]', 'Unemployed', 'I have applied for this job because it directly aligns with my passion of empowering young people grow and achieve their potential. The chance to work with an organization that values continuous learning and innovation excites me, as I believe strongly in the power of knowledge sharing and mentorship. ', 'Yes', 'Nhlangano Aids Training Information Counselling Centre (NATICC)', 'I worked closely with young people whereby I offered counselling to those who needed it. There is also a Litsemba Lami Support Group in the organization which helps young people to address issues of gender based violence and sexual abuse which is a cause for concern and I was fortunate enough to be a part of it. ', 'Yes', NULL, '2025-07-15 18:22:04', '2025-07-15 18:22:04'),
(176, 629, '[\"documents\\/01K077DNNB5C3M49RCBRN86Y0K.jpg\"]', '[\"documents\\/01K077DNNPZA12W279Y79MY9GA.jpg\"]', 'Unemployed', 'Firstly am desperately for the job,also am willing to promote the youth development and help people with more knowledge from healthy services and other funds from such organisations. ', 'No', 'N/A', 'None', 'Yes', NULL, '2025-07-15 18:22:06', '2025-07-15 18:22:06'),
(177, 630, '[\"documents\\/01K077ED1JWYN7W6D18YBM5Y4B.jpg\"]', '[\"documents\\/01K077ED1P44AS902AAW1R9E1R.jpg\"]', 'Unemployed', 'I have a strong experience when it comes with working with young people as I joined world Vision club since High school upto tertiary \nI have also worked as an intern Teacher which broadened my insight as to how to work with young people ', 'Yes', 'World Vision ', 'Participated in youth Empowerment campaigns\nGave opinions regarding social issues \n', 'Yes', NULL, '2025-07-15 18:22:29', '2025-07-15 18:22:29'),
(178, 631, '[\"documents\\/01K077GC67B8X704SX1X14PJHY.pdf\",\"documents\\/01K077GC6AZZ0DVQ5ZTR99ZBF8.pdf\"]', '[\"documents\\/01K077GC6ECMX4QVVGD66PPR23.pdf\"]', 'Unemployed', 'I have applied for the peer educator position, because I am a generalist social worker and have been trained to work with all population groups from diverse backgrounds. Also, my strong communication skills foster open dialogue, which will create a safe space for youth to express themselves. I also prioritize empathy and relatability to build trust and empower young people to make informed decisions as it\'spart of my role as a social worker. I further thrive in collaborative environments and am eager to learn from training and feedback to adapt my methods effectively hence I will make a positive difference in the lives of the adolescents I will be working with in my constituency.', 'No', 'N/A', 'None', 'Yes', NULL, '2025-07-15 18:23:34', '2025-07-15 18:23:34'),
(179, 632, '[\"documents\\/01K077RPJBNFWP7YHNZ0TV1NBM.jpg\",\"documents\\/01K077RPJEX0GR04HB9Y1B0PMP.jpg\"]', '[\"documents\\/01K077RPJRW5Q9J1J67KM06715.jpg\",\"documents\\/01K077RPJVWMDJ2GPRZNRB5ZAK.jpg\"]', 'Unemployed', 'I\'m excited to apply for this role because it aligns with my skill, experience, and passion for working with young people. With 3 years of experience in working with young people, I have developed a strong foundation in loving and being patience with young people. I\'m the best candidate for this job because I bring unique combination in young people that will enable me to drive success in this role.I can make a valuable contribution to the team. I\'m  confident that my strong work ethic, collaborative spirit and creative problem-solving skills make an excellent fit for this position. I\'m looking forward to this discussing my application and how can contribute the organisation\'s success.', 'Yes', 'Cabrini Ministries ', 'I helped  them to build confidence and self-esteem by believing in them and   celebrating their success.And I encouraged them to set goals and work towards achieving them.\n\nI have been a listening ear and a sounding board for their ideas and concerns.\n\nI shared experience and axpertise to help them navigate challenges and make informed decisions.\n', 'No', NULL, '2025-07-15 18:28:07', '2025-07-15 18:28:07'),
(180, 633, '[\"documents\\/01K077V20GBGVJ4WSQ2ERH6Y6E.PDF\"]', '[\"documents\\/01K077V20N3QD98W1ASSKPKZ6G.pdf\"]', 'Unemployed', 'I have experience in working with the youth and have a diploma in Community development . ', 'Yes', 'ACAT Lilima eSwatini', 'My duty was to establish youth club within Shiselweni 2 Inkundla, monitoring and train groups on savings and HIV prevention.', 'Yes', NULL, '2025-07-15 18:29:24', '2025-07-15 18:29:24'),
(308, 757, '[\"documents\\/01K09NCAQF55EK1E9CN1VTN210.jpg\",\"documents\\/01K09NCAQP7VN9QE76G7FZ7N94.jpg\"]', '[\"documents\\/01K09NCAQV6AH9ECHQGRJZ6S76.PDF\"]', 'Unemployed', 'I have applied because the role aligns perfectly with my passion for the next generation and helping them build tools to navigate life challenges.\n\nI am the best candidate for the Job because I have an experience with the youth whereby I\'ve conducted group sessions with AGYWs focused on empowering them to improve their safety and completion of their education \nI know how to create safe space with young people.', 'Yes', 'Georgetown University Eswatini ', '1.Guide AGYW through safe spaces and life skills development.\n2.Deliver critical HIV/SRH education and GBV prevention.\n3.Connect youth to health services (PrEP, VMMC, testing and Family Planning services).', 'Yes', NULL, '2025-07-16 17:04:30', '2025-07-17 08:05:20'),
(182, 433, '[\"documents\\/01K08TY7BV36NKM9XKPKG7X1CJ.jpg\",\"documents\\/01K08TY7C1DE04NZSVXRNNFMJE.jpg\",\"documents\\/01K08TY7C33HHYTQQH3WVF5KCX.jpg\"]', '[\"documents\\/01K08TY7C58TWED0MR5V8ENC8B.jpg\",\"documents\\/01K08TY7C7HS1ZJSMHZ6JCFX9J.jpg\",\"documents\\/01K08TY7CAK9J2XCEBBY928EXX.jpg\"]', 'Unemployed', 'I have applied because I so wish to continue working with the youth,and I also have an experience.', 'Yes', 'Pact Eswatini and Young Heroes organisations', 'I was working as a Dreams Ambassador where I used to teach young women about HIV/AIDS,then refer them to the clinic or to the Dreams clinic from The Luke Commission for them to go and get PreP and family planning commodities.', 'Yes', NULL, '2025-07-16 09:22:25', '2025-07-16 09:22:25'),
(183, 119, '[\"documents\\/01K08VVEWJC7H7P586PMVABB4T.jpg\",\"documents\\/01K08VVEWMKS3WZ3Q1GE7366WS.jpg\"]', '[\"documents\\/01K08VVEWP4VYYJ1RBKKDFAE4N.jpg\"]', 'Self-Employed', 'Am the young business man ,( owning Arise and shine carpentry) who is the good example in my community. Most of the youth in my community are encouraged by my life and most of them they always come to me and asked me how did I make it, some are asking for job because usually when am working in my community I make sure I teach at least 2 young people who are willing to learn in that way my business is benefitting and the youth in my Area is benefitting skills.\nAm a young strong man who fear God and who is the good example in my community,am the most respectful and responsible young person. \n', 'Yes', 'Sakha kwetfu society club ', 'We used help those who needs uniforms donates and buy them clothes, more especially those who don\'t meet the standard of being able to buy for them selves, we also help elders more especially on Saturday because we had this organisation while we were at Esigangeni high school, \nMoreover, we used to clean our communities on Saturdays, help each other by donating money and help physical when one of our young children has lost their family members', 'Yes', NULL, '2025-07-16 09:38:23', '2025-07-16 12:47:29'),
(184, 634, '[\"documents\\/01K0926N6S5QY49D7GQ6C9S7DY.pdf\",\"documents\\/01K0926N6WX8Y3Z3DNRTVDAF8R.pdf\"]', '[\"documents\\/01K0926N718XM5SX67KEZRHQS7.pdf\"]', 'Unemployed', 'I have applied for the Youth Mindset Change Trainer Programme because I am deeply passionate about empowering young people to unlock their full potential, reshape limiting beliefs, and develop a positive, growth-oriented mindset. With a background in psychosocial support, I have a solid foundation in understanding behavioral patterns, emotional well-being, and the social factors that influence youth development. I believe I am the best candidate for this role because I combine professional training with genuine passion and proven experience. My ability to connect with youth on their level, coupled with my psychosocial knowledge, allows me to deliver mindset change sessions that are not only engaging and relatable but also grounded in techniques that truly work. ', 'Yes', 'Rising Stars Generation Eswatini ', 'I previously worked as a volunteering facilitator for children that came to the camp. We helped the young people to change their behavioral problems and helped them to stay fit and exercised throughout the camp.', 'Yes', NULL, '2025-07-16 11:29:22', '2025-07-16 11:29:22'),
(185, 635, '[\"documents\\/01K092CSY4THBDY7FTVESBG1YR.jpeg\"]', '[\"documents\\/01K092CSYN5ETR6Z5MW5HJY5CN.png\"]', 'Unemployed', 'I’m willing to learn more so I can be able to help young people \nI can be best because I dedicate myself in everything given to me \nBut mostly important is the wellbeing of the youth ', 'Yes', 'World Vision ', 'Was teaching about HIV prevention\nThe use of contraceptives to prevent unwanted pregnancies \nPrep n Pep use \n', 'Yes', NULL, '2025-07-16 11:32:43', '2025-07-16 11:32:43'),
(186, 636, '[\"documents\\/01K09VYXEFS6D3E5Z45G12ZFV5.pdf\",\"documents\\/01K09VYXEH0W2ZHAMHE4ZNWC6G.pdf\",\"documents\\/01K09VYXEKD0364XTR57TGW146.pdf\"]', '[\"documents\\/01K09VYXEPRB56SPFR747BR0TP.pdf\"]', 'Unemployed', 'I have applied for the job because I love working with children since I have worked with them for the past 3 years under young heroes. I dedicate myself when doing work and I am a fast learner.  I am able to work under pressure ', 'Yes', 'Young heroes', 'I was doing home visits, working with children from 0 to 20 years. Visiting them once a month and talk about certain topics mostly about HIV prevention and many more. Encourage young ones who are on art to take their pills on time and be there for emotional support. We also supported them with school uniforms, school fees and help those who have experienced gender base violence. Encourage parents about the importance of taking their children to clinic for immunisations.', 'Yes', NULL, '2025-07-16 11:37:57', '2025-07-16 18:59:31'),
(187, 637, '[\"documents\\/01K092YCVAEFXRRK37G8SXZ3AJ.jpg\",\"documents\\/01K092YCVD6415PP7W78NAKKA4.jpg\"]', '[\"documents\\/01K092YCVZ09ZPET8M74HFP31T.pdf\"]', 'Unemployed', 'I am so passionate about helping the youth especially the adolescents to achieve their goals. As a final year Psychology student at Eswatini Medical Christian University I wish to help the youth with their mental health issues that may hinder them from performing up to their full potential and I will apply the knowledge that I have attained from psychology such as developmental psychology. I will also help them on how to integrate with their social environment using the knowledge from sociology as well as community psychology so that they know what others expect from them in the society including their moral behaviour.', 'Yes', 'Taiwan Fund for Children and Families, Cebolenkhosi Mtsetfwa Foundation ', 'At Taiwan Fund for Children and Families I was a peer mentor for the Secondary and high school grades. At Cebolenkhosi Mtsetfwa Foundation I was the personal assistant of the founder of the organisation.', 'Yes', NULL, '2025-07-16 11:42:20', '2025-07-16 11:42:20'),
(188, 638, '[\"documents\\/01K093TAQ4VNPQ6T55T6NNMB7K.jpg\",\"documents\\/01K093TAQ8SKF3C6PDPW43QXKP.jpg\"]', '[\"documents\\/01K093TAQCR3RGSGNRVE0HK43P.jpg\",\"documents\\/01K093TAQE69BT6EDVWQD199FW.jpg\"]', 'Unemployed', 'With my vast experience with working with young people I think am the best candidate for this position.I applied for this postbecause am passionate about young people, their well being and all the the staff. In my community Lwandle chiefdom am the leader for young people who I represent at my constituency being Mtfongwaneni Inkhundla.I am a reliable person.I can work with people from different walks of life meaning I easily adapt to any environment. With my good communication skills and leadership skills I foresee myself as the best candidate.\n\nWith my vast experience with working with young people I think am the best candidate for this position.I applied for this postbecause am passionate about young people, their well being and all the the staff. In my community Lwandle chiefdom am the leader for young people who I represent at my constituency being Mtfongwaneni Inkhundla.I am a reliable person.I can work with people from different walks of life meaning I easily adapt to any environment. With my good communication skills and leadership skills I foresee myself as the best candidate.\n\n', 'Yes', 'Family Life Association of Swaziland (FLAS) under the Youth Action Movement (YAM))', 'I was a peer educator teaching young people on Sexual Reproductive Healthy Rights(SRHR) including Comprehensive Sexual Education (CSE) when I was at FLAS. With the vast experience in working with young people I became a role model in my community.I used to distribute condoms and CSE material to young people,also helping them with mental health issues. I joined the Youth Action Movement in 2017 so with the vast experience with working with young people I think am suitable for the post mentioned above.', 'Yes', NULL, '2025-07-16 11:57:35', '2025-07-16 11:57:35'),
(189, 639, '[\"documents\\/01K093W5GE0RYV9QQE8P8BK4TG.pdf\"]', '[\"documents\\/01K093W5GGP5EA53M1B449M8YM.pdf\"]', 'Unemployed', 'Growing up, I witnessed how young people often struggle silently with issues such as mental health, substance abuse, sexuality, peer pressure, and academic stress—mainly because they don’t feel comfortable talking to adults or professionals. They often prefer to speak to someone their own age, someone who understands the challenges they are facing. That is why peer educators are so important. They are not only educators but also role models, support systems, and safe spaces. I want to become that person for others.\nI am applying for this training because I believe I have the qualities, mindset, and drive needed to be an effective peer educator. I am empathetic, a good listener, and naturally approachable. People often come to me for advice or comfort because I create a judgment-free atmosphere. I respect people’s feelings and confidentiality. I believe that listening is sometimes more powerful than speaking, and that understanding someone’s situation without criticizing it is the first step toward helping them.', 'No', 'No', 'I always pride myself in creating a safe space for teenagers make them feel comfortable to talk to me with regards to everything, probably because I was never given that platform.I guess thats why I has my child at the age of 17 .This year I managed to talk some form 2 girl into not aborting a child .And I always make sure to always preach about contraceptives when ever I have a talk with them.', 'Yes', NULL, '2025-07-16 11:58:35', '2025-07-16 11:58:35'),
(190, 640, '[\"documents\\/01K093ZCH5V0XQ44EA9RCDN01T.pdf\"]', '[\"documents\\/01K093ZCHAT3FG2K0PM3RA0KAH.pdf\"]', 'Unemployed', 'I have applied for the ENYC Youth Training Programme because I believe it offers an important opportunity to build practical skills, gain professional guidance, and contribute meaningfully to my community. I recently completed my degree in Consumer Science Education at the University of Eswatini and will be graduating this year. While my academic journey equipped me with knowledge in education, entrepreneurship, and community development, I am eager to gain hands-on experience, expand my skills, and become more employable and self-reliant.\nI believe I am a strong candidate for this programme because I am committed, self-driven, and eager to grow. My university experience taught me to be disciplined, responsible, and goal-oriented. I am ready to apply myself fully, not only for personal development but also to become a resource to others. I am also a team player, a good communicator, and someone who works well under pressure. These qualities, combined with my academic background and passion for youth development, make me a suitable fit for this programme.\n', 'No', 'None ', 'None ', 'Yes', NULL, '2025-07-16 12:00:21', '2025-07-16 12:00:21'),
(191, 641, '[\"documents\\/01K0942A9PFMW7W45HQEFS1T78.pdf\"]', '[\"documents\\/01K0942A9TSQ3PADDMWEEFSA2J.pdf\",\"documents\\/01K0942A9WMEQX9PWXE2JX05A0.pdf\"]', 'Self-Employed', 'I applied because I am self-employed and I enjoy working with young people, as I am a young person myself. I make and sell detergents, so I have a lot of time on my hands as I make my products once in a while. I like giving back to the community and I see this a perfect way to do that while doing what I love. I have a great understanding of young people and inclusivity while working with different people. I believe I am a perfect candidate for this job because I have great experience working with young people and adults in different environments. ', 'Yes', 'The Ministry of Agriculture ', 'I worked as a Home Economics Extension Officer, where I was working with unemployed young people and women in different communities in the Shiselweni region under The Ministry of Agriculture. I was equipping them with knowledge and skills on income-generating activities and helped them participate in workshops where different organizations would donate equipment like peanut butter machines, and educate them on how they can work with retail shops to sell the products.', 'No', NULL, '2025-07-16 12:01:57', '2025-07-16 12:01:57'),
(192, 642, '[\"documents\\/01K0943QMNRGNS596XKTQN08MJ.pdf\"]', '[\"documents\\/01K0943QMZSXE2A5Z4K1XRD0QX.pdf\"]', 'Unemployed', 'I am passionate about sharing necessary information and items to areas or people that need it. I am the best candidate for the job because I work hard and I am passionate.', 'Yes', 'Lend a hand Charity Organization ', 'Assisted tertiary students from poor financial backgrounds with breakfast meals, groceries and accommodation especially in their first year without an allowance.', 'Yes', NULL, '2025-07-16 12:02:43', '2025-07-16 12:02:43'),
(193, 643, '[\"documents\\/01K0946VSKJYSPSD8WD16AATYV.pdf\"]', '[\"documents\\/01K0946VSSWS7V6CZBGWZVS18V.pdf\"]', 'Self-Employed', 'I believe I’m the perfect candidate because I am open-minded, eager to learn, and ready to grow. I’m passionate about improving myself, and I know this programme will help me develop a strong, positive mindset. I want to be surrounded by other young people who are focused, motivated, and aiming for success. I believe this is a great opportunity for me to gain skills, confidence, and the right mindset to overcome challenges and build a better future.\n', 'No', NULL, 'I’ve helped young people by encouraging them to believe in themselves and stay focused on their goals. I give advice, listen when they need someone to talk to, and share positive messages that inspire them. I’ve also supported friends and younger people around me by helping them with schoolwork, job applications, and staying away from bad influences. I believe even small acts of support can make a big difference.\n', 'No', NULL, '2025-07-16 12:04:26', '2025-07-16 12:04:26'),
(194, 644, '[\"documents\\/01K094J1FQV4YJZDP6FWWBHMZK.pdf\",\"documents\\/01K094J1FSTPSVRYVGHFS4PHHZ.pdf\"]', '[\"documents\\/01K094J1FX2365C7RH8X69CZKW.pdf\"]', 'Unemployed', 'The reason I have applied for this job, am really passionate to motivation the you of my community. How they can deal with life in this cruel world. Equip them with business ideas since I am running a perfume business as an unemployed graduate. I am the best candidate because , I have business skills, and graduate in Business Management.', 'Yes', 'Young Hereos', 'I was a member of Young Hereos, participating on the youth classes, learning how to take care of yourself as Young person.', 'Yes', NULL, '2025-07-16 12:10:32', '2025-07-16 12:10:32'),
(195, 645, '[\"documents\\/01K094MQQBHVJAZXY9CD7FJ8WX.pdf\",\"documents\\/01K094MQQER5AB20Y7RMPGB5TK.pdf\"]', '[\"documents\\/01K094MQQHRZ1F0CAJ50FEXMYE.pdf\"]', 'Unemployed', 'My entire four year course has help me become an active member of the society. For instance my institution held campaigns which I was part of ,where I took the responsibility to teach the youth and the elders about STI\'s and antibiotic resistance. ', 'Yes', 'Enactus ', 'Empowering colleagues to be self motivated and engage them self onto activities that are focused on education of those lacking knowledge about certain things ', 'Yes', NULL, '2025-07-16 12:12:00', '2025-07-16 12:12:00');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(196, 646, '[\"documents\\/01K095A96R0YM3JT3QE197FPNF.jpg\"]', '[\"documents\\/01K095A96WHT8E8KZKHSBAWZ3D.png\"]', 'Unemployed', 'I have applied for this role as a Mindset Change Trainer because I am deeply passionate about empowering individuals and fostering positive growth within my community. My time as a student and my experiences, both academic and personal, have shown me the profound impact that a positive mindset can have on overcoming challenges and achieving potential.\n\nI believe that many of the issues we face in our community can be significantly addressed by shifting perspectives, building resilience, and cultivating a growth-oriented approach. I am particularly drawn to the opportunity to train others in these critical mindset principles because I understand that true, sustainable change often comes from within. I want to be a catalyst for that internal shift.', 'No', 'none', 'none', 'Yes', NULL, '2025-07-16 12:23:46', '2025-07-16 12:23:46'),
(197, 647, '[\"documents\\/01K095DDMJA3E8J7EZNR3FARAK.jpg\"]', '[\"documents\\/01K095DDMPWDVD4EP53H4QWNPK.pdf\"]', 'Employed', 'I\'m one person who prioritises mental health.I believe every young person out there deserves a free mind.I am also young so I believe they\'ll be free to talk without the fear of being judged.I aslo practice confidentiality at it best', 'No', 'None', 'None', 'No', NULL, '2025-07-16 12:25:29', '2025-07-16 12:25:29'),
(198, 648, '[\"documents\\/01K095K3M09EB2A2SWARNV1B10.pdf\",\"documents\\/01K095K3M16JSJYRYY10WH9VJ8.pdf\",\"documents\\/01K0BK2MY0GSSPKDZJEF8QCHKN.pdf\"]', '[\"documents\\/01K095K3M3MXBV28YDKKYJ1K2E.pdf\",\"documents\\/01K095K3MDG1S3W9RDVRCVT2KA.pdf\"]', 'Unemployed', 'I applied because I have a deep commitment to personal growth and empowerment. This role allows me to work directly with individuals seeking to improve their mindset, which aligns perfectly with my passion and I have a deep commitment to personal growth and empowerment. This role allows me to work directly with individuals seeking to improve their mindset, which aligns perfectly with my passion.\nI am the best candidate because I have an experience in personal development and training, where I have successfully facilitated workshops and coaching sessions focused on mindset transformation.\nI also have strong communication skills, I  excel in creating an open and engaging environment that encourages participants to share their thoughts and experiences, fostering a collaborative learning atmosphere.\nI am committed to my own personal and professional development. I regularly pursue certifications and attend workshops to stay updated on the latest trends and techniques in mindset training.\nI also have genuine passion for helping others achieve their potential drives me to create impactful programs. I believe that with the right mindset, anyone can overcome obstacles and succeed.\nLastly, alignment with Organizational values, I resonate strongly with ENYC\'s mission and values, and I am excited about the opportunity to contribute to your initiatives and help others transform their lives.\nBy combining these strengths, I am confident that I can make a meaningful contribution as a Mindset Change Trainer.', 'Yes', 'King Sobhuza II PHU', 'I was doing health education about STIs and worked with NTCP and Ministry of Health educating the community and finding the challenges they encounter ', 'No', NULL, '2025-07-16 12:28:35', '2025-07-17 11:02:45'),
(199, 649, '[\"documents\\/01K095NZXSYGABDXAEYE663PQP.pdf\"]', '[\"documents\\/01K095NZXXM10SN57GYBNJRMT0.pdf\"]', 'Unemployed', 'Firstly, I am a team player I work well with people, especially young people and I have a vast interest in youth services. I am even considering taking a course on psychology, so that I can be equipped on how they think based on how they differ from each other. At univessity I did a courses on teaching principles which greatly equipped me with public speaking and on how to manage effectively a group of people. Also, I am teachable and also a good listener who can easily adopt teachings from trainings and impart to the youth. Lastly, I am a focused person with good personality, therefore I can be influential and examplery to the youth.', 'Yes', 'School, Mayiwane High School ', 'I was doing my teaching practice, then I partaked in some of their guidance and counselling lessons, providing some lessons about puberty and their developmental stages', 'Yes', NULL, '2025-07-16 12:30:10', '2025-07-16 12:30:10'),
(200, 650, '[\"documents\\/01K095PKDA20G19S5T6TRZCVTZ.jpg\",\"documents\\/01K095PKDDN64N7MTXC7BE2Q6H.jpg\"]', '[\"documents\\/01K095PKDQ0S53MMCRQVTE9HG3.pdf\"]', 'Self-Employed', 'I\'ve applied to be a peer educator because I\'m deeply committed to empowering individuals within our community here in Eswatini. I believe that by sharing knowledge and fostering open dialogue, we can collectively address challenges and build a stronger, more informed populace. My passion for this role stems from a genuine desire to see my neighbors thrive, equipped with the practical information they need to make sound decisions for themselves and their families.\nMy experience running and operating my own successful business makes me an ideal candidate for this position. Business ownership has honed my communication and presentation skills, allowing me to clearly articulate complex ideas in an understandable and engaging way – a crucial asset when educating my peers. I\'ve also cultivated strong organizational and planning abilities, essential for structuring effective educational sessions and managing resources efficiently.\nFurthermore, my entrepreneurial journey has ingrained in me a robust capacity for problem-solving and adaptability. Every business faces hurdles, and I\'ve learned to identify issues, think critically, and devise practical solutions on the fly. This translates directly to being able to address diverse questions and challenges that may arise during peer education. My role as a business owner has also fostered significant leadership and influence, allowing me to guide discussions and encourage active participation. The reliability and accountability required to run a successful venture mean I am committed to delivering on promises and earning the trust of those I interact with. I am also inherently resourceful, accustomed to taking initiative and finding creative solutions, which will be invaluable in developing engaging and impactful educational materials. Finally, operating within this community has given me an intimate understanding of its dynamics and needs, ensuring that my educational efforts will be highly relevant and impactful. My proven track record of success and credibility within the community will also foster greater trust and receptiveness from those I aim to educate.\n', 'No', 'No', 'None', 'Yes', NULL, '2025-07-16 12:30:30', '2025-07-16 12:30:30'),
(201, 651, '[\"documents\\/01K095QS27FMKFMACAAJWCF42N.jpg\",\"documents\\/01K095QS2AZNRMX945F7BXB97V.jpg\",\"documents\\/01K095QS2CC2S50BCVMV9Q82WM.jpg\"]', '[\"documents\\/01K095QS2EZFW8R233091AKKSW.jpg\",\"documents\\/01K095QS2GV88WFG4T6N4NYF93.jpg\"]', 'Unemployed', 'I am applying for this job because I am a driven individual who works under pressure as well as minimal supervision.I want to work close with the young people in my community so that they can change their minds thinking twice when doing things and I want to be their mentor and a role model to them .Also  I want to gain more experience and to improve my skills as I am a well dedicated person. ', 'Yes', 'Khulisa Umntfwana,Bantwana Initiatives,Young Heroes and World Vision Eswatini', 'Identifying orphaned and vulnerable children in the community and administer a child well-being assessment to establish extent of vulnerability including the overall household socio-economic vulnerability. Mobilisation of adolescent girls in the community for AGYW establishment and implementation. Development of work plans,development of health services provision schedules and implementation of activities based on work plans.Provision of relevant knowledge on HIV and sexuality knowledge to adolescent girls and young women;enabling them to explore and question their own attitudes towards HIV,relationships, sexual practices,gender norms.Doing health service referrals,liasis with health service providers such as local clinics and mobile clinics offerd by local partners including issuing of health service referrals and follow up on referrals made to ensure access to services.Data management;data collection, management and reporting on HIV prevention interventions and session activities using online mobile.', 'Yes', NULL, '2025-07-16 12:31:08', '2025-07-16 12:31:08'),
(202, 652, '[\"documents\\/01K095SYMTR7T3JMQZFDWZPFWK.pdf\"]', '[\"documents\\/01K095SYN1YB6TH7NBJ9X8BJZ9.pdf\"]', 'Self-Employed', 'I believe in impacting the life of the youth in being an instrumental tool to people\'s lives because I was also influenced by someone to be who I am today.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 12:32:20', '2025-07-16 12:32:20'),
(203, 653, '[\"documents\\/01K095Y4R3AT4YNYB98X1Y3PJP.jpg\"]', '[\"documents\\/01K095Y4R62YQ484JKZ4RAH9N1.jpg\"]', 'Unemployed', 'Applying for this job, I\'ll like to acquire more skills and sharpens my knowledge in everything happening in the country towards our youth and be able to help them or sometimes council them to take good decisions in life, as we all know that our youth normally tends to commit suicide due to the fact that they lake much support on their oppression that overcomes them.', 'Yes', 'Junior Achievement Company ', 'We were making mats using old car tires for car bakkies and for homestead. We sold them and with the money we got we were helping other students at school who are in needy of uniforms. ', 'Yes', NULL, '2025-07-16 12:34:37', '2025-07-16 12:34:37'),
(204, 654, '[\"documents\\/01K0963PGY44M6CEHTDMFE2SVH.pdf\"]', '[\"documents\\/01K0963PHAP8GNXTA0RWT9WEQW.pdf\"]', 'Unemployed', 'As a social work student, I am applying for the job because it directly aligns with my core values and professional aspirations. My dedication to empowering communities and fostering positive social change is what drew me to social work in the first place, and this program offers a unique opportunity to apply those principles in a tangible and impactful way. My application for the Youth Mindset Change Trainer Programme is not merely a pursuit of an opportunity. The chance to empower young people across Tinkhundla of Eswatini, facilitating mindset change sessions on a volunteer basis, resonates deeply with my commitment to community development, social justice, and the holistic well-being of individuals. I am not just applying; I am stepping forward with conviction, believing that my unique blend of academic grounding, practical skills, and unwavering passion makes me the best candidate for this vital role.\nMy journey into social work was ignited by a desire to understand and address the multifaceted challenges that individuals and communities face. My academic curriculum has provided me with a robust theoretical framework directly applicable to the objectives of this program. I possess a comprehensive understanding of human growth and development, particularly the critical developmental stages of adolescents and young adults. This knowledge is crucial for appreciating the unique cognitive, emotional, and social factors that influence their mindsets, allowing me to tailor approaches that are both age-appropriate and impactful. Furthermore, my studies in community development theories have instilled in me the understanding that sustainable change is an organic process, nurtured from within communities through collaborative and participatory approaches – a philosophy perfectly mirrored by this volunteer initiative. I have also rigorously studied group dynamics and facilitation techniques, equipping me with the skills to design and lead engaging, inclusive, and thought-provoking sessions. I can effectively manage group discussions, encourage active participation, navigate disagreements constructively, and ensure that every voice is heard and valued, fostering an environment conducive to learning and transformation.\nBeyond theoretical knowledge, my social work education has placed a strong emphasis on cultivating practical skills essential for direct engagement and positive influence. I am proficient in active listening, a foundational skill that enables me to truly comprehend the diverse perspectives, concerns, and aspirations of young people. This allows me to adapt my communication and messaging to resonate authentically with their lived experiences. My training extends to highly effective communication strategies, encompassing both verbal and non-verbal cues, which are instrumental in building rapid rapport and establishing a foundation of trust. In the sensitive context of mindset change, this ability to create a safe and non-judgmental space is paramount. While not a therapist, my exposure to basic counseling skills provides me with the sensitivity and tools to respond empathetically to potential emotional responses or disclosures during sessions, ensuring a supportive and protective environment for participants. Crucially, my ability to adapt my communication style to various age groups, educational backgrounds, and the rich tapestry of cultural contexts within Eswatini ensures that the message of mindset change is not only understood but truly internalized across the nation.\nMy decision to apply is fundamentally driven by a deep-seated commitment to the very essence of this program. The voluntary nature of the Youth Mindset Change Trainer Programme is not a hurdle; it is a profound source of motivation. As a social work student, I firmly believe that genuine societal progress is often fueled by selfless dedication and a willingness to invest in the well-being of others without expectation of immediate material gain. My passion lies in contributing to a vibrant and resilient Eswatini, and I see this program as a direct, powerful avenue to actualize that vision. I am not merely seeking an addition to my resume; I am seeking to actively contribute to a cause that aligns perfectly with my personal and professional ethos. My intrinsic drive to empower young people to cultivate growth mindsets, overcome adversity, and envision brighter futures for themselves and their communities is unwavering.\nFurthermore, my understanding of the unique socio-cultural landscape of Eswatini is an invaluable asset. While academic knowledge provides a universal framework, effectively navigating the specific nuances of different communities, cultural sensitivities, and prevailing social norms is critical for impactful engagement. I am committed to continuously deepening my understanding of the specific challenges, dreams, and aspirations of young people across Eswatini\'s 59 Tinkhundla, ensuring that the mindset change sessions are not generic but deeply relevant, culturally appropriate, and truly resonate with their realities. I also fully grasp the importance of being \"respected and trusted in the community,\" a key requirement of this role. My approach will always be one of humility, unwavering respect, and a genuine desire to serve, fostering trust organically through consistent ethical conduct, transparent communication, and an authentic commitment to the well-being of the participants.\nFinally, my commitment extends unequivocally to both the entire training sessions and the subsequent dedication required for the volunteer work. I am a diligent, disciplined, and highly motivated individual who understands that thorough preparation, consistent engagement, and a continuous learning mindset are non-negotiable for the success of such a vital program. I am eager to fully immerse myself in all the knowledge and skills imparted during the trainer program, relentlessly refining my abilities to become the most effective and inspiring facilitator possible. My profound drive to make a tangible, positive difference in the lives of Eswatini\'s youth, coupled with my robust academic foundation, honed practical skills, cultural sensitivity, and unwavering commitment to the program\'s transformative vision, positions me as the ideal candidate to inspire and empower the next generation. I am ready to dedicate my time, energy, and heartfelt passion to this crucial initiative, confident that I will be a significant asset to the Youth Mindset Change Trainer Programme.', 'No', 'None ', 'None ', 'Yes', NULL, '2025-07-16 12:37:39', '2025-07-16 12:37:39'),
(205, 655, '[\"documents\\/01K096B2VW2PBEVRKR1DK20J9Y.pdf\",\"documents\\/01K096B2VYC8WTGMD1PMXQCY8S.pdf\",\"documents\\/01K096B2W0XSJ2XABFDNTQJRVB.pdf\"]', '[\"documents\\/01K096B2W33JT1C6QFEQTF49Q5.pdf\"]', 'Unemployed', 'I believe I am the right person for this programme because I am optimistic, compassionate, thoughtful, and ambitious. I get along well with people from all walks of life, and I enjoy helping others grow. I care deeply about young people and feel called to make a positive difference in their lives. My motto is to treat others the way I want to be treated, and I believe this attitude will help me inspire and guide the youth to change their mindset for the better.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 12:41:41', '2025-07-16 12:41:41'),
(206, 656, '[\"documents\\/01K096D8TMPWQ98V6ZVXSFMNQZ.pdf\"]', '[\"documents\\/01K096D8TQNKNNA9345WRBS00Q.pdf\",\"documents\\/01K096D8TTQTE6XV9BBV4PZSXN.pdf\"]', 'Unemployed', 'I have applied for the job  because I am passionate about empowering young people and eager to use my voice to inspire them to make  informed decisions about their health and well-being. Through my previous work with SWAGAA, Save the Children, Georgetown University, and currently with SAFAIDS, I have gained valuable experience in mentoring, community engagement, and delivering sexual and reproductive health education. \n\nI believe I am the best candidate for this job because I already have excellent experience working with the youth in communities. I understand their challenges and  I have built strong relationships with them .I can exceptionally work with diverse individuals without discrimination.\n\n I am ready to train and  reach more young people with accurate, youth-friendly information in the community. I am looking forward to learn, share, and serve.', 'Yes', 'SAVE THE CHILDREN, GEORGE TOWN UNIVERSITY,SWAGAA', 'I have consistently worked to uplift and support adolescents through mentorship, education, and advocacy. In 2019 I was a Young Girl\'s Mentor with SWAGAA, where I provided emotional support and life skills to young girls, helping them build self-confidence, set goals, and understand their rights. I facilitated group sessions focusing on gender-based violence and  teenage pregnancy prevention.From 2020 to 2021, I served as a Change Agent in Communities with Save the Children. In this role, I actively engaged young people in rural areas, raising awareness about sexual and reproductive health, HIV prevention, and child protection services. I organized dialogues and peer learning spaces where youth could share their experiences and learn in a safe and respectful environment.\n\nFrom 2022 to 2024, I took on the role of an Adolescent Girls and Young Women Peer Navigator under Georgetown University. I supported girls and young women in accessing youth-friendly health at Lomahasha clinic,services such as PrEP, HIV testing, and contraceptives. I also helped link them to education and empowerment programs while tracking their progress through follow-ups. \n\nCurrently, I serve as a SAM4SRHR Champion with SAFAIDS, where I continue to advocate for sexual and reproductive health and rights. I educate young people on mental health and SRHR.', 'Yes', NULL, '2025-07-16 12:42:53', '2025-07-16 12:42:53'),
(207, 657, '[\"documents\\/01K096M0BR4DHKRDNMANQFW9TS.jpg\"]', '[\"documents\\/01K096M0BW3B7JB5DYDDGEAN2J.pdf\"]', 'Unemployed', 'I\'m a young energetic person who is willing to change her life and willing to help others to change theirs. I am will to educate people especially the youth the ways of improving their lives in my society. I am fast learner and also a passionate person. I am also willing to provide information required in to change the mindset of the youth towards a better future.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 12:46:33', '2025-07-16 12:46:33'),
(208, 658, '[\"documents\\/01K096SG6RMWYWE5TWVNJKH4QP.pdf\"]', '[\"documents\\/01K096SG6VKNKRANH49HQYTGQ9.pdf\"]', 'Unemployed', 'I am passionate about young people and I feel like the more we work on young people the more the economy of the country will gain since young peoplehave sharp minds. I am the best candidate for the job because I have worked with young people many times and I have positively impacted their lives in previous years through counselling and mentoring, so I feel and know that my presence in the youth team leadership can benefit quite a number of more young people in the Kingdom of Eswatini.', 'Yes', 'Eswatini Professional Counselors Association ', 'Through psychological counselling by providing them with counselling and through mentoring them on becoming self sufficient when they grow up.', 'Yes', NULL, '2025-07-16 12:49:33', '2025-07-16 12:49:33'),
(209, 659, '[\"documents\\/01K096WFSBK373SK1F8B8D0JKZ.jpg\",\"documents\\/01K096WFSQFF8DJN4EG7P44F8W.jpg\",\"documents\\/01K096WFT3D4G9K641ZNQ6E80P.jpg\"]', '[\"documents\\/01K096WFT6S6MQE8Z8SDY5101R.pdf\"]', 'Unemployed', 'With a solid foundation in community development, youth mentorship, and health education, I bring not only relevant experience but also a deep passion for uplifting communities through peer-led engagement and empowerment. I believe I am the best candidate for this role because of my unique combination of education, hands-on experience, communication skills, and an unwavering commitment to helping others.\n\nI am currently pursuing Level 5 in Professional Community Development at the Mananga Centre for Regional Integration and Management, where I am learning about participatory development, community mobilization, leadership, and sustainable social change. This program is enhancing my ability to design and implement effective community programs that truly respond to the needs of vulnerable populations.\n\nOver the years, I have gained practical experience through volunteering and working with various organizations focused on health, education, and youth empowerment:\n\nAt Lusweti Organisation, I played an active role in community outreach initiatives, health promotion campaigns, and youth-focused programs. I participated in workshops, helped coordinate awareness events, and supported vulnerable youth in accessing vital services and resources.\n\nI am currently a Peer Educator with Amiccall Organisation, where I facilitate youth dialogues on sexual and reproductive health, HIV prevention, gender-based violence, and life skills. I also provide mentorship and emotional support to adolescents, empowering them to make informed and healthy life choices. This role has strengthened my ability to communicate with compassion, maintain confidentiality, and serve as a relatable and trustworthy role model.\n\nIn addition to my volunteer and community work, I run a small perfume business, which has taught me self-discipline, leadership, financial responsibility, and how to inspire other young women to pursue entrepreneurship and economic independence.\n\n\nMy experience has given me a deep understanding of the challenges faced by youth in Eswatini, especially those related to poverty, lack of information, peer pressure, gender inequality, and limited access to health services. As a Peer Educator, I have learned to approach these challenges with empathy, patience, and a solutions-focused mindset. I understand that peer education is not just about giving information—it\'s about building trust, leading by example, and inspiring positive behavioral change.\n\nWhat sets me apart as a candidate is my real-life experience working at the grassroots level, my ongoing professional training, and my ability to connect with young people from diverse backgrounds. I am a great listener, a confident speaker, and a passionate community advocate. I am also a fast learner, a team player, and someone who can be relied upon to handle responsibilities with maturity and dedication.\n\nBeing chosen for this position would not only allow me to contribute meaningfully to your programs, but it would also help me grow as a community leader and educator. I am committed to using my voice, skills, and experiences to promote awareness, educate others, and build stronger, healthier communities.\n\n', 'Yes', 'Lusweti Organisation ,Amiccall ', 'As a Peer Educator, my main goal would be to guide, support, and empower young people to make healthy, informed, and positive choices in their lives. I believe young people need someone they can relate to, talk to freely, and trust—someone who listens and understands what they’re going through.\n\nHere’s what I would do to help young people:\n\n1. Provide Education on Key Life Topics\nI would lead peer sessions and school/community discussions about:\n\n\n\nSexual and reproductive health\n\nHIV/AIDS and STI prevention\n\nSubstance abuse\n\nMental health and emotional well-being\n\nGender-based violence and healthy relationships\n\n\nThese topics are often ignored at home or school, but they are crucial to a young person’s growth and safety.\n\n\n---\n\n2. Be a Role Model and Peer Mentor\nI would lead by example—showing other youth that they can rise above peer pressure, stay focused, and build a better future. Through my own life, volunteering journey, and current studies in Community Development at Mananga, I would encourage them to stay in school, seek opportunities and believe in themselves \n3. Link them with services and opportunities for example clinic,support groups, education and counselling ', 'Yes', NULL, '2025-07-16 12:51:11', '2025-07-16 12:51:11'),
(210, 660, '[\"documents\\/01K0970HQY30FPMAE2KSAGAJHB.pdf\"]', '[\"documents\\/01K0970HRG1JBG762P94FRP173.pdf\"]', 'Unemployed', 'I have worked with youth and passionate in improvement of eswatini livelihoods especially the youth. Also i have good communication skills which are very important in this job. ', 'Yes', 'Bantwana Initiative ', 'I was a livelihoods intern, where i worked with young women between the ages of 15 to 30 on improving their livelihoods through financial independence. We advocated that the women should start up new businesses then we supported them with buying the capital inputs through aid from USAID and mentored the young women on business development. ', 'Yes', NULL, '2025-07-16 12:53:24', '2025-07-16 12:53:24'),
(211, 661, '[\"documents\\/01K0972B87WRS0VPWE9W3A8MBQ.pdf\"]', '[\"documents\\/01K0972B897VB2MH2HME07F5N5.pdf\"]', 'Unemployed', 'During my undergrad i undertook courses that deals with human behaviour like psychological, social sociology and as well as leadership management. I can easily interact with people and i quickly adapt in a new environment and public speaking I\'m very good at it.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 12:54:23', '2025-07-16 12:54:23'),
(212, 662, '[\"documents\\/01K0975SGEMXHH87RWH9MNQ6Y0.jpg\",\"documents\\/01K0975SGHTVG0E8MNASWT0MV9.jpg\"]', '[\"documents\\/01K0975SGSV9N0M15TW9T8ZM04.pdf\"]', 'Unemployed', 'I am a perfect candidate for this job because I believe that young people still have a chance to rewrite their stories again especially in my area of residence. Young people need to also realize that being uneducated is not the end of the world and there is a beginning in everything in life. I see myself helping young people with participation to tinkhundla meetings as also their voices matter in teaching them on their human rights and so forth.', 'Yes', 'AWPDF (African Women Peace and Development Foundation)', 'As I was volunteering  in the organization as a youth representative, I was teaching young people that all hope is not lost as the organization is all about peace building and conflict resolution but also a remainder that peace always goes with development. As young people we are going through a lot of problems of facing unemployment and lack of skills that are needed in this world, most tend to do things that they never thought they would just to survive but leave the aspect of peace behind. My role was to instill peace within young people and tell them that there is hope and it\'s not too late to start again and also start their own business based on peace and development.', 'Yes', NULL, '2025-07-16 12:56:16', '2025-07-16 12:56:16'),
(213, 663, '[\"documents\\/01K097HQEBENEY3DXDGXKRVA23.jpg\"]', '[\"documents\\/01K097HQEJA95BQDR4SWP0640Y.pdf\"]', 'Unemployed', 'I am the best candidate because i bring a proven track record of achieving results in working hand in hand with people at community level since my responsibility as an enumarator at my previous work experience was to work with them.\nI am also confident that my skills and ability will contribute and this position will motivate me to perform best', 'No', 'none', 'none', 'Yes', NULL, '2025-07-16 13:02:47', '2025-07-16 13:02:47'),
(214, 664, '[\"documents\\/01K097K9N9WES95S0FPZJ7Z908.jpg\"]', '[\"documents\\/01K097K9NXY2CDBSF7DXGSSW3Y.jpg\"]', 'Unemployed', 'Young and energetic boy who is flexible and like to work with young people to depend on themselves and develop community.....(currently a volunteer on NDMA)', 'Yes', 'Fhi360 ', 'Working as peer educators....on community based development and even temporal teaching at Herefords primary school......', 'Yes', NULL, '2025-07-16 13:03:39', '2025-07-16 13:03:39'),
(215, 665, '[\"documents\\/01K097NNWCM4R79C1WEBY8YTCC.jpg\"]', '[\"documents\\/01K097NNWWXHMESCF0QMB5Y5ZJ.pdf\"]', 'Unemployed', 'As a young person myself, i  understand the challenges, pressures, and mindset blocks that today\'s youth face , making me uniquely positioned to connect with and relate to program participant. My passion for reading and continuous self-development demonstrates not only my commitment to personal growth but also my ability to guide young people on their own transformational journeys.   ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 13:04:57', '2025-07-16 13:04:57'),
(216, 666, '[\"documents\\/01K097XDQTHT8FF2VXMC18NGB5.jpg\"]', '[\"documents\\/01K097XDQX8SSPG0KJ8ECWYC9E.jpg\"]', 'Unemployed', 'For about 4 years now I have dedicated myself volunteering in my community and some NGOs for the youth and Change that I believe is brought to us through knowledge and awareness. I am a dedicated , passionate, committed, respectful young person ,if given this chance which i understand will not only change my life but also the lives of the youth I my community  .I have also grew from this inkhundla, hence I understand and know most about my community and the youth around .I have also made a good name for  myself both the elders and youth , I\'m to be trusted and active and willing to learn and unlearn,work .Therefore I also believe  I\'m the right person and would be grateful for this opportunity. ', 'Yes', 'Church Forum on HIV/AIDS,MEN ENGAGE ESWATINI', 'I have worked with young people since 2019 , when I join Church Forum eswatini . We were peer educators drained to raise awareness to our fellow age mates in church  about main problems that destroy and impacts  negativity and positively in a person\'s our age (youth). We engage them through topic such as SRHR,Drug abuse ,Responsibilities, HIV/AIDS,  .Positively we engage others through  business and personal development and growth topic , saving and Money literacy.  This was an amazing time as we move between communities and Church transforming and sharing the little knowledge we had knowing lives would be changed  and the lives and numbers of youth will change to better .', 'Yes', NULL, '2025-07-16 13:09:11', '2025-07-16 13:09:11'),
(217, 667, '[\"documents\\/01K0983GJYJ0Q4PS5F71VHGX8C.jpg\",\"documents\\/01K0983GK0DMWADJ0ME90VHRY5.jpg\",\"documents\\/01K0CAAPXPE2DZKS2Q7FRCWX08.pdf\"]', '[\"documents\\/01K0983GK11ZXPX0NSWK1FDKKP.pdf\"]', 'Unemployed', 'I applied for this job to gain more experience with working with people since I am a public relations student at Limkokwing University of Creative Technology doing my third year.. This is an opportunity for me to learn and challenge myself. I believe I am the best candidate for this job because I am a young person which means I understand the issues and stages that young people go through and I have experiential knowledge on them. I am well versed in communication and dealing with people in general. I am also an open and bubbly person and I believe young people will relate and communicate with me easily.', 'Yes', 'Bawss foundation ', 'In the organization we have hosted events in primary schools and high school to educate young people on menstrual health and donate sanitary pads to underprivileged girls', 'Yes', NULL, '2025-07-16 13:12:30', '2025-07-17 17:54:16'),
(218, 668, '[\"documents\\/01K09864N385BNTX2FQSRPG3TR.jpg\"]', '[\"documents\\/01K09864NDHKGVA30QH9DMAZEQ.pdf\"]', 'Employed', 'I applied for the peer educator position because I am passionate about youth empowerment, health education as well as community development. I believe that meangful change begins with informed individuals and peer education is one of the most effective ways to promote knowledge, positive behavior and personal growth especially among young people. This role aligns perfectly with my duties and responsibilities as a health promotions officer and I am excited about the opportunity to contribute to a program that supports awareness, prevention and community development.\n\nMoreover, I am the best candidate for the position because I bring a combination of personal experience, strong communication skills and genuine dedication. Furthermore, I am eager to learn and continuously improve, I am committed to being a positive role model and helping others make informed decisions about their health, education and well-being. More so, with my motivation, sense of responsibility and understanding of the challenges faced by the youth today I am confident that I can make a meaningful impact in this role, since I have volunteered before with AMICAALL I know how volunteering works and I am willing to volunteer on this program. ', 'Yes', 'AMICAALL Eswatini and Municipal Council Of Mbabane ', 'First and foremost, on the AMICAALL projects we had peer education and life\'s kills programs which were about enrolling adolescent girls and young women for HIV prevention education and service delivery for instance, family planning, condom education, demonstration and distribution. More so, we did income generating sessions and provided start-up kits for young women for example, saloon equipments for those who were doing hair, provided start-up capital for a cooperative selling chickens. Furthermore, with the Municipal Council Of Mbabane we are doing social behavioral change education in both primary and high schools around Mbabane. Topics that we cover include, gangsterism, crime prevention, drug and substance abuse as well as gender rights and equality to name a few. Moreover, we have in-school teen clubs lead by our peer educators that we train. In addition, we do Spelling B competitions for primary schools every year with a selected theme for example, this year\'s theme was gangsterism and bullying. More so, we do public speaking for high schools every year and this year\'s theme was Mbabane a smart city on health, education and recreational facilities. Lastly, we also conduct educational dialogues with out of school youth in communities as well as tertiary institutions in the city. ', 'Yes', NULL, '2025-07-16 13:13:56', '2025-07-16 13:13:56'),
(219, 669, '[\"documents\\/01K0987446VQ357WXZM5H28PWQ.pdf\"]', '[\"documents\\/01K0987448BFRVMC417E9PWRQ8.pdf\"]', 'Unemployed', 'I am passionate about youth development and empowerment , and I will be able to uplift and support young people across Eswatini aligns with my values, desire to contribute meaningfully to the future of our country. I’m the best candidate because I bring a combination of passion, dedication, and revenant skills. I am a hardworking, goal driven individual who works well with others and can adapt to different environments.', 'Yes', 'Children’s Cup', 'I was in the wellness department whereby the organization distribute medication to vulnerable children who are under their care points. We would take children to hospital for their appointments with the doctors and for check ups and I used to note down records for their next appointments. I was part of child protection case.', 'Yes', NULL, '2025-07-16 13:14:28', '2025-07-16 13:14:28'),
(220, 670, '[\"documents\\/01K0988AGP0DTTAC9NZF18A3GR.jpg\"]', '[\"documents\\/01K0988AGRZCSH6XZS0H84KMHS.jpg\"]', 'Unemployed', 'I have applied because I believe I can bring change in this community with our youth falling pregnant at young age and avoid them into falling into drugs because of peer pressure as well as joining gangsterizm', 'Yes', 'Bantwana Initiative', 'I was teaching young people about abstinence and the importance of preventing unwanted pregnancy and also how to avoid peer pressure ', 'Yes', NULL, '2025-07-16 13:15:08', '2025-07-16 13:15:08'),
(221, 671, '[\"documents\\/01K098KH3CNXQDPADQCDM0CWV1.jpeg\"]', '[\"documents\\/01K098KH3FCW7NH2S56QFCJD88.pdf\"]', 'Unemployed', 'I’m passionate about this opportunity because your organization’s mission to drive innovation and mindsets of our youth in this kingdom aligns perfectly with my career goals and personal values. \nYour commitment to excellence and community impact resonates with my own dedication to delivering high-quality results that make a tangible difference. \nAm the best candidate because i have worked with adolescents on my last voluntary in Moyeni High School. Mr S Manyatsi the head teacher can be of good reference (7604 6771) \n\nJoining your team would allow me to grow professionally while contributing immediately to initiatives I truly believe in.  ', 'Yes', 'Moyeni High School ', 'I worked as a volunteer teacher for 2 years. I teached grade 8,9 and 11.', 'Yes', NULL, '2025-07-16 13:21:15', '2025-07-16 13:21:15'),
(222, 672, '[\"documents\\/01K098PF6C7P8PK4M28H2M0NTK.jpeg\"]', '[\"documents\\/01K098PF6QV2VNW1VV75SWXMV5.jpg\"]', 'Unemployed', 'I bring a strong combination of personal commitment, relevant experience, and the ability to connect with young people. I’ve worked on youth-focused initiatives—whether through mentoring, volunteering, or community engagement—and I understand the challenges today’s youth face. I’m a good communicator, a team player, and I have the creativity and energy needed to inspire and support young minds. Most importantly, I’m dedicated to building safe, inclusive spaces where youth feel heard, valued, and empowered to lead.', 'Yes', 'Eswatini World Vision ', 'I helping the youth in the community  on how to reach their goals , and provided them with job session and their healthiness ness and well behavior in girls child also business ideas and self sustainability. self acceptance and value. in addition i was a life mentor and teaching youth on HIV prevention and a youth facilitator.', 'Yes', NULL, '2025-07-16 13:22:51', '2025-07-16 13:22:51'),
(223, 673, '[\"documents\\/01K098QPQ9J9RYQE0Q77H830HV.jpg\"]', '[\"documents\\/01K098QPQJXA2HZKEHS6NPME3X.jpg\"]', 'Unemployed', 'I am the best candidate for the job since I am a committed member of the community, I am also a hard working person and can bring my skills and talents to contributes to an efficient environment ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 13:23:32', '2025-07-16 13:23:32'),
(224, 674, '[\"documents\\/01K09922P1CTQ56V2X2JMTJW89.jpg\"]', '[\"documents\\/01K09922PK29ND44TS8TG3PXDX.pdf\"]', 'Self-Employed', '1. I have a passion for this initiative and honestly I have been waiting for such an opportunity for a while. \n2. I believe this program will bring my community social and economic development.\n3. I am positively well known in my community, respected and I also have a clean criminal record.\nNkwe. Thank you.', 'Yes', 'Shawco (in SA) and peer counselors at UNESWA', 'At shawco we provided entertainment, food and every day essentials to vulnerable orphaned children. At UNESWA we went around rural schools motivating pupils on the importance of education and also taking care of oneself.', 'Yes', NULL, '2025-07-16 13:29:12', '2025-07-16 13:29:12'),
(225, 675, '[\"documents\\/01K09924G5Z1Z5V8ASG0MXYDZX.pdf\"]', '[\"documents\\/01K09924G7KBBGBT10D0YP8769.pdf\"]', 'Unemployed', 'I am the best candidate for this job because I am very determined individual. I am focused and I am willing to go and extra mile when I am doing something. I am also passionate about youth, developing them and assisting them any how. This is because I have worked in the health centre where I was mostly involved with the youth of that area. Working with them gave me the opportunity to be exposed to them and groom them.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 13:29:13', '2025-07-16 13:29:13'),
(226, 676, '[\"documents\\/01K099786WFEP6WS1QAFWME8HV.jpg\",\"documents\\/01K09EKM3E1SAZT2WC0TFS2SWS.pdf\"]', '[\"documents\\/01K0997874D6BYWPST8MYB370Q.jpg\"]', 'Unemployed', '1.I have work with young women, I have experience and I qualify\n2.Exellent training and facilitation skills\n3.Team building and problem solving\n4Team player able to work with minimum supervision ', 'Yes', 'Amiccaal and Nazarene compassionate ministry ', '1.Yes, having group sessions talk about life how to live, HIV prevention.\n2.HIV risk, education SRH and PrEP.\n3 Business - how to be financially independent by starting ur own business in our community, empowering them.', 'Yes', NULL, '2025-07-16 13:32:01', '2025-07-16 15:06:09'),
(227, 211, '[\"documents\\/01K099BE0VGNH1YXJVK2YBD435.pdf\"]', '[\"documents\\/01K099BE0YZDNQ5NA45K9D4WF3.pdf\"]', 'Self-Employed', 'I believe I\'m the best candidate for this job because I bring a strong combination of relevant skills, experience and a genuine passion for this field. I\'m not only committed to delivering quality but I also adapt quickly, work well under pressure and thrive in teams environments. I\'m excited about the opportunity to contribute to your team and help drive your goals forward. ', 'Yes', 'Rachael SD ', 'I was a member of the Rachael SD Organization which was mainly focused on Orphans. We helped them with school uniforms, Fees and Food', 'Yes', NULL, '2025-07-16 13:34:18', '2025-07-16 13:34:18'),
(228, 677, '[\"documents\\/01K099EFSER94KWF94XM153SR3.jpg\",\"documents\\/01K099EFSHPE01VRQJ2MT7S9GA.jpg\",\"documents\\/01K099EFSK10D31GY1P6BAW94W.jpg\"]', '[\"documents\\/01K099EFSQBH52PSR2RPP7NMB0.pdf\"]', 'Self-Employed', 'Am also an entrepreneur who own poultry farm. The impact extends far beyond striving business. As an active member  of the community  l service as a becon of hope and inspiration  to others.  I also serve as  youth leader under Community Development committee. Where l work with youth addressing issues like GBV, HIV prevention and employability.  Through the entrepreneurship journey  l have groomed other young people who are successfully owning their business. Some got employed through my assistant. I have been motivated youth people across the country. Been in number of platform. ', 'Yes', 'Young Heroes ', 'I was a volunteer cadre at Young Heroes as a  Business mentor under Madlangamphis constituency. I had been Mentoring youth on livelihoods and employment program. Linking them with relevant institutions eg Eswatini Youth Revolving Fund for loan applications for their business.  Helping them on writing successful business plans and CV for job application. Referrals to clinical services as well as HIV prevention. ', 'Yes', NULL, '2025-07-16 13:35:58', '2025-07-16 13:35:58'),
(229, 678, '[\"documents\\/01K099FEXCMW2M646JMQFCTX5H.pdf\"]', '[\"documents\\/01K099FEXEC8GSBVAJKVRJ9F15.pdf\"]', 'Unemployed', 'I am writing to express my interest in the Youth Mindset Change Trainer Programme offered by the Eswatini National Youth Council. As a dedicated and purpose-driven professional with a strong background in agriculture economics, community development, and youth engagement, I believe I am well-positioned to contribute meaningfully to this important initiative.\n\nI hold a Bachelor of Science in Agriculture Economics and Agribusiness Management from the University of Eswatini, and I have complemented my education with short courses in data entry, operations management, Career Essentials in Administrative Assistance, administrative assistance, and small business management. These qualifications have equipped me with the foundational knowledge and skills required to facilitate community sessions and inspire young people to adopt progressive mindsets.\n\nOver the past six years, I have served in various roles within Eswatini Bank — including as a Credit Advisor, Bank Clerk, and Customer Service Consultant. In these roles, I gained valuable experience working directly with people of diverse backgrounds, often assisting youth, entrepreneurs, and rural communities. I have conducted credit assessments, facilitated agricultural funding workshops, and provided technical support to young farmers and aspiring business owners. These experiences have honed my communication, facilitation, and mentoring skills — all of which are critical for this programme.\n\nIn addition to my banking career, I completed a community-based internship with World Vision under the Economic Development Department. This role involved organizing farmer training workshops, delivering educational presentations, and evaluating program effectiveness — further strengthening my ability to engage groups and deliver knowledge in a meaningful and structured way.\n\nMy passion for youth development and community empowerment is not new. During my university years, I served as an executive committee member of the Student Christian Movement, where I managed logistics, coordinated team activities, and fostered youth participation in faith-based development. This experience sharpened my organizational and leadership capabilities and deepened my appreciation for teamwork and volunteer service.\n\nI am particularly drawn to this programme because of its focus on mindset change — an area I believe is critical for unlocking the potential of young people in Eswatini. I am confident that I meet both the minimum qualifications and key requirements. I have a strong history of working with adolescents and young adults, and I understand the dynamics of community structures through my previous roles in both the private and non-profit sectors. I am also deeply trusted and respected in my community, and I am fully committed to completing the entire training session and serving as a volunteer peer educator thereafter.\n\nUltimately, I view this programme as a powerful opportunity to give back to the communities that have shaped me, and to help guide the next generation toward positive personal growth and civic engagement. I am ready to apply my skills, share my experiences, and learn alongside other motivated young leaders from across the country.', 'Yes', 'World Vision', 'We did data collection, conducted trainings, organizing farmer training workshops.', 'Yes', NULL, '2025-07-16 13:36:30', '2025-07-16 13:40:48'),
(230, 679, '[\"documents\\/01K099JCJ38RYGJS3QB09V4YD2.pdf\"]', '[\"documents\\/01K099JCJ7TJKM876X97YGEYFT.png\"]', 'Unemployed', 'I\'m passionate about empowering individuals and communities to reach their full potential. As a part-time student  in Psychosocial Support, I\'m excited to apply my skills and knowledge to make a positive impact. This role aligns with my values and goals, and I\'m eager to contribute to the success of the project.\nMy studies in Psychosocial Support have equipped me with knowledge and skills in counseling, group facilitation, and community engagement.\nI have experience in designing and delivering training programs, which would enable me to effectively train peer educators.\nI\'m committed to working with communities and empowering individuals to make positive changes in their lives.  I possess excellent communication and interpersonal skills, essential for effective training and community engagement.\n I believe in the importance of mindset change and am excited to work with peer educators to promote positive change in the community.\n\nI\'m confident that my education, experience, and passion for mindset change make me an ideal candidate for this role. I\'m excited about the opportunity to contribute to the success of this project and make a positive impact in the community.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 13:38:06', '2025-07-16 13:38:06'),
(231, 680, '[\"documents\\/01K099KBDV278V1ENDXS04EYVK.jpg\"]', '[\"documents\\/01K099KBE759DZ9GCH93C698S4.pdf\"]', 'Unemployed', 'I love empowering youth on how to take care of themselves in a way that is acceptable and productive into the environment and country...more especially young girls like me...I can say I am one person who tries to lead by example.', 'No', NULL, 'I have never worked in an organisation like that...', 'Yes', NULL, '2025-07-16 13:38:38', '2025-07-16 13:38:38');
