(232, 681, '[\"documents\\/01K099QB9AWS935VHNNS8B34XY.jpg\"]', '[\"documents\\/01K099QB9XRBKWYS39BH04PB1C.jpg\"]', 'Unemployed', 'I have Applied because:\n1.I have all the requirment needed for this position.\n2.I am a hard working girl who works without supervision and honest to my work.\n3.Ever since Had work with community I have develop love and passion to work with people and children so to help them be free from the advesity they facing.\n4.Since will work under my constituency I could be of great help as I know what my community need and how I can interact with the peopl in my community and they can easily trust me as they have work with me before and they know my confidentiality.', 'Yes', 'Young Heroes Organisation', 'I have been doing my duties at community level:\n1.Assess and enrol eligible OVCs, interact with their caregivers,facilitate individuals and group activities.at community level I also identify and enrol different sibpopulation.\n2.I develop and update family care plans and also perform data entry for all services provided into the COMMCARE APP.\n3.Work closely with Linkages Assistants to re-enrol and provide support to Children/Adolescents living with HIV.\n3.\n', 'Yes', NULL, '2025-07-16 13:40:49', '2025-07-16 13:40:49'),
