(236, 685, '[\"documents\\/01K099WNCAPMJK5AZVAYJ8TWFW.jpg\"]', '[\"documents\\/01K099WNCGSF8FD1HXEF7K76EP.pdf\",\"documents\\/01K099WNCJVW7RZE2XESS22MAA.jpg\"]', 'Unemployed', 'Firstly ,i have a good experience with working with young people so it\'s can be easy for me to mobilize them.\nAlso ,I have a good relationship with them.\nMoreover ,I think I am a best candidate because I have a clear understanding of working with a youth .', 'Yes', 'Bantwana Initiative, Cabrini Ministries ', 'To help them to achieve their goals .Helping them to become self dependence and self empowered.\nHelp them to prevent unplanned by referring them to clinics for family planning commodities. ', 'Yes', NULL, '2025-07-16 13:43:43', '2025-07-16 13:43:43'),
