(238, 687, '[\"documents\\/01K09ACSPW36MNBDF9T6QESQE4.pdf\"]', '[\"documents\\/01K09ACSPZTQ849B72Z2T4VWFA.pdf\"]', 'Employed', 'I\'m willing to continue contributing on the OVCs life, help them to continue protecting themselves in any harm, that may destroy their future, I still got plans on how to do it.', 'Yes', 'Insika yakusasa from Cabrini Ministries ', 'I was a home visitor where I was visiting OVC s from 0to21 where I was finding their, try to help them on meeting their needs,help those who are HIV positive to take their medication correctly.', 'Yes', NULL, '2025-07-16 13:52:31', '2025-07-16 13:52:31'),
(239, 688, '[\"documents\\/01K09AYJTVJSGAADQCSSP509AF.pdf\"]', '[\"documents\\/01K09AYJTZ3JQDF46DDCH2EN0F.pdf\"]', 'Self-Employed', 'I wish to get an opportunity to interact with young people and share my personal experiences as raised from a humble background to shape the future of young people.\n', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 14:02:14', '2025-07-16 14:02:14'),
(240, 689, '[\"documents\\/01K09AYY4RSRV4PJHFFFH03EGK.pdf\"]', '[\"documents\\/01K09AYY51F505ADNG5N82BTM1.pdf\",\"documents\\/01K0BVKCCEDRHP5GWJ8B5194AE.docx\"]', 'Unemployed', 'My skills and  experience that I have with working with the youth makes me a perfect candidate for this position. I really think it can also help me to broaden my knowledge in this industry as well as the passion i have for the youth from diverse backgrounds.I would also love to be a part in building the future leaders through my skills.', 'Yes', 'Ministry of Labour and Social security, hosting National Career expo\'s while enabling the youth to choose the right careers which aligns with their personalities.', 'In the Ministry we were the hosts of National Career expo where we would work with the youth in the Country. We helped them to choose the right career choices which alignes with their personality traits.While doing that we used a  testing tool which proved that it\'s working as we have diffrent categories to channel the youth when making the decision of choosing their careers.', 'Yes', NULL, '2025-07-16 14:02:26', '2025-07-17 13:31:42'),
(241, 690, '[\"documents\\/01K09B5QKJE74VE0A9A6G23C2S.jpg\"]', '[\"documents\\/01K09B5QM1RQ8DEPR5A48CJ2EF.jpg\"]', 'Unemployed', 'Because I have a great experience in Orphans and vulnerable children\'s work gained in Insika Yakusasa project and Sabelo sensha project where I worked as a home visitor and i have a great experience in delivering OVC work while serving in compassionate Swaziland and Bantwana initiative Eswatini. Also i have gained good supervision skill as i was a cadre.And finally, i learnt to ensure confidentiality on other people\'s issues.', 'Yes', 'Compassionate Swaziland organisation and Bantwana initiative Eswatini organisation ', 'I was the survivor of abuse and i helped the children in educational support which is school fees to vulnerable children, and who dropped out of school..and Finally i to provide adherence support to the children living with HIV ', 'Yes', NULL, '2025-07-16 14:06:09', '2025-07-16 14:06:09'),
(242, 691, '[\"documents\\/01K09BWFQHEX2ZDG5PWA9G36YF.jpg\"]', '[\"documents\\/01K09BWFQN6FS8M4BHKX2WS3RS.pdf\"]', 'Unemployed', 'I am genuinely passionate about the work your organization does and the impact it has on the community. This role aligns closely with my values, skills, and long-term career goals. I am excited by the opportunity to contribute meaningfully, grow professionally, and be part of a team that is committed to excellence and service.\n\nI bring a strong combination of relevant qualifications and hands-on experience that matches the demands of this role.\n\nI am highly dependable, self-motivated, and known for my ability to adapt quickly and work well under pressure.\n\nMy excellent communication skills, strong work ethic, and team-oriented mindset ensure that I can contribute positively from day one.\n\nI continuously seek to learn and improve, which allows me to stay effective and innovative in any task I take on.\n\n\nIf you’d like to tailor this for a specific job, feel free to share the job title and a bit about your background.\n\n', 'Yes', 'AIDS Healthcare Foundation', 'Provide pre and post counselling for children and adolescent living with HIV\nLiving young people with other available resources with collaboration with other professionals\nMonitoring adherence to children and adolescents taking Antiretroviral (ARV\'s) treatment ', 'Yes', NULL, '2025-07-16 14:18:34', '2025-07-16 14:18:34'),
(243, 692, '[\"documents\\/01K09C381BPCX5E9NYGS4ZWY4B.pdf\"]', '[\"documents\\/01K09GCZRJHABHJBTX74W7V7DT.pdf\"]', 'Unemployed', 'I applied because as a young person,  it is important to me that I empower other young people to learn to be independent.  I believe I am the best for this job because I specialized in Community Health Nursing which equipped me with the skill to positively impact the community and how to interact with  the community in a way that they relate to what you are trying to teach.', 'Yes', 'Junior Achievement ', 'We helped young people by teaching them skills such as making an eco-friendly flask, which they can sell and make money.', 'Yes', NULL, '2025-07-16 14:22:16', '2025-07-16 15:37:29'),
