(245, 694, '[\"documents\\/01K09CD2KFVMCQP76K4PWEPVTE.pdf\",\"documents\\/01K09CD2KXXJ2NWJYBZBKPT7YM.pdf\"]', '[\"documents\\/01K09CD2MBYNG73FR0AVYA43HG.pdf\"]', 'Unemployed', 'My interest is more focused on lighting up the youth about the challenges outside schools. Looking at the high youth unemployment rate and the rumbling world economy and political spheres that can be of great influence to their lives. Must not loose their focus. ', 'No', NULL, 'None', 'No', NULL, '2025-07-16 14:27:38', '2025-07-16 14:27:38'),
(246, 695, '[\"documents\\/01K09CYBC5KVW5DD87H2T78GVC.pdf\"]', '[\"documents\\/01K09CYBC8EK8DYZ88T5N3RVPP.pdf\"]', 'Unemployed', 'I am young woman who knows and has actually experienced some of the struggles that the that youth of our country have. This has made have an interest in the development of youth I am a hard working team player who is eager to learn, has impeccable communication skills, is tech savvy and has empathy which are essential for building a rapport with young people. ', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 14:37:04', '2025-07-16 14:37:04'),
(247, 696, '[\"documents\\/01K09CZ4Q3RP0D1CDBVNHHNT2E.pdf\"]', '[\"documents\\/01K09CZ4Q682EV8GKEPEEMJSSE.pdf\"]', 'Unemployed', 'I have applied for this opportunity because I am deeply committed to making a positive impact in my community and beyond. As a qualified but unemployed youth, I see this as a vital platform to develop my skills, gain valuable experience, and contribute meaningfully to environmental and community development initiatives. I believe that participating in this program will not only help me grow personally and professionally but also enable me to support my family and serve as a role model for other young people in my community.\n\nMy motivation stems from my role as the Chairperson of the Eswatini Man and Biosphere Youth Network, where I actively work with schools and communities to promote green initiatives, tree planting, and youth-led projects. I have demonstrated leadership, dedication, and passion for environmental conservation and youth empowerment. These experiences have equipped me with strong organizational, communication, and teamwork skills, which I believe make me a suitable candidate for this program.\n\nDespite my current unemployment status, I am proactive and eager to learn. I am committed to leveraging this opportunity to enhance my skills in project management, leadership, and community engagement. I am confident that my background in environmental initiatives and youth mobilization will bring valuable perspectives and energy to the program.\n\nFurthermore, I come from a humble background where both of my parents are unemployed, and I am often relied upon to support and care for my family. This situation has instilled in me a strong sense of responsibility, resilience, and determination. It has also motivated me to seek opportunities that can help me improve my circumstances and better serve my community. I see this application as a step toward building a brighter future for myself and my family, as well as contributing positively to society.\n\nI believe I am the best candidate because I am passionate, committed, and ready to learn. I bring a unique perspective fueled by firsthand experience of community challenges and a genuine desire to create sustainable change. My leadership experience, coupled with my dedication to environmental and youth development, positions me as someone who can maximize the benefits of this opportunity and give back to my community.\n\nIn summary, I am applying because I want to grow, contribute, and make a difference. I am confident that my background, motivation, and dedication make me a strong candidate, and I am eager to seize this opportunity to further develop my skills and serve my community effectively.\n', 'Yes', 'Eswatini Man and Biosphere Youth Network, Environmental Health Students Association ', 'As the Chairperson of the Eswatini Man and Biosphere Youth Network, I am dedicated to empowering young people to take an active role in environmental conservation and community development. My work primarily involves supporting schools and youth initiatives to promote sustainability and green practices.\n\nOne of my key contributions is helping schools initiate green school programs. I collaborate with teachers and students to develop projects focused on environmental awareness, waste management, recycling, and conservation. These initiatives aim to instill a sense of responsibility and environmental consciousness among young learners, fostering a generation committed to protecting their environment.\n\nI also organize and support tree planting activities, especially in the Libombo region. These activities help combat deforestation, restore ecosystems, and promote biodiversity. I work with local communities, schools, and environmental organizations to ensure the success and sustainability of these projects. Through these efforts, I help young people understand the importance of trees and natural resources, encouraging them to become environmental stewards.\n\nAdditionally, I support youth-led initiatives by offering mentorship, resources, and platforms for young people to showcase their projects. I assist them in developing project proposals, finding funding, and organizing community outreach activities. This empowerment helps young people develop leadership skills and take ownership of their environment and community development.\n\nOverall, my work focuses on inspiring and enabling young people to become change-makers. By promoting education, facilitating hands-on activities like tree planting, and supporting youth-led projects, I help young people gain the skills, confidence, and motivation to contribute positively to their communities and the planet. My goal is to nurture a new generation of environmentally conscious leaders committed to sustainable development and community well-being.  \n', 'Yes', NULL, '2025-07-16 14:37:30', '2025-07-16 14:37:30'),
(248, 697, '[\"documents\\/01K09DD93FD427FGXCE434QGPK.jpeg\"]', '[\"documents\\/01K09DD93MBFZ366YVEHM93S8C.png\",\"documents\\/01K09DD93Q1Y9FJ04YXKNNV007.png\",\"documents\\/01K09DD93T3QJV2WBB73D3Z98E.png\"]', 'Unemployed', 'I have applied for this opportunity because i believe this job presents an incredible opportunity for me to contribute to the well being and development of adolescent in our country . I believe that I am the best candidate for this job because I believe that working here will not only allow me to give back to the community but will also equip me with practical experience in facilitating change among our youth.', 'Yes', 'Girls Leading Our World ( GLOW)', 'I worked with GLOW and served as a leader for girls . I was equipping and empowering the girl child . I was also mentoring them .', 'Yes', NULL, '2025-07-16 14:45:13', '2025-07-16 14:45:13'),
(249, 698, '[\"documents\\/01K09DDQKK2D9SBKHTBAS2PYW8.pdf\"]', '[\"documents\\/01K09DDQKQADT7DTXAYTV313J2.pdf\"]', 'Unemployed', 'I have a passion for the work and proven abilities. I have differentiated experience in this field, also, I have exceptional drive and determination to succeed.', 'Yes', 'SWAGAA and Only God Knows Charity Organisation ', 'SWAGAA 	08 July 2021 -  07 May 2022 Mentor \nI was responsible for mentoring the younger generation in particular the boy child, where  I worked with  boys from the age of nine to fourteen years on  self care and grooming them to be upright social citizens.  \n\nOnly God Knows Charity Organisation - 19 June 2020 – 2023 Public relations officer  \nI worked as media liaison officer for the Organization, where I coordinated press communication with the different media outlets and stakeholders.  \nI was also responsible for contributing  in the organization marketing activities and social responsibility programmes, which included delivering food parcels to families in need driving the Organization car. \n \n I was also responsible for delivering full reports on different projects the company embarked on, and contributing to end of year company reports. \n', 'Yes', NULL, '2025-07-16 14:45:28', '2025-07-16 14:45:28'),
(250, 699, '[\"documents\\/01K09DE16WRQD1MW0XG7GKPQ6A.png\"]', '[\"documents\\/01K09DE176W1TX4BX7TPJBSS9X.jpg\",\"documents\\/01K09DE17EHCBZ7MECVQBHK0RY.jpeg\"]', 'Unemployed', 'I applied for the job because i am very passionate and patient.\nI love working with people of different age groups but mostly with that of a younger age hence I am a primary educator by profession.\nI am a dedicated someone who is very sociable.\nI may not hold any experience to the position but I am always willing and open to learning new skills and adapt to environments.\nI applied so I can learn more and become a valuable assert to the organisation.', 'No', NULL, 'None. ', 'Yes', NULL, '2025-07-16 14:45:38', '2025-07-16 14:45:38'),
(251, 700, '[\"documents\\/01K09DFH2KJHQTEV3H8ZQYY0GB.jpg\"]', '[\"documents\\/01K09DFH2RHRWBVWB6HDQZ53V0.pdf\"]', 'Self-Employed', 'I have a passion in working with young people, i have been on the fields for 6 years now doing life changing programs.Given a task i do it deliberately and give satisfying results. I can be very happy to get the opportunity because I am the bread winner at home,as I have stated that I have 4 dependent  which are my siblings.Currently I am self employed ,selling broilers  which is the only income I have to support  them,so if I can be selected  I would do my best at work because it will help me and my siblings. Not to forget the experience that I would gain in the field and the young people that i will be helping, will help me grow academically as i have also got an opportunity from Junior Achievement to  give me a skill of being a beautician which was something i have neverthought of doing. I am also willing to grow my business  too,so I know with the time given there will be a lot that I would have achieved. ', 'Yes', 'World Vison,FLAS', 'Basically I was the youth Facilitator/Life Mentor in both Organizations.Mobilising Adolescent girls/boys,young women and Men doing HIV prevention sessions, providing SRH services  and live hoods where by they would do savings groups start small business  and selecting those who needed to go back to school,maybe they drop out because of finances, pregnancy  any case it maybe be...Every individual was helped through the groups.', 'Yes', NULL, '2025-07-16 14:46:27', '2025-07-16 14:46:27'),
(252, 701, '[\"documents\\/01K09DMJJRQK6MMHDS03KMD915.jpg\",\"documents\\/01K09DW1PBAR40BGDVMGEYFAEK.jpg\"]', '[\"documents\\/01K09DW1PSBX2HVMT0ABPSAKFD.pdf\"]', 'Unemployed', 'I am passionate about working with the young people and bringing them together to speak about their day to day challenges and knowing very well that their solutions is among them. Each and  every meeting I meet a part of myself within each individual and finding solutions together complete me. It\'s more of touching souls and expanding who we are as we coexist, it\'s love of my people and spreading awareness that we not over yet but beginning and we are the future .', 'Yes', 'Listen Health Orga', 'we distributed condoms and lubrication to already sexual peers and we taught about misconception about taking PREP and importance of taking it.', 'Yes', NULL, '2025-07-16 14:49:12', '2025-07-16 14:53:17'),
(253, 702, '[\"documents\\/01K09DQTM4DGPF5FV202J83DAG.pdf\",\"documents\\/01K09DQTM521AEPM6G6VDDQEJ3.pdf\"]', '[\"documents\\/01K09DQTM8SRK7MR5DH67V3SGJ.pdf\"]', 'Unemployed', 'I am a young individual who is passionate about youth development and education. I  believe that to build a sustainable future, the government should focus and support youth empowerment, skills development education. This will go a long way in combating unemployment of youths. I believe I am the best candidate for the job because I am a young person with knowledge and understanding of human behavior.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 14:50:59', '2025-07-16 14:53:30'),
(254, 703, '[\"documents\\/01K09DSPBKJ11G8QC7PVYSS1V3.pdf\"]', '[\"documents\\/01K09DSPBM5RVWN53R1PWVV5V9.pdf\"]', 'Unemployed', 'I like working with my colleges,motivating them ,sharing our problems and give trips concerning our problems we safe in life .l am a young women who is commitment to every work that is assign to do. I act as a role model to some girl in my community. I attended training and I experience on how to conduct sessions under supervision and following instructions. ', 'Yes', 'Bantwana Initiative ', 'I was working as Life Mentor,where we were conducting session with young women of the age 20-29.Also adolescent girls of 15-19 and young girl of the age 10-14 .I was teaching them about HIV prevention. ', 'Yes', NULL, '2025-07-16 14:52:00', '2025-07-16 14:52:00'),
(255, 704, '[\"documents\\/01K09E5NE3YKFEQBMZ883MYSFK.pdf\"]', '[\"documents\\/01K09E5NE4BW50VYSM48TAA85T.pdf\"]', 'Unemployed', 'My decision to pursue a role as a youth trainer stems from a profound and deeply personal conviction that I can make a significant, positive impact during a crucial developmental stage in young people\'s lives. It’s not just a career path for me; it\'s a calling born from my own experiences and a fervent belief in the potential residing within every adolescent.\n\nOne of my primary motivations is a genuine desire to contribute meaningfully to young lives. I vividly recall my own journey through adolescence – the exhilaration of discovering new interests, the confusion of navigating social dynamics, and the immense pressure to find my place in the world. During this period of profound change, the guidance of insightful mentors proved invaluable to me. They weren\'t just instructors; they were sounding boards, cheerleaders, and gentle correctives, helping me to understand my strengths and to learn from my mistakes. Because I personally experienced the transformative power of mentorship, I am driven to be that same kind of consistent, positive influence for others, providing a safe and encouraging environment where young people can explore, learn, and grow without fear of judgment.\n\nMy personal experiences, both triumphs and setbacks, have equipped me with a profound empathy for the challenges adolescents face today. I understand the anxieties that come with academic expectations, the complexities of peer relationships, the pervasive influence of social media, and the ever-present search for identity and belonging. This understanding allows me to approach training with a level of authenticity and relatability that I believe is crucial for connecting with young people. I want to build rapport based on shared understanding, fostering the trust that allows for open communication and effective guidance. I believe that by truly seeing and hearing adolescents, I can help them unlock their own inner resources and develop resilience.\n\nFurthermore, I am particularly drawn to the opportunity to cultivate essential life skills that are often not explicitly taught in traditional educational settings. While academic knowledge is undeniably important, skills like critical thinking, effective communication, conflict resolution, emotional regulation, and genuine leadership are fundamental for navigating the complexities of modern life. As a youth trainer, I would relish the chance to design and deliver interactive, engaging sessions that equip adolescents with these practical tools. Imagine the satisfaction of empowering a young person to articulate their thoughts clearly in a difficult conversation, to resolve a disagreement constructively with a peer, or to manage their stress effectively during exam periods. These are not just momentary achievements; they are foundational competencies that will serve them throughout their academic careers, their professional journeys, and their personal relationships.\n\nThe dynamic and evolving nature of youth training also profoundly appeals to me. Adolescents are naturally inquisitive and responsive to approaches that are relevant and authentic. This necessitates a trainer who is creative, adaptable, and committed to continuous learning and improvement. I am excited by the prospect of developing innovative curricula, incorporating modern pedagogical methods, and leveraging technology to make learning engaging and impactful. The challenge of keeping content fresh, relevant, and captivating for a diverse group of young minds is something I eagerly embrace. There is immense satisfaction in witnessing that \"lightbulb moment\" – seeing a young person suddenly grasp a new concept or overcome a personal hurdle.\n\nFinally, my motivation is deeply rooted in the belief in the long-term societal impact of investing in youth. Empowering adolescents with strong values, robust critical thinking abilities, and a profound sense of self-worth is not just about individual success; it\'s about building stronger, more resilient communities. By fostering responsible citizens, innovative problem-solvers, and compassionate leaders, we are contributing to a more promising future for everyone. To be part of this foundational work, to actively contribute to the well-being and potential of the next generation, is not merely a professional goal for me; it is a profound and humbling aspiration. I am convinced that this role would allow me to channel my passion and skills into a purpose that truly matters, helping to shape the individuals who will, in turn, shape our world.', 'No', 'Georgetown University ', 'As a Social Work Intern at Georgetown University, I gained invaluable experience providing comprehensive support to individuals navigating the complexities of living with HIV. My core responsibilities encompassed meticulous data collection and insightful report writing, essential for tracking client progress and identifying systemic needs. A significant portion of my direct client work involved individual counseling aimed at promoting ART (Antiretroviral Therapy) adherence, a critical factor in managing HIV and preventing transmission. For clients facing higher viral loads, I delivered specialized stepped-up adherence counseling (SUAC), offering intensified support and strategies to improve their health outcomes.\n\nMy passion for empowering young people found a strong outlet through facilitating engaging teen club sessions. These sessions provided a safe and supportive space for adolescents living with HIV to connect, share experiences, and learn vital coping mechanisms and life skills. Recognizing that some clients faced barriers to consistent engagement, I proactively conducted home visits, extending support beyond the clinic walls to ensure disengaged individuals received the care they needed. This outreach was crucial for maintaining continuity of care and addressing potential social determinants of health impacting their well-being.\n\nBeyond direct client services, I contributed to systemic improvements by performing thorough audits on chronic care files and viral load registers. This meticulous work allowed me to identify gaps in care delivery, and I subsequently provided mentorship to staff, helping to bridge these identified discrepancies and enhance overall service quality. My involvement extended to the academic and research spheres as well; I contributed to the development of research protocols focused on HIV vertical transmission, a critical area for preventing mother-to-child transmission. Furthermore, I had the privilege of serving as a panelist in a collaborative social work seminar, engaging with colleagues from the University of Eswatini and Christian University. This experience broadened my perspective on global health challenges and collaborative solutions in social work.\n\nOverall, my internship provided a holistic understanding of social work practice in an HIV context, combining direct client intervention, community engagement, data-driven analysis, and contributions to research and professional dialogue. The emphasis on working with adolescents was particularly rewarding, as it allowed me to make a tangible difference in the lives of young individuals facing unique challenges.\n', 'Yes', NULL, '2025-07-16 14:58:32', '2025-07-16 15:00:05'),
(256, 705, '[\"documents\\/01K09EAZWYAAMYQPGC8B93PXDC.pdf\"]', '[\"documents\\/01K09EAZX03XVHX0588GQ8P336.pdf\"]', 'Self-Employed', 'I am passionate about youth affairs. I want to see our being empowered in any way possible. The number of graduated and unemployed youth is so high in our country across all communities. Since i am a hard worker and a businessman who is still establishing himself i will help young people to venture more into business. I got a lot of training in business and entrepreneurship courses so i will transfer the knowledge. Most of our youths are lady and less motivated,  that is my duty to empower them to soldier on.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 15:01:27', '2025-07-16 15:01:27'),
(257, 706, '[\"documents\\/01K09END7VTSHV0WNMEEQ7DA8N.jpg\"]', '[\"documents\\/01K09END80GZNCDPC30P69919G.pdf\"]', 'Unemployed', 'I am an early childhood teacher by profession and I have been extensively involved in my teaching experience which allowed me to develop strong interpersonal skills, time management and strong teamwork. Also being engaged with young people have made me develop organizational skills and become a good communicator both verbal and writing. With my experience in working with both groups and my commitment to making a positive impact I believe i am an excellent fit the job. I am eager to contribute my time and energy to support your mission.', 'No', 'None ', 'I was a leader for young people (junior youth) at church and I was privileged to be part of them because we will contribute money and buy sanitary pads and toothpaste for those who did not afford. And we did a church outreach focusing making on young people.', 'Yes', NULL, '2025-07-16 15:07:08', '2025-07-16 15:07:08'),
(258, 707, '[\"documents\\/01K09ENGJN9AFNRSA9H709YMH5.pdf\"]', '[\"documents\\/01K09ENGJQMPER54MRRS92934A.pdf\"]', 'Employed', 'I am applying for the Mindset Change Training because I believe that a shift in thinking is the first step toward unlocking the full potential of our youth. In my work with young people, I have witnessed how negative self-perceptions, limited exposure, and a lack of motivation often hold them back from seizing opportunities. This training aligns with my passion for empowering youth to see beyond their current circumstances, develop a growth mindset, and make informed decisions about their future.', 'Yes', 'Matsapha Town Council', 'I am currently a Youth Mentor at Matsapha Town Council, i am currently helping with mobilizing the and Youth and organizing youth related events that will help empower the youth.', 'Yes', NULL, '2025-07-16 15:07:11', '2025-07-16 15:07:11'),
(259, 708, '[\"documents\\/01K09ERPV8JNJXPTAQPCYPJDGB.jpg\",\"documents\\/01K09ERPVH7ZPPW6EJXNR3EXW3.jpg\",\"documents\\/01K09ERPVPTZVBACKZ1XKAFRVC.jpg\"]', '[\"documents\\/01K09ERPVYBQQ0PM3TCTZT7NBN.jpg\"]', 'Unemployed', 'I think I am the best because I am a hard worker I can work well with the youth in my community.I am a well dedicated person who works under pressure and minimal supervision. I can make change in my community while working with the youth.', 'Yes', 'Khulisa Umntfwana,Bantwana Initiatives,Young Heroes ', 'Identifying orphaned and vulnerable children in the community and administer a child well-being assessment to establish extent of the community.Facilitating adolescent girls and young woman about HIV prevention sessions.Health service provider,provide the girls with health services referrals to local clinics and mobile clinics and do follow ups on referrals.Data capturing on work using mobile phone .', 'Yes', NULL, '2025-07-16 15:08:56', '2025-07-16 15:08:56'),
(260, 709, '[\"documents\\/01K09ETA5YN0ER5ZSPC3Y4Y7XB.pdf\"]', '[\"documents\\/01K09ETA62XK18VEKX2WF6QZW1.jpeg\",\"documents\\/01K09ETA65SSA28MD0Y5YJJH8B.jpeg\"]', 'Unemployed', 'I applied for this job because working at your establishment would be a huge achievement for me as I like helping people of the community especially the vulnerable.It is my passion to work with children and young adults and also community members hence I studied social work and lastly I am unemployed and have been unemployed since I graduated from 2021.\n', 'Yes', 'Lusweti', 'I was working as an intern under the Insika project.We would teach young adults and children on issues of HIV/Aids and we would go to communities and create peer groups and also locate the vulnerable people and link them to resources.Finally we would give one on one counselling sessions to those who need it and teach them about life skills.', 'Yes', NULL, '2025-07-16 15:09:49', '2025-07-16 15:09:49'),
(261, 710, '[\"documents\\/01K09F17PDAH2ZAVYW5W426Q02.jpg\"]', '[\"documents\\/01K09F17PKV8KNH5VNNM5VWAPG.jpg\"]', 'Unemployed', 'I am motivated to apply for the position of Mindset Change Trainer because I believe that true transformation begins with a change in mindset. Through my experience as an Economic Strengthening Facilitator at Cabrini Ministries, I have gained practical skills in mentoring individuals and communities, fostering positive attitudes, and supporting behavior change that leads to improved livelihoods and well-being. I have seen firsthand how empowering people to shift their perspectives can open doors to new opportunities and lasting change.\n\nOne of the key strengths I bring to this role is my ability to connect with people on a personal level, build trust, and encourage self-reflection. I have facilitated life skills training, savings groups, and parenting sessions that promote healthier behaviors and mindsets. My work has helped young people and caregivers develop confidence, set goals, and adopt proactive attitudes toward their futures.\n\nI am a committed and reliable professional who values teamwork and accountability. I approach my work with empathy and patience, recognizing that change takes time and consistent support. My communication skills, coupled with fluency in siSwati and English, enable me to engage diverse groups effectively and create inclusive learning environments.\n\nAdditionally, I am organized and able to design and implement work plans that track progress and ensure sustainability. I work collaboratively with community leaders and stakeholders to build programs that reflect local needs and cultural contexts, making the change process more relevant and impactful.\n\nOverall, my education, experience, and personal qualities make me confident in my ability to contribute as a Mindset Change Trainer. I am passionate about inspiring individuals to embrace positive change and look forward to applying my skills to support your organization’s mission.', 'Yes', 'Cabrini Ministries.', 'During my time as an Economic Strengthening Facilitator at Cabrini Ministries, I played a key role in supporting young people and their families to improve their social and economic well-being. My main focus was empowering youth through mentorship, life skills development, and financial education. I facilitated savings groups where young people learned the importance of saving, budgeting, and planning for small income-generating activities. This helped many of them become more financially responsible and begin small businesses or side projects to support themselves.\n\nI also worked closely with girls and young women, offering one-on-one guidance and group sessions to address issues like self-esteem, relationships, and peer pressure. These safe spaces allowed the youth to share their challenges openly, gain confidence, and make better decisions for their lives. I witnessed remarkable changes in their attitudes, motivation, and ability to set goals.\n\nIn addition to working directly with young people, I facilitated parenting sessions for their caregivers. These sessions focused on building better communication between parents and teens, helping families understand one another, and encouraging positive parenting practices. As a result, many households reported improved relationships and reduced conflicts at home.\n\nFurthermore, I supported the formation of youth clubs and HIV prevention groups, promoting awareness and safe behavior. I developed weekly and monthly plans to track progress, and I worked with local leaders to ensure the sustainability of these community groups.\n\nOverall, my work helped build stronger, more resilient young people who are better equipped to face life’s challenges and make informed decisions about their future. It also strengthened family units and empowered communities to support their youth in meaningful and lasting ways.', 'Yes', NULL, '2025-07-16 15:13:35', '2025-07-16 15:13:35'),
(262, 711, '[\"documents\\/01K09F3300Z8J6MBN4ZPC1R0M4.pdf\"]', '[\"documents\\/01K09F3302XR92ESJV2C4CFTWQ.pdf\"]', 'Unemployed', 'I am an energetic, responsible, passion for the young ones and community-driven professional with experience in working with adolescents through Baylor Foundation’s Teen Club Program. Skilled in communication,\ncoordination, and teamwork, with strong endurance and a passion for youth empowerment.\nSeeking to contribute to the success of mindset change community sessions as a Volunteer.', 'Yes', 'Baylor Foundation Eswatini', ' Facilitated activities for adolescents aged 15–19\n Coordinated transport, food prep, and activity planning\n Maintained supervision and encouraged participation during events\n Gained valuable skills in programming, emergency response, and adolescent engagement', 'No', NULL, '2025-07-16 15:14:36', '2025-07-16 15:14:36'),
(263, 712, '[\"documents\\/01K09F5CRS7BG9K454QGV7Q5HP.pdf\",\"documents\\/01K09F5CS3JK3V9PNRQCGRHR4W.pdf\",\"documents\\/01K09F5CS5JX9SAWFA2BPPTKPT.pdf\"]', '[\"documents\\/01K09F5CSGAXV154T20V8BVAG4.pdf\"]', 'Unemployed', 'I have experience and I work well with children.I am dedicated to what I do.Im passionate about matters that involves the youth.I work well as a team and I achieve every goal I\'ve set for myself.', 'Yes', 'World Vision ', 'I did a survey on the well-being of children and their living conditions.Then I will report back to my superiors to see how we can assist.', 'Yes', NULL, '2025-07-16 15:15:52', '2025-07-16 15:15:52'),
(264, 713, '[\"documents\\/01K09F6AD6GH1R5FE2CA8QRNAF.pdf\"]', '[\"documents\\/01K09F6ADFQNCNER4FGDM82HWY.pdf\"]', 'Unemployed', 'I possess a genuine passion for community development and a demonstrated ability to connect with young people from diverse backgrounds, aligning perfectly with the Youth Mindset Change Trainer Programme\'s mission to create a significant impact. While I  may lack formal work experience, my eagerness to learn and my understanding of community structures, combined with my commitment to the entire training session,  make me a highly  motivated and dedicated candidate ready to contribute fresh perspectives and innovative ideas. Investing in me is an investment in a future leader committed to making a positive difference in the lives of young people and the communities they serve. ', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 15:16:22', '2025-07-16 15:16:22'),
(265, 714, '[\"documents\\/01K09F9DKQJ5KV58PEMHB338HE.jpg\"]', '[\"documents\\/01K09F9DKRB76J8WM2D2A5TXG3.pdf\"]', 'Unemployed', 'A volunteering opportunity would go a long way for me after more than a year of unemployment. ', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 15:18:04', '2025-07-16 15:18:04'),
(266, 715, '[\"documents\\/01K09FFRZ564FDJZ69P1771AX5.jpg\"]', '[\"documents\\/01K09FFRZ9NAY22JPTT631YDS3.pdf\"]', 'Employed', 'I have applied because I am passionate to work with young people. In my degree in Psychosocial Support and trainings from different organizations, I have the experience needed to excel in this role. As a young person, we face a lot of challenges foe example, unemployment, this challenges forces us to give up on life, make wrong choices, and end up being nothing in life. Young people need guardianship and empowerment that will make great future leaders who are responsible for their lives and strive to achieve their dreams despite all odds.\n\nWith my experience and skills, I am the right person to help give them hope and empower them. ', 'Yes', 'Nazarene Compasionate Ministries and Siphilile Maternal and Child Health ', 'At Nazarene Compasionate I worked with Adolescent Girls and Young Women, life mentoring them on how they can be responsible of thier lives, reproductive health issues, health issues and diseases and the importance of education in achieving their goals and dreams.', 'Yes', NULL, '2025-07-16 15:21:32', '2025-07-16 15:21:32'),
(267, 716, '[\"documents\\/01K09FG8JPR1ZGR1AQ6RBE4FFB.pdf\",\"documents\\/01K09FG8KMFQCCTRTK6NH1JYNT.pdf\"]', '[\"documents\\/01K09FG8KW8W2G38E6P8ST10S0.pdf\"]', 'Unemployed', 'Having developed passion with working with community I think I can best implement community based programs effectively and efficiently I believe that with the experience I have working with people at community level will me yield better and good implementation meeting targets ', 'Yes', 'Siphilile maternal and child health ', 'I have worked as a male mentor mentoring males on the roles has ought to play in support maternal and child health. Males being cautious about their health, HIV awareness,prevention and adherence to ART', 'Yes', NULL, '2025-07-16 15:21:48', '2025-07-16 15:21:48'),
(268, 717, '[\"documents\\/01K09FKM69AK9EE8B0AB6TXHWW.jpg\",\"documents\\/01K09FKM6HNR3EZPFEA76Q2ZFT.jpg\"]', '[\"documents\\/01K09HPTNBM68YZVXW64YGE7GE.pdf\",\"documents\\/01K09HPTNYABY4WMVB4AMFBD9D.pdf\"]', 'Unemployed', 'I am applying for the trainer of trainers position because I am passionate about capacity building and empowering others to lead. I believe that training is not just about delivering information, but about inspiring confidence,  developing skills and nurturing future leaders who can multiply the impact within their own communities or organisations. By stepping into a trainer role, I see the opportunity to contribute on a larger scale, equipping trainers who will in turn reach even more people. I am motivated by the idea of creating a ripple effect of knowledge and skills through training and mentorship.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 15:23:38', '2025-07-16 16:00:20'),
(281, 730, '[\"documents\\/01K09J321D20QBARBEAFV7J8Y3.jpg\"]', '[\"documents\\/01K09J321JEKT93SK131JE609W.jpg\"]', 'Unemployed', 'Growing up in a rural area and facing life’s hardships from an early age has shaped my character, my values, and my desire to become an agent of positive change. I am applying for the Youth Mindset Change Trainer Program because I believe that I have something meaningful to contribute not just from a place of passion, but also from lived experience. I want to use my story to inspire others and to help guide young people toward a future filled with purpose and discipline.\n\nOne of the main reasons I applied is that I understand the struggles that many young people face especially those who come from underprivileged communities. I have lived that experience. I have seen my peers fall into destructive patterns of behavior due to a lack of guidance, mentorship, and opportunities. Many youth today suffer from hopelessness, low self-esteem, and frustration. I want to be a voice of hope in such spaces. I want to encourage mindset change by showing others that where you come from does not define where you are going.\n\nI believe that I would be a good candidate for this program because of my natural ability to connect with people. I may not have formal qualifications or professional experience, but I have empathy, a good listening ear, and a heart for service. I am relatable because I speak from the same background as those I hope to reach. I am also a fast learner and open to training, feedback, and growth. Being part of this program would allow me to develop further, gain facilitation skills, and sharpen my leadership abilities.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 16:07:01', '2025-07-16 16:07:01'),
(269, 718, '[\"documents\\/01K09FRD6KTJG00NTY8ZG96VXK.pdf\"]', '[\"documents\\/01K09FRD6QKDX7RE1ZD3NKWGTS.pdf\"]', 'Employed', 'I have applied for this job because I am passionate about capacity building and community development, and believe this training will enable me to make a meaningful impact in my community. I am committed to continuous learning and sharing knowledge, which aligns perfectly with the goals of this program. I am confident that my strong communication skills, proactive approach and genuine dedication make me suitable candidate ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 15:26:15', '2025-07-16 15:26:15'),
(270, 719, '[\"documents\\/01K09FVHAK8EHND9DTAN5YYXTQ.pdf\"]', '[\"documents\\/01K09FVHANDXXNWNMH5PVGJTR4.pdf\"]', 'Employed', 'Seeing the increase in the number of teenage pregnancy and unemployment in the community, I believe the young people need to be educated more on other means of life than looking for jobs that are hard to find. \nThey need to know that everyone’s hands are full of opportunities only if they use what they have wisely.', 'Yes', 'Bantwana initia', 'Mentorship of in and out of school children \nRaise awareness of teenage pregnancy and HIV/AIDS', 'No', NULL, '2025-07-16 15:27:57', '2025-07-16 15:27:57'),
(271, 720, '[\"documents\\/01K09FY601WRB3QNSGQF6T0QDF.pdf\"]', '[\"documents\\/01K09FY6046GY9CGYB53SB1CJ6.pdf\"]', 'Unemployed', 'I am passionate about youth development and I believe in the power of mindset change to transform lives. As a trained teacher with a strong foundation or background in commercial subjects, I understand the struggle and potential of young people especially those from disadvantage background. I have the communication skills and expertise in connecting young people from the diverse communities. This opportunity aligns with my goal of becoming a positive role model and a change maker. I bring experience, energy and a deep desire to help others grow and reach their full potential ', 'Yes', 'Nyakatfo High school ', 'I have actively engage with young people through peer mentoring and informal and formal educational sessions.I helped students to understand basic principles in subjects like business studies and economics. I also supported school leavers by guiding them on career choices and encourage them to remain focused despite challenges such as unemployment. My role is to create a safe and positive environment where young people can freely express themselves and gain confidence to make positive decisions about their future. ', 'Yes', NULL, '2025-07-16 15:29:24', '2025-07-16 15:32:42'),
(272, 721, '[\"documents\\/01K09G3ECXDEG38R95SE804MS9.pdf\"]', '[\"documents\\/01K09G3ED06XZ6HP8P7XGGV7DF.pdf\"]', 'Unemployed', 'I have applied because I am willing to help the youth and I like working with people of my age, as I also share the same experiences with them.  I believe I am the best candidate for this job because i am a professional girl who understands diverse youth and the challenges they face in their daily lives and with the skills and knowledge I have,I  can be of great help to the youth', 'No', 'None', 'None\n', 'No', NULL, '2025-07-16 15:32:16', '2025-07-16 15:32:16');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
