(278, 727, '[\"documents\\/01K09H76ZXRYYSBDDXFD45XHJC.pdf\"]', '[\"documents\\/01K09H770668S8HE4M3Y3PRWQC.pdf\"]', 'Unemployed', 'My name is Pholile and l believe l am the best candidate for the job because l am compassionate, teachable, organised, creative and l am very good with people. Even though l haven\'t worked with an organisation before, l am junior youth leader at my church and also Sunday school teacher. That has equipped me to gain better communication skills, listening skills, and being able to speak in large crowds. I am passionate about group talks that helps the youth grow. Thank you', 'No', NULL, 'The following are three things on how l have helped young people (at my church STM because l am junior youth leader):\n1. I am all for body positivity, teaching the youth that they are beautiful and enough just as God created them.\n2. I do not only advocate for God\'s love but teaching youth how to make save money, dating , how to overcome peer pressure etc.\n3. I have thought the youth to be more outspoken, know their right, how to balance school life and personal time.\nThank you', 'Yes', NULL, '2025-07-16 15:51:49', '2025-07-16 15:51:49'),
