(284, 733, '[\"documents\\/01K09J62606HMHA8KFYERJS107.pdf\"]', '[\"documents\\/01K09J6263EZ26NH1XNCV8JNDD.pdf\"]', 'Unemployed', 'As a motivated and passionate individual with a background in education, community engagement, and personal development, I believe I am well suited to contribute meaningfully for this initiative.\nMy work with youth and communities has taught me the importance of mindset in personal growth and social development . I believe that helping others change how they think, behave and respond to challenges is key to long-term transformation and I want to be part of that change.\nI am a fast learner, dependable, passionate about helping others reach their full potential. I am confident that this training will equip me with tools yo support mindset shifts in individuals and communities. ', 'No', 'None', 'I taught young people Science, Consumer Sciences, Maths and Food and Nutrition ', 'Yes', NULL, '2025-07-16 16:08:39', '2025-07-16 16:08:39'),
