(291, 740, '[\"documents\\/01K09Q5XGE03GKRKCDQMXDXKP1.pdf\"]', '[\"documents\\/01K09Q5XGK7QDPPHA5DW7CMFQY.pdf\"]', 'Unemployed', 'I have applied for the Youth Mindset Trainer programme because I am passionate about empowering young people to realize their potential and develop a positive outlook on life. Throughout my academic journey and volunteer experiences, I have seen firsthand how guidance and support can transform lives. I believe I am the best candidate for this role because I bring a combination of relevant experience, a genuine commitment to youth development, and a strong desire to make a meaningful impact. My background in social work, volunteering at mental health facilities, and involvement in community activities have equipped me with empathy, communication skills, and a deep understanding of the challenges young people face. Additionally, my diverse experiences as a model, beauty pageant finalist, and volunteer have helped me develop confidence, resilience, and leadership qualities—traits I will use to inspire and motivate others. I am eager to use my skills and passion to help young people cultivate a positive mindset and achieve their goals.', 'Yes', 'NATICC and the Pschiatric Hospital ', 'I volunteered at the Psychiatric Hospital working with mental health patients as a social work intern, which involved supporting individuals with mental health challenges and helping them access resources. I also interned at the Manzini Municipal Clinic, providing assistance that contributed to the well-being of young people seeking healthcare services. Additionally, I shadowed at NATICC, a local organization focused on youth development, where I observed and learned about programs aimed at empowering young people. Through these experiences, I gained insight into the needs of young people and contributed by offering support, guidance, and resources to help them overcome challenges and build resilience.', 'Yes', NULL, '2025-07-16 16:20:21', '2025-07-16 17:35:57'),
