(297, 746, '[\"documents\\/01K09KD2PC9MWJQV64RCGFPKXH.pdf\",\"documents\\/01K09KD2PE0MKK1A8YFXH4WXDS.pdf\",\"documents\\/01K09KD2PHK9XA2MMJ63V28XHT.pdf\"]', '[\"documents\\/01K09KD2PNDFJGGSCZ5AQT86Z5.pdf\"]', 'Unemployed', 'I have applied because I am passionate about empowering young people through agriculture, education, and community-driven solutions. With hands-on experience in teaching, farm management, and youth-focused initiatives such as Enactus Luyengo, I bring a unique blend of practical and academic knowledge that directly supports development goals. My strong communication skills, dedication to rural transformation, and deep understanding of local challenges make me the ideal candidate to drive positive change in my Inkhundla.', 'Yes', 'Enactus Luyengo', 'At Enactus Luyengo, I was actively involved in developing and implementing entrepreneurial projects that empowered youth with business skills, financial literacy, and sustainable income-generating opportunities. I helped mentor young people, encouraging innovation and leadership to solve real community challenges.', 'Yes', NULL, '2025-07-16 16:29:58', '2025-07-16 16:29:58'),
