(300, 749, '[\"documents\\/01K09KXE08MRGZEW68WPN32SV8.pdf\",\"documents\\/01K09KXE0CDKHDPRT5R285XRQ2.pdf\"]', '[\"documents\\/01K09KXE0FR9C3M43YRQ4FYD5Q.pdf\"]', 'Unemployed', 'I have experience working with the youth and I have developed a deeper understanding of how we think as young people. I have gone through a season in my life where I lost the plot, faced many challenges but with a little push to the right direction I have picked up myself and doing everything within my reach to make ends meet. Young people nowadays are facing so many challenges especially the unemployment one and I want to be part of this journey so that I can help someone who is in my situation through sharing real life experiences and help shift one’s thinking from limitations to possibilities. ', 'Yes', 'World Vision', 'I worked as a volunteer (youth facilitator) for Umliba loya embili project in 2015 under Maseyisini inkhundla facilitating stepping stones a behavior change intervention for in and out of school adolescent girls aged 10-19. From late 2015 to 2018 I worked as an HIV prevention field officer for the project. In collaboration with Lusweti and Pact I supervised and mentored youth facilitators under the inkhundla, conducting training of trainers trainings, team building and monthly meetings for the facilitators. I also liased with schools and hospitals to make referrals and provide SRH services to the adolescent girls. I also worked with clinics to conduct teen clubs for adolescents living with HIV. All we did was to help adolescent girls make informed decisions through creation of safe spaces where we can discuss everything and support them. ', 'Yes', NULL, '2025-07-16 16:38:54', '2025-07-16 16:38:54'),
