(304, 753, '[\"documents\\/01K09MJGYT2QJQMX9MF70D8TPT.png\"]', '[\"documents\\/01K09MJGYYC2Q1JQTCNH7W8H2A.pdf\"]', 'Unemployed', 'I want to grow my skills and work in a team. Thus, this job fits with my experience and career path.', 'Yes', 'Young Heroes ', 'I provided comprehensive HIV prevention support to adolescent girls and young women through conducting outreach, small and one-on-one sessions mentorship on HIV prevention. Also, I made referrals for clinical services to mobile and local clinics for the adolescent girls and young women. Lastly, I empowered them towards reaching their life goals and starting small businesses so that they can be independent.', 'Yes', NULL, '2025-07-16 16:50:25', '2025-07-16 16:50:25'),
