(307, 756, '[\"documents\\/01K09MS60GKM74YM653E0C2JDH.pdf\",\"documents\\/01K09MS60J0F4SE10EG0R2VQT4.pdf\"]', '[\"documents\\/01K09MS60NFTNDBM4KBRFJYCYZ.pdf\"]', 'Unemployed', 'I have applied for this graduate trainee program because I would like to expand my knowledge and learn from the best. The program has proved to be very effective and helpful to young people like me who are new in the working environment. Also with my experience and knowledge I am confident that I am the best candidate for this program.', 'Yes', 'Dreams on wheels', 'The dreams on wheels organisation used to come and teach us on safe sex, and how to prevent pregnancy and sexually transmitted infections. That was really helpful because most of us our parents do not have conversations about sex with us. ', 'Yes', NULL, '2025-07-16 16:54:03', '2025-07-16 17:07:22'),
(309, 758, '[\"documents\\/01K09NHQC79B29AJBGQ62C9SJM.pdf\",\"documents\\/01K09NHQCA8DSZXWTZCRKJTGMF.pdf\"]', '[\"documents\\/01K09NHQCCTVX5SPSH3JD2PFRB.pdf\"]', 'Unemployed', 'I am applying to ENYC because i am deeply committed to empowering young people and I believe my skills align perfectly with your mission to foster socio-economic development for the youth of Eswatini. My recent 3-month IT internship at Manzini Public Library has enhanced my problem-solving abilities and demonstrated my capacity to quickly learn and adapt to new systems and challenges. I am a highly motivated and detail-oriented individual, eager to apply my analytical skills and dedication to supporting ENYC\'S initiatives,particularly in areas requiring organization and efficient program execution. I am confident that my proactive approach and strong commitment to youth empowerment make me a valuable candidate ready to contribute effectively to your team with ENYC\'S  goals.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 17:07:27', '2025-07-16 17:07:27'),
(310, 759, '[\"documents\\/01K09NPZ7XW9JSPWEGQM47SXZW.jpg\",\"documents\\/01K09NPZ7Z3EMVT1Q80JQ22844.jpg\",\"documents\\/01K09NPZ8238WJW9RCY1HJR833.jpg\"]', '[\"documents\\/01K09NPZ84GSC1RK44Q0CVBRZB.pdf\"]', 'Unemployed', 'I applied  because am a youth who is passionate about health and am a hard work .\nGood skills to communicate with young people.\nself motivated.\nAm the best candidate because of confidentially ,time consuming and having skills how to facilitating with young people.\n ', 'Yes', 'Young Hereos', 'Facilitating HIV and GBV prevention interventions for adolescent girls and young woman.\nHelp  young woman and adolescent girls to identify their goals.\nRefer young woman  write referral to the next clinic for serious illness and mobilize vulnerable adolescent girl and young woman in the project ,also collect data .\n', 'Yes', NULL, '2025-07-16 17:10:19', '2025-07-16 17:10:19'),
(311, 760, '[\"documents\\/01K09NXGWPFE4BNMM8JXJAPT9J.pdf\"]', '[\"documents\\/01K09NXGWRRKY9KHTX6TPB7TJ1.pdf\"]', 'Unemployed', 'My wish is to see all young people especially women able to take care of themselves and children without being dependants. Physical and mental fit to deal with different people regardless of their different life problems. Good listener, not a judge. Soft spoken and a team builder.', 'Yes', 'Compassionate Swaziland ', 'Once a Economic Strengthening Facilitator, I facilitates young people on saving groups, encouraging small business and introducing livelihoods lessons with startup packs. Also facilitating parenting skills both young and teens.', 'Yes', NULL, '2025-07-16 17:13:54', '2025-07-16 17:13:54'),
(312, 761, '[\"documents\\/01K09NZDC2EE9G0J2WTPM8ZFNA.pdf\"]', '[\"documents\\/01K09NZDC4WMYQHKKBH6PJQC0T.pdf\"]', 'Unemployed', 'I am deeply committed to empowering young people in Eswatini through meaningful mentorship, mindset transformation, and skill development. Over the past five years, I’ve actively led youth-focused programmes and camps with Young Life Eswatini, creating safe spaces for adolescents to grow emotionally, spiritually, and socially. My leadership style is empathetic, engaging, and grounded in lived experience with teen mentorship.\nIn addition to my volunteer work, I’ve held professional roles at Intsika Consultancy, Junior Achievement and LULOTE BMEP, where I developed training materials, delivered entrepreneurship workshops, and supported capacity-building initiatives that improved productivity and inspired growth. I understand the challenges young people face and I offer practical tools, strong communication skills, and a proven ability to connect across diverse backgrounds.\n\nWhat sets me apart is my ability to combine field experience, emotional intelligence, and strategic planning to drive transformation. I don’t just train I walk alongside youth as they challenge limitations and build resilience. I am confident that my passion, experience, and commitment make me the right candidate to deliver lasting impact through this programme.\n\n', 'Yes', 'Junior Achievement Eswatini, Younglife Eswatini', 'Junior Achievement, I facilitated entrepreneurship and financial literacy workshops for youth, helping participants understand key concepts like bookkeeping, budgeting, and market research. \nYoung Life Eswatini, I’ve mentored teens aged 14–19, coordinated youth camps, and led leadership development sessions. I created safe and engaging spaces where adolescents could explore their personal growth, build emotional resilience, and develop teamwork and communication skills in a community-centered environment.\n', 'Yes', NULL, '2025-07-16 17:14:56', '2025-07-16 17:14:56'),
(313, 762, '[\"documents\\/01K09PBWFXY4EW8SGRW7340CSK.jpg\"]', '[\"documents\\/01K09PBWG31FRDN8X9MZ64ZB9E.jpg\"]', 'Employed', '1. I want to help in building a better future for the youth\n\n2. To empower the youth in leading a healthy lifestyle \n\n3. To minimise challenges like HIV and teenage pregnancy \n\n4. To help the bring hope to the disabled youth', 'No', 'None', 'None', 'No', NULL, '2025-07-16 17:21:44', '2025-07-16 17:21:44'),
(314, 763, '[\"documents\\/01K09PCY9EZ3D5R23TAWH893HS.pdf\"]', '[\"documents\\/01K09PCY9GM96ZE0PPD01NKHPP.pdf\"]', 'Unemployed', 'I have worked with other young people before and I’d like  to make an impact into them changing their lives or even building their lives for the better.', 'Yes', 'Ministry of Labour and Social Security ', 'To help young people in high schools to acknowledge their talents in terms of career choices by putting them into tests; Uptitude Test (Form 3) and the Self-directed Search Test (Form 5)', 'Yes', NULL, '2025-07-16 17:22:19', '2025-07-16 17:22:19'),
(315, 764, '[\"documents\\/01K09PFD7QYTGWW3P7CSW6VXH4.pdf\"]', '[\"documents\\/01K09PFD7ZHP99A2X8BW7S7XYA.pdf\"]', 'Unemployed', 'I\'ve followed ENYC for some time and am particularly drawn to your mission of creating a conducive environment for the socio-economic development of youth. This aligns perfectly with my own passion for improving lives. The opportunity to contribute to your mindset change programs is especially exciting, as it directly supports my career goal.\n\nMy background at World Vision has equipped me with strong community engagement skills, a solid understanding of quantity surveying principles, and excellent interpersonal and soft skills, all of which are directly applicable to this role. I\'m confident I can bring this same level of dedication and proven ability to ENYC to improve and sustain the quality of life for young people. Furthermore, my collaborative approach and problem-solving mindset will enable me to seamlessly integrate with your team and contribute to a positive and productive work environment.', 'Yes', 'World Vision ', 'Was part of the community HIV youth empowerment program where I was volunteering demand creation activities in communities for increase access to HTC services. I also participated in Home based care community program through MFS where we conducted door to door services checking clients and doing refills with the team of experts from the TB HCF. I am currently part of a team that works as youth counselors.\n\n', 'Yes', NULL, '2025-07-16 17:23:40', '2025-07-16 17:23:40'),
(316, 765, '[\"documents\\/01K09PP7VZY4YBE2HE4JB1GG23.pdf\",\"documents\\/01K09PP7W4WSRYM3S7Z43PBWQ7.pdf\"]', '[\"documents\\/01K09PP7WB8G40QFZTMTZNAJ7Q.pdf\"]', 'Unemployed', 'I believe I\'m the best candidate since first and foremost I\'m the current youth meaning I relate to what the youth I\'ll be educating are going through,also I\'ve once worked with the youth I have some experience in dealing with them and lastly I\'m good in public speaking and work well with others.', 'Yes', 'SOHO', 'SOHO is a non-profit organization founded by an Adventist who happens to be an American so yearly they organized a camp whereby kids ranging from 8 up to 18years were taught lessons on growing, how to take care of themselves, they were evaluated too.', 'Yes', NULL, '2025-07-16 17:27:24', '2025-07-16 17:27:24'),
(317, 766, '[\"documents\\/01K09PYX2SBTQDF0YENMA7QDMH.png\",\"documents\\/01K09PYX2WF5BXHH9YNQKQTE80.png\"]', '[\"documents\\/01K09PYX31G98JCEYR4W58845Q.pdf\"]', 'Unemployed', 'It\'s because our youth today are facing many challenges and most of them are afraid to speak up, so I would like to be someone they can trust and speak up; a shoulder to cry on, since I was also an abuse survivor so whenever someone wants to talk I will really understand what she is going through since I also went through something similar. Teenage pregnancies and suicide cases are on the rise I would like to help government on that since these has become a national disaster.', 'Yes', 'Supper buddies ', 'Supper buddies was an adolescent focused organization whereby we were teaching and helping each other to deal with youth challenges such as peer pressure, sexual abuse etc.', 'Yes', NULL, '2025-07-16 17:32:08', '2025-07-16 17:32:08'),
(318, 767, '[\"documents\\/01K09Q7ZKMN7FP1MN975T56J40.pdf\"]', '[\"documents\\/01K09Q7ZKVXSD6XVJRBPY2TFEJ.pdf\"]', 'Unemployed', 'I am passionate about working with young people and believe i have the skills to male a positive impact in this role. I am also drawn to this organization because i believe that every young person deserves a supportive and  empowering environment.  I am eager to contribute my skills and passion to your team and help young people thrive.', 'No', NULL, 'N/A', 'Yes', NULL, '2025-07-16 17:37:05', '2025-07-16 17:37:05'),
(319, 768, '[\"documents\\/01K09Q8JN50DAJ48H4EV1SVAQT.pdf\"]', '[\"documents\\/01K09Q8JNDRKR6YW0NZG7DCY2T.pdf\"]', 'Unemployed', 'I applied for this job because I love to take care of children and adolescents because they are future citizens of the nation and some are servants of God\'s kingdom. Because I passionately love children and I have experience of working with children and their parents in community over along period of time I strongly believe that I am the best candidate for the job.', 'Yes', 'Bantwana Initiative Organization', 'I identified orphaned and vulnerable children in the community and administer a child well-being assessment to establish extent of vulnerability including the overall household socio-economic vulnerability which helped children and adolescents to access help from organization and from other stakeholders.', 'Yes', NULL, '2025-07-16 17:37:25', '2025-07-16 17:37:25'),
(320, 769, '[\"documents\\/01K09Q8W9WY782PYAGY4QA0MFR.jpg\"]', '[\"documents\\/01K09Q8WA2J3T6AR56F3JXGPT6.doc\"]', 'Unemployed', 'I am a hard worker who wants to help the teens achieved their dreams not the other way round.Even though I am fresher I assure you that I will give my best  work to my full potential so that I contribute as much as I can towards shaping the life of the teens. I will like to add that I work both as an individual contributor and also as a team member.', 'No', 'None', 'Encourage physical activities during weekends and holidays.Limit screen time and focus in their school work for good results.Teach them time management skills.', 'Yes', NULL, '2025-07-16 17:37:35', '2025-07-16 17:37:35'),
(321, 770, '[\"documents\\/01K09QHS31KVYHF01JPG029KYV.pdf\"]', '[\"documents\\/01K09QHS36BGGBWH408E2GSY96.pdf\"]', 'Unemployed', 'I am an emerging youth leader in my community, founded a youth organisation, volunteering in other youth initiatives so this opportunity is going to help me upscale my skills to meet global standards in terms of leadership skills. I also serve my Constituency as a Media Officer which is something I brought to the table myself to enhance information dispensation as we are living in Eswatini\'s most populated Inkhundla. For this reason I feel I need to upscale myself to be a proper and influential leader in my community. I am a church leader as well so the opportunity to network with like minded young people under the guidance of prosperous and influential leaders will enhance me a great deal', 'Yes', 'Youth Buzz Initiative and Green Schools Initiative ', 'I am a founder and Chairperson of Youth Buzz Initiative, which is currently based at Kwaluseni Inkhundla with a vision to grow beyond borders. We are founded on the basis of the UN 2030 Agenda incorporated in the 17 Sustainable Development Goals. We are how working more on the Paris Agreement 2015 as it seems mostly affecting our community. We are currently navigating in sustainable way to contribute in the climate action initiatives through partnerships. This are means to ensure that young people can earn a living through this measures. We are practising equality wereby the vulnerable groups are also incorporated. \nIn regards to the Green Schools Initiative, we work with schools and local organisation and companies in both private and public sectors to achieve our goals ', 'Yes', NULL, '2025-07-16 17:42:26', '2025-07-16 17:42:26'),
(322, 771, '[\"documents\\/01K09QJ9R52VRPN450CHA7EBX6.pdf\",\"documents\\/01K09QJ9R7KJK7VG97V1KRGGCW.pdf\"]', '[\"documents\\/01K09QJ9R91ZHTSERTS2VQVKV1.docx\"]', 'Unemployed', 'As a peer educator and a social worker, I am able to connect with young people to build trust and rapport. With proper training, I will be able to help shift the perspective and attitude of young people which will definitely foster personal growth, resilience and behavior change.', 'Yes', 'Eswatini', 'I worked closely with diverse population, including youth and marginalized communities. My responsibilities included advocating for Sexual Reproductive Health Rights, engaging the youth at community level creating SRHR awareness. I also advocated social accountability in the health care spectrum from policy makers, service providers and the individuals who access the services', 'Yes', NULL, '2025-07-16 17:42:43', '2025-07-16 17:42:43'),
(323, 772, '[\"documents\\/01K09R7XCC2PXM7E7XZQ28KQ7S.pdf\"]', '[\"documents\\/01K09R7XCE9YCD2PSV2Q3WRR9M.docx\"]', 'Unemployed', 'I have applied because I believe that I am the best person for this position since I have worked with young people in different communities for about three years. I started working under Pact Eswatini as a Community Mobiliser and also at Elizabeth Glaser as VMMC Mobiliser.\n\nAt university I did a Bachelor\'s degree in Social work and I am culturally competent', 'Yes', 'Elizabeth Glaser Pediatric Aids Foundation and Pact Eswatini ', 'Under Elizabeth Glaser I was educating young people about HIV prevention strategies especially voluntary medical male circumcision. And recruiting those eligible and referring them to health facilities.\nPact Eswatini \nI was educating both young and old people about covid 19 vaccine and recruiting those who are eligible to take the covid 19 vaccine', 'Yes', NULL, '2025-07-16 17:54:31', '2025-07-16 17:54:31'),
(324, 773, '[\"documents\\/01K09REEDHRC2R4W4GP0D4X5SP.jpg\"]', '[\"documents\\/01K09REEDKWZCYEDJ62XZB9NPT.pdf\"]', 'Unemployed', 'Iapplied for this youth empowerment role because I’m passionate about helping young people grow and succeed.\nI believe every youth deserves guidance, support, and the chance to realize their potential.\nMy background in mentorship and community work aligns perfectly with this mission.\nThis role allows me to make a meaningful impact and grow while serving others.', 'No', 'none', 'none', 'Yes', NULL, '2025-07-16 17:58:06', '2025-07-16 17:58:06'),
(325, 774, '[\"documents\\/01K09RHD9M1MMB6F4ENVPAF4FR.pdf\"]', '[\"documents\\/01K09RHD9RKQG1GSTX8AHQP234.pdf\"]', 'Unemployed', 'I am a young energetic lady. Who is willing to learn and help others', 'No', NULL, 'I took back 3 teenagers to school', 'Yes', NULL, '2025-07-16 17:59:43', '2025-07-16 17:59:43'),
(326, 775, '[\"documents\\/01K09RNVZZG4KPZ7W8GZBF89Z7.pdf\"]', '[\"documents\\/01K09RNW02Z77CC6H15EY9WQ9D.pdf\"]', 'Unemployed', 'With my background in Human Resources and Development Studies, I have developed a strong understanding of people development, which I now want to extend to the youth. I am passionate about empowering young people with the skills, confidence, and mindset they need to thrive and make meaningful contributions to society. Becoming a trained youth trainer will allow me to merge my professional skills with my heart for mentorship and social impact. I believe in the potential of youth and want to be part of shaping a generation that is informed, confident, and purpose-driven. This program will equip me to serve as a positive influence and help guide others toward personal and leadership growth.', 'No', NULL, 'None.', 'Yes', NULL, '2025-07-16 18:02:09', '2025-07-16 18:02:09'),
(327, 776, '[\"documents\\/01K09RVXE1GH9JGWYP55EBRW79.jpg\",\"documents\\/01K09RVXEAK213106NEDR76DDZ.jpg\"]', '[\"documents\\/01K09RVXEME7KK6H13G8WHENKC.jpg\",\"documents\\/01K09RVXESRDF0H21S64Y3QFJG.jpg\",\"documents\\/01K09RVXEW0H0DC1BC8E1NHAR5.jpg\",\"documents\\/01K09RVXF0QRVDJ9Z3DSBEFPNH.jpg\",\"documents\\/01K09RVXF48HWHS4W5W5RGQEYH.jpg\",\"documents\\/01K09RVXF91NNEREVQQB09HG9H.jpg\"]', 'Unemployed', 'I applied because i want to continue helping youth  on behavioral change, boosting self esteem through speeking, entreprenuership. To continue changing the lives of the alarming rate of the abused and killed youth. Also want to gain extra skills confidence communication listeming while changing the lives of others.  Also wish be the best assets to your company and receive multitude success stories while continuein to be a role model to others. I  feels like my skills closely match the requirement to be the rightful candidate for this position. ', 'Yes', 'World Vision Eswatini and The Luke Commission', 'While i was GBV  Outreach Worker for Word Vision the Halt project. I started by mobilising for Adolescent Girls and Young women between 15 and 24 years , Young Woman between 25 and29 years, Adolescent Boys and YoungMen between 15and 35 years and their parents or caregivers.\nAttend to GBV low risk cases. Refer abused survivors to mobile clinics and partners for assistance.\nEdicate youth on sexual reprductive health and encourage them about the importance of reporting abuse using the reporting lines. Helps AGYWs on business plan writtings those who were interested  on entrepreneurship.\nFacilitate behavioral change .\nFaciliate parenting sessions to young woman and parents on how to control emotions while raising the 2ks which are very fragile.\nRefer AGYWs and ABYMs to mobile clinic halting the spread of HIV and advice them on prep usage as a hiv prevention method. Encourage youth to start small business to minimise dependancy on partners.\nAdolescents Boys and Young Men between 15 and 35', 'Yes', NULL, '2025-07-16 18:05:27', '2025-07-16 18:05:27'),
(328, 777, '[\"documents\\/01K09RXSE8F8B4YW36KTGVTY2Q.jpg\"]', '[\"documents\\/01K09RXSEDQ7F7ECNSYKE6ZD3A.jpg\",\"documents\\/01K09RXSEGJT3842DPQF8CZDMR.jpg\"]', 'Unemployed', 'I am applying because its matches with my experience and skills,as i have been working with adolescent girls and Young Women for the past Seven 7 years. I am not too shine to stand in a big crown,my voice is loud and clear.So working  under Eswatini National Youth Council will help me to improve my experience and i hope i will gel another more experience in your company. ', 'Yes', 'Joyful Heart,Bantwana Initiative,World Vision Eswatini and SWAGAA ', 'I was help young women about businesses , I was also giving them more information about Sexually Healthy Reproduction ', 'No', NULL, '2025-07-16 18:06:28', '2025-07-16 18:06:28'),
(329, 778, '[\"documents\\/01K09S5PS49RM18GGN69HYR1Q0.jpg\"]', '[\"documents\\/01K09S5PSAJTAMS6PHYK50BYZ1.docx\"]', 'Self-Employed', 'I am someone who finds pleasure in helping others, mental health and establishment is a priority to me as I believe it drives change and chance. I believe I am the the best candidate because I work as a medium or channel for adults,youth and children meaning I can bring the together young and old and allow the message to reach everyone.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 18:10:48', '2025-07-16 18:10:48'),
(330, 779, '[\"documents\\/01K09SCRHEY5RQWEQ822QKT4XG.jpg\"]', '[\"documents\\/01K09SCRHKB7VSDBHHXKYT2H99.pdf\"]', 'Unemployed', 'I have a passion for  health and education. I believe  by sharing information and building connections can help young women to make informed decisions and adopt healthy lifestyles. I  am empathetic and able to connect with  peers on a personal level,listen without being judgemental.', 'Yes', 'Nazarene Compassionate Ministries ', 'I was providing guidance and support to my mentees,especially adolescent girls and young women by navigating the challenges of prevention,treatment  and living with HIV/AIDS\n', 'Yes', NULL, '2025-07-16 18:14:39', '2025-07-16 18:14:39'),
(331, 780, '[\"documents\\/01K09SPRTVYCXCAYJK488B0DDZ.pdf\"]', '[\"documents\\/01K09SPRV051T75JXQAW7S32WD.docx\"]', 'Self-Employed', 'I am applying for this job because my ultimate goal is to empower young people to make informed,healthy choices and to equip them with the skills and confidence they need to build successful futures.I am commited to fostering their independence,critical thinking and overal well-being.I am dedicated,hardworking and ready to contribute to ENYC.Furthermore,I am thinking I\'m the best candidate because I understand the significant influence adults can have on young people so I am committed to embodying positive values,demostating resilience ,and providing constructive guidance.I can also serve a mentor who inspires confidemce and encourages  responsible decision making.Finally,I am genuinely invested in seeing young people thrive,reach their potential and navigate the challenges of critical life stage successfully.My commitment to the well-being and development of young people is not just professional it\'s a deeply held passion.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 18:20:07', '2025-07-16 18:20:07');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(332, 781, '[\"documents\\/01K09SVC1FVQ1FYX51K0NK541S.jpg\",\"documents\\/01K09SVC1GMXEMJMBMPRFXJJFR.jpg\",\"documents\\/01K09SVC1HJE6BEXCXWV7VMDGS.jpg\"]', '[\"documents\\/01K09SVC1K3QWV11RA37D657FM.jpg\"]', 'Unemployed', 'I have applied for the position of peer counselor because I am passionate about supporting and empowering young people. I believe that many of the challenges youth face today whether emotional, social, or academic can be better addressed when they feel heard, understood, and supported by someone close to their own age. As a peer, I can offer guidance in a relatable and compassionate way, creating a safe space for others to open up and grow.\n\nI believe I am the best candidate for this role because I am a good listener, empathetic, and trustworthy. I understand the importance of confidentiality and non-judgmental support in helping peers navigate difficult situations. I am also committed to continuous learning, and I’m always willing to receive training or feedback to improve my skills. Being a peer counselor is not just a position for me it’s a calling to make a meaningful difference in the lives of others. I’m confident that I can contribute positively to the team and help uplift the youth we serve. Lastly I would like to put my social work learning to practice.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 18:22:38', '2025-07-16 18:22:38'),
(333, 782, '[\"documents\\/01K09SZMWB4GD4385SGKWWD8C1.jpg\",\"documents\\/01K09SZMWEATKWE5VK8E47KKAV.jpg\",\"documents\\/01K09SZMWK4XSB913J0NGTFFNZ.jpg\"]', '[\"documents\\/01K09SZMWQ2JW36JF36ST8BRPB.doc\"]', 'Unemployed', 'I am able to speak in public. I am have worked as  Diabetes educator where i teach about diabetes Mellitus in the communities. I am also able to write news paper articles. I have also spoken on radio and on television about diabetes Mellitus. ', 'Yes', 'Diabetes Eswatini i ', 'I worked in a campaign where we were registering children with diabetes Mellitus from 0-25 years of ahe to give them insulin and glucometers ', 'Yes', NULL, '2025-07-16 18:24:58', '2025-07-16 18:24:58'),
(334, 783, '[\"documents\\/01K09T0RVP4R6EZFW3VW3Y53VQ.pdf\"]', '[\"documents\\/01K09T0RVWXQTJQ16V8S0QJVJR.pdf\"]', 'Unemployed', 'I applied for this job because because of my strong background in youth empowerment, peer education, and community development, with a particular focus on adolescent girls and young women. My experience working with different organizations, especially World Vision, has prepared me to effectively influence positive behavior change, build confidence in others, and create sustainable impact in communities.\nOne of the most defining roles in my career was serving as a Business Mentor for World Vision, where I worked closely with adolescent girls and young women in my community. My main responsibility was to train and mentor them on how to start and manage small businesses. I helped them understand how to generate income, plan financially, and work as a team by forming savings groups. However, the true impact of that work went beyond business—it was about changing how these young women saw themselves. Many of them came from backgrounds where they had limited opportunities and lacked confidence in their abilities. Through our sessions and one-on-one mentorship, I helped them realize that they could be leaders, entrepreneurs, and change-makers.\nIn this role, I saw the power of mindset change in action. I guided young women to move from self-doubt to self-belief, from dependency to independence. We discussed goal-setting, overcoming fear, taking initiative, and building resilience. This is the type of transformation I want to continue encouraging as a Mindset Change Trainer. My experience has taught me that real empowerment starts when someone begins to see themselves differently, and I have developed the skills to nurture that change.\nIn addition to my work with World Vision, I currently serve as an AGYW SRH Advocate for SAfAIDS Eswatini, a position I have held since September 2024. In this role, I mobilize adolescent girls and young women in the Manzini communities and facilitate sessions on sexual and reproductive health (SRH). I educate them about their rights, health services, and the importance of making informed decisions. I also refer those who need medical attention or support to local clinics. This role has allowed me to expand my facilitation and communication skills while remaining connected to the real-life issues young people face daily.\nThese two roles—empowering youth economically and supporting them in making healthy life choices—have shaped my understanding of what it takes to be an effective peer educator and mindset change facilitator. I have learned how to connect with people on a personal level, how to deliver information in ways that are clear and relatable, and how to motivate others to take action in their own lives. My approach is people-centered, respectful, and encouraging. I do not force change—I help people see it for themselves and walk alongside them as they grow.\nWhat also makes me the best person for this role is my commitment and passion. I believe in the power of young people and especially in the potential of adolescent girls and young women. I know the challenges they face because I have worked closely with them. I have sat in community meetings, conducted one-on-one sessions, and seen transformation happen when people are given the right support and encouragement. I am passionate about helping others discover their voice and live with purpose.\nFurthermore, I am reliable, organized, and always ready to learn. I value teamwork, respect deadlines, and take every task seriously. I bring professionalism, empathy, and a positive attitude to everything I do. I am also flexible and able to adapt to different groups and community settings.\nIn conclusion, my combined experience with World Vision, SAfAIDS, and other community projects has given me the confidence, knowledge, and skills needed to be an effective Mindset Change Trainer. I know how to inspire change, mentor with care, and create safe spaces where learning and growth can happen. I am ready to take on this role and make a meaningful contribution to building empowered, resilient, and goal-driven individuals across our communities.', 'Yes', 'World Vision Eswatini, Safaids Eswatini, Super Buddies Club', 'My role was train and mentor adolescent girls and young women to start their own businesses and promote savings groups for World Vision Eswatini serving as a business mentor. Currently I am volunteering at Safaids Eswatini as an AGYW SRH advocate where I mobilise girls in communities and facilitate on SRH topics and Rights. For Super Buddies Club, I was a community adolescent treatment supporter where I provided psychosocial Support to adolescents and young people living with HIV empowering them on one on one sessions to become better versions of themselves and to be resilient. ', 'Yes', NULL, '2025-07-16 18:25:35', '2025-07-16 18:25:35'),
(335, 784, '[\"documents\\/01K09T1VAVTFK96D5BJDGRNGVS.pdf\"]', '[\"documents\\/01K09T1VAXHTEZ7NJ1BP36K03P.pdf\"]', 'Unemployed', 'I\'m passionate about helping the young to grow and educating the youth. I have good communication skills and the ability to address a group.', 'Yes', 'Young Life Eswatini', 'We were helping adolescents and youth to connect to Christ or I would say we were bringing them close to Christ. ', 'Yes', NULL, '2025-07-16 18:26:10', '2025-07-16 18:26:10'),
(336, 785, '[\"documents\\/01K09T4EJWXKTFS5PTMWF0Z7WR.pdf\"]', '[\"documents\\/01K09T4EJZGWD88A59DMEMTXDX.pdf\"]', 'Unemployed', 'The reason for this application is that the job resonates with my enthusiasm and passion. In addition, I offer a wide range of skills in the arear of psychology that involves critical thinking, counselling,organisational development and statistics just to mention a few. My education and training has better prepared my abilities in dealing with diverse individuals and an insightful understanding of human behaviuor. In that way I am at the right standing to advocate for mindset change and other behavioral intricacies. I am a responsible person who works hard,pays attention to detail, and eager to learn from others. Of course I am a key figure in the community and respected as well. This is quite evident in my ability to work with all community members including the authorities at chieftaincy level. I welcome any opportunity to speak about this application and anything else that may require clarity. Thank you.', 'Yes', 'Taiwan Fund for Children and Families ', 'Simo did  volunteer work At Taiwan Fund for Children and Families (TFCF). The scope of the job involved helping children and the youth to adapt in their livelihood in the different care points where they recieve support from TFCF. The job involved career guidance, assessment of their relationships with care givers, studying sessions and future focused care and support. These aimed at strengthening their adaptability and resilience as marginalised young people. Other activities involved coordinating trips,camps and other informative gatherings with the young people. In summation, as a volunteer at TFCF we focused on the above highlighted activities amongst others.', 'Yes', NULL, '2025-07-16 18:27:35', '2025-07-16 18:28:46'),
(337, 786, '[\"documents\\/01K09TPWXECARB32M2BTDCHQ6T.pdf\"]', '[\"documents\\/01K09TPWXJJPKA5R7B5D9HJFC1.pdf\"]', 'Unemployed', 'Working at Bantwana has help me to again good comunication skills,am good at working with adolescent people, I am to adapt in different environment at a short period.Some young people have different characteristics but working with them in the past few months has helped me to be able to adapt in different characters. I am a good organiser, I can invited  different type of people to be part of the  project an help young people achieve their goals.', 'Yes', 'Bantwana Intiative', 'As a Life mentor ,I worked with the young people in my community to live in  a HIV free environment by encouraging those who are on art to stay on treatment and advising the negative to be on prep. I help to limit the rate of drop out by encouraging the adolescent girls to be on contraceptives and it has help those who are already seaxully active.This has also help them to independent to avoid the GBV rate in the  community ,as it has been seen that a large number of teenagers are abuse by their partners.', 'Yes', NULL, '2025-07-16 18:37:40', '2025-07-16 18:37:40'),
(338, 787, '[\"documents\\/01K09TQZ8XNZDHE07FMYA1H4H3.jpg\",\"documents\\/01K09TQZ9266XH3T73Q3YGDCW2.jpg\",\"documents\\/01K09TQZ96FRYWZEYVJAMKPT8J.jpg\"]', '[\"documents\\/01K09TQZ9DJHRST887BMRQ8RNY.jpg\"]', 'Unemployed', 'I am interested in this position because I have seen it as a great opportunity for me to grow and help empower the youth. My experience at World Vision makes me to be the best candidate for the job. I am a hard worker with good listening and communication skills. I can work in collaboration with other people and I am confident that I will bring valuable contributions to your team.', 'Yes', 'World Vision', 'I was a life mentor under the Likusasa ngeletfu project. I provided adolescents girls and Young women with HIV and violence prevention sessions through group sessions and one on one meetings. I also offered guidance, support encouragement for those who wanted access SRH services.', 'Yes', NULL, '2025-07-16 18:38:15', '2025-07-16 18:38:15'),
(339, 788, '[\"documents\\/01K09TRDN65RPZZZXTYNCC8CD2.pdf\"]', '[\"documents\\/01K09TRDN83YRYF1CWVMFY23EQ.docx\"]', 'Unemployed', 'I have applied because I am passionate about youth empowerment and believe in creating mindset shifts that promote growth and responsibility. My experience working with adolescents in community projects has prepared me to effectively engage and support young people. I am a good communicator, empathetic, and committed to seeing others succeed. These qualities, along with my leadership and volunteer spirit, make me the ideal candidate for this programme.', 'Yes', 'Enactus Eswatini and Catalyze ', ' I participated in Enactus Eswatini projects where I collaborated with university peers to develop and promote youth-led entrepreneurial initiatives like Beta Juice. Through Catalyze, I engaged with rural youth, collecting data and encouraging them to participate in agricultural programs. These experiences helped inspire, support, and empower young people to believe in their potential and take action in their communities.', 'Yes', NULL, '2025-07-16 18:38:30', '2025-07-16 18:38:30'),
(340, 789, '[\"documents\\/01K09V383F9XVQJ0QPVTVNYWZ8.jpg\"]', '[\"documents\\/01K09V383M1TTSST6FQVTJ6AHP.jpg\"]', 'Unemployed', 'I love interacting with young people, also I would love to share what I learned from the groups that I joined. Then lastly, I want to give back to the community and be an asset.', 'Yes', 'World vision ', 'Was part of a group called young heros, where we were taught about HIV & AIDS prevention, STIs, and how to raise and save money.', 'Yes', NULL, '2025-07-16 18:44:24', '2025-07-16 18:44:24'),
(341, 790, '[\"documents\\/01K09VBN79N7VCE7N0502A6NVV.jpg\",\"documents\\/01K09VBN7AHKQZCE2BVXYBGNDZ.jpg\",\"documents\\/01K09VBN7B14ERG3ZF0RH3SA97.jpg\"]', '[\"documents\\/01K09VBN7CD1J3WZX6QNQWHXA3.pdf\"]', 'Unemployed', 'I am the right candidate for the job because I possess the necessary skills, relevant experience and qualifications. I am flexible and responsive when it comes to my work. I also have a strong bond with young people because I am able to present complex ideas in a clear and concise manner.', 'Yes', 'Adventures in Missions (AIM', '*Identifying and enrolling orphaned and vulnerable children through community mobilization.\n*Conducting group favilitations on weekly bases on biblical lessons, grief councelling, sexual orientation etc.\n*Mending friendships through play, one on one sessions, homevisits to gain children\'s trust and be their safe place.', 'Yes', NULL, '2025-07-16 18:49:00', '2025-07-16 18:49:00'),
(342, 791, '[\"documents\\/01K09VHZJJX3ZG490P8595F181.pdf\"]', '[\"documents\\/01K09VHZJP648FPMJJ6BDRTWED.pdf\",\"documents\\/01K09VHZJXP9MM2RBHC36R8EE9.pdf\"]', 'Unemployed', 'I have a growing concern about the young generation being wasted in this life；in drugs , sexual immorality , depression , etc, hence I have this desire in my heart to educate them about this things ,give them an ear to voice out their concerns and also equip them with the right mindset and character to survive and be successful in this life.', 'Yes', 'Young life', 'Drug Abuse Awareness. We equipped young people about the short and long term consequences of drug abuse which includes addiction and health risks. Most of them showed a positive response towards it and promised to abstain from using drugs and also educate others.', 'Yes', NULL, '2025-07-16 18:52:27', '2025-07-16 18:52:27'),
(343, 792, '[\"documents\\/01K09VMP5QSZM6Z4VT92XJGJZE.pdf\"]', '[\"documents\\/01K09VMP5WQ501R8C529H78YWE.pdf\"]', 'Unemployed', 'I have applied because I like seeing my peers developing in their lives in as much as I want to develop mine . I like bringing change of mindset to my peers so that they think positive about their lives and well-being. \n\nI am kindly the best candidate because my experience in working with young people , and my advocacy skills aligns me very well with your esteemed organisation as a peer educator. My service will bring a huge change in this position. \n\n', 'Yes', 'Family life association of eswatini ', 'My role is representing young people both national and international,  where I would advocate for them to have better health in terms of  their sexual reproductive health rights (SRHR). Advocating for them to have friendly health services.  Also I would look for job opportunities for the youth .', 'Yes', NULL, '2025-07-16 18:53:56', '2025-07-16 18:53:56'),
(344, 793, '[\"documents\\/01K09VP66SM5AS3WTHMR4Q6D9H.jpg\",\"documents\\/01K09VP66VS5QYA57FXYGYC6MX.pdf\"]', '[\"documents\\/01K09VP66ZEKWBN9MKH58TD7GB.docx\"]', 'Unemployed', 'Firstly, I\'m an unemployed graduate. I sincerely believe that being a teacher and peer educator collaborate in educationing young people. Secondly, as a young adult I was once an adolescent, a teenager. I share similar life experiences with young people. Therefore, young people are likely to listen to me  as thier peer educator because they relate to me. I want to enhance my skills as a teacher while socialising and working with others.', 'No', 'NONE', 'Firstly, at the previous school I worked at, I have taught my learners on how to boost their self esteem especially the girls. Secondly, I provided learners with one-on-one support to challenges they encountered. Helping some of the girls with sanitary pads. ', 'Yes', NULL, '2025-07-16 18:54:45', '2025-07-16 18:54:45'),
(345, 794, '[\"documents\\/01K09VQPA2MPAW7YWYRY68KS25.pdf\"]', '[\"documents\\/01K09VQPA9KKHMQ8TKVG82SP8R.pdf\"]', 'Unemployed', 'I applied because I\'m passionate about the youth, I believe in equipping them with the right tools to survive out there. I\'m the right candidate because I have a experience as an peer educator and it is something I love doing since I have been a volunteer for FLAS as peer educator under Youth Action Movement for 5 years now. I\'ve also worked with ENYC through the TYAs which were introduced to help the youth. I\'m one person who always advocate for youth empowerment in my community which is the reason I have been nominated twice to stand as a candidate for my community in the elections for member of parliament position.', 'Yes', 'Youth Action Movement ', 'I was a peer educator for youth action movement in the shiselweni region. I helped the youth in teaching them SRH education both in and out of school youth.', 'Yes', NULL, '2025-07-16 18:55:34', '2025-07-16 18:55:34'),
(346, 795, '[\"documents\\/01K09VTE4FN8GX2RW4H467SNHE.pdf\"]', '[\"documents\\/01K09VTE4HM0A50M86464YW1MY.pdf\"]', 'Unemployed', 'As a passionate and purpose-driven young woman in the field of Economics and Statistics, I believe I am the best candidate for the Trainer position at the Eswatini National Youth Council (ENYC). My academic background, leadership experience, strong communication skills, and deep commitment to youth development uniquely position me to contribute meaningfully to the Council’s mission of empowering the youth of Eswatini.\n\nCurrently in my final year at the University of Eswatini, studying Economics and Statistics, I have developed a strong foundation in critical thinking, problem-solving, research, and data analysis. These skills are not only essential in my field of study but are also transferable to effective training, facilitation, and youth mentorship. My ability to break down complex concepts into simple, practical lessons makes me an effective communicator, especially with diverse groups of young people. As a trainer, I am confident that I can deliver impactful sessions that are both informative and inspiring.\n\nOne of my greatest strengths is my ability to connect with people. I have always been drawn to youth-centered initiatives, and my involvement in several community and campus-based projects has equipped me with the interpersonal and facilitation skills required for this role. I have volunteered in mentorship programs, participated in peer-to-peer academic support groups, and assisted in organizing events aimed at promoting education, career development, and leadership among young people. These experiences have taught me how to lead with empathy, listen actively, and create a safe space for open communication — qualities essential in a training environment.\n\nMy experience as a research assistant during a group project at the university also reflects my organizational and instructional abilities. I was responsible for helping coordinate fieldwork, compiling data, and presenting findings on the rural-urban educational gap and its impact on economic development in Eswatini. Through this, I honed my public speaking, presentation, and teamwork skills. I have since grown more confident in leading workshops, presenting information clearly, and engaging an audience — all of which are key responsibilities in the role of a trainer.\n\nWhat sets me apart is my genuine passion for youth development. I am inspired by ENYC’s commitment to shaping a generation of empowered, knowledgeable, and socially responsible young people. Having grown up in Eswatini and experienced first-hand the challenges that many young people face in education, employment, and leadership, I am determined to be part of the solution. I believe that youth need more than just access to information — they need mentors, trainers, and advocates who will equip them with practical skills, encourage their self-confidence, and help them become active participants in nation-building. I am ready to be one of those people.\n\nIn addition, I bring a high level of professionalism, discipline, and dedication to every role I take on. I am punctual, organized, and capable of managing responsibilities independently or as part of a team. I value continuous learning and always seek opportunities to grow both personally and professionally. My willingness to take initiative, adapt to new situations, and remain committed to my goals even in challenging environments reflects my resilience — a quality I believe is essential in working with and training youth.\n\nFinally, my background in Economics and Statistics gives me a unique edge in delivering training that is not only motivational but also data-driven. I understand how to use evidence to support learning outcomes and how to measure the impact of youth programs effectively. This analytical approach, combined with my people skills and passion for service, enables me to contribute to the development of high-quality, impactful training content.\n\nIn conclusion, I believe I am the best candidate for the Trainer position at ENYC because I bring together academic knowledge, hands-on experience, leadership, and a heartfelt commitment to youth empowerment. I am excited about the opportunity to serve, to learn, and to grow alongside the young people of Eswatini. I am ready to make a meaningful difference and contribute to the transformative work of the Eswatini National Youth Council.', 'Yes', 'Bantwana Bantwana and Makhelwane Eswatini', 'Doing workshops about self awareness, and overcoming Bullying in my school and community with Bantwana. Also a peer educator. Conducted a study on bridging the skills gap and what impacts the youth of Eswatini, made a report and advice on policy making with Makhelwane Eswatini.', 'No', NULL, '2025-07-16 18:57:04', '2025-07-16 18:57:04'),
(347, 796, '[\"documents\\/01K09VV7753Q353086JEXDM3RP.jpg\"]', '[\"documents\\/01K09VV7787XVKAAJJHHG5XPD6.pdf\"]', 'Unemployed', 'I am a high school teacher by proffession,hence a can play a crucial role in mentoring the youth,this opputunity can also add into my experience,before i get into the field of teaching,I also believe that am the 21st century teacher good with modern technology,general knowledge and gifted in poetry and story telling', 'No', 'none', 'none', 'Yes', NULL, '2025-07-16 18:57:30', '2025-07-16 18:57:30'),
(348, 797, '[\"documents\\/01K09W0GBSCQR925KFRND9EXZE.pdf\"]', '[\"documents\\/01K09W0GBXAP39XAMY5SG9HH2S.pdf\"]', 'Unemployed', 'As a teacher with 2 years of experience and a volunteer with Youth Link, I have developed strong facilitation and mentoring skills. I am passionate about empowering young people with entrepreneurial skills and knowledge. \n\nMy experience with Youth Link has deepened my understanding of the challenges and opportunities facing young entrepreneurs. I have enjoyed coaching and training youth, helping them craft business plans, and witnessing their growth ans being an entrepreneurship coach. I am confident that my expertise and passion for youth development make me an ideal candidate.I would be proud to contribute to an organization that shares my values and is dedicated to making a positive impact on the youth lives. \n\nWith my teaching background, volunteer experience, and passion for youth development, I am confident that I possess the skills and expertise required to excel as a Youth Trainer. I am excited to bring my expertise to  Eswatini National Youth Councel and contribute to the growth and development of young people.', 'Yes', 'Youth Link Eswatini ', 'As an organization we have identified and supported the youth by providing guidance and encouragement to help them achieve their entrepreneurial goals. I have shared my knowledge and expertise, equipping them with essential skills to start and grow successful businesses. Lastly, I have worked closely with the youth and coached them to craft business plans.', 'Yes', NULL, '2025-07-16 19:00:23', '2025-07-16 19:00:23'),
(349, 798, '[\"documents\\/01K09W5M20XNR84M4EWBP877Z8.jpg\"]', '[\"documents\\/01K09W5M27RN7XPKFRBB5NTQ6K.jpg\",\"documents\\/01K09W5M2ANHSHFCBD9PHJCY4B.jpg\",\"documents\\/01K09W5M2CAE0K8B4CGPHRG2JC.jpg\",\"documents\\/01K0B236JAK7XMGSYYF6D6P2G9.jpg\"]', 'Unemployed', 'I am a dedicated and passionate individual with experience in youth mentorship. I have worked in the community before thus making it more easier to work for the organization .I am the best candidate because of my skills that  I have (attached to my CV).I can also do Teamwork perfectly with no supervision ', 'Yes', 'Cabrin Ministries organization ', 'I was teaching Adolescents girls about financial literacy. This helped young people to know how to save their money and start their own businesses to get profit and overcome their situations at their home. I was also teaching young people about Entrepreneurship, these lessons helped them to start their businesses in the community with the little money they had thus keeping them busy while expanding their money.', 'Yes', NULL, '2025-07-16 19:03:11', '2025-07-17 06:05:57'),
(350, 799, '[\"documents\\/01K09WAWTYB97Z58RCYN7QJV5P.pdf\"]', '[\"documents\\/01K09WAWV1FA88GQMVQPBKPX9T.docx\"]', 'Unemployed', 'To better engage with the younger children and to give them a voice where they feel they are unheard.  And to give them a better understanding of their world', 'No', 'None', 'None', 'No', NULL, '2025-07-16 19:06:04', '2025-07-16 19:06:04'),
(351, 800, '[\"documents\\/01K09WCAXZ8DS8JSJ43E6R79W3.jpg\",\"documents\\/01K09WCAY2W40070252X4VH9BD.pdf\",\"documents\\/01K09WCAY43KAB8MSTHJZFK765.pdf\"]', '[\"documents\\/01K09WCAYD99MGJGC9J8F92M8E.docx\"]', 'Unemployed', 'During my teaching practice at Madlangampisi High School I developed love to young people and I love to see them becoming something tomorrow. Also I see a bright future to young people. I\'m the best candidate because I\'m passionate and have the ability to connect with young people from diverse backgrounds. Lastly I do love young people. ', 'No', NULL, 'None ', 'Yes', NULL, '2025-07-16 19:06:51', '2025-07-16 19:06:51'),
(352, 801, '[\"documents\\/01K09WNEWT3C0DBXVH9X01CS6C.pdf\"]', '[\"documents\\/01K09WNEX2CN86FP7EG4W00MJ1.docx\"]', 'Unemployed', 'I applied because I want  to continue with what I did at Rock of Hope- helping bring a sense of purpose to the youth by providing a safe space to talk about issues that affect them, to guide, encourage and inspire responsible behaviour. I believe I can do a good job because I am a real people’s person and I\'m quite sensitive, observant and flexible, I have the ability to pick up things in an environment, tensions as well as emotions and this allows me to see the good in all things. I have the discipline to appreciate simple things and I\'m compassionate and it is not strange for me to get together with others. And this allows me to have great perceptions about people and being a real team player. I don\'t have to be in charge to use my abilities because I am known to get the job done from behind scene, I do my best to see a project to fruition. I have a graceful demeanour that makes it easy working with other people and because I am warm and this radiates from from my character, I can influence people to examine the matter from my own unique perception. I am sympathetic and understanding of other people and people turn to seek comfort from me which they always get. I am also gentle and imaginative and persuasive.', 'Yes', 'Rock of Hope (USAID funded project)', 'I was working as a peer counsellor helping young marginalised youth of manzini with psychological support and teaching them life skills such as CV writing, basic computer skills and enterprenuership. During the project we were able to reach over 300 youth of manzini and offered  counselling, and helping solve family conflict between parents of the youth and the youth itself. ', 'Yes', NULL, '2025-07-16 19:11:50', '2025-07-16 19:11:50'),
(353, 802, '[\"documents\\/01K09WQ146XCKVXQ8Y0D142P3Y.jpg\",\"documents\\/01K09WQ147GVFZPRCQHDMDN80Y.jpg\",\"documents\\/01K09WQ14AHJ05DPSEZMAPZ9JE.jpg\"]', '[\"documents\\/01K09WQ14C6FT2QEZ0VFVBSEBQ.jpg\"]', 'Self-Employed', 'I am applying to be a Peer Educator because I am passionate about making a positive impact in my community, especially among the youth. As a young and energetic individual, I understand the challenges young people face and the importance of providing guidance and support. I am deeply involved in my community, where I am trusted and respected, having been elected as Secretary for both the community leadership and the electricity scheme committee. This demonstrates my ability to lead, communicate effectively, and handle responsibilities with integrity. I am also fully committed to attending and participating in all training sessions, as I believe in continuous learning and growth to serve others better.\n\n', 'Yes', 'Enactus', 'I worked with them for a short period of time while i was in the University. I worked as Graphic Designer.', 'Yes', NULL, '2025-07-16 19:12:41', '2025-07-16 19:14:28'),
(354, 803, '[\"documents\\/01K09WW10MXJM76BYWE3XN7YA3.pdf\",\"documents\\/01K09WW10P2XZDF0T56WSPHFGP.pdf\"]', '[\"documents\\/01K09WW10RRB9E71ZSQ635KBDV.pdf\"]', 'Unemployed', 'I am excited to apply for the position of Peer Educator because I am passionate about promoting healthy behaviors, empowering my peers, and making a positive impact in my community. I believe my strong communication skills, empathy, and leadership qualities position me as a suitable candidate for this role.\n\nMy ability to relate to my peers, listen actively, and provide non-judgmental support allows me to connect effectively and encourage positive change. I am committed to sharing accurate information, fostering a safe space for open dialogue, and inspiring others to make informed decisions.\n\nAdditionally, I possess a proactive attitude, the ability to collaborate with diverse groups, and a genuine desire to educate and motivate my peers. These qualities, combined with my dedication to promoting well-being, make me confident that I can excel as a peer educator and contribute meaningfully to your program.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 19:15:25', '2025-07-16 19:15:25'),
(355, 804, '[\"documents\\/01K09WWE8W2VYPGYMVZCT2W9KS.pdf\"]', '[\"documents\\/01K09WWE92TYWRMX2DZCHJPQM0.pdf\"]', 'Unemployed', 'I am excited to apply for the Youth Mindset Change Trainer Programme, as I believe I possess the qualities and passion necessary to excel as a mindset change trainer. While I may not have formal experience in training or education, I have a profound understanding of the importance of mindset shifts and the transformative impact they can have on individuals and communities.\n\nThroughout my life, I have encountered diverse groups of young people, each with unique challenges and perspectives. These experiences have given me valuable insights into the barriers that hinder personal growth and community development. I firmly believe that mindset is at the core of overcoming these challenges. A positive mindset is not only essential for personal success but also for fostering a supportive and collaborative community. As a candidate for this program, I bring a deep understanding of how mindset changes can empower individuals to reach their potential and contribute meaningfully to society.\n\nMy motivation to apply for this programme stems from my commitment to creating a positive environment for young people. I have always been drawn to initiatives that empower youth, and I see this role as a unique opportunity to make a difference. I understand that mindset change is not a one-time event but a continuous process that requires dedication, empathy, and patience. I am eager to learn from experienced trainers and to develop the skills necessary to facilitate engaging and impactful sessions in my community.\n\nDespite lacking direct experience in formal training or education roles, I have cultivated essential skills that will serve me well in this position. I am an active listener, which allows me to understand the perspectives and concerns of others. This skill is vital in fostering trust and creating an open environment where young people feel safe to express their thoughts and feelings. Additionally, I am a strong communicator, and I thrive in collaborative settings. My ability to connect with others will enable me to encourage open dialogue and promote meaningful discussions during community sessions.\n\nI understand that part of being an effective mindset change trainer involves being adaptable and responsive to the needs of the audience. I am willing to put in the effort to learn about various strategies and methodologies that can be employed to facilitate mindset changes effectively. I have a proactive attitude towards acquiring knowledge, and I am eager to engage with resources that will enhance my ability to lead community sessions successfully.\n\nFurthermore, I have a strong desire to serve as a role model for my peers. I believe that by embodying the principles of positive mindset change in my own life, I can inspire others to do the same. My experiences in overcoming challenges and seeking personal growth will enable me to share relatable stories and practical insights during training sessions. I want to help create a ripple effect in my community, motivating others to embrace a mindset that fosters resilience, collaboration, and personal development.\n\nIn conclusion, I am confident that my passion for youth empowerment, combined with my understanding of the significance of mindset change, makes me an ideal candidate for the Youth Mindset Change Trainer Programme. I am ready to embrace the opportunity for growth that this program offers, and I am committed to using what I learn to make a lasting impact within my community. I look forward to the possibility of working alongside like-minded individuals who share my vision for creating a supportive and empowered youth community across all 59 Tinkhundla. Together, we can drive meaningful change that enhances the lives of many young people. Thank you for considering my application.', 'No', NULL, 'None', 'No', NULL, '2025-07-16 19:15:38', '2025-07-16 19:15:38'),
(356, 805, '[\"documents\\/01K09XA1HYDRWP2YY2J6TH5ZJJ.pdf\"]', '[\"documents\\/01K09XA1J4R96T3P3N7EHZV9CC.pdf\"]', 'Unemployed', 'I\'ve applied for the Youth Mindset Change Trainer Programme because I deeply believe in the power of empowering young people in Eswatini. My passion stems from seeing the incredible potential within our youth, often coupled with the challenges they face in navigating a rapidly changing world. I want to be an active part of the solution, helping to cultivate a generation that is not only resilient and innovative but also equipped with the right mindset to seize opportunities and drive positive change in their communities.\n\nThis program directly aligns with my personal commitment to fostering growth and development. The idea of contributing to a shift in perspective, where young people see challenges as stepping stones and embrace a proactive approach to their lives, genuinely excites me. I am eager to learn, contribute, and collaborate with the Eswatini National Youth Council to make a tangible difference.', 'Yes', 'Nhlangano Town Council', 'I was assisting in hosting youth dialogues like focus group discussions in their different wards as means of understanding their needs, challenges, and aspirations of as residents of Nhlangano, clean up campaigns (keep Nhlangano clean) encouraging youth to uphold a clean environment.', 'Yes', NULL, '2025-07-16 19:23:04', '2025-07-16 19:23:04'),
(357, 806, '[\"documents\\/01K09XNSVZCEZB7NJX2YW0K2N2.jpg\"]', '[\"documents\\/01K09XNSW6X48Z00WVJ4XDD00B.png\"]', 'Unemployed', 'My name is Zinhle Gwebu, a 30 years old lady residing from Ndubazi. I am a dedicated somebody.\n\nI feel like I can be the best candidate for this position because I have trained for 3 years to deal with the people\'s mindset, as I did my Primary Teachers Diploma at Southern Africa Nazarene University.\n\nI feel like I can work well with so many diverse people in different locations without any problem. I can work with any kind of a person in order to transform them to become what we want from them.', 'No', 'N/A', 'None', 'Yes', NULL, '2025-07-16 19:29:29', '2025-07-16 19:29:29'),
(358, 807, '[\"documents\\/01K09YHEZ91AY9KAHAR32YHZ5D.zip\"]', '[\"documents\\/01K09YHEZHS9N105ECDV6Q3XKJ.PDF\"]', 'Unemployed', 'I\'ve applied for the Youth Mindset Trainer program because I\'m really passionate about helping young people discover just how amazing they are and what they can achieve. I truly believe that learning to have a positive and resilient mindset early on is super important for handling life\'s ups and downs and grabbing new opportunities. I know every young person is unique, with their own stories and challenges, and I\'m excited to bring my energy, commitment, and knack for connecting with people to make a real, positive difference in their lives through this program.', 'Yes', 'Youth Action Movement (YAM)', 'I was actively involved in mobilizing out-of-school youth to central locations for dialogues on Sexual Reproductive Health and Rights (SRHR), entrepreneurship, and life skills. My role also included facilitating referrals to youth-friendly facilities for health check-ups, and the distribution of HIV self-test kits and condoms.', 'Yes', NULL, '2025-07-16 19:44:36', '2025-07-16 19:44:36'),
(359, 808, '[\"documents\\/01K09YKGKQV8RG1NN7AH08Y85J.jpeg\"]', '[\"documents\\/01K09YKGKVJYHDC5A30S9CQ53D.docx\"]', 'Unemployed', 'I want to be part of the youth improvement program in my area.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 19:45:43', '2025-07-16 19:45:43'),
(360, 809, '[\"documents\\/01K09YNCW44M83KX8E5FGTB850.pdf\"]', '[\"documents\\/01K09YNCW9GSWP5K0ER0FDTXFE.pdf\",\"documents\\/01K09YNCWB1ZEZE3G6Z2ZQWN97.pdf\"]', 'Self-Employed', '\nWith a heart driven by purpose and a voice committed to change, I am writing to express my keen\n interest in joining the Eswatini National Youth Council as an Adolescent Peer Educator. As a 26 years old LiSwati passionate about youth development, education, and health empowerment, I believe this role offers a powerful platform to serve, uplift, and inspire fellow adolescents across the Kingdom of Eswatini.\n\nI have been actively involved in peer-led initiatives focused on promoting sexual and reproductive health and rights (SRHR), mental health awareness, life skills training, and leadership among young people. I understand that adolescents relate best to someone who speaks their language, understands their struggles, and walks with them-not ahead of them. As a peer educator, I bring not only knowledge, but empathy, lived experience, and an unwavering belief in the potential of young people to lead change in their communities.\n\n\n\n \nWhat makes me an ideal candidate is my ability to communicate complex issues in a relatable,\nculturally sensitive way-whether in a classroom, community gathering, or one-on-one. I thrive in\nspaces that encourage dialogue, mutual respect, and personal growth. I am confident speaking about critical issues such as HIV prevention, teen pregnancy, gender-based violence, self-esteem, and goal-setting, and I approach each engagement with openness and respect.\n\nJoining the Eswatini National Youth Council would be both a profound honor and an exciting opportunity to expand my impact, working with a visionary team that has long championed youth empowerment in our country. I am ready to serve with dedication, creativity, and a commitment tolearning and growing in this role.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 19:46:45', '2025-07-16 19:46:45'),
(361, 810, '[\"documents\\/01K09Z04BAC1GS0A5S7CS499H1.jpg\"]', '[\"documents\\/01K09Z04BC30ERF7SRAX9MDWVJ.jpg\",\"documents\\/01K09Z04BEXYVWEFJK21QBEGNA.jpg\",\"documents\\/01K09Z04BHZJGH73ZK7YCFCZ37.jpg\"]', 'Unemployed', 'I am the best candidate because all requirements needed here I have them especially i have a passion of working with youth in the society bringing hope to the hopeless,more over I have the experience neended so that\'s why i am the best candidate.Thank you.', 'Yes', 'young heroes ', 'I was a business mentor working with adolescent girls and young women giving them session on how to stay independent and start businesses to support families and themselves giving them hope if there is no job too hire you ..you can be an employer yourself as a young woman.\nI did mentorship to them where we help the adolescent girl or young woman with her dream come to pass.\nguiding her till she sees her dream to practice.', 'Yes', NULL, '2025-07-16 19:52:37', '2025-07-16 19:52:37'),
(362, 811, '[\"documents\\/01K09ZB9F6KD51XJGEXEPHXDXH.jpg\",\"documents\\/01K09ZB9FBVCDQ1S9F4H8KZJQM.jpg\"]', '[\"documents\\/01K09ZB9FE8VAEDKF3E3G2N6W7.docx\"]', 'Self-Employed', 'Working with youth is my passion. For the past six years I have been a home visitor. I realized that my experience and skills would make me a perfect fit for the position. I am confidential, respectful I respect the dignity of all people she or he works with, this includes not discriminating, abusing, belittling or demanding.\nTo crown it all, I am a role model. For the youth to open up that someone must have integrity, and inspire confidence leading by example', 'Yes', 'Lusweti and Nazarene Compassionate Ministries Eswatini ', 'I was a home visitor \nConduct HIV Testing Screening for adolescents and children with HIV negative  status and unknown HIV status. Furthermore, Provide C/ALHIV treatment adherence at household level. Moreover assist teen moms access PNC/ PMTCT. Mobilize adolescents girls for access to clinical services ( HTS, SRH, PEP, PrEP)', 'Yes', NULL, '2025-07-16 19:58:42', '2025-07-16 19:58:42'),
(363, 812, '[\"documents\\/01K09ZC2D3GCXZMRCYS0A0SVRW.pdf\"]', '[\"documents\\/01K09ZC2D900J53X8Y3FWJ7KD9.pdf\"]', 'Unemployed', 'I believe so much in the youth. It is my wish to see the young progressing in life. That can be achieved by creating a good environment for the youth, where they going to be equipped with a number of skills in life. Our education system does not touch all aspects of life, an external body to touch on the other aspects of life is vital. It is my wish to join such body since a have the zeal and the zest to contribute to our youth since I am one of them. In the past few years I have served as a volunteer at Imbali Foundation, one of the organization with the mission of being concern with the life of the youth. My education background may contribute also, I was once a member of some campaign that was basically paying attention on mental awareness. Which is a very challenging issue on the youth, that brought some attention that much attention should be paid to the youth. ', 'Yes', 'Imbali Foundation ', 'Educating with about the significance of virginity to young girls and boys. Visiting different chiefdoms during the preparation of Umhlanga Ceremony and also planning and distributing Imbali Foundation merchandise during the ceremonies. ', 'Yes', NULL, '2025-07-16 19:59:08', '2025-07-16 19:59:08'),
(364, 813, '[\"documents\\/01K09ZH3F7KVP6ZF5S9W0WXFW7.jpg\"]', '[\"documents\\/01K09ZH3FA54DMHM6EBJ09J3CT.jpg\"]', 'Unemployed', 'I believe that I\'m a strong candidate for this job because I have worked with teenagers before as I was a Peer Counsellor Educator in school and currently I\'m a youth leader in church. Also I\'m very good with teenagers and they tend to open up to me even without asking deep questions ( the atmosphere that I create makes it easier for young people to tell me anything) . I strongly believe that if I can be part of your team a lot of changes can be visible and you won\'t regret your decision ', 'No', 'None', 'None', 'No', NULL, '2025-07-16 20:01:53', '2025-07-16 20:01:53'),
(365, 814, '[\"documents\\/01K09ZME3NCSQE151BJP85CA35.pdf\",\"documents\\/01K09ZME411G24403HYCFXHKVJ.jpg\",\"documents\\/01K09ZME4JZ3YVSKTNSG8JNY0S.jpg\"]', '[\"documents\\/01K09ZME4YAPZGWP33E61B9VA6.pdf\"]', 'Unemployed', 'I witness a lot of teenage pregnancy in my area.\nLots of abortions and abuse as women tend to depend on men rather than working.\nHigh levels of drug abuse\n\n', 'Yes', 'TzuChi Organization, Malkerns Youth Empowerment ', 'Empowering the youth through charity on both organization also through scholarship. ', 'Yes', NULL, '2025-07-16 20:03:42', '2025-07-16 20:03:42');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(366, 815, '[\"documents\\/01K09ZRB8THKTYGSEFFQ4CZWVP.jpg\"]', '[\"documents\\/01K09ZRB8YA83HVVJ6Z34A598Y.docx\"]', 'Self-Employed', 'I am applying for the Youth Mindset Change Trainer Programme because I am deeply passionate about youth development and believe that a positive mindset is one of the strongest tools we can equip young people with to help them overcome life’s challenges and make meaningful contributions to their communities. Growing up in Eswatini and studying at the University of Eswatini has given me firsthand understanding of the social, academic, and economic pressures young people face daily. I have seen how limiting beliefs, lack of confidence, and absence of supportive environments can hinder young people’s potential. These experiences have inspired me to actively be part of solutions that empower youth to believe in themselves, adopt a growth mindset, and take charge of their own futures.\n\nMy motivation for applying is rooted in my own journey as a Peer Counsellor and Educator at the University of Eswatini, where I have been privileged to provide counselling and mentorship to my fellow students. In this role, I offered confidential support to students facing various challenges such as academic stress, mental health issues, and personal problems. By actively listening, guiding, and referring students to relevant support services, I created a safe space where they felt seen and heard. I also took part in planning and hosting wellness events to raise awareness about critical issues like suicide prevention, substance abuse, and gender-based violence. These experiences have strengthened my facilitation and communication skills, and showed me the power of education, dialogue, and community support in changing mindsets.\n\nIn addition to counselling, I have developed strong leadership and organizational skills through my position as a class representative at the university. Acting as a liaison between students and faculty, I ensured that the concerns and welfare of my classmates were heard and addressed. This experience taught me to be proactive, solution-oriented, and a reliable team player — qualities I believe are essential for any Youth Mindset Change Trainer who must engage effectively with young people and community stakeholders alike.\n\nFurthermore, my participation in the Enactus Programme at UNESWA equipped me with entrepreneurship and innovative problem-solving skills. I contributed to developing and growing business ideas that addressed community needs. This cultivated my belief that a shift in mindset is the foundation for entrepreneurial thinking and self-reliance. I am confident that I can use these experiences to encourage youth to believe in their ideas, become resourceful, and take initiative in their lives.\n\nBeyond university, I have continually sought opportunities to broaden my skills and perspectives. For example, my recent training with the Woman Farmer Foundation in Climate Smart Agriculture expanded my knowledge of sustainable practices and gender-inclusive approaches in community development. This experience demonstrated my commitment to lifelong learning and community impact, qualities that align perfectly with the objectives of the Youth Mindset Change Trainer Programme. My internship with Livestock and Game Ranch further strengthened my sense of responsibility, attention to detail, and ability to work in diverse environments — all while maintaining professionalism and a strong work ethic.\n\nI believe my personal values, skills, and dedication make me an excellent candidate for this programme. I am a good communicator, an empathetic listener, and a team player — as evidenced by my roles as Peer Counsellor, Educator, and class representative. I have the ability to design and facilitate engaging sessions, drawing from my experience hosting wellness events and working with diverse groups. I am also innovative, quick to learn, and adaptable, which allows me to respond to the unique needs of different communities.\n\nWhat truly sets me apart is my genuine passion for making a positive impact. As someone who has benefited from supportive mentorship and mindset coaching myself, I know firsthand how transformative it can be. I want to give back by helping other young people build self-esteem, resilience, and motivation to pursue their goals despite life’s obstacles. I am excited about the opportunity to learn new facilitation skills, share ideas with other volunteers, and contribute to building a generation that believes in itself.\n\nI am also confident that I will be a reliable and committed trainer. My ability to manage my time effectively, balance multiple responsibilities, and maintain professionalism in every role I undertake shows that I am ready to meet the demands of this programme. My hobbies, like reading and playing volleyball, have taught me discipline, teamwork, and the importance of continuous self-improvement — qualities that align with the spirit of the Youth Mindset Change Trainer.\n\nIn conclusion, I am applying for this programme because I believe in its vision of empowering young people through mindset change, and I am ready to contribute my experience, skills, and enthusiasm to achieve this goal. I look forward to growing personally and professionally through this opportunity, while inspiring my peers to unlock their potential and become positive change-makers in their communities.\n', 'Yes', 'Uneswa Peer Counselor and Educator', 'As a Peer Counselor and Educator at the University of Eswatini (UNESWA), I had the privilege of playing an active role in supporting and empowering young people throughout their academic journey. In this role, I provided a safe, non-judgmental space for fellow students to express their personal, academic, and social challenges. Through confidential one-on-one sessions, I offered guidance, emotional support, and practical advice, helping students navigate the pressures of university life.\n\nOne of my key responsibilities was facilitating educational workshops and awareness campaigns on issues affecting young people, including mental health, stress management, substance abuse, healthy relationships, and academic motivation. I worked closely with the Peer Counselors Association to plan and deliver these activities in a way that encouraged open dialogue and peer-to-peer learning. By doing this, I helped to reduce the stigma surrounding mental health and encouraged students to seek help when needed.\n\nAdditionally, I acted as a bridge between students and professional services. Whenever a student needed further assistance beyond what I could offer, I connected them with qualified counselors, health services, or academic advisors. This ensured that students always had access to the right support system. I also collaborated with other student leaders to identify common challenges faced by students and advocated for their needs to the university administration.\n\nMy role required strong listening and communication skills, empathy, and confidentiality. I learned how to respond to sensitive situations with care and discretion, building trust with those who reached out to me. I believe my efforts contributed to creating a supportive campus environment where students felt valued and understood.\n\nBeing a Peer Counselor also enhanced my leadership, teamwork, and organizational skills. I learned to manage my time effectively to balance my academic responsibilities with my commitment to helping others. I developed and led presentations, facilitated group discussions, and engaged students through creative methods such as interactive activities and social media awareness campaigns.\n\nOverall, my experience as a UNESWA Peer Counselor and Educator strengthened my passion for youth development and mental health advocacy. It inspired me to continue creating positive change in my community by helping young people build resilience, make informed choices, and unlock their full potential. I am proud of the impact I made and look forward to applying these skills in future roles that involve working with young people.', 'No', NULL, '2025-07-16 20:05:50', '2025-07-16 20:05:50'),
(367, 816, '[\"documents\\/01K09ZXADR5NEQVB543QCPXQXD.pdf\"]', '[\"documents\\/01K09ZXADYP8AF4NNRE5PF6SM6.docx\"]', 'Employed', 'With my Bachelors degree in Community Development, I feel like I have so much potential combined together with my work experience. However I feel like I need more exposure, and probably training as I\'m passionate about changing communities through sustainable development and all this starts with the youth.', 'No', 'None', 'Currently I am working at Luyengo Clinic doing general mini laboratory diagnosis. I used to do outreach programs where I offered HIV Testing and counselling, STI screening and diagnosis, distrubute condoms etc. By doing so, the youth was able to know their HIV status and therefore able take charge of their health and wellbeing. This also helped them gain more knowledge about HIV/AIDs thus lowing it\'s spread.', 'Yes', NULL, '2025-07-16 20:08:33', '2025-07-16 20:08:33'),
(368, 817, '[\"documents\\/01K0A03SA9TFFWMWM7DYBA1DKF.pdf\"]', '[\"documents\\/01K0A03SAENVX3ZZAJMPJ3ZAQ7.pdf\"]', 'Unemployed', 'As someone whom is passionate about youth development and also improving the youth when I saw the advertisement I was happy so therefore I thought I should apply in order to help other young people to Achieve their dreams. As someone whom is involved in many youth activities I think with my experience about youth I think that\'s what makes me the best for the job ', 'No', 'None', 'I am Youth coach in my community where I work with young people from age 13to19 I have helped them through coaching them about football and also about Important life lessons ', 'Yes', NULL, '2025-07-16 20:12:05', '2025-07-16 20:12:05'),
(369, 818, '[\"documents\\/01K0A0G5TZ94Z3GVN0YGEZAMTE.pdf\",\"documents\\/01K0A0G5V2Z00Y5SA6YG0EXNDM.pdf\",\"documents\\/01K0A0G5V4MGQV2Z0ZEWV6P7MB.pdf\"]', '[\"documents\\/01K0A0G5V6QMH6F34DCP9YRTCN.docx\"]', 'Employed', 'Working with young people.has always been my passion.I am a young woman that used to engage in risky behaviors, up until one person believed in me and took their time to inspire change.I did before the worst happened.Thats what I want to do.Change the world with one young person at a time.', 'Yes', 'Georgetown University ', 'We worked on inspiring behaviors change in young women and later integrated to young men.Dissermination of information on HIV prevention sessions as well as mentorships.', 'Yes', NULL, '2025-07-16 20:18:51', '2025-07-16 20:18:51'),
(370, 819, '[\"documents\\/01K0A0JFBK7HNWGTJAEZ6BE3SC.pdf\"]', '[\"documents\\/01K0A0JFBXRNQE1YMRJ0YQVHVE.pdf\"]', 'Unemployed', 'I applied because I am passionate about youth development and believe in the power of mentorship to transform lives. My experience as an ICT tutor and community facilitator has equipped me with the communication, leadership, and technical skills needed to effectively engage and empower young people. I am a dedicated, energetic, and solution-oriented individual who connects easily with youth and adapts to different environments. I am confident that my background, enthusiasm, and proven ability to inspire young minds make me the ideal candidate for this programme.', 'Yes', 'Genesis Seven (Piggs Peak iHub)', 'As an ICT tutor during the STEM Project at Ubombo Sugar Limited and a Facilitator at Piggs Peak iHub, I trained high school students and out-of-school youth in basic computer skills, internet use, and digital literacy. I helped them gain confidence in using technology, improve their communication, and become more employable in today’s digital world. This experience allowed me to mentor, motivate, and inspire young people to believe in their potential and embrace personal growth.', 'Yes', NULL, '2025-07-16 20:20:06', '2025-07-16 20:20:06'),
(371, 820, '[\"documents\\/01K0A0V90XCF0C5HSXTHEC857J.jpg\",\"documents\\/01K0A0V911CRC1EMYM0BD1T0AP.jpg\"]', '[\"documents\\/01K0A0V915X6X0PPHTE7S5VT90.docx\"]', 'Unemployed', 'Firstly, this is an opportunity for job to me as now I am unemployed. As a social worker I have a desire to work with young people in my community. Development is in my veins, so, I want to share the aspects of development. I believe in team work,so I want to bring together the young people and form corporate businesses that will help them to create job opportunities. Some of the young people are stuck in drugs addition so , I am looking forward to help them by providing necessary counseling and something to do except for drugs abuse.', 'Yes', 'Family Life Association of Swaziland, Youthlet and Baphalali ESwatini Red Cross Society ', 'We were providing leadership skills to young people. We also give them moral and social support. Giving them health talks sessions. ', 'Yes', NULL, '2025-07-16 20:24:55', '2025-07-16 20:24:55'),
(372, 821, '[\"documents\\/01K0A15T70SPHKQH27TA53JK9X.pdf\",\"documents\\/01K0A15T7568ASZ0T2M9XPETN5.pdf\"]', '[\"documents\\/01K0A15T7GW114VWXXKHATG3SQ.pdf\"]', 'Unemployed', 'The reason for applying is because I have passion and love for young people while on the other side it will help me to gain work experience. \n\nI believe lm the best candidate for this position because as an aspiring teacher my background in education has equipped me with the ability to plan and deliver meaningful lessons that teach life skills that will shape the future of young people and help them discover their potential and take charge of their future. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 20:30:40', '2025-07-16 20:30:40'),
(373, 822, '[\"documents\\/01K0A1ESA24QCNQ2RAECT566Q5.heic\"]', '[\"documents\\/01K0A1ESA9E0951Y78B1TSHRJ0.heic\"]', 'Unemployed', 'The reason why I have applied to be trained as a trainer is because I\'m willing to gain more knowledge.With the knowledge i will get,a huge number of youth will benefit from me because I will then train them.I can also provide working opportunities to the unemployed(starting and runs businesses).Lastly,I am the best candidate for the job because I will be so obligate to see the country\'s economy progressing.', 'No', 'none', 'none', 'Yes', NULL, '2025-07-16 20:35:34', '2025-07-16 20:35:34'),
(374, 823, '[\"documents\\/01K0A1KYXHHG5PC28KZAS8WXY6.jpg\"]', '[\"documents\\/01K0A1KYXQ4MAHMEQJ4EFVQYCW.docx\"]', 'Self-Employed', 'I have applied for the Youth Mindset Change Trainer Programme because I am passionate about youth development and believe in the power of positive mindset transformation to drive change in communities. As a young person who understands the challenges faced by adolescents and youth in Eswatini, I want to be part of the solution by equipping others with the tools and perspectives that can help them lead better lives.\n\nI am the best candidate for this opportunity because I have practical experience working with young people from different backgrounds, which has sharpened my communication, leadership, and facilitation skills. I hold a background in community development and have participated in leadership programs such as the Fort Worth Sister Cities International Leadership Academy and Toastmasters Youth Leadership Program. These experiences have shaped me into a respectful, committed, and community-oriented individual.', 'Yes', 'UNICEF, FLAS, LUSWETI, JA ESWATINI, ENACTUS ', '•	FLAS (2014 – 2017) \r\n- Conducted mobile outreach programs on sexual/reproductive health  \r\n- Facilitated workshops for youth on HIV prevention and safe practices  \r\n- Collected and reported community feedback to program coordinators  \r\n\r\n• UNICEF (Radio programme presenter)(2012 – 2013) \r\n- Researched and hosted weekly segments on child development topics  \r\n- Conducted street interviews to gather community perspectives  \r\n- Scripted educational content for young audiences  \r\n\r\n• Junior Achievement Eswatini (2018) \r\n- Led a student-run business venture from planning to execution  \r\n- Managed team of 5 members in product development and marketing  \r\n- Presented business progress to judges and won\n\n\n•	ENACTUS  (2022 – 2025) \r\n- Researched and hosted weekly segments on child development topics  \r\n- Conducted street interviews to gather community perspectives  \r\n- Scripted educational content for young audiences  \r\n\r\n', 'Yes', NULL, '2025-07-16 20:38:23', '2025-07-16 20:38:23'),
(375, 824, '[\"documents\\/01K0A1S4KRSS018FZZC0XCHFR3.pdf\"]', '[\"documents\\/01K0A1S4M0JWX8PABJ13XQ2NQX.pdf\"]', 'Unemployed', 'As someone with a strong background in education, and a genuine passion for youth development, I am deeply committed in making a positive impact in the lives of young people. This opportunity aligns perfectly with my values, skills, and desire to contribute meaningfully to the growth, confidence, and emotional well being of young people. I have had the priviledge of working with different learners from different backgrounds, abilities and personalities. This has taught me that everyone is unique , with their pwn special strengths, challenges and stories. I have learnt the importance of acknowledging every individual so that they feel seen, heard, and valued. In my daily interactions, I have learnt to be a mentor, a guide, a listener and most impotantly, a friend. Being part of the organisation will allow me to extend the same dedication. One of the qualities I believe will be valuable for this role is my ability to communicate effectively. I am a very strong communicator who listens with empathy, speaks with clarity, and adapt my language according to the age and emotional state of the person I\'m engaging with. I believe that my communication skills will make me communicate with them in meaningful ways. With that being said, I bring a clear understanding of diversity and the importance of emotional intelligence in working with young people. This has taught me not to judge but to adapt in any situation. I have applied because I want to make a difference and to contribute positively to the community.', 'No', 'None ', 'None', 'Yes', NULL, '2025-07-16 20:41:13', '2025-07-16 20:41:13'),
(376, 825, '[\"documents\\/01K0A1ZW9J7RVVVD1JMZDEFCFK.jpg\"]', '[\"documents\\/01K0A1ZW9XR6E83FGGFR0QH83J.jpg\"]', 'Unemployed', 'I have once worked with adolescent girls and young women in my community piggs peak for 3 years I know what must be done to improve the community especially the young women for me it won\'t take long to adapt to the work I need to do or be sent to do to my community and I am a hard working person ', 'Yes', 'Youngheroes', 'I mentored young people gave them knowledge in financial literacy gave them startups so they could live n not depend on parents ', 'Yes', NULL, '2025-07-16 20:44:54', '2025-07-16 20:44:54'),
(377, 826, '[\"documents\\/01K0A22XZ5SD4DFYD72MMY62Q5.jpg\"]', '[\"documents\\/01K0A22XZ8X6GZNQKS6ARGS6CY.jpg\"]', 'Unemployed', 'Am self motivated, determined, I am high,don\'t allow anything to make me lose focus, am self driven,i work under pressure.Am good at motivating other young girls not to give up on their dreams but to fight until they make it in life,cause nothing comes easy in this life.', 'Yes', 'World vision(Hearlt)', 'Was a member', 'No', NULL, '2025-07-16 20:46:34', '2025-07-16 20:46:34'),
(378, 827, '[\"documents\\/01K0A2DGQBSH51B29R5WNXZZJ6.pdf\"]', '[\"documents\\/01K0A2DGQDD8V242B2482V18EK.docx\"]', 'Self-Employed', 'I believe I’m an ideal candidate because I lead with excellence, purpose, and passion. I have strong communication skills, work well under pressure, and know how to manage and lead projects with a deep sense of ownership and accountability. Whether it’s coordinating a team or headhunting talent, I approach each task with dedication and strategic thinking.\n\nI’m also an active member of my church, where I’m deeply involved in youth focused initiatives. Helping young people grow, find direction, and be empowered is something I’m truly passionate about. I care deeply about youth reform and creating safe, inspiring spaces where young people can thrive.\n\nAn opportunity like this is something I’ve been waiting for a platform where I can bring both my skills and my heart to the table. I’m ready to contribute, lead, and make an impact that reflects the values I live by every day.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 20:52:21', '2025-07-16 20:53:03'),
(379, 828, '[\"documents\\/01K0A2FW8N0HJ3QPPY0ZPAXFCB.pdf\",\"documents\\/01K0A2FW8SGX2BJ8EF43MVZJVY.pdf\",\"documents\\/01K0A2FW8X5E5X6KKA650NBQPN.pdf\"]', '[\"documents\\/01K0A2FW8ZT2E0AHCD3RV3XQJF.pdf\",\"documents\\/01K0A2FW95BM8SKPYSVMVQX9X9.jpg\"]', 'Unemployed', 'My professional experiences, including my role as a health practitioner with the Ministry of Health, have provided me with valuable opportunities to engage with and support young people. Furthermore, my time as a DSA for Letshego Eswatini honed my communication and interpersonal skills. I have also previously volunteered as a motivator for learners at my former high school on multiple occasions, and I recently applied for a peer educator project focused on youth engagement. As an aspiring teacher, I am deeply committed to working with young people to foster a brighter future, a commitment further reflected in my active membership of my church\'s youth committee.\nI am confident that I meet all the minimum qualifications and requirements for this programme. I am a fast learner, highly adaptable, and eager to contribute significantly to the success of this project. My background aligns perfectly with the programme\'s goals, and I am particularly drawn to the opportunity to empower young people and facilitate positive mindset change within communities.', 'Yes', 'Church Forum on HIV/Aids, FCI, MOH', 'I conducted health screenings, delivered workshops on preventative health and well-being, and provided individual counseling on issues such as sexual health, mental health, and substance abuse. My role involved educating and empowering youth to make informed decisions about their health, ensuring they had access to vital health information and services. ', 'No', NULL, '2025-07-16 20:53:38', '2025-07-16 20:53:38'),
(380, 829, '[\"documents\\/01K0A2R1EXEVTSAMJF6174C9JJ.pdf\",\"documents\\/01K0A2R1F3RX977TJ9F8M5VG77.pdf\"]', '[\"documents\\/01K0A2R1F99M4GZ9HCABXB5C30.pdf\"]', 'Unemployed', 'What prompted me to apply for this opportunity is the propitious experience that I have in community work as well as working with various groups of people. I have worked for Kwakha Indvodza which is a male mentoring organization as an office administrator assistant to mention a few and I have been engaged as a community health outreach worker for Fhi360 and recently I was employed as an Enumerator for the Imbeleko National Dynamic Social Registry Household Census where I was deployed at Kubuta Inkhundla.', 'Yes', 'Kwakha Indvodza ', 'At Kwakho Indvodza, I was designated into numerous roles; firstly, I was responsible for the recruitment of Emajaha into the program. Also I was responsible for signing of the attendance register of anyone who came into the office. Again, I was mandated for  analysing and uploading the participants details into the system and lastly I was also responsible for organizing lunch and transport reimbursement of Emajaha during the intention trainings. ', 'Yes', NULL, '2025-07-16 20:58:06', '2025-07-16 20:58:06'),
(381, 830, '[\"documents\\/01K0A309NGJATM9K414ES7STS0.jpg\"]', '[\"documents\\/01K0A309NRS243TW077KPXYABW._pdf\"]', 'Unemployed', 'I believe I have all that it take to bring a positive change in my community and the country at large focusing on the youth as it is the future for the nation, bringing out a sound minded generation will sustain the future of the country in the different aspects of the world we are living in. ', 'Yes', 'Prison fellowship Eswatini ', 'I have been a youth counselor and a peer educator helping the youth on background influence and developing skills for entrepreneurship and dealing with issues of substance abuse. ', 'Yes', NULL, '2025-07-16 21:02:36', '2025-07-16 21:04:52'),
(382, 831, '[\"documents\\/01K0A30TCCRAKJAZ5C61876XQX.pdf\"]', '[\"documents\\/01K0A30TCMGEH4C0WDH81P953Q.pdf\"]', 'Unemployed', 'I\'m excited to apply for the Youth Mindset Change trainer programme, where I\'ll have the opportunity to train and empower young people in our community. Although I don\'t have direct experience working with adolescents, my background as a teacher has equipped me with the skills to connect with young minds and foster growth. I\'m eager to adapt my teaching expertise to this new context and contribute to shaping the next generation\'s mindset. I\'m passionate about making a positive impact and believe my enthusiasm, combined with the organization\'s guidance, will enable me to make a meaningful difference in the lives of these young individuals.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 21:02:53', '2025-07-16 21:02:53'),
(383, 832, '[\"documents\\/01K0A4DMBCHHH441KAGW7CM99N.pdf\"]', '[\"documents\\/01K0A4DMBK3NCF3N979ADGYXD6.pdf\"]', 'Unemployed', 'I applied for this job because I like to work with younger people and provide positive impact to them as they grow. I am the best candidate for this job because I am friendly which makes younger people to feel comfortable around me, also I am younger in age which makes me have the same problems and experience our youth are facing on our todays life.\n', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 21:27:22', '2025-07-16 21:27:22'),
(384, 833, '[\"documents\\/01K0A4N3AB9XWGGFV71BMVT4BJ.jpg\"]', '[\"documents\\/01K0A4N3AK0Q9CYVTJZZCJQFVE.pdf\"]', 'Unemployed', 'I am excited to apply for the Youth Mindset Change Trainer Programme because I am passionate about empowering young people to reach their full potential. As a Consumer Sciencentist, I have developed strong skills in understanding human behavior, needs, and motivations.\n\nThroughout my academic journey, I have been drawn to topics that explore the intersection of psychology, sociology, consumer behavior and Community Development. I believe that understanding the complexities of human behavior is crucial in designing effective training programs that can inspire positive change in young people.\n\nAs a student, I have had opportunities to engage with diverse groups of people, and I have developed strong communication and interpersonal skills. I am confident that my ability to connect with people from different backgrounds and age groups will enable me to effectively engage with young people and facilitate meaningful discussions.\n\nMy degree in Consumer Science has equipped me with knowledge of human behavior, motivation, and decision-making processes. I am eager to apply this knowledge in a practical setting, working with young people to help them develop a growth mindset, build resilience, and cultivate positive attitudes towards life.\n\nI am particularly drawn to this programme because it aligns with my values of empowering young people, promoting positive change and being a community developer. I believe that every young person deserves the opportunity to reach their full potential, and I am excited about the prospect of being part of a team that shares this vision.\n\nAs a candidate, I bring a fresh perspective, enthusiasm, and a willingness to learn and grow. I am confident that my unique blend of academic background, communication skills, and passion for youth empowerment make me an ideal candidate for this programme.\n\nThank you for considering my application. I look forward to the opportunity to contribute to and learn from the Youth Mindset Change Trainer Programme.', 'Yes', 'World Vision Eswatini ', 'Mobilizing youth and helping them to have entrepreneal skills such as Sewing and helping them make household detergents like Liquid Soap, Handy Andy and Fabric softener and also helping them make community gardens in order to sustain their lives. ', 'Yes', NULL, '2025-07-16 21:31:26', '2025-07-16 21:31:26'),
(385, 834, '[\"documents\\/01K0A5EX83YK8JSQ2DV5AF0PJV.jpg\",\"documents\\/01K0A5EX85R6HKKZ59HJ63V9BV.jpg\"]', '[\"documents\\/01K0A5EX88BABG1F655VX7BPXW.jpg\"]', 'Employed', 'I am applying for this position because I am used to work with the youth ,even the youth around Gege inkhundla knows me because, I was not working for my community but I was working for the whole inkhundla,,I am committed to my work.', 'Yes', 'World Vision (The Halt)', 'I teaching the young adolescence boys about HIV prevention, GBV cases ,money choices on how they should use their money and do savings and also sharing boys stuff and cleanliness.', 'Yes', NULL, '2025-07-16 21:45:32', '2025-07-16 21:45:32'),
(386, 835, '[\"documents\\/01K0A5H9F0M5BQPHKS1BTH3EMV.pdf\"]', '[\"documents\\/01K0A5H9F26813TD56BFWZFSRH.docx\"]', 'Unemployed', 'I have a diploma in community development,I also do voluntary work at Vusumnotfo.I am a trusted member in my community and sometimes I assist in community project for example savings group,I serve as a secretary for a community saving club consist of women and youth.', 'Yes', 'Vusumnotfo', 'I did voluntary work,I also train youth on the importance of saving and credit. ', 'Yes', NULL, '2025-07-16 21:46:50', '2025-07-16 21:46:50'),
(387, 836, '[\"documents\\/01K0A5T8K0WGWEWVS8E8WB9D5E.pdf\"]', '[\"documents\\/01K0A5T8K57M5MHQ747VKKWD6Y.docx\"]', 'Unemployed', 'have worked hard in previous jobs to develop specific and necessary soft skills for this position. I am a highly organized person, which makes me a great choice to manage working with the youth.l am also very adaptable. I can work under pressure. I am partinate working with the youth', 'Yes', 'Baylor college of medicine', 'Educate and support ALHIV with treatment literacy,adherence,sexual reproductive health,psychosocial support and home visits. ', 'Yes', NULL, '2025-07-16 21:51:44', '2025-07-16 21:51:44'),
(388, 837, '[\"documents\\/01K0A6C54FRAY30KJHVFF4SNH4.pdf\",\"documents\\/01K0A6C54HCQ2FGF4Q73CXRJXF.pdf\"]', '[\"documents\\/01K0A6C54MFFZ0HAYYAQER7R5K.png\"]', 'Employed', 'As a high school teacher with two years of experience teaching Life Orientation, a subject that covers; personal growth, social and emotional intelligence, sexual health and rights and responsibilities, I have seen firsthand the impact that positive role models and guidance can have on young people\'s lives. My background in English has honed my communication skills, allowing me to effectively engage with diverse audiences.\n\nI am confident that I am the best candidate for this role because my teaching experience has equipped me with the ability to facilitate engaging sessions and build rapport with participants. Additionally, my project management course has given me the skills to plan and execute community sessions efficiently.\n\nI am a strong communicator, team player, and dedicated individual who is passionate about driving positive change. I am excited about the opportunity to join the team and contribute to the program\'s success.\n', 'No', NULL, 'None.', 'No', NULL, '2025-07-16 22:01:31', '2025-07-16 22:01:31'),
(389, 838, '[\"documents\\/01K0A6GJ17YAWTCQ8FDERFBMSE.pdf\"]', '[\"documents\\/01K0A6GJ1B5ABQNYSK7TNSQCV2.pdf\"]', 'Unemployed', 'I am interested in this position because during my time as a student teacher I had the privilege of working closing with youth , this experience not only enhanced my teaching abilities but also deepened my understanding of the challenges the youth face.\nI am to create engaging programs that resonate with students and encourage open discussions on important issues. I am committed to fostering a safe and inclusive environment where youth feel comfortable sharing their thoughts and experiences.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 22:03:55', '2025-07-16 22:03:55'),
(390, 839, '[\"documents\\/01K0A6Q38GVPW1222AWZG0S3KW.pdf\"]', '[\"documents\\/01K0A6Q38MBADBRV72GXBB6B3W.pdf\"]', 'Self-Employed', 'Highly dedicated and passionate primary school teacher with over seven years experience working with adolescent girls and young women creating a nurturing and engaging learning environment.I posses excellent communication skills and mentorship and solid commitment to promoting every child social, emotional and cognitive development.', 'Yes', 'Nazarene Compassionate Ministries ', '. Mobilizing adolescent girls (10-19) and young women (20-29) for facilitating HIV prevention sessions \n.one on one health mentorship sessions where by the adolescent will have a healthy goal to and I was supporting her to reach her goal \n. encourage the young women to take family planning commodities and to prevent unwanted pregnancies and also prevent getting HIV\n.we also encourage those who were already on treatment to adherence to have a healthy and a long live\n. house to house enrollment assessment\n.outreach health referrals\nI helped the youth by bringing hope to them,by encouraging them to attend my sessions and sharing ideas with other girls some girls noticed that they were living under GBV and the didn\'t know until we have a session about GBv,we also have Mobil clinics which come on the community and the nurses were youth friendly and some young women were also to attend vocational training through our project.\n', 'Yes', NULL, '2025-07-16 22:07:29', '2025-07-16 22:07:29'),
(391, 840, '[\"documents\\/01K0A6V0BQR00SSV8JZB2A8A7M.pdf\"]', '[\"documents\\/01K0A6V0BT78DBBXRD5ZFS5MD4.pdf\"]', 'Unemployed', 'I am a highly motivated and results oriented Psychology graduate with an experience in both clinical and industrial settings. I possess strong communication, interpersonal, critical, analytical, organisational and problem solving skills. I am passionate about applying my Psychological knowledge and skills in your organisation. I am flexible to changes and I can be able to work under pressure and less or no supervision.', 'Yes', 'Public Sector HIV AIDS Coordinating Committee ', 'I provided child therapy and group therapy and help those who are victims of gender based violence. I provided counseling and psychotherapy to them and help them with coping mechanisms and I provided them with Psychological interventions.', 'Yes', NULL, '2025-07-16 22:09:37', '2025-07-16 22:09:37'),
(392, 841, '[\"documents\\/01K0A78ZHJYZ3S75R2S87XYCK7.jpg\",\"documents\\/01K0A78ZHPER6DHTW8CZ5TRGGY.jpg\",\"documents\\/01K0A78ZJ2M6R3YQ4A0C6GY1P8.jpg\"]', '[\"documents\\/01K0A78ZJ75JYEABKYRSESB64T.doc\"]', 'Employed', 'I applied because I believe in myself that I can do the work with all my efforts, also I have been working with young people I know how they behave and how to deal with them as am also a young person too, my appearance to them can also motivate them. ', 'Yes', 'SAFAIDS Organization ', 'I work as SAM Champion where I do health talks with Adolescents on Sexual Reproductive Health Rights and also help them issue tickets on the tablets placed at the facility. ', 'Yes', NULL, '2025-07-16 22:17:15', '2025-07-16 22:17:15'),
(393, 842, '[\"documents\\/01K0A7C2TC02E48FZEG6WRF2ZH.pdf\"]', '[\"documents\\/01K0A7C2TJB1RTKZ7YH5NSV7K4.doc\"]', 'Unemployed', 'I applied because I like organizations that deal with impacting the youth and bringing change to the community.  Being of the Youth Mindset Change Programme will me and the community in bringing change and meaningful impact especially on the youth.\n \nI am the best candidate for this job because I am a committed and responsible individual who can work with people effectively. Being passionate about youth development I believe it is the best step to impact  youth development. ', 'No', 'None', 'None ', 'Yes', NULL, '2025-07-16 22:18:57', '2025-07-16 22:18:57'),
(394, 843, '[\"documents\\/01K0A7MADR2SY6V8EVRY5JCXXZ.jpg\"]', '[\"documents\\/01K0A7MAEDS1XB21N231CMW83Q.docx\"]', 'Unemployed', 'I believe I\'m the best fit for this job because of the skills and expertise I\'ve gained while i was a team leader and trainer for new intakes in my former employment over the past  2 years. I think my solid foundation of skills coupled with my passion for training and mentoring young people at work, can help me thrive in this role and benefit  at the same time.', 'No', NULL, 'none', 'Yes', NULL, '2025-07-16 22:23:27', '2025-07-16 22:23:27'),
(395, 844, '[\"documents\\/01K0A7Q46TG0N76VVQNBJCE8M4.jpg\"]', '[\"documents\\/01K0A7Q475PSZY937GTJDDW9KD.jpg\"]', 'Unemployed', 'I am a responsible hard worker. I am dedicated, organised and follow instructions. I am also an excellent team worker who is willing to learn and develop new skills. I\'m aslo in need of money ', 'Yes', 'Khulisa Umntfwana ', 'Teach them about HIV/AIDS, GBV\nEmpowers the youth to become leaders\nDistributed Sanitary Pads to the Youth ', 'Yes', NULL, '2025-07-16 22:24:59', '2025-07-16 22:24:59'),
(396, 845, '[\"documents\\/01K0A88EN9GXJPFX1J1ZVNBCF5.pdf\",\"documents\\/01K0A88ENBVWKHRNRT24FYC7EG.pdf\"]', '[\"documents\\/01K0A88ENDAB3JAPDB1C26G7SF.pdf\"]', 'Employed', 'With my capability in educating and training minds I possess great ability to effectively contribute to the ENYC training programme and advance its objectives in furnishing young people with skills and knowledge they require for socio-economic betterment. I posses a significant understanding of programme mornitoring and evaluation practices and fundamentals of project management which is key to an effective implementation of the training program. My interest in this opening is also driven by my ambition to influence change and contribute to people empowerment and development programmes that intends to shape their current and future livelihood and the development of their society. I am also keen in laying down proffessionals and personal skills to execute initiatives that aim to advance the course of achieving sustainable development in our society through knowledge sharing and equipping young people with relevant and necessary skills and knowledge that will elicit resilience, productivity as well as independence. Moreover I perceive this opportunity for me as a catalyst to attain growth and advance my goal to become a significant change maker in Eswatini.', 'Yes', 'Luyengo Youth Empowerment Programme ', 'I have founded the Luyengo Youth Empowerment Programme with an aim to assist the youth in my community to attain socio-economic growth and development. Since the organization is in its foundation phase so far I have managed to gather school going youth to conscientize them on how to attain their academic achievement, curbing  prevailing social behavioral issues such as the use of intoxicating substances, teenage pregnancy and as well on how they can improve their selves to become productive. Lastly I am in the process to advance the objectives of the programme by enhancing its effectiveness and implementing more initiatives to help and improve socio-economic well being of our young people and the development of our society at large.', 'No', NULL, '2025-07-16 22:34:26', '2025-07-16 22:38:51'),
(397, 846, '[\"documents\\/01K0A8BRBQ1F2B86W74NGQ1Q2M.pdf\"]', '[\"documents\\/01K0A8BRBXDAV8DPXY9TTTTBKQ.pdf\",\"documents\\/01K0A8BRBYCS0HQMNG9VCBV0V7.pdf\",\"documents\\/01K0A8BRC1SAA7HN81AZYDK3R7.pdf\",\"documents\\/01K0A8BRC4H1Y0X6X6EXTN167D.pdf\"]', 'Unemployed', 'Firslty, this opportunity is the best since it is about youth empowerment. As I am a youth of Eswatini, I am interested in making the country better and conducive through engaging with government\'s projects and opportunities that will fast-track the United Nations 2030 Sustainable Goals. I am the best candidate for this job because through out my University time, I was  a Peer Counselor and Educator and I have been part of the UNDP Eswatini Student Ambassadors. This has given me experience in working with diverse communities and the youth. More than anything, this is an opportunity to learn more and influence positive change in my community. ', 'Yes', 'UNDP Eswatini ', 'I was accepted to be part of the UNDP Eswatini Student Ambassadors. The programme was made for only twenty outstanding University of Eswatini students. Through the programme, I interacted with the youths on their projects and business and respresent the UNDP Eswatini. ', 'Yes', NULL, '2025-07-16 22:36:15', '2025-07-16 22:37:10'),
(398, 847, '[\"documents\\/01K0A8PGYXTX316JDR3RA4HD70.pdf\",\"documents\\/01K0A8PGYZ51FY8GBZ9XGX0XAF.pdf\"]', '[\"documents\\/01K0A8PGZ0DE07A1MFGXEMVHS8.pdf\"]', 'Unemployed', 'I am applying for the Youth Mindset Trainer program because I am passionate about empowering my friends and peers, especially as a refugee who understands the challenges that young people can face. Throughout my life, I have actively sought opportunities to uplift and inspire others, and I believe this program will allow me to continue making a difference.\n\nAs a former deputy head boy and later headboy at Saim Christian High School, I have had firsthand experience in leadership and mentorship roles, working with my peers to help them achieve their goals. My time as a tutor for AS and A Levels students has also given me valuable skills in coaching and guiding others towards success.\n\nIn addition to my academic pursuits, I have been actively involved in various community initiatives. I have volunteered as a motivational speaker for Sunday school and Isidra SeyongSil orphanage (Africa Continent Mission), where I shared my experiences and encouraged young people to believe in themselves and their abilities. Moreover, I have served as a support sports teacher, promoting the importance of physical activity and teamwork among students.\n\nWith my diverse background and unwavering dedication to empowering others, I firmly believe that I am the best candidate for this program. I am eager to bring my unique experiences and skills to the Youth Mindset Trainer role, as I continue to create a positive impact in the lives of young people.\n\n', 'Yes', 'Saim Talk', 'During my time at St. Marks, I was an active member of the Interact Club, which is affiliated with the Rotary Club. Our club organized and fundraised for various community projects, such as providing food and winter clothing to the Selulasandla orphanage and other local schools. Through these initiatives, we were able to empower young people and make a positive impact in our community.\"\n\n\"At Saim Christian High School, I founded Saim Talk, a platform that brought together students and teachers to share ideas and empower young people. Through Saim Talk, we created a space where students could learn from one another, grow as individuals, and develop the skills necessary to succeed in their future endeavors.\n\n', 'Yes', NULL, '2025-07-16 22:42:07', '2025-07-16 22:42:07'),
(399, 848, '[\"documents\\/01K0A903GJ4A6HG9TPGGFXR56K.jpg\"]', '[\"documents\\/01K0A903GN1PXM68FE7263KTNY.docx\"]', 'Unemployed', 'As a graduate of Eswatini Medical Christian University with a Bachelor’s Degree in Medical Laboratory Sciences, I have developed a deep appreciation for the importance of community health, education, and empowerment. Throughout my academic journey and field experiences, I have seen how mindset and behavior directly influence health outcomes, especially among youth.\n\nI am applying for the Youth Mindset Change Trainer Programme because I believe that real transformation starts with changing how young people think about themselves, their future, and their role in society. I am passionate about being part of that change. With my background in medical sciences, I bring a unique perspective on health education, responsible living, and the value of informed decision-making.\n\nThis programme will allow me to extend my impact beyond the laboratory by engaging directly with young people, empowering them with positive mindsets and life skills. I am committed, open to learning, and eager to contribute meaningfully to my community. I see this as an opportunity to grow personally and professionally while giving back in a powerful and lasting way.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 22:47:21', '2025-07-16 22:47:21'),
(400, 849, '[\"documents\\/01K0A91YJR3STYF812EM8JE306.pdf\"]', '[\"documents\\/01K0A91YJWTJCXBB8GESXSM1N0.pdf\"]', 'Unemployed', 'I have applied because I am passionate about youth empowerment.  I want to see a present where we have the youth empowered through acquiring various skills. I wish to enhance my skills in community participation and development as a social worker with a keen interest in the wellbeing of people especially those who are vulnerable, opposed and living in poverty. Being a peer educator would therefore be a great opportunity for me to continue to enhance youth empowerment and development especially within the area of Piggs Peak, a small town where the youth may find themselves lacking in finding viable opportunities.', 'Yes', 'Taiwan Fund for Children and Families ', 'We supported young people academic journey acting as tutors for students facing various academic challenges.  We also facilitated unity and community amongst young people through interactive activities and awareness campaigns. ', 'Yes', NULL, '2025-07-16 22:48:22', '2025-07-16 22:48:22'),
(401, 850, '[\"documents\\/01K0A928FZ9PQMYP6TWTBJEM12.pdf\",\"documents\\/01K0A928G304S0HTK1STB7T74K.pdf\"]', '[\"documents\\/01K0A928G8KD0MTAWVCJH8P60C.pdf\"]', 'Unemployed', 'I believe I\'m an agent for change. Having worked with high school kids and tertiary students, I\'ve always had that impact even if at were a 2min chat. I would like to teach them about financial literacy and life in general. A lot of our youth especially in my area are exposed to drugs, alcohol and prostitution. I wish there could be more of the career guidance and mentorship opportunities. Learning skills is very important nowadays if the young people can be equipped with skills at an early age we probably wouldn\'t be seeing so much unemployment rate in the country. I would really love to be an agent for change and I believe I can also learn something from being part of this great initiative.', 'No', 'None ', 'None', 'Yes', NULL, '2025-07-16 22:48:32', '2025-07-16 22:48:32'),
(402, 851, '[\"documents\\/01K0A9A05MWY216BQWNDW3AW1Q.pdf\"]', '[\"documents\\/01K0A9A05W28HZN2CY4ZEZZA3Y.pdf\"]', 'Unemployed', 'I am applying because I genuinely care about the future of young people in Eswatini, and I believe that real change starts with a shift in mindset. Growing up in a community where many youth struggle with direction, I have seen firsthand how encouragement, guidance, and support can make a difference. I have always had a natural ability to connect with people from different backgrounds, and I am committed to using that gift to inspire and uplift others. I believe I am the right candidate because I bring both heart and responsibility to everything I do, and I am ready to serve with humility and purpose.', 'No', NULL, 'none', 'Yes', NULL, '2025-07-16 22:52:46', '2025-07-16 22:52:46'),
(403, 852, '[\"documents\\/01K0A9K0PY93SR7N9T4MV4V8VP.jpg\",\"documents\\/01K0A9K0Q2BRNRAMNDP3QBYCDS.jpg\",\"documents\\/01K0A9K0Q6561XZ0Q495A8T37H.jpg\"]', '[\"documents\\/01K0A9K0QBPQC218SC5EP8M1CE.docx\",\"documents\\/01K0A9K0QCVMN2CJG19DH1KA5G.docx\"]', 'Unemployed', 'I like to work and help young people  and my skills, qualifications and work experience makes me the best candidate for this job.I completed form 5 and and was trained on how to work with young people and also gets certificates after training. I have strong communication skills and passion for supporting others.I have ability to listen actively and create safe environment.I am a respected and trusted person in the community and I understand the structure of the community as I once work for it for 8 years. I am good in problem solving ,leadership and creativity.I will be also available anytime needed.And that makes me the best candidate for this job.', 'Yes', 'Family Life Association,Compassionate Swaziland and Bantwana Initiative ', 'I was a youth facilitator,teaching young people about how to behave themselves.Taking good decisions about life and how to make their dreams come true.I was also teaching them about HIV and AIDS and Sexual transmitted diseases on how to protect them from getting it and what to do with those already  living with it including adherence support.Teach young people about importance of family planning and the methods of it.Talking with them the importance of knowing your HIV status and providing them with mobile clinics for this services including family planning commodities.Supporting them to join worth groups and starting businesses. Also talking with them about human trafficking and mental health..All these knowledge help young people to make good decisions with their life as most of them are affected by lack of knowledge. ', 'Yes', NULL, '2025-07-16 22:57:41', '2025-07-16 22:57:41');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(404, 853, '[\"documents\\/01K0A9M0QHVP56YE6QNE3RC5JB.pdf\"]', '[\"documents\\/01K0A9M0QNA3P8EGC3BABX7M51.doc\"]', 'Unemployed', 'The reason I\'ve applied to be a peer educator is that I want to help other children learn and navigate life as a whole. My life alone has inspired me because growing up I had no parents, but only siblings. So support was there but not all of it. I grew up without a mother or father figure but still managed to turn my life around. Because life is life, I got pregnant while on my junior year. Luckily I finished that year and passed with flying colors. I did not let my pregnancy get into my way with my books. Later had a gap year and went back to school with the help of my elder sister. Because I have been always bright in school I passed my IGCSE exams and went straight to College where I persude teaching. So all in all I want to tell my story to others and help them realize that in this life its not easy and that we should always take things one step at a time. Rome was not built in one day and so are our lives. Challenges are there but it does not mean one should give up. Additionally, I love being being young minds so this opportunity will also help me to nurture them into the right direction in life.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 22:58:14', '2025-07-16 22:58:14'),
(405, 854, '[\"documents\\/01K0A9QNPRQQWM5D31MGCVZBH6.jpg\",\"documents\\/01K0A9QNPZYFFJWQ1AX48VA4A7.jpg\"]', '[\"documents\\/01K0A9QNQ51BV5G7HTZRV7Z0SH.docx\"]', 'Unemployed', 'The roles matches my skills ,qualifications and interests as l was a life mentor.l have a leadership skills , relevant experience and a passion in working with the youth.l am a role model as l have demostrated positive values and behaviours inspiring young people to do the same.l also developed strong communication skills effectively connecting with them and provide guidance and support .', 'Yes', 'Compassionate Swaziland and Bantwana Initiative', 'I encourage young people to make independent decisions ,set goals and take charge of their lives.l boosted their confidence by helping them to develop self awareness ,realize their potential and increase confidence through personalized guidance and support.l also improve academic perfomance and developing life skills essential for success for those in school and providing bussiness mentor for out of school.l helped them to practise safe sex by using condoms consistenly and correctly during sex,and also to use Pre Exposure Prophylaxis ( PrEP) if they are at high risk of HIV exposure.l also encourage them to get tested for HIV and other STIs regularly if they have multiple partners or engage in high risk behaviors.Providing emotional support ,education and encouragement to those who are on ART.', 'Yes', NULL, '2025-07-16 23:00:14', '2025-07-16 23:00:14'),
(406, 855, '[\"documents\\/01K0A9T25XYHTWWGY036XTWG9K.jpg\"]', '[\"documents\\/01K0A9T26A4ZMJAQP6XXJ0ABYB.docx\"]', 'Unemployed', 'Im a young and passionate male  who respects others looking forward to change lives of young people in my constituency. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-16 23:01:32', '2025-07-16 23:01:32'),
(407, 856, '[\"documents\\/01K0AA1AAWD7XP1JKTWQHMA8XR.jpg\"]', '[\"documents\\/01K0AA1AB5MHTE3WSEM26KWCTZ.jpg\"]', 'Unemployed', 'I\'m am the right candidate for the job because I bring a unique combination of personal experience and an undying passion for young people. As a late bloomer mindset reformation is what increased my performance and confidence. Getting the opportunity to do the same for another young person would be a great privilege for me. \n', 'Yes', 'Young life Eswatini ', 'In young life I did the work of an evangelist. I spread the gospel,making sure to always add good moral lessons and self introspection questions. ', 'Yes', NULL, '2025-07-16 23:05:30', '2025-07-16 23:05:30'),
(408, 857, '[\"documents\\/01K0AA2R6146FJR5BMC34J319X.jpg\"]', '[\"documents\\/01K0AA2R65M9MF7XW3QV4V8WD5.docx\"]', 'Unemployed', 'I have applied  for this position   for growth and my previous work experience showed that i have a  great impact  in making a change  in the community  as well as changing the lives of our young people. I have worked   with  different communities of different dynamics as well as different perspectives and the results were outshining. I have experience on how to conduct  sessions as well as facilitating in a training  and that will limit the organization  cost. I am aware of the  child policies and I have signed them before.The young people  and adolescent  as well as the community  will enjoy  working  with such a person and the organization will save because there will be no or limited Trainings for me.', 'Yes', 'Bantwana Initiative ', 'We were helping  our adolescent  on HIV prevention programs  wich includes HIV prevention  session, impact of drug abuse  in the lives and  equip them on  Livelihoods streams.', 'Yes', NULL, '2025-07-16 23:06:17', '2025-07-16 23:06:17'),
(409, 858, '[\"documents\\/01K0AA8JQGA1BCSGN09FJVJQXF.jpg\"]', '[\"documents\\/01K0AA8JQV47N5221TRCF9ZQCP.jpg\"]', 'Unemployed', 'I am the best candidate for the job because I am a hard worker and a team player.I also have good communication skills.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 23:09:28', '2025-07-16 23:09:28'),
(410, 859, '[\"documents\\/01K0AAF969X6DESQ6AMZHEXDE2.jpg\"]', '[\"documents\\/01K0AAF96EQ5C1QE7PNNF3Q9F5.docx\"]', 'Unemployed', 'I applied for the job because I believe I am still young and vibrant. I am the best candidate for the job because I am willing to learn more about the job and excel in different categories.', 'No', 'None ', 'None', 'Yes', NULL, '2025-07-16 23:13:07', '2025-07-16 23:13:07'),
(411, 860, '[\"documents\\/01K0AASW4WH2AD634BZ26AKXKV.PDF\"]', '[\"documents\\/01K0AASW4Y81PEP3KR1GQHY8Q6.pdf\"]', 'Unemployed', 'I like working with the youth and I think getting more training will help me grow as I would love working with the youth in the next future.', 'Yes', 'FLAS', 'Worked with the Youth Action Movement, advocating for SRH.', 'Yes', NULL, '2025-07-16 23:18:54', '2025-07-16 23:18:54'),
(412, 861, '[\"documents\\/01K0AB0T4A5WKVVJV8E3TZ76G0.jpeg\"]', '[\"documents\\/01K0AB0T4CFKYA6T669HSTEA42.pdf\"]', 'Unemployed', 'I am the best candidate for this job because i have the experience, for the past 6 years and more i have been a peer educator. Started when i was in Form 3 it was a hobby but then i grew passion for talking to my peers about carrying yourself with pride and dignity whilst growing up. I loved and enjoyed the Umhlanga season because i knew for sure that it was my moment to speak and voice out what i have experienced out there while i am still growing and trust me sharing my experiences with my peers has grew my confidence as well. I loved and enjoyed creating a safe space for someone to be able to talk or vent to me and even ask questions about health and how to overcome some situations we face every single day. I love being a peer educator, i have learnt a lot and I would gladly and proudly say i am what i am today because of it. I grew wiser and smartly knowing that i can be able to voice out anything i want to say and not let anyone deam my light. I would also love to upgrade my experience so working with ENYC would really bring change in my life and I would benefit more that I would love to share with my peers from my hood and many more places.', 'Yes', 'Khulisa Umntfwana Organization ', 'I was a peer educator during the Umhlanga ceremony in the country. I taught the maidens about relationships, self-care, HIV/AIDS and many more topics involving health. I was specifically tasked to educate girls since Umhlanga is for young girls who are virgins. My duty entirely involved talking to girls what to expect while growing and how yo tackle those situations faced while growing up and also how to live a healthy life.', 'Yes', NULL, '2025-07-16 23:22:42', '2025-07-16 23:22:42'),
(413, 862, '[\"documents\\/01K0AB7H5J9BCKGNFXCQ14S8TT.pdf\",\"documents\\/01K0AB7H5NJGD1GBTESPZHZETS.jpg\",\"documents\\/01K0AB7H5VVY40NVQ91QP69MWE.jpg\"]', '[\"documents\\/01K0AB7H61BN52PQSQ0GZ5ME21.pdf\"]', 'Unemployed', 'I have applied because i believe this opportunity will finally help me reach my professional goals so that I can become a more equipped and better leader overall. \n\nI believe im the best candidate because the nature of my studies and volunteering experience has prepared me well for working with the youth. I am committed to exemplifying what your organization looks for in young people which requires the effort and determination to make a meaningful impact in communities.', 'Yes', 'US Peace Corps Eswatini ', 'Peace Corps counterpart volunteer\n - assist Peace Corps volunteers with community projects (eg..organize a community in school and out of school youth clubs.  \n- work as a liaison between Peace Corps and community leaders to successfully complete community projects.\n', 'Yes', NULL, '2025-07-16 23:26:22', '2025-07-16 23:26:22'),
(414, 863, '[\"documents\\/01K0ABDEZBJFY4F60QD71CHHAB.jpeg\"]', '[\"documents\\/01K0ABDEZVN0WEAS6ZJYDGXV3V.pdf\"]', 'Unemployed', 'I applied for this position because i am very keen to work for an ambitious organization such as yours, especially what it has done for the young people throughout the country. I am the best candidate for this job because i have a very strong work ethic. I am a fast learner, friendly, efficient, enthusiastic individual with a great deal of willingness to learn everyday to improve my skills, confidence and knowledge.  I believe my motivation and commitment will ensure that I quickly become a productive and valued member in your team. ', 'Yes', 'Community Health Empowerment Forum(CHEF)', 'Community Health Empowerment Forum is an Organization that inculcates healthy living in communities in order to enable effective community response and inspire better health outcomes .I was a facilitator. Adolescents are vulnerable to risky sexual interactions partly due to gender norms which make it very difficult to negotiate safe sex, and are often victims of poverty, unemployment and lack of knowledge in HIV prevention . I was motivating the young people and their role in reducing new infections and unnecessary deaths. Emphasizing the importance of adhering to treatment and ensuring that you eat nutritious food to support the immune system.', 'Yes', NULL, '2025-07-16 23:29:36', '2025-07-16 23:29:36'),
(415, 864, '[\"documents\\/01K0ABKGND1K0J8W5VG5QWAHEX.jpeg\"]', '[\"documents\\/01K0ABKGNH0VCSSA34HRW27TT6.jpeg\"]', 'Unemployed', 'I am thrilled to apply for a position at the Eswatini National Youth Council (ENYC), an organization dedicated to empowering and advocating for the rights and interests of young people in Eswatini. As a passionate and dedicated individual with a strong background in education and community service, I am confident that I would be an excellent fit for this role.\n\nMy interest in working with ENYC stems from my desire to make a positive impact on the lives of young people in my country. Throughout my academic and professional journey, I have been driven by a passion for education, community development, and youth empowerment. My Bachelor of Education Secondary Humanities degree from the University of Eswatini has equipped me with a strong foundation in humanities, education, and social sciences. This degree has not only deepened my understanding of the complexities of human behavior and social issues but also honed my critical thinking, problem-solving, and communication skills.\n\nAs a recent graduate, I am eager to apply my knowledge and skills in a dynamic and fast-paced environment like ENYC. I am confident that my academic background, combined with my experience in community service and peer education, makes me an ideal candidate for this role. Throughout my studies, I developed strong research, analytical, and project management skills, which I believe would be valuable assets in this position.\n\nMoreover, my experience as a peer educator and community worker has given me a unique understanding of the challenges and opportunities facing young people in Eswatini. I have worked with diverse groups of young people, providing guidance, support, and mentorship on various issues, including education, health, and social welfare. This experience has taught me the importance of empathy, active listening, and effective communication in building strong relationships with young people.\n\nI am excited about the opportunity to join ENYC and contribute to the organization\'s mission of promoting youth development, empowerment, and advocacy. I am confident that my skills, experience, and passion for youth work make me a strong candidate for this role. I look forward to the opportunity to discuss my application and how I can contribute to the success of ENYC.', 'Yes', 'Khulisa Umntfwana Charity Organisation ', 'As a dedicated and passionate individual, I have had the privilege of working with Khulisa Umntfwana Organisation as a Peer Educator, where I supported young people in various aspects of their lives. In this role, I was responsible for providing guidance, mentorship, and education to adolescents and young adults on topics such as life skills, health, and social issues. I worked closely with the community to identify the needs of young people and developed programs and interventions to address these needs.\n\nAs a Peer Educator, I facilitated workshops, discussions, and awareness campaigns on topics such as HIV/AIDS, reproductive health, and substance abuse. I also provided one-on-one support and counseling to young people, helping them to navigate challenges and make informed decisions about their lives. Through my work, I developed strong relationships with the community, schools, and local organizations, which enabled me to reach a wider audience and have a greater impact.\n\nOne of the most rewarding aspects of my role was seeing the positive impact that our programs had on the lives of young people. I witnessed individuals gaining confidence, developing life skills, and making positive changes in their lives. I also saw communities coming together to support one another and address social issues that affected them. Through this experience, I developed strong communication, interpersonal, and problem-solving skills, which I believe would be valuable assets in this role.\n\nWorking with Khulisa Umntfwana Organisation also gave me the opportunity to develop my leadership and teamwork skills. I worked closely with other Peer Educators and staff members to plan and implement programs, and I had the opportunity to take on leadership roles in certain projects. This experience taught me the importance of collaboration, adaptability, and creativity in achieving our goals.\n\nOverall, my experience as a Peer Educator with Khulisa Umntfwana Organisation has been incredibly rewarding and has given me a sense of purpose and direction. I am proud of the work that I did and the impact that we had on the lives of young people. I am confident that the skills and experience I gained in this role would enable me to make a positive contribution to your organization.\n\n', 'Yes', NULL, '2025-07-16 23:32:55', '2025-07-16 23:32:55'),
(416, 865, '[\"documents\\/01K0ABYMN8XSB9R9BQ12KT11ZE.pdf\"]', '[\"documents\\/01K0ABYMNDA7RQ0QS8M556YTA1.pdf\"]', 'Self-Employed', 'I applied for this position because I am passionate about helping young people develop practical skills that can benefit their futures and communities. With a degree in Agricultural Education and experience teaching in schools, along with involvement in youth-focused NGOs like Young Heroes and World Vision, I bring both knowledge and hands-on experience. I believe I’m the best candidate because I’m dedicated, reliable, and focused on making a meaningful impact through education.\n', 'Yes', 'World Vision and Young Heroes ', 'I was an active member of youth-focused NGOs such as Young Heroes and World Vision, where I participated in community outreach activities. I helped support young people through school visits, life skills sessions, and awareness campaigns on health and education. My involvement contributed to creating a positive environment for youth development and empowerment.', 'Yes', NULL, '2025-07-16 23:38:59', '2025-07-16 23:38:59'),
(417, 866, '[\"documents\\/01K0ABZC3F6237FHFZPBP3S1JV.jpg\"]', '[\"documents\\/01K0ABZC3SP77M4ZJHJC2RXK4T.docx\"]', 'Unemployed', 'I am self driven, innovative and task driven. I learn to teach others to learn. I am also loving and sociable, I\'m active and would love to give to the community. I want to bring greatness and not just as a young woman, as a woman of substance. ', 'No', 'None', 'I was always joining groups from Young Heroes and other organizations from my community. I learnt a lot and we had chances to teach some days. I know to talk sense to young people.  I used to be a school Prefect in my previous school and I was very best at leadership.', 'Yes', NULL, '2025-07-16 23:39:23', '2025-07-16 23:39:23'),
(418, 867, '[\"documents\\/01K0AC1BJYWM3PSQC7ST8YAYWJ.pdf\"]', '[\"documents\\/01K0AC1BK1M9JNR9HABWCGZ4BG.pdf\"]', 'Unemployed', 'I am applying for the youth mentorship program in my constituency because I am passionate about empowering young people with knowledge, skills, and guidance to unlock their full potential. Having grown up and studied within this community, I understand the unique challenges that youth face, including limited access to information, career guidance, and positive role models.\n\nAs a graduate in Environmental Management and Water Resources with experience as a Health Officer and active participation in community development projects, I bring valuable insights into health promotion, environmental awareness, and responsible citizenship. My involvement in campus environmental clubs and high school leadership programs like Junior Achievers taught me the importance of mentorship, teamwork, and civic responsibility.\n\nI believe that mentorship is a powerful tool for change, and I am committed to using my experience to guide, inspire, and support young people to make informed decisions, pursue education and skills development, and become active contributors to our society. Through this program, I aim to promote a culture of leadership, self-confidence, and community service among the youth in our constituency.', 'Yes', 'Mbabane Campus Environmental Health student club and Junior Achiever (JA) club ', 'I participated in a range of sustainability-focused initiatives. These included organizing clean-up campaigns, tree-planting drives, and environmental awareness events such as World Environment Day. I also took part in peer education on climate change, waste management, and water conservation, aiming to promote sustainable behavior among students. Through these activities, I developed teamwork, event planning, and advocacy skills while deepening my understanding of environmental issues affecting our communities.\n\n2. Junior Achievers Program (High School Activities):\nDuring high school, I was involved in the Junior Achievers program, which introduced me to entrepreneurship, leadership, and business ethics. I contributed to running a mini business project with fellow students, where we learned about product development, financial literacy, teamwork, and marketing. This experience sharpened my communication, problem-solving, and leadership abilities, and gave me a solid foundation in planning and responsibility from a young age.', 'Yes', NULL, '2025-07-16 23:40:28', '2025-07-16 23:40:28'),
(419, 868, '[\"documents\\/01K0AC1DHSEKHQ6TG85ZHE1YJB.pdf\"]', '[\"documents\\/01K0AC1DJ4K3VT11NC0D53BSN7.pdf\"]', 'Self-Employed', 'I applied in this Youth Mindset Change training program because it is my passion to help the youth and  I strongly believe that they are the future of our community, and many of them face challenges that limit their potential, whether it\'s poverty, lack of guidance, peer pressure, or unemployment. I was once a young person who needed direction, and I know how just one opportunity or a kind mentor can change someone’s entire path. Volunteering allows me to give back, share what I’ve learned, and help create opportunities where they may not exist.\n\nWhen young people are supported, they become confident, skilled, and responsible citizens. My passion is to be that support to guide, motivate, and open doors for them so that they can rise beyond their circumstances and achieve their dreams in life.\n\nI believe that, I am the best candidate for the job since, I am not only care deeply, but I also take action. On top of that, i am already been involved in youth development through for example.in my church youth groups i do provide concelling, motivationand encouragementto the youth since i am the youth Leader, also I\'ve been involved in organizing events of youth empowerment in many communities, also organise community outreach monthly to assist the young people to achieve their dreams in life. I listen to young people, since, i understand their struggles, and I have the energy and commitment to keep pushing even when things get tough. I am a self-motivated, dedicated person who is eager to learn new things every time I meet someone. \n\nAgain, I  bring good leadership, teamwork, and planning skills, which are critical in running youth programs effectively. I am trustworthy, consistent, and always eager to learn and collaborate with others to make a bigger impact. Most importantly, I treat every young person with respect and dignity as that i am convinced thus the foundation of true empowerment.', 'Yes', 'One Accord Foundation ', 'We were empowering the youth and women of Siteki town about entrepreneurship . We were helping those who want to start their own businesses by providing encouragement and creative ways of doing things in business.\n Again, in One Accord foundation, we were helping elderly with basic needs for example food parcels and we assisted more than 5 homesteads where we found that the are not having proper housing.\nFurthermore, we were helping young people by teaching them life skills and digital literacy  by organising outreach in that community we were visiting, every month end.\nMoreover,  we were helping young people by building partnerships with big companies and other NGOs finding grants to help young people who are struggling in paying school fees in primary or High school level and in Vocational centres.\nIn a nutshell, One Accord Foundation was an organisation which provides nertwork to young people since we were organising Clean up campaigns through collaboration with Siteki Town Council to keep the town clean.', 'Yes', NULL, '2025-07-16 23:40:30', '2025-07-16 23:40:30'),
(420, 869, '[\"documents\\/01K0AC2VCJ4YDCM0GQ1TCNEHK5.jpg\",\"documents\\/01K0AC2VCQFB2663S0CEH0ZHGP.jpg\",\"documents\\/01K0AC2VCW6D3SKHMRQ4FN53MR.jpg\"]', '[\"documents\\/01K0AC2VD1YQ4B2VWTR2ACRZNM.docx\",\"documents\\/01K0AC2VD72CV46V16K8G853VN.docx\"]', 'Unemployed', 'I like to help and work with young people and my skills and qualifications and work experience makes me the best candidate .I completed form 5 and I was trained on how to work with young people and adolescents and also gets certificates after training. I have ability to connect with young people also work with the community for 8 years.I am a respected  and trusted person in community and understand the structure of the community. I have strong communication skills and ability to listen actively and create a safe environment. I\'m also good in problem solving,leadership and creativity.I will be available anytime needed.', 'Yes', 'Family Life Association, Compassionate Swaziland and Bantwana Initiative ', 'I was a youth facilitator,teaching young people about how to behave themselves.Talking about taking good decisions about life and how to make their dreams come true.I was also talking to them about HIV and AIDS on how to protect themselves on getting it and what to do those already living with it.Talking about sexual transmitted diseases and symptoms of it.Teaching them about Family Planning methods and where to get it by providing mobile clinics in the community. Teaching them about human trafficking and mental health.  Supporting them to join worth group  and starting businesses. All these knowledge help young people how to take good decisions about their life as most of them lack knowledge. ', 'Yes', NULL, '2025-07-16 23:41:17', '2025-07-16 23:41:17'),
(421, 870, '[\"documents\\/01K0ACHENT22WKF5Y2WY6J87N1.pdf\"]', '[\"documents\\/01K0ACHENXFTTWKV9784ADNGGJ.pdf\"]', 'Unemployed', 'I am applying for the Youth Mindset Change Trainer Programme because I am deeply passionate about the empowerment and transformation of young people in Eswatini. I believe that mindset is the foundation of every young person’s journey it determines how they approach opportunities, setbacks, and the future. This programme aligns perfectly with my vision of inspiring youth to believe in themselves, take initiative, and lead change in their communities.\n\nHaving worked with Junior Achievement Eswatini as the President of the Alumni Network, I have firsthand experience in leading, mentoring, and motivating youth to pursue meaningful goals. In that role, I saw the challenges that many young people face low self-confidence, limited exposure, and a lack of direction. Yet, I also saw the power of transformation when they are supported and challenged to think differently.\n\nThrough various initiatives, including business mentorship, financial literacy sessions, and leadership development events, I helped equip young people with the tools to reframe their mindset from one of dependence to one of ownership and possibility. As a result, several alumni I mentored went on to start businesses, raised funding, pursue further education, or step into leadership roles in their communities.\n\nWhat sets me apart as a candidate is not only my experience, but also my energy, relatability, and commitment to youth empowerment. I connect well with young people because I understand their language, their struggles, and their dreams. I’ve walked that path, and I bring authentic insight into what it takes to move forward when the odds seem stacked against you.\n\nI also bring strong facilitation and communication skills, sharpened through public speaking engagements, alumni representation abroad, and corporate partnerships. I’ve had the honor of representing Eswatini youth internationally, and I’ve used those platforms to bring back knowledge and ideas that can be localized and applied here at home.\n\nAcademically, I hold an Associate Degree in Business Management from Limkokwing University and am currently pursuing a Strategic Project Management course with Harvard Business School, further equipping me with the structure and discipline needed to drive impactful initiatives.\n\nIn addition, I am a certified Community Builder by JA Worldwide (2025) a title that embodies who I am. I believe this programme will allow me to expand my impact, receive advanced training, and collaborate with like minded individuals to shift the national youth narrative from dependency to empowerment, from apathy to action.\n\nThe youth of Eswatini deserve trainers who are not only qualified, but genuinely passionate and relatable. I am that person. I don’t just want to change mindsets I want to see real movements of the youth in Eswatini.', 'Yes', 'Junior Achievement Eswatini ', 'Yes, I have worked extensively with Junior Achievement Eswatini, I participated in JA programs since 2019 while I was still in high school and university, I completed all their programs, later I was appointed & served as the first ever President of the Alumni Network in Eswatini from July 2023 to April 2024. This role allowed me to contribute meaningfully to youth development across the country and beyond.\n\nAs President, I led a network of former JA participants, organizing impactful events, mentorship sessions, and skills-building workshops aimed at empowering young people with entrepreneurship, leadership, and personal development tools. I worked closely with corporate partners and educational institutions to create opportunities for alumni and current students, ensuring sustained engagement with the JA community.\n\nOne of my key contributions was mentoring Out Of School entrepreneurs, I helped them shape their business ideas, improve their confidence, and access networks that could support their growth. I also coordinated initiatives that encouraged young people to adopt a proactive mindset, focusing on problem-solving, financial literacy, and personal accountability.\n\nOn an international level, I proudly represented JA Eswatini at both the Africa Alumni Leaders Bootcamp in Kampala, Uganda (2023) and the Global JA Alumni Summit in Porto, Portugal (2024). These platforms allowed me to exchange ideas with youth leaders across the globe and bring back innovative strategies that benefited local youth in Eswatini.\n\nMy work with JA Eswatini was rooted in the belief that young people, when given the right mindset and support, can become drivers of change in their communities. Through leadership, mentorship, and collaboration, I have played a part in building a generation of resilient and visionary youth.', 'Yes', NULL, '2025-07-16 23:49:16', '2025-07-16 23:52:30'),
(422, 871, '[\"documents\\/01K0ACR07RRCZ15HDTJ5V6ANTA.pdf\"]', '[\"documents\\/01K0ACR07WZ75WG8MN45Z1S00N.pdf\",\"documents\\/01K0ACR089RVCAW37VTCJY5N5H.pdf\"]', 'Unemployed', 'I have applied for the position of a Mindset Change Trainer because I believe that meaningful change begins with the transformation of the mind. As a young person who has consistently dedicated time, energy, and passion to uplifting my community, I view this role as an opportunity to expand the impact I already strive to make in the lives of young people. This opportunity aligns perfectly with my purpose, values, and commitment to ensuring that young people develop a strong, healthy, and progressive mindset that allows them to thrive in all spheres of life.\n\nMy background as a Sexual and Reproductive Health and Rights (SRHR) advocate under the Her Voice Project with SAfAIDS has given me extensive experience working with young people on the ground. I was involved in community dialogues, school-based outreaches, and youth group discussions where we addressed topics ranging from consent, gender-based violence, HIV prevention, menstrual health, and the importance of bodily autonomy. These conversations were not just about giving information—they were about challenging harmful cultural and societal norms and empowering young people, especially girls, to know their rights and live boldly and wisely. I learnt how to communicate in a respectful, non-judgmental, and empowering way that connects with young minds and motivates them to reflect and take charge of their lives. I believe this is the core of mindset change.\n\nIn addition to my advocacy work, I also did an internship as a high school teacher. This experience helped me understand how critical mindset is among adolescents and youth. I witnessed students who had the potential but lacked confidence, direction, and motivation. Others were weighed down by social pressures, poverty, peer influence, and a deep sense of hopelessness. Being in the classroom daily allowed me to not only teach academic content but to engage students on life matters—encouraging them, mentoring them, and helping them believe in themselves. I learnt that young people are not resistant to growth, but they often need someone to walk with them, someone who understands, listens, and challenges them positively. I aspire to be that person through this program.\n\nWhat makes me the best candidate for this position is that I do not just see youth empowerment as a duty—I see it as a calling. I have always carried the interests of young people at the center of my heart. Whether it is volunteering in community projects, mentoring my peers, or creating safe spaces for youth-led conversations, I have always shown up with sincerity and passion. I am deeply aware of the socio-economic and emotional challenges young people face today—from unemployment, identity crises, substance abuse, to social media pressures—and I believe mindset change is the first solution before policy, employment, or opportunity. When you change the way young people think, you change the way they live, dream, and work.\n\nMoreover, I bring with me strong interpersonal and facilitation skills. I am a confident speaker, a good listener, and a team player. I understand how to create interactive and engaging sessions that allow young people to express themselves, reflect on their lives, and receive guidance without feeling judged. I believe in a participatory approach where youth feel heard, respected, and valued. I also understand the importance of culture and context when addressing issues that affect young people, and I have experience adapting content to suit the age, background, and sensitivity level of my audience.\n\nBeing a young person myself, I relate to the journey many others are walking. I know what it feels like to be unsure, to lack guidance, or to be pressured by society\'s unrealistic expectations. But I also know the power of a changed mindset. I have personally overcome limiting beliefs and societal barriers to become who I am today, and I want to use my story to inspire others.\n\nIn conclusion, I have applied for this role because I believe in the transformation of youth through education, dialogue, mentorship, and empowerment. I have a track record of youth engagement, a deep love for young people, and the capacity to be a role model and change agent. I am committed to being part of a movement that helps build resilient, focused, and purpose-driven young people who will contribute positively to their communities and the nation at large. This role is more than a job to me, it is a platform to pour into the lives of others what I have gained and to help ignite mindsets that lead to lasting impact.', 'Yes', 'SAFAIDS Organisation ', 'I served as an SRHR advocate under the Her Voice Project in the SAFAIDS organisation, where I engaged with young people in schools and communities to raise awareness about sexual and reproductive health and rights. I facilitated discussions, workshops, and campaigns aimed at empowering youth to make informed decisions about their health and well-being. Through this role, I helped amplify young voices, provided access to vital information, and encouraged peer-led change within communities.', 'Yes', NULL, '2025-07-16 23:52:50', '2025-07-16 23:52:50'),
(423, 872, '[\"documents\\/01K0ACT90Z8WT8Q51J6YH8FY1G.jpg\"]', '[\"documents\\/01K0ACT916WCTVHYBNQ50QP5HP.jpg\",\"documents\\/01K0ACT918HXKD442J4XHAKVJ4.jpg\"]', 'Unemployed', '*I am eager to enhance refine my personal development within the organization, and take on the challenges lie ahead.\n*I will endeavor to effectively performance in all my tasks as required by the organization and maintain the standards as defined by you.\n*It is my aim to make and part of a successful team that is directly involved in making the organization a success as I believe I have a role to play. \n', 'Yes', 'AHF Eswatini ', '*Teach youth to practice safe sex through condom distribution.\n*Provide information on sexual reproductive health.\n*Promote hygiene and sanitation through provision of sanitary towels and toiletries .', 'Yes', NULL, '2025-07-16 23:54:05', '2025-07-16 23:54:05'),
(424, 873, '[\"documents\\/01K0AD0XA5EAT34Q4AQEPGH2SP.pdf\"]', '[\"documents\\/01K0AD0XA7GQYD3XVTWS9EAP98.pdf\"]', 'Unemployed', 'I applied because am excited about the opportunity to develop my skills . Although I\'m new to the workforce, I\'m a quick leaner and confident that my strong work ethics and passion would make me valuable. Am the best candidate because am still young and energetic,good with team work am also easy to teach and correct. Am open and adaptable to new experience,which can be valuable in changing environments. Am still young which makes it easy to mold and develop me to fit your specific needs. Am still young which makes to have bring high level of enthusiasm,which can be contagious and beneficial to you ', 'No', NULL, 'None', 'Yes', NULL, '2025-07-16 23:57:42', '2025-07-16 23:57:42'),
(425, 874, '[\"documents\\/01K0AD5T53C3ZJGFQ1T763MN0W.jpg\"]', '[\"documents\\/01K0AD5T5BB1RNP2E7K3RT8DBP.jpg\"]', 'Unemployed', 'I need this job so I can provide for my family since we have no one to provide for us.\nAlso I\'m willing to see the youth of Eswatini growing in acquiring skills . ', 'Yes', 'Langalethu Charity organization ', 'I\'ve been a leader and conducting Bible classes and outreach. Organising youth outings and other youth activities within and outside the church.', 'Yes', NULL, '2025-07-17 00:00:23', '2025-07-17 00:00:23'),
(426, 875, '[\"documents\\/01K0ADFYMXXG23HH3VXXWYBAF6.jpg\"]', '[\"documents\\/01K0ADFYN2CVWXGCTEY708DPWA.docx\"]', 'Self-Employed', 'I want to give the misfortunate youth/elderly a chance too make their dreams heard too.  To alert them that \nthere are people  who still care.\nI want to help the youth by giving them a hope for the future, that there is more to life than fun and drugs and life in gangs. I want help them realize their purpose so that they live a fulfilling life. \nIf I changed my life then they can do it too. Iron sharpens Iron.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 00:05:55', '2025-07-17 00:05:55'),
(427, 876, '[\"documents\\/01K0ADX6MDHRYK9KZE3FE8TXMX.jpg\"]', '[\"documents\\/01K0ADX6MH0K49CA85AFJ91TA9.pdf\"]', 'Unemployed', 'I have deep passion for empowering young people and promoting their freedom with experience in leadership roles and mentorship as I have served as a Teen Club leader for many years and I even had an opportunity to attend conference which was held at Washington DC. ', 'Yes', 'Teen club Eswatini under Baylor. ', 'As I was serving as a Teen Club leader I lead by example a good presentable life serve as role model to my peers.', 'Yes', NULL, '2025-07-17 00:13:09', '2025-07-17 00:13:09'),
(428, 877, '[\"documents\\/01K0ADZFA36N5JDJDB79YVPPHK.jpg\"]', '[\"documents\\/01K0ADZFA54SAF5TEFJ8NR2BRB.docx\"]', 'Unemployed', 'I\'m currently doing an online course at the university of eSwatini on child minding and care which I\'ll be finishing on the 02 of August. I believe I am the best candidate for this job because dealing with children Will not be a difficult thing since I have learnt how children think and reason according to their developmental stages be it children with special needs or disabilities. ', 'No', 'N/A', 'N/A', 'Yes', NULL, '2025-07-17 00:14:24', '2025-07-17 00:14:24'),
(429, 878, '[\"documents\\/01K0AE38N5EMHJK1RMYPRNBH5T.pdf\",\"documents\\/01K0BQK1CZ0F26MKRDV57JJHFJ.jpg\"]', '[\"documents\\/01K0AE38N71KK6G7W45B02CKBW.docx\"]', 'Unemployed', 'I am passionate about youth empowerment and community development, which aligns with the mission of Youth Mindset. As a final-year Humanities student at UNESWA and an active member of the English Language and Literature Society, I bring strong communication and leadership skills. My experience working with World Vision from childhood and at Rhodes Food Group for three years has equipped me with teamwork and service values. I believe I can make a meaningful impact in my community through this opportunity.\n', 'Yes', 'World Vision ', 'During my spell at Lavundlamanti World Vision I used to help with registering other children, fairly distribution of food and conducting plays and children games.', 'Yes', NULL, '2025-07-17 00:16:28', '2025-07-17 12:21:36'),
(430, 879, '[\"documents\\/01K0AEHGRVFJE37NFF4DDB76BW.pdf\",\"documents\\/01K0AEHGRXBWKFFNY52H9MEYEF.pdf\",\"documents\\/01K0AEHGS0BG7EKS5060XSMN9X.pdf\"]', '[\"documents\\/01K0AEHGS205A0656ABX28GRGP.pdf\"]', 'Unemployed', 'I am writing to express my sincere interest in becoming a Youth Mindset Change Trainer Programme participant because I believe in the transformative power of youth engagement in addressing critical issues facing the Kingdom of Eswatini. This opportunity aligns perfectly with my passion for youth and sexual reproductive health issues, as well as my strong desire to make a positive impact in my community and beyond.\nI want to become a participant because I am deeply committed to driving positive change in my community, particularly in the areas of behavioral change, youth and sexual reproductive health, and community development. Coming from a disadvantaged background, I know that the environmental influence in rural areas is not as inspiring as in urban areas, has fueled my determination to contribute to solutions that address such pressing issues. As a participant, I see the potential to collaborate with like-minded individuals, share knowledge, and work collectively towards mindset change and development on a larger scale. I believe that my weeks commitment in the training will provide me with a unique platform to amplify my efforts and learn from diverse perspectives, ultimately enabling me to make a more significant and lasting impact.\nMy dedication to creating positive change, coupled with my track record of initiating and executing successful projects, sets me apart as a strong candidate for the programme. My experience in mentoring young people by helping them realize they have the potential to face all life obstacles in order to achieve their dreams demonstrates my ability to identify problems and implement effective solutions. This program ensured that young people to formulate their goals and a way forward towards achieving their goals. Lastly, it will give career advice to young people and disseminate information about scholarships and job opportunities. \nFurthermore, my academic background in Civic Leadership, equips me with solid foundation in leadership principles and practices, particularly in community engagement. I am a quick learner, an excellent communicator, and possess strong analytical skillsall of which will be invaluable in collaborating with diverse stakeholders and implementing projects during my tenure as mindset change trainer.\nIn joining the training programme, I bring a range of skills that will be beneficial for both personal and collective growth. These include:\nCommunity Engagement: My work on mentoring young people in my community taught me the importance of engaging and collaborating with local communities. I am adept at building relationships and working closely with diverse groups to achieve common goals.\nAdaptability and Innovation: Growing up in challenging circumstances taught me to be adaptable and innovative in finding solutions. I view problems as opportunities and believe in continuously seeking better ways to achieve results.\nIn conclusion, I am excited about the opportunity to contribute my skills, experiences, and passion for positive change as a Youth Mindset Change Trainer Programme participant. I am confident that this experience will not only allow me to grow personally but also enable me to make a meaningful and lasting impact on the communities I serve. I look forward to the possibility of working alongside fellow participants and organizations to advance the goals of Eswatini National Youth Council and promote mindset change in the country.\n\n', 'No', 'None', 'I am a young LiSwati passionate about rural youth and sexual reproductive health issues. Facing various challenges while as a child, I was forced to think out of the box, be innovative and view problems as opportunities rather than setbacks. This is what I believe leadership to be, moreover, what has enabled me to make meaningful impact in life.\nIn high school I held the position of a senior prefect and my school had a littering problem that had persisted for years, without anyone paying attention to it. Concerned with the aesthetics of my school surroundings and with assistance from the schools administration, I established an environmental club responsible for the environmental cleanliness of the school. Through the club I educated my peers on sound environmental management, gradually changing their perception on littering. The club attracted more than 50 students committed to proper management of school grounds. Through the club, I solved the schools littering problem, further, empowered my peers on a subject of global importance.\nMy educational journey has not been an easy one but Im so grateful to God for where I am right now. I grew up in a rural area and attended both my primary and high school in the same rural area. Coming from a disadvantaged background, I know that the environmental influence in rural areas is not as inspiring as in urban areas. Currently, I mentor young people by helping them realize they have the potential to face all life obstacles in order to achieve their dreams. In my rural area, I mentor five young women who are in high school and I also organize mentors for girls and young women according to their career ambitions.  I also do motivational speeches at two high schools, one primary school and two churches in my community. Im passionate to inspire other young people, especial those who are living in disadvantaged communities and attending schools in rural areas, because I understand better the situations they face and I believe they have so much potential to achieve more in life. \nI believe being awarded the opportunity and attending the training on youth mindset change trainer programme will not only develop me but it will empower me with more leadership skills for the advancement of my community work and the whole country.', 'Yes', NULL, '2025-07-17 00:24:15', '2025-07-17 00:24:15'),
(431, 880, '[\"documents\\/01K0AESBB2QTXHT1J1EPDMCV1R.pdf\",\"documents\\/01K0AESBB4Z475TPEFAQ3CK68Q.pdf\"]', '[\"documents\\/01K0AESBB7QDZTRE0WF1Z26YA9.pdf\"]', 'Unemployed', '\n\nI want to work with the youth training trainer in my area because I believe that young people are the foundation of any strong and successful society, and by supporting their development through skills training, mentorship, and guidance, we can empower them to become confident, responsible, and productive individuals who will not only transform their personal lives but also uplift their communities, create employment opportunities, and reduce poverty and social instability in the long term, especially in areas like ours where many young people face challenges such as unemployment, peer pressure, lack of role models, and limited access to meaningful resources that can help shape their futures positively. Working closely with a dedicated youth trainer will allow me to gain first-hand experience in facilitating workshops, developing training materials, organizing community events, and offering one-on-one support to young people who may need extra help navigating their personal challenges, academic pressures, or even setting and reaching their career goals, while also helping me grow professionally in areas like leadership, communication, problem-solving, and conflict resolution, all of which are important not only for this role but also for my future career, personal growth, and contribution to society as a whole. I have always had a strong desire to make a difference where I live, and I see this opportunity not just as a chance to support the trainer in their daily activities but also as a chance to become a bridge between young people and the services or opportunities that they might not be aware of or confident enough to access, such as entrepreneurship programs, vocational training, mental health support, or life skills development workshops, which could completely change the trajectory of their lives if given the right support at the right time. Ultimately, my goal is to create an environment where young people feel heard, valued, supported, and inspired to become the best version of themselves, and I truly believe that by collaborating with a youth training expert, I will not only help amplify their impact but also play a meaningful role in shaping a brighter, stronger, and more united future for our community.\n\n', 'No', 'None', '\nNone\n\n\n\n\n', 'Yes', NULL, '2025-07-17 00:28:31', '2025-07-17 00:28:31'),
(432, 881, '[\"documents\\/01K0AETZZYWVR2ZZZS1DHYP7S4.pdf\"]', '[\"documents\\/01K0AEV001ZKZCE7FA6X0C6BTF.pdf\"]', 'Unemployed', 'I applied to be a part of the community and to give back in the best way I know possible. I believe lending an extra hand where you can goes a long even if it seems I significant at the time. This would also be an opportunity to meet people, delve into different backgrounds and improve my interpersonal skills. It would further be a chance to not be idle as we know how prevalent unemployment is in the kingdom. ', 'Yes', 'Girls Foundation ', 'This was a foundation focuses on empowering young girls at the orphanage at Zakhele. We cleaned, cooked and helped start up a garden for the girl', 'No', NULL, '2025-07-17 00:29:25', '2025-07-17 00:29:25');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(433, 882, '[\"documents\\/01K0AF42VD70S6J8EGXT4E7TH3.jpg\"]', '[\"documents\\/01K0AF42VHWYK9QEYJAH81D9C4.pdf\"]', 'Unemployed', 'The reasons why I would want to work in such an industry, firstly, is my passion for youth development. I have a genuine belief in the potential of young people and a desire to see them succeed.\nThe profound satisfaction of knowing your work contributes to shaping brighter futures. This involve helping them overcome challenges, discover their talents, build confidence, or navigate important life stages. Therefore, this is another reason fo applying to this job.\nLastly, working with young people often means staying current with trends, technologies, and social changes, which can be intellectually stimulating. \nI think I Am the best candidate for the job because I am aware of particular issues young people face like education disparities and mental health and career guidance gaps and I have a desire to be part of the solution.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 00:34:23', '2025-07-17 00:34:23'),
(434, 883, '[\"documents\\/01K0AF4RKFJMH32VGSGK3T79MF.jpg\"]', '[\"documents\\/01K0AF4RKJPJZ7YBKY3AW0J1E1.pdf\"]', 'Unemployed', 'I applied because, I believe I\'m very good with people, especially the youth. I\'m the best candidate for this job because I have been around young people and I\'m a good leader. Also a fast and creative person.', 'Yes', 'Girls empowerment Club ', 'I help girls gain their self confidence as they entered the adolescence stage. I also helped them understand the changes in their body will undergo as they grew.', 'No', NULL, '2025-07-17 00:34:46', '2025-07-17 00:34:46'),
(435, 884, '[\"documents\\/01K0AF8MJVA96GDYG8ECNHYMX6.pdf\"]', '[\"documents\\/01K0AF8MK0G690ZJZ8ZVKM9RMA.pdf\"]', 'Unemployed', 'I have applied for this trainers training because I believe that if we foster a positive mindset upon young people this can result in the change of the entire society such as decrease in crime rate, entrepreneurship.\nI believe I am the best candidate for the position because I want to play a pivotal role in ensuring that young people have to accomplish their dreams.\nI have a vision of helping young people more especially the in school youth to have a specific goal they want to achieve by helping them develop a strategy to achieve it.\nI believe everyone can have a positive impact in their community regardless whether they are seen as not good in school but they have something they are good at which is their skills and talent.\nAll Young people have a potential to do great things provided they are well natured which is the main reason I have applied to play a part in naturing them for the betterment of society.', 'Yes', 'Nazarene Compassionate Ministries organization ', 'We were educating young people on the issues of male circumcision on the benefits of it to both male\'s and female. Incorporating young people into taking their medication correctly especially those with that have tested HIV positive.', 'Yes', NULL, '2025-07-17 00:36:52', '2025-07-17 18:44:05'),
(436, 885, '[\"documents\\/01K0AF9DWFXRNCH5EM26AGYBT3.pdf\",\"documents\\/01K0AF9DWW3XZ35Q51GBNWJJE7.pdf\",\"documents\\/01K0AF9DWZXEXX9JY0WZ1TJQR7.pdf\"]', '[\"documents\\/01K0AF9DX3R02CF05RE2VYZY56.docx\"]', 'Unemployed', 'I have applied for this position because I am passionate about empowering young people to reach their full potential. I believe in the power of guidance, education, and mentorship to positively shape the lives of youth, especially in areas such as life skills, leadership, and making healthy choices.\n\nWith my background in social work, mentoring, counseling, and community outreach, I have hands-on experience engaging with young people from diverse backgrounds. I have conducted training sessions on drug prevention, conflict resolution, and psychosocial support, and I’ve seen firsthand how the right support can transform lives.\n\nI am the best candidate for this role because I bring a blend of professional training, real-world experience, and deep commitment. I know how to create safe, inclusive learning environments where youth feel heard, valued, and motivated. I am ready to contribute my energy, skills, and heart to support the organization’s goals and make a lasting impact.\n', 'Yes', 'Association of Students Against Drug use and Trafficking ', 'As a mentor and advocate with an anti-drugs organization, I worked closely with young people who were at risk of or already using drugs. I conducted awareness sessions in schools and communities to educate youth on the dangers of substance abuse. I also provided one-on-one mentorship and group counseling to support those struggling with addiction or peer pressure.\n\nI helped them build self-confidence, set personal goals, and develop healthy coping strategies. I collaborated with families, schools, and healthcare providers to ensure young people received the care and support they needed. My goal was to create a safe, supportive environment where youth could make informed, positive choices for their future.\n', 'Yes', NULL, '2025-07-17 00:37:18', '2025-07-17 00:37:18'),
(437, 886, '[\"documents\\/01K0AFHTTDMG6SQFVXFGSZ2M1W.jpg\",\"documents\\/01K0AFHTTG49104YQPY91RQ3GT.jpg\"]', '[\"documents\\/01K0AFHTTJVD5RPFFCRETRNPVN.pdf\"]', 'Unemployed', '\nAs a passionate advocate for youth empowerment and community engagement, applying to be part of the youth program is an exciting step for me. My background in public relations, enhanced by my recent certification, has equipped me with the skills and knowledge necessary to contribute meaningfully to this initiative. I believe that this program aligns perfectly with my aspirations, and it offers a unique opportunity to work collaboratively with like-minded individuals committed to making a difference in our community.\n\nOne of the main reasons I applied for this program is my deep-seated belief in the power of youth. I believe that young people have the potential to drive change, inspire innovation, and contribute positively to society. Through my experiences—both personal and educational—I have witnessed how youth can be catalysts for progress when given the right tools and opportunities. The youth program embodies this belief by fostering an environment where young people can learn, grow, and make their voices heard. I am incredibly motivated to be part of this transformative experience.\n\nMy public relations certificate has provided me with a comprehensive understanding of communication strategies, media relations, and community outreach. These skills are essential for anyone looking to make an impact in youth advocacy. I have studied topics such as crisis communication, audience engagement, and strategic messaging, all of which are vital in connecting with diverse groups and promoting initiatives. I envision utilizing these skills within the youth program to help amplify the voices of young people, enabling them to articulate their ideas and concerns effectively. I want to be part of a team that harnesses the power of communication to foster dialog between youth and decision-makers, ensuring that the perspectives of young people are included in important discussions.\n\nMoreover, I have always been involved in various community service projects, which have fueled my desire to inspire change at a grassroots level. From organizing local clean-up campaigns to mentoring at-risk youth, these experiences have taught me the importance of active participation in community-building. I see the youth program as an extension of these efforts—a platform to engage more systematically and impactfully with community issues. By collaborating with others, I hope to leverage our collective talents to design and implement projects that address the unique needs and interests of young people in our community.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 00:41:54', '2025-07-17 00:41:54'),
(438, 887, '[\"documents\\/01K0AFNABAZCBFF7CW1QPF4VYF.png\",\"documents\\/01K0AFNABE43ZKPNGNNAB6AW3B.png\"]', '[\"documents\\/01K0AFNABJVNPCT52D45P0CGA8.png\"]', 'Unemployed', 'I am keen with working and empowering young people. I believe my academic background and internship experience in HR makes me to be a good fit for the position. I have worked with different clients in short and long term phases and learnt professional communication.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 00:43:48', '2025-07-17 00:43:48'),
(439, 888, '[\"documents\\/01K0AFS429FBAZTEJRVFDMMMGD.jpg\"]', '[\"documents\\/01K0AGH2RC7NRZBRJCSZE60DZ4.pdf\"]', 'Self-Employed', 'Because I\'m passionate about teaching especially to the youth, growing up I wanted to be a teacher but then things did not work my way therefore I would like to share My experiences with the youth and use my failure as a ladder for them to reach their goals,, I also enjoy knowing that I have made an impact in someone\'s life so bringing change, sharing ideas is one of my biggest desire.Secondly,in my community programs that nurture and educate the youth are very slim so this opportunity will help me uplift my community\'s future leaders and so that contribute to a better world so Iam the best person for that since I have a great vision and plans about the future that will begin today through me. Thirdly,Iam a young woman who is God fearing and who serve at church therefore I won\'t be teaching the young minds with general knowledge only but also help them spiritually which is a necessity nowadays because our youth are being misleaded more often.lastly,I am the best candidate for this role because I am outspoken, ever-smiling,flexible, good leastner,and also patient so I am a simple person to understand and communicate with which is needed by our youth today.', 'Yes', 'The do something charity organization', 'I was the assistant leader of the group,we offered help that we had to the youth,it may be financially, spiritual and evn sexually because we wanted to bring change .', 'Yes', NULL, '2025-07-17 00:45:53', '2025-07-17 01:30:26'),
(440, 889, '[\"documents\\/01K0AFW47A0CZC1HAXMSEQM1ZS.jpg\"]', '[\"documents\\/01K0AFW47CXQFHAY9XMBF73DHD.pdf\"]', 'Unemployed', 'I am a primary school educator seeking the opportunity to work with the youth as it is in my passion to create and  develop young ones leading them to their suitable careers. I am eager to use my proven teaching skills to continue the district’s legacy of quality education and help prepare students for future success. My aim is to strengthen basic education to support and implement human  capital development in Eswatini thus, limit the rate of school drop outs. I\'m also capable in equiping adolescents with a wide range of psychosocial skills and help them to effectively manage day to day life challenges and make informed and successful decisions. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 00:47:31', '2025-07-17 00:47:31'),
(441, 890, '[\"documents\\/01K0AFWRR43SFWKA4DFRD7MBMH.pdf\"]', '[\"documents\\/01K0AFWRR8ER0VHYP3TBJHYGBJ.pdf\"]', 'Unemployed', 'As a Business Management graduate with a passion for human development and behavioral transformation, I am confident in my ability to guide individuals and teams through meaningful mindset shifts that support personal growth and organizational success. Moreover, my skills aligns with those of a Mindset change trainer of which i think am the suitable candidate.\n', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 00:47:52', '2025-07-17 00:47:52'),
(442, 891, '[\"documents\\/01K0AG6VNFHAKZ700RB7JKTQ3J.pdf\",\"documents\\/01K0AG6VNM1SYWB6M1S792X38T.pdf\",\"documents\\/01K0AG6VNV1JYCZEKEVFX7MVJZ.png\"]', '[\"documents\\/01K0AG6VP03R43RKA80AZGJCK0.pdf\"]', 'Employed', 'I have applied for the position so that I can be able able to help the young people in my residential area facing diverse challenges , to see life differently and try their level best to be the best they can be in the society.\n\nWhat makes the best candidate for the job is that , firstly I am a qualified educator with a diploma in education , I\'m well equipped with dealing with young people. \nSecondly at my early stages of development I have worked with young people in the scouting movement where I assumed leadership positions and worked with large numbers of young people.\n\nLastly, my experience working as a peer educator for UNICEF ,makes me the best candidate for the job. I am a certified HIV/AIDS peer educator trained by UNICEF through the string game story.', 'Yes', 'Eswatini scouts', 'I did counseling to those in need , provided HIV/aids trainings to my peers and life orientations ', 'Yes', NULL, '2025-07-17 00:53:23', '2025-07-17 00:53:23'),
(443, 892, '[\"documents\\/01K0AGSXK0KVGT4BWNKYR9WQST.jpg\"]', '[\"documents\\/01K0AGBWEKWR923H5KHP0HRJ4S.pdf\"]', 'Unemployed', 'Firstly I have good communication skills which will enable me to convey the message with ease, I am also in my youthful stage and has underwent a lot of situations which most youths are going through- making it easier to talk to people who are mostly on the same page as you are. I love young people, it has always been in my heart to see them happy, prospering and fulfilling their dreams and ambitions in ways which will make them future great leaders of the society. My main aim of applying was to be given the chance to change a young person from bad to best, to make them better see the best in life and what we will be taught to them.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 00:56:07', '2025-07-17 01:03:47'),
(444, 893, '[\"documents\\/01K0AGVGPF2S2HZ0CM91277Q3R.jpg\"]', '[\"documents\\/01K0AGVGPK9PPDKCDF0G28DZWK.jpg\"]', 'Unemployed', 'I believe my small community of Salukazi can benefit from such a program, because as it stands-the youth are currently facing unemployment, young girls even younger than me falling pregnant and no hope for the future. I am the best candidate for the job as I can be a candle of hope, reassure them that if we come together, see to it that this programme is a success, the whole community at large can be able to sustain itself. This way, even the younger generation after us can see an example in us thus strive for change. ', 'Yes', 'Woman Farmer Foundation, IYF eSwatini ', 'I was in a climate smart training in tunnel farming where I got to meet, engage with a lot of individuals (the youth) from all corners of the country. I was collaborating, engaging and mkiung submissions on how the youth of Eswatini can benefit from such a program.\n\nIn IYF Eswatini, I have attended a few of their mindset education classes which i believe helped me the world in a different perspective. In these classes, I was a participant with my fellow peers from all over the country. I was able to align myself with their experiences and share mine for a better tomorrow. ', 'No', NULL, '2025-07-17 01:04:40', '2025-07-17 01:04:40'),
(445, 894, '[\"documents\\/01K0AH1S3N0XMMW5MYNHGJV5G7.pdf\"]', '[\"documents\\/01K0AH1S3V6AAWFYHHZPNA5001.pdf\"]', 'Unemployed', 'believe I am the best candidate for this position because I am passionate about working with young people and committed to making a positive impact in their lives. I have excellent communication and listening skills, which allow me to build trust and connect with youth from different backgrounds.\n\nIn addition to my interpersonal strengths, I bring experience in guiding, teaching, or mentoring, whether formally or informally, and I know how to create a safe, engaging, and supportive environment. I am also responsible, approachable, and patient—qualities that are essential when working with youth.\n\nI understand the challenges that young people face today, and I’m confident in my ability to inspire, motivate, and empower them through creative programs, honest guidance, and positive role modeling. I’m also a quick learner and a team player, which means I’m always open to training, growth, and contributing to the organization’s mission.', 'Yes', 'IYF ', 'We donated essential like sanitary towels to young girls, also delivered presentations on importance of Education and having goals.', 'No', NULL, '2025-07-17 01:08:05', '2025-07-17 01:08:05'),
(446, 895, '[\"documents\\/01K0AHA79FAXM0VQW6WF5TWGRJ.pdf\"]', '[\"documents\\/01K0AHA79JYZN43098Z4V41KPG.docx\"]', 'Unemployed', 'Looking onto the current economy in our country I want to be directly  involved in  evolusions that can help the youth in my society in building networking and gathering resources that will help our community to a better level. Due to the scarcity of jobs it is my aim to help the youth in achieving valuable life skills \n that will help one to be independent  which in return will reduce the number of youngsters taking their life  because they feel like they have failed their parents as well as securing the future of their children.   I belive that I am the best candidate for this job because I am one of graduates that got  an opportunity to learn but then faced the harsh reality of unemployment and scarcity of jobs which has then made me to switch focus on how can I survive beside being employed ,thus I am willing to be part of a team that will change the focus and mindset of the youth  ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 01:12:42', '2025-07-17 01:12:42'),
(447, 896, '[\"documents\\/01K0AJ1A1EZHWRQDC7P87CV906.pdf\",\"documents\\/01K0AJ1A1H00VKDXJ6MGZWACXA.pdf\",\"documents\\/01K0AJ1A1KW6CAFM8HRYKF3PJX.pdf\"]', '[\"documents\\/01K0AJ1A1QH16EYK0GNVEPX15K.pdf\"]', 'Unemployed', 'I am applying to ENYC because I am deeply passionate about youth empowerment and believe my Associate Degree in Business Management, combined with my diverse administrative and financial experience, will directly support your mission for socio-economic development. My roles at Bright Mercy Investments, Duraz Consultancy, and Mandulo High School have honed my organizational, communication, and analytical skills, enabling me to manage operations efficiently and interact effectively with various stakeholders. I am particularly adept at streamlining processes and ensuring meticulous record-keeping, which are crucial for the successful coordination and execution of ENYC\'s vital programs. I am eager to contribute my proactive approach and dedication to fostering a conducive environment where Eswatini\'s youth can thrive.\n', 'No', 'None ', 'None ', 'Yes', NULL, '2025-07-17 01:25:18', '2025-07-17 01:25:18'),
(448, 897, '[\"documents\\/01K0AJNYT7ZE81990SX0FZ9CGP.jpg\"]', '[\"documents\\/01K0AJNYTBVMNEYK5BASAVCQ2K.docx\"]', 'Unemployed', 'I believe I am the best candidate because of my strong communication skills emphathy and passion for youth development. I understand the importance of creating a safe place, supportive and engaging environment where young people feel heard and valued . My experience such as mentoring, facilitating and coaching or working in youth programs has equipped me with the ability to connect with young people from diverse backgrounds, understand their challenges and help them build confidence and life skills.  I am patient , energetic and dedicated to making a positive impact , which I believe is essential for inspiring and guiding young people toward their full potential.', 'Yes', 'World Vision Organization ', 'I facilitated Young women on Halting the spread of HIV and Reversing its Impact in Eswatini ', 'Yes', NULL, '2025-07-17 01:36:35', '2025-07-17 01:36:35'),
(449, 898, '[\"documents\\/01K0AK070P687GFS7DJYPAG8YP.pdf\",\"documents\\/01K0AK070RPEGBVGHT3GREJ5BV.pdf\"]', '[\"documents\\/01K0AK070W6G8F20SDCE7GX5CT.pdf\"]', 'Unemployed', 'I applied because I’m passionate about youth development and believe mindset is key to creating lasting change. As a Digital Literacy Tutor and Peer Health Coordinator, I’ve worked directly with young people, leading sessions that focused on confidence, wellness, and digital skills. These roles taught me how to connect, communicate, and lead with empathy. I believe I’m the right candidate because I have both the heart and experience to inspire others and represent ENYC’s mission well.', 'Yes', 'UJ Community Engagement and UJ CSHAW (Centre for Student Health and Wellness)', 'As a Digital Literacy Tutor with UJ Community Engagement, I helped primary school learners build basic computer skills in a fun and interactive way. I also served as a Peer Health Coordinator under UJ CSHAW, where I led sessions on mental health, self-confidence, and wellness for young people. Both roles allowed me to empower youth with knowledge and support their personal growth.', 'Yes', NULL, '2025-07-17 01:42:11', '2025-07-17 01:42:11'),
(450, 899, '[\"documents\\/01K0APJW2QGVPFB134C4T26HFV.pdf\",\"documents\\/01K0APJW2T4M51BN1NDFZWKF51.pdf\",\"documents\\/01K0APJW2WXY30XHM90T6VYVC7.pdf\"]', '[\"documents\\/01K0APJW2YH2E1KABBZJFVJX7W.docx\",\"documents\\/01K0APJW2Z2BMP9VY7SE8D4VP6.jpg\",\"documents\\/01K0APJW32H17MJMH7343FV455.jpg\"]', 'Self-Employed', 'I applied for the Mindset Change Workshop with ENYC because I believe young people in my community, especially in Kwaluseni and Matsapha, urgently need support in shifting their perspectives towards growth, responsibility, and positive behavior. Having previously contributed inputs to the Mindset Change Manual and participated in ENYC meetings, I have seen the value of creating spaces where young people’s voices shape solutions that affect them directly. My background in youth advocacy and community engagement motivates me to continuously seek opportunities that equip me with skills to inspire and support mindset change among my peers. I am confident that this workshop will strengthen my ability to contribute meaningfully to youth development efforts in Eswatini.', 'Yes', 'SAFAIDS Eswatini ', 'As a Programme Officer at SAfAIDS in Eswatini, I coordinated projects focused on promoting health, human rights, and youth empowerment by ensuring young people had access to accurate information, essential services, and opportunities to participate in decisions affecting their lives—especially in sexual and reproductive health and rights (SRHR), HIV prevention, gender equality, and social accountability. I led and facilitated youth-centered workshops, trainings, and community dialogues, created platforms for capacity building and mentorship, collaborated with youth-led organizations and government departments for advocacy and awareness campaigns, and monitored project progress to ensure initiatives were effective and responsive to youth needs. Through these efforts, I strengthened youth leadership and advocacy skills, improved access to vital health and support services, and amplified young people’s voices in national policy discussions, contributing to more inclusive, rights-based programs that empower healthier and more engaged communities in Eswatini.', 'Yes', NULL, '2025-07-17 02:44:48', '2025-07-17 02:44:48'),
(451, 900, '[\"documents\\/01K0APQ2C8DCVQHMK5K96J7B4B.jpg\"]', '[\"documents\\/01K0APQ2CBN9FPHD5Q0EYGVMHM.jpg\"]', 'Unemployed', 'I have applied for this job because, I am genuinely passionate working with you and see it as an opportunity to contribute my skills and experience to a forward thinking team.i am the best candidate because my skills and qualities are a strong match for this job description. ', 'No', 'None', 'None', 'No', NULL, '2025-07-17 02:47:05', '2025-07-17 02:47:05'),
(452, 901, '[\"documents\\/01K0APRH3FHGXSPKT27MMJ3VWB.jpg\"]', '[\"documents\\/01K0APRH3Q39T8KP3QGHP6KK3W.pdf\"]', 'Unemployed', 'I have a great passion and very compassionate in working woth different people from different background. Having theory and experience on community works, I would be glad to be part of the team in helping out and strengthening those who are in need of help. Again, I am a hard working and dedicated individual that gets work done in time without the urge to be supervised. Honesty and loyalty are always my priorities in what ever job I do, so I believe I will add value in the communities', 'Yes', 'Young Heroes ', 'I was part of a group under young heroes during high school and tertiary years where we educated each other on preventing methods, business ideas, savings and many more topics discussed. This taught us surviving skills and coping skills in times of wilderness ', 'No', NULL, '2025-07-17 02:47:53', '2025-07-17 02:47:53'),
(453, 902, '[\"documents\\/01K0APRXT1VK699VGSGY1YTFFV.pdf\",\"documents\\/01K0APRXT9JM5G5AABZX54H0KF.pdf\"]', '[\"documents\\/01K0APRXTHVRBAY17Y990D0VSC.pdf\"]', 'Unemployed', ' I believe I am an excellent candidate for this traineeship because I  fall within the specified age range of 18-35 which allows me to have the ability to connect with young people from diverse backgrounds.\n\nFurthermore, I have a good understanding of our local community structures, which will allow me to tailor the mindset change sessions to be relevant and impactful. I am committed to being a respected and trusted voice within my community and take my responsibilities seriously. I am fully committed to attending and actively participating in all the required training sessions, understanding the dedication this programme demands. I am a quick learner, adaptable, and genuinely excited by the prospect of learning from experienced trainers to make a tangible difference in the lives of young Swati youth.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 02:48:06', '2025-07-17 02:48:06'),
(454, 903, '[\"documents\\/01K0APWY1Q1WD9CANQJP8MVX0C.jpeg\"]', '[\"documents\\/01K0APWY1Z04JB9MXN9M64V46V.docx\"]', 'Self-Employed', 'I have applied for this position because I love working to improve my community  working with youths like me and being in a position where I can influence change and be an advocate for young women like me.\nI believe I am suitable for this job because I been trained for 2 years equipped with public speaking skills, advocacy skills, youth leadership skills and experience with working with youths and stakeholders and more equipped and knowledgeable on Sexual Reproduction Health and solving issues young people face on daily basis.I am also currently volunteering on HER VOICE Funded Project where I am an advocate for young women and adolescent girls and focusing on the health and SRH Services.', 'Yes', 'Batwana Initiative and Young Heroes ', 'When I was working for Bantwana Initiative I was a Financial Education Facilitator teaching youths like me on the importance of knowing how to use money, saving , investing and budgeting.This was to emphasize the importance of being independent and stable as adolescent girls and young women \nWhen I worked for Young Heroes I a Dreams Representative I was the link for youths to Facilities working along Luke Commission and and mobilizing youth for sessions where I was teaching broadly about SRH and the importance of being independent as youths , taking feed backs from clinics to the youth during MDT meetings and give and take feedback from community leaders during stakeholder meetings under the Inkhundla of Lobamba ', 'Yes', NULL, '2025-07-17 02:50:18', '2025-07-17 02:50:18'),
(455, 904, '[\"documents\\/01K0AQ8PR3T44AZZTV4FE8W2SJ.pdf\",\"documents\\/01K0AQ8PR9YBW4RV7CP8CEC404.pdf\",\"documents\\/01K0AQ8PRDQWT6N8XSQB67V69X.pdf\"]', '[\"documents\\/01K0AQ8PRGRZC5XYE5G4GKP520.pdf\"]', 'Unemployed', 'I am confident in my ability to lead the Somntongo Inkhundla as a trainer of trainers, backed by my professional experience and academic qualifications. I am passionate about youth development and believe in the youth\'s impact on sustainable development in Eswatini. That is why I have the conviction that the youth of Eswatini should lead in all development facets, from education and training, entrepreneurship, innovation and employment, health, food security, governance, and research.\nI have experience in socioeconomic profiling, leadership, coordination, public speaking, training, educating and empowering developed from my previous work roles. It is my conviction that these skills and experience will be an asset for the role to be filled. I am an active youth member and I have made it a point to keep myself updated and engaged in all communiity developments in my constituency. ', 'Yes', 'World Vision Eswatini', 'In this project, The HALT, I was a Youth Facilitator for my constituency and area program (Somntongo). The main objective of my everyday work was stopping/halting the spread of HIV in my constituency, especially in the youth I was allocated to, through educational programs and close mentoring. In my role, I implemented a comprehensive HIV prevention program by creating a safe space for Adolescent Girls and Young Women and Men (AGYWM), conducting vulnerability assessments, developing tailored mentoring plans, and providing outreach, mentorship and health information on HIV prevention, Sexual Reproductive Health (SRH), and life skills. I further supported health and safety initiatives by identifying and enrolling AGYWM, tracked progress through monthly reports, and addressed Gender-Based Violence (GBV) cases. My other key task was enrolling my drop-out AGBYWM that showed zeal and enthusiasm in learning back to school. World Vision covered the school fees and uniforms and monitored the progress of those beneficiaries. Livelihood skills were also initiated to be coupled into the program.', 'Yes', NULL, '2025-07-17 02:56:43', '2025-07-17 02:56:43'),
(456, 905, '[\"documents\\/01K0AQCBAW0W8D87P1GCBRYYQE.pdf\",\"documents\\/01K0AQCBAYADVZ667NZVM4S7VA.pdf\",\"documents\\/01K0AQCBB07K3ZZRXT2SKMZSDG.pdf\"]', '[\"documents\\/01K0AQCBB2NBQDWG70SSHM2710.pdf\"]', 'Unemployed', 'Hi This is Marx Hennsion. I have applied to this Organization to mainly gain experience from other Young people like me. I like seeing the world as a better place and thus that can only be done by the future leaders of the country which is is young people. I am also eager to work with young women like me to prove to the whole country that women can also be effective in everything they do. ', 'No', 'None', 'None ', 'Yes', NULL, '2025-07-17 02:58:43', '2025-07-17 02:58:43'),
(457, 906, '[\"documents\\/01K0AQZ81NMAWR39ETCH862Y9Z.jpg\"]', '[\"documents\\/01K0AQZ81QV5ZRR74NATM7CD8Z.docx\",\"documents\\/01K0AQZ81RGHN4PPR0T5Z237B3.jpg\",\"documents\\/01K0AQZ81V1WP4YYVPNNJM6B1H.jpg\",\"documents\\/01K0AQZ820HC7VT7X6181Z7MHW.jpg\",\"documents\\/01K0AQZ82F3ZD22CT6GPNEAQGC.jpg\"]', 'Self-Employed', 'I am very passionate in engaging  with young people and promote positive change in communities.I strongly believe in well informed  future generation to stimulate development and improved living standards also lead with wisdom.Being a peer educator will save my aim of creating a well informed,empowered,self employed and a health environment for everyone.', 'Yes', 'YOUNG HEROES ', 'to achieve voluntary skills and training.motivate them to amplify their voices and be drives of positive change at community level and nationally.Conducted Safe spaces and sessions  on Gander based violence and teenage pregnancy also mental health support.', 'Yes', NULL, '2025-07-17 03:09:02', '2025-07-17 03:09:02'),
(458, 907, '[\"documents\\/01K0AR8HB4SVXRRAZCBK77DGZY.pdf\"]', '[\"documents\\/01K0AR8HBDZ9TF9KA546E7ZQD9.pdf\"]', 'Unemployed', 'I have applied for the Youth Mindset Change Trainer Programme because I am passionate about empowering young people to reach their full potential and make positive life choices. Growing up and working in my community, I have seen firsthand the challenges that young people face—such as lack of motivation, peer pressure, and substance abuse—and I believe that mindset change is the key to transforming lives and communities.\n\nOver the years, I have gained experience mentoring and motivating adolescents through voluntary work with Lisakhanya Likusasa and the Obz Can Feed You Community Kitchen. I have connected with young people from diverse backgrounds, encouraged them to value education, and helped steer them away from destructive behaviors. I understand how to work within community structures and have earned the trust of my peers and local leaders through my consistency, integrity, and commitment to service.\n\nIn addition to my community work, I have professional experience working as a web developer for an international company based in Mauritius—Phatqi (Pty) Ltd. This role strengthened my ability to work remotely with multicultural teams, manage projects independently, and communicate effectively across borders. I developed and maintained websites, built responsive applications, and collaborated with team members from different backgrounds. This experience has enhanced my problem-solving skills and adaptability, which I believe are also valuable when working with youth and community stakeholders.\n\nI am fully committed to completing the entire training programme and using the knowledge and tools gained to support and inspire more young people in my community. My combined experience in community work, mentorship, and international collaboration makes me a strong and well-rounded candidate for this opportunity. \n', 'Yes', 'Lisakhanya Likusasa', 'At Lisakhanya Likusasa Community-Driven Organization, my primary focus was on supporting and empowering adolescent boys in the Macetjeni community. I served as a mentor and role model, providing regular motivation and encouragement to help them believe in their potential and stay focused on their education. Many of these young people faced difficult circumstances at home and within the community, including poverty, peer pressure, and a lack of positive role models. I made it a priority to build meaningful relationships with them, listen to their concerns, and guide them toward making informed decisions about their future.\n\nOne of the key ways I helped was by creating a safe space where the boys could openly share their struggles and receive guidance without judgment. Through regular mentorship sessions and informal conversations, I encouraged them to set personal goals and reminded them of the long-term benefits of staying in school and avoiding harmful behaviors such as drug and alcohol abuse. I used real-life examples, including my own experiences, to show them that with discipline, focus, and the right mindset, they too could overcome obstacles and achieve success.\n\nIn addition to one-on-one mentorship, I was actively involved in organizing community events and campaigns aimed at educating young people and promoting positive values. I designed posters and materials that were visually appealing and tailored to youth interests, helping to draw their attention to important messages such as self-respect, responsibility, and education. These events created opportunities for the youth to engage in meaningful dialogue, learn from one another, and participate in activities that built their confidence and sense of belonging.\n\nMy involvement at Lisakhanya Likusasa went beyond motivation—I contributed to their personal development by being consistently present, offering emotional support, and advocating for their needs within the organization. Over time, I saw many of the boys grow in confidence, improve their school attendance, and begin to make better life choices. This work was deeply fulfilling, and it reinforced my belief in the importance of mentorship and community-based support systems for youth development. \n', 'Yes', NULL, '2025-07-17 03:14:06', '2025-07-17 03:14:06'),
(459, 908, '[\"documents\\/01K0ARHVBJG27T2TYGH95T1FZQ.jpeg\"]', '[\"documents\\/01K0ARHVBPVV5NA783NBDM18MX.pdf\"]', 'Unemployed', 'I believe I am the best candidate for a mindset change trainer because I have a proven track record of inspiring others to unlock their potential. For instance, I worked with a client who struggled with self-doubt and fear of failure. Through personalized coaching and empathy, I helped them identify limiting beliefs and develop practical strategies to overcome them. As a result, they gained confidence, set achievable goals, and experienced a significant positive shift in their mindset. My passion for empowering others, combined with my ability to listen deeply and tailor approaches to individual needs, makes me uniquely qualified to lead others on their journey toward growth and self-improvement.', 'Yes', 'Salvation Army Organisation', 'supporting the emotional and mental well-being of youth by providing a safe and welcoming environment. I facilitated group activities and discussions that promote self-awareness, resilience, and positive social interactions. It\'s also important to identify and address any signs of distress or mental health concerns among the youth, offering guidance or referrals when necessary. Additionally, i served as a role model, demonstrating respectful communication and empathy.\nOverall, your goal is to empower young people to develop confidence, coping skills, and a sense of community throughout the camp experience.', 'Yes', NULL, '2025-07-17 03:19:12', '2025-07-17 03:19:12'),
(460, 909, '[\"documents\\/01K0ARKRW2VXPBKTSFEY4PWGAZ.jpg\"]', '[\"documents\\/01K0ARKRW70J7J2HKTHSXSTRGR.docx\"]', 'Unemployed', 'I applied because I am passionate about youth development and creating a positive impact in my community. I believe I am the right candidate because of my previous experience in youth organizations, strong communication skills, and my dedication to teamwork.', 'Yes', 'Mbuluzi youth organization ', 'I helped organize youth events, supported life skills workshops, and encouraged other young people to get involved. It taught me teamwork and leadership.', 'Yes', NULL, '2025-07-17 03:20:14', '2025-07-17 03:21:47'),
(461, 910, '[\"documents\\/01K0AYZ5BX19X7X3ZX8YCN0MGE.pdf\"]', '[\"documents\\/01K0AYZ5C3QS3W7TAWGJHX83V3.pdf\"]', 'Employed', 'I want to give back to my community by helping the younger generation build resilience, confidence and hope. I have experience mentoring vulnerable or at risk youth, helping them navigate life challenges. I have mobilised and facilitated sessions on life skills, reproductive health and leadership in my community. I believe youth are the foundation of every strong community and i want to be part of the team that empower them to reach their full potential.', 'Yes', 'WORLD VISION ESWATINI ', 'Mobilised and facilitated 100+ young women from age15- 29. Facilitated safe spaces for open conversations about mental health, peer pressure,social challenges and linked youth to relevant support services when needed. I also equip young people with essential life skills, leadership tools and practical knowledge to become proactive, confident and capable contributers to the community.', 'Yes', NULL, '2025-07-17 05:11:19', '2025-07-17 05:11:19'),
(462, 911, '[\"documents\\/01K0B3XM64H5ANGG2428BGDZBC.jpeg\"]', '[\"documents\\/01K0B3XM6BZTNAYJKJJNPS5RT6.docx\",\"documents\\/01K0B3XM6KJT1CW9RBBVQ742Y4.pdf\"]', 'Unemployed', 'I am applying for the Youth Mindset Change Trainer Programme because I am passionate about youth development and committed to driving positive change in my community. Growing up, I witnessed many young people around me struggling with low self-esteem, lack of motivation, and limited guidance. I believe that shifting mindsets can unlock potential and inspire long-term transformation. This programme offers a meaningful opportunity to be trained, equipped, and empowered to lead those changes and I am eager to be a part of it. I see this as a chance to give back to my community, uplift my peers, and grow personally in the process.\n\nAcademically, I have completed Form 5 and recently earned a diploma in Human Resource Management, which has helped me develop strong communication, organizational, and people skills. My background in HR gives me a solid foundation in understanding human behaviour, personal growth, and interpersonal dynamics skills that align well with the objectives of this programme. I am also actively seeking my first formal employment opportunity and view this initiative as a stepping stone to meaningful work in youth and community development. I believe my educational foundation, paired with a strong desire to serve, makes me well-suited for this role.\n\nWhat sets me apart as the best candidate is my genuine passion, lived experience, and readiness to commit to this programme with my full energy and dedication. I understand the challenges young people face because I’ve lived them and I believe that makes my voice more relatable and impactful. I am not applying just for the title, but for the opportunity to serve, grow, and be part of something bigger than myself. I am committed to attending all training sessions, actively participating, and taking what I learn back to my community to make a difference. I believe in the vision of mindset change, and I’m ready to help bring it to life.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 06:37:52', '2025-07-17 06:37:52'),
(463, 912, '[\"documents\\/01K0B4Q9CE6R4CPFKQ6EX21H08.jpg\",\"documents\\/01K0B4Q9CGH9D3EAG2NHD2KM88.jpg\"]', '[\"documents\\/01K0B4Q9CM2ECG4FRY4DGZE000.pdf\"]', 'Self-Employed', 'I applied for this position because it align closley with my interests and I am excited about the opportunity to contribute to a team that values community growth and positive mindset.I am a good candidate because I bring such a relevant experience ,communication skills. I am committed to learning and I\'m confident in my ability to  contribute positively from day one. ', 'Yes', 'AMICAALL', ' I was a Home Visitor.My job was to monitor and encourage HIV positive beneficiaries to take their medication everyday and on time. I teached adolescent boys and girls how to behave and practice good hygiene. ', 'Yes', NULL, '2025-07-17 06:51:53', '2025-07-17 06:53:49'),
(464, 913, '[\"documents\\/01K0B57XG7QA920YDKPE23ZXZ2.pdf\"]', '[\"documents\\/01K0B57XGBN6889EJ59SXTTRB0.pdf\"]', 'Unemployed', '\nI have applied for this position because I am genuinely passionate about young people and I believe this role aligns perfectly with my skills, experience, and career goals. I am drawn to your organization’s reputation for helping young people achieve their dreams, and I am excited about the opportunity to contribute meaningfully to your team.\n\nI believe I am the best candidate for the job because I bring a combination of relevant experience, a strong work ethic, and a commitment to excellence. My background in education has equipped me with the ability to solve problems, work under pressure and be a team player, I am a fast learner, reliable, and always ready to take initiative. I also bring a positive attitude and a willingness to grow professionally, which I believe will make a strong contribution to your team.\n\n\n---\n\nIf you tell me more about the job role and your background, I can tailor this even better for you.\n\n', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 07:00:58', '2025-07-17 07:00:58'),
(465, 914, '[\"documents\\/01K0B7XM6H3BF62E7BMG85W890.pdf\",\"documents\\/01K0B7XM6K4BFVYJN2R9EEGBX4.pdf\",\"documents\\/01K0B7XM6PBZ5TJ00HESWGJM57.pdf\"]', '[\"documents\\/01K0B7XM6RE2CWWMZ0QXPERXWC.docx\"]', 'Unemployed', 'Upon completing my bachelor’s degree in Psychology from Eswatini Medical Christian University, I conducted a research project in the department with the topic Lived experiences of adolescents with conduct disorder. I have a huge interest in young people who are emotionally challenged and I always to share some guidance and counselling, and on the post they wanted someone to work with young people so I believe I\'m the best candidate for this job ', 'Yes', 'Iboost-Foundation ', 'Provided emotional and psychological support to patients and families.\n Escorted clients to the National Psychiatric hospital.\n Worked with Mahlabatsini community on food and school counselling initiatives.\n Raised mental health awareness in schools: KaZakhali, Inkhanyeti, Living Waters, Helemisi, Lwati.\n Developed and presented funding proposals.\n Prepared and submitted monthly reports.\n Promoted a collaborative and accountable work culture.\n', 'Yes', NULL, '2025-07-17 07:47:46', '2025-07-17 07:47:46'),
(466, 915, '[\"documents\\/01K0B8M7QDDGZFMNZVCFS2W93B.pdf\",\"documents\\/01K0B8M7QMMVXYBXFP4NVWCJ0Y.pdf\"]', '[\"documents\\/01K0B8M7QV982YEEME1RXKC25W.pdf\"]', 'Unemployed', 'I am writing to express my enthusiastic application for the Youth Mindset Change Trainer Programme. As a young citizen of Eswatini with a strong passion for youth development and empowerment, I am excited about the opportunity to be part of this initiative.\n\nAs a trainer, I bring several key strengths to the program. My academic background in Social Science has given me a deep understanding of social dynamics, allowing me to craft contextually relevant training programs. Additionally, my computing skills enable me to develop engaging digital content, making complex concepts more accessible to young people.\n\nHaving witnessed the untapped potential of Eswatini\'s youth due to socio-economic challenges, I firmly believe the Youth Mindset Change Trainer Programme is a vital initiative. It has the potential to equip our youth with the right mindset, skills, and knowledge to drive meaningful change in their communities.\n\nI am the best candidate for this role because I possess a unique blend of social science knowledge and technical skills, allowing me to design and deliver holistic training programs. My passion for youth development, combined with my skills, makes me well-suited to inspire and empower young people to become agents of change.', 'No', 'None', 'None', 'No', NULL, '2025-07-17 08:00:07', '2025-07-17 08:13:00'),
(467, 916, '[\"documents\\/01K0B8P3XKHS1GAY8VCEB9A9WP.pdf\"]', '[\"documents\\/01K0B8P3XN82AXPHCCHRQ58CZC.pdf\"]', 'Unemployed', 'I am excited to apply for the position of peer educator because I am passionate about empowering my peers through education, support, and shared experiences. As someone who values community and believes in the power of knowledge, I see this role as an opportunity to make a meaningful impact on the lives of others while fostering a positive and inclusive environment.\r\nMy motivation to become a peer educator stems from my own experiences as a student. I have faced challenges that many of my peers encounter, such as navigating academic pressures, mental health issues, and social dynamics. Through these experiences, I have learned the importance of having someone to turn to for guidance and support. I want to be that person for others someone who listens, understands, and provides valuable resources.\r\n', 'Yes', 'Young heroes ', 'I helped young people from 8 - 18 years with studying on Saturdays. I would ask them topics that they don\'t understand at school and then help them with the topics. I also helped them with their homeworks. ', 'Yes', NULL, '2025-07-17 08:01:09', '2025-07-17 08:01:09'),
(468, 917, '[\"documents\\/01K0B9BWYQSPXWQTK8RTX70RQ6.jpeg\"]', '[\"documents\\/01K0B9BWYVT9TX0AKAETCF5NTR.docx\"]', 'Unemployed', 'I applied for the job because it is in alignment with the degree i am currently pursuing which is a Bachelors in social work. This is an initiative that I need in order to gain more experience in readiness for the work field. I think I’m the write candidate for this job because I possess all the qualities needed to make sure that the job is done on its highest capability.', 'Yes', 'Family Life Association ', 'I was a peer educator and I rallied raising awareness to the youth on SRH related matters. I’ve been able to reach most schools in Mbabane as well as make condom distributions around the city in efforts to try combat HI infections as well as teenage pregnancy ', 'No', NULL, '2025-07-17 08:13:02', '2025-07-17 08:13:02'),
(469, 918, '[\"documents\\/01K0B9SN1KGG1CXX64VHFT2S5B.pdf\"]', '[\"documents\\/01K0B9SN1WE3H0J8TP8FDTCFKA.docx\"]', 'Unemployed', 'I have applied because I like saving for community, helping young people grow and mentoring them keeps going and like working with young people and seeing them achieving their goals through my assistance and changing their behaviors.I am the best candidate for this job because I have experience in working with young people,I know how to connect with young people and can set a conjusive environment for them. I am trusted in the community since I have been working on the ground I have never had difficulties with the people in the community which proves that they trusted me and thus made working with the community easier. I understand community structures and understand the way I need to present myself in the  community. I am also committed to the training sessions.', 'Yes', 'World Vision Eswatini', 'I was a business mentor, I was trained to facilitate USAID evidence-based curriculum (Job Aids) that is facilitated to Adolescent Girls and Young Women (AGYW) for business facilitation in the implementing in communities in Eswatini. I delivered model fidelity interventions to the targeted beneficiaries in the communities.  I also ensured that indicators like Mentoring PP-PREV,Savings and Landings(helped AGYWs to start saving money in groups after facilitating a module called Savings and Landingv),Business Start-ups(here AGYWs would go through module called skills buildings, then after I helped them to start business of their interest,with World Vision supporting them with capital,they would start the businesses in groups or individuals),Internship ( link the AGYWs for Internship) and Financial Literacy set targets are met and timely. ', 'Yes', NULL, '2025-07-17 08:20:33', '2025-07-17 08:20:33');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(470, 919, '[\"documents\\/01K0BA39NQXVWJN9KABQPXWCXC.pdf\",\"documents\\/01K0BA39NZFY58J0JDGVXKV296.pdf\"]', '[\"documents\\/01K0BA39P1XKWT8SPMYM2MTKDK.pdf\"]', 'Unemployed', 'I am a very youth friendly person and I am very passionate with working with young people. I have been a life mentor at Lusweti in 2018 during the Insika yakusasa project and have served a youth secretary at Kwaluseni Inkhundla during the parliament term which commenced in 2018. I am currently an African Digital Youth Influencer working with young people at Pan African Catholic Theology and Pastoral Network where I work with African young people and also did an online course there where two of the modules were Transformational Servant Leadership and Change Agency and Practical Implementation of a Project in a Local Church, Community or School and I am currently running a project with young people at Church which is a compassionate outreach for the elderly ', 'Yes', 'Lusweti and Pan African Catholic Theology and Pastoral Network ', 'I am currently running a project a church funded by Pan African Catholic Theology and Pastoral Network where we go for Compassionate Outreach to the elderly with young people empowering them through acts of mercy.', 'Yes', NULL, '2025-07-17 08:25:49', '2025-07-17 08:25:49'),
