(473, 922, '[\"documents\\/01K0BC5MVN2ZHN85G5T3G13J94.jpg\"]', '[\"documents\\/01K0BC5MVTWAB6N9HFCZBR6A82.jpg\"]', 'Unemployed', 'I’m applying to ENYC(Eswatini National Youth Council) because I want to be a voice for young people and help create opportunities for growth and development. I’m confident I’m the right candidate because I’m passionate, and reliable. ', 'Yes', 'SAFAIDS ', 'Educate young people about Mobisafaids which is a model designed to get feedback from young people when they come to the healthcare facility, aimed to help improve services for young people especially the SRHR (Sexual Reproductive Health Rights).\nThe importance of abstinence and HIV Prevention. ', 'No', NULL, '2025-07-17 09:02:03', '2025-07-17 09:02:03'),
(474, 923, '[\"documents\\/01K0BCKQ22BYJS4WKEYZY95GN9.pdf\"]', '[\"documents\\/01K0BCKQ24970Y7WYSQ67TDXJJ.pdf\"]', 'Unemployed', 'I have always been passionate about youth development. I have successfully managed the local team for the past 10 years and we have been able to encourage self respect and development to a number of young boys who have gone on to play in the Premier league, while doing so through partnership with Kwaluseni Alliance Church we always host a weekend getaway at least once a year at Mphophoma, we usual invite individuals to motivate them', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 09:09:44', '2025-07-17 09:09:44'),
(475, 924, '[\"documents\\/01K0BCV2N5948XYGVMBECRVW35.jpg\"]', '[\"documents\\/01K0BCV2NQNWKPN627E6T5252W.doc\"]', 'Self-Employed', 'I applied for this post because, firstly I love working with diverse population of young people, understanding their perspective on life issues. Secondly I believe there is a great need for creating safe space forums where young people can come together to tackle everyday life issues together. I believe there hasn\'t been much activities angaging the youth since COVID 19 which is negatively impacting the lives of the youth, so I believe it is time we come together again and take serious action. This would be a great opportunity for me to positively impact the lives of the youth in my constituency.', 'Yes', 'Khulisa Umtfwana and joyful hearts ', 'I taught young people about HIV , how to prevent themselves from contacting HIV, how to live with the HIV for those who are already on ART and how to help those who are taking ART. I also helped adolescents understand the changes in their bodies as they are growing, what to and what not to do. ', 'Yes', NULL, '2025-07-17 09:13:45', '2025-07-17 09:13:45'),
(476, 925, '[\"documents\\/01K0BCWM96QX20NXY8PYS7RE0G.pdf\",\"documents\\/01K0BCWM9AA8C7CAPFBBH8TZNM.pdf\"]', '[\"documents\\/01K0BCWM9NWGJGJW50JGWKBZDG.pdf\"]', 'Employed', 'I think I am the best candidate for this post because I have an experience in working with the youth and it cannot be a challenge to me. Ontop of that, if it\'s a community thing it will be easy for the people to trust me because they already know and trust me with their kids. Moreover, as we all know that we working with different people with different attitudes for me it won\'t be that much difficult because I already know them and how to handle them one by one. ', 'Yes', 'World Vision ', 'Facilitating HIV sessions for adolescent girls and young women and equipped them mainly with ways to halt the spread of HIV in our country ', 'Yes', NULL, '2025-07-17 09:14:36', '2025-07-17 09:14:36'),
(477, 926, '[\"documents\\/01K0BD40A4W9JW5V5ZT5Z4FAS5.jpg\",\"documents\\/01K0BD40AEXV6A02ZB19F77B1X.jpg\"]', '[\"documents\\/01K0BD40AQM6QBP8QJC08WY3Y6.jpg\",\"documents\\/01K0BD40AWBZ4ZM6RTRPAKED6F.jpg\"]', 'Self-Employed', 'I want to help the youth in my constituency to refrain from drugs and bad habits . \nI want to help reduce the escalating number of violence against women in children in the country at large. \nI am the best candidate because the people in my constituency are familiar with me in this type of work ,they trust me since we have created a relationship with them in the past years ', 'Yes', 'Young heroes ', 'Young heroes organisation \nI gave psychosocial support to adolescents girls in my community. \nMentoring Young boys and teaching them about drugs and positive masculinity ', 'Yes', NULL, '2025-07-17 09:18:38', '2025-07-17 09:18:38'),
(478, 927, '[\"documents\\/01K0BD63VDKQHVPK5S1Y2MEPB5.pdf\"]', '[\"documents\\/01K0BD63VGAQ09CA2QEMX1EZ0H.pdf\"]', 'Unemployed', 'I am a young innovation young woman looking forward to changing life situations for our youth. As am friendly am easy to talk to and have good communication skills.\n\nI want to gains more knowledge and being in an adventurous environment where I will get new challenges and deal with them in a different approach.\n\nPro active as I am, am ready to share my experience with our young future leaders ', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 09:19:47', '2025-07-17 09:19:47'),
(479, 928, '[\"documents\\/01K0BDW3TQ8FCVCPR03YVQGSJP.jpeg\"]', '[\"documents\\/01K0BDW3TTA4VJE5G5Y1HVQHVM.png\"]', 'Unemployed', 'I have applied so I can be able to gain knowledge and experience. I am a good team worker and have both interpersonal and intrapersonal skills. I want to equip the youth and teams with the tools and strategies to adapt to change, embrace challenges, and unlock their full potential. I also want to contribute to your more agile and high- performing organization.', 'No', 'N/A', 'None ', 'Yes', NULL, '2025-07-17 09:31:48', '2025-07-17 09:31:48'),
(480, 929, '[\"documents\\/01K0BE0BZ76TG390MV2H8KPXBM.jpg\",\"documents\\/01K0BE0BZAB6MK2DF8T9N81ASQ.jpg\"]', '[\"documents\\/01K0BE0BZD5FVMJ9V826DK89YQ.jpg\",\"documents\\/01K0BE0BZGEHA3GYJ6V398FTWG.jpg\"]', 'Unemployed', 'I am a best candidate in this job because I am an example to the rural orphanage in my area,I have so much to explain about my life to them and I have answers from their situation.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 09:34:07', '2025-07-17 09:34:07'),
(481, 930, '[\"documents\\/01K0BE1836EBTGR1APTEE6C4E6.pdf\"]', '[\"documents\\/01K0BE183FGFWSA1HF84GPBYN2.jpg\"]', 'Unemployed', 'As graduating teacher, this opportunity would be very handy in strengthening my experience in working with young teenagers. I have a foundational background with working with young people as I successfully engaged with them during my teaching practice in high school. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 09:34:36', '2025-07-17 09:34:36'),
(482, 931, '[\"documents\\/01K0BE2ABNCCVJZ4BCW4FHSWCX.pdf\"]', '[\"documents\\/01K0BE2ABR14DZ0ACJAT9AB4Z7.pdf\"]', 'Unemployed', 'I have applied for the Youth Mindset Change Trainer Program because I am deeply committed to youth empowerment and community development. I believe that changing the mindset of young people is a vital step toward building resilient, healthy, and forward-thinking communities. This program aligns perfectly with my passion for creating safe spaces for adolescents and youth to grow, heal, and thrive.\nAs a dedicated and passionate community development professional with a strong foundation in community health planning and psycho-social support, I bring valuable experience and skills and knowledge to this role which includes community mobilization, communication, facilitating sessions.\n\nWhat sets me apart is my ability to connect with young people authentically, create trust, and inspire transformation. I am not only trained in effective facilitation but also driven by compassion, resilience, and a vision for empowered youth leading change in their own lives and communities. I am confident that my skills, experience, and values make me a strong candidate for this opportunity.\n', 'No', 'Intern at ESWATINI LEGAL AID ', '\nProvided individual counseling and trauma-informed psychosocial support to survivors of sexual violence.\n- Conducted assessments to identify psychosocial needs and developed action plans.\n- Delivered mental health first aid and facilitated human rights awareness on child protection.\n- Maintained accurate case records and supported clients’ recovery through tailored interventions.\n\n\n\n', 'Yes', NULL, '2025-07-17 09:35:11', '2025-07-17 09:35:11'),
(483, 932, '[\"documents\\/01K0BE4SX3EFN8D4MZS2JMN3V8.jpg\",\"documents\\/01K0BE4SX71A7R4QXQQTBFA11Q.pdf\"]', '[\"documents\\/01K0BE4SXJ8949ZXRVAME460Y0.jpg\",\"documents\\/01K0BE4SXNG9H51RXSVD3N3PZC.jpg\",\"documents\\/01K0BE4SXQDHWZJCATYXDF9S0P.jpg\",\"documents\\/01K0BE4SXTT1QBSC8H7A3HZVZR.pdf\"]', 'Unemployed', 'I have applied for this opportunity because I am passionate about empowering young people and creating positive change in my community. Through my previous volunteer work under the theme of charity, I assisted children with their homework and provided after-school lessons focused on both academics and life skills. I also served as an outreach worker with FHI 360 and Rock of Hope, where I referred youth to clinics for free health services and conducted small educational sessions during home visits. These experiences have given me a strong foundation in community engagement, youth development, and communication. I believe I am the best candidate because I am committed, approachable, and experienced in working with adolescents from diverse backgrounds. I am eager to further develop my skills and contribute meaningfully to this programme.\n', 'Yes', 'FHI360, Rock Of Hope and Theme Charity ', '\nUnder the theme of charity, I assisted children with their homework through after-school classes and life skills programs (emakhono).\nAt FHI 360 and Rock of Hope, I served as an outreach worker, referring young people to clinics for free health services and conducting home visits to provide small educational sessions.\n', 'Yes', NULL, '2025-07-17 09:36:33', '2025-07-17 09:36:33'),
(484, 933, '[\"documents\\/01K0BEKRSYSJX9R0953MPJV11C.jpg\",\"documents\\/01K0BEKRT5W72CGHV3MVN0Y5KV.jpg\"]', '[\"documents\\/01K0BEKRT83H89JY3DKQZGMG07.pdf\"]', 'Unemployed', 'My interest in the Youth Mindset Change Trainer Programme is that I have been volunteering for four years  as a Youth Facilitator in an HIV prevention project, I am confident in my ability to contribute effectively to this initiative. My background, skills, and passion for youth empowerment make me an ideal candidate for this position.\nThroughout my four years in the HIV prevention project, I have had the opportunity to work closely with young people aged. My role involved facilitating workshops, conducting educational sessions, and providing support to youth in understanding HIV prevention, safe practices, and healthy relationships. This experience has not only equipped me with the necessary knowledge about HIV awareness but has also enhanced my ability to engage and communicate with young people effectively.\nIn addition to my work in HIV prevention, I have successfully organized community outreach programs aimed at raising awareness about various health issues affecting youth today. These programs have allowed me to connect with individuals from diverse backgrounds, fostering a sense of community and shared responsibility. I believe that my ability to relate to young people and understand their needs will be invaluable in the Youth Mindset Change Trainer Programme.\nOne of my strongest assets is my communication skills. I have honed my ability to present complex information in a relatable and engaging manner. My experience in conducting workshops has taught me the importance of creating an inclusive environment where everyone feels comfortable to share their thoughts. I employ various interactive methods, such as group discussions and role-playing, to ensure that participants are not only passive learners but active contributors. \nAs a Youth Facilitator, I have taken on leadership roles within my team, guiding new facilitators and helping them develop their own skills. I believe in the power of mentorship and regularly provide support to young people in my community, helping them navigate challenges related to health and personal development. This experience has taught me how to be patient, empathetic, and supportive—all crucial qualities for a successful trainer.\nMy experience working in the community has allowed me to build strong relationships with local organizations and stakeholders. I have collaborated with schools, health centers, and youth organizations to create comprehensive programs that address the holistic needs of young people. This network will be beneficial for the Youth Mindset Change Trainer Programme as I can leverage these connections to enhance the training sessions and outreach.\nI am deeply passionate about empowering young people to take charge of their health and well-being. I believe that education is a powerful tool in breaking the cycle of misinformation and stigma surrounding issues like HIV. My commitment to this cause is evident in my continuous pursuit of knowledge in the fields of health education and youth development. I regularly participate in workshops and training sessions to further my understanding of effective teaching strategies and youth engagement techniques.\nI am excited about the opportunity to be a part of the Youth Mindset Change Trainer Programme. I fully understand the importance of mindset change in preventing HIV and other health issues among young people. I am committed to participating in the entire training sessions, learning from experienced trainers, and sharing my knowledge and experiences with fellow participants. I am eager to contribute to the development of training materials and methods that resonate with youth and inspire them to make informed decisions.\nTo conclude, my four years of experience as a Youth Facilitator in an HIV prevention project, combined with my strong communication skills, leadership abilities, and passion for youth empowerment, make me a strong candidate for the Youth Mindset Change Trainer Programme. I am excited about the possibility of working alongside other dedicated individuals to create a positive impact in the lives of young people \n\n\n', 'Yes', 'World Vision Eswatini ', 'Volunteered as a community youth facilitator in an HIV prevention project.  Mobilized Adolescent girls and young women ( AGYW) to attend sessions  on daily bases. Invite mobile clinics and encourage AGYW to take PreP if tested HIV negative. Generated  worth groups were AGYW would save n invest money to start small businesses.  Done vulnerability assessments and register those in need for vocational trainings through World Vision.', 'Yes', NULL, '2025-07-17 09:44:43', '2025-07-17 09:44:43'),
(485, 934, '[\"documents\\/01K0BF69EYK28NT54W2S42SCGB.pdf\"]', '[\"documents\\/01K0BF69F215VQ2M1QADKNRMRX.pdf\",\"documents\\/01K0BF69F3XRWR02PG36JPJX6S.pdf\"]', 'Self-Employed', 'I would like to believe in the impact of my skills that I have aquire to be useful to the next generation. As a citizen, I have seen the brighter side of supported young minds with the tools they need to thrive. Hence if given this opportunity, it is my promise to deliver my best support and guidance to the younger minds. I am also working on my personal project to empower young people\"Ecosystem of impact \". Thank you for your time.', 'Yes', 'Techno Friends International’s ', 'As a facilitator and tutor,I am helping younger generations to aquire digital skills. Learners from diverse backgrounds have made me to love what I am doing as a dedicated tutor. ', 'No', NULL, '2025-07-17 09:54:50', '2025-07-17 09:54:50'),
(486, 935, '[\"documents\\/01K0BFCMX8VTN787CTDAYSQQW7.pdf\"]', '[\"documents\\/01K0BFCMXCT6K855T530MZBBTB.pdf\"]', 'Unemployed', 'I\'m really passionate about becoming a peer educator and leading mindset transformation in my community, Maseyisini Inkundla, because I believe real change starts from within. With my background in Psychology and hands-on experience working with young people, I\'ve seen how powerful it is when someone believes in you and pushes you to think differently about your life. I want to be that person for others,to inspire hope, build confidence, and help shift negative mindsets into something positive and empowering. As a young person myself, uplifting the youth and seeing them grow is what drives me every day.', 'Yes', 'HEALS ', 'At the HEALS Organisation, I worked as a counselor, where I provided psychosocial support and guidance to adolescent girls, especially the vulnerable females. My role involved creating a safe and supportive environment, offering emotional counseling, and helping clients cope with mental health challenges, trauma, and life stressors. I also facilitated awareness sessions on mental health and linked individuals to appropriate services when needed.\n\n', 'Yes', NULL, '2025-07-17 09:58:18', '2025-07-17 09:58:18'),
(487, 936, '[\"documents\\/01K0BFH0Z8ESBWSW1KQZXK5R5B.jpeg\"]', '[\"documents\\/01K0BFH0ZSWDXPSXS5HM2GDH27.pdf\"]', 'Unemployed', 'I have applied for this position because I am passionate about empowering young people and helping them reach their full potential. I believe that youth are the foundation of any thriving community, and I am committed to being part of a program that nurtures their growth, confidence, and leadership. I am the best candidate for this role because I bring both experience and dedication to youth work. I have strong communication and mentoring skills, and I relate well to young people from different backgrounds. I am reliable, compassionate, and driven by the desire to make a lasting positive impact in their lives.', 'Yes', 'World Vision', 'I was conducting a survey to check if adolescent were not abused in any way. If they are I reported to my supervisor for them to get help', 'Yes', NULL, '2025-07-17 10:00:42', '2025-07-17 10:00:42'),
(488, 937, '[\"documents\\/01K0BFNN0X9X4PC10KEASMTRDB.jpeg\"]', '[\"documents\\/01K0BFNN17KWGV9SXFTANNQGAG.png\"]', 'Unemployed', 'I have applied for the Youth Mindset Change\nTrainer Programme because I am deeply passionate about empowering young people and contributing to positive community development, aligning perfectly with the program\'s vision for fostering mindset change. My extensive experience working with adolescents and young people, particularly through organizations like Khulisa Umtfwana and my regular facilitation at events such as the Umhlanga Reed Dance, has equipped me with a proven ability to connect with diverse young individuals and create engaging, impactful environments. I possess a strong understanding of community structures and am respected within my community, ensuring I can effectively reach and resonate with participants. My commitment to the entire training sessions, coupled with my demonstrated facilitation skills and dedication to youth empowerment, makes me an ideal candidate to effectively conduct mindset change community sessions on a volunteer basis and truly create a significant impact.', 'Yes', 'Khulisa Umtfwana Organization ', 'I gained valuable experience working with young people through my involvement with Khulisa Umtfwana, where I actively participated in programs designed to empower and guide youth.\nMy role often involved facilitating discussions and workshops aimed at developing positive mindsets and practical life skills. Additionally, I regularly facilitated group activities and discussions, including at events like the Umhlanga Reed Dance, where l engaged diverse groups of young people in a respectful and culturally sensitive manner, encouraging their participation and fostering a sense of community and shared purpose.', 'Yes', NULL, '2025-07-17 10:03:13', '2025-07-17 10:03:13'),
(489, 938, '[\"documents\\/01K0BG1WBX31DSFRBNZSH7HHBY.jpg\"]', '[\"documents\\/01K0BG1WC39439KGFPCP8JJ4TK.jpg\"]', 'Employed', 'With my experience working with young people I developed a passion for helping the youth achieve their goals in life and I am a team player in the \" Work towards HIV/AIDS free Generation\".', 'Yes', 'World Vision ', 'Through the group sessions we conduct around the community I teach them about good moral behaviours and HIV prevention knowledge and how to be an independent young person by reaching them with Stepping stones sessions.', 'Yes', NULL, '2025-07-17 10:09:54', '2025-07-17 10:11:44'),
(490, 939, '[\"documents\\/01K0BG58GXTW5GDMZXGFP5WZKR.jpg\"]', '[\"documents\\/01K0BG58H1WVFKZS5VS9K19G1P.doc\"]', 'Unemployed', 'I have a passion for working with the youth. So, I am confident that this training will better my skills of handling young adults. I am known for being energetic, hence that is why I deem myself fit for this job. I am also willing to grow my experience in working with the youth, so that I impart my skills and knowledge better.', 'Yes', 'Umliba Loyembili Eduprenuears (ULEP)', 'I have equipped adolescents with blogging skills. I have also organized a training session for the youth, and they acquired skills in Electronics and Arduino.', 'Yes', NULL, '2025-07-17 10:11:45', '2025-07-17 10:11:45'),
(491, 940, '[\"documents\\/01K0BGPHV0J5B78FD81Z930KDG.pdf\"]', '[\"documents\\/01K0BGPHV7KZSNKYEB3CDCX34M.pdf\"]', 'Unemployed', 'I am applying for the peer educator position in my community with profound enthusiasm, driven by a deep-seated belief in the power of grassroots education and community empowerment to foster well-being. My motivation stems from a genuine desire to translate my professional knowledge and advocacy experience into direct, tangible support for my community members. I believe that effective change begins at the local level, and the peer educator role offers a unique platform to connect, share vital information, and build resilience from within. I am eager to contribute to a supportive environment where individuals feel empowered to discuss mental health openly and access necessary resources, ultimately helping to uplift the overall health and vitality of our community.\n\nI am confident that my unique blend of experience and qualifications makes me the ideal candidate for this role. Firstly, my former position as a mental health worker at Eswatini Business Health and Wellness provides me with invaluable practical experience in promoting well-being and engaging with diverse individuals on sensitive health topics. This daily interaction has honed my communication skills, my ability to empathize, and my understanding of the nuances involved in supporting mental health in a practical setting. I am adept at explaining complex concepts in an accessible manner and fostering a safe space for dialogue.\n\nSecondly, my role as the Eswatini representative in the ECSA-HC youth mental health project offers a distinct advantage. This experience will broaden my perspective on regional mental health challenges and equip me with advocacy skills crucial for driving awareness and policy discussions. It has instilled in me a strong sense of responsibility towards the youth, providing me with insights into their specific needs and the innovative approaches required to engage them effectively. I understand the importance of being an innovative leader, capable of contributing creatively to mental health frameworks and policies, which aligns perfectly with the proactive nature of peer education.\n\nFinally, my psychology qualification provides a robust theoretical foundation for understanding human behavior, mental health conditions, and effective intervention strategies. This academic background, combined with my practical experience, allows me to approach peer education with both scientific rigor and compassionate understanding. I am not only equipped to share information but also to recognize underlying issues and guide individuals towards appropriate support. My commitment to curbing the high rising mental health issues such as depression and suicide is unwavering, and I see this peer educator role as a critical avenue to contribute directly to this vital cause, making me a highly dedicated and effective candidate.', 'Yes', 'ECSA-HC', 'As a representative of ECSS-HC Eswatini, I recently joined a vital youth mental health project focused on understanding and addressing the unique mental health challenges faced by young people in Eswatini. My involvement began with active participation in a Focused Group Discussion (FGD), a crucial initial step in our data gathering process.\n\nDuring the FGD, I engaged directly with several youth participants from Eswatini. We facilitated an open and supportive environment, encouraging candid discussions about their experiences with mental health. My role involved actively listening to their perspectives and contributing to a series of questions designed to elicit comprehensive insights into the prevalent mental health issues affecting their age group. This direct engagement provided invaluable qualitative data, revealing nuanced understandings of their struggles, coping mechanisms, and perceptions of existing support systems.\n\nFollowing the FGD, I took the lead in compiling a detailed report synthesizing all the information gathered. This report meticulously documented the key themes, challenges, and recommendations that emerged from the discussions. It highlighted recurring concerns, identified potential gaps in current mental health provisions, and underscored the urgent need for accessible and youth-centric support. I ensured the report was comprehensive, accurate, and clearly articulated the voices of the young participants.\n\nI successfully submitted this report to the organization, marking a significant milestone for the project. This compilation is now serving as a foundational document, directly informing the organization\'s next steps. Their primary goal is to implement a regional mental health framework for young people, and my work in documenting the initial findings is a critical contribution to this broader objective. By translating the raw discussions into actionable insights, I\'ve directly supported the project\'s aim of developing a tailored and effective mental health strategy for Eswatini\'s youth. My efforts have helped to ensure that the voices and needs of young people are at the forefront of this crucial initiative', 'Yes', NULL, '2025-07-17 10:21:11', '2025-07-17 10:21:11'),
(492, 941, '[\"documents\\/01K0BH2CFS83CHH9E8EB6SEYBX.jpg\"]', '[\"documents\\/01K0BH2CG042B9MPENJTP5NTKJ.doc\"]', 'Self-Employed', 'I have applied for this job because i want to make a difference in my community and to help our future generation to make better choices so that they can have a bright future.\nI believe i am the best candidate for this job because i am detail oriented and possess excellent communication and interpersonal skills which i believe will make it easier to work with adolescents. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 10:27:39', '2025-07-17 10:27:39'),
