(495, 944, '[\"documents\\/01K0BHYQRGYV73SEXRPBD37S9V.pdf\"]', '[\"documents\\/01K0BHYQRNP04523Z9M221TMK0.pdf\"]', 'Self-Employed', 'I have applied because I am passionate about empowering young people to reach their full potential. Growing up, I witnessed firsthand the impact of positive role models and mentorship on my peers\' lives. This experience sparked a desire within me to contribute to initiatives that foster personal growth, resilience and confidence in youth. I believe I\'m the best candidate because I have experience in working with young people since I\'m a teacher by profession. Also, I\'m one of the youth who is respected and trusted in my community. To add on that I have strong communication skills, I effectively connect with people from diverse backgrounds ensuring impactful interactions. Again, I am patient and i sympathise with people, I always create safe, supportive environments helping young people open up and grow. Lastly, I am flexible and I adapt easily which makes me to be comfortable working in dynamic environments and adjusting to new challenges.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 10:43:08', '2025-07-17 10:43:08'),
