(499, 948, '[\"documents\\/01K0BMEAQ5JP4074M9B3XAQAKW.pdf\"]', '[\"documents\\/01K0BMEAQBECTPPAKZ99WPP482.pdf\",\"documents\\/01K0BMEAQDECG4WXVRMRY38D9N.pdf\"]', 'Self-Employed', '1. I am interested and my experience and possession are aligned with the position requirements. I posses diploma in Social work and community development and i have been working with young people for the past three years in a vocational training centre for youth.\n2. I have good reputation in my community, if i may be given and opportunity to train youth to change their mindset they can believe on what i am teaching them that it can change their life.\n3. I know community structures, that when ever you wish to do something in the community you have to report. I understand young people that for one to change what they believe on it calls one to display a clear picture of that thing.\n4. I am willing to be part of the training until the end. ', 'Yes', 'STREEC Project', '1. As i working in Youth Vocational training centre, i helped the youth from my community to apply and some were accepted, they now have income.\n2. Some young people in the vocational were discouraged by many challenges so i used to encourage them to press on hard work pays, mybe that experience will open doors for them so they completed.\n3. As they were trained to start their own businesses i helped them with business plans for them to get funding, i suggested for them to apply from youth fund and Provident fund etc.', 'Yes', NULL, '2025-07-17 11:26:36', '2025-07-17 11:26:36'),
(500, 949, '[\"documents\\/01K0BMGQN6C5QJZ1J8CYDE19B7.jpg\"]', '[\"documents\\/01K0BMGQND17RW8WE15T25DM2Q.pdf\"]', 'Unemployed', 'I have applied because I have a passion in working with young adults. Also have a deep understanding of community development or community service which makes me a best fit for this jobs.  ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 11:27:55', '2025-07-17 11:27:55'),
(501, 950, '[\"documents\\/01K0BMHVN2HCV444CEJ580M4M4.pdf\",\"documents\\/01K0BMHVN66CMDZJ7Q9KE9VXGR.pdf\"]', '[\"documents\\/01K0BMHVNAGFC3JHYY1R6GFBDH.pdf\"]', 'Employed', 'My passion for the empowering youth and commitment to fostering positive change perfectly align with mission of your organization. My experience in this role has equipped me with valuable skills in Mentorship, leadership and program development. I have successfully implemented initiatives that brings that inspired the youth to build confidence and cultivate a sense of purpose. As certified life coach, I bring a wealth of knowledge in personal development strategies, helping individuals identify their goals and navigate the path to achieving them.', 'Yes', 'Campus Crusade for Christ ', 'I had the privilege to guiding young individuals from diverse backgrounds fostering resilience, self growth and purpose. Leading them to Christ. Also helping them with study with success which is one of the programs we had.', 'No', NULL, '2025-07-17 11:28:32', '2025-07-17 11:28:32'),
