(503, 375, '[\"documents\\/01K0BN7KCNEGJ0E4TYX7KBFT6Q.png\"]', '[\"documents\\/01K0BN7KCZRARNMXPADCB4TN2F.docx\",\"documents\\/01K0BNA2HCP6DFV2TCMDQFH08V.docx\"]', 'Self-Employed', 'As a teacher who is well trained in educational psychology, child care and  development, teaching and learning, and also have experience with peer teaching , I feel like I have the passion and experience to successfully complete this task. ', 'Yes', 'Compassionate and Word Vision ', 'I was a member of a peer group where we were mostly taught about how to keep ourselves safe from the world. We had health lessons, personal growth, and socio economic. ', 'Yes', NULL, '2025-07-17 11:40:24', '2025-07-17 11:41:45'),
(504, 952, '[\"documents\\/01K0BN98S6MDC5ZG55HXQ8J9EZ.jpg\"]', '[\"documents\\/01K0BN98SCXPS025THCZFP058E.pdf\"]', 'Unemployed', 'I have applied because l work with the Youth and l meet all the requirements for this position. I have adopted the strategy of the Kingdom of Eswatini \"Nkwe\" strategy to develop and improve our beautiful country as The Youth. ', 'Yes', 'SADC Youth Parliament,  Enactus ', 'I advocated policies for Youth in the SADC level in health, education, Environment and Climate Change in the SADC Youth parliament where l was representing the Kingdom of ESwatini. Moreover,  l also empowered The Youth of eSwatini on University and Colleges on entrepreneurship skills under Enactus where l was serving as a human resource for Enactus Good Shepherd Catholic College of Health Science, we were able to came up with business ideas and implement them where we made portraits, floor tiles, mosaic design tables using recycled Windscreens .', 'Yes', NULL, '2025-07-17 11:41:19', '2025-07-17 11:41:19'),
(505, 953, '[\"documents\\/01K0BNKC4RM2TRS7G7Q8RNQ0FR.pdf\"]', '[\"documents\\/01K0BNKC4YR0HTYSVRC2Z4A7X6.docx\"]', 'Unemployed', 'My academic background in Psychology provides me with a strong foundation in understanding human behavior, social dynamics, and the psychological principles behind mindset change. This theoretical knowledge is complemented by over two years of practical volunteer experience that directly aligns with the objectives of this program.\nAs a Community First-aid Responder at Luvatsi, I have consistently provided critical emotional and psychosocial support during sensitive emergencies, employing active listening and empathetic counseling techniques to de-escalate crises. This experience has significantly developed my ability to connect with diverse individuals from various backgrounds, build trust, and offer crucial support – all essential qualities for a Peer Educator.\nFurthermore, my previous role as an HTS Counselor at Motshane Clinic involved designing and conducting engaging psycho-educational presentations and providing client-centered individual counseling. This experience has honed my skills in effectively communicating complex information, facilitating group discussions, and empowering individuals to make informed and positive choices regarding their health and well-being. These abilities are directly transferable to guiding community members through mindset change sessions.\nI am confident in my demonstrated ability to connect with young people and individuals from diverse backgrounds, and I am committed to respecting and being trusted in the community. I am prepared to dedicate my time and effort to the entire training sessions and subsequent volunteer work on a volunteer basis.', 'Yes', 'Luvatsi (WOMEN AND YOUTH SUPPORT PROJECT)', 'Organization: Luvatsi \n    Position: Community First-aid responder | April 2023-Current \n    Responsibilities \n1.Provided immediate first-aid response and critical emotional and psychosocial support during emergencies, including sensitive cases of Gender-Based Violence (GBV), suicide ideation, depression, and trauma incidents.\n2.Employed active listening, empathy, and basic counseling techniques to de-escalate crises and offer crucial support to individuals in distress.\n3.Conducted impactful community outreach initiatives, raising awareness about mental health issues and effectively connecting individuals with available support resources.', 'Yes', NULL, '2025-07-17 11:46:50', '2025-07-17 11:46:50'),
(506, 954, '[\"documents\\/01K0BP3AH2V6VHJKVEJ8AHM4KT.jpg\"]', '[\"documents\\/01K0BP3AH7SQDYAWRA6VV53VSM.docx\"]', 'Unemployed', '\nI am the best candidate for this position because I bring a unique combination of passion, practical experience, and proven commitment to youth development. I have worked closely with young people through relevant community initiatives.\n\nMy communication skills allow me to connect authentically with diverse youth, understand their challenges.\n\n My genuine dedication to youth empowerment sets me apart. I believe in creating safe, inclusive spaces where young people are heard, supported, and given opportunities to lead. My approach is not just about guidance it\'s about collaboration and equipping youth with the tools to become change makers in their communities.\n\nWith my background experience in crop production, along with my creativity, organizational skills, and a track record of positive outcomes, I am confident in my ability to make a meaningful impact as your Youth Empowerment Officer.', 'No', 'None', 'I practice farming which has become a part of my life.\nI donate some of the produce from my harvests.\n I share  knowledge and crop growing techniques.', 'Yes', NULL, '2025-07-17 11:55:33', '2025-07-17 11:55:33'),
