(508, 956, '[\"documents\\/01K0BPGKQPWSDXVJ6HYR8JG776.jpg\"]', '[\"documents\\/01K0BPGKQX4M7SCAG18E4G1XR2.jpg\"]', 'Unemployed', 'I have the right skills and I am ready to work hard for this organization. I want to use my skills and grow here.I like this organization, it has a good reputation. ', 'Yes', 'Compassionate Swaziland organization and Bantwana Initiative Organization ', 'I was doing parenting sessions to young adolescents ,creating groups for savings. Their lives changed to be the better a better one and they enjoyed attending sessions after they learned more about making budget with money and the ways to save money.', 'Yes', NULL, '2025-07-17 12:02:48', '2025-07-17 12:02:48'),
(509, 957, '[\"documents\\/01K0BPQMKM9F7G89KW2VR30HTT.PDF\",\"documents\\/01K0BPQMKP67TNG6RDTCCTRJNV.PDF\"]', '[\"documents\\/01K0BPQMKS5TH7SGPWYW8EXKWE.pdf\"]', 'Unemployed', 'With my previous job as a home visitor working with young adolescents I have developed strong skills in time management, problem solving and organizational skills.\n\nI also learned a lot about the needs of thos are vulnerable and how to help them regarding that', 'Yes', 'Young heroes', 'None', 'Yes', NULL, '2025-07-17 12:06:38', '2025-07-17 12:06:38'),
