(511, 959, '[\"documents\\/01K0BQ2398VZG8D4613Z9HP2DH.pdf\"]', '[\"documents\\/01K0BQ239D9T9BGV3Z4GMZ7JFW.pdf\"]', 'Unemployed', 'I am a highly organized and motivated lady with strong communication and public speaking skills.I thrive in team environments and consistently contribute positively to group dynamics as a reliable and collaborative team player.My ability to clearly convey ideas, both in writing and verbally allows me to connect with colleagues and stakeholders effectively.With a proven track record of managing tasks efficiently and staying focused under pressure, I bring not only skills required but also the dedication and enthusiasm need to make a meaningful impact in the role.', 'Yes', 'Bantwana Intiative', 'While working with Bantwana,I have been actively involved in supporting and empowering young people in my community.Through various youth focused programs I provided mentorship,life skills training and guidance on issues such as education,health and personal development.I help create safe space where young people can express themselves,build confidence and develop leadership skills. By community outreach and one on one support,I ensure that these youth not only  feel heard but are also equipped with tools they need to make informed decision and create brighter futures for themselves.', 'Yes', NULL, '2025-07-17 12:12:21', '2025-07-17 12:12:21'),
(512, 960, '[\"documents\\/01K0BQG2SFA1WV7QCQF2C1JKAV.jpg\",\"documents\\/01K0BQG2SJWSV904Y1KGAWYRZC.jpg\",\"documents\\/01K0BQG2SNN34AP4TBVSS45T5T.jpg\"]', '[\"documents\\/01K0BQG2SRPJQ9JB5W15B38MNC.jpg\"]', 'Unemployed', 'I love working with adolescent girls and young women because I am of their age and they feel free to talk to me about anything thing\n\nI do have experience in working with them \nI saw good results on my previous work because the rate of pregnancy decreased after they got the services', 'Yes', 'Young Heroes', 'I worked as a Life mentor whereby we were conducting sessions with the adolescent girls and young women discussing ways on how from HIV infection and how to live if you are already infected,there were also services given to', 'Yes', NULL, '2025-07-17 12:19:59', '2025-07-17 12:19:59'),
