(514, 962, '[\"documents\\/01K0BQKGDS17N4HHHN15Y1JJX2.jpg\"]', '[\"documents\\/01K0BQKGE1YD1VGNPHWPRA6TVN.pdf\"]', 'Unemployed', 'I believe am the best candidate for this trainer programme because I believe it is a great fit for my skills and interest as helping people learn new things and expand their knowledge is my passion especially with the youth . I can also anticipate  young people needs while maintaining poise and pressure due to their nature of being enthusiastic to try to explore new things . I do this well with my positive attitude,good communication skill, excellent team work and leadership and the ability to multi task effectively . This will be a better position to practice what I love doing professionally which is helping the youth overcome existing challenges more especially those that involves their well being psychologically ', 'Yes', 'FOSWA', 'I worked as a peer educator to the youth , where we will have section where I will teach about the well being of the youth ,topic such as HIV and AIDs, skills and development , entrepreneurship and lastly the use of electronic technology to disabled as on most cases they are left behind ', 'Yes', NULL, '2025-07-17 12:21:52', '2025-07-17 12:21:52'),
(515, 963, '[\"documents\\/01K0BR3PS5WFF7Y69235P9J12P.jpeg\"]', '[\"documents\\/01K0BR3PSAKJGD4QS0MQ7C4QM0.pdf\"]', 'Unemployed', 'I believe my experience in teaching has given me a unique perspective. As a teacher, I have seen students overcome obstacles and achieve their goals when they adopt a growth mindset. I am confident that my experience, combined with my passion for personal development, make me a strong candidate for this role. I am also a strong communicator, and I thrive in environments where I can inspire and motivate others.', 'Yes', 'The Youth Stand Organization', 'I was a volunteer in peer to peer sessions in communities where I advocated for youth people born and living with HIV. We also provided psychosocial support to them and helped them lead fulfilling lives through education, support, and economic opportunities.', 'Yes', NULL, '2025-07-17 12:30:42', '2025-07-17 12:38:55'),
(516, 964, '[\"documents\\/01K0BRDQ2Y9R1RTV27XN8DC6AJ.jpg\"]', '[\"documents\\/01K0BRDQ36DJP153ZZ0RAY2CWN.jpg\"]', 'Unemployed', 'I enjoy youth  company  where  by  we  share  views  and   encourage  them  on how   to equipe  them self  in our  days  in order to accomplish  their  dreams in life. At  church  I am  a youth  leader, we  used  to  motivate  each other  about   life. I believe  I am a  good  candidate because  it\'s  my passion  to work  with  young  people.', 'No', NULL, 'none', 'Yes', NULL, '2025-07-17 12:36:10', '2025-07-17 12:36:10');
