(518, 966, '[\"documents\\/01K0BRT0Z91F65AWXXMP0NHCT0.jpg\"]', '[\"documents\\/01K0BRT0ZK0A69CXCF9VBQ9KWG.docx\"]', 'Self-Employed', 'I have applied because I believe i can make a difference and I fit best for this job because I am passionate about growth ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 12:42:54', '2025-07-17 12:42:54'),
(519, 967, '[\"documents\\/01K0BS4VCMRD1AE05KWHVW8F17.pdf\"]', '[\"documents\\/01K0BS4VCP27YXNDE5N1HKDZWB.pdf\"]', 'Unemployed', 'I applied for this position because I’m passionate about teaching and helping others grow. With my Bachelor of Education, I have a strong foundation in delivering lessons, engaging learners, and adapting to different learning needs. I believe I’m the best candidate because I’m a quick learner, dedicated, and ready to grow into a skilled trainer.', 'Yes', 'Voice of Our Voices (VOOV)', 'I was a Community Vaccine Mobilizer. I mobilize people, mostly young people, to register and take up the COVID-19 vaccine. I would do follow-ups to those who registered and those who took the first dose.', 'Yes', NULL, '2025-07-17 12:48:49', '2025-07-17 12:48:49'),
(520, 968, '[\"documents\\/01K0BS7Z155YCNADYT1AX52T65.pdf\"]', '[\"documents\\/01K0BS7Z19QP81F8Y6QX0X53Z9.pdf\"]', 'Unemployed', 'I think my aspirations aligns perfectly well with your mission as I\' am a professionally trained social worker. Social work is a practice-based profession that enhance the well-being of people through liberation of human rights and social justice, which I believe it aligns perfectly with peer education.', 'No', 'None', 'None', 'No', NULL, '2025-07-17 12:50:31', '2025-07-17 12:50:31'),
(521, 969, '[\"documents\\/01K0BS8EXM9WEKYBVH95579N29.pdf\"]', '[\"documents\\/01K0BS8EY0JSB6DQQTKE98T3CS.pdf\"]', 'Unemployed', 'I am the best candidate for the job because I am passionate about helping the youth, as I believe that if the youth are connected with their destiny helpers, our country will fight poverty. This is due to the fact that they will not only focus on professional jobs only, but they will also explore in the entrepreneurial world, hence the reduction of unemployment. ', 'Yes', 'Africa Continent Mission Church ', 'At my church I was running motivational sessions with the youth, it helped in opening the minds of the youth because most of them believed that education is of less value in the country due to the rate of youth unemployment. Currently most of them are continuing with school and they are progressing well. Going forward, I will be helping those who have completed in choosing programmes to enrol for in the various tertiary institutions. ', 'No', NULL, '2025-07-17 12:50:47', '2025-07-17 12:50:47'),
(522, 970, '[\"documents\\/01K0BSKX9ZJSV3QS3ZW2JJ7DBF.pdf\"]', '[\"documents\\/01K0BSKXA40TD2J0CZ4NC12PFT.pdf\"]', 'Unemployed', 'I am a motivated person who is eager to learn new things. Flexible and adaptable, I like to see change implemented by youth.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 12:57:02', '2025-07-17 12:57:02'),
(523, 971, '[\"documents\\/01K0BSYYDPDFW6KYWKE96EXPZZ.pdf\"]', '[\"documents\\/01K0BSYYDWSW1G46D9E3FMM83G.pdf\"]', 'Unemployed', 'Am current unemployed and looking a challenge to work with diverse young people with different backgrounds especially from around my place as i hv connected with those from e Kwaluseni. Am the best candidate because of the experience and love i have for young people', 'Yes', 'Kwakha Indvodza ', 'I was a project coordinator for an UNFPA project. I helped young people on health issues, social responsibility and financial stability.', 'Yes', NULL, '2025-07-17 13:03:04', '2025-07-17 13:03:04'),
(524, 972, '[\"documents\\/01K0BSYZSQZE9Z6Q4Y06CJP0NT.pdf\"]', '[\"documents\\/01K0BSYZSXP11DM6T3VY6WB0C3.pdf\"]', 'Unemployed', 'I have a strong set of skills that uniquely qualify me for this job. Secondly I have work so hard in previous job to develop specific and necessary soft skills for this position. Lastly I am a highly organised. person.', 'Yes', 'SADAT(STUDENT AGAINST DRUG ABUSE AND HUMAN TRAFFICKING)', 'I went to school and make social clubs,and I introduce the dangers of Drugs.', 'Yes', NULL, '2025-07-17 13:03:05', '2025-07-17 13:03:05'),
(525, 973, '[\"documents\\/01K0BT194YX8M2DQNRAC9F69Y1.jpg\",\"documents\\/01K0BT1952NQDDFVHDVA5HX890.jpg\"]', '[\"documents\\/01K0BT1956PRMMQ7CPXC6Z2B7W.docx\",\"documents\\/01K0BT195EJJ0M2GZ4QSDR9EQ2.jpg\",\"documents\\/01K0BT195KPR771DXTKHN4EBGB.jpg\"]', 'Unemployed', 'I have applied for this position because am genuinely excited about the opportunity to contribute to ENYC. I also admire how ENYC connect with young people from diverse backgrounds. I believe iam the best candidate for this role with my past experiences that i have gained with Bantwana Initiative as home visitor.This experiences has equipped with problem solving skills who thrives in collaboration environment ', 'Yes', 'Bantwana Initiative Organization, Joyful Hearts Organization ', 'Conduct home visit developing care plan.facilitating monthly visits for improvement of wellbeing of ovc and mobilize ovc into small groups for GBV sessions and issuing and documenting health referrals and follow up open referrals and make sure ovc and caregivers access required services.', 'Yes', NULL, '2025-07-17 13:04:20', '2025-07-17 13:04:20'),
(526, 974, '[\"documents\\/01K0BT2RDGSHMTMVVRSZ5P7B1V.docx\",\"documents\\/01K0BT2RDMZZKGJCXV1J43W7GP.docx\",\"documents\\/01K0BT2RDS9EGET0C7DQRK8D1W.docx\"]', '[\"documents\\/01K0BT2RDYCZ86S6XPRWRHFWEA.pdf\"]', 'Employed', 'I strongly believe in Young people and their capabilities if mentored correctly they can transform the world and their life with their families.I have also  servere as the community chairperson,moreover I serve as a yourth chairperson for about 18 Evangelical church locals.', 'Yes', ' SCRIPTURE UNION& YOUNGLIFE OTGANIZATION ', 'Empowerment young people to be innovative and improve the Education in partnership with God ', 'Yes', NULL, '2025-07-17 13:05:09', '2025-07-17 13:06:26'),
(527, 975, '[\"documents\\/01K0BT6AA8RCCV79FEGXB7Y9VE.pdf\"]', '[\"documents\\/01K0BT6AAE19254NHB5RC7RH6S.pdf\"]', 'Unemployed', 'I am the best candidate because i have two years experience working with students teaching the about entrepreneurship and mentoring them till the National Expo competition. I was also responsible for teaching Form 2s for Financial Literacy.\nFurthermore more was assisting the Business Development Service through mentorship.\nI am the best candidate i have more knowledge working with the youth and how to handle them. ', 'Yes', 'Junior Achievement Eswatini', 'I worked under the Inschool department, focusing on Financial Literacy and Entrepreneurship to students.', 'Yes', NULL, '2025-07-17 13:07:05', '2025-07-17 13:07:05'),
(528, 976, '[\"documents\\/01K0BT6F9FD9CGEZWSVJTFP3M1.pdf\"]', '[\"documents\\/01K0BT6F9VACDB4JMVXGPJSHG2.pdf\"]', 'Unemployed', '\n\nI am applying for the Youth Mindset Change Trainer Programme because I am passionate about personal growth and community development. I believe that positive mindset change is the foundation for building strong, motivated, and successful young people. This programme is a great opportunity for me to use my skills to inspire and empower others in my community.\n\nI am the best candidate because I am disciplined, hardworking, and respectful within my community. I have experience working with different people through previous jobs and volunteering. I understand the challenges faced by young people and I am committed to helping them make better life decisions. I am also a quick learner, a good communicator, and I am fully prepared to attend and complete all training sessions. With my dedication, I will become a reliable and impactful mindset change trainer.\n\n', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 13:07:10', '2025-07-17 13:07:10'),
(529, 977, '[\"documents\\/01K0BT809XQNAQW4EADRVXK770.pdf\"]', '[\"documents\\/01K0BT80A1PNMHVWZN300FNFWZ.pdf\"]', 'Unemployed', 'I am passionate about empowering others and creating positive change within my community. I possess strong communication and interpersonal skills, which allow me to engage effectively with people from diverse backgrounds. I am a good listener, empathetic, and open-minded—qualities that are essential for guiding peers in addressing issues such as health, education, and social behavior. I am also committed to leading by example and promoting a positive mindset among youth. With a willingness to learn and share knowledge, I am confident that I can contribute meaningfully and help inspire lasting impact.', 'No', 'none', 'None', 'Yes', NULL, '2025-07-17 13:08:00', '2025-07-17 13:08:00'),
(530, 978, '[\"documents\\/01K0BTP2P1HFD5CBQPS4JK652Q.pdf\"]', '[\"documents\\/01K0BTP2P6KTFZPSDS1CSY7E2T.docx\"]', 'Unemployed', 'I love to work with young people, sharing information about growing up and sharing advices on how to cater for themselves and be dependent, that\'s I chose to be a secondary teacher. I believe I am the best fit for this position because I\'m passionate with young people and I have an experience of working with them. In my community, I am also a living testimony of how young people face devastating situations but still be able to become whatever they want to be without, thus I believe that they\'ve learnt something from my life that nothing can stop young people from pursuing their ambitions.', 'Yes', 'World Vision (Umliba Loya Embili)', '-Empowering adolescents about growing up stages and HIV/Aids related issues. \n-Assisted in designing and developing relevant questionnaires.\n-Administered and collected data on a small projects related to adolescents in Mbangweni community, Shiselweni 2 constituency.\nRepresented World Vision in the Eswatini Youth Advisory Board (YAB).\nThis equipped Eswatini Youth about how to take of themselves as they grow up. They also got information about how to protect themselves from getting HIV/AIDS, and how to take care of themselves if living with HIV/AIDS.', 'Yes', NULL, '2025-07-17 13:15:42', '2025-07-17 13:15:42'),
(531, 979, '[\"documents\\/01K0BTQ0NHY21M659E6A6T25WX.pdf\"]', '[\"documents\\/01K0BTQ0NXA2DJ5BFAGG19S13Q.pdf\"]', 'Unemployed', 'I chose to apply for a position at ENYC because I strongly believe in its mission to empower and uplift young people in Eswatini. Your commitment to youth development, innovation, and leadership aligns perfectly with my passion for using technology to create meaningful change. I am eager to contribute my skills in IT to support ENYC’s digital initiatives, enhance communication platforms, and help streamline youth programs. I see this opportunity not just as a job, but as a chance to be part of a movement that shapes the future of our nation. Thank you for considering my application. I look forward to the possibility of working together to empower the youth of Eswatini.\n', 'Yes', 'International Youth Fellowship', 'I worked as an IT Technician and also as  Mentor teaching students Microsoft Office . I even taught students how to partake in various sports activities for instance soccer, passing ball in the air, relay race, tug of war', 'No', NULL, '2025-07-17 13:16:12', '2025-07-17 13:16:12'),
(532, 980, '[\"documents\\/01K0BVZMEQYV25AEK7Y4RX0ZMW.pdf\",\"documents\\/01K0BVZMEZHPGN5KZD98DPYHK8.pdf\"]', '[\"documents\\/01K0BVZMF56R89MY7GWJ314H9B.pdf\"]', 'Unemployed', 'I have applied because I am passionate about helping young people especially mentoring them. I have worked with young girls especially in school. The experience was so lovely and amazing. I would love to part take in this program in helping young people out there. ', 'Yes', 'SWAAGA', 'None\n', 'Yes', NULL, '2025-07-17 13:38:23', '2025-07-17 13:40:48'),
(533, 981, '[\"documents\\/01K0BWA1Z9C37N8GN0BJR9DAK1.pdf\"]', '[\"documents\\/01K0BWA1ZDM63PQ6HQAZ0QTR9Y.docx\"]', 'Unemployed', 'I am a fast learner who also like providing a service and giving back to the community. I have done community development module thus I have an understanding on the works of the community. I am a peer councillor and educator. Lastly I\'m passionate to learn on empowering youth .', 'No', 'None ', 'None ', 'No', NULL, '2025-07-17 13:44:05', '2025-07-17 13:44:05'),
(534, 982, '[\"documents\\/01K0BWH3WGHVY40A57SPX5KW08.jpg\"]', '[\"documents\\/01K0BWH3WKCAT7PCYMQD9P89BY.docx\"]', 'Self-Employed', 'I had applied  for the job because  am someone who has a heart for the youth in businesses and in health .seeing our community  youth improving themselves ', 'No', 'No', 'None', 'Yes', NULL, '2025-07-17 13:47:56', '2025-07-17 13:47:56'),
(535, 983, '[\"documents\\/01K0BWJZWA8410HN9C2YZNVSRF.jpg\"]', '[\"documents\\/01K0BWJZWGEDVKJKMF6EZZ7W5E.docx\"]', 'Unemployed', 'I have applied because i am dedicated and passionate member of the society who wishes to see my community developing. I think i am the best candidate since i have just completed my Bachelor of Business Education in UNESWA and im also good at teaching. So i think i will play a crucial role in changing youth mindset. ', 'Yes', 'Young Heroes', 'I was a member of Young Heroes and we discussed issues aroound teenage pregnancy and how to overcome it. Also discussed sexually transmitted infections. I helped through discussing and posing questions which were crucial that raised awareness to the youth group which were in my members', 'Yes', NULL, '2025-07-17 13:48:58', '2025-07-17 13:48:58'),
(536, 984, '[\"documents\\/01K0BWPWH01KJGE1P6HZB9NFKY.jpg\"]', '[\"documents\\/01K0BWPWH4AC9VMPTMYB87WRHP.docx\"]', 'Unemployed', 'I have applied as a mindset  change trainer because working around young people have been driven by passion and seeing this programme which will have a great impact in our community, to also see young people having a positive mindset and adapt to change. So I believe I am the best candidate because of my previous experience in this job and helping others. As I have been working with young people before the past years i have developed strong communication, problem- solving and relationship building skills. So with this combination of skills I think I\'m the best candidate ', 'Yes', 'Family Life Associated of Swaziland, LISTEN Project ,House Of Our Pride, Save The Children,  Eswatini National Youth Council ', 'I started at Family Life Association of Swaziland as an Outreach Mobiliser for Youth and Key population, having group sessions with young people on HIV and AIDS Management and bringing them services they needed in a mobile clinic. Then I was a volunteer at House OF Our Pride as a Key population Peer Educator . I was facilitating sending health messages and linking them to services.  Also I was an Adolescent Girls and Young Women Mentor at LISTEN Project whereby I was conducting group sessions giving them information on Sexual Reproduction Health and Rights , Entrepreneurship  and encouraging them to start small businesses. At Eswatini National Young Council I was a Peer Educator on Life Skills Education giving young people information on values and rights  , Entrepreneurship, sexual Reproduction Health and Rights , how one should treat one another in the society in terms of discrimination and gender inequality. Also encouraging young people to be independent by starting small businesses. Then at Save The Children I was a Trainer for Caregivers teaching them on Child development and Children with special needs', 'Yes', NULL, '2025-07-17 13:51:05', '2025-07-17 13:51:05'),
(537, 985, '[\"documents\\/01K0BX719HC34MNYCR2ZMXQCVS.pdf\"]', '[\"documents\\/01K0BX719MESW7X73ZKY96P0A0.docx\"]', 'Unemployed', 'As a social work graduate awaiting official graduation, I believe I am the right candidate for this role because I bring fresh theoretical knowledge, practical field experience, and a strong commitment to making a difference. My academic background has equipped me with skills in psychosocial assessment, casework, and ethical practice, while my internship experience allowed me to apply these in real-life situations such as child protection, family support, and community outreach. I’m proactive, compassionate, and eager to grow professionally, and this qualities align well with the goals of this position.', 'No', NULL, 'None', 'No', NULL, '2025-07-17 13:59:54', '2025-07-17 13:59:54'),
(538, 986, '[\"documents\\/01K0BX8DA4WB1BX8F7JPGHYBME.jpg\"]', '[\"documents\\/01K0BX8DA7NCGN8DX3VQWEG3KE.jpg\"]', 'Unemployed', 'The reason I have applied is that I like working with youth.I have ability to work well under pressure .I have communicating skills and I also multitask.', 'Yes', 'Youth savings ', 'They knew how to save money for future use.', 'No', NULL, '2025-07-17 14:00:40', '2025-07-17 14:00:40'),
(539, 987, '[\"documents\\/01K0BXMTMMGRT0XQ45X5W8SX7R.jpeg\",\"documents\\/01K0BXMTMRJB56KSP6SBYG9VB5.jpeg\",\"documents\\/01K0BXMTMVYTQ9TAZ7ET5Q8HNV.jpeg\"]', '[\"documents\\/01K0BXMTMZA4D5T8H1EJFYV5R4.docx\"]', 'Unemployed', 'I am a hard working individual who is eager to learn.\nI am a team player and can work under minimum supervision. \nI love working with people as I get to be exposed to different personalities, thus improving my communication skills.\nI wish to add to your productivity goals.', 'No', 'N/A', 'None', 'Yes', NULL, '2025-07-17 14:07:26', '2025-07-17 14:09:28'),
(540, 988, '[\"documents\\/01K0BYBDKJM69EX5BK13K4XHPP.pdf\"]', '[\"documents\\/01K0BYBDKRB82V25HGQM2Q6BDS.pdf\"]', 'Unemployed', 'I am applying for the Youth Mindset Change Trainer Programme because I strongly believe in the importance of empowering young people and supporting their growth through positive mindset development. Although I do not yet have direct experience working with youth, I am eager to gain this experience and am fully committed to learning and contributing meaningfully.\nI consider myself a dedicated and responsible individual, and I am confident that with the right training, I will be able to effectively engage with young people and facilitate positive change within my community. I am prepared to commit fully to the training and to serve as a volunteer with professionalism and enthusiasm. My willingness to learn, combined with my passion for community development, makes me a suitable candidate for this programme.', 'No', 'None', 'None', 'No', NULL, '2025-07-17 14:19:47', '2025-07-17 14:19:47'),
(541, 989, '[\"documents\\/01K0BYDBVZCSGR0FSHEAJRV7AQ.jpg\"]', '[\"documents\\/01K0BYDBW6BXTXN1SGXM5YENK1.png\"]', 'Unemployed', 'I\'m am a student at the University of Eswatini pursuing my degree in B.A Social Sciences and working with the youth is part of my ultimate goal.\nI believe I have so much to offer the youth since I\'m someone who is very passionate about change and progress. I have attended alot of youth conferences where we were being empowered and educated in so many words and with the knowledge that I have gathered I want to put it in good use. Being chosen will not only help me financially but it will also help everyone I will interact with during the job because I believe I bring out the best in everyone, by being passionate to people and learning with every experience, Also i am the best candidate for this job because I have so much to offer since I am a very fast learner and over the years as a student I have developed a skill in interacting with other people .', 'No', 'None', 'None', 'No', NULL, '2025-07-17 14:20:50', '2025-07-17 14:20:50'),
(542, 990, '[\"documents\\/01K0BYTSBC8VZ066QP1ZKJAQAA.pdf\"]', '[\"documents\\/01K0BYTSBFF60S4WC0V22VB8MK.pdf\"]', 'Employed', 'I believe in the Youth and their ability to apply change in their own lives and make huge impacts on their communities and in the country at large. I spend a lot of time with young people and I see potential even in their confused social lives and livelihoods at large. Admist the current unemployment issues they are facing they can change their perception on things, unite and build a progressive life changing business life.', 'Yes', 'No', 'None', 'Yes', NULL, '2025-07-17 14:28:10', '2025-07-17 14:28:10'),
(543, 991, '[\"documents\\/01K0BZ6B1HEV0SCD76WPQXSFMY.pdf\"]', '[\"documents\\/01K0BZ6B1T6MKJEYE4DAY0X24K.docx\"]', 'Unemployed', 'I applied because I’m passionate about youth empowerment and community development. My experience in data-driven health campaigns and working with diverse youth makes me a strong fit. I connect easily with others and am committed to making a positive impact through mindset change.', 'Yes', 'World Health Organisation ', 'I was involved in a campaign funded by (WHO) to vaccinate young girls in Schools in the Shiselweni region against Human \nPapillomavirus and also deworming all\n the boys and girls.', 'No', NULL, '2025-07-17 14:34:29', '2025-07-17 14:34:29'),
(544, 992, '[\"documents\\/01K0BZBB3QMSQ08DWDPJN9VR3R.jpg\"]', '[\"documents\\/01K0BZBB3S9NC2E1S31VWG78GB.pdf\"]', 'Unemployed', 'I have massive experience working with NGOs and with young people, I am passionate about social development and  financial independency for all young persons  living in Eswatini', 'Yes', 'Save the children fund and DREAMS PSI', 'Facilitating Financial literacy and social sustainability to Young  Women and out of school Adolescent girls', 'Yes', NULL, '2025-07-17 14:37:13', '2025-07-17 14:37:13'),
(545, 993, '[\"documents\\/01K0BZF72Q2BMKV9D3SP77BMWC.jpg\"]', '[\"documents\\/01K0BZF731SJ1F6S80NM5P0QE9.jpg\"]', 'Unemployed', 'I have a passion of working with young people especially those that are living with HIV & AIDS so that I can encourage them to adhere to their medication until they are virally suppressed. I have a seven years experience in working with people that are in the communities and also working in a donor funded organization.', 'Yes', 'Bantwana Initiative eswatini', 'I worked with children living with HIV&AIDS.I would encourage adherence and honoring of all clinic appointments.I also attended Teen Clubs with children living with HIV.I would also offer supportive supervision to community cadres working with adolescents and young women. I would also loom into issues of child protection.', 'Yes', NULL, '2025-07-17 14:39:20', '2025-07-17 14:39:20'),
(546, 994, '[\"documents\\/01K0BZR2VRZV63VAADPDVYZNK5.jpg\"]', '[\"documents\\/01K0BZR2VW9SGAE1Q348ZZ7GHC.docx\"]', 'Employed', 'I applied to these program because I\'m passionate about becoming a positive role model in my community and developing the skills needed to lead and inspire others.\nI believe I\'m the best candidate because I bring dedication and strong work ethics,a genuine desire to grow as a leader.Im open minded, a good listener and always willing to learn from others,I\'ve already taken steps to be involved in my community.', 'Yes', 'Elizabeth Glaser and World Vision ', 'I support Education in Community mentoring 15-29 AGYWs and Young Women. We were talking about sexual productive, HIV,STIs ,GBV,Mental health and how to save Money \nI even helped young people to be not ashamed of taking condoms where they\'re distributed because condom is the best protection we should use, prevent pregnancy and STIs', 'Yes', NULL, '2025-07-17 14:44:10', '2025-07-17 14:44:10'),
(547, 995, '[\"documents\\/01K0BZR6X0GQZF9EHKK1CC2TCT.pdf\"]', '[\"documents\\/01K0BZR6X3EPAK42KBJ9BDDZDE.pdf\"]', 'Unemployed', 'I\'m a passionate young lady about empowering youth and driving positive change in my community. As a dedicated and enthusiastic individual, I\'m excited to be trained as a mindset change trainer to help young vulnarable girls who are abused and also help them stand up for themselves. With the experience as a leader in high school, I\'ve developed strong communication and leadership skills, which I believe will enable me to effectively facilitate impactful community sessions. I\'m committed to volunteering my time and effort to make a significant difference in the lives of young people of Macetjeni or anywhere in Eswatini.', 'No', NULL, 'No', 'No', NULL, '2025-07-17 14:44:14', '2025-07-17 14:44:14'),
(548, 996, '[\"documents\\/01K0C09WJCPMEE90EV3QD1V5Y8.jpg\"]', '[\"documents\\/01K0C09WJKYDZNFQN60G8CJTTN.pdf\"]', 'Unemployed', 'I love working with young people and I think I am the best candidate for the job because of my work experience, I\'m dedicated, ambitious, energetic,creative and willing to learn person. ', 'Yes', 'Lusweti Chaps Mens Clinic AHFand AMICAALL Manzini ', 'I facilitated study groups, held health talks and support groups, referred people who needed clinical services as well as mentoring adolescents on money generating programs. ', 'Yes', NULL, '2025-07-17 14:53:54', '2025-07-17 14:53:54'),
(549, 997, '[\"documents\\/01K0C0M2YHFJFY57SD5VEPPRY2.pdf\"]', '[\"documents\\/01K0C0M2YN212KSJAXXKNY8QWN.docx\"]', 'Unemployed', 'I\'ve applied for the Youth Mindset Change Trainer position because I am deeply passionate about empowering young people and believe firmly in their potential to drive positive change in their lives and communities. Having witnessed firsthand the transformative power of a growth mindset, I am eager to contribute to an initiative that directly addresses the challenges faced by youth today, equipping them with the mental tools they need to thrive.\n\nI am the best candidate for this role because my skills and experiences align perfectly with the requirements of a Mindset Change Trainer. My background has provided me with strong communication and interpersonal skills, enabling me to connect with young people from diverse backgrounds and foster an open, trusting environment. I am adept at active listening and empathetic understanding, which are crucial for identifying the specific needs and challenges individuals face, and tailoring guidance accordingly.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 14:59:28', '2025-07-17 14:59:28'),
(550, 998, '[\"documents\\/01K0C0X0RGVBDBPA1SD6WPMDXA.jpg\"]', '[\"documents\\/01K0C0X0RJNXC32FE1YDXV9A9K.jpg\"]', 'Unemployed', 'I applied because lm in need of a job to bring food home,for career growth, to help my brothers and sisters on paying school fees.for my personal fulfilment and growth  and help needy people around our home. ', 'No', NULL, 'Nothing l did as lm from school and my wish is to get job and help young people .also to assist my parents to bring something to eat at home as they are now old for them to work and support me.', 'Yes', NULL, '2025-07-17 15:04:21', '2025-07-17 15:04:21'),
(551, 999, '[\"documents\\/01K0C0YYGRYK4KWS8W9ZWPKZEM.pdf\"]', '[\"documents\\/01K0C0YYGXKTW89H5XH8BH2CD2.pdf\"]', 'Self-Employed', 'As a passionate and dedicated youth advocate, I\'m excited to apply for the Youth Mindset Change Trainers program at the Eswatini National Youth Council. With my background in Agronomy and experience navigating the challenges of unemployment, I\'m confident in my ability to inspire and empower young people to reach their full potential.\n\nGrowing up in Swaziland, I\'ve witnessed firsthand the impact of limited opportunities and negative mindsets on our youth. However, I believe that with the right training and support, young people can overcome these challenges and become agents of positive change in their communities.\n\nAs a mindset change trainer, I would bring a unique perspective shaped by my experiences as a graduate struggling to find employment. I\'ve had to overcome obstacles, develop resilience, and cultivate a growth mindset to stay motivated and focused on my goals. I\'m eager to share these insights and strategies with others, empowering them to break free from limiting beliefs and unlock their full potential.\n\nMy passion for youth development and community empowerment drives me to pursue this opportunity. I\'m committed to creating a supportive and inclusive environment where young people feel encouraged to take risks, explore their passions, and develop the confidence to pursue their dreams.\n\nThrough this program, I aim to gain the skills and knowledge necessary to design and deliver effective training programs that address the specific needs and challenges of Swazi youth. I\'m excited to learn from experienced trainers and collaborate with like-minded individuals who share my vision for a brighter future for our youth.\n\nAs a successful graduate of this program, I envision myself working closely with the Eswatini National Youth Council to develop and implement mindset change initiatives that positively impact the lives of young people across the country. I\'m confident that my unique blend of experience, passion, and dedication make me an ideal candidate for this program.\n\nI\'m excited about the opportunity to contribute to the development of Swazi youth and look forward to the chance to discuss my application.', 'Yes', 'Lend a Hand Foundation ', 'As a dedicated volunteer at Lend a Hand Foundation, a non-profit organization founded by Luyengo campus students, I played a key role in raising funds and providing support to struggling and orphaned students. Through our collective efforts, we successfully assisted numerous students in need, providing them with essential resources and mentorship to help them overcome their challenges and achieve their academic goals. By working together, we made a tangible difference in the lives of young people, empowering them to build a brighter future for themselves and their communities.\n\nOur efforts had a profound impact on the students we assisted. Many were able to focus on their studies, improve their academic performance, and develop a more positive outlook on life. By providing them with the resources they needed, we helped bridge the gap between potential and opportunity, empowering them to become confident, capable, and compassionate individuals.\n\nThrough my experience at Lend a Hand Foundation, I developed valuable skills in leadership, communication, and teamwork. I learned the importance of empathy, active listening, and adaptability in working with diverse groups of people. Most importantly, I saw firsthand the difference that collective effort and community support can make in the lives of young people.', 'Yes', NULL, '2025-07-17 15:05:24', '2025-07-17 15:05:24'),
(552, 1000, '[\"documents\\/01K0C125MCDP3BREX1RK1Y4VME.pdf\",\"documents\\/01K0C125MFB4TH0SX60AXMAMCB.pdf\"]', '[\"documents\\/01K0C125MJ5CMPTR7CB6Y78FRV.pdf\"]', 'Unemployed', 'Working with young people is in my heart and i believe change starts from us as youth changing our mindset. Being part of Eswatini National Youth Council will help fulfil the purpose. To combat the skyrocketed unemployment and crime rates, Gender Based Violence and to empower young people for a better future.', 'Yes', 'eNgudzeni Young Heroes ', 'ENgudzeni Young Heroes was a male youth project that was sponsored by Young Heroes and the LaMgabhi MP Mr. Scelo Senzo Jele. It was mainly focused on planting trees in eroded areas and educating the young males on how to earn a living in life. It was a successful project because the area has less eroded areas. ', 'Yes', NULL, '2025-07-17 15:07:09', '2025-07-17 15:07:09'),
(553, 1001, '[\"documents\\/01K0C12RMHVXGA596QHHPE4SEZ.png\"]', '[\"documents\\/01K0C12RMQD2D57RR323R8TTTY.png\",\"documents\\/01K0C12RN0SB045DPK04H0SK3B.png\"]', 'Self-Employed', 'I have applied mainly because my heart is fond of working with young people, helping them discover their potential despite their current predicaments. I strongly believe  I am the best candidate because I know my capabilities and strengths for doing this kind of a job. I have a heart for it. Bringing out the best in others. ', 'Yes', 'Kwaluseni Red Cross, helping orphaned kids and children ', 'We help by feeding young kids and children with their daily cooking, dishing, and assisting them with writing their home works and school assignments. ', 'Yes', NULL, '2025-07-17 15:07:29', '2025-07-17 15:07:29'),
(554, 1002, '[\"documents\\/01K0C18X85R91RAJKPR6ZPCEJ9.jpg\",\"documents\\/01K0C18X8BJN4AVYMR9HERY7A1.jpg\"]', '[\"documents\\/01K0C18X8FW129V7GCSCZBWH6P.docx\"]', 'Unemployed', 'For the passion that I have which runs through my veins I have that zeal to encourage other younsters to follow and/or exceed my footsteps.\nI am a trustworthgy person as the community children prefer approach me and opening up to me with whatever story or speech they may want to off-load.\nAlso I do not choose where is the child is coming but I give myself time to listen to what ever he/she is saying and give my best advices or encouragements.\nI am willing to learn in order to improve my work performances and exceed he company\'s expectations, handling tasks honestly and listening attentively.\nI can work cooperatively with other employees and very well as a team.\nAs a young; flexible with fresh trainable mind which would take the company/organization to its bettwerment.', 'Yes', 'Young Heroes', 'Teaching children about HIV prevention; mentoring them to over come peer pressure and reach their dream goals; advising and urging them to always respect their parents and adults.\nTraining them to always clam and obey.', 'Yes', NULL, '2025-07-17 15:10:50', '2025-07-17 15:10:50'),
(555, 1003, '[\"documents\\/01K0C1X5R4NJ34DA7DTEV37420.pdf\"]', '[\"documents\\/01K0C1X5RBGMK08NPVRN4167JP.pdf\"]', 'Unemployed', 'I have applied because I\'m very passionate about youth empowerment and community development. I love working with the youth. I love seeing them transform their lives, doing the most to become financially independent. I also love field work, because I get to interact with different people with different mindsets, it helps me grow and understand life from different perspectives.\nI have also applied because, according to me, Eswatini National Youth Council is an excellent place to help me grow and provide me with a platform to showcase my skills.\nI am the best candidate for this job because I am hardworking, and I have the required experience.', 'Yes', 'Bantwana Initiative ', 'I was a business mentor. I facilitated financial literacy sessions to the youth, and helped them start savings groups. I also taught them employability soft skills, so that they will be able to find employment. \nI also helped young entrepreneurs start small businesses with the start-up pack program from the organisation. I also helped some of them in writing business plans, so they could acquire funding for their businesses.', 'Yes', NULL, '2025-07-17 15:21:54', '2025-07-17 15:21:54'),
(556, 1004, '[\"documents\\/01K0C20FG11W5KVYNDQK9WHNVA.pdf\"]', '[\"documents\\/01K0C20FGJV30WWJXR0Y8YF7GE.docx\"]', 'Unemployed', 'I am excited about this job at Youth Focused Organization because of its commitment to communicating. With my strong background in communication skills I believe I can make significant impact. \n\nI am the best candidate for the this job because my skills perfectly align with the Job requirements.\n\nNowadays Youth are facing many challenges and that leads to suicide, so with the skill of communicating, I will collaborate better with the Youth. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 15:23:43', '2025-07-17 15:23:43'),
(557, 1005, '[\"documents\\/01K0C22577P9XGD7QZ9H5VX3H0.jpg\"]', '[\"documents\\/01K0C2257AA7C01J47Q30VVTPC.jpg\"]', 'Unemployed', 'I apply for this job because I love engaging with the youth,am a dedicated person who is able to speak freely with different people of different levels.I valued confidentiality.I am able to work under pressure,work under minimal of supervion and to meet deadlines.', 'Yes', 'AHF eSwatini', 'I empowered them to always stay healthy.I educate them about health talks.we even engage in activities that deals with health and fitness like playing netball etc.', 'No', NULL, '2025-07-17 15:24:38', '2025-07-17 15:24:38'),
(558, 1006, '[\"documents\\/01K0C2GM6P8A5HGXG0FNPKYHH0.docx\",\"documents\\/01K0C2Q9GDEY3Y6JP8W7EWCJ3A.docx\"]', '[\"documents\\/01K0C2GM6T18V705EA7150FBEH.docx\",\"documents\\/01K0C2Q9GJKZAWXERSEHGWF616.docx\"]', 'Unemployed', 'I have applied for the job because I believe so much in making a difference, making a positive impact in the lives of youngsters.I believe I am the best candidate for the job because it will help me build skill development and bringing a sense of purpose as I believe my nature is to love and nurture young minds.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 15:32:32', '2025-07-17 15:36:10'),
(559, 286, '[\"documents\\/01K0C2J09FRE71BDVR1SQ8SBRC.pdf\",\"documents\\/01K0C2J09K3GA6FTK7FQV3PRY9.pdf\"]', '[\"documents\\/01K0C2J09QK600RGTJDKAGM3M7.pdf\"]', 'Unemployed', 'I believe my experience and skills make me an ideal candidate for this initiative,as I have worked with  the youth in my community where I have empowered them in many ways such such as building self confidence, becoming financially independent and making themselves a  priority. Also I believe I\'m the best candidates because I\'m an empowered young energetic woman who strive for the best for me and other young people in my community wich will lead to everyone inspired to do more.Last but not least I have the potential and energy to be on top as I believe bieng part of this initiative will help boost myself confidence and build up leadership roles and be able to a leader tomorrow. ', 'Yes', 'World vision _Likusasa Ngeletfu organization ', 'As I worked from the organization I worked as a life Mentor where I worked with Adolescent girls and young women where I educate them on HIV/AIDs prevention, family planing, condom usage and further refer them for clinical services in mobile clinics and nearby clinics.Also I help them chose goals through our mentoring session where I mentor them and refer others to business mentors for those who want to be financial independent. I report GBV cases to our officers and other stakeholders that deals with abuse in our country and creating a safe space among them.', 'Yes', NULL, '2025-07-17 15:33:17', '2025-07-17 15:33:17'),
(560, 1007, '[\"documents\\/01K0C32ZVKB7MYH45SAXMMKQF4.PDF\"]', '[\"documents\\/01K0C32ZW02AEF5T2F747ZBX2X.docx\"]', 'Unemployed', 'I think am the best candidate because I\'ve done a module on community development and one of the keys components of community development is youth and people living with disabilities.  I also did a module on cultural competence which taught me about acceptance of people from different background. I am also part of bandlancane in my area and am advocating for youth recognition in all level of leadership positions. Lastly I am a man of his word.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 15:42:33', '2025-07-17 15:42:33'),
(561, 1008, '[\"documents\\/01K0C36XNFBCGCGZ1XNSDF8RQY.pdf\",\"documents\\/01K0C36XNP7EK8GCPP5CHAP6Y9.pdf\",\"documents\\/01K0C36XP1SG5GBFXJ7TV7KHF6.pdf\"]', '[\"documents\\/01K0C36XPA54X6JTQWDP6BHM28.pdf\"]', 'Unemployed', 'I believe I\'m the best candidate because I\'d serve as a motivation to young people being able to relate with each other and be able to help them articulate challenges they face. I believe my exposure to trainings that pertain to the youth and also being a peer counsellor back at University will help me being a good candidate. I also possess good values and I know my strengths as to being innovative, committed, passionate, goal-driven, friendly, hustler which I can also help youth to identify their strengths and values for better achievement. ', 'Yes', 'Eswatini National Agricultural Union (ESNAU) ', 'Provide trainings to the youth to help in farming business such as financial literacy. Assisted the youth to access finance through grants, revolving fund and even loans which would require no collateral.\nThere is also a Youth Wing which is a group of youth across all four regions where they are able to get mentorship, monitoring and valuable trainings for their development. ', 'Yes', NULL, '2025-07-17 15:44:42', '2025-07-17 15:44:42'),
(562, 1009, '[\"documents\\/01K0C37QT63ZMF817M190MYDRX.jpg\"]', '[\"documents\\/01K0C37QTKYQKST12YRSM7VJG1.jpg\"]', 'Self-Employed', 'I love working with people solving problems together and having a better future together. ', 'Yes', 'World Vision Eswatini ', 'I was facilitating young women on starting own business and vocational skills ', 'Yes', NULL, '2025-07-17 15:45:09', '2025-07-17 15:45:09'),
(563, 1010, '[\"documents\\/01K0C3BFAKJW6B46CTTSWCVKDF.jpg\",\"documents\\/01K0C3BFAXFZ8JABA14E9HXNKS.jpg\"]', '[\"documents\\/01K0C3BFB69DA9YM0Z26B9XKKF.jpg\"]', 'Self-Employed', 'It\'s because I have once worked with adolescents girls and boys for HIV prevention sessions.Also I was able to use multiples mobile Apps e.g. DMS,Field Task and Data Capturing.', 'Yes', 'Young Heroes and World Vision ', 'I was a youth facilitator where by we gather young girls and boys for HIV prevention sessions.\nAlso demand creation for clinical services.', 'Yes', NULL, '2025-07-17 15:47:11', '2025-07-17 15:47:11'),
(564, 1011, '[\"documents\\/01K0C3DNMC7ZKC9TDZFQS70204.jpg\"]', '[\"documents\\/01K0C3DNMMX8MS13GXKXAG6ZYJ.pdf\"]', 'Unemployed', 'I am the best candidate for this job because I am passionate about creating a safe and nurturing environment for children. I have an experience with working around children. I have a strong understanding of the developmental needs of children and am skilled in creating engaging and educational activities, and I\'m currently pursuing my teaching degree so this job will be an advantage for me. ', 'No', 'None', 'I have not ', 'Yes', NULL, '2025-07-17 15:48:23', '2025-07-17 15:48:23'),
(565, 1012, '[\"documents\\/01K0C3NFQ6YN8VTA05JAC3THS0.pdf\"]', '[\"documents\\/01K0C3NFQJ0F7FSJHK1A56VECF.pdf\"]', 'Unemployed', 'I want to empower young people to be the change they want to see in our communities. I am driven towards seeing all of our youth taking initiative towards making a better life and future for themselves and their families through mindset change and embracing innovation. \nBeing the voice of the voiceless remains a priority within me as a young person,  and want to use my strength, insight and experiences to empower my peers in my community. \nI believe that this opportunity will offer self growth opportunities even for myself and a change to make the world a better place for our generation and the next generations to come. ', 'Yes', 'Young Heroes ', 'I worked with Adolescent Girls and Young Women as a Regional DREAMS Ambassador, my role was to empower the youth to take up health services offered by the community outreach team. Engage with the youth on health issues affecting them and documenting responses on how HIV and teenage pregnancy services can be better delivered by the Ministry of Health. I empowered Young people to take initiative for their health and well being, while also being the voice of the youth in decision making forums where I participated advocating for the needs of the youth. I also participated in the fight against GBV through educational campaigns and podcasts where Young people were able to express themselves about matters of GBV.', 'Yes', NULL, '2025-07-17 15:52:39', '2025-07-17 15:52:39'),
(566, 1013, '[\"documents\\/01K0C3XV0V9EAV6GJNSZV108WX.pdf\"]', '[\"documents\\/01K0C3XV13N1PB346CE57CEV08.pdf\"]', 'Unemployed', 'I have worked with young people and I understood the challenges they face on a daily basis  moreover we introduced  digital platforms which are Facebook, ticktok and whatapp Chatbot where they accessed the services learned about which are unwanted pregnancies, GBV and STI they loved the fact that the whatapp chatbot was friendly because they were talking to a automated digital friend  and it was a safe space for  them because they were not judged  .', 'Yes', 'Population Services International, Girl power Eswatini ', ' bring  valuable  experience gained through involvement with Girl Power  Eswatini (GPE) implemented by PSI ,where worked extensively to mobilize adolescent girls and young women to access SRH and HIV information through  various digital  platforms. In this role, I forums represent youth perspectives, conducted outreach and community-based awareness, campaigns to promote digital access health education assisted in the creation, review and approval of youth -friendly control social media ensuring that the messaging relevant clean empowering. These experiences have strengthened my communication facilitation and peer engagement skills, qualities that are essential for a peer Educator supporting in school clubs focused on life skills,health and gender awareness ', 'Yes', NULL, '2025-07-17 15:57:13', '2025-07-17 15:57:13'),
(567, 1014, '[\"documents\\/01K0C44T3JYNZMW7FVTETK7PMF.jpg\",\"documents\\/01K0C44T3MZ12QVS24QGH43NSC.jpg\",\"documents\\/01K0C44T3QRHQ5FHZ843VNB0Q3.jpg\"]', '[\"documents\\/01K0C44T3TYK7Z94BM2HE4R0TD.pdf\"]', 'Unemployed', 'I applied for this job because I’m looking for a challenging opportunity that helps me take more responsibilities and also to learn something new and apply what I\'ve learned. I believe i am the best candidate because of the skills & expertise I’ve gained while working with adolescents and Young Women. My good communication skills and ability to work in a team also makes me an ideal candidate for this role or job. ', 'Yes', 'Young Heroes', 'Identify and enroll Adolescent Girls and Young Women\r\n(AGYW) through strategic entry points and conduct\r vulnerability assessments using the set criteria\n\r\nDeveloping and managing life mentorship plans for AGYW\n\r\nConduct small group sessions, and one on one mentorship\r\non HIV prevention, Sexual Reproductive Health, life skills\r\nand using job aids', 'Yes', NULL, '2025-07-17 16:01:02', '2025-07-17 16:01:02'),
(568, 1015, '[\"documents\\/01K0C4BGWPS4K1P9PPS1NKEH81.pdf\",\"documents\\/01K0C4BGWSCPNCWQ2SQAGXY69R.pdf\"]', '[\"documents\\/01K0C4BGWW6V0HJ02RX2TKWQPR.pdf\"]', 'Employed', 'I am very interested in this opportunity and believe my skills in communication and organization would be a strong fit. I\'ve attached my resume for your review. Thank you for your time and consideration. \nBest regards,\nMenzi', 'Yes', 'Georgetown University ', 'I mobilized adolescent Girls and Young Women (AGYWs) and Adolescent Boys and \r\nYoung Men (ABYMs) within the targeted community for participation in the “No \r\nMeans No” program.\r then facilitated group sessions using the “No Means No” Worldwide (NMNW) curriculum \r\nreaching the target populations in targeted communities.\r Then i developed and managed integrated mentoring plans tailored to the target population’s \r\nneeds, risk, and vulnerability and ensure follow-up.\r Lastly, i conducted follow-up with participants utilizing the mentorship approach to track them to \r\ncompletion. ', 'No', NULL, '2025-07-17 16:04:42', '2025-07-17 16:04:42'),
(569, 1016, '[\"documents\\/01K0C4P1QSWH28FXPA8REMD1SN.jpg\"]', '[\"documents\\/01K0C4P1QY6RGM99NAW6JERKKE.pdf\"]', 'Self-Employed', 'I am the right candidate since I have done community work before. I relate to this kind of work because I have clear picture that helping out does not mean I need to expose anyone needing assistance in anything. I understand the value of community development work meaning it\'s for the growth of the Tinkhundla in the country so it plays a huge role in socio-economic growth in the country. I also believe in the notion \"it always starts with you\", meaning the change we want to see in all communities with such an initiative calls for every individual to stand up and participate to bring the change.', 'Yes', 'Red Cross ', 'What we did for the young people  included helping them with studies that is through their school work, helping out ngelidladla laseNkhundleni to dish out young kids after school', 'Yes', NULL, '2025-07-17 16:10:26', '2025-07-17 16:10:26');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(570, 1017, '[\"documents\\/01K0C4X3FY7QKBN9SN66662ZYD.pdf\"]', '[\"documents\\/01K0C4X3G662T7WSABY9MVSGZ5.pdf\"]', 'Unemployed', 'I have applied for the Youth Mindset Change Trainer Programme because I am passionate about youth empowerment, community transformation, and mental wellbeing. This programme aligns perfectly with my personal mission and the work I have been doing for the past seven years in supporting adolescents and young people, especially those living with HIV.\nMy experience includes working as a Community Adolescent Treatment Supporter (CATS), Youth Facilitator, and most recently as a Peer Supporters Supervisor with SNYP+. In these roles, I facilitated teen clubs, led safe space activities, supported treatment adherence, conducted community sensitization, and mentored young people to overcome stigma, build self-confidence, and adopt healthy behaviours. These responsibilities are closely aligned with what the Youth Mindset Change Trainer role requires.\nI believe I am the best candidate for this opportunity because I don’t just have the qualifications—I have lived and proven experience. I hold a Certificate in Psychosocial Support from the University of Eswatini, and I have successfully implemented youth-focused programmes at grassroots level. I am also a strong communicator, a good listener, and someone who young people trust and relate to. I know how to engage diverse youth audiences and create safe, respectful spaces for mindset change to happen.\nIn addition, I am highly committed, community-rooted, and available to fully participate in the training and give back as a peer educator. I understand the challenges our young people face, and I am passionate about being part of the solution. This opportunity is not just a training programme for me—it is a platform to amplify the work I already do and to reach even more youth with a message of hope, growth, and transformation.\n', 'Yes', 'Eswatini Network Of Young Positives', 'As a dedicated Psychosocial Supporter, I have played an active role in improving the wellbeing of Adolescents and Young People Living with HIV (AYPLHIV) through various roles in community-based organizations across Eswatini.\n\nAt SNYP+, I served as a Peer Supporters Supervisor and Project Assistant where I supported CATS (Community Adolescent Treatment Supporters) with caseload planning and guided them in using the WANDA tool for client tracking. I was instrumental in establishing and facilitating Teen Clubs, Young Adult Spaces, and Young Boys’ Movement safe spaces, creating platforms for young people to express themselves, learn about health, and receive psychosocial support. I co-facilitated sessions, conducted home visits, monitored performance indicators under the READY+ project, and ensured young people’s voices were represented in advocacy efforts.\n\nPreviously, as a CATS under Nazarene Compassionate Ministries, I worked directly with AYPLHIV aged 10–24, providing adherence support, leading teen clubs, facilitating community sensitization, and conducting regular home visits. My work helped young people remain in care, understand their health better, and feel supported in their journeys.\n\nDuring my time with Bantwana Initiative, I visited households of vulnerable adolescents, promoted HIV testing and treatment adherence, and ensured that young people were linked to services. Similarly, at REPSSI, I worked as a Youth Facilitator where I enrolled adolescents into GBV programs, facilitated weekly group sessions, and referred high-risk cases to appropriate psychosocial services.\n\nWith PACT, I mobilized communities for COVID-19 vaccination, educating young people and their families about the importance of immunization, while also capturing data using digital tools like COMMCARE.\n\nIn addition to field work, I contributed to national research by collecting data for the Stigma Index, helping ensure that the lived experiences of young people living with HIV were documented to influence programming and policy.\n\nThroughout these roles, I consistently used active listening, communication, and mentoring skills to create safe and supportive environments for young people. I also strengthened their access to information, improved adherence to treatment, and encouraged resilience and leadership among youth.\n\nMy commitment is to empower young people, reduce stigma, and ensure they have access to holistic support systems that nurture their mental, emotional, and physical wellbeing.\n\n', 'No', NULL, '2025-07-17 16:14:18', '2025-07-17 16:14:18'),
(571, 1018, '[\"documents\\/01K0C52WVKYDZSDDBXZTPET45P.jpg\",\"documents\\/01K0C52WVWG5KGSABQZNRZ6NM9.jpg\"]', '[\"documents\\/01K0C52WVZZ5HZ2VCXC5NMREYM.docx\"]', 'Unemployed', 'I believe that given an opportunity within your  organization I would be able to exercise effectively the knowledge and capability that I possess in peer education and ensure to my best that I contribute my energy and dedication to meet the organization’s targets and goals . As a peer educator, I aim to create a safe, supportive, and inclusive environment where individuals can share their concerns, explore their potential, and develop the skills and confidence needed to make informed decisions about their lives.', 'Yes', 'Young Heroes', 'I believe that given an opportunity within your  organization I would be able to exercise effectively the knowledge and ', 'Yes', NULL, '2025-07-17 16:17:27', '2025-07-17 16:17:27'),
(572, 1019, '[\"documents\\/01K0C58N9SPCGA2MGRTPYN0Q9M.zip\"]', '[\"documents\\/01K0C58N9WZZ75M6SZ06G39RM9.pdf\"]', 'Unemployed', 'I\'ve applied for the Youth Mindset Change Trainee position because I\'m passionate about empowering young people and believe my background in Information Technology uniquely positions me to contribute. While my formal education is in IT, I\'ve always been drawn to how technology can be a catalyst for positive change and skill development. I see this role as an incredible opportunity to merge my technical understanding with a direct impact on youth, helping them adapt to and thrive in an ever-evolving world. I\'m eager to help foster innovative thinking and resilience among young individuals, which I believe is crucial for both personal growth and community development\nI believe I am the best candidate for this role because my IT background has equipped me with a unique set of problem-solving, analytical, and communication skills that are directly applicable to fostering mindset change. In IT, you learn to break down complex problems, adapt to new technologies, and clearly explain technical concepts to diverse audiences—all of which are essential when guiding and mentoring young people.\n\nFurthermore, my experience in IT has cultivated a forward-thinking mindset and an understanding of the rapid changes shaping our world. I can leverage this perspective to help youth develop adaptability and innovation, critical qualities for navigating future challenges. I\'m also proficient in utilizing digital tools, which can be invaluable for developing engaging and impactful programs for youth.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 16:20:36', '2025-07-17 16:20:36'),
(573, 1020, '[\"documents\\/01K0C59T0446XMY0T4VP0APNK0.jpg\",\"documents\\/01K0C59T08Q0Q8945VQVR5XC80.jpg\",\"documents\\/01K0C59T0A8THWFKSDBD9BF1PY.jpg\"]', '[\"documents\\/01K0C59T0DJG5H3TFSSD6G5E6G.doc\"]', 'Unemployed', 'I applied because I want to gain more knowledge and impact that knowledge to young people in my community, I want to bring positive change in my community. I am the best candidate because I have  experience in working with young people,I have a good facilitation and interpretation skills, I am able to work with different people from different back grounds, I am dedicated to work given and am able to meet deadline ', 'Yes', 'World  vision, Bantwana initiatives , SWAGAA', 'I was facilitating group session about HIV prevention methods, healthy living and economical strengthening. \nI was referring them to health services like HTS, PREP, PEP, ART \nMost young people in my community they know their status, and the are economical independence (they have their small business)\nI also educate males about the importance of VMMC and refer them for VMMC', 'Yes', NULL, '2025-07-17 16:21:14', '2025-07-17 16:21:14'),
(574, 1021, '[\"documents\\/01K0C5C9GVVYGK6A48BG46YD73.jpg\"]', '[\"documents\\/01K0C5C9H4JG0E6267DRHHBSKY.jpg\"]', 'Unemployed', 'I have applied because i believe in the transformative power of mindset and want to help others in my community. With a degree in Social Work and strong background working with individuals facing adversity, i have seen how changing mindset can lead to lasting change. Also, i bring strong communication and facilitation skills and also personal commitment and resilience. I believe i am an ideal candidate for the programme because i combine professional knowledge, personal insight, and a deep passion for helping others grow.This opportunity will strangthen my ability to guide people through meaningful transformation and inspire change in both individual and communities.', 'Yes', 'World Vision', 'raise awareness on teenage pregnancy, Gender based violence and also HIV prevention methods and the importance of knowing their status. This helped in preventing teenage pregnancy as teenagers are informed and make informed decisions when it comes to sexual reproductive health. I also gave them referral pathways where they can report GBV. ', 'Yes', NULL, '2025-07-17 16:22:35', '2025-07-17 16:22:35'),
(575, 1022, '[\"documents\\/01K0C5MQNS2QFHJ1W21MK31FAP.pdf\",\"documents\\/01K0C5MQP3F7P1QKA8MS7F0A6T.pdf\"]', '[\"documents\\/01K0C5MQPRKA88STH84N2M05KK.pdf\"]', 'Unemployed', 'I have applied because I believe this is an important initiative and I would love to be a part of it. Our communities are in need of these community sessions and being a part of this work will not only help others but help me to be a better person. As a Christian, I am always looking for ways to serve my community and to help others. This feels like the right way to both be useful in society and to practice the values I hold deep in my heart. Growing up, I noticed the gap within our youth education , a gap that affected me as well. To be able to help and assist the youth will be as if I am helping the teenage version of myself become a better individual who is prepared to be an adult. It is exciting to see the effort being put in our country to better equip the youth for our ever changing world. ', 'No', NULL, 'None', 'No', NULL, '2025-07-17 16:27:12', '2025-07-17 16:27:12'),
(576, 1023, '[\"documents\\/01K0C5W10JSNVNMS509XJN898Y.webp\"]', '[\"documents\\/01K0C5W10PP2TWX4KTEE6FJYYS.docx\"]', 'Unemployed', 'I have applied because I like working with young people and bringing up new ideas that contribute in mental health and social growth. \nI believe I am the best candidate for this job, because I will be able to work with young people in bringing up ideas on different projects that will promote conservation and sustainable living considering the changes on the weather conditions, also help them understand the importance of protecting our land for future generations. \nI believe I\'ll also be able to encourage young people to be involved and also participate in communities to make a positive impact and also advise them to have access to education and mentorship in order to develop more skills and make informed decisions. \nI would also love to provide mental health support by creating a safe space for young people to discuss their struggles and concerns.', 'Yes', 'Youth Sustainable Development Centre ', 'I was working on the Global Campaign Equal Nationality Rights(GCENR), where I was advocating for affected people through activations and social media. I also got a chance to teach young people about SDG 5 and 10, which is Gender Equality and Reduced Inequalities. We helped other young people who were affected and those who knew people that were affected in all four regions, and different Tinkhundla.', 'Yes', NULL, '2025-07-17 16:31:11', '2025-07-17 16:31:11'),
(577, 1024, '[\"documents\\/01K0C64QQQR5RCQE1WFKADDGTA.jpg\"]', '[\"documents\\/01K0C64QQT2C4QEBVA3NHN72X0.pdf\"]', 'Unemployed', 'I applied to be a mindset change trainer because I believe that mindset plays a crucial role in personal development and overall well-being. My psychosocial support certificate has provided me with a strong foundation in understanding the complexities of human behavior and the factors that influence our thoughts and emotions. I’m passionate about helping individuals realize their potential and overcome barriers that may hold them back.\n\nHaving developed skills such as active listening, empathy, and effective communication through my training, I feel equipped to guide others in their journey toward a more positive mindset. I’ve experienced firsthand the transformative power of changing one’s perspective, and I’m eager to share these insights and techniques with others.', 'No', 'None', 'None ', 'Yes', NULL, '2025-07-17 16:35:56', '2025-07-17 16:35:56'),
(578, 1025, '[\"documents\\/01K0C6DPFF5XA08W7N0HAAMN4N.jpg\"]', '[\"documents\\/01K0C6DPFYZRW4RYF8ZKNFH31T.pdf\"]', 'Unemployed', 'I applied because I am eager to be peer mentor and educator. Besides having academic knowledge as an advantage the experience i have gained from working with other organizations makes me the best candidate as i will be able to apply it where needed.I understand how social systems work, I am the best candidate because the course I am doing enabled me to understand human behavior. Also I am passionate on helping our youth achieve its highest goals. Lastly the love for peer education enables my strengths of flexibility, team work and empathy. I am eager to learn and quick at adapting and doing a taught job. ', 'Yes', 'Taiwan Fund for Children and Families ', 'I provided assistance with educational difficulties or challenges they faced. Acted as a role model motivating them to focus on education in order to be able to be accepted in higher institutions and achieve their goals. Also I provided psychological and psychosocial services to them in cases of need.', 'No', NULL, '2025-07-17 16:40:50', '2025-07-17 16:48:18'),
(579, 1026, '[\"documents\\/01K0C6FN70T0JRPPNEZ98Z1KSS.pdf\",\"documents\\/01K0C6FN77XHEFF2EN3SYBED1Q.pdf\"]', '[\"documents\\/01K0C8SYF1JWXKWPNZFFEF092F.pdf\"]', 'Unemployed', 'As a Chief Brother and mentor in my community, I have long been dedicated to guiding and shaping the mindset of our youth. I have applied for the Youth Mindset Change Trainer Programme because I believe that meaningful change begins with the mind and it must be led by those who understand the cultural, social, and emotional realities of young people today.\n\nOur youth are facing challenges unlike any previous generation ranging from identity crises to peer pressure, unemployment, and exposure to harmful influences. I see firsthand how these issues affect their choices, behaviors, and futures. My role has always been to listen, guide, and support them, but I recognize that new methods, tools, and professional approaches are essential in this rapidly changing world. This programme will equip me with those tools, allowing me to combine traditional wisdom with modern training techniques.\n\nI am the best candidate for this opportunity because I bring both lived experience and leadership. I have already built trust within the youth community, and I understand the local context, language, and values. I don’t just speak to the youth I speak with them, and they listen because they know I care. With the training from this programme, I will become even more effective, multiplying the impact within my circles and beyond.\n\nUltimately, I believe that transforming mindsets is about empathy, trust, and vision. I already have the heart and the hands for this mission, this programme will give me the sharper tools. That’s why I’ve applied.', 'Yes', 'Peace Corps Eswatini', 'Facilitated workshops focused on effective communication, conflict resolution, and relationship building for parents and teens.', 'Yes', NULL, '2025-07-17 16:41:54', '2025-07-17 17:22:28'),
(594, 1040, '[\"documents\\/01K0C8TDMJKY6H197E9Y9NY36T.jpg\",\"documents\\/01K0C8TDMNMF4XX4ZRAK1D4NCM.jpg\",\"documents\\/01K0C8TDMR5FTC56NNE0AT5T9W.jpg\"]', '[\"documents\\/01K0C8TDMWR8XMDCP1VKKWQGDD.jpg\"]', 'Unemployed', 'I have seen this as an opportunity for me to grow and be able to mentor and empower other young people in our communities. My experience under World Vision had taught me how to work in collaboration with other people to bring positive change. I also have strong communication skills. I am a hard worker, a good team player and am always eager to learn new things', 'Yes', 'World Vision ', 'I worked as a life mentor to adolescents girls and young women. I provided them with HIV, violence prevention and mental health sessions through group sessions and one on one sessions. Also, I referred them to health facilities to access SRH services. I referred out of school young women to business mentors where they got knowledge on how to become economically independent.', 'Yes', NULL, '2025-07-17 17:22:44', '2025-07-17 17:22:44'),
(580, 1027, '[\"documents\\/01K0C6HNBZ746BDPTGG9PW1YCH.jpg\"]', '[\"documents\\/01K0C6HNC8PDSFFCQKR9SRAN76.pdf\"]', 'Unemployed', 'I have applied for the job because of the benefits I stand to gain because I believe I will gain leadership and communication skills as the program is a mindset change hence I’ll develop leadership qualities such as  teamwork and  communication. As a result, certain dynamics on how I think, see things will change as I will be able to identify various aspects of life which are crucial for success. In addition, I would like to achieve Personal development and empowerment through growth mindset as certain  that  i will learn how to identify opportunities for growth and embrace challenges. so I’ll be able to learn and improve in different aspects. Moreover, I will be able to impact the community through community engagement as the  skills and knowledge I will learn  will empower young people hence contribute to positive change. \nI am the best candidate for the job because the youth mindset change training program will empower  me with the skills and confidence to overcome challenges as a result i can contribute to the community and also,  gain personal and professional growth. Which will enable me to have a positive approach to learning and problem-solving. Hence, develop a growth mindset.\n', 'No', 'None ', 'None', 'Yes', NULL, '2025-07-17 16:43:00', '2025-07-17 16:43:00'),
(581, 1028, '[\"documents\\/01K0C6V83N3D7HZG3BMQFJ0SB4.pdf\"]', '[\"documents\\/01K0C6V843H6TZT8CDNDT48WPB.docx\"]', 'Unemployed', 'I am excited to apply for the Youth Mindset Change Trainer Programme because I strongly believe in the power of education and community development. With a recently completed Certificate in Adult Education from the University of Eswatini, I have gained valuable skills that I am eager to apply in fostering positive mindset changes within communities. Although I do not hold a formal qualification in community development, my educational background has equipped me with the necessary tools to contribute effectively to this initiative.\n\nMy training in Adult Education has provided me with a deep understanding of community dynamics, learning theories, and methods that facilitate personal and communal growth. I believe that mindset change is at the core of addressing the challenges faced by young people in our communities, and I am passionate about using education as a tool for positive transformation. Through my studies, I have developed an understanding of how to engage with diverse groups, assess their needs, and design programs that address those needs in a practical and impactful way.\n\nAdditionally, I have experience in community-based work through my studies, which involved conducting needs assessments, facilitating discussions, and strategizing ways to close gaps in education and personal development. I have learned how to communicate with people from different backgrounds, listen actively, and foster an environment of trust and respect, which I believe are key components to the success of this program.\n\nMoreover, I am proficient in Microsoft Office, which allows me to manage data, prepare reports, and create materials for community training sessions efficiently. This proficiency will enable me to effectively support the logistical and organizational aspects of the program while ensuring the seamless delivery of training content.\n\nMy passion for community work, coupled with my educational background, makes me an ideal candidate for this position. I have demonstrated the ability to work with young people, especially in educational settings, and I am committed to the entire training process. I understand the importance of consistency, dedication, and resilience in achieving meaningful results in any community project. I am confident that my skills and experiences will allow me to contribute positively to the Youth Mindset Change Trainer Programme.\n\nFurthermore, my ability to connect with young people from diverse backgrounds aligns with the objectives of the program. I am eager to create a lasting impact on the youth in Eswatini by fostering self-awareness, growth, and empowerment, helping them realize their potential and become catalysts for positive change in their communities.\n\nI look forward to the opportunity to contribute my skills and knowledge to this impactful program and to grow as a trainer and community advocate.', 'No', 'None ', 'None ', 'Yes', NULL, '2025-07-17 16:48:14', '2025-07-17 16:48:14'),
(582, 1029, '[\"documents\\/01K0C6XMZ90WGZZQ86J2R90747.jpeg\",\"documents\\/01K0CKY03XBCE2T1TXMNTZMA0N.jpg\",\"documents\\/01K0CKY042AD7N6EA8V5NFJ3YW.jpg\"]', '[\"documents\\/01K0C6XMZBBYFGZZNEVT4JPJV2.docx\"]', 'Unemployed', 'I applied because I am passionate about helping young people develop a positive mindset that can change their lives. I believe I am the best candidate because I have 2 years of experience mentoring and supporting youth on HIV prevention, mental health, and life skills. I have also conducted community outreach, health education programs, and facilitated workshops on business management and personal development. ', 'Yes', 'Young Heroes ', 'October 2023 – January 2025\nMentored and supported young individuals on HIV prevention, mental health, and life skills.\nConducted community outreach and health education programs.\nFacilitated workshops on business management and personal development\n', 'Yes', NULL, '2025-07-17 16:49:33', '2025-07-17 20:36:56'),
(583, 165, '[\"documents\\/01K0C6XWNAPWTE9MXB2N0FMQTE.pdf\",\"documents\\/01K0C6XWNE3Z40RF7JE76Y53A7.pdf\"]', '[\"documents\\/01K0C6XWNH4HQ7FR5Z4X0QSTYD.pdf\"]', 'Self-Employed', 'I have applied for this opportunity because I am passionate about inspiring and equipping young people to reach their full potential, especially in the area of mindset development. As a youth Christian leader since Form 4 through to tertiary level and into my current journey, I have consistently led and mentored peers in faith, discipline, and purpose-driven living. I believe a renewed mindset is the foundation for sustainable growth, especially among youth navigating social pressures, unemployment, and identity crises.\n\nMy experience as a young entrepreneur has shaped me into a resilient and solution-oriented individual. I have built a business from the ground up, serving real clients and solving real problems, which has sharpened my leadership, communication, and problem-solving skills. These experiences have given me practical insight into how belief systems affect performance, attitude, and achievement.\n\nAs a mindset trainer, I bring not just theory, but lived experience. I understand the fears and limiting beliefs many young people face because I’ve lived through them and overcome them. My background in leadership, faith, and entrepreneurship allows me to connect deeply and authentically with the youth, making me a relatable and effective trainer. I am committed to serving with integrity and excellence, and I believe I am the right candidate to positively impact this generation.', 'Yes', 'FLAS and LUSWETI AS PEER EDUCATOR UNDER MTN EDUCATOR ', 'I managed to convince young people of my community to discuss issues around young, like how to deal with peer prejudice stay focused. Moreover, discuss hard topics like dealing with teenage and unwanted pregnancy. ', 'Yes', NULL, '2025-07-17 16:49:41', '2025-07-17 16:49:41'),
(584, 1030, '[\"documents\\/01K0C6ZS9S3X6H2WTN098X20H8.jpg\",\"documents\\/01K0C6ZS9WVCCDRGEQV5H9ZTN9.jpg\"]', '[\"documents\\/01K0C6ZSA0BW8VAJ1ERSE15N76.png\",\"documents\\/01K0C6ZSA3E08W73HDE2DS4C5R.png\"]', 'Unemployed', 'Because I have been working with the youth and I have so much experience in working with them..Iam a patient person this job needs patience especially because we will be dealing with young people.I work so hard I make sure I reach all targets given to me on time .I can cooperate.I am able to compile data using a phone or paper.I always strive to give the best with my work .', 'Yes', 'FLAS andWorld Vision ', 'I was a community youth facilitator.i facilited stepping stone session to the youth..I focused on adolescent girls and young women..I mobilised,referer them to clinical services,give livehoods training where they started savings groups.', 'Yes', NULL, '2025-07-17 16:50:43', '2025-07-17 16:50:43'),
(585, 1031, '[\"documents\\/01K0C70E7TFK0TS9PZ03A559SB.jpg\",\"documents\\/01K0C70E7Z07N6C3TBSC5Z0PY2.jpg\"]', '[\"documents\\/01K0C70E83XKT9R19P62PNQ5X7.jpg\",\"documents\\/01K0C70E89YPJ275MQWEJ0RSFZ.jpg\",\"documents\\/01K0C70E8CRZFVABMCFMRFPWWY.jpg\"]', 'Unemployed', 'I believe I am the best candidate because the nature studies has prepared me for with the youth. I have applied because I have great passion to bring change to the youth, also willing to learn more on this project. ', 'Yes', 'Bantwana Innitiatives ', 'I was a life mentor, facilitating awareness on HIV/AIDS and GBV. Empowering adolescent girls and doing referrals to SRH services.', 'Yes', NULL, '2025-07-17 16:51:04', '2025-07-17 16:51:04'),
(586, 1032, '[\"documents\\/01K0C73PTVQ079XVZ3P4EG1008.pdf\"]', '[\"documents\\/01K0C73PTY2VXEQEGJT0Q17MSN.docx\"]', 'Self-Employed', 'I believe, the best candidate for this job because I have special connection with young people, I have a lot of experience working with them from different organisations to church camps and seminars as I am also a Youth Pastor. Other than my Associate Degree in Public Relations, I also have one in Theology which has taught us about dealing with youth of all kinds as we were taught on counselling, philosophy and technology.', 'Yes', 'Nhloso Likussasa Lelichakazile', 'I was responsible for facilitating workshop for youth which was basically teaching them personal development skills. I was teaching them to write the CVs and cover letters then I was also responsible for creating social media content for the organization.', 'No', NULL, '2025-07-17 16:52:51', '2025-07-17 16:52:51'),
(587, 1033, '[\"documents\\/01K0C76P96K8A7MNNNS3FHQF5J.pdf\"]', '[\"documents\\/01K0C76P9BFKAJBWR312VFMGAN.pdf\"]', 'Self-Employed', 'I want to get more practical experience which will be a great impact to my field of study. I want to exercise my communication skills as I angage myself with young people. I believe I am the best candidate for the job, as I will be sharing my experiences and knowledge to empower my peers to make positive changes in their lives and communities.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 16:54:29', '2025-07-17 16:54:29'),
(588, 1034, '[\"documents\\/01K0C77FKKQ7MBR75WC6C8FKM2.pdf\"]', '[\"documents\\/01K0C77FKNSPB4A9MY392V8Z7G.pdf\"]', 'Unemployed', 'I have applied for the Youth Mindset Trainer position because I am deeply passionate about youth empowerment and personal development. I believe that guiding young people to develop a strong, positive mindset is one of the most powerful ways to equip them for success in school, relationships, careers, and life. I want to be part of the solution that builds resilient, confident, and self-aware youth in our communities.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 16:54:55', '2025-07-17 16:54:55'),
(589, 1035, '[\"documents\\/01K0C7C49R0J89M2KSQB5WJBXX.jpg\"]', '[\"documents\\/01K0C7C49W575B0AT7T764GXVV.docx\"]', 'Unemployed', 'I\'m passionate about working with the youth and to make a meaningful impact in my community. I would like to help young people to develop positive mindset thus enhancing their personal growth and future opportunities.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 16:57:27', '2025-07-17 16:57:27'),
(590, 1036, '[\"documents\\/01K0C7JH7WHF03JGA97VGD9A6K.pdf\"]', '[\"documents\\/01K0C7JH7YG2DF2TR5748HGJRV.pdf\"]', 'Unemployed', 'I am applying for the Youth Mindset Change Trainer Programme because I believe in the power of youth to lead change when given the right mindset, tools, and support. Growing up in Eswatini, I’ve seen the many challenges young people face lack of direction, peer pressure, unemployment, and low self worth. I strongly believe that change starts in the mind, and by helping youth reshape how they think about themselves and their future, we can transform entire communities.\n\nThis programme stands out to me because of its focus on peer led, community based sessions. It creates a space for young people to inspire other young people, which I see as one of the most powerful forms of influence. I am passionate about being part of that process helping others discover their potential, build confidence, and make better choices.\n\nWhat makes me a strong candidate is my background, experience, and genuine desire to serve. I hold a degree in Medical Laboratory Sciences, which has helped me develop critical thinking, discipline, and an appreciation for community health. But more than that, I’ve actively volunteered in youth-centered spaces where I have led discussions, shared life skills, and mentored adolescents on real life issues affecting them.\n\nI have volunteered with the Ministry of Health on awareness campaign . Through these roles, I’ve worked with young people from different backgrounds helping them navigate topics like self esteem, mental health, and decision making. I’ve learned how to communicate with empathy, how to create a safe space, and how to lead by example.\n\nMy ability to connect with young people is something I take pride in. I don’t approach them with judgment, but rather with understanding and a willingness to listen. I am also respectful of community structures and understand the value of collaboration with local leaders and stakeholders. This helps ensure that any programme I’m part of is not only effective but also sustainable and inclusive.\n\nI am fully committed to attending all training sessions and to serving with consistency and professionalism. I see this opportunity not only as a chance to help others, but also to grow personally and build leadership skills that I can use long term. I want to be part of a network of young change makers who are driven by purpose and are ready to make a difference.\n\nIn conclusion, I have applied because I care deeply about the future of Eswatini’s youth. I want to contribute to a movement that promotes positive thinking, self-belief, and action. I believe I have the right mindset, experience, and dedication to represent the values of this programme and to inspire others along the way.\n', 'Yes', 'Ministry of Health Campaign Peer Educator (HIV Awareness )', 'As a peer educator under the Ministry of Health Campaign, l facilitated youth focused sessions on sexual and reproductive health, HIV awareness and mental wellness. I helped young people build self esteem, make informed health decisions, and access youth friendly services. Through open discussions and group activities, I created safe space for adolescents to express themselves and feel supported and comfortable.', 'Yes', NULL, '2025-07-17 17:00:57', '2025-07-17 17:00:57'),
(591, 1037, '[\"documents\\/01K0C7X91NNHWTSN0ZAK0W72VY.pdf\"]', '[\"documents\\/01K0C7X91XJ8NSBD5VKSHPV59J.pdf\"]', 'Unemployed', 'I am passionate about youth development and personal growth, and I believe that real change starts with the mind. I want to join the Youth Mindset Change Trainer Programme because I see it as a powerful platform to empower young people to think differently, overcome limiting beliefs, and unlock their full potential.\n\nAs someone who has witnessed the impact of negative mindsets — such as hopelessness, fear, and lack of vision — I want to be part of a movement that encourages positivity, resilience, and purpose among the youth. This programme will equip me with the skills, tools, and strategies to become a confident and effective trainer, enabling me to influence others and contribute to building a stronger, more empowered generation.\n\nAdditionally, I see this as an opportunity to grow personally and professionally. I am eager to learn from experienced mentors, engage with like-minded peers, and gain practical experience in facilitation and leadership.', 'Yes', 'Manzini Schools Health ', 'Taught about eating healthy and healthy lifestyle.\nTaught about sexual relationships and STIs.\nEncouraged them to have dreams and achieve their dreams. \nEncouraged them to unlock their full potential. ', 'Yes', NULL, '2025-07-17 17:06:49', '2025-07-17 17:06:49'),
(592, 1038, '[\"documents\\/01K0C87ZSRE5J8TA72621RY67A.jpg\"]', '[\"documents\\/01K0C87ZSVHAQB54NBXFVNXH28.pdf\"]', 'Employed', 'Why am i applying.\nI am excited to apply because i am passionate about empowering young people. i believe that my educational background and experience aligns perfectly with fostering change among young individuals. \n\nThe program presents a good opportunity to contribute to the development of our youth. I am drawn to the program\'s focus on facilitating transformative experiences in young people. i hope to leverage my skills and experiences on our youth to embrace positive values and make informed decisions. \n\nWhy i am the best candidate\ni have relevant experience in community engagement. i have successfully facilitated educational sessions on various topics. These sessions have allowed me to connect with diverse audiences and create an environment where participants feel comfortable sharing their experiences. I have played a vital role in community outreach programs aimed at improving the overall well-being. \n\nI also hold a bachelor\'s degree in Psychology which equipped me with the knowledge needed to understand the cognitive, emotional and social interactions that influence behavior.\n\nI have proven leadership and facilitating skills. More importantly my passion for youth Empowerment drives my desire to apply for this position. \n', 'No', 'none', 'i have facilitated educational sessions in Government schools focusing on issues such as addictions, mental health and stress management. i have helped young people understand the risk associated with substance use and the importance of mental health. this sessions created a safe space for open discussions, allowing young people to express their concerns and ask questions.\n\nI organized career guidance workshops to equip students with essential skills.\n\nConducting research on parenting styles and their effects on adolescent mental health informed parents about the impact of different parenting approaches on their children\'s emotional and their psychological well-being. \n\ni conducted one on one and group counselling sessions for young people experiencing mental health crisis or exhibiting externalizing behaviors. \n\ni have also guided young individuals in navigating the complexities of life challenges such as academic pressures, relationships issues, family dynamics, financial burden, psychological disorders, unemployment, negative coping mechanisms, personalities and identity struggles.', 'Yes', NULL, '2025-07-17 17:12:40', '2025-07-17 17:12:40'),
(593, 1039, '[\"documents\\/01K0C8GEBA74V0HZCASTPN8GYA.jpg\",\"documents\\/01K0C8GEBEFSD5G9FVDM44VMYG.jpg\"]', '[\"documents\\/01K0C8GEBJFG9BCHVHAPKWDW59.pdf\"]', 'Self-Employed', 'I applied because I am passionate about empowering young people and promoting positive change within communities. Being part of the Youth Action Movement has deepened my understanding of the challenges young people face, especially around mindset, behavior and decision-making. My motivation to apply for this programme stems from a strong desire to contribute meaningfully to the transformation of mindsets among young people in Eswatini. In my personal and professional journey, I have witnessed how limited mindsets, misinformation, peer pressure and lack of support can hinder the potential of youth. Many adolescents in our communities face challenges such as unemployment, teenage pregnancy, substance abuse and low self-esteem. These challenges often stem from negative social norms, a lack of positive role models and limited access to information and resources. I believe that through mindset change and peer education, we can begin to address these issues in a sustainable and impactful way.', 'Yes', 'Youth Action Movement ', 'As an active member of the Youth Action Movement, I have been involved in several youth-led initiatives focused on sexual reproductive health right, HIV prevention, gender equality and life skills education. This role has provided me with valuable experience in to peer education, facilitating group discussions, planning community outreach campaigns and supporting adolescents from various backgrounds. Through YAM, I have learned the importance of listening, empathy and creating safe spaces for young people to express themselves. I have also developed the ability to communicate effectively, organize youth sessions where we learned mostly about issues affecting the youth and skills to develop ourselves. ', 'No', NULL, '2025-07-17 17:17:17', '2025-07-17 17:17:17'),
(595, 1041, '[\"documents\\/01K0C8VYH4XV1Q1XJT451THPR6.pdf\"]', '[\"documents\\/01K0C8VYHC4XBBDPSJF7D9HET0.docx\",\"documents\\/01K0C8VYHKAMV8Z5CGP3FXBQJP.docx\"]', 'Unemployed', 'I am a young person who is passionate about making change and helping the youth hence the reason I also ventured into psychology because I want to create a safe space for them to be able to talk to someone who cares and values their feelings and existence. This job gives me the ideal platform to contribute to my community in a positive way and also to the young growing generation. As a young person who was also helped to be where i am today, i feel like this will be a great chance to do so.', 'Yes', 'YoungLife Eswatini', 'I coordinate and help during camps and weekly running of our clubs. I also offer guidance and counselling and also help them grow spiritually. I also head the department of leader care in the Hhohho region which is a department that focusses on the well being of every young person and also leaders we have.', 'Yes', NULL, '2025-07-17 17:23:34', '2025-07-17 17:23:34'),
(596, 1042, '[\"documents\\/01K0C8WM16VMVMP7R0VZ1FB307.jpg\"]', '[\"documents\\/01K0C8WM19G7MAZ29EDN2V494J.docx\"]', 'Unemployed', 'I am passionate and dedicated individual with a strong interest in youth development and I believe young people have the power to drive positive change in their communities. I am eager to be part of an organization that empowers and supports youth leadership. I understand the challenges and opportunities that our country faces, and I am committed to working with others to find innovative solutions. I believe that my strong work ethic, creativity and ability to work well in a team would make me a strong candidate for the Eswatini National Youth Council.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 17:23:56', '2025-07-17 17:23:56'),
(597, 1043, '[\"documents\\/01K0C91NN2Z9QHVZAM2NSQJHQ1.jpg\"]', '[\"documents\\/01K0C91NN7KEW0QT9PJGM5WE55.docx\"]', 'Unemployed', 'This is an opportunity for me to learn and gain more experience on working with the youth and to help them as well as myself have a Mindset Change.  I believe that l am capable of helping the youth and l am dedicated to helping them grow in their mental health journey. ', 'Yes', 'Eswatini World Vision', 'Had talks with the youth in communities and delivered food parcels to those in need', 'Yes', NULL, '2025-07-17 17:26:42', '2025-07-17 17:26:42'),
(598, 1044, '[\"documents\\/01K0C9807JDQWRHNH8QYE94QAQ.pdf\",\"documents\\/01K0C9807NP919V375W8DMWT1E.jpg\"]', '[\"documents\\/01K0C9807RY8DRMQWS334SYPS7.docx\"]', 'Unemployed', 'I have vast experience in peer education, I have great listening ability and highly equipped with ethical values , Iam highly motivated and always willing to work hard and do more', 'Yes', 'SANOP', 'Held sexual reproductive rights sessions, gave career guidance and motivational sessions as well as peer education and concilling', 'Yes', NULL, '2025-07-17 17:30:09', '2025-07-17 17:30:09'),
(599, 1045, '[\"documents\\/01K0C9Z0RWMNR5NFTBXEFFC8TJ.jpg\",\"documents\\/01K0C9Z0S4F7CTSA1DTTFTCSZS.jpg\",\"documents\\/01K0C9Z0S7543SBAE6W00RK37J.jpg\"]', '[\"documents\\/01K0C9Z0SS05BDYRDRS6RHEF34.pdf\"]', 'Unemployed', 'With years of experience in community development, youth empowerment, and health rights advocacy, I have seen firsthand that impactful leadership requires more than passion and skills — it requires a flexible, growth-oriented mindset. My professional journey has taken me through roles such as Programs Officer at IBoost Foundation, HIV Prevention Peer under the Ministry of Health LISTEN Project, and Peer Educator with SOS Children’s Village. These roles involved program design, community mobilization, stakeholder engagement, and capacity building for vulnerable communities in Eswatini. While I have gained technical skills in areas such as HIV prevention, gender-based violence advocacy, and mental health awareness, I recognize that these skills alone are not enough to address the complex, evolving challenges communities face today.\n\nThis is why applying for a mindset change programme is a strategic and necessary step in my personal and professional growth. Through my work, I have often encountered situations that required not just following established methods but thinking beyond them — creating new approaches to community engagement, adapting to resistance, and finding solutions in uncertain environments. A mindset change programme would help me intentionally develop this adaptability, equipping me with frameworks and tools to approach leadership, collaboration, and problem-solving in more innovative and effective ways.\n\nMoreover, I have learned that empowering others starts with how I lead and interact. As someone passionate about youth development and empowerment, having a mindset rooted in growth, resilience, and openness is essential for inspiring and guiding others. The mindset change programme would strengthen my leadership abilities, allowing me to mentor peers, design more responsive programmes, and support community members in navigating change themselves.', 'Yes', 'Ministry of Health LISTEN Project ', 'Over the years, I have contributed to community development and youth empowerment in Eswatini through roles in program coordination, HIV prevention, gender-based violence advocacy, and education. I’ve worked as a Programs Officer with IBoost Foundation, HIV Prevention Peer with the Ministry of Health LISTEN Project, Peer Educator with SOS Children’s Village, and Remedial Teacher, focusing on community engagement, SRHR, mental health awareness, and capacity building for young people and vulnerable groups. My work integrates leadership, research, and training skills aimed at promoting social justice, health rights, and community empowerment across Eswatini.', 'Yes', NULL, '2025-07-17 17:42:43', '2025-07-17 17:42:43'),
(600, 1046, '[\"documents\\/01K0CA5H3AZ2RRFZQ8X59VE3QJ.pdf\"]', '[\"documents\\/01K0CA5H3E3TPHTBTBXWTJRYCB.docx\"]', 'Unemployed', 'I am passionate about helping young people grow , think positively and realize their potential. I also have strong and good commitment and Interpersonal skills. Lastly I am respected in the community, and I have shown consistent commitment through volunteer work and mentorship programs while at the University. ', 'No', 'None', 'I have guided young people through guidance and counseling and mentorship . I have learned how to address youth challenges and adress related issues. ', 'Yes', NULL, '2025-07-17 17:46:17', '2025-07-17 17:46:17'),
(601, 1047, '[\"documents\\/01K0CAHJFRCNCM023TFDXRVZQF.pdf\"]', '[\"documents\\/01K0CAHJFW5WD5C2B67QK1Z6JV.pdf\"]', 'Unemployed', 'I recently completed my Bachelors degree in Computer Science and I am eager to use my knowledge and skills that I have gained to contribute to positively impact another’s life. Although I have not worked with a youth-focused organization, I have been involved in youth-related work and empowerment in the past. In high school, I served as a Head Girl and President of the Environmental Club. In University, I was a member of the cybersecurity club and IEEE BIUST branch. Recently, I became a fellow for the WomEng Southern Africa Fellowship 2025. I believe these experiences have helped shaped the person I am today. Through them I gained and enhanced my ability to work with others, communication skills, public speaking skills and leadership skills. I believe that with the training to be provided matched with my existing skills, I will excel in the tasks and responsibilities that this role requires.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 17:52:51', '2025-07-17 17:52:51'),
(602, 1048, '[\"documents\\/01K0CAP4NE6KGD2YETXD74KZJ2.pdf\",\"documents\\/01K0CAP4NHBD89JBWREV386941.pdf\",\"documents\\/01K0CAP4NMW8GBKDBVQ35R91QE.pdf\"]', '[\"documents\\/01K0CAP4NRMDG6PX9WYGHVHA9S.pdf\"]', 'Unemployed', 'I am excited to apply for the Youth Mindset Change Trainer Programme because I am passionate about youth empowerment and committed to making a difference in my community. As a psychology graduate with experience working with young people and families, I understand the challenges many face and the power of mindset change in overcoming them. I have a natural ability to connect with people from diverse backgrounds and am already recognized as a trusted and supportive figure in my community. I am fully committed to completing the training and using my knowledge and passion to lead meaningful and transformative sessions. I believe this programme is the perfect opportunity to deepen my impact and help others realise their full potential.', 'No', NULL, 'None ', 'Yes', NULL, '2025-07-17 17:55:21', '2025-07-17 17:55:21'),
(603, 1049, '[\"documents\\/01K0CARTHJNZBENJ6FZMCB7RD7.pdf\",\"documents\\/01K0CARTHP1WHR04VF3VX7RJST.pdf\"]', '[\"documents\\/01K0CARTHVST40EP567Z0JPS47.pdf\"]', 'Unemployed', 'Self development is the main drive towards exploring this great opportunity of learning from the experienced and developing new skills. With limited opportunities across societies in the world , such a platform will not only help me achieving my mid-term life goals it will also assist me improve my social networking skills with different stakeholder in the world around me.', 'Yes', 'Taiwan Fund for Children and Families  and Vulamasango Juvenile Facility ', 'In my previous role I worked closely with  students who were sponsored by the organization in an after school program,where helped them with academic related issues, peer support and individual counseling sessions. In addition,  I had the privilege of also working closely with incarcerated juveniles and youth where I facilitated worked close with families, individuals by providing counseling and Substance abuse support groups sessions. Developed treatment plans.', 'Yes', NULL, '2025-07-17 17:56:49', '2025-07-17 17:56:49');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(604, 1050, '[\"documents\\/01K0CATGVJ0TWGCNE6CS7PGF3Z.jpg\",\"documents\\/01K0CATGVR6SGR1BEHJM6HMGBN.jpg\"]', '[\"documents\\/01K0CATGW09E0KQYSQMBS0XB94.docx\"]', 'Unemployed', 'As a professional teacher, I believe I am a strong candidate for the role of a peer educator because my experience has equipped me with the necessary skills to effectively communicate, guide, and support others in their learning journeys. I have developed a deep understanding of diverse learning styles, allowing me to adapt my methods to meet the unique needs of each individual I work with.\n\nMy experience has taught me the importance of empathy and active listening. I’ve built meaningful relationships with people, providing not only academic support but also emotional encouragement. These interpersonal skills are vital when acting as a peer educator, where the role is as much about fostering trust and offering guidance as it is about teaching content.\n\nMy passion for continuous learning and growth ensures that I’m always seeking new ways to improve both my own knowledge and the way I support others. I thrive in collaborative environments, and as a peer educator, I would work to create a space where everyone feels valued, respected, and motivated to succeed. This combination of teaching experience, adaptability, and commitment to mentorship makes me confident that I can effectively serve as a peer educator and positively impact those I support.\n\n\n\n\n\n', 'No', 'None', 'I have worked as a volunteer in a local School (Ethembeni high school) to relieve workload for the agriculture teacher who was alone teaching agriculture the whole school. Created a learning friendly environment for the learners as the had quality time to learn in a collaborative and hands-on environment engaging all learners and responding to their special needs for a positive academic feedback which was accomplished. ', 'Yes', NULL, '2025-07-17 17:57:44', '2025-07-17 17:57:44'),
(605, 1051, '[\"documents\\/01K0CAV3JEN99ZBX3BX7B6A5QV.pdf\"]', '[\"documents\\/01K0CAV3JH7QGD8HJ1R7286ZKB.pdf\"]', 'Unemployed', 'Because I am a hard and dedicated worker who is looking for personal growth and willingness to learn new things.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 17:58:04', '2025-07-17 17:58:04'),
(606, 1052, '[\"documents\\/01K0CAW9WE3GMQHP2YP17ANDY0.docx\"]', '[\"documents\\/01K0CAW9WMQ78EVSYKMYC8EZ0Z.docx\"]', 'Unemployed', 'I have prepared for this for a long time I am well equipped. I am inspired by people who are able to be part of of change and wellness for the youth, I believe in innovation and change mentally and physically. I am grateful to be even in the running for such a great opportunity. This is an opportunity to grow and to be the change I want to see in young people. A job that involves impact is a job worth having it also contributes to the service you have to give as a child of God. Thank you ENYC, for the lovely opportunity. Not only the youth is in my heart I am also working with the community living with special needs as my own father is 98% visually impaired now , so this opportunity I belive will teach me more and expand my network. ', 'Yes', 'Mind Food & Soul Organisation Founded By Nelton Mondlane', 'Under the leadership of our founder our aim is to put young people on a path of mindset shift to overcome environmental issues and challenges. We do this using our four pillars Spirituality, Health, Wealth and Relationships. We want to an enhance an individual\'s way of viewing and living life. My duties are Programs officer. we do community outreach and educate through seminars so I am trained in events coordinating. And through my qualifications we are trying to educate the elderly to more Tech Savvy.', 'No', NULL, '2025-07-17 17:58:43', '2025-07-17 17:58:43'),
(607, 1053, '[\"documents\\/01K0CB30HT9Y2A9NWRAW7D30MX.jpg\"]', '[\"documents\\/01K0CB30HWJFJ37ZRAS0MCCXKZ.docx\"]', 'Unemployed', 'I am a qualified young lady that have been working with young women for the past 4 years. I can serve as a bridge between the organisation and community. ', 'Yes', 'AMICAALL- ESWATINI', 'Empowering the young women and adolescents girls in business mentorship and skills training.', 'Yes', NULL, '2025-07-17 18:02:23', '2025-07-17 18:02:23'),
(608, 1054, '[\"documents\\/01K0CBDQ7HA5WM6WJE0W029DKZ.jpg\"]', '[\"documents\\/01K0CBDQ7R01P4B5D8EWWWDYW9.png\"]', 'Unemployed', 'I have the best understing of what this country needs, which is the youths with fresh minds and better understanding of the technology we are having in this century.', 'Yes', 'African Tourism Board ', 'The organisation\'s main focus was on tertiary youth and youth on rural areas on protecting the environment and Natural which is the swazi prade and which attracts most tourist in the country and community based tourism.', 'Yes', NULL, '2025-07-17 18:08:14', '2025-07-17 18:08:14'),
(609, 1055, '[\"documents\\/01K0CBME1HK1F278DSZNP0QK91.jpg\"]', '[\"documents\\/01K0CBME1T11V24WRN2Y9M8MQ7.jpg\"]', 'Unemployed', 'I applied to be empowered through the training and also share the knowledge and experience with my fellow youth.i have good communication skills and loyalty ', 'Yes', 'Bantwana and World Vision ', 'I was a life mentor on hiv prevention project working with adolescent girls and young women empowering them on life issues and business minded', 'Yes', NULL, '2025-07-17 18:11:54', '2025-07-17 18:11:54'),
(610, 1056, '[\"documents\\/01K0CC06C5X4RA1JNQHB0GJYCG.jpg\"]', '[\"documents\\/01K0CC06CA61QBB9D5TF5D95RW.docx\"]', 'Unemployed', 'I have applied. Because  I am eager to learn,grow and  contribute positively to my community. I am committed,responsible,and willing to work hard. My ability to connect with others especially the youth,and my dedication to creating positive change make me a strong candidate for this opportunity. ', 'Yes', 'CABRINI MINISTERIES', 'I help many youth on starting saving groups in the community ', 'Yes', NULL, '2025-07-17 18:18:19', '2025-07-17 18:18:19'),
(611, 1057, '[\"documents\\/01K0CC8KMXB2NVZG1M35WFNQ39.pdf\",\"documents\\/01K0CC8KN1B86PS6VQXPBV1ABQ.pdf\"]', '[\"documents\\/01K0CC8KN41MDNKNCX8HYP7D84.pdf\"]', 'Unemployed', 'Want to gain more knowledge to equip myself as a young person to bring innovative ideas and solutions in any organisation in the country', 'Yes', 'Enectus Eswatini', 'I was part of the  farm strawberries project that we initiated in 2023', 'Yes', NULL, '2025-07-17 18:22:55', '2025-07-17 18:22:55'),
(612, 1058, '[\"documents\\/01K0CCFGEAV2Z2D12GQZFSTEVJ.jpg\"]', '[\"documents\\/01K0CCFGEENBWQ41M1ZY5BVRXN.pdf\"]', 'Unemployed', 'Although,  I don\'t have a formal work experience, I believe I am a great candidate for this role because I am a fast learner with a strong work ethic . I have developed good communication and team work school projects.  I am confident I can quickly learn and contribute to your team .', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 18:26:41', '2025-07-17 18:26:41'),
(613, 1059, '[\"documents\\/01K0CCWZ4GDGPT8QGMJTSRXGJ8.pdf\",\"documents\\/01K0CCWZ4JJWMY3JZAM190TM91.pdf\"]', '[\"documents\\/01K0CCWZ4NMHTZ8Q11SA9NZNKA.docx\"]', 'Unemployed', 'I am passionate about making a difference in the lives of young people and helping them discover their voice and potential.  By joining your organization which empoweres  young people, I hope to contribute meaningfully to programs that uplift,  educate and inspire young people to become leaders and changemakers in their communities, whilst also gaining skills and experience myself. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 18:34:02', '2025-07-17 18:34:02'),
(614, 1060, '[\"documents\\/01K0CD1R3S991FMAKHKBSNRESM.jpg\",\"documents\\/01K0CD1R3V01FWCVNQPRC7DMEY.pdf\"]', '[\"documents\\/01K0CD1R3Y188YHWWRGRFC0WD0.jpg\"]', 'Unemployed', 'I saw this as an opportunity to grow personally and professionally while improving the lives of the youth and therefore the community. \n\nMy background in mental health nursing has equipped me with knowledge and skills that align well with this role.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 18:36:38', '2025-07-17 18:36:38'),
(615, 1061, '[\"documents\\/01K0CD40DQ6AZ28N67A2NC7M2A.pdf\"]', '[\"documents\\/01K0CD40DVVE2S33RFEB5GXAVG.pdf\"]', 'Unemployed', 'I strive to bring about holistic social change by impacting lives of young people, this is a great opportunity to give back to the community through my serventhood spirit. I am passionate to work with adolescents to spearhead the fight against social and health ills. I believe my skills, proven strong work ethic and willingness to learn align with the specifications\n to make a great impact on this role. Having worked with adolescents inclusive groups in the health fraternity, I believe my experience and work ethic is ideal for this role. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 18:37:52', '2025-07-17 18:37:52'),
(616, 1062, '[\"documents\\/01K0CD535TRDW2YF0K0422SWDM.pdf\"]', '[\"documents\\/01K0CD535XVWB7M03Q3BTX9DMB.pdf\"]', 'Employed', 'I am passionate about personal growth, community empowerment, and creating meaningful change—especially among young people. Joining the ENYC Youth Development Program aligns perfectly with my vision of becoming a well-equipped leader who can inspire others and contribute positively to society.\n\nThrough my involvement in church youth programs, I’ve seen firsthand how mentorship, training, and collaboration can transform lives. I believe ENYC offers a unique opportunity to deepen that impact by providing structured development, exposure to new ideas, and access to a network of like-minded individuals.\n\nI am particularly drawn to ENYC’s commitment to nurturing leadership, promoting civic engagement, and fostering innovation. I want to be part of a movement that not only uplifts individuals but also strengthens communities. By joining this program, I hope to gain the tools, knowledge, and support needed to amplify my efforts—whether it’s through education, youth mentorship, or community initiatives.\n\nUltimately, I see this as a stepping stone toward becoming a more effective agent of change, and I’m excited to grow alongside others who share the same passion and purpose.\n', 'Yes', 'Free Evangelical Assemblies', 'In a church, we participate in various youth programs that empower young people spiritually, emotionally, and socially. These initiatives often include mentorship sessions, leadership training, community outreach, and creative arts like drama, music, and spoken word. Through these programs, young people discover their purpose, build confidence, and develop a sense of responsibility toward their communities.', 'No', NULL, '2025-07-17 18:38:28', '2025-07-17 18:38:28'),
(617, 1063, '[\"documents\\/01K0CD7DZ7WXAHNR6BHQKKS7MC.pdf\",\"documents\\/01K0CD7DZEHNB9C7SC8N5GN0JE.pdf\",\"documents\\/01K0CD7DZKSNKHVJDMDAJSRBQG.pdf\"]', '[\"documents\\/01K0CD7DZR5ND62STVG2Z0F7ZX.pdf\"]', 'Unemployed', 'As a young person, studying Social work has made me aware of all social problems that may hinder a persons growth, function and productivity towards their own growth and to the economy at large. I have realized that young people need guidance and also a sense of belonging so that they may believe in themselves and thrive in life. I believe I can provide guidance to young people mentally, psychologically and socially preparing them for their progressive future.', 'Yes', 'Young Heroes/ AMICAALL ', 'I have worked with Young Heroes and AMICAALL as the DREAMS project representative/ Peer educator. It was my duty to link adolescent girls for project enrollment, and making sure that after enrolling they attended weekly sessions discussing; Sexual reproductive health rights, HIV prevention, business mantorship and issues of genders based violence.\n\nI had also been fully involved community leadership engagements sessions with community leaders in Mbabane West and East Tinkhundla. Engaging leaders ( bandlancane) on their local community social problems. Working with the community leadership engagement officer we were able to help leaders develop action plans after identifying social problems within their communities.\n\nI was also responsible for reporting any suspected case of gender based violence in the community.', 'Yes', NULL, '2025-07-17 18:39:45', '2025-07-17 18:39:45'),
(618, 1064, '[\"documents\\/01K0CDG96NS528JW01GKF9NDZN.pdf\"]', '[\"documents\\/01K0CDG96VBJJVV9Z150SSB62P.pdf\"]', 'Unemployed', 'Seeing a lot of young minds who are unemployed makes me wonder and imagine that this great minds can do something great, or creative such as handcraft. They can make this items sell them, and get money to buy food and whatever necessities that they might be in need of. So, I can come up with business ideas to help young people do and be able to survive.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 18:44:35', '2025-07-17 18:44:35'),
(619, 1065, '[\"documents\\/01K0CDR92AR349T6QQNA7BPGT1.jpg\"]', '[\"documents\\/01K0CDR92C427PFY70GHWWW9Z8.docx\"]', 'Unemployed', 'I am looking forward for an opportunity to experience what I\'m passionate about since I\'m a team member,humble and keen on a achieving new goals. I\'m the ideal candidate because I\'m selfless and able to adapt to new changes. ', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 18:48:57', '2025-07-17 18:48:57'),
(620, 1066, '[\"documents\\/01K0CDSXQFE8DWR1FKEH6F5BAD.jpeg\"]', '[\"documents\\/01K0CDSXQK2312WVN7Z41WK56F.docx\"]', 'Unemployed', 'In our fast-paced world, the capacity to adapt and welcome change has become crucial, not merely advantageous. As a trainer focused on fostering a growth mindset, I am excited about the chance to assist both individuals and organizations in developing the mindset needed to face challenges and unlock their maximum potential. My dedication to personal growth, along with my background in coaching and training, equips me uniquely to make a meaningful impact in this capacity.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 18:49:51', '2025-07-17 18:49:51'),
(621, 1067, '[\"documents\\/01K0CE4D51GM8A0VCZEEPPE2G4.pdf\"]', '[\"documents\\/01K0CE4D54ZHCNKABMDTTPCS1R.docx\"]', 'Unemployed', 'I have applied so that I may gain some work experience since I do not have any at the moment so this opportunity would help to be my stepping stone. I am the best candidate for the job because I am willing to work hard as well as learn a few skills along the way. I am also a very dedicated individual and I do put in the work. I also do well when in comes to team work.', 'No', 'None ', 'None', 'No', NULL, '2025-07-17 18:55:34', '2025-07-17 18:55:34'),
(622, 1068, '[\"documents\\/01K0CE6GK0629TTD8N6HVZPPPX.pdf\"]', '[\"documents\\/01K0CE6GK3EC21JK7BE7SH3ER9.pdf\"]', 'Employed', 'I have applied because I am a passionate young man with seven years of experience as a baker, which has not only honed my technical skills but also taught me the value of perseverance, creativity, and teamwork. My journey in the baking industry has equipped me with the ability to adapt and innovate. Through this training, I am deeply committed to making a positive impact in my community, particularly among the youth. I understand the challenges they face today and believe in the importance of fostering resilience and self-belief. By sharing my real-life experiences and insights, I aim to inspire and motivate young people to pursue their dreams and overcome obstacles, thus, I am eager to collaborate with others who share this vision and work towards uplifting our youth. ', 'No', 'N/A', 'None', 'Yes', NULL, '2025-07-17 18:56:43', '2025-07-17 18:56:43'),
(623, 1069, '[\"documents\\/01K0CEHEDK805EM6YM3H4R9DZB.jpg\"]', '[\"documents\\/01K0CEHEDRXAFGSP1R9G776XG6.pdf\"]', 'Unemployed', 'I believe that I can bring change to the youth out there. Willing to bring change and help every young person to achieve their dreams even if they have lost hope. I also wish to encourage every young person to start small businesses using the little they have and also speak out if they experience abuse whether it\'s in the family or in the community. ', 'Yes', 'Young heroes ', 'Mentoring young people females on how to take care of them and start businesses. \nHelping young ladies about hygiene. \nEducating young ladies.\nHIV prevention and GBV.', 'Yes', NULL, '2025-07-17 19:02:41', '2025-07-17 19:02:41'),
(624, 1070, '[\"documents\\/01K0CEWE18QBV1GKWZEXG9050G.pdf\"]', '[\"documents\\/01K0CEWE1C5XCX4PYKSV1RJM8X.pdf\"]', 'Unemployed', 'I am applying because I am passionate  about  youth empowerment  and I believe that mindset transformation is key to sustainable community development.  I hold a qualification in community development, am an active member  of the Eswatini MAB Youth Network  and I also serve on the  Community Development Committee  in my community, where I engage directly  with community structures and youth initiatives.  These roles have equipped  me with the skills, experience  and community trust needed to lead impactful change. I am fully committed to this programme and ready to contribute meaningfully to my community.', 'Yes', 'Eswatini MAB Youth Network', 'I am a volunteer,  I took part in engaging with other people ( youth) through activities such as clean up campaign, outreach campaigns and tree planting aimed at restoring the ecosystem.', 'Yes', NULL, '2025-07-17 19:08:41', '2025-07-17 19:08:41'),
(625, 1071, '[\"documents\\/01K0CF091YPD3Z1JA6MX5JYX7K.jpg\"]', '[\"documents\\/01K0CF0921DYAJQPX332T4F7JA.docx\"]', 'Unemployed', 'The reason I applied is because I want to gain more experience from this training. Upon gaining the experience I\'ll share it with my members when we hosted our monthly sessions. So generally,  I want to be inspired so that I can inspire others. Another reason is that I\'m currently working with the youth in my community, so I\'m familiar with what to expect when working with the youth.', 'Yes', 'AHF Young People\'s Program', 'So generally the program is aimed at changing the lives of the youth in my community, I am a youth ambassador,  my job is to identify young males who may need any kind of assistance and refer them to people who have the help. That is both health wise and monetary.', 'Yes', NULL, '2025-07-17 19:10:47', '2025-07-17 19:10:47'),
(626, 1072, '[\"documents\\/01K0CF25EBPCZEAQMSW1JHPDE7.jpg\",\"documents\\/01K0CF25EF706M7M98E1F4R0K9.jpg\",\"documents\\/01K0CF25EMBJMT6XE6XAY86BGF.jpg\"]', '[\"documents\\/01K0CF25ESJNV1R9A7J9DT8219.jpg\"]', 'Unemployed', 'With a Degree in Community Development, I have an understanding of community structures\nI have a background of working with adolescents and young people \nTo contribute to the development of young people from diverse backgrounds\nWith the experience I gained from my previous work, I can be a valuable asset to the organization\n\n', 'Yes', 'Eco Youth Engage - 2023', 'Contributed in community initiatives\nCollaborated in group projects to analyze social trends\nContributed in brainstorming sessions ', 'Yes', NULL, '2025-07-17 19:11:49', '2025-07-17 19:11:49'),
(627, 1073, '[\"documents\\/01K0CF57GXYEK672BZKC83SHPM.jpg\",\"documents\\/01K0CF57HAE8D05TJ0VETEZV1N.jpg\"]', '[\"documents\\/01K0CF57J036N13SWR12GAJY89.jpg\"]', 'Unemployed', 'I have applied for this job because i know i am the right person for this job, I am the best candidate because i am a passionate young lady, very hard working and a determined lady. I am a focused lady and very good at everything that i do, I have a teachers diploma and i did this course because i love working with youngsters. I believe in guiding and helping youngsters. I would be very delightful if you would consider me as the best candidate and i get the job', 'No', 'none', 'none', 'Yes', NULL, '2025-07-17 19:13:30', '2025-07-17 19:13:30'),
(628, 1074, '[\"documents\\/01K0CF8NXXM04C62YB9ENWHPZJ.pdf\"]', '[\"documents\\/01K0CF8NY4KZVJS4FTH4YDA6WM.pdf\"]', 'Employed', 'I have applied for this position because I am passionate about empowering young people and building strong, engaged communities. My experience as Chairman of the Youth Department in Eswatini, where I successfully led youth camps, conferences, and stakeholder engagement initiatives, has equipped me with practical leadership, planning, and communication skills needed for this role. I am committed, organised, and able to work well with diverse stakeholders to deliver results. I believe I am the best candidate for this job because I bring proven experience in youth engagement, strong teamwork and leadership skills, and a genuine dedication to serving and uplifting others through structured programs and initiatives.', 'Yes', 'Youth Department Eswatini', 'The Chairman of the Youth Department in Eswatini leads the department by overseeing its activities and ensuring alignment with its vision of empowering young people. The Chairman facilitates stakeholder engagement with churches, communities, and partners, and actively leads youth engagement through organizing and managing youth camps, conferences, and related programs. Key duties include providing leadership to the youth executive, coordinating planning and reporting, mentoring young leaders, and ensuring effective implementation of spiritual, social, and skills development initiatives within the youth department.', 'Yes', NULL, '2025-07-17 19:15:23', '2025-07-17 19:15:23'),
(629, 1075, '[\"documents\\/01K0CFCTZ6VTMVWEA1NMJDB2YF.jpg\"]', '[\"documents\\/01K0CFCTZG5FZJ8B1FVSF49B84.jpg\"]', 'Self-Employed', '*Why I Applied:*\n\nAs a passionate educator and life mentor, I applied for the Mindset Change Trainers of Adolescents program to leverage my skills and experience in empowering young people. I\'m driven by a desire to help adolescents develop a growth mindset, build resilience, and unlock their potential. This program aligns with my values and goals, and I\'m excited about the opportunity to make a positive impact.\n\n*Why I\'m the Best Candidate:*\n\n1. *Experience working with adolescents*: My experience as a teacher and life mentor has equipped me with the skills and knowledge to understand and support the unique needs of adolescents.\n2. *Passion for youth development*: I\'m passionate about empowering young people and helping them develop a growth mindset, self-awareness, and confidence.\n3. *Strong communication skills*: I possess excellent communication skills, which enable me to connect with adolescents, build trust, and facilitate meaningful discussions.\n4. *Empathy and understanding*: My experience has taught me to be empathetic and understanding, creating a safe and supportive environment for adolescents to explore their thoughts and feelings.\n5. *Commitment to positive impact*: I\'m committed to making a positive impact in the lives of adolescents, and I believe that this program will enable me to do so.\n\nBy combining my experience, passion, and skills, I\'m confident that I can be an effective Mindset Change Trainer and make a meaningful difference in the lives of adolescents.', 'Yes', 'Cabrini Ministries ', '\nBy serving as a Life Mentor at Cabrini Ministries, I had the privilege of making a positive impact in the lives of adolescents, empowering them to reach their full potential and achieve their goals.', 'Yes', NULL, '2025-07-17 19:17:39', '2025-07-17 19:17:39'),
(630, 1076, '[\"documents\\/01K0CFV0K44B7ZP7QJ2Z3AE1NR.jpg\",\"documents\\/01K0CFV0K9JBSZBEC8GSS4ZKYD.jpg\",\"documents\\/01K0CFV0KFHJ59C066KFNQMP9J.jpg\"]', '[\"documents\\/01K0CFV0KJKZ8SB38BNEFF6TW5.docx\"]', 'Unemployed', 'I believe I can be of great help to the children as I\'m at ease and used to working with children. I want to add a meaningful impact in shaping children\'s life for the better. This fits me because I\'m currently a youth leader thus I process knowledge, skills and experience with children. I am also eager to learn me so that I can transfer my knowledge to the local youth for the betterment of the community', 'Yes', 'Pasture Valley Children\'s Home', 'I was teaching young children the CBE curriculum. I organized games and carried out the games withon the children\'s home for all the children including adolescents. I also facilitated team talks and team buildings. I  am also a youth leader at Evangelical Church Ndingeni', 'Yes', NULL, '2025-07-17 19:25:23', '2025-07-17 19:25:23'),
(631, 1077, '[\"documents\\/01K0CFWP5PNQW19N827HCR7BJV.pdf\"]', '[\"documents\\/01K0CFWP61VG5MAZ29PRHQB0PS.pdf\"]', 'Unemployed', 'For me applying for this opportunity is to sharpen my skill of sewing. Due to the job scarcity in Eswatini, I have realised that enrolling on youth based organisations is vital since more young people are living life to the fullest with the help and knowledge as well as the equipments they get from such organisations. I want to change my life so I believe with the knowledge I have I am the best candidate for this position. I am smart, teachable, goal driven and a hardworking lady.', 'Yes', 'WITAD and Woman Farmer Foundation ', 'I am currently working on my business plan with the help of Woman Farmer Foundation. It opened my eyes to see and utilise opportunities.', 'No', NULL, '2025-07-17 19:26:18', '2025-07-17 19:26:18'),
(632, 1078, '[\"documents\\/01K0CFZFKR9BX849H8RB44FEGT.jpg\",\"documents\\/01K0CFZFKXW6NYWWKZJ2MQJM6J.jpg\"]', '[\"documents\\/01K0CFZFM5C149ZYBXZW8NPDFW.jpg\",\"documents\\/01K0CFZFM9VJ6QJ5XST8QX5ZAR.jpg\"]', 'Self-Employed', 'I am passionate about working with the youth in different communities.  Secondly I want to see our country being one of the developed countries because of us as youth developing skills that can make our country being good marketed in other countries because of us youth. Also I want to encourage youth to abstain from sexual and stop the drug ubuse and be encourage to bring positive change in our communities. \n\nI am the best candidate for the job ibecause I love working with different people of different backgrounds bringing positive change.  Secondly I am a good communicator and I learned communication skills and I have listened skills also I don\'t judge but I come up with positive solutions in cases. Lastly this job will help me gain more knowledge and skills as I am a psychology student who want to be a community psychologist. ', 'Yes', 'Red Cross organisation ', 'We were teaching about gender violence, how can you see if you are in an abusive relationship and telling them they need to report if one see someone being abused.\nI teacher the youth special the girl to learn to find something to do to earn a living that depending on man which is the cause of abuse most of the time. Moreover teaching he youth of different skills that can make money for the youth than to depend on government jobs.', 'Yes', NULL, '2025-07-17 19:27:50', '2025-07-17 19:27:50'),
(633, 1079, '[\"documents\\/01K0CFZFRBD4VF6S9ZABF2R86Q.pdf\"]', '[\"documents\\/01K0CFZFRGTAN8V7EVEEC25QFT.pdf\"]', 'Unemployed', 'I am very pertinent about the youth. As a young person i want to see the youth improve their society and the country in as far as sustainable development is concerned. ', 'Yes', 'Mhlatane high school', 'Teaching history and grography. And being their sports teacher. ', 'Yes', NULL, '2025-07-17 19:27:50', '2025-07-17 19:27:50'),
(634, 1080, '[\"documents\\/01K0CG76ZBRJ4QWK5593CKVMY3.pdf\"]', '[\"documents\\/01K0CG76ZFQBKKPW64M5B1G80S.pdf\"]', 'Unemployed', 'I am a dedicated Social worker professional with a strong passion for youth empowerment, equity and sustainable development in the community. I am excited to contribute to the organizations impactful work.\nMy academic background in Social Work combined with field experience in community work has equipped me with solid understanding in working with young persons, advocacy, community mobilization. I believe that working with young people requires inclusive planning, cultural sensitivity and strength based approach which these are the principles I have practiced during working in communities.\nI bring strong interpersonal communication skills, youth engagement, community mobilization and advocating for policies that favours young people to develop in all spheres of life. \nI am committed in making a positive difference in the lives of young people so that they reach their full potential.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 19:32:03', '2025-07-17 19:32:03'),
(635, 1081, '[\"documents\\/01K0CGGSEKSX929Z6NJDQ761SN.jpg\"]', '[\"documents\\/01K0CGGSEPQKHSE6EJCXBPNTZ0.doc\"]', 'Unemployed', 'Am much interested in changing lifes in the society and am the best candidate because l am an individual who put in the efforts when given a chance and also willing to learn and grow', 'No', 'None', 'I participate in community youth development programs like discovering youth with different talents', 'Yes', NULL, '2025-07-17 19:37:17', '2025-07-17 19:37:17'),
(636, 1082, '[\"documents\\/01K0CJAARX5HMSN055QGGV6RG5.pdf\"]', '[\"documents\\/01K0CJAASCFZARX9J7D1KPE1TW.pdf\"]', 'Unemployed', 'I am applying for the Youth Mindset Change Trainee Program because I believe deeply in the transformative power of mindset—particularly among young people. In a world marked by rapid change, economic uncertainty, and social challenges, it is crucial to cultivate resilient, proactive, and purpose-driven youth. This program aligns perfectly with my aspirations to become a catalyst for positive change in my community and beyond.\n\nGrowing up, I observed how limiting beliefs, lack of mentorship, and socio-economic pressures often prevented many talented young people from realizing their full potential. Despite having the capacity and ambition, they lacked the tools to reframe their thinking, take ownership of their future, and lead change in their own lives and communities. This awareness became a powerful motivator for me. I’ve come to understand that changing the way youth perceive themselves and their place in society is not just a nice ideal—it’s a necessary intervention. That’s what makes this program so meaningful to me.\n\nI consider myself an ideal candidate for this opportunity for several reasons:\n\n1. Passion for Youth Empowerment:\nOver the past few years, I have taken active steps to empower my peers and younger individuals. Whether through volunteering, mentoring, or participating in community-based initiatives, I’ve consistently sought to create spaces where young people feel seen, heard, and inspired to grow. I believe mindset change begins with intentional conversations and consistent modeling of positive behavior—something I practice both formally and informally in my daily life.\n\n2. A Growth-Oriented Mindset:\nI bring a growth mindset to this program. I value feedback, embrace challenges, and see failure as a necessary stepping stone toward progress. I am eager to learn from experienced facilitators, fellow trainees, and the communities we’ll engage with. I’m not afraid to unlearn limiting beliefs and stretch myself intellectually and emotionally. This quality will allow me to benefit fully from the training and also pass on its core principles with authenticity.\n\n3. Communication and Leadership Skills:\nI have strong interpersonal and communication skills, honed through school leadership roles, group facilitation, and public speaking opportunities. I understand how to communicate effectively with different audiences—especially youth—by using relatable language, empathy, and active listening. These skills are vital for encouraging mindset shifts, which often require patience, clarity, and trust-building.\n\n4. Commitment to Community Impact:\nBeyond personal development, my goal is to translate what I learn from this program into tangible change in my community. I have already identified key areas where mindset change is urgently needed—such as in education, employment readiness, gender equality, and mental well-being. I want to lead workshops, design peer mentorship initiatives, and advocate for more inclusive opportunities for youth development. This program would provide the knowledge, structure, and network to help me scale my impact.\n\n5. Alignment with Program Values:\nThe Youth Mindset Change Trainee Program embodies values that resonate deeply with me—integrity, innovation, resilience, and social responsibility. These are not just abstract ideals to me; they guide my actions daily. I believe in leading by example, adapting to new challenges with creativity, and always acting in the best interest of the community.\n\nIn conclusion, I am applying not just to learn, but to lead. I want to be part of a movement that redefines what young people believe is possible for themselves. I want to help shift mindsets from limitation to possibility, from dependency to self-determination, and from passive waiting to active creating. The Youth Mindset Change Trainee Program represents a vital step on that journey, and I am ready to contribute, grow, and make a lasting difference.', 'Yes', 'Ondiyaneni Disaster Risk Reduction.', 'As a member and Vice Chairman of the Disaster Risk Reduction (DRR) Committee in my community, I have actively championed youth inclusion and empowerment in disaster preparedness, response, and recovery. Recognizing that young people are not only vulnerable in times of disaster but also powerful agents of change, I focused my efforts on equipping them with knowledge, skills, and responsibilities that foster both safety and leadership.\n\nOne of my first initiatives was organizing community sensitization programs in schools and community meeting places, where I worked closely with local leaders and partners to educate young people on disaster risks, early warning systems, and basic emergency response. \n\nUnderstanding the importance of youth voices in decision-making, I advocated for youth representation in DRR planning meetings. I mentored young leaders to speak up during public forums, ensuring that youth perspectives were considered in local disaster preparedness strategies.\n\nTo this end, the youth is now part of the Disasaster Reduction Cooperative that has benefited E30 000.00 incentive from the Red Cross to start poverty alleviating programs.\n\nMy work in the DRR Committee has shown me the transformative potential of youth when they are empowered with the right tools and opportunities. I am proud to have contributed to building a more resilient, informed, and proactive generation in my community. I believe this experience aligns perfectly with the goals of the Youth Mindset Change Trainee Program and will enable me to further my impact.', 'Yes', NULL, '2025-07-17 20:08:43', '2025-07-17 20:08:43'),
(637, 1083, '[\"documents\\/01K0CJBB22PFCMW8C55A66Y46Y.jpg\"]', '[\"documents\\/01K0CJBB28229F812QB3G9R795.doc\"]', 'Unemployed', 'I am very passionate in working with the youth in the country.\nFor the past 9years working in Young Heroes makes me to understand the challenges the youth is facing in the country and with the experience i got while i was working under Young Heroes makes to be a suitable candidate for the job.\nI have been working in one of the most remote areas in my Inkhundla working with Young children, Young Women and Children living with HIV', 'Yes', 'Young Heroes', 'I have been working with adolescents and young women enrolling OVCs back to School.\nFacilitating teen clubs in all clinic under Siphocosini Inkhundla and provide children living with HIV social support.', 'Yes', NULL, '2025-07-17 20:09:16', '2025-07-17 20:09:16'),
(638, 1084, '[\"documents\\/01K0CJC2BQ3DDDZP14SBKPZKP4.pdf\"]', '[\"documents\\/01K0CJC2BWZND2TGWSGS078F2S.docx\"]', 'Unemployed', 'I believe I can help my community transform through innovation and entrepreneurship as I\'ve have seen firsthand. Through my life experiences and skills, I believe I can help change and inspire my fellow youth so we develop our community and the country at large.', 'Yes', 'Innovator\'s Association of Eswatini ', 'I was chosen to serve a secretary of the Association whereby am responsible for all communications, administrative and executive task. We help young entrepreneurs with a place to work from and their innovative ideas come to a reality.', 'Yes', NULL, '2025-07-17 20:09:39', '2025-07-17 20:09:39'),
(639, 1085, '[\"documents\\/01K0CKDAAGHSQ2DHP1DH6ZWKGW.jpg\"]', '[\"documents\\/01K0CKDAATKR23M2QXWCZEMNM7.pdf\",\"documents\\/01K0CKDAAZY22F2BB8HSK659C9.doc\"]', 'Unemployed', 'I applied for this only because I\'m also a young person and I want to see change in their lives. I once worked with AGYWs before when I was a Life mentor and recently worked as an SRHR advocate for SAFAIDS Eswatini under the Liphimbo Lami Project,  so basically I know how to talk with young people as I have a three years experience of facilitating them.', 'Yes', 'Bantwana Initiatives ', 'I was a Life Mentor under the Sabelo Sensha Project, under the category of HIV prevention ', 'Yes', NULL, '2025-07-17 20:27:49', '2025-07-17 20:27:49'),
(640, 1086, '[\"documents\\/01K0CKDFC7M67D8H0747X90W5E.jpg\",\"documents\\/01K0CKDFCAKGAJWRMTE3B4A405.jpg\"]', '[\"documents\\/01K0CKDFCEXBBJ60CJFZXSA25R.pdf\"]', 'Unemployed', 'I love working with the youth, I have an experience working with people and have also been a public speaking coach in various school. Besides being unemployed,it is my wish to be of positive impact in my country, community and many spaces that I may walk into. Furthermore, I wish and dream of being an inspiration to people of my society and further start my own NGO in future.', 'Yes', 'Super Buddies ', 'I started while in High School at Masundvwini High School where I was the chairman of the Super Buddies Club. After High School in 2014 I then became a peer educator where I attended the Care African Network (CAN) PTSD course on Accelerated Trauma ', 'Yes', NULL, '2025-07-17 20:27:54', '2025-07-17 20:27:54'),
(641, 1087, '[\"documents\\/01K0CKF8XVTWCRZB8NDZHFVP1J.pdf\"]', '[\"documents\\/01K0CKF8Y5AE5AN91GCBTXMVDZ.pdf\"]', 'Unemployed', 'I have had the opportunity of exposure on how to cooperate with people of different ages especially the young age.This experience coupled with my experience as a life skills facilitator will be key in ensuring success in the organization.I believe I could add value to the organization through implementation of skills acquired through working in the circumcision field and public service at large.My thirsty for helping the youth pursue their dreams.', 'Yes', 'Chaps Eswatini and Lihawu lesive ', 'Conduct education presentation on HIV measures for primary target males and females support the males in circumcision.Train and mentor peers on achieving their goals. Work with schools and community leaders in ensuring the youth gets the right information about life and it\'s challenges.', 'No', NULL, '2025-07-17 20:28:53', '2025-07-17 20:28:53'),
(642, 1088, '[\"documents\\/01K0CKYHA6TE7023AETE1C639H.pdf\"]', '[\"documents\\/01K0CKYHAC86Q6875SNTEC130V.pdf\"]', 'Unemployed', 'I am Passionate about empowering others through knowledge and have proven ability to communicate clearly and effectively. My experience in facilitating and public speaking makes me confident in leading and engaging diverse groups. I am adaptable, quick to learn and committed to delivering impactful training sessions. With Strong work ethic and genuine enthusiasm for development, I believe I can make a meaningful contribution to your team.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 20:37:13', '2025-07-17 20:37:13'),
(643, 1089, '[\"documents\\/01K0CKYNKSFYJVKK74NF5H47NZ.jpg\",\"documents\\/01K0CKYNKV08YRYWCDRCQTPSWC.jpg\"]', '[\"documents\\/01K0CKYNKXZA4M7GC8211Z347S.jpg\"]', 'Unemployed', 'I believe I will be able to mobilize the youth so that they get the knowledge that they need so that they achieve their goals. I am able to Influence the youth so that they come and learn whatever I want to teach them. Working for World Vision was an eye opener to me because I was able to identify young girls and boys who are abused and then assisted them. Working for EGPAF also played a vital role in making me understand the need for teenagers to learn more about HIV and AIDS and how to prevent it', 'Yes', 'World Vision', 'Working as a Prep Ambassador, assisting youth with prep, preventing spread of HIV and AIDS. Teaching youth on how to take care of themselves so that they become healthy citizens of the country and assist in raising the country\'s economy. I also worked for EGPAF where I was also teaching the youth on how to stop the spread of HIV and AIDS', 'Yes', NULL, '2025-07-17 20:37:18', '2025-07-17 20:37:18'),
(644, 1090, '[\"documents\\/01K0CM4VEV6XCVP4XF4GZVQ0N4.jpg\",\"documents\\/01K0CM4VF73Y83MC15S4GP0ZBK.jpg\",\"documents\\/01K0CM4VFJAQCTG1KPWTEZHXEP.jpg\"]', '[\"documents\\/01K0CM4VFXN7T7CZV7M6BCBH7N.jpg\"]', 'Unemployed', 'I apply because i like to spend time with teens and enjoying to give them lessons so that to be successful in future.i enjoyed if they came successful beause of my efford for example they became business women by helping them with starting business. I am selling perfumes to show them that you can make your own money than asking somone to help you. If they have their money no more sugar dads  teenagers pregnant decrease , Hiv decrease. GBV cases also decrease.I also like this job I put more efford to became successful and meets with targets. ', 'Yes', 'Compassionate eswatini and Bantwana initiative ', 'I mobilizing caregivers and teens for parenting sessions to teach them how parents deals with the behaviour of teens at home. \nI teached them lessons that can makes the differences at home for example spending time together with their teens so that they can bond if a teen faced with some challenges or something happened to her or him will be easy to  tell their parents without fear. \nI also teached them to save my money and to start business to improve the standard of living also to afford to buy some needs at home \nAfter parents and teens attended their lesson every thing change at home no coflicts always peace they know how to praise each other parents always calm no shouting at them.Teens report abuse cases without fear because the lessons opened their mind. Teenage pregnant decrease after the lessons. ', 'Yes', NULL, '2025-07-17 20:40:40', '2025-07-17 20:40:40'),
(645, 1091, '[\"documents\\/01K0CM525G5FEMX6KHKTQ83Z75.pdf\"]', '[\"documents\\/01K0CM525MPGCDZ9Q0CY95AK9D.pdf\"]', 'Unemployed', 'I am the best candidate for this job because I have the required skills and experience on working with young people and I have been involved in community projects where I had to deal with people from different age groups and backgrounds daily and it was a success. ', 'Yes', 'Georgetown University ', 'I educated young people to take care of their sexual and reproductive health and not be dependant on their sexual partners financially. ', 'Yes', NULL, '2025-07-17 20:40:47', '2025-07-17 20:40:47'),
(646, 1092, '[\"documents\\/01K0CN95V78K1D73JR11VGEMCA.jpg\"]', '[\"documents\\/01K0CN95VEN5XVDFTTQ4TX7E2C.png\"]', 'Unemployed', 'I am patient, reliable, dedicated candidate and willing to teach others ', 'Yes', 'Young Heroes ', '-Empower adolescent girls and young women with information, knowledge and skills \n-Ensuring adolescent girls stay in school \n-Reduce risk of HIV and other STI infection\n-Build agency of AGYW to champion their own cause\n-Psychosocial support for AGYW\n', 'Yes', NULL, '2025-07-17 21:00:30', '2025-07-17 21:00:30'),
