(648, 1094, '[\"documents\\/01K0CNCN9TVZY1W1VRPCNTNSEJ.pdf\"]', '[\"documents\\/01K0CNCNA4EYYHJ0G45VNGPPYH.pdf\"]', 'Unemployed', 'I applied for this programme because I believe in the power of mindset change as a foundation for personal growth and social development. I am passionate about helping young people unlock their potential, and I see this opportunity as a way to be trained, empowered, and equipped to inspire positive change in my community. Being part of this initiative will not only allow me to contribute meaningfully, but also grow as a leader and role model among my peers.', 'Yes', 'Lusweti Institute for Health Development Communication ', 'I was involved in mobilising teenagers in the community, teaching them about HIV and other related diseases. I also assisted them with self-testing kits by demonstrating how to use them correctly and answering their questions to ensure they understood the process.', 'Yes', NULL, '2025-07-17 21:02:25', '2025-07-17 21:02:25'),
(649, 1095, '[\"documents\\/01K0CNFWBXFJYTAC428R5W7K40.jpg\"]', '[\"documents\\/01K0CNFWC54517FPAJEKQ2FX3X.PDF\"]', 'Unemployed', 'I Nkosinathi mathabela  I applied because I worked as a peer educator at SOS Children\'s village  and I want to gain more experience ', 'Yes', 'SOS Children\'s village ', 'I help young people  a lot some able to pass their grades ', 'Yes', NULL, '2025-07-17 21:04:10', '2025-07-17 21:04:10'),
(650, 1096, '[\"documents\\/01K0CNQ37YHNWPH6KD89QW5P5D.pdf\"]', '[\"documents\\/01K0CNQ382GV60QDE90Z8GM649.pdf\"]', 'Unemployed', 'I applied because i have passion to work with people, i have customer service certificate which help me to deal and understand all kind of customer\'s or clients.  Am a good listener and good presenter, am team player, i speak and write both Siswati and English.\n\nGiven such opportunity will means a lot to me and i promise,  you won\'t regret it.  Looking forward to work with you', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 21:08:07', '2025-07-17 21:08:07'),
(651, 1097, '[\"documents\\/01K0CNR74F1KX5QKHCDXXZSTGE.pdf\"]', '[\"documents\\/01K0CNR74XKC24EZMK3YJHSASY.pdf\"]', 'Unemployed', 'I have been trained to work with teenagers as a qualified teacher who is currently unemployed. I believe I can equip young people to be useful individuals in the future, from the experience I have gained working with young people in high school and in my church I believe I be able to do the job.', 'No', NULL, 'I encourage young people in church spiritual, encouraging them to focus on education first and keeping themselves true, stay away from bad influence from friends and to abstain until marriage.', 'Yes', NULL, '2025-07-17 21:08:43', '2025-07-17 21:08:43'),
(652, 1098, '[\"documents\\/01K0CPMX68WV0K8PPW5FQV4MP5.jpg\"]', '[\"documents\\/01K0CPMX6NGD5ZYB4B5JX3PJ1H.png\"]', 'Unemployed', 'Am a dedicated and motivated lady to client that is why l want this position. I am energetic and friendly ', 'Yes', 'Baylor college of medicine children foundation eswatin ', 'I was community Expert client to providing adherence and psychosocial support services to people who are living with HIV ', 'Yes', NULL, '2025-07-17 21:24:23', '2025-07-17 21:24:23');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(653, 1099, '[\"documents\\/01K0CRKFE8CEN5AAAVZ24WZY7X.pdf\",\"documents\\/01K0CRKFEC83Y7VT7CTYHHGK5K.pdf\"]', '[\"documents\\/01K0CRKFEE1MHJWD7TGKWKM7NF.pdf\"]', 'Self-Employed', 'I have applied for this opportunity because I am passionate about contributing to meaningful work that uplifts communities, empowers young people, and drives positive change. Throughout my journey, I have dedicated myself to roles that focus on youth mentorship, community engagement, and mindset transformation. I firmly believe that young people, when given the right support and guidance, can become agents of change not only in their own lives but within their communities.\n\nWhat makes me the best candidate for this position is my hands-on experience in both youth development and customer-focused environments. I have successfully facilitated training programs that inspire self-confidence, entrepreneurship, and personal growth among youth from diverse backgrounds. My experience is not only theoretical; I have been on the ground, interacting directly with young people, understanding their struggles, and helping them turn their potential into real opportunities.\n\nIn addition, my background in sales, technical support, and customer service has strengthened my communication skills, problem-solving abilities, and professionalism in dealing with people from all walks of life. I am a natural motivator, a strong team player, and a reliable individual who brings both passion and results to any role I take on.\n\nUltimately, I am driven by the desire to make a difference, and I am confident that my skills, experience, and character align perfectly with the goals and values of this organization.', 'Yes', 'Inspirational Bliblical Approach ', 'Developed and delivered tailored training programs focused on helping young people identify and harness their unique talents to create sustainable income opportunities.\n\nOrganized and facilitated interactive workshops on personal development, leadership, financial literacy, and entrepreneurship, equipping participants with practical skills for real-life application.\n\nPromoted mindset transformation through motivational speaking, encouraging self-belief, resilience, and a growth mentality among youth from diverse social and economic backgrounds.\n\nProvided one-on-one mentorship and coaching, supporting individuals in setting realistic goals, overcoming personal challenges, and fostering long-term positive behavioral change.\n\nCollaborated with community leaders, organizations, and stakeholders to ensure alignment of training initiatives with broader youth development goals.\n\nDocumented success stories and participant progress to measure impact and refine future training content.', 'Yes', NULL, '2025-07-17 21:58:34', '2025-07-17 21:58:34'),
(654, 1100, '[\"documents\\/01K0CTJX50RFDXENTK1VS7JW9A.pdf\",\"documents\\/01K0CTJX5DZ90WQY06X4WGBGTS.pdf\"]', '[\"documents\\/01K0CTJX5GZR5X9F4YH6J51DGZ.pdf\"]', 'Self-Employed', 'I have equipped myself with more skills than the one I had 2017 while I was working for Girls Empowerment (SWAGAA)it has always been my dream to work with the youth,encourage and counsel them. We are living in a broken generation where young people are physically, emotionally and sexually abused and \nneeds people to assist in their rising. People who will believe in them and assist them to do the same. They also need someone who will advise them that they can achieve their dreams despite their background.  I believe I am that person to help the new generation to rise.', 'Yes', 'Girls empowerment SWAGAA', 'I was encouraging girls at Pigg\'s Peak High School on self-esteem/self awareness \n*To know themselves \n*To believe themselves \n*To love themselves ', 'Yes', NULL, '2025-07-17 22:33:12', '2025-07-17 22:41:59'),
(655, 1101, '[\"documents\\/01K0CVJ40TPJPV0Y3B5R3S6839.jpg\"]', '[\"documents\\/01K0CVJ419EVPF43C4TXTWAQT6.pdf\"]', 'Unemployed', 'As a passionate and dedicated individual with a strong commitment to empowering young people.I possess a unique blend of skills knowledge that can makes me an ideal candidate I also honed my communication and interpersonal skills which enable me to effective engage with young people.I am also driven by the belief in the potential of every young person to make a positive impact in their communities and the world at large,I am committed to supporting and empowering them to realize their full potential.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-17 22:50:15', '2025-07-17 22:50:15'),
(656, 1102, '[\"documents\\/01K0CVJYA8QGDD2YSAQA0C0AT2.pdf\",\"documents\\/01K0CVJYAC2MFDJC8SCGVCCQW4.pdf\"]', '[\"documents\\/01K0CVJYAG2ZYMC2G3Y05V7660.docx\"]', 'Unemployed', 'I believe I\'m the right candidate because I have experience on the kind of vacant post available and used in working with mostly young people and really passionate about everything I do.', 'Yes', 'Red Cross Society', 'I was mainly responsible for educating young people about life in general touching topics on HIV/AIDS. I also acted as a role model to some giving them raw truth about my life and consequences and lastly motivated them to become their best selves.', 'Yes', NULL, '2025-07-17 22:50:42', '2025-07-17 22:50:42'),
(657, 1103, '[\"documents\\/01K0CWM90M0EAFETY3CZ46KQRB.pdf\"]', '[\"documents\\/01K0CWM90YGQ7XN7QKK6RAZZ6X.docx\"]', 'Unemployed', 'I have excellent communication skills verbally and writing as well as listening.Inhave the ability to work under pressure and I can think on my feet.Given the opportunity I will apply myself diligently to task assigned.', 'Yes', 'Population Services International (PSI)', 'I was registing clients who had come for circumcision at the clinic.Prepare data room by organizing seating arrangement.Populate clients records into PSI electronic system.\n', 'Yes', NULL, '2025-07-17 23:08:54', '2025-07-17 23:08:54'),
(658, 1104, '[\"documents\\/01K0CX67KHDYFZWBN0ZE0QP2VN.\"]', '[\"documents\\/01K0CX67KNSXYHDK3K7CZ6FKTW.pdf\"]', 'Unemployed', 'I have applied because im more passionate about empowering the youth with knowledge and skills to make informed decisions about their lives.  I aim to create a supportive space for the youth as i have gained more experience in the organisations i have volunteered to. I\'m committed to fostering positive relationships and make impact in the community. I am thrilled about  the opportunity  as  i will be able to develop my own skills and knowledge as a peer educator. Working  with the youth from different backgrounds helped me to learn different traits. This opportunity  will not only benefit  my community  but it will enhance my personal growth  and develepment.', 'Yes', 'BAWSS Foundation ', 'We were donating sanitary pads to girls in schools in the community. We will educate about  behavior  and  also menstrual hygiene. I would also assist the girls with  challenges they face and help with counselling  and  also  do referrals for  counselling if a need arises.', 'Yes', NULL, '2025-07-17 23:18:43', '2025-07-17 23:18:43'),
(659, 1105, '[\"documents\\/01K0CXW5ZQJV6ZK60AERA4X2WB.pdf\",\"documents\\/01K0CXW5ZVW046A7XVWHC45N10.pdf\",\"documents\\/01K0CXW600G65A25E7YPZE5NYK.pdf\"]', '[\"documents\\/01K0CXW60X3GMQ5H3E0NR9YNSY.pdf\"]', 'Unemployed', 'I\'m excited to apply for the Peer Educator role, driven by my passion for empowering young people. Through mentoring and teaching, I\'ve developed strong communication skills, patience, and empathy. I believe my excellent interpersonal skills, passion for positive change, and commitment to inclusive learning environments make me an ideal candidate. I\'m confident my skills and experience will enable me to contribute to the team and positively impact young lives.', 'Yes', 'Gender Links Eswatini ', 'I\'ve had the opportunity to work with young people through mentoring and teaching, where I\'ve developed strong communication skills, patience, and empathy. These skills have enabled me to connect with young individuals and support their growth, helping them build confidence and reach their full potential.', 'Yes', NULL, '2025-07-17 23:30:42', '2025-07-17 23:30:42'),
(660, 1106, '[\"documents\\/01K0CXWEP9VZJ7970016BSZBEQ.jpg\"]', '[\"documents\\/01K0CXWEPF1KN3J61YTNZVFE86.jpg\"]', 'Self-Employed', 'I applied for this position because I want to bring more change to the youth and become their voice, I also want to bring hope to those who are hopeless ', 'Yes', 'AMICAALL ', 'I created health club in my community where I engaged with youth about Health and Non Health talks', 'Yes', NULL, '2025-07-17 23:30:51', '2025-07-17 23:30:51'),
(661, 1107, '[\"documents\\/01K0CYYRD7MKJ71785SBK9WBA2.pdf\"]', '[\"documents\\/01K0CYYRDDJV8HMC5W27GCGZCC.docx\"]', 'Unemployed', 'I am deeply passionate about empowering young people to realize their potential and contribute meaningfully to their communities. Having grown up in this area of Lamgabhi, I understand the unique challenges and opportunities that local youth face. This position aligns perfectly with my commitment to fostering growth, resilience, and practical skills among young individuals.\n\nI bring a structured approach to learning, which is essential for delivering impactful training. My academic background in accounting and business systems, combined with my experience in advising on decision-making processes and ethical practices, equips me to guide youth not only in technical knowledge but also in critical thinking and responsible leadership.\n\nWhat sets me apart is my ability to connect theory with real-world applications. I’ve worked on feasibility studies, explored entrepreneurship strategies, and analyzed business systems—all of which are valuable tools for youth seeking to start ventures or improve their employability. I also have experience drafting professional documents and advising on career development, which can help participants prepare for future opportunities.\n\nI am confident that my blend of local insight, technical expertise, and passion for youth development makes me the ideal candidate to inspire and equip the next generation of leaders.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-17 23:49:35', '2025-07-17 23:49:35'),
(662, 1108, '[\"documents\\/01K0CYZ6PARZWPXJHHTF508975.jpg\"]', '[\"documents\\/01K0CYZ6PC1HNXGVN2EFD8PT00.docx\"]', 'Unemployed', 'I have an experience on working with the youth. I am willing to learn new skills . I love and enjoy being a peer educator. Therefore I think I \'m the best candidate for this job.', 'Yes', 'Youth Action Movement (YAM) under Family Life Association (FLAS)', 'I was a peer educator. I teached the youth on Sexual Reproductive Health  (SRH) , Respect, Abuse and many more.', 'Yes', NULL, '2025-07-17 23:49:49', '2025-07-17 23:49:49'),
(663, 1109, '[\"documents\\/01K0CZYCW4X47C9NKCR8KY0JN9.pdf\"]', '[\"documents\\/01K0CZYCWA95MDDNBNSCWVJ1KA.pdf\"]', 'Unemployed', 'I am deeply passionate about supporting and empowering young people to reach their full potential. With strong communication skills, empathy, and a genuine commitment to youth development, I create safe, respectful, and motivating environments where young individuals feel heard and valued. I believe every young person deserves guidance, encouragement, and positive role models, and I’m dedicated to being that support. My ability to connect, listen, and inspire makes me a strong candidate for this position.', 'Yes', 'Young Life Collage Eswatini', 'I was mentoring young people into focusing on restoring their relationship with God. I also helped abused and vulnerable children into overcoming trauma or finding a purpose in their lives.', 'Yes', NULL, '2025-07-18 00:06:52', '2025-07-18 00:06:52'),
(664, 1110, '[\"documents\\/01K0D036F0YFZHBP3FW80YD45Z.pdf\"]', '[\"documents\\/01K0D036F4SRFRX1BADMT79173.pdf\"]', 'Unemployed', 'I am the best candidate because mainly because I have years of experience and training as a peer educator. Also as a young person living in the same community with the youth I have better understanding of how to approach my peers in order to yield positive results. Above all, peer education is a passion to, I have made bad decisions in life because of the lack of knowledge and now I want to turn over a new leaf and make a difference in someone else\'s life, something I had no privilege to.', 'Yes', 'Family Life Association of Eswatini ', 'I was a peer educator and I provided my peers with information on Sexual Reproductive Health and Rights, helping them make informed decisions pertaining their Health and Rights.', 'Yes', NULL, '2025-07-18 00:09:29', '2025-07-18 00:09:29'),
(665, 1111, '[\"documents\\/01K0D1276XA7BWQ2XYSX18WXGY.heic\",\"documents\\/01K0D127798AXWHS8GASEK82T4.heic\",\"documents\\/01K0D1277M432S8TPJCY90YZVM.heic\"]', '[\"documents\\/01K0D1277YQHMXZBBHNXA0WXA6.pdf\"]', 'Unemployed', 'I am applying for the Youth Mindset Change Trainer Programme because I am passionate about creating a positive impact in the lives of young people. I believe this programme is an excellent opportunity for me to grow personally while helping others change their outlook on life and make better decisions for their future.\n\nAlthough I have not yet worked for any organizations, I have always had a strong interest in community development and youth empowerment. I enjoy working with people, especially fellow youth, and I am eager to be part of programmes that focus on building character, confidence, and purpose. I have witnessed how peer influence and lack of guidance can lead young people down the wrong path, and I want to play a role in changing that narrative.\n\nI have completed Form 5 and I am within the required age group. I am confident in my ability to connect with young people from different backgrounds and communicate in a respectful and understanding manner. I am a good listener, patient, and always open to learning from others. These qualities make me a strong candidate for this programme.\n\nEven though I may not have formal experience, I bring with me a high level of commitment, enthusiasm, and a strong desire to serve. I am ready to learn, attend all training sessions, and dedicate my time to volunteer as a peer trainer. I believe that the knowledge and skills I will gain from this programme will allow me to make a meaningful contribution in my community.\n\nIn conclusion, I am applying because I believe in the mission of this programme. I am ready to be trained, to grow, and to become a positive influence for other young people. I may not have worked with organizations before, but I am fully willing and prepared to step into that space with passion and dedication.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-18 00:26:25', '2025-07-18 00:26:25'),
(666, 1112, '[\"documents\\/01K0D18NP2P5XMMFAW6DXEGN01.pdf\"]', '[\"documents\\/01K0D18NP4KT92H6T2NVFQXBK9.pdf\"]', 'Unemployed', 'I applied because I best fit the role in that I have had experience working with young people and love interacting with them yet learning from different minds. I exude passion and put all my energy in everything I do. I go an extra mile to obtain realistic set goals.', 'Yes', 'Busisiwe Bhembe Foundation', 'Hosted,visited and had motivational talks with other young on life and how to set realistic goals. Had mentorship sessions with young and old people on money,business and life talks.', 'Yes', NULL, '2025-07-18 00:29:57', '2025-07-18 00:29:57'),
(667, 1113, '[\"documents\\/01K0D1NV2QGJDA0JZG3NRQ46WJ.pdf\"]', '[\"documents\\/01K0D1NV2WHT57J4XP4AKT446X.pdf\"]', 'Unemployed', 'I\'m Nokusha Mpofu, and I\'m thrilled to apply for the Youth Mindset Change Trainer Programme. As a former church youth leader, I\'ve had the privilege of guiding and mentoring young people, and I\'m eager to take my skills to the next level. I\'m passionate about empowering youth and creating positive change in my community.\n\nThrough this programme, I hope to gain the knowledge and expertise needed to facilitate impactful community sessions that inspire and motivate young people to reach their full potential. I\'m confident that my leadership experience, combined with the training I\'ll receive, will enable me to make a meaningful difference in the lives of others.\n\nI\'m excited about the opportunity to work with like-minded individuals who share my vision for a brighter future. I\'m committed to volunteering my time and energy to create positive change and inspire others. I\'m confident that this programme will equip me with the tools and support I need to achieve my goals and make a lasting impact.', 'No', NULL, 'No', 'No', NULL, '2025-07-18 00:37:08', '2025-07-18 00:37:08'),
(668, 1114, '[\"documents\\/01K0D21Z42XK97H9204WTFC8S2.pdf\"]', '[\"documents\\/01K0D21Z456MNNSHS72BADSQZB.pdf\"]', 'Self-Employed', 'I\'ve always felt a strong desire to serve and make a difference in the lives of people, and this training program aligns perfectly with that passion.\n\nMany young people in my community face challenges that seem insurmountable, and I want to be part of breaking those cycles and opening doors to new opportunities. I aim to make a positive impact on the lives of young people; while I can’t promise them the world, I believe I can at least commit myself to making a lifelong impact on their lives, and this training program is just the beginning of my journey to become a leader who truly makes a difference.\n\nIt’s also important for me to learn how to engage with my community, develop effective solutions to address the needs and challenges faced by young people, and build strong relationships with them. I’ve always dreamt of being a leader, and as Linda Kasonde said in one of her books, “Sometimes you’ll be the only one who believes in your dream. DO NOT STOP! The world needs you to model what’s possible for the rest of us.” I aspire to develop leadership skills and become an effective leader who doesn’t just speak about change but embodies the change people want to see.\n\nI aspire to be a role model, help youth find clear direction in life, encourage them not to give up on their dreams, and instill hope within them. Again, this training provides an opportunity for networking that is essential for my personal and professional growth. ', 'Yes', 'Young Life, Youth Alive, PEPFAR and Tisite Social-Aid Network ', 'Young Life: During my time as a volunteer and participant in high school, I helped individuals with disabilities at St. Joseph\'s Boarding House by assisting them with various activities, including games, exercises, and short learning programs. The programs offered by this organization played a vital role in boosting confidence and creating a nurturing environment for young people to thrive.\n\nYouth Alive: In my role as a brand ambassador, I worked to promote various programs and events hosted by the organization, ensuring they reached more young people. This effort provided them with motivation and direction toward a better future.\n\nPEPFAR: As both a participant and volunteer at St. Joseph\'s Mission, I took part in community service initiatives aimed at educating young people about HIV while also supporting entrepreneurship and business growth. My involvement included helping individuals identify opportunities and assisting them in their efforts to establish their own businesses with the limited knowledge I had from my own experience.\n\nTisite Social-Aid Network: Although still being developed, this platform has provided me with valuable training in skill development and entrepreneurship that I\'ve shared with many young people around me. The actual plan is to share what I\'ve learned with young people and contribute to the growth of the organization, which has been done quarterly and will continue as we await funding.\n\nOn my own initiative, I created a WhatsApp group dedicated to recognizing personal growth and offering opportunities for young people to tackle social issues within their communities. It serves as a platform for sharing valuable information and resources that can benefit them and those around them. ', 'No', NULL, '2025-07-18 00:43:46', '2025-07-18 00:43:46'),
(669, 1115, '[\"documents\\/01K0D22408HSHA4283PT2GP2P4.jpg\",\"documents\\/01K0D2240ACSRT5JFD264PN5FE.jpg\"]', '[\"documents\\/01K0D2240DJXKN2N0J2W74YCRW.pdf\"]', 'Unemployed', 'I want to secure a role in health education or community development, where I can utilize my skills and experience to support vulnerable populations particularly adolescents girls and young woman and contribute to creating a positive change in my community. I believe my skills and experience makes me a strong fit for the job.', 'Yes', 'World Vision Eswatini ', 'I was a Home Visitor where I provided adherence support for children adolescents girls and boys living with HIV (CALHIV) including a notable case where a female child improved her medication adherence through supportive conversations. I also facilitated in group sessions about SRH information.', 'Yes', NULL, '2025-07-18 00:43:51', '2025-07-18 00:43:51'),
(670, 1116, '[\"documents\\/01K0D28X9HKTQ5VTH5YGCCESR6.pdf\"]', '[\"documents\\/01K0D28X9MQ0PBAQ5XGJXY4J4G.docx\"]', 'Unemployed', 'As a social work student this job will be very helpful since youth empowerment is part of our practice. Also to equip more skills in understanding the diversity of young people and how we can work together to bring change in our society. Since I am still in my youth I can be helpful in inspiring youth and I have very good communication skills.', 'No', NULL, 'None', 'Yes', NULL, '2025-07-18 00:47:33', '2025-07-18 00:47:33'),
(671, 1117, '[\"documents\\/01K0D2JC7K22YM3QD8V9DQ1Z3J.pdf\"]', '[\"documents\\/01K0D2JC85QA3RYAND1TCMVWAD.pdf\"]', 'Unemployed', 'Dear Selection Committee,\nI have witnessed the impact of mindset change on young people’s lives. Empowering the youth with the right tools and confidence can transform not only individual lives but entire communities.\n\nMy motivation stems from my desire to contribute to youth development and support them in realizing their potential. I believe in the power of mindset change to foster resilience, positivity, and purpose among young people.\n\nI will fully dedicate myself to the training sessions and subsequent volunteer work. I am eager to learn from trainers and share my knowledge with others, creating a ripple effect uplifting our communities.\n', 'Yes', 'William Pitcher College ', 'Interned at the college and helped with their administration and  helped some kids apply for scholarship, also joined their career expo team to inform young people about tertiary and how to qualify for such opportunities. ', 'Yes', NULL, '2025-07-18 00:52:43', '2025-07-18 00:52:43'),
(672, 1118, '[\"documents\\/01K0D2VK1ETHC5F8VRXFAMN6PA.png\"]', '[\"documents\\/01K0D2VK1MPW746XPXZY5REMTN.png\"]', 'Unemployed', 'I am a vibrant, enthusiastic young male passionate about empowering youth by giving them life skills. I believe knowledge is Power. Educating youths is the best way to empower them as opposed to giving handouts. I believe I am the best candidate because I am driven and I always want to see success of youth empowerment endeavours. I strongly believe the youth of Eswatini can achieve more when united and empowered. ', 'Yes', 'World Vision', 'I worked as a volunteer on a Programme called Dream save. We were taught how to form savings groups so we can go back and empower other youths in our community. We were also taught Entrepreneurial Skills. ', 'Yes', NULL, '2025-07-18 00:57:45', '2025-07-18 00:57:45'),
(673, 1119, '[\"documents\\/01K0D3FPCQAYPNKMA684R9EB4P.pdf\"]', '[\"documents\\/01K0D3FPCWQBJS3QNVDV94DP3T.pdf\"]', 'Unemployed', 'I\'m excited to apply for the Youth Mindset Change Trainer Programme to empower my peers and community through positive mindset shifts. With strong communication skills and a passion for empowering others, I\'m confident in my ability to make a significant impact. I\'m eager to learn and contribute to positive change in Swaziland. I\'m dedicated to inspiring a mindset shift and empowering young people to reach their full potential.', 'No', NULL, 'No', 'Yes', NULL, '2025-07-18 01:08:44', '2025-07-18 01:08:44'),
(674, 1120, '[\"documents\\/01K0D3H6A8M3Z5SJWQWXCEG54N.pdf\"]', '[\"documents\\/01K0D3H6AE58AAXPCGTYEG5WE5.pdf\"]', 'Unemployed', 'I believe I can be the best candidate for the job because i have been educated on how to work and help young people also educated on community development not to forget being educated on counselling both young and old and making a better environment to leave on. I\'m also looking forward on changing the world to a better unity and bring back the pride of Ubuntu on our young group of people.  Giving a helping hand is my most desirable thing so being part of young youthful people can also help me grow up and be a better person and making the world be a better place for us to live on.', 'No', 'None ', 'None ', 'Yes', NULL, '2025-07-18 01:09:33', '2025-07-18 01:09:33'),
(675, 1121, '[\"documents\\/01K0D47RT8RYFYEYTSE8TYBRAT.pdf\"]', '[\"documents\\/01K0D47RTB4JBZE8PRX6KS1C38.pdf\"]', 'Unemployed', 'As a young person, I\'ve witnessed firsthand the impact that positive role models and mentors can have on shaping the next generation. I\'m eager to be part of the mindset change movement that seeks to inspire and motivate young people to reach their full potential. Through this programme, I\'m looking forward to gaining the skills and knowledge necessary to facilitate impactful community sessions that spark meaningful conversations and drive positive change. I\'m looking forward to collaborating with like-minded individuals who share my vision for a more empowered and inspired generation of young people. Together, I believe we can create a ripple effect of positive change that will be felt for years to come.', 'No', NULL, 'No', 'No', NULL, '2025-07-18 01:21:53', '2025-07-18 01:21:53'),
(676, 1122, '[\"documents\\/01K0D4BDGR1P8S6N0977C58QYA.pdf\",\"documents\\/01K0D4BDGW578CAX5CF08NF2M9.pdf\",\"documents\\/01K0D4BDH1DSBMPWAYJPVPFAHJ.pdf\"]', '[\"documents\\/01K0D4BDH4Y8379EMPJPWMT4S6.pdf\"]', 'Unemployed', 'I loved working with young people.\n Encouraging them to improve is my passion.\nSharing my ideas with them makes me happy.\n', 'Yes', 'Nazarene Compassionate Ministries     and  Compassionate Swaziland  ', 'Business Mentor Facilitator ', 'Yes', NULL, '2025-07-18 01:23:53', '2025-07-18 01:26:28'),
(677, 1123, '[\"documents\\/01K0D4SHSVGKHEHX54AQ3HN1VV.jpg\"]', '[\"documents\\/01K0D4SHSYD0KGH0XEX908H44T.jpg\"]', 'Unemployed', 'I am applying for this because this is the best opportunity for me to learn more about young people and it\'s a great opportunity for me to learn more. \n\nI am the best candidate for this job because am a target oriented individual who loves the  challenge  of ensuring that the daily target is met without fail.\n\nSecondly, i am always ready to take the next step forward by handling more responsibilities. \n\nLastly, i found it easy to assist to assist other staff if need to be and derive genuine enjoyment from my job ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-18 01:31:36', '2025-07-18 01:31:36'),
(678, 1124, '[\"documents\\/01K0D4STW54HNX6Q8Z0QWJ3T7X.pdf\"]', '[\"documents\\/01K0D4STWBPZ5BYCTX46ZZR094.pdf\"]', 'Self-Employed', 'I have always been passionate about youth empowerment and success. With the current state of the nation with regard to high rate of employment even for graduates, I feel called to assist young people with means to cope and better explore the available resources at their disposal to make the most out of life. There is a need to enlighten and help the current and upcoming generation realise that the world around us is changing and demand a changed mind to help oneself thrive.', 'Yes', 'World Impact Organization', 'I volunteered as a peer educator under a programme called Cross Roads that enhance Good decision making through behavioural change to maximise youth potential. I am currently volunteering on part-time basis, serving as a Training Facilitator mainly to conduct seminars for student leadership and learners for better academic performance under a programme called Study With Success.', 'Yes', NULL, '2025-07-18 01:31:45', '2025-07-18 01:44:10'),
(679, 1125, '[\"documents\\/01K0D4TJZT96MQYRTT63YPYZ2J.jpeg\"]', '[\"documents\\/01K0D4TJZX8JXPMJZ7R94XP85F.jpeg\"]', 'Unemployed', '\nI have applied for this position because I am passionate about contributing meaningfully to your organization. The role aligns perfectly with my skills, interests, and career goals. I am eager to grow professionally and believe this opportunity will allow me to use my strengths while learning and adding value to your team.\n\nI am dedicated, reliable, and always willing to go the extra mile. I bring a positive attitude, a strong work ethic, and the ability to adapt quickly to new challenges. I take pride in being a team player, and I am confident that my commitment and willingness to learn will make me a valuable asset to your organization.\n', 'Yes', 'Eswatini Down Syndrome ', 'I was collecting data with colleagues. Together we managed go analyze how the you with Down syndrome is socially isolates. We also managed to forge means for possible inclusive solutions ', 'Yes', NULL, '2025-07-18 01:32:10', '2025-07-18 01:32:10'),
(680, 1126, '[\"documents\\/01K0D5QCBKCDXH0TSVE7SH0RK6.jpeg\"]', '[\"documents\\/01K0D5QCBP38QH8S7WEZ15MC94.jpeg\"]', 'Unemployed', 'I have applied for this position because I am passionate about contributing to a meaningful cause and using my skills to make a positive impact. I am particularly drawn to your organization’s mission and the opportunity to grow professionally in an environment that values innovation, integrity, and service', 'No', NULL, 'Currently we have formed an organisation with the youth from various corners of the country. We are educating each other on IT and software related stuff.  I hope this will disseminate to each and every swazi child. ', 'Yes', NULL, '2025-07-18 01:47:53', '2025-07-18 01:47:53'),
(681, 1127, '[\"documents\\/01K0D638NE0TMJSXHNVA4K5734.pdf\"]', '[\"documents\\/01K0D638NG96HWKE1B9S463ST0.pdf\"]', 'Self-Employed', 'ENYC has opened an exciting opportunity to give back to my community by sharing the skills I’ve gained throughout my university journey. I can’t begin to express how much it means to me to engage with the youth of eSwatini—empowering one another with practical, resourceful skills that pave the way for a better tomorrow. This is more than just training for me; it’s a stepping stone toward becoming a lifelong contributor to youth development in Eswatini.\n\n', 'Yes', 'University of Botswana Business Clinic ', 'I trained University of Botswana aspiring Entrepreneurs how they can successfully turn their ideas into real businesses by teaching them how to spot opportunities, build plans, and confidently bring their vision to life. ', 'No', NULL, '2025-07-18 01:54:23', '2025-07-18 01:54:23'),
(682, 1128, '[\"documents\\/01K0D6E2E19B0KMS6CKBT4SFBP.jpg\"]', '[\"documents\\/01K0D6E2E5QPKTZ8SSBJXG40ZS.jpg\"]', 'Self-Employed', 'Specifically I am applying for this special type of program because it\'s a youth centered program . So according to my personal knowledge the youth age is the most fragile stage of life where one is exposed to many thing like peer pressure, feeling man or woman enough. Then has a bargain of choosing either the good or bad side of life . So I\'m applying for this youth mindset Change Trainer Program because of its title \"mindset Change Trainer\". I want to be that one of many youth trained to at least shapen the mindset of the youth through the knowledge I would gain whilst a trainee of the program. Plus my personal knowledge would be an added advantage. I am confident that my eagerness to learn plus relavant personal skills such as communication skills plus team work spirit would be a gain to many. Thank You', 'Yes', 'World Vision Organization ', 'World Vision Organization dealt with out of school girls below 25years of age. Mostly focused on education them about life lessons such as how to protect one\'s self from sexually transmitted diseases, how to save and make money. Also, school them about women empowerment for the better most future of themselves. Each girl would then be brought a silver platter of choosing whether she would like to go back to high school \"restart\" or take part in vocational education at college. All the necessary school fees would have been gladly directed to World Vision Eswatini. This fantastic opportunity really helped most girls since they got a second chance of education. So their positive uplifting is a positivity for not only them but for our country as a whole since more youth would be educated.', 'Yes', NULL, '2025-07-18 02:00:17', '2025-07-18 02:00:17'),
(683, 1129, '[\"documents\\/01K0D7A0TF4C3K5QHGKM30EVQJ.jpg\",\"documents\\/01K0D7A0TPYXQYXHCXG9WJZTR1.jpg\",\"documents\\/01K0D7A0TSQWK1WHEQ6ZQ8XJ10.jpg\"]', '[\"documents\\/01K0D7A0TYEXT4JXCNXP66Y4A4.docx\",\"documents\\/01K0D7A0V6NNG0V55ZF070R8SB.docx\"]', 'Unemployed', 'I enjoyed working with the AGYWs and I still have a great relationship with them even now they still call me when every they need someone to talk to, ', 'Yes', 'Nazarene compassionate ministries and AMICAALL ', 'Was life mentor conducted group sessions empowering then about H.I.V, family planning, referring for clinical services linkage to financial literacy ', 'Yes', NULL, '2025-07-18 02:15:32', '2025-07-18 02:15:32'),
(684, 1130, '[\"documents\\/01K0D7ASQZZ00XB5ETAV8FPX37.pdf\",\"documents\\/01K0D7ASR213PWF51R5EY9QJYY.pdf\",\"documents\\/01K0D7ASR5M75YC7K56QBXEKJV.pdf\"]', '[\"documents\\/01K0D7ASRA87R20TCWS24KAXG4.pdf\",\"documents\\/01K0D7ASRDAV949G0R1NH5HB1Z.pdf\"]', 'Employed', 'As a Spoken Word Poet, I believe in the power of narratives to shape one\'s worldview, reality and essentially, their perceptions of themselves and their ability to effect change in their lives and the lives of others. Thus, my poetry is driven by a desire to shift narratives and drive mindset change towards more empowered communities and healthier social norms. It is this passion which thus drives the work I do in the development space, where I work with youth to expose them to the relevant knowledge, skills and tools to become resilient agents of change. My extensive experience working with youth coupled with my education (BA Honours Social Science) makes me a great candidate for this position where I look forward to taking a more targeted approach to mindset change through delivering this course. I am agile and willing to learn, and in touch with youth needs and community structures having conducted development programs at grassroots levels. ', 'Yes', 'Youth Sustainable Development Centre (YSDC); CCM Board; Woman Farmer Foundation; African Leadership University; African Leadership College', 'Youth Sustainable Development Centre (YSDC)- Projects Officer\n1. Lead programs that aim to increase youth participation in sustianable development initiatives, such as conducting youth dialogues and trainings and youth advocacy efforts\n2. Successfully lead a USAID project to increase youth engagement in SRH programs through Young Heroes. There I facilitated AGYW dialogues, conducted feedback surveys and trained youth leaders on effective youth engagement.\n3. Developed and implemented a program to drive young artists to curate socially conscious art, using art as a powerful tool for mindset change and shift narratives\n\nEswatini Country Coordinating Mechanism Board- Youth Constituency Representative\n1. As the elected youth representative (2025/27) I coordinate and represent youth in the CCM board to ensure youth voices are amplified and inform HIV/TB and Malaria programming in Eswatini\n2. Coordinate and lead youth engagement meetings, where I introduced capacity building workshops to strengthen youth  representatives of youth-led and youth-centred organisations preparedness to manage their entities and access funding opportunities\n\nWoman Farmer Foundation- Communications Officer\n1. Developed and led communication strategies which effectively tripled youth participation in the annual Woman Farmer of the Year competion (Female Youth category) and also doubled youth participation in their tunnel program \n\nAfrican Leadership University- Entrepreneurial Leadership Teaching Assistant\n- Provided academic support for students under the EL course which was designed to empower first-year students to lead themselves in order to lead others in order to tackle the world\'s most pressing challenged through entrepreneurial thinking. The course covered topics such as emotional intelligence, design thinking, entrepreneurial approaches to problem solving etc. There I conducted office hours provided in class support, occasionally conducted lectures and graded 100 assignments per week.\n2. Developed a peer-to-peer assessment program to improve teaching methods, and student experience.\n3. Conducted workshops on school policies, and developed on-campus student wellness initiatives\n\nAfrican Leadership College:\n1. Provided and facilitated wellness support to students such as conducting residential meetings, developing and implementing on-campus events, providing peer counselling, engaging in conflict resolution, developing workshops to address overarching on-campus issues, conducting weekly 1-on-1 check-ins with my residents and sensitizing students on school policies.\n2. Developing incident reports and tracking student wellness\n3. Managing the campus reporting mechanism and email, coordinating the resolution of residential and operational concerns within a 48 hour turn around period which was a joint effort between the Student Life Department and the Operations Department.\n', 'Yes', NULL, '2025-07-18 02:15:58', '2025-07-18 02:15:58'),
(685, 1131, '[\"documents\\/01K0D7NTJ563SWZANPJVG01CPY.jpg\"]', '[\"documents\\/01K0D7NTJ93NR976YZPNXYTMA4.doc\"]', 'Unemployed', 'I think I am the best candidate because when it happens to talk about GBV I will tell what I have go through as young people.', 'No', 'None', 'As victim of teenage pregnancy I used to share with young people about challenges of raising child.', 'Yes', NULL, '2025-07-18 02:21:59', '2025-07-18 02:21:59'),
(686, 1132, '[\"documents\\/01K0D9N2603496BHNG1AJMS8C3.pdf\"]', '[\"documents\\/01K0D9N267QRFFME0V5S2J80DH.pdf\"]', 'Unemployed', 'Though I didn\'t took it as a job, but the main reason for I have applied is that in my Inkhundla I have observed a huge increase in the number of young people getting into drugs, increase in teenage pregnancies, increasing school drop outs, increase in crime rate from the youth. I can see that some of this issues are caused by ignorance, so I therefore wish that there should be more peer education programmes offered to our youth. I tried taking the initiative to voluntarily peer educate some of the since I once attended a peer education workshop with you in 2014 so I wish to be part of this current one so to increase my knowledge and experience since the world is moving faster and I so wish that current and coming generation should not get into all this because of ignorance.\nI believe that I can be the best candidate for the job as I have great experience working with young people of different nations, abilities and backgrounds ', 'Yes', 'Bantfwana', 'I was a voluntary male medical circumcision mobilizer, I helped young people to know the importance and benefits of being circumcised  and I managed to convince some to finally got circumcised medically which is the safe way, I as well do peer education to young individuals around me and I have observed some changes in their attitudes expecially towards education ', 'Yes', NULL, '2025-07-18 02:56:31', '2025-07-18 03:18:50'),
(687, 1133, '[\"documents\\/01K0DA3QQR7MHQGERS0FFG8037.jpg\"]', '[\"documents\\/01K0DA3QR2FH17TVFTK1BW7MG0.pdf\"]', 'Unemployed', 'I can work with a group of people and communicate/collaborate effectively to others. I enjoy talking to people getting to know them and their insights. I enjoy empowering young people and help them reach their full potential. I understand that every person is unique, and I am willingness to adapt to different learning styles. I love bringing new ideas and motivating program culture that support the growth and development.', 'No', NULL, 'none', 'Yes', NULL, '2025-07-18 03:04:32', '2025-07-18 03:04:32'),
(688, 1134, '[\"documents\\/01K0EQ9GDHF737MX6SHRR6A751.jpeg\"]', '[\"documents\\/01K0E5X56BJQB64ZJACMMPBMTB.docx\"]', 'Self-Employed', 'have applied for this opportunity because it aligns deeply with my calling, my lived experience, and my unwavering commitment to the transformation of young people and communities. For years, I have dedicated my time and energy to creating spaces that empower youth — emotionally, spiritually, and mentally — because I believe our greatest healing and leadership potential lies within us, especially when we are guided and supported in the right environment.\n\nAs a young African woman who has navigated trauma, identity loss, and spiritual disconnection — and risen above these challenges — I know what it means to search for meaning and healing. That is why I founded Ndauwe Spiritual Home, a unique space in Eswatini that focuses on spiritual awakening, ancestral healing, mental health, and personal empowerment. I have witnessed firsthand how young people are silently battling anxiety, depression, identity confusion, and spiritual loss. At Ndauwe, I offer mentorship, rituals, herbal healing, and workshops that help them realign, reconnect, and remember who they are.\n\nThis work is not just something I do — it is who I am. I am not driven by prestige, but by purpose. Each young person who comes to Ndauwe receives guidance tailored to their path. I do follow-ups, offer cleansing and protection, and help them build a foundation for sustainable self-leadership. Many go on to make better life decisions, build stronger spiritual practices, and become sources of light in their communities.\n\nMy journey began in youth movements such as Luvatsi Youth Mahlanya, where I was exposed to leadership, advocacy, and civic engagement. I learned to mobilize young people, to listen actively, and to design impactful campaigns around issues that affect us — from mental health to sexual health and beyond. That early experience gave me confidence and structure. Later, as a member of the Bushfire Legacy Program, I used art, storytelling, and music to create dialogue among youth. That space taught me how powerful creative expression can be for healing and awareness.\n\nWhat makes me the right candidate is not just my experience, but my deep-rooted spiritual intelligence, emotional maturity, and genuine service mindset. I have the ability to hold space — real space — for youth to cry, reflect, ask hard questions, and transform. I don’t offer just a program or service; I offer presence. I am a mentor, a healer, a sister, and a listener. My Afro-spiritual lens allows me to approach young people holistically — not just focusing on their academic or economic potential, but also on their soul and sense of self.\n\nI am applying because I want to deepen this impact. I want to access opportunities that allow me to refine my work, reach more young people, and network with like-minded change-makers. I believe platforms like this are not just about recognition but also about capacity-building and community development. With the right support, Ndauwe Spiritual Home can expand to reach schools, rural areas, and young people in crisis. It can also serve as a model for how traditional African spirituality can be used to heal modern challenges.\n\nI am also a musician — performing under the name BlackChild — and I use my music to speak to the soul of the youth. I write songs about healing, awakening, resilience, and love. My creative approach sets me apart, and I know how to use art, sound, and storytelling to reach people beyond formal settings. I understand the language of the youth — their struggles, their silence, their resistance — and I know how to build bridges between who they are now and who they are becoming.\n\nIn conclusion, I am applying because this work is already in motion, and this opportunity will be the fuel to keep it alive, sustainable, and far-reaching. I am not just a candidate — I am a vessel. And I carry a vision of a generation that is spiritually awake, mentally strong, emotionally safe, and unapologetically African. With support, I will continue to build that vision — one healing session, one song, one workshop, and one youth at a time.\n', 'Yes', 'European Union ', 'As a passionate youth leader and spiritual mentor, I dedicate my work to helping young people rediscover themselves, reconnect to their roots, and reclaim their power. Through my initiative, Ndauwe Spiritual Home, I create safe, healing spaces for young people to explore their spirituality, identity, and mental well-being. Many youth today are overwhelmed, misinformed, or disconnected, and Ndauwe provides a unique path of guided growth, offering tools such as ancestral alignment, meditation, and herbal healing to support them on their journey. I mentor those who come to me for clarity and spiritual guidance, and some are even initiated as spiritual healers under my care.\n\nMy mission began years ago when I was part of Luvatsi Youth Mahlanya, where I learned the importance of youth-led community change. I was involved in campaigns that focused on sexual and reproductive health, human rights, and youth empowerment. These experiences sharpened my voice and strengthened my ability to organize, speak up, and listen — all qualities I now pass on to the young people I work with.\n\nLater, I served as a Bushfire Legacy member, where we used art and performance as a platform for youth expression and activism. Being part of this vibrant, creative movement reminded me how powerful storytelling, music, and culture are in reaching and inspiring youth. That is why, today, I also use music under my stage name BlackChild to uplift and speak to young people about their worth, healing, and purpose.\n\nIn every role I’ve held, I’ve prioritized mental health, empowerment, and spiritual restoration — especially for youth in underserved and rural areas. I continue to create spaces where they are seen, heard, and guided. Whether it’s hosting workshops at Ndauwe, doing one-on-one sessions, or leading group rituals and teachings, my goal is to help them walk into their light with confidence and awareness.\n\nI believe that true empowerment comes from self-knowledge and alignment, and that is what I offer every young person who crosses my path. My journey has been shaped by powerful youth movements, and now I carry that legacy forward through my work — rooted in spirit, guided by purpose, and grounded in community.\n', 'No', NULL, '2025-07-18 11:10:17', '2025-07-18 16:14:07');
INSERT INTO `t_o_t_applications` (`id`, `participant_id`, `certificate_upload`, `cv_upload`, `current_activity`, `motivation`, `youth_organization_response`, `youth_organization_name`, `youth_organization_duties`, `current_residence`, `deleted_at`, `created_at`, `updated_at`) VALUES
(689, 1145, '[\"documents\\/01K0F64CP7HRXQ9C7S75WV8CDJ.pdf\",\"documents\\/01K0F64CPHFSTYD9VHWNT040VD.pdf\"]', '[\"documents\\/01K0F64CPMM169N4JGNTNHKFEH.pdf\"]', 'Self-Employed', 'am applying for this opportunity in youth empowerment because I strongly believe in the power of young people to bring positive change to their communities when they are equipped with the right support, tools, and mentorship. As a young person myself, I have experienced the struggles, doubts, and limitations that often come with growing up in a world that doesn’t always provide equal opportunities. However, I have also seen the transformative impact of empowerment—being believed in, given responsibility, and challenged to grow.\n\nThis is why I am passionate about being part of a movement that creates space for young people to rise. I want to contribute to a platform that not only addresses the challenges youth face but also unlocks their potential through practical skills, leadership training, and personal development.\n\nWhat makes me a strong candidate for this opportunity is both my personal experience and my commitment to leadership and service. I have taken part in several youth initiatives and served in leadership roles, including being Chairperson of a Student Christian Movement. In that position, I led a team that organized outreach programs, mentorship sessions, and community activities. These experiences taught me how to lead with humility, work with diverse groups, and inspire others to step into their purpose.\n\nAcademically, I have pursued fields that help me understand global and community challenges. I hold degrees in Environmental Management and International Business, which have expanded my thinking around sustainable development and strategic planningboth of which are important when working with youth-driven change.\n\nI am a person who listens, learns, and leads. I am grounded in values of service, compassion, and excellence. I believe youth empowerment is more than a conceptit’s a lifestyle of lifting others as you climb. I want to be part of that process, helping young people find their voice, believe in themselves, and act with courage.\n\nThis opportunity aligns perfectly with my values and long-term vision of building a generation that is purpose-driven, bold, and solution-oriented. I believe I can add value through my leadership, creativity, and willingness to serve wholeheartedly. I’m not just applying for a role I’m responding to a calling to empower others, just as I have been empowered.', 'Yes', 'I was chairperson of the movement STUDENT CHRISTIAN MOVEMENT ', 'The Chairperson of a Student Christian Movement (SCM) plays a critical leadership role, both spiritually and administratively. As the primary leader of the movement, the Chairperson is responsible for setting the spiritual tone, guiding the vision, and ensuring that the organization remains rooted in Christ-centered values throughout its activities.\n\nSpiritually, the Chairperson serves as a shepherd, encouraging members to grow in their personal relationship with God. This includes leading by example through a consistent prayer life, commitment to Scripture, and a lifestyle that reflects the teachings of Christ. The Chairperson is expected to inspire and support the spiritual development of both the executive team and the wider student body. They may lead Bible studies, open and close meetings in prayer, and coordinate with the prayer and worship teams to foster an atmosphere of spiritual revival.\n\nOrganizationally, the Chairperson oversees the overall direction of the movement. They are responsible for setting the yearly vision in consultation with the executive committee, ensuring that all planned activities such as outreach programs, evangelism, conferences, and discipleship sessions  align with the mission and purpose of the movement. This vision casting is not only strategic but spiritual, ensuring that the SCM operates not just as a student club but as a spiritual force on campus.\n\nIn terms of leadership and teamwork, the Chairperson must foster unity, motivate the executive team, and manage any internal challenges with wisdom and grace. They chair executive meetings, assign responsibilities, and ensure that each leader is supported in their role. Servant leadership is key  leading not for power or recognition, but to serve others with humility and love.\n\nThe Chairperson also acts as a bridge between the movement and external bodies such as university chaplaincy, other student organizations, and national Christian student networks. This requires strong communication skills, diplomacy, and the ability to represent the movement with excellence and integrity.\n\nLastly, the Chairperson is entrusted with pastoral care, helping to resolve conflicts, counseling members, and creating a welcoming and inclusive environment for all students. In all these roles, the Chairperson must remain prayerful, visionary, and focused on the eternal goal making Christ known.', 'No', NULL, '2025-07-18 20:33:28', '2025-07-18 20:33:28'),
(690, 1141, '[\"documents\\/01K0F6DQ21NEFQBBX8XG2B7DB2.jpg\"]', '[\"documents\\/01K0F6DQ26DG3GHTZ4MD72V865.pdf\"]', 'Unemployed', '- I believe my experience and skills can bring a positive change other young people and promote growth in communications.\n- Because of my commitment to continuous learning and growth.\n- I have a great interpersonal relationships with different types of people.\n- Committed in making a positive impact in every possible way .', 'Yes', 'The Luke Commission ', '-Working closely with the youth in tackling issues of daily life.\n- Train ,educate and engage with them in real life problems in our society.\n- Creating a safe and open environment for those who need to express themselves.\n', 'Yes', NULL, '2025-07-18 20:38:34', '2025-07-18 20:38:34'),
(691, 1140, '[\"documents\\/01K0F6Q20YPFVN2GRTSTBKMT85.pdf\",\"documents\\/01K0F6Q211GDFQ9N2TWQKZ3PFN.pdf\"]', '[\"documents\\/01K0F6Q213TBXX7Y97JGF926K4.pdf\"]', 'Unemployed', 'I believe I am a compassionate yet firm individual who is able to adapt to an individuals character when teaching or explaining things. This can be supported by my colleagues at the University of Eswatini who usually confided and sought help on their research projects from me rather than their supervisors due to my willingness to teach and explain complex tasks simply. I possess public speaking skills due to my supervisory experience at Royal Eswatini Sugar Corporation. A lot of my subordinates attested that I am firm, fair and empathetic individual when necessary. ', 'No', NULL, 'I have helped young farmers and community members partake in crop and vegetable production. I have provided them with advise, guidance and recommendations on what, where, when and how to produce. I have helped advocate market oriented approach in peoduction and cost effectiveness helping them capture higher profits and improved yields. I have acted as a beacon of advise and guidance for my young relatives after graduating from high school. ', 'Yes', NULL, '2025-07-18 20:43:40', '2025-07-18 20:43:40'),
(692, 1153, '[\"documents\\/01K0F74VHMEY5ZD0REGKYY6SSV.pdf\"]', '[\"documents\\/01K0F74VHRESNG7TMA0B3QP9TS.docx\",\"documents\\/01K0F74VHZFV2SVXB5Y4E5RDA2.pdf\"]', 'Unemployed', 'I am passionate about empowering other young people and creating a positive impact in my community. I lead by example, stay committed, and am always ready to learn and grow. My strong communication and teamwork skills help me connect with others and inspire change. As a young leader I will bring energy, dedication, and a vision for a better future.\n\n', 'Yes', 'Rotary and Nurturing Future Success ', 'In Rotary I was a volunteer, I would help when they go and distribute items to different schools. In Nurturing Future Success I\'m one of the founders and I\'m helping in running it and organising programs and many more other operations of the organisation.', 'No', NULL, '2025-07-18 20:51:12', '2025-07-18 20:51:12'),
(693, 1158, '[\"documents\\/01K0F904MY84EP1MCW531PYQBH.jpg\"]', '[\"documents\\/01K0F904N1MVDG3E6KAC161NN6.docx\"]', 'Employed', 'I am applying to represent Eswatini at the Commonwealth Youth Council because I am deeply committed to uplifting the voices of young people and ensuring that Emaswati youth are actively engaged in shaping global policies that affect our lives and our future. I believe that youth participation is not just necessary—it is essential in addressing the most pressing issues of our time, from education and employment to climate justice and gender equality.\n\nAs a young leader with a background in education and science, I bring a strong foundation in advocacy, communication, and policy awareness. I have been actively involved in youth development initiatives at local  levels, including participation at student’s scripture union, where I have led campaigns, facilitated training, and collaborated with stakeholders to create positive change.\n\nI am fluent in English, passionate about youth empowerment, and skilled in representing diverse perspectives in a respectful and effective manner. I strongly believe in inclusive leadership, and I am committed to championing meaningful change, not just through words but through action.\n\nThis opportunity aligns perfectly with my purpose and vision—to help build a future where every young person in Eswatini is heard, valued, and equipped to lead. With my proven leadership experience, my ability to work collaboratively across cultures, and my deep passion for youth-driven change, I am confident that I can serve as an impactful and inspiring representative of Eswatini on the global stage.\n', 'No', 'None ', 'none ', 'Yes', NULL, '2025-07-18 21:23:35', '2025-07-18 21:31:44'),
(694, 1151, '[\"documents\\/01K0F97CQY8E19V8X5K7WEH5QF.pdf\"]', '[\"documents\\/01K0F97CR1V352X4RDG5H254W8.pdf\"]', 'Self-Employed', 'I have applied because I have been attending some of the youth seminars hosted by the Eswatini Youth Council and I do want to see the change and the ideas we suggest being implemented to their full potential and secondly, I am passionate about the youth hence I would love to participate in this to ensure our youth is considered and helped in every possible way ', 'Yes', 'One Accord Foundation ', 'It motivated many and sensitised them on the importance of entrepreneurship', 'No', NULL, '2025-07-18 21:27:32', '2025-07-18 21:27:32'),
(695, 1159, '[\"documents\\/01K0F9B5AWNMDVZH8PRP4WA31Q.jpg\"]', '[\"documents\\/01K0F9B5AZNRK417AA454NNDQV.jpg\"]', 'Unemployed', 'I am excited to apply for the Youth Mindset Change Trainer Programme because I believe in the transformative power of education and mentorship for young people. This opportunity aligns with my career aspirations and resonates with my personal values. I am passionate about empowering youth to overcome challenges, foster resilience, and cultivate a positive mindset. Below, I outline my motivations for applying and the qualities that make me a strong candidate.\nI have always been drawn to working with youth. My journey began in high school, where I volunteered as a tutor for younger students. This experience ignited my passion for education and mentorship. I witnessed how guidance and support could positively influence a young person’s trajectory, motivating me to pursue a career focused on youth development.\nMy commitment to this cause deepened through community service projects aimed at engaging adolescents. I organized workshops on life skills and mental health awareness, creating safe spaces for young people to express themselves and learn coping strategies.\nThe program’s mission resonates with my belief in cultivating a positive mindset among youth. In today’s fast-paced world, adolescents face pressures from academics and social media. Equipping them with tools to navigate these challenges is crucial for their well-being.\nI firmly believe that a positive mindset can empower young people to overcome obstacles and achieve their goals. I am eager to contribute to this mission and guide youth in discovering their potential.\nMy experience working with adolescents is one of my key qualifications for this role. I have volunteered in various capacities, including mentoring programs and after-school clubs. These experiences have developed my ability to connect with youth and provide the support they need.\nAs a mentor in a local youth program, I worked with at-risk teens facing significant challenges. Through one-on-one sessions and group activities, I helped them develop coping strategies, set achievable goals, and build self-esteem. Witnessing their growth reinforced my commitment to this line of work.\nAdditionally, my coursework in psychology and education has provided me with a solid foundation in understanding adolescent development. I have studied topics such as motivation and resilience, knowledge that will be invaluable as a trainer.\nEffective communication is essential in any training role, and I pride myself on my ability to engage with diverse audiences. I have honed my skills through public speaking and workshops, striving to create an inclusive environment where everyone feels comfortable participating.\nActive listening is a priority for me. I make it a point to listen to the voices of young people, ensuring they feel heard and valued. This approach fosters trust and encourages meaningful discussions around mindset change.\nIn conclusion, I am passionate about the opportunity to join the Youth Mindset Change Trainer Programme. My dedication to youth development, alignment with the program\'s mission, relevant experience, strong communication skills, and commitment to community engagement make me a strong candidate. I look forward to contributing my skills to empower young people and help them cultivate positive mindsets.\n\nThank you for considering my application \n', 'No', NULL, 'None', 'Yes', NULL, '2025-07-18 21:29:36', '2025-07-18 21:29:36'),
(696, 1161, '[\"documents\\/01K0FB43JA4TDBBD6YPP12APC4.pdf\"]', '[\"documents\\/01K0FB43JDBDEYE0F3V6454G8R.docx\"]', 'Unemployed', 'I have a vast of experience working with young people. It is my dream to change as many as possible young people lives for the better. I am a very passionate person, who is also willing to go an extra mile just to save a young soul from any danger that may affect his/her future.', 'Yes', 'World Vision, Flas and ZYA', 'World Vision - I am the currently ABYM under Zombodze inkhundla, under Halting the spread of HIV & AIDS in Eswatini and reversing it impact. FLAS I was their peer educator, under Zombodze Youth in Action Organisation I am their current chairperson.', 'Yes', NULL, '2025-07-18 22:00:42', '2025-07-18 22:00:42'),
(697, 1152, '[\"documents\\/01K0FBG1TM2VEY4Q6GTN58CZHD.jpg\"]', '[\"documents\\/01K0FBG1TRB7N9JEQKZA1Y0H1G.pdf\"]', 'Self-Employed', 'As a young strong person I know struggles and reality faced by young people . My strengths lie in my ability to offer guidance on effective communication, understanding diverse perspectives, and addressing common challenges faced by peers. Im confident in sharing my very own story to young people and willing to listen without judging them . Additionally, I can assist in creating educational materials and facilitating discussions on important topics that can help is developed mental and spiritual. ', 'Yes', 'SAFAIDS, SIVUSA TIVE NENGCEBO AND UNDP ', 'I have helped motivate young people about personal growth , hygiene including and  self care by providing relevant information.  \nAlso provide information,  guidance and support to young people that no matter issues they face , they is still more to life \nLasty I cook for orphans 100+ ever week and also watch there behaviors and also provide clothes or toiletries. ', 'Yes', NULL, '2025-07-18 22:07:13', '2025-07-18 22:07:13'),
(698, 1171, '[\"documents\\/01K0FDKHG6CYF00SB2JJS50N67.jpg\"]', '[\"documents\\/01K0FDKHG95EEPS41859W8R2TB.jpg\"]', 'Self-Employed', 'I\'m am a good  leader to teenagers  also i know  challenges that  faced by teenagers  and how to solve their  is .i am good  in communication as I work more than 3 years  in cabrini  ministry  without  complaining  with my job bt instead  I bringed  joy to my Leader.Laslty I am a good  candidate with good  heart  who deserves  this position ', 'Yes', 'Cabrini ministry  ', 'Youth empowerment on how to save money  for their  future  by making  groups  every  week  save  certain amount  of money and encourage  them so start  their  own  business for their future .in addition   I also  teach  them  about  teenage pregnancy  on how to prevent  it and also encourage  those  who oredy  have kids   don\'t look down them self  self  on their  present situation ', 'Yes', NULL, '2025-07-18 22:44:05', '2025-07-18 22:44:05'),
(699, 1187, '[\"documents\\/01K0FM85F4WX8PY9PS4XNFK5DH.pdf\"]', '[\"documents\\/01K0FM85F7BR6PDPC2F76690BE.pdf\"]', 'Unemployed', 'I want to bring change in my community and I want to gain experience working with the youth. I want to do something for my community. I am the best candidate because I was once involved in Bantwana group where youth will gather and be taught about HIV and AIDS so I know how sensitive the youth is. ', 'No', 'N/A', 'None', 'Yes', NULL, '2025-07-19 00:40:12', '2025-07-19 00:40:12'),
(700, 1195, '[\"documents\\/01K0G3EFYSQR0VNFA5EFX5JQJE.jpg\",\"documents\\/01K0G3EFYYPVRJ9ADMR47WQC16.jpg\"]', '[\"documents\\/01K0G3EFZ4TEJJZFPM2FPG1TKW.pdf\"]', 'Unemployed', 'First and foremost lam a young person who is motivated into bringing about a change in my community,with the experience and knowledge l have gained in working with young people in my comminity l want to further the knowledge so that l able to mentor the youth,l believe the passion l have is the one that make me the best candidate for this job, l thank you', 'Yes', 'World vision and Bantwana initiative', 'I worked as girl power ambassador ,l mentored them about the important of taking care of their lives,how can the stay free from HIV ,like teaching them about the importance of taking prep, ,pep,more information on condomising and also about gender based violence, also how to be self independence.', 'Yes', NULL, '2025-07-19 05:05:48', '2025-07-19 05:05:48'),
(701, 1196, '[\"documents\\/01K0G98MGQ6QE19VVTAMN61SSY.pdf\"]', '[\"documents\\/01K0G98MGT9ZCS4DA7RNMZ898W.png\"]', 'Unemployed', 'As an agricultural entrepreneur i have Helped in advocating the youth on how best they can improve their farming skills in order to gain high yield and shared with them the opportunity for a good market system ', 'Yes', 'AEM society ', 'Leaded a project on ensuring low cost in agriculture farming based projects ', 'Yes', NULL, '2025-07-19 06:47:28', '2025-07-19 06:47:28'),
(702, 1197, '[\"documents\\/01K0GA81V82FE3MT9H55RMP69W.pdf\"]', '[\"documents\\/01K0GA81VB2PZJV9X1J2KGJHCW.docx\"]', 'Unemployed', 'I applied for the youth development job because I\'m passionate about empowering young people, helping them grow their skills, and supporting their personal and professional development.\n\nI think I am the best candidate for the  job because I have a genuine passion for working with young people, strong communication and leadership skills, and a proven ability to motivate and guide youth toward achieving their goals. I\'m committed, reliable, and bring both empathy and energy to every task.\nI have developed in emotional intelligence which I believe is crucial for this position.\nI see challenges as an opportunity for growth.\n\n', 'No', 'Non', 'Non', 'Yes', NULL, '2025-07-19 07:04:37', '2025-07-19 07:12:55'),
(703, 1204, '[\"documents\\/01K0GSF51W2CTFAAY7DACC5J56.pdf\"]', '[\"documents\\/01K0GSF522AJRDT6BDXYK8JJYN.pdf\"]', 'Unemployed', 'I have applied because I am passionate about youth development. Though I am still new in this space, being part of the Eco Pioneer club has opened my eyes to the power of youth voices and the importance of sustainable change. I may not have formal leadership experience, but I am willing to learn, represent my peers, and bring fresh ideas. I believe I represent many young people who are ready to grow and lead if given the opportunity.', 'No', 'None ', 'I have not yet worked with a youth-focused organization, but as a member of Eco Pioneer a student-led sustainable development club I have been part of awareness activities and discussions that encourage fellow students to care about the environment and climate action. This experience is helping me learn how youth can lead and support one another toward positive change.', 'Yes', NULL, '2025-07-19 11:30:38', '2025-07-19 11:30:38'),
(704, 1209, '[\"documents\\/01K0GZB4WTS2PNRMBMY2YDJ6HH.pdf\"]', '[\"documents\\/01K0GZB4X00MF3ND3FFXQT0R35.pdf\"]', 'Self-Employed', 'I am a 22-year-old young lady who loves engaging and educating the youth on issues that affect \r\nthem, and by extension affect their studies. I was part of the Prefects team in high school which \r\nobliged me in constantly having to address students, be it in assembly, classrooms or individually. \r\nI am currently enrolled at the Institute of Development Management (IDM), where I am part of \r\nthe current Student Representative Council (SRC). I am also one of the selected students awaiting \r\ntraining to be Peer Educators at the institution. I strongly believe that these positions will show \r\nthat I am a suitable candidate as I have presenting and public speaking skills. My constant exposure \r\nto the youth means I am aware of the issues the majority of young people face and I have some \r\nexperience in dealing with students and their personal issues. I am always looking forward to any \r\nchances I come across where I can empower the youth, educate them on how to transition into \r\nadulthood and tertiary, be someone they can trust and be safe with and discuss relevant topics that \r\ndirectly impact them. I am passionate about the wellbeing of the girl child and I am constantly \r\nadvocating for them to be educated, skilled, self-aware, healthy, safe and independent.', 'No', 'None', 'None', 'Yes', NULL, '2025-07-19 13:13:19', '2025-07-19 13:13:19'),
(705, 1210, '[\"documents\\/01K0GZZ7WERV420E8G36K2C5N1.pdf\"]', '[\"documents\\/01K0GZZ7WH06D4Y6DBAHKZ419Z.pdf\"]', 'Self-Employed', 'My aim to to help young teenager and giving the platform i will be able to reach them and maybe one or two could be helped and have a little education on teenage pregnancy and drug abuse cause it one of the leading factor that destroys ones future and helping them with business ideas as I\'m also a young business woman.', 'Yes', 'Baphalali red cross ', '1 giving them healthy tips\n2 they were given sanitary pads and bits of education on look after themself\n3. They were given an opportunity to volunteer to help the community ', 'Yes', NULL, '2025-07-19 13:24:17', '2025-07-19 13:24:17'),
(706, 1211, '[\"documents\\/01K0H2JVPPPTDWNN6M674G52BF.jpg\"]', '[\"documents\\/01K0H2JVQ17MDT5T1C70SCWE41.pdf\"]', 'Unemployed', 'I realised my district region lack exposure as far as development and youth empowerment programmes are concerned thus they end up hanging around shops, gambling, smoking and drinking from sunrise till sunset; entrepreneurial knowledge, environmental issues, technical infrastructures and healthywise.\n\nI am working towards implementation of a waste management plant that will benefit the out-of-school youth in community with something to be busy. \n\nI believe this will be the right plartform to pitch my idea before funders and present the community problems. ', 'Yes', 'Eswatini Climate Change Youth Parliament ', 'As a parliamentarian in the office representing all Shiselweni youth, i would share the climate related issues we facing in the communities and dicuss a way forward with relevant stakeholders.\n\nWith the help of EEA and community schools we did a montly clean up campaign programme where the learners would collect litter along the road covering a distance of about 3Km.\n\nWe also planted fruit trees in schools ; in Nhletjeni High we worked with Hletjeni High Eco-Club.', 'No', NULL, '2025-07-19 14:09:57', '2025-07-19 14:09:57'),
(707, 1156, '[\"documents\\/01K0H7PR99XJMYN2V1R6NMCQKD.pdf\"]', '[\"documents\\/01K0H7PR9HMMFGR7KTGAHRNWTT.pdf\"]', 'Employed', 'I am particularly drawn to the Commonwealth Youth Council\'s emphasis on values such as democracy, sustainability, innovation and human rights. These are not just abstract ideas to me, they are principles I live by. I envision a future where young people are not just merely beneficiaries of development but architects of it. Through the Commonwealth Youth Council, I will strive to push forward agendas that promote climate action, digital innovation, youth entrepreneurship and inclusive education. I will also advocate for youth-friendly policy environments that enable young people to thrive socially, economically and politically.', 'No', 'None', 'None.', 'No', NULL, '2025-07-19 15:39:27', '2025-07-19 15:39:27'),
(708, 1214, '[\"documents\\/01K0H9Q9XJ7TK355HRQV1MVZZH.jpg\"]', '[\"documents\\/01K0H9Q9XZCAXK7JHQFPM8G82D.pdf\"]', 'Unemployed', 'As a mindset change trainer, I\'d bring:\n\n1. *Empathy and understanding*: Creating a safe, non-judgmental space for clients to explore their thoughts and emotions.\n2. *Personalized approach*: Tailoring strategies to individual needs and goals.\n3. *Evidence-based techniques*: Utilizing proven methods like CBT, mindfulness, and positive psychology.\n4. *Inspiring and motivating*: Empowering clients to overcome obstacles and achieve growth.\n5. *Accountability and support*: Providing ongoing guidance and encouragement.\n\nMy strengths:\n\n1. *Active listening*: Understanding clients\' concerns and perspectives.\n2. *Creative problem-solving*: Developing innovative solutions.\n3. *Authenticity and transparency*: Building trust and rapport.\n4. *Continuous learning*: Staying updated on best practices.\n\nI\'d help clients:\n\n1. Identify and challenge limiting beliefs\n2. Develop resilience and confidence\n3. Cultivate positive habits and mindset\n', 'Yes', 'Amicaal Eswatini ', 'I worked at Amicaal Eswatini as a life mentor in the Manzini North inkhundla. I mentored the youth group about HIV and AIDS and how to live with it. I would take them to a mobile clinic organized by the company. I was a sister and a friend to the youth.', 'Yes', NULL, '2025-07-19 16:14:43', '2025-07-19 16:14:43'),
(709, 1215, '[\"documents\\/01K0HARHZV2MW9JAH133KC5MXH.jpg\",\"documents\\/01K0HARHZXRP43ANXW0K3EA0PT.jpg\",\"documents\\/01K0HARHZZQVW451FE4RTZ588B.jpg\"]', '[\"documents\\/01K0HARJ03QT1CCVVPQ2T9EP3B.jpg\"]', 'Unemployed', '1. I am a very eloquent speaker, English, Siswati and Korean therefore I would be an asset in working with diverse communities.\n2. I have a passion for the youth and my experience so far with many youth has given me insight on issues outside our scope hence I am very well vest with the issues , it\'s better to have an applicant who has had the youth exposure and i happen to possess that.\n3. I am a social work students hence this application will help enlarge my scope and knowledge on social issues and I can get to put the theory i learn in class into practice.\n4. I am the best candidate for the job because im good and well equipped in community engagement, collaboration and working with others cohesively. I believe in factual conversations conveyed in a respectful manner. ', 'Yes', 'Youth Action Movement ', '1. We offered education and awareness on Sexual Reproductive Health and issues related to health both males and females.\n2. We donate sanitary pads to schools that are hard to reach and under privileged.\n3.We do heath talks and dialogues where we engage in meaningful discussions with Youth members to discuss issues pertaining Eswatini Youth, location being Family life association of Eswatini Mbabane Youth Centre.', 'Yes', NULL, '2025-07-19 16:32:52', '2025-07-19 16:32:52'),
(710, 1218, '[\"documents\\/01K0HHZB9YEERMAC1RGQEE0PA4.jpeg\"]', '[\"documents\\/01K0HHZBA36SVXHQ2A0SWQV02B.docx\"]', 'Unemployed', 'I have applied for the Youth Mindset Change Trainer Programme because I am deeply committed to youth empowerment, social transformation, and creating safer, healthier communities. With a strong background in peer education, advocacy, and social accountability, I believe this programme aligns perfectly with my passion and experience.\n\nOver the years, I have gained extensive experience working with adolescents and young people through organizations such as Khulisa Umntfwana, SAfAIDS, and the Eswatini Network of Young Positives. My roles have involved leading community dialogues, coordinating gender-transformative projects, training peers, and participating in high-level advocacy meetings. These experiences have equipped me with the skills to connect with young people from diverse backgrounds, build trust within communities, and inspire positive change.\n\nAdditionally, I have undergone multiple relevant trainings, including Feminist Leadership, Youth Advocacy on SRHR and Entrepreneurship, and Social Accountability Monitoring. These have strengthened my understanding of community structures and sharpened my facilitation, communication, and leadership skills.\n\nI am confident that I am the best candidate for this role because I not only meet the requirements but bring a track record of impact, dedication, and a clear commitment to youth development. I am ready and fully committed to participate in all training sessions and to volunteer my time to bring about real change through mindset transformation at the community level.', 'Yes', 'SAfAIDS, Khulisa Umntfwana, ENYP+', 'None', 'No', NULL, '2025-07-19 18:38:55', '2025-07-19 18:38:55'),
(711, 1220, '[\"documents\\/01K0HV9Y0TC5C8VRAXJWD5PNZX.pdf\"]', '[\"documents\\/01K0HV9Y0XW6XT7D57W5K1BWYA.pdf\"]', 'Unemployed', 'It is in my best interest to educate and mobilize th youth about life and wellness education. Motivate them about school and their wellness. The youth is th future so they need more of peer to peer education on how they can improve their life', 'Yes', 'World vission', 'Teaching about HIV prevention at college ', 'Yes', NULL, '2025-07-19 21:21:59', '2025-07-19 21:21:59'),
(712, 1225, '[\"documents\\/01K0J5297KZ4CZJ4226TSQ8GDX.pdf\"]', '[\"documents\\/01K0J5297RP12APGFQXSTMRSV3.pdf\"]', 'Unemployed', 'I am young, talented and most importantly, motivated to take the job. I am in the midst of the crisis Eswatini is facing right now and instead of letting the pressure get to me, I am results oriented so my focus is on finding solutions rather than complaining about problems. I am young person who believes in methodology to achieve excellence. I may or may not be the best Candidate for the job, but I am an \"out of the box\" thinker, a problem solver, a solution finder and most importantly, I am a great candidate who is aiming for nothing less than excellence. ', 'No', 'None', 'None', 'Yes', NULL, '2025-07-20 00:12:34', '2025-07-20 00:12:34'),
(713, 1234, '[\"documents\\/01K0KC0XKNWTNG0F7PFRQC0TSZ.jpg\"]', '[\"documents\\/01K0YQDZR42G0JNRF00ZAF5QT7.heic\",\"documents\\/01K0YQDZRJQWWPMKFW24HTJWN6.heic\"]', 'Unemployed', 'I once been selected to attend a workshop which was hosted by commonwealth so we were trained how to help the youth to see at a bigger picture. \nI have a certificate in leadership and governance training program \nI have strengthened my ability to engage in professional discussions and advocate for positive change \nI have been in VOC where I gained experience in public speaking as I was working with the youth ', 'Yes', 'ENYC', 'Helping youth to start businesses like shisanyama giving them equipment to continue working like braai stand, spices  \nHelping the youth with seedling who wanted to do agriculture \nProviding sections with the youth to teach them about how to start a business n how as a youth where to go about when they need help from youth fund ', 'Yes', NULL, '2025-07-20 11:33:24', '2025-07-24 21:24:25'),
(714, 1257, '[\"documents\\/01K0WEVVHP73NRN7A6N16E43XB.jpg\"]', '[\"documents\\/01K0WEVVHWWSESSX9CSA2DHERB.docx\"]', 'Unemployed', 'I\'m the best candidate for this job because I possess a unique combination of empathy, creativity, and problem-solving skills. I\'m committed to creating safe, inclusive, and supportive environments where young people can thrive. My experience working with patients, at-risk youth and students has taught me the importance of tailoring approaches to meet individual needs.', 'Yes', 'Broadening Minds Redifining Manhood Obtaining Success(BRO)', 'As a member of BRO (Broadening Minds, Redefining Manhood, Obtaining Success), I contributed to initiatives that equip young boys with the skills and confidence to become great leaders in their communities.', 'Yes', NULL, '2025-07-24 00:16:13', '2025-07-24 00:16:13'),
(715, 1256, '[\"documents\\/01K0WK8QK2YXZ1K3NBR7JT1D0A.pdf\",\"documents\\/01K0WK8QKAFS7RXGXGWJKAYGDS.pdf\"]', '[\"documents\\/01K0WK8QKGZ26C72ZB45XW6RCR.docx\"]', 'Self-Employed', '\"I am excited to apply for this role because it aligns with my passion for empowering youth and promoting agriculture. With my extensive experience in voluntary work, mentoring, and community development, I am confident that I can make a meaningful contribution to your organization.\n\nAs a dedicated and results-driven individual, I have a proven track record of empowering learners, mentoring youth, and providing valuable insights on agriculture opportunities. My hands-on approach to teaching and mentoring has enabled me to make a tangible impact in my community, and I am eager to scale up my efforts in this role.\n\nI believe I am the best candidate for this job because of my:\n\n- Proven expertise in agriculture and youth development\n- Strong network and partnerships with organizations and stakeholders\n- Ability to inspire and motivate young people to pursue careers in agriculture\n- Hands-on approach to teaching and mentoring\n- Success stories and achievements in empowering youth and promoting agriculture\n\nI am excited about the opportunity to bring my skills and experience to your organization and contribute to the growth and development of the next generation of agricultural leaders and entrepreneurs. ', 'Yes', 'Eswatini National Agricultural Union  Youth Wing ', '\"Through my voluntary work, I\'ve empowered learners to grow their own vegetables, which are used in the school kitchen. I extend this support beyond the classroom, visiting homesteads to help families establish backyard gardens, promoting balanced nutrition. As a youth mentor, I provide valuable insights on agriculture opportunities, access to funding, and business development. My expertise has been sought by organizations, schools, and media outlets, where I share motivational talks and practical skills to attract youth to agriculture. Notably, I\'ve assisted several young farmers in securing funding and resources, including:\n\n- Helping a young farmer win E10,000 worth of farming inputs through the ENYC program\n- Supporting six young farmers in the Shiselweni region to access inputs from ESNAU/FUNCLUDE\n- Guiding a young lady to pursue a makeup course with Junior Achievement\n\nMy goal is to inspire and equip the next generation with the knowledge and skills to succeed not only agriculture but also in all entrepreneurship enterprises.', 'Yes', NULL, '2025-07-24 01:33:10', '2025-07-24 01:33:10'),
(716, 1254, '[\"documents\\/01K0YNMYR89KP3TCB2FEQS248Z.jpg\"]', '[\"documents\\/01K0YNMYRKH67D53PJQ2CYYFC6.jpg\",\"documents\\/01K0YNMYRW78V52XSPGWATBJEP.jpg\"]', 'Unemployed', '-I am passionate and willing to lead.\n-I am a youth and easy understanding and communication can be easy .\n-I have been in youth programs before.\n-I like to see my community youth grow and achieve.', 'Yes', 'International Youth Fellowship (IYF ', 'I did agriculture.\n-Teaching agriculture \n-Working in the garden teaching how to plant\n-Teaching how to have faith.', 'No', NULL, '2025-07-24 20:53:16', '2025-07-24 20:53:16'),
(717, 1259, '[\"documents\\/01K144FVG35CZZKC1X65D2TX5C.jpg\"]', '[\"documents\\/01K144FVGHA6YFXK4Z0D37K27Z.doc\"]', 'Unemployed', 'I applied here because I saw it an organization that is based on adolescent and youths living and it will be not my first time working with such people and I love and appreciate working with you very much I can interact with adolescent and young people by developing them good advice in growing.', 'Yes', 'Worldvision Eswatini Organization', 'In worldvision Eswatini organization I was working with adolescent and young people we usually groom them about living on how to earn a living, we usually have workshops whereby we teach them about how to maintain life aslo we give them some garden materials to do hand work to have a good life also we give them some goat to ensure that they are well taken off and empowering we also pay for some at school for school fees especially for those who have no parents to have bright future like every children as this organization is based on children\'s living organization as it is a Christian organization to show Gods love to young women and men.', 'Yes', NULL, '2025-07-26 23:48:50', '2025-07-26 23:48:50');
