(32, 34, 'Electrician', 'Employed', '4 years or more', 'Installation, inspection , testing and correction of new and existing wiring structures to ensure safety ', 'No', '[\"documents\\/01JQFT2QPX866H8AD3ZN42K1DA.jpeg\",\"documents\\/01JQFTF7JVSZ49NMSJMNE07BD3.jpeg\"]', '[\"documents\\/01JQFT8108D7GNX3X5T1VAMGC8.pdf\"]', 'I have applied to get assistance of a toolkit preferably ( EARTH RESISTANCE TESTER KIT)\nThe tool will enhance in inspection, testing and correction of high risk wiring structures in the community. This will ensure safety and eliminate electric shock \n\n\n', 'Yes', '76733356', 'Practical Experience Under A Qualified Technician', 'No', 'N/A', NULL, '2025-03-29 06:00:49', '2025-03-29 06:07:39'),
