(34, 36, 'Carpentry', 'Self-Employed', '4 years or more', 'First and foremost, the toolkit would allow me to enhance the quality and efficiency of my craft. With the right tools, I can complete projects with greater speed, accuracy, and precision—delivering results that meet and even exceed client expectations.  Having these tools would also enable me to take on larger workloads and a wider variety of tasks. I’d be able to handle custom jobs more effectively and reduce the need for outsourcing services such as cutting or edging, since I would now be equipped to do those in-house. This means shorter turnaround times and more competitive pricing, which are crucial in today’s market.  Another key use of the toolkit would be to empower others, especially the youth. I believe in sharing skills and creating opportunities, so I would use the toolkit to mentor and train apprentices, giving them hands-on experience and helping them build confidence in their abilities. Lastly, the toolkit would directly support my goal of producing high-quality, tailor-made furniture and fittings. It would help me turn creative ideas into functional, beautiful pieces that clients can be proud of.', 'Yes', '[\"documents\\/01JRBQ016Z4TDFV7F7DDQHR0VZ.pdf\"]', '[\"documents\\/01JQG3BXFKA503P6Y81MSHJSVT.png\",\"documents\\/01JQG3BXFQ24GZWJT71VQSFVPA.png\",\"documents\\/01JQG3BXFVK88TY0JCJSW4RGT2.png\",\"documents\\/01JRB3XJP8S8R68BK4W84A8Z42.pdf\",\"documents\\/01JRBQ017DBQJWS1VN51FYXWP1.pdf\"]', 'I applied to this program because I believe it can provide the boost I need to accelerate my business growth. I\'m committed to building a strong, reliable brand, and with the guidance and resources from this program, I’m confident I can enhance efficiency, reach new markets, and scale sustainably. It’s an opportunity to turn potential into real, measurable impact.\n', 'Yes', 'Momo-76497303', 'Tertiary Education', 'Yes', 'JA alumni ', NULL, '2025-03-29 08:43:07', '2025-04-10 15:13:38'),
(35, 37, 'Sewing', 'Self-Employed', '3 years', 'Start a business design and sew garments to sell and get tenders in companies ', 'Yes', '[\"documents\\/01JQG5X4J3TK2QWCST3B0SEYH8.jpg\"]', '[\"documents\\/01JQG5X4JD8FJGBRZGYG4Z0XCK.png\"]', 'I\'m graduating on the 11th of April...I was doing a sewing course under NHTC for the past 7 months....after graduation my wish is to start off my very own business.in this program I am hoping to get the help of a tool kit to start off ', 'Yes', '78425870', 'Practical Experience Under A Qualified Technician', 'Yes', 'World Vision ', NULL, '2025-03-29 09:27:29', '2025-03-29 09:27:29'),
