(42, 45, 'Sewing', 'Self-Employed', '1 year or less', 'I would use it as a self employment equipment. I would start working immediately. ', 'No', '[\"documents\\/01JQGP3FYXREK1V00T60XY5Y6W.jpg\"]', '[\"documents\\/01JQGP3FZNQVR5MBNCQDDFB8FM.jpg\"]', 'Well.. After my sewing course at MITC we got sewing machines of which we are grateful for,but the machines do not have an over locker stitch. I\'m hoping to get a sewing machine with an overlocker or just the overlocker machine. I can\'t sew garments from scratch because they need an overlocker. Getting an overlocker would be of great help. Its really holding me back. Locally I do have customers but I always turn them back because I lack proper equipment.', 'Yes', '76536965/960601 MOMO Pay', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-03-29 14:10:34', '2025-03-29 14:54:31'),
