(90, 101, 'Welding', 'Employed', '2 years', 'Firstly, I would be very grateful for the opportunity given since I\'ve been longing for owning this kit. I will start my own business of welding. As we know that welding goes a long way,I will manufacture window frames,burglar and burglar doors, all kinds of gates and Sliding gates, billboards,trailors, palisades etc. Additionally I will brand and advertise the name of my company in order to get customers in big companies like RES cooperation, Illovo, Eswatini Beverages and many other companies. I will also hire more youth of Eswatini to join hands with me in boosting the country\'s economy thus reducing the high unemployment rate in the country. Lastly, I will also donate some of the profits in charity so that your help can go a long way. Finally, I will be driven into a state of expending victory if I can be one of your nominated candidates in this project.', 'No', '[\"documents\\/01JQP92VMDMXMVYY6QPWZV3963.pdf\",\"documents\\/01JQP92VMKFZ5Y05N4MSGR1KJ4.pdf\"]', '[\"documents\\/01JQP92VN50FYPVTAA2JP3JSEV.jpg\"]', 'First and foremost I am very much pleased for this opportunity and I am looking forward to be one of your selected candidates. I have been working on my business and tried to archive a certain goal of owning this kit since I usually have customers who need me to manufacture window frames and burglar doors for them. All along I have been borrowing the tool kit from one of my colleagues in a form of rental. So now that is the main and backbone reason for me to apply for this kit. I am looking forward to receive the offer soon so that I\'ll be able to gain more experience in the field thus making a lot of profit in order to help other Swazi people in my area and in the entire nation as well. This kit will go a long way since I believe in myself and I believe in your decisions about the start up kits. I will be more grateful if I will be one of your chosen candidates.\n\nThank you.', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-03-31 18:18:28', '2025-03-31 18:18:28'),
(91, 102, 'Carpentry', 'Self-Employed', 'Unemployed', 'I have applied into this programme inorder to seek help into getting myself a toolkit to start with. Since I have completed my tertiary, things have not been going well. Sometimes I get called to do piece jobs and sometimes you find that I don\'t have the right tools or equipment to get the job done with.  Furthermore, it has now been difficult for me to save up and buy myself tools, because you find that the little that I receive from those jobs, I then try to help out with my Mother, since she is a single parent and un-employed.', 'No', '[\"documents\\/01JQP9G721DTFP2T63MC7NHN75.pdf\"]', '[\"documents\\/01JQP9G726T933K5ME5GR919YW.pdf\"]', 'I have applied intp this program inorder to seek help into getting myself a toolkit to start with. Thus helping me in making my work much easier with the right tools. From this program, what I really hope to gain is more information, knowledge and on about how to become successful.', 'No', '78409883', 'Tertiary Education', 'No', 'None', NULL, '2025-03-31 18:25:46', '2025-06-07 12:40:27'),
(92, 103, 'Sewing', 'Self-Employed', '2 years', 'I would use the toolkit to enhance my sewing skills by creating various projects such as clothing, home decor items, and accessories. It would also be useful for repairing garments, experimenting with different fabrics, and learning new techniques like quilting or embroidery. I can also use the toolkit to train others, expand my business and to employ more seamstresses.', 'No', '[\"documents\\/01JQP9JG83AQKR0B5ZZBM4VT4F.jpg\"]', '[\"documents\\/01JQP9JG86FNNHTZKGZP1SSB02.pdf\"]', ' As a dedicated seamstress with over five years of experience in tailoring and garment design, I have consistently sought opportunities to enhance my skills and expand my business. I have applied for the ENYC TVET Support Programme to gain advanced technical knowledge and access to modern sewing technologies that can significantly improve the quality and efficiency of my work. Additionally, I hope to learn effective business strategies that will enable me to scale my operations and reach a broader market. Participating in this programme will not only refine my craftsmanship but also empower me to contribute to the local economy by creating more employment opportunities and promoting sustainable fashion practices.', 'Yes', '76383616', 'Tertiary Education', 'No', 'N/A', NULL, '2025-03-31 18:27:01', '2025-03-31 18:27:01'),
(93, 104, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'I will use the toolkit in motor mechanic ', 'No', '[\"documents\\/01JQPBYS5NASQZVP198C1R9S86.pdf\"]', '[\"documents\\/01JQPBYS5VZQVFD76NHTJ79GVD.pdf\"]', 'I kindly apply for this program because I\'m lacking tools for my practice. Also it will help me while I\'m gaining knowledge and experience ', 'No', 'N/A', 'Tertiary Education', 'No', 'N/A', NULL, '2025-03-31 19:08:41', '2025-03-31 19:08:41'),
