(106, 117, 'Sewing', 'Unemployed', 'Unemployed', 'I would use the tool kit to maximize my production as well as the quality of my merchandise.This will increase my competitive advantage this maximizing my profits. This will allow me to achieve my dream of opening a boutique of my own.', 'Yes', '[\"documents\\/01JQQ0Q9AEV3K7DV7VC71E03VS.pdf\"]', '[\"documents\\/01JQQ0Q9AK4608W6T3NSS6JWD6.jpeg\",\"documents\\/01JQQ0Q9APNK381B3H0HP6VFP4.jpeg\",\"documents\\/01JQQ0Q9ATG4T3C7KRCQVE8VSS.jpeg\",\"documents\\/01JQQ0Q9B292KH71V81YGCAPF6.jpeg\",\"documents\\/01JQQ0Q9B626QRBDS51ZGT98F6.jpeg\",\"documents\\/01JQQ0Q9B80T178Y7G1N4F5BXC.jpeg\"]', 'I have  applied for this program because of my burning desire to become a young successful fashion designer and business woman, I have hope that this program will be my stepping stone  into the entrepreneurial world. I hope to gain knowledge from this program and to grow through this program and be one of the youngest entrepreneurs in the kingdom of Eswatini.Thank you for your anticipated cooperation,I hope my application reaches your desired expectations.', 'Yes', '76086461', 'Tertiary Education', 'Yes', 'YALI network ', NULL, '2025-04-01 01:11:35', '2025-04-01 01:11:35'),
(107, 118, 'Welding', 'Unemployed', '1 year or less', 'I\'m going to be self employed and start my own  because I will be all the tools the are needed in order to complete work nicely and provide neat work to customers. ', 'No', '[\"documents\\/01JQQ1EKRCWPP2NMR5WNBN2HEJ.jpg\"]', '[\"documents\\/01JQQ1EKRFC0R6QZ4HSEH4V7MJ.jpg\"]', 'I applied because I want to be self employed  and boost the economy of the country and my economy, I also applied to help others by sharing my skill to them so that they could  able to stand on their and start their own businesses. I hope in this program I will be able to learn more about my skill, and I hope my application will be successful.', 'Yes', '78285243', 'Tertiary Education', 'No', 'None', NULL, '2025-04-01 01:24:19', '2025-04-01 01:24:19'),
(108, 119, 'Carpentry', 'Self-Employed', '3 years', 'Cabinet making, fitting and interior designing ', 'No', '[\"documents\\/01JQQGTTX9EP1SY7RQT35A0B6B.jpg\"]', '[\"documents\\/01JQQGTTXGJF4JK4FTR2AYQCBS.jpg\",\"documents\\/01JQQGTTZEF9V2RH5BBBYXJSQ3.jpg\"]', 'Am applying here to boost my company and add more labour to a new workshop that I want to build in my home place. To encourage young people who are unemployed and provide them with job opportunities ', 'Yes', ' Momo -78512143', 'Tertiary Education', 'No', 'None', NULL, '2025-04-01 05:53:09', '2025-07-16 07:58:38'),
(109, 120, 'Carpentry', 'Self-Employed', '1 year or less', 'I would ceiling, cupboard,wall units,stud walls, suspended wood floors. I could also make beds .', 'Yes', '[\"documents\\/01JQQREZNEX3TJ805GW8XAMPTS.jpg\"]', '[\"documents\\/01JQQREZNXV9SE2Q6E469767X3.jpg\"]', 'I have seen it as a great opportunity for us youngsters as we lack financial support to start businesses with our talents.\nI hope to gain support and tools to strive and conquer every assigned job.This would also help in motivating other youngsters to start working on their skills.', 'Yes', '76717403', 'Tertiary Education', 'Yes', 'CCECC', NULL, '2025-04-01 08:06:29', '2025-04-01 08:06:29'),
(110, 121, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'I will help local motor vehicle owners and gain inco5', 'Yes', '[\"documents\\/01JQQW8JSG8FT262YDWRGJQW2Z.jpg\"]', '[\"documents\\/01JQQW8JSRR3A2TBEMK242Y831.pdf\"]', 'Eversince I graduated I\'ve been working with local mechanics to gain more practice and experience and now I\'m fit to do the work alone but I\'m lacking toolkit to be independent ', 'Yes', '78057157', 'Tertiary Education', 'Yes', 'Red Cross Society ', NULL, '2025-04-01 09:12:53', '2025-04-01 09:12:53'),
