(112, 123, 'Carpentry', 'Self-Employed', '4 years or more', '𝐈 𝐰𝐨𝐮𝐥𝐝 𝐮𝐬𝐞 𝐢𝐭 𝐭𝐨 𝐜𝐨𝐦𝐩𝐥𝐞𝐭𝐞 𝐦𝐲 𝐭𝐚𝐬𝐤 𝐦𝐚𝐤𝐢𝐧𝐠 𝐟𝐮𝐫𝐧𝐢𝐭𝐮𝐫𝐞 𝐚𝐧𝐝 𝐜𝐚𝐛𝐢𝐧𝐞𝐭𝐬', 'No', '[\"documents\\/01JQR3C4J9PAXQHHPBTMJ7NMTS.jpg\"]', '[\"documents\\/01JQR3C4JPXGREP2TARVPPE68Y.png\"]', '𝐈\'𝐯𝐞 𝐚𝐩𝐩𝐥𝐢𝐞𝐝 𝐛𝐞𝐜𝐚𝐮𝐬𝐞 𝐢 𝐧𝐞𝐞𝐝 𝐭𝐡𝐢𝐬 𝐩𝐫𝐨𝐠𝐫𝐚𝐦 𝐭𝐨 𝐡𝐞𝐥𝐩 𝐦𝐞 𝐰𝐢𝐭𝐡 𝐭𝐨𝐨𝐥𝐬 𝐚𝐧𝐝 𝐬𝐭𝐚𝐫𝐭 𝐦𝐲 𝐨𝐰𝐧 𝐛𝐮𝐬𝐢𝐧𝐞𝐬𝐬. 𝐒𝐢𝐧𝐜𝐞 𝐢𝐦 𝐧𝐨 𝐥𝐨𝐧𝐠𝐞𝐫 𝐞𝐦𝐩𝐥𝐨𝐲𝐞𝐝 ', 'Yes', '𝐌𝐨𝐦𝐨/76082567', 'Tertiary Education', 'No', '𝐍𝐨𝐧𝐞', NULL, '2025-04-01 11:17:10', '2025-04-01 11:17:10'),
