(166, 177, 'Plumbing', 'Unemployed', '1 year or less', 'I\'ll greatly appreciate to be awarded toolkit because it\'s gonna make any plumbing job offer easy and convenient to perform at anytime whether it\'s a short term job or long term job. Moreover, it\'s going to he\'ll me complete my Plumbing work so easy without any delay since I\'ll be having every tool required to complete my project. Incase am permanently employed in any Plumbing Institution, a toolkit is going to help me during weekends if I attend any client\'s job offer pertaining any plumbing service e.g, plumbing Installations, cold water supply system and drainage system. ', 'No', '[\"documents\\/01JQVERXESYTZP4ZRRETCR2M8C.jpg\"]', '[\"documents\\/01JQVERXFCMVMRCJ3FV1DZB0YS.jpg\"]', 'I kindly applied on the ENYC youth development programme to stand an offer of my vocational work toolkit or toolbox for my plumbing career and am being hopeful and positive that my application to this program will kindly be taken to much consideration and be successful.', 'Yes', '76645727', 'Tertiary Education', 'No', 'None ', NULL, '2025-04-02 18:34:06', '2025-04-02 18:34:06'),
(167, 178, 'Electrician', 'Unemployed', 'Unemployed', 'If awarded a toolkit for my vocational skill, I would use it to start a business to become self-sufficient.', 'No', '[\"documents\\/01JQVGQJAMNCE5RJX5ADYSW882.pdf\"]', '[\"documents\\/01JQVGQJB44DE7NBR9J1TXJJXR.pdf\"]', 'A starter kit would significantly improve my life by providing me with the tools necessary to become more independent and self-sufficient in my electrical work. This would allow me to confidently offer a wider range of services, not only improving my own livelihood but also benefiting my community by providing essential electrical assistance to those in need.\n\n', 'Yes', 'MOMO - 76362670', 'Tertiary Education', 'No', NULL, NULL, '2025-04-02 19:08:19', '2025-04-02 19:08:19'),
(168, 179, 'Carpentry', 'Self-Employed', '4 years or more', 'I would use it for making furnitures in order to get money, and buy another tools so that my products to be looking good, and attractive to my clients.', 'No', '[\"documents\\/01JQVJS8N4S0N7FQF55NHGWGMY.jpg\"]', '[\"documents\\/01JQVJS8NAACQT5JGD7D5XMAF9.jpg\"]', 'I  applied because I am shortage of power tools which are making the work easier for me, and save time. It\'s will also help to be more faster to provide my clients with their goods. It also give me an advantages of getting more customers in a short space of time. I hope the program will also help me to uplift my skill.', 'Yes', '76870748', 'Practical Experience Under A Qualified Technician', 'No', 'None ', NULL, '2025-04-02 19:44:12', '2025-04-02 19:44:12'),
(169, 180, 'Electrician', 'Self-Employed', 'Unemployed', 'If I were awarded a toolkit for my vocational skill as an electrician, I would use it to enhance my craft, improve safety, and expand my service offerings. Equipped with high-quality tools, I would focus on both residential and commercial electrical systems, ensuring that I can effectively tackle a variety of projects.  One primary use of the toolkit would be for routine maintenance and repairs. Having reliable tools like wire strippers, multimeters, and voltage testers on hand would enable me to quickly diagnose and fix issues, ensuring that my clients’ electrical systems are safe and functioning optimally. This efficiency would not only improve customer satisfaction but also contribute to my reputation as a skilled electrician.  Additionally, I would utilize the toolkit for installation projects, such as lighting fixtures, outlets, and circuit breakers. By having specialized tools, I could execute these tasks with precision, adhering to safety codes and best practices, which is paramount in our field. This would also empower me to take on more complex installations, thereby broadening my expertise and service capabilities.  Moreover, I would use the toolkit to promote safety in my work environment. Investing in insulated tools and personal protective equipment would further minimize risks associated with electrical work. Ensuring safety not only protects me but also my clients and colleagues.  Finally, I would share my knowledge and skills with aspiring electricians in my community. By hosting workshops or training sessions, I could demonstrate the effective use of tools and techniques, fostering a culture of safety and competence in the trade.  In summary, a toolkit would be invaluable for enhancing my skills, ensuring safety and stability in my work, and giving back to the community.', 'Yes', '[\"documents\\/01JQVQ1QDQ9NV30TTRNGXC48SB.jpg\"]', '[\"documents\\/01JQVQ1QE95EZ801AA01NJCZTS.pdf\"]', '\nI have applied for this program because I am eager to transform my entrepreneurial ideas into a successful business venture. As an aspiring entrepreneur, I recognize the importance of having a solid foundation and the right resources to navigate the complexities of starting and running a company. This program represents an invaluable opportunity to acquire essential tools and knowledge that will empower me to turn my vision into reality.\nOverall, I am excited about the possibility of participating in this program, as it aligns perfectly with my goals of learning and growth in the entrepreneurial space. I am committed to leveraging the tools and knowledge I gain to establish a thriving business that contributes positively to the community.\n\nThank you for considering', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'Yes', 'IYF ', NULL, '2025-04-02 20:58:44', '2025-04-02 20:58:44'),
(170, 181, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'Start fixing people\'s cars', 'No', '[\"documents\\/01JQVS0PDVCFH6Y7RJZS4WSZKA.jpg\"]', '[\"documents\\/01JQVS0PDZ127DD4ZMEPX1SK24.jpg\"]', 'I am applying because I need a start up tool kit so that I can start fixing people\'s cars', 'No', NULL, 'Tertiary Education', 'No', NULL, NULL, '2025-04-02 21:33:07', '2025-04-02 21:33:07'),
