(174, 185, 'Sewing', 'Unemployed', '3 years', 'Having my own workshop and design clothes for business purposes ', 'No', '[\"documents\\/01JQW103653QA0KFVWJB3Z402R.jpg\"]', '[\"documents\\/01JQW1036CB1TM25X9KDBSB6KD.jpg\"]', 'Due to the challenge we are facing as young people where we see the increase in the rate of unemployment, my eyes are opened that if there are no jobs then I must be the one creating them.\n\nI just have it in my heart that if I can just get one skill and sewing was the one I chose. Having it in my heart that if I can get a good sewing machine, my life would have change because of this skill. \nThere are a lot of business opportunities that are related to sewing, school uniforms, wedding outfits, chair covers to mention a few. Actually it has been asserted to the fact that sewing covers much space in our daily activities as life is concerned. \nI am hoping for any kind of assistance from this program. Actually I am in separate need of sewing machines (overclock and straight) machines.\n\nI promise to change my life and those around me if I can get such help.\n', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-02 23:52:36', '2025-04-02 23:52:36'),
