(184, 195, 'Sewing', 'Unemployed', 'Unemployed', 'start a sawing business from home, where i would design, saw and sell t-shirts, jersey\'s, shirts, track-suits, pillow cases , school uniform, sport tracks. i would also help me grow my skills as i work towards bigger markets where i would be tailoring designer dresses, suits and atire\'s  for events and wedding ceremonies. within the Shiselweni Region and eventualy throughout the country. It would be a very great opportunity to develop my dreams into a hopefully sustainable and fast growing centre for all   all fashion.', 'No', '[\"documents\\/01JQXGNKVA2WWE6X7PAR6EN9JN.pdf\"]', '[\"documents\\/01JQXGNKVG6NDTKRJW4H2BSCP2.pdf\"]', 'Passion is a valuable motivator for a dreamer like me, though resources are the main requirements for any passion to convert into a career. With this Starter Kit, I would start to develop my passion for fashion into a sustainable business that will grow alongside my skills as a business woman. With a strangling background, this Kit would help reshape the situation in my family and hopes for a brighter future. ', 'Yes', '7655 2572', 'Tertiary Education', 'No', NULL, NULL, '2025-04-03 13:45:44', '2025-04-03 13:45:44'),
(185, 196, 'Electrician', 'Self-Employed', '2 years', 'I would advance my work to be competent nationally through innovations and of course grow the business. ', 'Yes', '[\"documents\\/01JQXNEVT3SS3B5XMBV6Z02XBB.jpg\"]', '[\"documents\\/01JQXNEVV3RXRHDNE5M00WN1FD.jpg\"]', 'My burning desire to execute my skills in digitals and electronics particularly on videography has led me to this program. I want to equip myself will all necessary working equipment so to meet the need of professional videographer in the Shiselweni region. ', 'Yes', 'Momo - 78270656', 'Tertiary Education', 'No', 'None', NULL, '2025-04-03 15:09:26', '2025-04-03 15:09:26'),
(186, 197, 'Electrician', 'Unemployed', 'Unemployed', 'I would use it to practice more and gain more experience, to an extent of getting a trade test certificate. Then also engage my fellow community\'s youth to equip themselves as well. Since in our days it is very difficult to find job opportunities. Having a skill is what brings food in the table than sitting at home doing nothing.', 'No', '[\"documents\\/01JQXQ54NV1KE9CCA0RY0ZQE4Y.jpg\"]', '[\"documents\\/01JQXQ54P472W1J6FG2732YQ7A.jpg\"]', 'I have always dreamt of opening a workshop or something similar to it. I have a heart for people to an extent of helping them have a brighter future, as the youth is our tomorrow. I hope to gain experience and my trade test certificate so that I can be able to achieve the above mentioned, because I can achieve anything without experience. Also the exposure from interacting with the youth from different regions of Eswatini.', 'Yes', '76305114', 'Practical Experience Under A Qualified Technician', 'No', NULL, NULL, '2025-04-03 15:39:04', '2025-04-03 15:39:04'),
(187, 198, 'Plumbing', 'Employed', '1 year or less', 'I\'ll be self employed and do domestic plumbing and maintenance.', 'No', '[\"documents\\/01JQXQWC03P1CN78B9HNN971PE.jpg\"]', '[\"documents\\/01JQXQWC07V9N6W9VEY598XX63.jpg\"]', 'When I went to tertiary I wanted to be self employed, have my own company and be my own boss then hire other people so that they can earn a living. \n\nI hope I\'ll be one of the chosen and live my dream \n\nThank you ', 'Yes', '76969955', 'Tertiary Education', 'No', NULL, NULL, '2025-04-03 15:51:45', '2025-04-03 15:51:45'),
(188, 199, 'Carpentry', 'Unemployed', 'Unemployed', 'I would become self employed and market my skills so that I get more clients to do the job and make a living out of it', 'No', '[\"documents\\/01JQXR8BGAZJVX14GEAKN94JR6.jpg\"]', '[\"documents\\/01JQXR8BHCZK1SM0CP13F3D3CN.jpg\"]', 'I want to  gain knowledge and experience then make a living by my vocational skills then create job opportunities for some people. ', 'No', NULL, 'Practical Experience Under A Non-Qualified Technician', 'No', 'None', NULL, '2025-04-03 15:58:18', '2025-04-03 15:58:18'),
(189, 200, 'Electrician', 'Unemployed', 'Unemployed', 'With an electrical wiring toolkit, I would apply my skills from BSA Training Center to take on electrical installation and repair projects. I would use it to perform household and commercial wiring, troubleshoot electrical faults, and possibly offer freelance services. Additionally, the toolkit would help me as I work toward obtaining my electrical certification, allowing me to gain practical experience and build a foundation for future business opportunitiesWith an electrical wiring toolkit, I would apply my skills from BSA Training Center to take on electrical installation and repair projects. I would use it to perform household and commercial wiring, troubleshoot electrical faults, and possibly offer freelance services. Additionally, the toolkit would help me as I work toward obtaining my electrical certification, allowing me to gain practical experience and build a foundation for future business opportunities', 'Yes', '[\"documents\\/01JQXS9V97PGN4AZZQKAAJRN03.pdf\"]', '[\"documents\\/01JQXS9V9DYND81FCDZT6BM9FT.pdf\",\"documents\\/01JQXS9V9H3YS7JNVMYJX0H84N.pdf\"]', 'I have applied because this would enhance my electrical skills. This would also help me in finding employment opportunities which would expand my my skills.\nAnd lastly It could help me with connecting with mentors and other skilled youth which can open doors for future projects and partnerships.I have applied because this would enhance my electrical skills. This would also help me in finding employment opportunities which would expand my my skills.\nAnd lastly It could help me with connecting with mentors and other skilled youth which can open doors for future projects and partnerships.', 'No', NULL, 'Tertiary Education', 'No', 'World vision ', NULL, '2025-04-03 16:16:36', '2025-04-03 16:16:36'),
(190, 201, 'Sewing', 'Unemployed', 'Unemployed', 'To start sewing school and church uniforms. While self-employed, I\'ll employ some people in my community. ', 'Yes', '[\"documents\\/01JQXXRGDMVY9Z762ADWBPJ8J6.jpg\"]', '[\"documents\\/01JQXXRGDRJWKH04MB0YAZ484Z.jpg\"]', 'I hope to gain much needed capital so that I can start my dream business of sewing. Upon commencement, I\'ll succeed and employ a number of people, thus helping to curb the issue of high unemployment in the country. ', 'Yes', 'MoMo 78469581', 'Practical Experience Under A Qualified Technician', 'Yes', 'Siyatfutfuka organization ', NULL, '2025-04-03 17:34:30', '2025-04-03 17:34:30'),
(191, 202, 'Sewing', 'Self-Employed', '3 years', 'If awarded a toolkit for my vocational skills in the sewing industry, I would utilize it to enhance my craftsmanship and expand my business capabilities. The toolkit would ideally include high-quality sewing machines, various fabrics, cutting tools, and resources for pattern making.   Firstly, I would use the sewing machines to create high-quality garments and accessories. Investing in advanced equipment would allow me to experiment with innovative designs and techniques, ultimately elevating my work and attracting a broader clientele. Having access to diverse fabrics would enable me to explore various styles, catering to different fashion trends and consumer preferences. Additionally, I envision using the toolkit to set up workshops for aspiring seamstresses in my community. By sharing my skills and knowledge, I hope to empower other women to pursue careers in the sewing industry. This initiative could foster a supportive environment where creativity flourishes, and participants can learn essential skills that enhance their employability.', 'No', '[\"documents\\/01JQXXRZB4Z467TBKMTW78NVD3.pdf\"]', '[\"documents\\/01JQXXRZB8ZMJZA9JZ3N695Z03.png\"]', 'I have applied for this program because I am passionate about the sewing industry and committed to honing my skills to create meaningful opportunities for myself and others. As a woman in this field, I have experienced both the challenges and joys that come with pursuing a creative career. This program presents a unique opportunity for me to gain valuable insights, technical expertise, and networking connections that can significantly advance my career.\n\nThrough this program, I hope to acquire advanced sewing techniques and knowledge about the latest trends and technologies in the industry. I believe that expanding my skill set will enable me to produce higher quality products, allowing me to stand out in a competitive market. I am particularly interested in learning about sustainable practices in fashion, as I want to ensure that my work not only reflects my creativity but also considers environmental impact.\n\nAdditionally, I aim to connect with like-minded individuals who share my passion for sewing and entrepreneurship. Building a supportive network of fellow women in the industry can provide inspiration, collaboration opportunities, and mentorship. I value the exchange of ideas and experiences that can arise from this program, as they can motivate me to innovate and push my creative boundaries.\n\nUltimately, I hope that this program will empower me to establish a successful sewing business, while also enabling me to give back to my community by sharing my knowledge and encouraging other women to pursue their interests in the sewing industry.\n', 'Yes', '76809128', 'Practical Experience Under A Qualified Technician', 'No', 'n/a', NULL, '2025-04-03 17:34:46', '2025-04-03 17:34:46'),
