(193, 204, 'Electrician', 'Unemployed', 'Unemployed', 'If I were to be awarded the toolkit ,I would start up my own business. I would also provide for my mother and my kids.', 'Yes', '[\"documents\\/01JQY74T6VHQ6JGDAWSFJ2F653.png\"]', '[\"documents\\/01JQY74T7CD01RKC4QPP999BYN.png\"]', 'I have applied here ,in order for me to be a self independent person,not to depend on anyone,with high hopes of getting the toolkit,and by having the toolkit I can be able to start up my own business and provide for my mom and kids .', 'No', 'None', 'Tertiary Education', 'Yes', 'Georgetown university', NULL, '2025-04-03 20:18:31', '2025-04-03 20:18:31'),
