(214, 225, 'Sewing', 'Unemployed', 'Unemployed', 'A sewing toolkit would help me refine my skills, create custom clothing, and start a business. I could offer alterations, design unique pieces, and teach others through workshops or tutorials. More than just tools, it would be a path to creativity and financial growth.', 'No', '[\"documents\\/01JR065082CE4J0AABQGMMAMDP.pdf\"]', '[\"documents\\/01JR065089G6P9EMYGBDACEDAM.pdf\"]', 'I have applied for this program because I am passionate about sewing and eager to enhance my skills, gain hands-on experience, and explore opportunities in the fashion and tailoring industry. Sewing is more than just a hobby for me; it is a skill I want to develop into a professional craft that can open doors to new possibilities. This program offers the perfect platform for me to refine my abilities, learn advanced techniques, and understand the business aspects of tailoring and fashion design.\n\nOne of my main goals is to improve my sewing proficiency, from mastering different stitching techniques to understanding fabric selection and pattern-making. I believe that professional guidance will help me perfect my craft and build confidence in my work. With access to expert knowledge and high-quality resources, I can refine my skills and create well-made, stylish, and durable garments.\n\nBeyond technical skills, I am also interested in the entrepreneurial side of sewing. Many people seek tailor-made outfits and alteration services, and I see an opportunity to turn my passion into a business. This program can equip me with the knowledge needed to start and manage a successful sewing business, from pricing my services to marketing my products effectively. Learning about customer preferences, fashion trends, and business strategies would be invaluable in establishing myself in the industry.\n\nAdditionally, I hope to connect with experienced professionals and like-minded individuals who share my passion for sewing. Engaging with mentors and peers can provide inspiration, new ideas, and networking opportunities that will be beneficial for my growth.\n\nUltimately, I want to use the knowledge and skills gained from this program to build a successful sewing business and empower others by sharing what I have learned. This opportunity is a crucial step toward achieving my dreams.', 'No', NULL, 'Tertiary Education', 'No', NULL, NULL, '2025-04-04 14:39:37', '2025-04-04 14:39:37'),
(215, 226, 'Sewing', 'Unemployed', 'Unemployed', 'I will help people with services and they will pay me and I will earn earn a living.thus making life easy', 'No', '[\"documents\\/01JR07SBRCJMVWDPSWW8ZEAK4P.jpg\"]', '[\"documents\\/01JR07SBRPB5DPQV3BWSG3RPG4.png\"]', 'I hope toget the start up kit so that I make money through my sewing skill and take care of my family needs', 'Yes', '78198043', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-04 15:08:13', '2025-04-04 15:08:13'),
(216, 227, 'Welding', 'Unemployed', 'Unemployed', 'Start up a small business in my community which I believe one day it will become a bigger (as in workshop). Then later employ other young people in my community which will decrease the level of employability in the community and also teenager pregnancy because when young girls will be independent than on boyfriends.', 'Yes', '[\"documents\\/01JR09WWBYP7CHBQXK8D3PBHAS.jpg\"]', '[\"documents\\/01JR09WWE8VHY5KPS3PAJAHMW3.jpg\",\"documents\\/01JR09WWG6X7K9S3P2W27YBHK1.jpg\"]', 'I applied because I want to start my own business one day and I believe it will be a successful one..It will be a fabrication company,own a workshop in my community..Fabricate items like wash line,door frame,window frame,gates,braai stand etc..Then I believe later on I will be a well known company and be a subcontractor in big companies around the country..I want to improve the standard of living in my community as I will be employing them which will decrease the level of employability in my community..I want to empower other young girls and show them that vocational skills can make you a successful young woman one day if you work hard...In addition to that I also want to reduce the level of teenage pregnancy in my community because young girls fall pregnant due to desperation,they want money from sugar daddy.. I want them to work and be independent.Thank you', 'No', 'N/A', 'Tertiary Education', 'Yes', 'Chakaza ntombi under Georgetown University ', NULL, '2025-04-04 15:45:06', '2025-04-04 15:45:06'),
(217, 228, 'Electrician', 'Self-Employed', 'Unemployed', 'Provide the quality service.They would make sure I am safe and would save time.', 'No', '[\"documents\\/01JR0APJ1DK5KQ4BF3EEYPCHBM.jpg\"]', '[\"documents\\/01JR0APJ1H27JMMBFSBR3CSPR8.jpg\"]', 'Provide quality service.Gain reputation.', 'Yes', '78353478', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-04 15:59:07', '2025-04-04 15:59:07'),
(218, 229, 'Plumbing', 'Unemployed', 'Unemployed', 'Particular task', 'No', '[\"documents\\/01JR0B85PVT75ZF8K46R8J8BPD.jpg\"]', '[\"documents\\/01JR0B85QF66G4Z6V4B8QCPXAN.jpg\"]', 'It\'s because I need a toolkit so that I will be able to do particular jobs, I hope that this program will help me by a toolkit. ', 'Yes', '78427635', 'Practical Experience Under A Qualified Technician', 'No', '-', NULL, '2025-04-04 16:08:44', '2025-04-04 16:08:44'),
(219, 230, 'Plumbing', 'Unemployed', 'Unemployed', 'I would like to be self independent. Starting my own company. Also working harder to support my siblings with their needs and also paying their school fees.', 'No', '[\"documents\\/01JR0BGKY4D6CBC1SND0FXX0DP.jpg\"]', '[\"documents\\/01JR0BGKY8D4VCGBJ810RWQ2RF.pdf\"]', 'I have applied to this program so that I can be gifted with plumbing toolkits. I am highly hopping that this program will be helpful to me, since I\'m desperate for plumbing toolkits. I can highly appreciate if my application will be successful so that I can start working and be self dependent. Without work life is difficult, therefore I\'m seeking help from this program with the toolkit, so that I can start working and earn a living. ', 'Yes', 'Standard bank - 911 000 679 3013', 'Practical Experience Under A Qualified Technician', 'Yes', 'Eswatini scouts association ', NULL, '2025-04-04 16:13:21', '2025-04-04 16:13:21'),
(220, 231, 'Plumbing', 'Self-Employed', '1 year or less', 'I will use toolkit for improving my business in plumbing for people\'s houses, Also maintaining people\'s houses', 'Yes', '[\"documents\\/01JR0DN27H7HE91CAV3FXXCNZM.jpg\"]', '[\"documents\\/01JR0DN27VPQ9RAT21R86A4QRW.jpg\"]', 'I apply for seeking for help for awarded toolkit to improve my business in plumbing and this will help me to gain more experience because if you have tools to work  and it easy to do Job quickly and get money .Also can help my business to succeed and I can also hire some assistance this can help in community ', 'Yes', '76747090', 'Practical Experience Under A Qualified Technician', 'Yes', 'International youth fellowship ', NULL, '2025-04-04 16:50:44', '2025-04-04 16:50:44'),
(221, 232, 'Sewing', 'Unemployed', 'Unemployed', 'I would love to join the industry of sewing school uniforms, because currently am only sewing skirts for church ladies.', 'Yes', '[\"documents\\/01JR0EDQFG5GD6W8431RFV8VAK.jpg\"]', '[\"documents\\/01JR0EDQFPZ1MWTS6FGHVKKNZ4.jpg\"]', 'I have applied for a toolkit so I can easily do my sewing since I now only have a sewing machine. I believe I will get help from the program with the other objects like drafting materials and an overlocker.', 'No', 'None', 'Tertiary Education', 'Yes', 'Bontsanga literacy Club', NULL, '2025-04-04 17:04:12', '2025-04-04 17:04:12'),
(222, 233, 'Carpentry', 'Unemployed', '1 year or less', 'A starter kit with professional tools and equipment would significantly improve my ability to deliver higher quality work, complete projects more efficiently, and expand my range of services. It would allow me to take on larger, more complex projects, which could increase my income and improve my business prospects.', 'No', '[\"documents\\/01JR0EDVFT52FQQN41H6FN17C3.png\"]', '[\"documents\\/01JR0EDVFZPB1W4141KTA2H9SY.pdf\"]', 'I hope toget a starter toolkit and start my own business.', 'Yes', '78256608 mobile money ', 'Tertiary Education', 'No', 'None', NULL, '2025-04-04 17:04:16', '2025-04-04 17:04:16'),
(223, 234, 'Carpentry', 'Unemployed', '1 year or less', 'I would start working so that i can sharpen my working skills', 'Yes', '[\"documents\\/01JR0ERYRP2BZ6DQNB2473QPH7.jpg\"]', '[\"documents\\/01JR0ERYSDGNDV6D9565NG6Q45.jpg\"]', 'I have applied because i wish to get a working toolkit.I have trained but now i do not have the working materials do that i can continue sharpening my skills. I wish to have my own material because i wish to be my own boss and maybe one day i can grow and have my own company. ', 'Yes', '76902137', 'Practical Experience Under A Qualified Technician', 'Yes', 'George town university ', NULL, '2025-04-04 17:10:20', '2025-04-04 17:12:35'),
(224, 235, 'Sewing', 'Self-Employed', '2 years', 'I am currently borrowing a sewing machine, the toolkit will give me an opportunity to own a sewing machine thus increasing my business revenue.', 'No', '[\"documents\\/01JR0FYJYCY6VAHJSHVCA33PPM.pdf\"]', '[\"documents\\/01JR0FYJYHPMQE44DP5Z666VXA.pdf\"]', 'I have applied for the Sewing Toolkit Support because I am a passionate tailor striving to establish a sustainable sewing business. Sewing has been a part of my life since childhood, when I used to mend my siblings\' clothes and hand-stitch small garments. Over time, I developed my skills further by attending part-time sewing lessons at Lunyatsi Community Centre.\n\nCurrently, I sew school uniforms, church pre-school uniforms, and other custom-made outfits such as bonnets and scrunchies for my community. However, my progress has been limited due to a lack of essential tools and equipment. The sewing toolkit will provide me with the necessary resources to improve my efficiency, increase production, and offer better-quality products to my customers.', 'No', NULL, 'Practical Experience Under A Non-Qualified Technician', 'Yes', 'Nazarene Youth International(NYI)', NULL, '2025-04-04 17:30:53', '2025-04-04 17:30:53'),
(225, 236, 'Welding', 'Unemployed', 'Unemployed', 'If I can get a toolkit, It’ll be a great honor for me, I’m in short of tools. I want to open a welding and fabrication workshop. ', 'Yes', '[\"documents\\/01JR0HA0SC8N1DJV2NN0RCRFZZ.jpeg\"]', '[\"documents\\/01JR0HA0SH68AZWZSWXCJ32437.jpeg\"]', 'The reason I applied for this support program is because I want to put my dreams in to reality, my biggest dream is to own a workshop whereby I can deal with steel works (fabricate ,repair, sell) etc. If I can get this toolkit it’ll play a major role not only for me but also to my community because I’ll just pick people who can help me by so i’ll be teaching them the skill at the very same time give them money so that they can feed their families.\nI am hoping to get a startup tools for my workshop, so that I can start producing put my dream into reality, extend my business.', 'Yes', 'NEDBANK - 4314610004761192', 'Tertiary Education', 'Yes', 'JA Eswatini', NULL, '2025-04-04 17:54:36', '2025-04-04 17:54:36'),
