(229, 240, 'Electrician', 'Employed', '1 year or less', 'Part time jobs to help me cater for my family, what am currently earning is not enough but I am grateful for the experience I am getting on my job.', 'Yes', '[\"documents\\/01JR0P86MJYAZ768DZSM7D95PQ.pdf\"]', '[\"documents\\/01JR0P86MWA3R0Y0BJMAG17VQ4.pdf\"]', 'I hope to gain a tool kit which would help me raise more funds through side hustling, so I can register and open my own electrical company and focus on my dream.', 'No', 'none', 'Tertiary Education', 'Yes', 'Lobamba Lomdzala Electrical and Water Scheme', NULL, '2025-04-04 19:20:59', '2025-04-04 19:20:59'),
(230, 241, 'Carpentry', 'Unemployed', 'Unemployed', 'I will use it to make automobiles, sofas,automatic,headboards this will help me to improve my skill and also have an experience of designing different things.Also l want to be independent so that l can be able to provide my family. This will also provide job opportunities in my community. Young people are stranded and they end using drugs because of boredom.Also l will be able to make my workshop to be standard and using good quality.Also l will able to make all the things  l did during my learning for example making automobiles, sofas,automan,headboards .Also l will make sure that l use them in a right way because l learnt on how to use them and how l should handle them because they are dangerous. Also l will be able to put oil where necessary for an example the sewing machine needs oil so that will work without rusting it should make your work easier without difficulties. I can able to put them in a safety place. ', 'Yes', '[\"documents\\/01JR0PKPCPGQR8WTJB36YY4PNQ.jpg\"]', '[\"documents\\/01JR0PKPCTQEHX09AWZNYCXS4P.jpg\"]', 'I applied because l believe that l will be able to get the tool kit so that l can be able to use my skill .This will help a lot of people in my community because it will provide job opportunities and some will able to learn and start their own businesses because the level of unemployment is very high in nowadays. Also this may help me to be dependent because life is very complex. Also l hope this will reduce teenage pregnancy in our society because young people are not busy with anything and the level of theft is very high. I can be able to help elderly people and those who are disabled whereby they have nobody who will help them with their needs and wants whereby you find others they sleep with an empty stomach and take their medication which is not good for their healthy.Also l will make sure that in my workshop l will make the best whereby my customers will always be happy about my services. I will always deliver in time without problems and also l will use good quality materials that  will last my customers. I can also be the best  in my workshop l will order expensive materials because they are very good. I will always make sure that l follow workshop rules and their safety because the tools are dangerous .', 'Yes', '76987744', 'Tertiary Education', 'Yes', 'George Town University ', NULL, '2025-04-04 19:27:16', '2025-04-04 19:27:16'),
(231, 242, 'Carpentry', 'Self-Employed', '1 year or less', 'I can use it in the workshop to make the things we do in the workshop', 'Yes', '[\"documents\\/01JR0RY9B05D7RZ497J0A2WZMN.jpg\"]', '[\"documents\\/01JR0RY9BM4P14PJ8V603D007M.jpg\"]', 'I apply so that i can work hard at workshop,to make sofas,automans and i will gain because i sell so that i can make money.', 'Yes', '78395516', 'Practical Experience Under A Qualified Technician', 'No', 'Gorge Town', NULL, '2025-04-04 20:08:00', '2025-04-04 20:08:00'),
(232, 243, 'Sewing', 'Self-Employed', 'Unemployed', 'I would use it to design and construct custom made clothing mostly for ladies. I will collect orders and charge customers based on their designs. They bring their own materials.', 'No', '[\"documents\\/01JR0Z64HRD2D9Y27JMQD9P6ZQ.pdf\"]', '[\"documents\\/01JR0Z64HY259HAG7M2CE2H98Y.pdf\"]', 'I have a domestic sewing machine which I currently use in my house to make garment alterations for customers and I also design custom made clothing for customers. I however lack a lot of sewing tools to expand my business. If I get a tool kit it can help me a lot because I would be able to work efficiently and hence expand my business. I would be able to  add other items that I did not sew because of lack of resources. This program will actually help me kickstart my business.', 'No', 'N/A', 'Tertiary Education', 'No', NULL, NULL, '2025-04-04 21:57:09', '2025-04-04 21:57:09'),
