(238, 249, 'Sewing', 'Self-Employed', '2 years', 'I would use it for making my work easier and in that way I would be able to take more clients or more work because of the startup kit.', 'No', '[\"documents\\/01JR2HNGN6V5VZC8TSW7QHNXF7.jpeg\"]', '[\"documents\\/01JR2HNGNHXBQRJM6J15CDF4D9.jpeg\"]', 'So i can get a double needle machine because i have a need for it. \nThat would make my work so much easier and i would make more money to support my siblings and my sister’s kids.', 'Yes', '76633052', 'Practical Experience Under A Qualified Technician', 'Yes', 'Insika yakusasa under Lusweti ', NULL, '2025-04-05 12:39:22', '2025-04-05 12:42:01'),
(239, 250, 'Carpentry', 'Unemployed', 'Unemployed', 'I will.use it for my specific work. Also I will keep it safe', 'Yes', '[\"documents\\/01JR2HTH8G5ESQSM9FZM2BC30N.jpg\"]', '[\"documents\\/01JR2HTH8K829WJH58TPCCTV7Q.jpg\"]', 'I apply because I want to work to have money to earn a living with my family as we are struggling. Secondly this will benefit the whole community because we will be busy making n fixings furniture. It\'s will also help me to grow economical. As a like I can be able to be independent to myself. ', 'Yes', '76869749', 'Practical Experience Under A Qualified Technician', 'Yes', 'Gorge Town', NULL, '2025-04-05 12:42:06', '2025-04-05 12:42:06'),
(240, 251, 'Sewing', 'Unemployed', 'Unemployed', 'If I would be awarded the toolkitbi would use it for starting my own business for sewing .I would use the money I get to add other machine to increase my bussiness', 'No', '[\"documents\\/01JR2RVX9GZ03G31TA8TZ3QFRY.jpg\"]', '[\"documents\\/01JR2RVX9M3K281D6HRZVEWWX1.jpg\"]', 'I have applied for  this program to ask for the sewing machine since I was doing the course of sewing last year  what I hope to gain from this program is the help of getting the toolkit please', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-05 14:45:11', '2025-04-05 14:45:11'),
(241, 252, 'Motor Mechanic', 'Self-Employed', 'Unemployed', 'We are already running a Motor mechanic garage, with minimal working tools, the tool kit will assist us to work efficiently and make make more revenue through servicing a wider customer base. We plan to expand and set up a workshop and employ our colleagues from within our community as form of employment creation. ', 'No', '[\"documents\\/01JR2V77XG34KVCHXWR64HH7DP.pdf\"]', '[\"documents\\/01JR2V77XNSXAV0X41CB14BJ06.pdf\"]', 'I have applied to bridge a gap to assist me with proper working tools to fully operate our Motor mechanics business. The tool kit will ensure efficiency in running the business, enhance growth, increase revenue, create means of living for us and create employment opportunities and transfer the skills to other youth in our community. ', 'Yes', '78606598', 'Practical Experience Under A Non-Qualified Technician', 'Yes', 'Church Youth Forum ', NULL, '2025-04-05 15:26:20', '2025-04-05 15:26:20'),
(242, 253, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'If I were awarded a toolkit for my vocational skill, I would use it to launch my journey as a self-employed heavy plant mechanic and begin offering professional services to clients across different locations. This toolkit would be my first real step toward building a sustainable business where I can apply my training, support myself financially, and grow both personally and professionally. As a young woman in a male-dominated field, having access to a complete set of tools would not only allow me to put my skills into action but also help me challenge stereotypes. I would use the toolkit to work independently, take on jobs confidently, and build a reputation for quality service. The flexibility and mobility the tools provide would enable me to travel to clients and complete on-site projects—something essential in my line of work. More importantly, the toolkit would serve as a symbol of empowerment—not only for me but for other young women watching my journey. By using it to grow my business, I hope to inspire others to pursue careers in technical trades and see what’s possible when skills are matched with the right resources. In the long run, I would use the experience gained to train and mentor others, especially young women, helping them find their path in vocational work. The toolkit would be a stepping stone toward broader goals: certification, business registration, job creation, and community development. This opportunity is not just about tools—it’s about creating impact. I would treat the toolkit as an investment in my future, and I am committed to using it to its fullest potential.', 'No', '[\"documents\\/01JR30QCAG1XJD9S1H8KZ2P81F.pdf\",\"documents\\/01JR30QCAMWZ18S5879YVVNTF4.pdf\",\"documents\\/01JR30QCAQ4231P75FDPC476PP.pdf\"]', '[\"documents\\/01JR2Z0BFVXPRGGYCH0Q01N0KY.pdf\",\"documents\\/01JR30QCAWBPJ8EMMY3N8CC8Q6.jpg\",\"documents\\/01JR30QCAYHSJV04C93XEYZVKY.jpg\",\"documents\\/01JR30QCC2M9EEKN66D250K1RC.jpg\",\"documents\\/01JR30QCC54D4MHGDCKWE7R5QH.jpg\",\"documents\\/01JR30QCC79KAFBM4255BZBTVG.pdf\"]', '\nI am applying for the TVET Toolkit because I strongly believe it will empower me to start my own business and become self-employed. I am a trained heavy plant mechanic, and while I have acquired the necessary technical knowledge and skills, I currently lack the resources and equipment to put my qualifications into practice. This toolkit will bridge that gap—it will provide me with the tools I need to kick-start my journey as a professional in the field, enabling me to begin offering services to clients and build a name for myself and my future company.\n\nHaving access to a complete toolkit will give me the mobility to travel to different locations to serve my customers. This is particularly important in my trade, where jobs often require on-site work. I envision myself working independently, moving from one project to another, and gradually gaining recognition for the quality of my work. The toolkit will help me take that first bold step toward establishing myself as a reliable, skilled professional in a highly competitive industry.\n\nMore than just a personal step forward, this programme is an opportunity for me to inspire other young women in my community and beyond. The heavy plant mechanic field is traditionally male-dominated, and as a young woman pursuing this path, I am already defying expectations. With the right support and equipment, I will be able to prove that women not only belong in this field, but can also thrive and lead in it. I hope to use my journey as an example to encourage other young girls to pursue their dreams, especially in trades that are not commonly considered “women-friendly.”\nBy being visible and active in this space, I aim to challenge and dismantle the stereotypes that hold many girls back from pursuing their true interests. Representation matters—when young girls see someone like them succeeding in a field like mine, it helps them believe that they, too, can achieve their goals. My hope is that my story will give others the courage to explore their potential, especially in technical and vocational fields.\n\nReceiving the toolkit would not only give me the tools I need, but also boost my confidence and provide the motivation to continue learning and growing. Every job I complete will present unique challenges that will push me to improve my technical problem-solving skills. As I face these challenges head-on, I will continue to gain valuable experience that will deepen my understanding and sharpen my abilities. I believe that learning is a lifelong process, and I am fully committed to continually upgrading my knowledge and staying up to date with developments in my trade.\n\nIn the long term, I aspire to grow beyond individual service provision and establish a sustainable business that can employ and train other young people—particularly young women—who are interested in technical fields but may not have had the opportunity to pursue them. I want to be in a position where I can give back by mentoring and equipping others, just as I am seeking to be equipped now.\n\nThis toolkit will be the key to turning my vision into reality. It will enable me to move from being trained to being fully operational, and from dreaming to doing. It will give me the independence to earn a living through my own skills, the confidence to challenge gender stereotypes, and the platform to uplift and inspire others. I believe that with the right support, I can make a meaningful contribution not only to my own life and that of my family, but also to my community and to Eswatini broader goal of promoting youth entrepreneurship and skills development.\n\nIn conclusion, I am deeply passionate about what I do. I am ready to take this next step, and I am committed to using this opportunity to its fullest potential. The TVET Toolkit would mean so much more than just a set of tools to me—it would represent hope, growth, empowerment, and the beginning of a new chapter in my life and career. Thank you for considering my application.', 'No', NULL, 'Tertiary Education', 'No', NULL, NULL, '2025-04-05 16:32:28', '2025-04-05 17:02:31'),
(243, 254, 'Electrician', 'Unemployed', 'Unemployed', 'If I were awarded a toolkit for my vocational skill, I would immediately use it to begin practicing and offering my services professionally. The toolkit would allow me to move from having training and knowledge to applying those skills in real-life situations. I would use the equipment to start my own small business, providing high-quality services to individuals and organizations within my community. With the right tools, I would be able to take on more work, serve clients confidently, and build a reputation for reliability and excellence in my field. Beyond personal advancement, I would use the toolkit as a foundation to empower other young people, particularly those who, like me, may have skills but lack resources. My long-term goal is to not only run a successful business but also mentor and support others who want to pursue vocational trades. I hope to inspire young people—especially young women—to believe in themselves and follow their passions, even in fields that are not traditionally considered female-dominated. The toolkit would also be essential in helping me prepare for trade testing and certification, which are important steps in professionalizing my services. With practical experience and quality tools, I will be better positioned to meet industry standards and expand my service offerings. In essence, receiving the toolkit would be a turning point in my life. It would empower me to take charge of my future, create employment opportunities, support my family, and uplift my community. I would treat this opportunity with dedication and gratitude, making the most of it not only for my benefit but for the benefit of others around me.', 'No', '[\"documents\\/01JR2Z99661KGMNDT2AXBJEDEZ.pdf\",\"documents\\/01JR2Z99699GDA3Q53CA7CYEE3.pdf\",\"documents\\/01JR2Z996CJZMRAT5G4ZQXMTQA.pdf\"]', '[\"documents\\/01JR2Z996GHZMPZBQY774AQAXJ.jpg\",\"documents\\/01JR31G9FQCSCQBPW2T0S3JHZ6.pdf\",\"documents\\/01JR31G9GJR9N3MHT78KRKSH3H.jpg\",\"documents\\/01JR31G9GN8VA9F72HQVJ969P3.jpg\"]', 'It has always been my dream to open and operate my own business—one that reflects my skills, passion, and desire to contribute meaningfully to my community. When I learned about the TVET Toolkit opportunity through the Youth Council, I felt a renewed sense of motivation. This programme is more than just a chance to receive tools; it is a gateway to fulfilling a long-held dream of becoming self-reliant, empowering others, and building a future that creates opportunities not only for myself, but for others as well.\n\nI am applying for the TVET Toolkit because I understand how important tools are to translating skill into productivity. I have acquired technical training and developed hands-on knowledge, but without access to the proper equipment, my ability to practice and grow in my trade is severely limited. This toolkit will enable me to begin operating professionally, offering services, and establishing a small but sustainable business. With it, I can work independently, gain clients, and steadily build a reputation in my field.\n\nThe benefits of this opportunity, however, extend far beyond myself. I strongly believe that the success of one youth is a stepping stone for many others. Once I am fully operational, I intend to use the experience I gain not just to grow my own business, but to mentor and support other young people in my community—especially those who have talent and passion but are held back by a lack of resources. I envision a future where I can pass on the skills I have learned, help others find their feet, and contribute toward reducing the youth unemployment rate in my area.\nHaving a toolkit will also allow me to take control of my future. Rather than relying solely on job-seeking in a highly competitive market with limited formal employment opportunities, I will be able to generate income through my own effort. Self-employment is not just an option for me—it is a necessity and a way to create a livelihood that can support my family. I come from a background where opportunities are not always within reach, but I have always believed in hard work and taking initiative. This programme aligns perfectly with that mindset.\n\nFurthermore, I want to use this platform to challenge the status quo. In many communities, certain trades and professions are still seen as “men’s work,” and young women are often discouraged from pursuing them. I firmly believe in gender equality, and I want to be a living example that women can succeed in technical fields just as much as men can. Receiving the toolkit and building my business will give me the credibility and visibility needed to shift perceptions, especially among young girls who may be hesitant to step into spaces where they are underrepresented.\n\nThrough this programme, I also hope to grow both personally and professionally. The real-world experience I will gain through using the toolkit will enhance my technical abilities, build my confidence, and help me solve complex challenges on a daily basis. Every job will be a learning opportunity, and over time, I know I will become more skilled, efficient, and business-minded. I am ready to put in the work, and I am eager to learn from both success and failure along the way.\n\nIn the long term, I see myself running a fully established business that offers quality services, creates employment, and nurtures upcoming talent. I want to register my company, expand my operations, and even offer internships or short-term learning opportunities for other youth. I want to be able to look back and say that I took this opportunity seriously, made the most of it, and used it to positively impact others.\n\nIn conclusion, I am applying for the TVET Toolkit because it represents a real chance to change my life, uplift my family, and make a difference in my community. I am passionate, focused, and ready to take the next step in my journey. With the right tools and support, I believe I can contribute to a stronger, more empowered generation of youth in Eswatini. Thank you for considering my application.\n\n\n', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-05 16:37:21', '2025-04-05 17:16:08'),
(244, 255, 'Electrician', 'Unemployed', 'Unemployed', 'If I were awarded a toolkit for my vocational skill, I would use it as the foundation to begin my journey as an independent professional and entrepreneur. The toolkit would allow me to move from simply having a skill to actively using it to earn a living, support my family, and provide services within my community. It would be the first practical step toward starting my own business, something I have dreamed about for many years. Having the tools would mean I could immediately begin offering my services, building a client base, and gaining hands-on experience. This experience is critical because it will help me improve my technical abilities and prepare me to go for trade testing and official certification—an important milestone in my profession. Trade testing will increase my credibility and open even more opportunities for business growth and recognition. Beyond personal growth, I would also use the toolkit to create opportunities for others. Once my business is established, I hope to employ or mentor other young people, especially those who are skilled but lack resources. In a country where many youth face unemployment, I believe one person’s success can lead to opportunities for many. I also want to become a role model, showing other young people that it is possible to succeed through vocational skills, hard work, and the right tools. The toolkit would not just help me build a business—it would help me build a life of purpose, responsibility, and impact. I would treat it not just as a gift, but as a serious investment in my future and that of my community.', 'No', '[\"documents\\/01JR3016YG28M61JQB7GZD7XFF.pdf\",\"documents\\/01JR3016YQ8RF6261FSZRE2BK5.pdf\"]', '[\"documents\\/01JR3016YVQ219KWA25DBY5BY6.pdf\",\"documents\\/01JR31GMGPG263GQRRN5CYMSCR.pdf\",\"documents\\/01JR31GMGTJ5Q3NW66KSZ7PW18.jpg\"]', 'I am applying for the TVET Toolkit because I want to take an important step toward building a future for myself, my family, and my community. My long-term goal is to start my own business and become self-employed. I believe that receiving this toolkit will give me the practical foundation I need to bring my vision to life. The tools will not only help me work more efficiently and professionally but also allow me to gain the experience and confidence necessary to operate successfully in my chosen field.\n\nStarting a business has been a dream of mine for many years. I want to create something sustainable that can grow over time, and that can eventually provide opportunities to other young people like me. In Eswatini, many young people face the challenge of unemployment, not because they lack the talent or passion, but because they lack access to resources that allow them to use their skills. I see this toolkit as a starting point for change—a way to break the cycle of dependency and begin building something of my own.\n\nOne of the biggest reasons I have applied for this programme is because I want to create job opportunities, both for myself and for others. If I am successful in starting my business, I will be in a position to hire other youth or even offer them mentorship or short-term training. I believe that when one young person rises, they can help lift others along the way. This programme would allow me to take on that responsibility and be part of the solution to the youth unemployment crisis in my community.\n\nBeyond business, I want to be a source of motivation and inspiration for the youth around me. I come from a community where many young people feel discouraged and uncertain about their futures. By receiving the toolkit and putting it to good use, I hope to show others that it is possible to succeed through hard work, determination, and the right support. I want them to see that with a skill and the right tools, they too can make a living and live with dignity.\n\nThe TVET Toolkit will also allow me to gain more experience in the trade I have already trained for. While I have acquired skills through training, there is still so much more I want to learn and improve on. With hands-on work and real-life projects, I will be able to deepen my understanding of my craft, refine my techniques, and grow into a more capable professional. This experience will also prepare me to eventually go for trade testing and certification, which is a key milestone for anyone serious about succeeding in the technical and vocational space.\n\nTrade testing is not just a formality for me—it is a goal that will give me credibility, open doors, and allow me to compete in the market more effectively. However, before I can reach that stage, I need the tools to put my knowledge into action. With the toolkit, I will be able to work independently, take on jobs, build a client base, and eventually prove myself worthy of full trade certification.\n\nThere is something incredibly powerful about being able to take care of yourself and your family through your own hard work. That is what I hope to achieve through this programme. I want to be financially independent, support those I care about, and make a positive contribution to society. I want to move from simply having a skill to using that skill to create value and opportunities.\n\nIn conclusion, I am applying for the TVET Toolkit because I want to change my life and the lives of others. I want to start a business, gain experience, prepare for trade testing, and serve as a role model to the youth in my community. I am ready to commit myself fully to this journey, and I am confident that with the right tools and support, I can make a real difference. Thank you for considering my application.\n', 'No', NULL, 'Practical Experience Under A Qualified Technician', 'No', 'none', NULL, '2025-04-05 16:50:25', '2025-04-07 11:23:18'),
