(251, 262, 'Motor Mechanic', 'Employed', '1 year or less', 'I will use it to put my motor mechanic skills into by continuing working on cars diagnosing, repairing, and maintaining them. This will help me gain more experience and start earning an income. In the long run, I\'m planning to become self employed and eventually open my own auto repair business. With time, I hope to grow the business big enough to hire and train other unemployed but talented mechanics so we can work together as a team and create more job opportunities in our community.', 'No', '[\"documents\\/01JR366SNF9KG06QDP1V2HJ800.jpg\"]', '[\"documents\\/01JR366SNK762YCG1QAAS21J45.webp\"]', 'I have applied for this program because I’m passionate about motor mechanics, and I believe this opportunity can take me a step closer to building a successful future. I want to sharpen my skills, gain hands-on experience, and become more confident and independent in my work. Through this program, I also hope to get the support and tools that will help me kickstart my journey toward self-employment. My biggest goal is to one day own a well established workshop, where I can not only support myself but also train and employ other young people who love cars like I do. This program would be a life changer for me.', 'Yes', 'Momo +268 78352751', 'Tertiary Education', 'Yes', 'Swazi Youth Gears (SYG) ', NULL, '2025-04-05 18:38:19', '2025-04-05 18:38:19'),
