(254, 265, 'Carpentry', 'Unemployed', 'Unemployed', ' I’d use it to take my craft to the next level. With the right tools, I can build more precise, durable, and creative furniture and structures. It would help me speed up my workflow, take on more challenging projects, and even train others who are passionate about woodworking. This toolkit wouldn’t just improve my work—it would help grow my business and impact my community through quality craftsmanship.', 'Yes', '[\"documents\\/01JR3FY45DACZ14PAK0MDFGWAS.jpg\",\"documents\\/01JR3FY4756FFNFR5DS9ZGW0DF.jpg\"]', '[\"documents\\/01JR3FY4886537GAPDX257K9TT.jpg\"]', 'I applied for this program because I’m passionate about carpentry and always looking for ways to improve my skills and grow professionally. This program offers a unique opportunity to learn from experts, connect with other skilled artisans, and gain access to resources that can elevate my work. I hope to gain hands-on training, mentorship, and tools that will help me produce higher-quality projects, expand my business, and possibly mentor others in my community who want to learn the trade.\n\n', 'Yes', 'Momo 76356035', 'Practical Experience Under A Qualified Technician', 'Yes', 'International youth fellowship (IYF)', NULL, '2025-04-05 21:28:21', '2025-04-05 21:28:21'),
