(263, 274, 'Plumbing', 'Self-Employed', 'Unemployed', 'I will use it to do job that will bring cash to my hand inorder to support my family.Also with the toolkit I will try to form my own business in the plumbing industry and try to help my siblings with the skill of plumbing inorder to get money.', 'No', '[\"documents\\/01JR6A26B209MFGDQRGCED0SXR.jpg\"]', '[\"documents\\/01JR6A26B74HX94TNJ5Y5M46RB.jpg\"]', 'I applied for a Toolkit and It will help me to do plumbing task more simpler than when you do not have any tool for that specific job and that will bring cash for my living.', 'No', '76688280', 'Tertiary Education', 'No', NULL, NULL, '2025-04-06 23:43:26', '2025-04-06 23:43:26'),
(264, 275, 'Motor Mechanic', 'Self-Employed', '3 years', 'I would use tools to improve speed in my work space and quality of the job. Being the number one Quality provider it would also boost marketing thus increasing profits to my income stream. Profits would help build an industrial Spray Booth', 'No', '[\"documents\\/01JR6CF5E1Y5GHNDZRDQDEY4X7.pdf\"]', '[\"documents\\/01JR6CF5EBXWRGD057NQ6127DG.pdf\"]', 'I have applied to get tool gear for Spray Painting Cars in order to service clients with Affordable, Quality work and on Time. I hope to get maily Spray Painting Tools which include 200 liter Compressor, Spray Gun, Spray Painting Mask and\n Tool box', 'Yes', 'Standard bank-9110005616754Momo - 78478328', 'Practical Experience Under A Qualified Technician', 'No', NULL, NULL, '2025-04-07 00:25:28', '2025-04-07 00:25:28'),
(265, 276, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'The support from ENYC in providing me with a starter tool kit would enable me to service a wider range of customers, ultimately increasing my daily revenue. I estimate that, with the right tools, my average daily earnings could rise to between E800 and E1500. This financial growth would not only allow me to sustain my business but also facilitate the expansion of my garage, enabling me to serve more customers and employ additional individuals from my community.', 'No', '[\"documents\\/01JR752A60T7TBRSW3NH9SG38F.jpg\"]', '[\"documents\\/01JRFA1NS0R4F6RE8W3HQ8AHTM.pdf\"]', 'As a passionate mechanic specializing in German cars, particularly BMW and VW, I have dedicated myself to honing my skills through freelance work. This endeavor not only allows me to earn a living but also provides me with invaluable practical experience. Currently, I am working with two young boys from my area, imparting my knowledge and skills to them in hopes of improving their livelihoods and creating a positive impact within our community.\n\nDespite my dedication and hard work, I face significant challenges due to the limitations of my current makeshift tool kit. This situation often necessitates borrowing tools, which hampers my efficiency and, consequently, the quality of service I provide to my customers. With a comprehensive motor mechanic tool kit, I believe I can significantly enhance my service capabilities and establish a reliable commercial enterprise.\n', 'Yes', '76831574', 'Tertiary Education', 'No', 'None', NULL, '2025-04-07 07:35:22', '2025-04-10 11:38:53'),
(266, 277, 'Motor Mechanic', 'Self-Employed', '1 year or less', 'If I were awarded a Toolkit for my vocational skill. It would used on the repairs and services of motor vehicles, the repair and service of motorcycles and bicycles, as well as helping around the home with any jobs that need to be done ', 'No', '[\"documents\\/01JR7M6ZSGDN1DR0CPN4JE9FJT.pdf\",\"documents\\/01JR7M6ZVTNAB0QGXJC0H2PS9D.pdf\"]', '[\"documents\\/01JR7M6ZWDZCKKFRC8W5F393J9.jpg\",\"documents\\/01JR7M6ZX4PTFJ2HVH2NH4PQMR.jpg\"]', 'I have applied to this program because I  have a very strong understanding and passion for my field of work, and I I am confident in my ability to learn, adapt and apply my skills.\nHowever, the challenges I currently face are that I do not have a toolkit of my own to dedicate to my work,\nAnd I do not have the personal financial ability to purchase this equipment or proper advertisement for my business \nI hope that in that applying for this program I will be given the opportunity to acquire the tools and capital needed to market and improve the quality of work and grown the business', 'No', NULL, 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-07 12:00:04', '2025-04-07 12:00:04'),
(267, 278, 'Sewing', 'Unemployed', 'Unemployed', 'I would start my own sewing business and supply my products to businesses in small or large quantities depending on the order. ', 'No', '[\"documents\\/01JR7ZSN8QP8BGXN63NGTJM954.pdf\"]', '[\"documents\\/01JR7ZSN93HWFE1XRDMEAAM9PF.pdf\"]', 'I have applied so that I can have equipment for starting my own business so that I will be independent and to also help in my family situation. I will also help the needy. From this Program I hope to gain further skills and assistance in Starting up my business.  ', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-07 15:22:30', '2025-04-07 15:22:30'),
(268, 279, 'Carpentry', 'Unemployed', 'Unemployed', 'I will use it to because I will be self employed ', 'No', '[\"documents\\/01JR816D7X2FTNBABWSVSK3X4F.jpg\"]', '[\"documents\\/01JR816D8K5RTK5CNRVCPQA50Q.jpg\"]', 'I applied because I\'m in need of tools ', 'Yes', '78392079', 'Tertiary Education', 'No', NULL, NULL, '2025-04-07 15:46:56', '2025-04-07 15:46:56'),
(269, 280, 'Motor Mechanic', 'Self-Employed', 'Unemployed', '1. To tackle basic repair. For do-it-myself work', 'Yes', '[\"documents\\/01JR847131HKCAM8X2G4GRXE63.jpg\"]', '[\"documents\\/01JR8471380KSW02MZNESTTX6Q.pdf\"]', 'I applied to get starter toolkit for my business and I hope to gain knolwedge on how to save money to expand business.', 'Yes', '76597063', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-07 16:39:42', '2025-04-07 16:39:42'),
(270, 281, 'Sewing', 'Unemployed', 'Unemployed', ' I can create a resilient and sustainable livelihood utilizing the sewing toolkit. The repair and alteration services provide a consistent income stream, while upcycled creations offer higher profit margins and tap into a niche market. Sewing lessons diversify income and contribute to community empowerment. This holistic approach addresses both economic needs and environmental concerns within the Ezulwini community.', 'No', '[\"documents\\/01JR8BKXXJ47R40M07TYA4WYFQ.pdf\",\"documents\\/01JR8BKXXPWDSR7XYM2SYYWHME.pdf\"]', '[\"documents\\/01JR8BKXY7H1EMZMFJZZNK7J4E.jpg\",\"documents\\/01JR8BKXYAGJ6ARKV9TPC4X8ZG.jpg\",\"documents\\/01JR8BKXYC6K19QATN80HDJRNJ.jpg\",\"documents\\/01JR8BKXYFBWCF1NPKQ0CTTY5B.pdf\",\"documents\\/01JR8C4KCFRMD18SKGN4E1AK5D.pdf\",\"documents\\/01JRAZA6V6EH3CT5H1PM2PWZSN.jpg\",\"documents\\/01JRAZE2KTWR92RQ6JZT6DEBKP.pdf\"]', 'As an individual deeply passionate about the art of creation and mending, I\'ve applied for the sewing toolkit because it represents a tangible opportunity to further develop a skill that I find both practical and deeply fulfilling. I\'ve dabbled in basic repairs and simple alterations, often with limited resources. Having a dedicated toolkit with quality materials and essential tools would allow me to move beyond these basic tasks and explore more intricate projects. I envision myself being able to create personalized items, upcycle existing clothing, and even contribute to my community by offering mending services.\n\nMy hopes for the ENYC YD Programme are multifaceted. Firstly, I am eager to connect with like-minded individuals who share a passion for skill development and community engagement. I believe that learning in a supportive and collaborative environment will be invaluable. Secondly, I am particularly drawn to the programmers focus on youth development and empowerment. I hope to gain not only technical skills in sewing but also valuable insights into entrepreneurship, leadership, and community building. Ultimately, I aspire to leverage the skills and knowledge gained through this programme to become a more resourceful and contributing member of my community. I believe that the ability to create and repair is a powerful one, and I am excited about the potential this programme holds for my personal and professional growth.', 'Yes', '76598906', 'Practical Experience Under A Non-Qualified Technician', 'Yes', 'Save the Children community empowerment and saving scheme', NULL, '2025-04-07 18:49:05', '2025-04-08 19:13:53'),
(271, 282, 'Sewing', 'Unemployed', 'Unemployed', 'I can have my own workshop ', 'No', '[\"documents\\/01JR8GQBS321ZFAGYWYBCP5930.jpg\"]', '[\"documents\\/01JR8GQBSA3HK1GD7YBPH9BVSR.png\"]', 'I applied because, I\'m in need of the toolkit to start doing my own thing. Yes I have the knowledge but I believe that without having the tools that can help me doing the work it\'s means the knowledge I have it\'s amounts to nothing.\n\nHaving the tools will help me advance in the skill I know possessed from the vocational. I\'m saying so because I understood that there are kinds of design you come across in the upholstery industry . So if I have the tools it will help me to solve those problems.\n\nFrom this program I\'m looking forward a change in my life in the near future . I believe in this because having proper working tools will help me doing the job in the right way thus I gain more customers to support sice I have a vision of owning my workshop and employ people.\n\nI\'m looking forward an uplifting from this program . The reason I\'m saying this is because I\'ve been watching and waiting for such an opportunity for sometime now . It\'s been my dream to have tools  as soon as possible so I can embark on my journey as an upholsterer , for tomorrow is not guaranteed.\nA wise man once said the sooner the better. That\'s why I\'ve been looking forward such an opportunity as a young and energetic man who wants to own one of the most successful workshop in the country that will fight poverty.\n\nI hope to gain support from this program to fulfill my dream as an upholsterer.\n', 'Yes', '+268 76593292', 'Practical Experience Under A Qualified Technician', 'No', 'Langalethu Charity organization ', NULL, '2025-04-07 20:18:20', '2025-05-16 00:11:01'),
(272, 283, 'Carpentry', 'Unemployed', 'Unemployed', 'I can start my own business to master alot my skill and try more new ideas. ', 'Yes', '[\"documents\\/01JR8KR6BPA6Y3YQ67Z7YKGCF3.pdf\"]', '[\"documents\\/01JR8KR6C7H9SX6GJRCW8PF4DV.pdf\"]', 'To showcase my skill and learn more from other colleagues and gain more experience.  Also bring more ideas on the table', 'Yes', '76125174', 'Practical Experience Under A Qualified Technician', 'Yes', 'George Town ', NULL, '2025-04-07 21:11:13', '2025-04-07 21:11:13'),
(273, 284, 'Welding', 'Unemployed', 'Unemployed', 'Self employment and development ', 'Yes', '[\"documents\\/01JR8MAC6ZRZTW1SAJR129BRJ5.jpg\"]', '[\"documents\\/01JR8MAC73NJ8YSS45STP0HFVD.jpg\"]', 'To accept any assistance from the organization and I hope my request will be successful, because I cannot afford the tools', 'Yes', 'Momo76299150', 'Tertiary Education', 'Yes', 'International Youth Fellowship ', NULL, '2025-04-07 21:21:09', '2025-04-07 21:21:09'),
