(275, 286, 'Sewing', 'Unemployed', 'Unemployed', 'Sewing and designing different fashion clothes and sell them and get more money and enlarge my business. ', 'Yes', '[\"documents\\/01JR91T1MKB4DYEZ0XJRE6SZAH.jpg\"]', '[\"documents\\/01JR91T1NQW8NK1E0071C1TTH0.pdf\"]', 'It is because I wanna get the toolkit as I have acquired the skill,so that I start my business in fashion and design to get money and become economical independent and enlarge my business. Also this program will help me to be mentored  and be able to get help from other partners like youth fund to help me get fund to start other business and become stable in life thus reducing chances of me being abused and protected from being infected with HIV/AIDs.Also this program I\'m hoping it will help me to improve self esteem wich will help me to engage in youth development in my communities. ', 'No', NULL, 'Tertiary Education', 'Yes', 'Youthlet organization ', NULL, '2025-04-08 01:16:54', '2025-04-08 01:20:31'),
