(287, 298, 'Sewing', 'Unemployed', '1 year or less', 'I will use it to open a sewing boutique shop, specializing in all types of suits and dresses for proms and graduations', 'No', '[\"documents\\/01JRA9SHRVYNY8F1TA00R8JFYH.jpg\"]', '[\"documents\\/01JRA9SHS7A8SAS317KAPWJMQ0.jpg\"]', 'My improved skills and growing customer base have demonstrated the pressing need for quality tailoring services in my community. I firmly believe that my experiences have prepared me to establish my own sewing business; however, I lack the necessary equipment such as advanced sewing machines and dummies. With your support through the youth funding program, I will be able to acquire these essential tools, fulfill my entrepreneurial dreams, and provide valuable services to my community.', 'Yes', '78328397', 'Tertiary Education', 'No', NULL, NULL, '2025-04-08 12:55:41', '2025-04-08 12:55:41'),
(288, 299, 'Electrician', 'Unemployed', 'Unemployed', 'I will start a small business of my own inorder to gain more experience in my field of Play.Help other people who are willing to learn and gain skill in electrical fields.', 'No', '[\"documents\\/01JRADQ0G8YGM2QC5F1SA2AG00.jpg\"]', '[\"documents\\/01JRADQ0HQKYDPXE0JVRGQAFYY.pdf\"]', 'I have applied because I am patinate to gain more experience in the electrical field and help others to learn electrical', 'Yes', '76540901', 'Tertiary Education', 'No', 'None', NULL, '2025-04-08 14:04:12', '2025-04-08 14:04:12'),
(289, 300, 'Sewing', 'Unemployed', 'Unemployed', 'I would use it to sew my designs that I have as I have a passion and love for fashion,then sell my beautiful work to people at an affordable prices.I would also make curtains and duvets.Lastly I would do weeding gown ', 'No', '[\"documents\\/01JRADST89DGC0RVVM2ZST6JNQ.jpg\"]', '[\"documents\\/01JRADST8C3G831EN7HYQEHAWP.jpg\"]', 'I have applied to get the kit so I can be able to use it and start working,as I don\'t have money to buy for myself a kit while I wish I would have it already to start working  to start my own business and earn money for a living.If I would have this kit it can I can also teach other people to sew,which can help them have a skill that they can use in the future to earn a living.I have gained that in life if you have power to help other people\'s situation do so because lot of people are struggling, be a blessing to other people\'s lives.As that is also what you teach us.', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-08 14:05:44', '2025-04-08 14:27:28'),
