(294, 305, 'Sewing', 'Self-Employed', '4 years or more', 'For improving my personal welfare from the income earned and I also used my skill for advertising my business to reach bigger markets, for example making samples for a certain school and ask the school for tenders.', 'No', '[\"documents\\/01JRAQHVDHV3C9MCXP1TMY7RNY.jpg\",\"documents\\/01JRAQHVEPGSVSQCQS0S2F3P4H.jpg\"]', '[\"documents\\/01JRAQHVFA317JJF81G824ZX4F.pdf\"]', 'I need financial assistance, the initial plan is to buy another sewing machine as this will expand the business as well as production quantity as I have one old sewing machine. I also need assistance in terms of the materials, the material is expensive and a backup will help me a lot because I will be able to buy the material in bulk as sometimes I run out of the necessary material because I  do not buy in bulk. This really affects the growth of the business because I run out of stock , therefore the business won’t grow and I will not be able to keep the business running from its own cash flow.', 'Yes', 'Eswatini Building Society-52000871666/Momo-76627313', 'Practical Experience Under A Non-Qualified Technician', 'No', 'None', NULL, '2025-04-08 16:56:09', '2025-04-08 16:56:09'),
