(299, 310, 'Sewing', 'Unemployed', 'Unemployed', 'First and foremost, I intend to use the sewing machine to refine my sewing skills. Practising regularly will allow me to master various techniques such as stitching, hemming and pattern making. This hands-on experience is crucial for anyone aspiring to work in fashion as it provides a solid foundation in garment construction. I plan to create sample garments that will serve as both practice piece and portfolio items. I aim to engage in creative projects that reflect my personal style and vision. I will experience with different fabrics and colours and patterns to create unique clothing items. This could include designing casual wear, formal attire or even accessories like bags and hats. By working on these projects, I hope to develop a distinctive aesthetic that sets me part in the competitive fashion landscape.  I see this opportunity as a change to give  back to my community. Once I feel confident in my abilities, I plan to offer workshops or classes for beginners interested in learning how to sew. Sharing knowledge not only reinforces my own skills but also foster a sense of community among aspiring designers and hobbyists.', 'No', '[\"documents\\/01JRB5CFE1D7MPBW1ET5PG2QB9.jpg\"]', '[\"documents\\/01JRB5CFF9QEC1W8PZKPYVVZ48.pdf\"]', 'I applied for the program to receive a free sewing machine because I am passionate about fashion and fabric, and I believe that having my own sewing machine will significantly enhance my skills and creativity in this field. As a student of fashion design, I have learned the importance of practical experience in developing my abilities. A sewing machine is an essential tool that will allow me to practice my techniques, experiment with different fabrics, and bring my design ideas to life. Additionally, access to a sewing machine will enable me to work on personal projects and potentially create pieces for others, which can help build my portfolio as I prepare for a career in the fashion industry. This program not only provides me with valuable resources but also demonstrates the government\'s commitment to supporting aspiring designers like myself. By receiving this sewing machine, I will be better equipped to refine my craft, explore new creative avenues, and ultimately contribute positively to the fashion community.', 'No', 'None ', 'Practical Experience Under A Qualified Technician', 'No', 'None ', NULL, '2025-04-08 20:57:53', '2025-04-08 20:57:53'),
