(304, 315, 'Motor Mechanic', 'Unemployed', '1 year or less', 'I will use the tools as a first step to achieve the goal of having a workshop. This will help reduce the number of none functioning cars causing the environment to be untidy  ', 'No', '[\"documents\\/01JRBH2873P2M60M728ZYD7A4Y.png\"]', '[\"documents\\/01JRBH2880AHTMAWM14XWDC3SK.png\"]', 'With the ever increasing desire to own a motor vehicle,most of those vehicles eventually develop mechanical problems. This can be supported by the fact that motor vehicles are found on the road side. With the knowledge and expertise gained from the training centre and internship,I can be able to operate and run a proper workshop ', 'Yes', 'FNB-63113429971/momo 76828993', 'Practical Experience Under A Qualified Technician', 'No', NULL, NULL, '2025-04-09 00:22:00', '2025-04-10 23:36:49'),
(305, 316, 'Welding', 'Self-Employed', '1 year or less', 'I would weld a new style of windows that will require a silicone to apply the glass. I would also do doors and steel gate, etc ', 'Yes', '[\"documents\\/01JRCGA2HZT826WHFVVKDQEEYD.pdf\"]', '[\"documents\\/01JRCGA2J4NNXV3WFN3TW0M0RB.pdf\"]', 'I applied for the welding tool kit program because I am passionate about pursuing a career in welding, despite not having a formal vocational certificate. I have gained valuable skills and knowledge through hands-on experience and mentorship from a qualified welder, which has ignited my desire to further develop my craft. Access to a professional welding tool kit would not only enhance my abilities but also provide me with the necessary resources to take on more complex projects and improve my employability in the industry. This opportunity represents a crucial step towards achieving my goal of becoming a skilled welder and contributing positively to my community.', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-09 09:28:02', '2025-04-09 09:28:02'),
