(307, 318, 'Electrician', 'Employed', '1 year or less', 'Iam a man from Eswatini who is willing to start a business. Iam a qualified solar and electrical installer. I obtained a certificate in renewable energy in 2022 and i did my internship at Solsun company as solar installer. In 2023 i , Bi-energy, Entreprenuership, Solar Thermal, Electrical and Solar Photovoltaic. In 2023 i obtained a electrical wireman license and iam part of Mormond Electrical team i work as an Electrician. Through the experience i get, iam willing to start something that is ennovative like Green Energy and electrical installation.', 'No', '[\"documents\\/01JRCW3BDEZBTCNRSXX4NEJ9FB.pdf\"]', '[\"documents\\/01JRCW3BE1SV87V9BGQW9TM4N8.pdf\"]', 'I think this is the chance that i can use to to show my skills by starting my own business. This Program will help me by showing up my skills.', 'Yes', '76914193', 'Tertiary Education', 'No', 'None', NULL, '2025-04-09 12:54:05', '2025-04-09 12:54:05'),
(308, 319, 'Electrician', 'Self-Employed', '2 years', 'If awarded a toolkit, I would utilize it to significantly expand my business operations and reach a wider customer base. This expansion is crucial not only for the growth of my business but also to provide essential financial support for my family, particularly as my parent is currently battling cancer. The increased income would directly contribute to covering medical expenses and ensuring their well-being during this challenging time.', 'No', '[\"documents\\/01JRD0EB216DTGBT59YDJKMZTK.pdf\"]', '[\"documents\\/01JRD0EB2691GQ0DRPSAEG4EB7.pdf\"]', 'I have applied to this program with the primary goal of acquiring essential toolkits to enhance my vocational skills. Additionally, I am keen to gain valuable knowledge in business management. This combination will enable me to maximize the utility of the tools provided and ensure the wise and effective management of my future business ventures.', 'No', 'Momo - 7664 4984', 'Tertiary Education', 'No', NULL, NULL, '2025-04-09 14:09:59', '2025-04-09 14:09:59'),
(309, 320, 'Motor Mechanic', 'Self-Employed', 'Unemployed', 'I would use it to buy more tools and necessary  equipment  of running a bmw workshop and try get workshop to rent or build and buy stock for parts.i will also buy car and build to good condition and sell them at higher price and make profit .it would be cheaper  for me since I would be the mechanic.', 'No', '[\"documents\\/01JRD21Q07MX7DJ0CXEVAQJ2G0.jpg\",\"documents\\/01JRD21Q0DTT2A17WQHST59G8N.jpg\",\"documents\\/01JRD21Q0HX0ZVHHN3K1HA3KGQ.jpg\"]', '[\"documents\\/01JRD21Q0NZAA9CPBTF0T6FBVB.jpg\",\"documents\\/01JRD21Q0WH0WVVHX2N6WZ8G3D.jpg\",\"documents\\/01JRD21Q102B31HEYM52C1X445.jpg\",\"documents\\/01JRD21Q13TZG5F3MPHE5W1FAT.jpg\",\"documents\\/01JRD21Q163ZP8G0R6M2CKNADQ.jpg\",\"documents\\/01JRD21Q198VVG4Y96MTX2DBN0.jpg\",\"documents\\/01JRD21Q1CD53P41B9480XQFAR.jpg\"]', 'I hope to get help on funding my business to improve get my own premises and equipment and hire people to work and improve lives.I would  like the program to help me archive this dream as it help and inspire a lot of young hero\'s.I have applied  because I don\'t have a workshop to work on since I am still growing and don\'t have resources to help me grow, I would really appreciate this opportunity since it will help me help my family also and help feed ather families I am a giver by nature I would love to see ather people\'s lives change through me with the help of this program as God would love.', 'Yes', 'FNB 63076619891', 'Tertiary Education', 'No', NULL, NULL, '2025-04-09 14:38:03', '2025-04-09 14:38:03'),
(310, 321, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'I am planning to start an auto mobile mechanic service called Sakhe Auto Mobile Services. The goal is to offer car repair and maintenance services that come directly to the customer—whether they are at home, stuck on the road, or busy at work.  This business will help people who don’t have easy access to garages or can’t afford to tow their vehicles. I will use basic mechanic tools, safety gear, and possibly a diagnostic scanner to fix common problems like brake issues, battery failures, oil changes, and more.  Starting this service will not only provide convenience to drivers in my community but also create job opportunities in the future as the business grows.', 'No', '[\"documents\\/01JRD39KZ84R4JV01DQRMDS647.png\"]', '[\"documents\\/01JRD39KZY1TATQ3YKYCGY036K.pdf\"]', 'Starting Sakhe Auto Mobile Services is more than just a dream for me—it\'s a step toward building something meaningful that serves people where they are, solves real problems, and helps grow the local economy. Joining this program is a chance for me to gain the skills, tools, and guidance I need to make that dream a reality. I believe that with the right support, I can turn this small idea into a business that makes a real difference.\n\nThe first thing I hope to gain is practical business knowledge. Running a successful mobile mechanic service takes more than just knowing how to fix cars. I want to learn how to manage my business well—how to budget, plan ahead, set fair prices, and handle customer payments properly. I believe the program can guide me in how to keep track of income and expenses, make smart business decisions, and grow in a sustainable way.\n\nI also hope to improve my technical skills when it comes to modern car repairs. Today’s vehicles are more advanced, and I want to learn how to use tools like diagnostic scanners to identify problems faster and fix them more efficiently. With access to training or mentorship through this program, I can sharpen my skills and offer a better service to customers, which builds trust and keeps them coming back.\n\nAnother important thing I hope to gain is customer service training. A mobile service like mine depends on building relationships. I’ll be going to people’s homes, workplaces, and helping drivers in stressful situations. I want to know how to deal with different types of customers professionally, respond to complaints respectfully, and provide a service that makes people feel comfortable and confident in my work.\n\nSupport and motivation are also things I hope to gain from this opportunity. Starting a business from scratch is not easy, especially when you don’t have all the resources. Sometimes it can feel like giving up is the only option. But I believe that being in a program that believes in me, supports me, and pushes me forward will help build my confidence and keep me going, even when things get hard.\n\nNetworking is another major benefit. I would love to connect with other young people who are also starting businesses, as well as mentors who can share their experience. Learning from others, hearing their stories, and getting advice from people who have walked the same road would be powerful. I believe that no one succeeds alone—sometimes all it takes is one connection or conversation to open a new door.\n\nMost importantly, I hope to gain access to tools and equipment that will allow me to get started. Things like a basic tool set, jack, safety gear, and maybe a battery tester or diagnostic scanner would make a huge difference. With these in hand, I’ll be ready to work right away, earn an income, and start building my customer base. Even small support—like fuel money or a phone with data—can help me move between clients and take bookings more easily.\n\nIn the long run, I hope this program helps me to see the bigger picture—not just how to survive, but how to grow. I want to learn how to expand my business in stages, plan for the future, and create opportunities for others. One day, I would like to train or hire other young people who are passionate about mechanics and want to build a better life for themselves.\n\nIn conclusion, I see this program as a stepping stone. It is a chance to learn, grow, and begin something that can change my life and help others too. I am not looking for a handout—I am ready to work hard, learn, and prove myself. All I need is a helping hand to get started. With the support from this program, I believe Sakhe Auto Mobile Services will not just be a business, but a solution that brings value to many.', 'No', 'No', 'Tertiary Education', 'No', 'None ', NULL, '2025-04-09 14:59:51', '2025-04-09 14:59:51'),
