(312, 323, 'Sewing', 'Employed', '1 year or less', 'The tool kit will enable me to maximize my production and be able meet my clients demands. Also this will enable me to run my business full time rather than as a side hustle.', 'No', '[\"documents\\/01JRD3HQW65EMTVZGNFFKZG38M.pdf\"]', '[\"documents\\/01JRD3HQW9WGZ7K03VEPB9Z5DN.pdf\",\"documents\\/01JRD3HQWBR16582BX01W7NG02.pdf\"]', 'As this program will help with the resources that I lack \"equipment\" I will be able to run it full time not as a side hustle. Furthermore, I\'m eager to grow my business to mass production not only targeting the local market but also the international market. This will play a major role in my growth as an aspiring entrepreneur.', 'No', NULL, 'Tertiary Education', 'No', NULL, NULL, '2025-04-09 15:04:17', '2025-04-09 15:04:17'),
