(331, 342, 'Electrician', 'Self-Employed', '4 years or more', 'I would use it in my occupation hence I\'m lacking a lot of tools. Again it will assist me to expand my sole trade company through creating jobs opportunities within my community and as well at the country.', 'No', '[\"documents\\/01JRFFP1M7X9J183XENP01WXFX.jpg\"]', '[\"documents\\/01JRFFP1MV59H633KP5A02Z8E1.jpg\",\"documents\\/01JRFFP1N1HY1ZC9E67HKGPJ9J.jpg\",\"documents\\/01JRFFP1NWWYW9R7DDWTW120PJ.jpg\"]', 'It is because to get more tools so that my will will become easily, my hope to gain from this program might be advance tools like drills, aluminium step ladder etc. ', 'Yes', '76584909', 'Tertiary Education', 'No', NULL, NULL, '2025-04-10 13:14:50', '2025-04-10 13:14:50'),
(332, 343, 'Sewing', 'Unemployed', 'Unemployed', 'l would use it to successfully start my own clothing shop under which i will create different clothing brands where i will sell things that i made myself including clothes, bags and underwear. First the shop will start as an online shop then as sales gain traction then i will look into opening a physical shop and hiring people. Creating Job opportunities for the young of Eswatini.', 'Yes', '[\"documents\\/01JRFGYJW62Z2YG8PX0F7WWZPC.jpg\"]', '[\"documents\\/01JRJ4K7889P9577PAP0NP03KQ.pdf\"]', 'I have applied for this program because I believe it offers exactly what I need to take the next step in building a business that not only sustains me, but also empowers other young people in Eswatini. As a 23-year-old woman currently living and volunteering at the Good News Mission, I’ve dedicated my life to serving others. I\'m a proud member of the International Youth Fellowship (IYF Eswatini) under the Good News Church, where I developed a deep love for community work, personal growth, and nation-building.\n\nMy journey into entrepreneurship began with a passion for fashion. As a model, I had the privilege of being exposed to various designers and creative styles. That experience sparked something in me—a desire to not just wear beautiful clothes, but to create them. At the time, I didn\'t have formal training, but I was determined to learn. I started hand sewing items for myself and family members. Later, I enrolled in IYF’s three-month sewing course, where I learned the basics of sewing. Since then, I’ve taught myself even more through YouTube and Pinterest, developing my skill into a craft that now serves others.\n\nWith the little I had, I began sewing outfits—especially graduation and everyday clothes—for clients, friends, and family. I’ve been using a small plastic sewing machine to bring my ideas to life. While I’m proud of how far I’ve come, this machine has been very limiting. It frequently jams, breaks down, and is not built for the level of work I’m now doing. In fact, it’s no longer functioning at all, which has halted production and made it difficult to meet customer demands. That’s one of the key reasons I am applying for this program.\n\nThis opportunity represents more than just access to equipment—it represents a way to bring my vision to life. My business, Cute Things, is still in its early stages, but I have big dreams for it. It will house different brands, including Forever and a Day (clothing), Scarlet (underwear), and soon a line of handmade bags. I plan to start online and, as sales grow, open a physical store where I can hire and train other youth—especially those who are unemployed or overlooked.\n\nThrough this program, I hope to gain proper sewing tools like a high-quality sewing machine and an overlocker. These tools will allow me to improve the quality of my work, increase productivity, and take on more clients. But beyond the physical tools, I also hope to gain business knowledge, mentorship, and the opportunity to connect with others who are building something meaningful. I want to learn how to manage and grow a sustainable business that can stand the test of time.\n\nAs a volunteer, I do not earn an income for the work I do, yet I remain committed to my mission because I believe in the transformation of young people and the development of our nation. Receiving this support would help me sustain myself financially while continuing to serve the community. It would also allow me to create employment for others and contribute to the local economy in a meaningful way.\n\nIn conclusion, I am applying because I’m ready. I’m ready to grow, to learn, and to lead. I’ve laid the foundation with my own hands—now I just need the tools to build higher. This program could help turn my small beginning into something truly impactful, and I would be honored to be a part of it\n\n', 'No', NULL, 'Practical Experience Under A Qualified Technician', 'Yes', 'International Youth Fellowship Eswatini', NULL, '2025-04-10 13:36:58', '2025-04-11 13:58:46'),
(333, 344, 'Sewing', 'Unemployed', 'Unemployed', 'I would use it for starting a sewing business. i will sew clothes for different people and i would ask sewing tenders in organizations like schools, creche and churches even football teams.', 'No', '[\"documents\\/01JRFHHKNK9T60R62HJBB2TQ8E.jpg\"]', '[\"documents\\/01JRFHHKPB1DYW3JFZ8T3DB0XQ.pdf\"]', '1. I applied so that i can improve my life financially by starting a sewing and dressmaking business.\n2. I applied so that i can have source of income from the business, currently i do not have a source of income.\n3. I applied so that i can create job for others once my business succeed.\n4. I applied so that i can get the toolkit to start my business.', 'Yes', 'Momo - 76245893', 'Tertiary Education', 'No', 'None.', NULL, '2025-04-10 13:47:21', '2025-04-10 13:47:21'),
(334, 345, 'Sewing', 'Employed', '3 years', 'I will use it to start my own business as I don\'t have enough funds to buy the necessary tools ', 'No', '[\"documents\\/01JRFM75AY1AF134G8WMRW5EJ3.jpg\"]', '[\"documents\\/01JRFM75CA2H6KXJ25GPPY3E8H.pdf\"]', 'I have applied because I nolonger want to do the job I\'m doing and commit myself to my tailoring field. And hope this program can offer me industrial machines,not only that but every help can be appreciated. ', 'Yes', 'Nedbank -40000530338', 'Tertiary Education', 'Yes', 'YOUTHLET', NULL, '2025-04-10 14:34:05', '2025-04-10 14:34:05'),
(335, 346, 'Plumbing', 'Self-Employed', '1 year or less', 'I would continue to further my experience in the field of plumbing by providing good services to clients since plumbing is also my way of living.', 'No', '[\"documents\\/01JRFQ23NZQB1MQN9YMX8S9X46.JPG\"]', '[\"documents\\/01JRFQ76HCMJ9ZCS7VDSGZ1QDP.pdf\"]', 'To have enough tools so that i can provide enough and good services to client since i will be having a complete toolbox and gain more experience through being part of your programs.', 'Yes', '9110006523202', 'Tertiary Education', 'No', NULL, NULL, '2025-04-10 15:23:45', '2025-04-10 15:26:31'),
(336, 347, 'Electrician', 'Unemployed', 'Unemployed', 'I could effectively utilize the toolkit of my vocational skills to generate sustainable income', 'No', '[\"documents\\/01JRFQM61JM3FFYSQJM3NKBMVS.pdf\"]', '[\"documents\\/01JRFQM61XZAA1EMV6PR3H66ZE.pdf\"]', 'I\'ve applied for this electrical engineering toolkit because it represents a significant opportunity to advance my practical skills and contribute more effectively to the field. As someone passionate about electrical engineering, I understand the critical importance of having access to the right tools and equipment for hands-on learning and project implementation. I hope to gain enhanced practical skills, contribute to my community and to start a sustainable business.', 'Yes', 'Momo - 7976 2219', 'Tertiary Education', 'No', NULL, NULL, '2025-04-10 15:33:37', '2025-04-10 15:33:37'),
(337, 348, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'With the toolkit, as a young person I can begin to offer services and generate income this can be particularly due to unlimited opportunities. This kit will empower me to control my earnings and build a sustainable livelihood. ', 'Yes', '[\"documents\\/01JRFR77GXMQHFJGGPS03EPAAQ.pdf\"]', '[\"documents\\/01JRFR77H09H6A0Q7B33NRPJ95.pdf\"]', 'I have been actively seeking opportunities to learn and grow in my vocational skill to demonstrate my strong worth ethic and genuine desire to excel in this field. However, limited resources have hindered me to pursue  my dream. From this program i hope to gain economic empowerment and freedom, so i can be of help to my family and communities I operate in.', 'Yes', 'Momo  - 7843 5579', 'Tertiary Education', 'No', NULL, NULL, '2025-04-10 15:44:01', '2025-04-10 15:44:01'),
(338, 349, 'Sewing', 'Self-Employed', '2 years', 'I will sew uniforms for my local community school and supply them, since they are running short of supply sometimes. I will also continue with my business Qondile Dress Atelier which has closed due to the fact that I am no longer able to rent a sewing machine.', 'No', '[\"documents\\/01JRFRW6JESYVBSWAY3XGV6C0W.PNG\"]', '[\"documents\\/01JRFRW6JJYWGQEXR41G8474GN.pdf\"]', 'I have applied because I need a sewing toolkit to work, as I do not own any. I have gained many skills from sewing for over a year and have assisted many sewer when they had a lot of sewing work to do.', 'Yes', 'Momo-78204966', 'Practical Experience Under A Qualified Technician', 'No', NULL, NULL, '2025-04-10 15:55:28', '2025-04-10 15:55:28'),
(339, 350, 'Carpentry', 'Unemployed', 'Unemployed', 'I will use them to start my own business, so I can have the ability to generate money and be able to help my family financially. ', 'No', '[\"documents\\/01JRFTSWJGS7W2GZJ7QX6K46KY.jpg\"]', '[\"documents\\/01JRFTSWKD3PWXANNYZF38Q58Y.jpg\"]', 'My aim of applying is form to gain the tools as my business start up. It is indeed my deepest aim to start up my business,so I can be able to generate an income to help my family and create job opportunities.I also want to help youth in my community who doesn\'t know what to do with their lives, and introduce them in the carpentry skill. I am a person who believes in second chances, so being able to get the tools will be a huge break through in my life of being an unemployed citizen. I thank you. ', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-10 16:29:10', '2025-04-10 16:29:10'),
(340, 351, 'Motor Mechanic', 'Self-Employed', '1 year or less', 'For diagnosing problems, mechanic use daignostic tools to identify issues with a vehicle engine, electrical system, and other components.  Also perform repairs, mechanic use variety of tools to repair damage or worn part including brakes,suspension and engine components. Moreover, for maintaining vehecles.', 'No', '[\"documents\\/01JRFY2ZW4SGKBDT02JZ2QYQBD.jpg\"]', '[\"documents\\/01JRFY2ZX2KNVD3FGCNHWNYZBJ.jpg\"]', 'The main reason for this application is to get tool kit for efficient and safety vehicle repair and maintenance. Well-equipped kit enable me to work faster and more efficient. Also using the correct tools help to minimize the risk of injuries caused by improper equipment use.\nMoreover, a well-equipped mechanic projects an image of professionalism and expert, building trust with clients. Using the right tools and techniques demonstrates adherence to industry standards and best practices.', 'Yes', 'Momo 78285534', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-10 17:26:34', '2025-04-10 17:26:34'),
(341, 352, 'Plumbing', 'Unemployed', 'Unemployed', 'I would use the toolkit to transform my skill into a thriving business, creating a positive ripple effect throughout my life and the lives of those around me.', 'No', '[\"documents\\/01JRFZ9NPYT4AX3B99537F0HC9.pdf\"]', '[\"documents\\/01JRFZ9NQ1HKEXD2NP7N2ZE490.pdf\"]', 'I have applied for this program because it represents a crucial opportunity to transform my current situation and build a sustainable future for myself and my family. I am deeply committed to improving my living condition, and this program offers the resources and support necessary to achieve that.', 'Yes', 'Momo - 78254519', 'Tertiary Education', 'Yes', 'Youth Brigates ', NULL, '2025-04-10 17:47:41', '2025-04-10 17:47:41'),
(342, 353, 'Carpentry', 'Employed', '1 year or less', 'If I were awarded a carpentry toolkit, I would use it to establish a sustainable carpentry business, focusing on both practical income generation and community benefit.', 'No', '[\"documents\\/01JRFZX9Y9XY5DQEWFQRERWJPV.pdf\"]', '[\"documents\\/01JRFZX9YQW0GVERCBFQXXAZM7.pdf\"]', 'I see this program as an investment in my future and the future of Sandleni Inkhundla. I am committed to using the skills and resources provided to build a thriving carpentry business that benefits both my family and my community.', 'Yes', 'Momo - 78452313', 'Tertiary Education', 'No', NULL, NULL, '2025-04-10 17:58:25', '2025-04-10 17:58:25'),
(343, 354, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'I have gained a lot of experience and traing on the skill and would like to open my own mini workshop as i am unemployed now.', 'No', '[\"documents\\/01JRG0AY4JS1M76GQSX1Y7T1E5.jpg\"]', '[\"documents\\/01JRG3T2YSYR3P6WRH7YZTW0NF.pdf\"]', 'After gaining so much experince and undergoing training for Motor Mechanic, i have been motivated to start my own small business. Starting a new business needs funding, mentorship and guidance from such programs, and i hope and believe being under this program i aim to gain opportunities for skill building not only for myself but also for the youth in my community which will help us develop confidence and make contribution to the community which we aim to develop.', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-10 18:05:51', '2025-04-10 19:06:33'),
(344, 355, 'Welding', 'Self-Employed', '4 years or more', 'I will provide service in my community, as they have to go a long way seeking for help. Also to my family. ', 'No', '[\"documents\\/01JRG18MEAX55KWGQT0R9FSSWQ.pdf\"]', '[\"documents\\/01JRG18MENWSN4928CSAA8TCBW.pdf\"]', 'I have applied in this organization in order for me to be assist with the toolkit. I am a young man who wish to help my community providing them with savice, that why I am applying to this program. I hope gaining the toolkit will help me to take care of my family and to provide service to the community. ', 'Yes', '76625132', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-10 18:22:04', '2025-04-10 18:22:04'),
(345, 356, 'Carpentry', 'Unemployed', 'Unemployed', 'Opening my own workshop as i have the experience in the trade, thus i was exelling in Design and Technology back at school.Also fulfilling my dream as being one of the best carpenters in the country also giving other youth the skill and showing them the imprtance of handwork from  the actual artifacts.', 'No', '[\"documents\\/01JRG1DD0N72YKY6XV329YKHJ7.jpg\"]', '[\"documents\\/01JRG1DD18XTR7NFV2FYT4Q0JX.jpg\",\"documents\\/01JRJK2Q59X8YQS9XZ4VRBBV3T.jpg\",\"documents\\/01JRJK2Q686K7BJKAJR9VA4Q4R.jpg\",\"documents\\/01JRJK2Q96HR1J8J32025Z0KVD.jpg\"]', 'Applying to this program was to ask for assistance in carpentry toolkit.Having experience and love for carpentry works made me to see the void of having my own workshop,as I have many ideas on my mind but i\'m restricted by not having my own equipment. Aslo having a number of  people placing orders when I put post on media of my handwork that  I used to make for school and tertiary practicals,made me to turn up for assistance in this programme.My hope to get the assistance in the carpentry toolkit will anable me to fulfill my dream of gatting more expirience in my own workshop until I become one of those doing carpentry works in the royal famillies and oversees opportunities.', 'Yes', '78505127', 'Tertiary Education', 'No', 'N/A', NULL, '2025-04-10 18:24:41', '2025-04-11 18:11:54'),
(346, 357, 'Sewing', 'Unemployed', 'Unemployed', 'I would use to sew school uniform and sew people desire', 'No', '[\"documents\\/01JRG67WA6AGQ7VFB2KJGS0EFJ.jpg\"]', '[\"documents\\/01JRG67WAZH4WA2A4FH4XE56A7.jpg\"]', 'Hope to get a machine and use to sew school uniform and sew some chothes desgner and also church uniform.', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-10 19:49:02', '2025-04-10 19:49:02'),
(347, 358, 'Electrician', 'Employed', '1 year or less', 'IF I were awarded an electrical toolkit, I would use it to start working in my community with basic electrical work—like fixing wiring issues or installing. I can also advertise myself on social platforms so that i gain more customers that need installations and troubleshooting. It would also allow me to start earning money by offering these services, while gaining more experience and building a career in the electrical field.', 'Yes', '[\"documents\\/01JRG6YYECM9YCKV10HS8RX921.pdf\"]', '[\"documents\\/01JRG6YYEN8MZ0YMD10HJM7JE6.pdf\",\"documents\\/01JRG6YYF6PGYH4GFN4DKV53SN.pdf\"]', 'I applied for this TVET program because I am passionate about advancing my career in the electrical field. I can not only improve my skills but also contribute meaningfully to my community. One of my main goals in applying is to receive a start-up toolkit, which will enable me to begin working independently and build a sustainable livelihood. This opportunity would give me the practical resources and confidence to put my training into real-world practice, offer quality services, and eventually grow into a professional electrical technician.', 'Yes', 'Momo - 76876476', 'Tertiary Education', 'Yes', 'Youthlet Centre ', NULL, '2025-04-10 20:01:38', '2025-04-10 20:01:38'),
(348, 359, 'Sewing', 'Unemployed', 'Unemployed', 'I would like to start my own business in sewing and sell a variety of items, be it graduation gowns, dresses and suits for events and even have some for rentals, and other different types of clothing, maybe also sew for those who do branded clothing. I am in need of an overlocker machine and also fabric for start up because fabric is also an issue because I don\'t have the finance to buy one. ', 'No', '[\"documents\\/01JRG7T9TK0HX0DZ03WAJPS082.jpg\"]', '[\"documents\\/01JRG7T9VK6CNZEB9BY11WBQ3N.jpg\"]', 'It is because I need to start my small business in order to be financially stable, it is hard out here, I have been applying for a job left and right but with no luck, I graduated 2019 for a Diploma in Human resources management but up until to date 2025 I have not been contacted anywhere, I am just  unemployed and struggling with no capital to start even a business.Recently In 2023 I applied for a sponsored UNDP sewing program and I was accepted and obtained a certificate thinking that maybe that would help me start a business but with no Capital that is impossible, may I please have an Overlocker sewing machine and atleast start up fabric. At the moment I am selling ice blocks at home but there is no much money because I end up using those small profits for home needs. ', 'Yes', 'Momo-78450570', 'Tertiary Education', 'No', 'None', NULL, '2025-04-10 20:16:35', '2025-04-10 20:25:51'),
(349, 360, 'Sewing', 'Employed', 'Unemployed', 'If given the opportunity i would start doing my own sewing business especially now there is a huge market available in school.', 'No', '[\"documents\\/01JRG86WFSQ1M9WSE10DHGZ5H9.jpg\"]', '[\"documents\\/01JRG86WJT0NC3DDMNQ6YP9G7P.pdf\"]', 'Living in an area where there are no job opportunities and you have to create your own has made me not to sit and wait for handouts but use the skill i am passionate and excelling in which is sewing. I have been moving from one job to another and getting retrenched because i was not believing in myself. The program has mase me believe that i can be my own employer with the help they are offering and making it easier to start my own sewing business. I hope to gain more mentorship and courage which will also jelp others who were afraid to start their own business and belived on being employed.', 'Yes', '78332445', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-10 20:23:27', '2025-04-10 20:23:27'),
(350, 361, 'Welding', 'Self-Employed', '1 year or less', 'I would like to formally register my business and hopefully expand and create job opportunities to the youth', 'Yes', '[\"documents\\/01JRG8HYF6NE6HH1Z2S3NMJF8W.jpg\"]', '[\"documents\\/01JRG8HYF8KMDK9X9K9WCYYRQ9.pdf\"]', 'Firstly I want to expand my enterprises and hopefully register my business . And inspire other youth mebers to be creative and start their own business', 'Yes', 'unayo -79145193', 'Practical Experience Under A Qualified Technician', 'Yes', 'Kwakha Indvondza', NULL, '2025-04-10 20:29:30', '2025-04-10 20:29:30'),
(351, 362, 'Carpentry', 'Employed', '1 year or less', 'I would open a workshop in my area which will benefit the community and also boost the economy of the country by employing unemployed individuals. In the workshop I will make furniture like TV stands, shoe racks which will be supplied to local people. To end with in the workshop we will also do carbinate making and fit them.', 'No', '[\"documents\\/01JRG9E1SMTCNVB7A0MTZYDW3M.PDF\"]', '[\"documents\\/01JRG9E1SRH2C6RBJZK88K3TCZ.pdf\"]', 'I have applied here because I don\'t have a capital to start my business, so I want the organisation to help me with the capital so that I can start and operate my business. I hope I can gain the to tools I need fe my business to operate.', 'Yes', 'First National Bank - 4268925002574983', 'Tertiary Education', 'No', 'N/A', NULL, '2025-04-10 20:44:50', '2025-04-10 20:44:50'),
(352, 363, 'Electrician', 'Self-Employed', '3 years', 'I will do house wiring for homes in my community. Solve electrical faults at home ', 'No', '[\"documents\\/01JRG9WQYP7HYRDMPEWD9E4P04.jpg\"]', '[\"documents\\/01JRG9WQZ5ZBTCGSX591Y35VN6.jpg\"]', 'I want to start doing house wiring using my own tools. Hopefully get more jobs as I will be fully equipped to do my job properly and easier.', 'Yes', '76716053', 'Tertiary Education', 'No', NULL, NULL, '2025-04-10 20:52:52', '2025-04-10 20:52:52'),
(353, 364, 'Plumbing', 'Unemployed', 'Unemployed', ' I would have used it to master a skill which will then help me to produce to consumers  and start a new business ', 'No', '[\"documents\\/01JRGA0MRVF234H09Q0SHKXNG8.jpg\"]', '[\"documents\\/01JRGA0MSE8KGFJ9EZ46YW9J2M.jpg\"]', '  To improve  my skill of plumbing  and to acquire new skills. I hope to gain in how to overcome challenges that are in plumbing and how to cooperate with customers. ', 'No', NULL, 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-10 20:55:00', '2025-04-10 20:55:00'),
(354, 365, 'Sewing', 'Unemployed', 'Unemployed', 'I would have applied for a tender to produce school uniforms for local schools. I would also open a small business where other people with similar qualifications can gather together and produce different types of garment ', 'Yes', '[\"documents\\/01JRGA1G7KSCGV78CDSNDB66DD.jpg\"]', '[\"documents\\/01JRGA1G7ZMKAE91RFRMDQQRKB.pdf\"]', 'I want to put my area of expertise into use. Staying at home and not making use of my qualifications will lead to forgetting and putting my talent into waste.\n\nI also want to ease the life of local community in accessing school uniform with having to travel longer distances.\n\nI am hoping to gain more experience in this programme which will also open the minds and opportunities for other people of my age.', 'Yes', '78131164', 'Practical Experience Under A Qualified Technician', 'Yes', 'Young Heros', NULL, '2025-04-10 20:55:28', '2025-04-10 20:55:28'),
(355, 366, 'Plumbing', 'Self-Employed', '4 years or more', 'To start working freely with all needed tools, and get a huge number of Customers to Service, for good income.', 'No', '[\"documents\\/01JRGD40JZ5TE92TSECF7K74AZ.jpg\"]', '[\"documents\\/01JRGD40KDYCWW2CFMKYC9SEEH.jpg\"]', 'I applied to this program because I am I need of some tools to equip my working standard, while I can\'t afford them. My hope from this program is that I will get the maximum help, for me to reach or meet my wishes with this skills I possess.thank you!', 'Yes', 'MoMo- 78249078', 'Tertiary Education', 'No', 'None', NULL, '2025-04-10 21:49:16', '2025-04-10 21:49:16'),
(356, 367, 'Carpentry', 'Unemployed', 'Unemployed', 'I would use it to start a small business offering services related to my trade. This would allow me to earn money.', 'Yes', '[\"documents\\/01JRGE2GJ5609FTW79T7KTC2NZ.pdf\",\"documents\\/01JRGE2GJDF2TPGGW3R3DHKYFY.pdf\"]', '[\"documents\\/01JRGE2GJXWGCHH719FMG3ZTQC.pdf\"]', 'I wanted to gain practical skills that will help me become self-reliant. The toolkit will give me the necessary resources to start working immediately and earn a sustainable income. ', 'Yes', 'Momo-78101396', 'Practical Experience Under A Qualified Technician', 'Yes', 'Kwakha Indvodza', NULL, '2025-04-10 22:05:55', '2025-04-10 22:05:55'),
(357, 368, 'Welding', 'Unemployed', 'Unemployed', 'I would use it to start my own business ', 'No', '[\"documents\\/01JRGE7S9TQ5B23V3Z17Y0170H.jpg\"]', '[\"documents\\/01JRGE7S9ZNW4WCDYQ3M986532.jpg\"]', 'Because of high rate of unemployment. I wish to gain help from government so that I can start my own business ', 'Yes', '76567722', 'Tertiary Education', 'No', 'None', NULL, '2025-04-10 22:08:48', '2025-04-10 22:08:48'),
(358, 369, 'Electrician', 'Unemployed', 'Unemployed', 'I will use the toolkit to do house wiring,to earn a living since I\'m not employed and no one is taking care of me', 'No', '[\"documents\\/01JRGE99KCTA2R2K9K7924KJQC.jpg\"]', '[\"documents\\/01JRGE99KN7MA4KF9VAN7D8WD1.jpg\"]', 'I want to do lot of house wiring,motor termination,so that i will end up opening my own company to creat job opportunities for other youth ', 'Yes', '76235477', 'Practical Experience Under A Qualified Technician', 'Yes', 'Junior Achievement ', NULL, '2025-04-10 22:09:37', '2025-04-10 22:09:37'),
(359, 370, 'Carpentry', 'Self-Employed', '4 years or more', 'I would  work  and make more more income. I would  wo hard and improve  myself  and help the community. ', 'No', '[\"documents\\/01JRGFD246ME6EW113QTGC1DME.jpg\"]', '[\"documents\\/01JRGFD24JHMBD2YHJFN7SDMEM.jpg\"]', 'I have  applied  for this fo I\'m lacking  tools for my work and that slows down  my productivity. I applied  for  this because I really  want to work  and improve my skill.furthermore I would  like to help my community  Boyz have future.last but not least I would  like to own a company  yet I don\'t have power to do it.', 'Yes', '78280376', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-10 22:29:09', '2025-04-10 22:29:09'),
(360, 371, 'Sewing', 'Unemployed', 'Unemployed', 'With that toolkit,I would sew school uniform for my nearest Buhleni National High as they were in need of tailor on January.', 'No', '[\"documents\\/01JRGG462NQW7391NV9QP24RFA.jpg\"]', '[\"documents\\/01JRGG462V26SJ8P150FH4FNXH.jpg\"]', 'I have applied for the toolkit because  i want to start my own business of sewing school uniforms and making designs weddings, promes and many more events.', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-10 22:41:47', '2025-04-10 22:41:47'),
(361, 372, 'Welding', 'Self-Employed', 'Unemployed', 'I would use it to start up my own workshop and add to the already owned tools', 'Yes', '[\"documents\\/01JRGH76XJ5BT2AQRP5YGPGZE9.pdf\"]', '[\"documents\\/01JRGH76XQZ88RTM53N1Z34KY4.pdf\"]', 'I apply so as to win start up kit and add to already owned tools and open my own workshop', 'No', 'No', 'Tertiary Education', 'Yes', 'Junior achievement ', NULL, '2025-04-10 23:00:55', '2025-04-10 23:00:55'),
(362, 373, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'I will start up my own local guarage, whereby I will be servicing motor vehicles, repairing and help in diagnosing them for my customers. ', 'No', '[\"documents\\/01JRGHD1ZAE37E0R201WZA5J3B.jpg\"]', '[\"documents\\/01JRGHD1ZXRM0DV5XAZHDD445B.jpg\"]', 'Due to the fact that there is high rate of unemployment in the country,I did not get any job after completing my motor vehicle mechanic course to get money to start my own business.It is on that note that I applied to you to get a start up capital to open my garage.The garage will help in giving the local youth some job opportunities and myself.\nThe garage will also help in reducing car accidents along our local roads since cars will be fixed even before reaching the country\'s busy roads.\nWith the garage I will earn cash since now after rendering the service to people, they just thank me and go while others pays me little and say you will buy airtime. The garage will help in charging the amount that is due for the service.\n', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-10 23:04:07', '2025-04-10 23:04:07'),
(363, 374, 'Welding', 'Unemployed', '2 years', 'Having my own workshop and register a comporny,try to teach the skill to those who don\'t afford to go and learn the skill because of lack of support and expand my compony to keep unemployed youth busy,and share new ideas and have our own designs and introduce them to our contry', 'No', '[\"documents\\/01JRGJ09PJPHJ9TP1P4P9B3VBE.pdf\"]', '[\"documents\\/01JRGJ09PP3W329Z31MX0TXB8D.pdf\"]', 'I\'m applying because i am a qualified young man who have been searching for a job with a pressure of supporting my 4 young sisters with all their needs since our parents died years ago, and I believe this will help me to make my dream come true,My dream was to have my own workshop and register a comporny expand it and help the jobless youth and those who haven\'t Finnish school for different reasons and share our ideas and introduce new designs in the country, I\'m looking forward to gain working tools and support from this proggram and make them not to regret of helpping Swazi youth but have an interest of giving more and more help', 'Yes', '76861287', 'Tertiary Education', 'Yes', 'FLAS', NULL, '2025-04-10 23:14:37', '2025-04-10 23:14:37'),
(364, 375, 'Sewing', 'Unemployed', 'Unemployed', 'I would use it to do what I always do best which is designing authentic garments. I would make sure to improve my establish my business  and make it successful.', 'Yes', '[\"documents\\/01JRGJ1VVP0D28WK7ZV84PK4YR.png\"]', '[\"documents\\/01JRGJ1VW7498909GNDM6VJB8Z.pdf\"]', 'From my university book allowance I managed to buy myself a flat sewing machine and I have been ever since trying to push my business with , however it was not that much of success as I have to zig zag edges which is something that my clients are not so pleased with. I am also a single mother and I need income to support my  children. I hope to grow my business and make a mark for myself. ', 'Yes', 'Momo 78234250', 'Tertiary Education', 'No', NULL, NULL, '2025-04-10 23:15:28', '2025-04-10 23:15:28'),
(365, 376, 'Welding', 'Unemployed', 'Unemployed', 'It would help to boost the source of income so my brother and sister can go back to school', 'Yes', '[\"documents\\/01JRGJR2YB4QJVM41KAWRVKF7E.pdf\",\"documents\\/01JRJTXJ4HT3FY9T5RP8AN2602.pdf\"]', '[\"documents\\/01JRGJR2YFXET8ZX19FP2K5RW0.pdf\"]', 'My passion is my craft. I take great pride in the art of making. I wish to contribute to society through every ability I have aquired from the same community members that gave them to me. \nI am a young,responsible and hard working individual in a chaos of a social landscape. Every gain I make is a perfect example that hard working can be beneficial. \nWe work hard to serve a community that is poverty stricken. Small jobs turn out to be more complex because of lack of tools. If we had better tools our services will be cheaper and we would be able to provide quality and keep more young individuals occupied ', 'Yes', '11990153630', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-10 23:27:36', '2025-04-11 20:28:53'),
(366, 377, 'Sewing', 'Unemployed', 'Unemployed', 'I\'d use the toolkit to enhance my sewing skills, create custom garments and textiles, and develop a professional portfolio. My goal is to start a sewing business, offer custom services, and contribute to my community by teaching others and creating items for local charities.', 'No', '[\"documents\\/01JRGM8G732DBQB2KBT73TCYX3.jpg\"]', '[\"documents\\/01JRGM8G7H80BA8BXGCAHZEBJP.pdf\"]', 'I\'m excited to apply for the youth employment program in sewing because I\'m passionate about fashion and textiles. I hope to gain technical sewing skills, industry experience, and confidence to pursue a career in the fashion industry. My long-term goal is to establish my own sewing business and contribute to my community.', 'Yes', 'Momo - 78138399', 'Practical Experience Under A Qualified Technician', 'No', NULL, NULL, '2025-04-10 23:54:03', '2025-04-10 23:54:03'),
(367, 378, 'Sewing', 'Self-Employed', '1 year or less', 'Producing more clothes with an aim of making a profit to grow my business ', 'No', '[\"documents\\/01JRGMT98D9QA87V7WPDWGRMBA.pdf\"]', '[\"documents\\/01JRGMT98JEFSVNJJTT53KRQ2D.pdf\"]', 'It is because I\'m in need of the equipment and I can not afford it since my business is still growing. My aim is to own a boutique of my fashionable clothes so that I can be famous ', 'Yes', 'Building Society -52000907261', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-11 00:03:46', '2025-04-11 00:03:46'),
(368, 379, 'Electrician', 'Unemployed', 'Unemployed', 'I would use it to generate income to sustain my daily expenses and sharpen my technical skills in the process ', 'Yes', '[\"documents\\/01JRGN6ZN1F42KYTNQWPJQM7ZJ.jpeg\"]', '[\"documents\\/01JRGN6ZN34XEWCZ4P4EB9MC48.jpeg\"]', 'I am hoping to get an opportunity to extend my skills as a technician and broadening my brand especially as a girl in this industry and thrive as I hope to open my own company and hire my fellow peers in the near future.', 'No', 'None', 'Tertiary Education', 'Yes', 'Young Heroes', NULL, '2025-04-11 00:10:42', '2025-04-11 00:10:42'),
(369, 380, 'Welding', 'Employed', '1 year or less', 'I can start a project specialised in in designing garden tools that could be sold for everyone in Eswatini.This will go with a service that i will offer to Emaswati who are in need of any weldingservice.e a', 'Yes', '[\"documents\\/01JRGN9RA02S9M0QG17R91NFH7.jpg\"]', '[\"documents\\/01JRGN9RAZZNH61EF5SEQPBB8S.png\"]', 'I have applied for this program because i seek assistant for too tools i can need in the project that i am willing to start and sustain my self with the society which could benefit from the project i am willing to start and empower the other youth in my community,to discover the importance of vocational skills  in our livelihoods.\n\nI hope to gain assistant from this program as young liSwati,who is really inspired to make it in the world and also bring a great impact in the country from a result of my vocational skills or works.', 'Yes', 'Momo-78504213', 'Tertiary Education', 'Yes', 'Start-up Grind Mandzini', NULL, '2025-04-11 00:12:13', '2025-04-11 00:12:13'),
(370, 381, 'Sewing', 'Unemployed', 'Unemployed', 'I will use start up a well stable business. As for now I used to rent machinery at high prices from tailors to sew some items such as hair bonnets and skirts. ', 'No', '[\"documents\\/01JRGNMFBJYBCHBZVZA4899CAX.jpg\"]', '[\"documents\\/01JRGNMFBPCPSXPSCEZ6QN4S08.jpg\"]', 'I applied because I\'m in need of the sewing machine to increased my productivity as I have learnt how to make different clothes such as skirts and dresses which can helps me to reduce my poverty status and also able to overcome my children\'s needs. I hope to gain flat sewing machine. ', 'Yes', 'Momo -  7832 3944', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 00:18:04', '2025-04-11 00:18:04'),
(371, 382, 'Electrician', 'Unemployed', '1 year or less', 'I would use it for house wiring, electrical fault finding and troubleshooting and also repair electrical appliances.', 'No', '[\"documents\\/01JRGP8TC4BJTHH1Z1M8W5E2VK.jpg\"]', '[\"documents\\/01JRGP8TD3RJSWFK8E8X58RA64.jpg\"]', 'To gain income so that I support my family and expand my business as an electrician.', 'Yes', 'Momo-76453528', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 00:29:11', '2025-04-11 00:29:11'),
(372, 383, 'Sewing', 'Unemployed', 'Unemployed', 'If I were to get the Toolkit for my vocational skill, I would practically polish up my skills, start sewing for clients immediately with the dream I always had to commercializing it soon so that in the future I will expand and create opportunities of employing others while advancing my skill in the process. I will be making a living myself and with many others benefitting as they will also be able to work and improve their skills more than to do something as young people than staying home and my family will be also supported through the process. This can help in opening up a lot of creativity due to the more practical sessions and possibilities because doing this has been driven by passion than just to look for a job. I will also upcycle old clothes to turn them to new fashionable items while teaching others. I will also make sure if time allows, we empower more young people in the community to also start earning from sewing and make a living. We will also make sure we increase our knowledge by participating more to capacity training workshops on business and financial management as we grow our entity to serve a larger population to increasing more demand and supply to our customers.', 'Yes', '[\"documents\\/01JRGQ2JQFA5HV4MRB072ZPNPC.pdf\"]', '[\"documents\\/01JRGQ2JQQ4QV9JRH66JDH6APR.pdf\"]', 'I have applied for the TVET sewing program because I am passionate about learning practical skills that can help me become self-reliant and create opportunities for myself and others. Sewing is not only a valuable trade, but it also offers a path to entrepreneurship, especially in communities where access to formal employment is limited.\n\nThrough this program, I hope to gain hands-on experience in sewing techniques, pattern making, and garment construction. I also want to learn how to manage a small business so that I can eventually start my own sewing business, create unique designs, and possibly train others in my community. This program will help me build a solid foundation for a brighter and more sustainable future.\n\nBy participating in this program, I aim to build a strong foundation for a brighter, more sustainable future—for myself and for those around me which will also help in poverty alleviation in my family, community and add value to the national economy as well addressing issues of depression and stress among youth that i will engage in the business growing timely the numbers of the employed young people in my community. \n\nThis will help me inspire more young people to create job opportunities for themselves and those around them than to sorely rely on being employed by cooperate companies or to work in the white-collar jobs sectors only. This will also show the world that Eswatini National Youth Council is a beneficial entity for the young people attracting more funders to support the initiatives started, maximize the organizations potential to increase their pool and also sustaining such opportunities.\n\n\n', 'Yes', 'Momo - 7665 7966', 'Practical Experience Under A Non-Qualified Technician', 'Yes', 'Youth Unbounded (YU)', NULL, '2025-04-11 00:43:15', '2025-04-11 00:43:15'),
(373, 384, 'Electrician', 'Unemployed', 'Unemployed', 'I would start working to make a living', 'No', '[\"documents\\/01JRGR6B4SN7RHKSG0ZFFNDG6P.jpg\"]', '[\"documents\\/01JRGR6B512ZESZET5JV04B9X4.pdf\"]', 'I applied to get help so I can be able work and I look forward to gain the tool kits', 'Yes', '76048270', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-11 01:02:46', '2025-04-11 01:02:46'),
(374, 385, 'Sewing', 'Self-Employed', '2 years', 'Having an overlocker machines can make my work more easier as I will not have to go to others organisations for overlocking which make it to be a long process that my customers can\'t stand. ', 'Yes', '[\"documents\\/01JRGS8N04G830PRS6BFBSH42F.jpg\",\"documents\\/01JRGSG9W0XKQFPQF1V2T82HCN.jpg\"]', '[\"documents\\/01JRGSG9WERSBPQK5H6M1JYZWF.jpg\"]', 'It wish to learn more in seeing as most of the time we only cover the basic like in high school.Provided the overlocker can make my work more convenient my customers will be ablaze to rely in me,as I will be able to deliver in time which customers are looking for', 'No', NULL, 'Practical Experience Under A Qualified Technician', 'No', NULL, NULL, '2025-04-11 01:21:31', '2025-04-11 01:25:41'),
(375, 386, 'Carpentry', 'Unemployed', '1 year or less', 'Building furniture\'s to develop my skills ', 'No', '[\"documents\\/01JRGSPHQKZQZCFFAF28KK5NRC.pdf\"]', '[\"documents\\/01JRGSPHQR9FK827PFKX8ZXMPB.pdf\"]', 'I\'ve applied in this program because I want achieve my dreams of becoming the greatest carpenter and also hope to gain new skills of becoming a successful carpenter and also gain the toolkit from this program ', 'Yes', '76994246', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-11 01:29:06', '2025-04-11 01:29:06'),
(376, 387, 'Sewing', 'Self-Employed', '1 year or less', 'To produce more clothes for my customers of example dress, curtains, bed covers. I wish to meet my customers demands on time.', 'Yes', '[\"documents\\/01JRGVH7EJA06ZFFX8T1YJZ798.jpg\"]', '[\"documents\\/01JRGVH7F12AWABNC926PH0YQP.jpg\"]', 'I am applying because  I am in need of industrial sewing machine or overlock', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'Young heroes ', NULL, '2025-04-11 02:01:09', '2025-04-11 02:01:09'),
(377, 388, 'Sewing', 'Unemployed', '2 years', 'I would start my own dressmaking business where I will focus on making school uniforms mostly but not exclusively. I will also make other items like dresses, tidziya, curtains, etc.', 'No', '[\"documents\\/01JRHE0XZGN0JMDEQ09P07Z174.pdf\"]', '[\"documents\\/01JRHE0Y1NEE3DDZTPYP048T6Y.pdf\"]', 'I have applied because I saw on the post that there is a chance of being awarded a toolkit to qualifying candidates. I am hoping that I qualify because I would really appreciate a toolkit just to help me get on my feet. Since I currently cannot afford a sewing machine on my own right now, it is hindering my dressmaking progress. I am unable to sew as much as I would like without my own sewing machine. ', 'Yes', '76879552', 'Practical Experience Under A Non-Qualified Technician', 'Yes', 'YOUTHLET ', NULL, '2025-04-11 07:24:18', '2025-04-11 07:24:18'),
(378, 389, 'Plumbing', 'Self-Employed', '4 years or more', 'I will use it to start my own business as a self employed Plumber ', 'No', '[\"documents\\/01JRHEYF2GS40PYX20JVQNH24N.jpg\"]', '[\"documents\\/01JRHEYF34MTY6D7X7D31YDCQR.jpg\"]', 'I have  applied because I wanted to be a fully equipped plumber, with all the tools I need to perform my plumbing services .\nI hope to see my future changing through the course of being Self-employed powered by this program and also hope to see myself being a job offer other than a job seeker thus limiting the rate of unemployed youth', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 07:40:26', '2025-04-11 07:40:26'),
(379, 390, 'Motor Mechanic', 'Self-Employed', 'Unemployed', 'As Mechanic this kit will help me more on providing quality services on faulty vehicles. Also the kit will help me to gain the practice more, because practise makes you perfect and accurancy.', 'Yes', '[\"documents\\/01JRHGSPRF652WK51NAM9ZST7Y.jpg\",\"documents\\/01JRHGSPRWN91Q1FGS9GMFJ7GQ.jpg\"]', '[\"documents\\/01JRHGSPS1ZM21F4Y9CG1N60VJ.jpg\"]', 'I need much assistance on working tools, which will enables me to provide more services to car owners. Also, i need your assistance on business registration in near future.', 'Yes', '62931745634', 'Tertiary Education', 'Yes', 'Junior Achievement', NULL, '2025-04-11 08:12:47', '2025-04-11 08:12:47'),
(380, 391, 'Electrician', 'Employed', '1 year or less', 'To start a business of my own ', 'No', '[\"documents\\/01JRHN2R1WHWVC7S2CK158XZKX.jpg\"]', '[\"documents\\/01JRHN2R269KF186SF7TCSSAX2.jpg\"]', 'I have applied because I am willing to acquire new information that might be helpful in the near future in my business which I want to start ', 'Yes', '76308393', 'Practical Experience Under A Qualified Technician', 'No', NULL, NULL, '2025-04-11 09:27:37', '2025-04-11 09:27:37'),
(381, 392, 'Sewing', 'Unemployed', 'Unemployed', 'I would use it to start my own fashion design business, creating affordable and stylish clothing for young people while also offering repair and alteration services in my community. This would not only help me become financially independent but also create opportunities to train and inspire other youth interested in fashion.', 'Yes', '[\"documents\\/01JRHP8EK4DDFBK7KFWKMHK5YJ.jpg\"]', '[\"documents\\/01JRHP8EK8NYHXFZS98YSCD3DT.jpg\"]', 'I have applied for this program because I am passionate about fashion design and ready to take the next step in turning my skill into a sustainable business. As a young entrepreneur, I face challenges accessing the tools I need, and this opportunity will give me a solid foundation to start my journey. I hope to gain not only equipment like a sewing machine but also business support, mentorship, and exposure to grow my brand. Ultimately, I want to use this chance to empower myself and inspire other young people to follow their dreams.\n', 'Yes', '76124456', 'Tertiary Education', 'Yes', 'SAFAIDS Eswatini ', NULL, '2025-04-11 09:48:13', '2025-04-11 09:48:13'),
(382, 393, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'It would help fix cars for private job clients', 'No', '[\"documents\\/01JRHPFSEEM3Q2B1J0M4M59GGC.jpg\"]', '[\"documents\\/01JRHPFSETT58QG4VM8GA1YGFV.jpg\"]', 'Winning this price can help me a great alot because the tool box can make my work easier when I am to fix people\'s cars when I have found some clients who needs their cars fixed,I can be able to support the people who are depending on me by the money I obtained through the toolbox', 'Yes', '76613288', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 09:52:13', '2025-04-11 09:52:13'),
(383, 394, 'Electrician', 'Self-Employed', '4 years or more', 'I can wire houses and fix fauld in around the country and solve any problem within mg field of study.', 'No', '[\"documents\\/01JRHSZM0VY6VVB693W568JBK9.jpg\"]', '[\"documents\\/01JRHSZM16D8PFMX7TP6G63D2P.pdf\"]', 'Ive have applied because i am short of tools and i want to work profesional with the right tools in the industry.From this program i hope to gain  experience and to take my wiring skills to a better level', 'Yes', '63130563637', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 10:53:18', '2025-04-11 10:53:18'),
(384, 395, 'Carpentry', 'Unemployed', '4 years or more', 'Start a business to take care of the family', 'No', '[\"documents\\/01JRHT0RKMVARYZCEP7RPWP5GV.pdf\"]', '[\"documents\\/01JRHT0RKTYZ1P83GT8Z2WC5YV.pdf\"]', 'I want to start a business be able to take care of my family and possibly employ young people.', 'Yes', '76484224', 'Practical Experience Under A Non-Qualified Technician', 'No', 'Kingdom Designs & Marketing', NULL, '2025-04-11 10:53:55', '2025-04-11 10:53:55'),
(385, 396, 'Sewing', 'Employed', '1 year or less', 'I will start my own business and hire someone to help me', 'No', '[\"documents\\/01JRHTG8ND38EARXBCXKG9PYH3.jpg\"]', '[\"documents\\/01JRHTG8PJZ46HXQ13VDXMQB50.jpg\"]', 'I will empower young woman to start their own business.\nHire them and teach them the skills \nWork together and make a support group for valnerable children\n', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-11 11:02:23', '2025-04-11 11:02:23');
