(386, 397, 'Electrician', 'Unemployed', 'Unemployed', 'If awarded a tool kit i uould start my own busines, and i have even managed to get myself customers while i was learning under a qualified electdician.', 'No', '[\"documents\\/01JRHW3ZEN13SMSV13R1N8RRHE.jpg\"]', '[\"documents\\/01JRHWZVQBWHTXKTB0X6R6Q6XM.pdf\"]', 'Having difficulties in obtaining a job in the environment i live in has made realize to create one. I have been unemployed for a long time yet i am a bredwinner at home. When an opportjnity of learning wiring presented itself i made a promise to learn a skill that will secure me employment. In this program i hope to gain mentorship and resillience which will help me do a strong business. ', 'Yes', '76692207', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 11:30:38', '2025-04-11 11:45:51'),
(387, 398, 'Welding', 'Unemployed', 'Unemployed', 'Panel Beating and sprey painting ', 'No', '[\"documents\\/01JRHWF2HZVXY0VD2GSFB4MXJH.jpg\"]', '[\"documents\\/01JRHWF2J5V7HXZ5H4EV5WWXZ1.pdf\"]', 'I\'m in need of working tools. I hope to be funded with the tools, then I will also be able to hire some of the guy in he industry ', 'Yes', '76132878', 'Tertiary Education', 'No', NULL, NULL, '2025-04-11 11:36:41', '2025-04-11 11:36:41'),
(388, 399, 'Sewing', 'Unemployed', 'Unemployed', 'Be self empoyed', 'No', '[\"documents\\/01JRHXY436W90EES1CG33DVMVH.jpg\"]', '[\"documents\\/01JRHXY454TVQW5Q8HDQ4QKNVM.jpg\"]', 'Tools to start my own business ', 'Yes', 'MoMo 76418919Too', 'Practical Experience Under A Qualified Technician', 'No', 'Nature', NULL, '2025-04-11 12:02:23', '2025-04-11 12:02:23'),
(389, 400, 'Sewing', 'Unemployed', 'Unemployed', 'It would help me find a place where i can work and start my sewing to sustain a living.', 'Yes', '[\"documents\\/01JRHZ94Z6GK8CRCHSK4GREQJS.jpg\"]', '[\"documents\\/01JRHZ94ZSW1MJ2GQHRVPNTMPJ.jpg\"]', 'Ive applied for the assistance becuase i do not have money to buy the start up toolkit for my self so i can start doing my sewing for self sustainability and grow my profession.  Hope i will be considered and supplied with the toolkit.', 'Yes', 'Standard Bank- 9110007013410', 'Tertiary Education', 'Yes', 'World Vision Youth Organization ', NULL, '2025-04-11 12:25:53', '2025-04-11 12:25:53'),
(390, 401, 'Motor Mechanic', 'Unemployed', '3 years', 'I would start my own work station since I do help out in local mechanic garages.It would help me stangthen my mechanic skills and work hard to open my own garage in future.', 'No', '[\"documents\\/01JRHZSRR05R3H2HZN44P8G6E4.pdf\"]', '[\"documents\\/01JRHZSRS6YR6QW8AHC37GYYAT.pdf\"]', 'I have applied to get assistance in starting a small business.\n I an orphan,this business will not help me achieve the goals I have,but will help better the situation at home as I also will be able to assist financially and otherwise.\nBeing unemployed is stressful, this will open doors for me.\nI really hope to learn a lot from this program,to acquire more skills.\nMore than everything, to get the assistance I desperately need to start a small business. ', 'Yes', '78077317', 'Tertiary Education', 'No', NULL, NULL, '2025-04-11 12:34:58', '2025-04-11 12:34:58'),
(391, 402, 'Sewing', 'Unemployed', 'Unemployed', 'I would design tote bags for tertiary students and sew them for selling. I would also produce dresses for rental and for sale.', 'No', '[\"documents\\/01JRJ03YXGZ93DCDPM5J7VEQXN.pdf\"]', '[\"documents\\/01JRJ03YZWGJ5DMK7FP2877S4V.pdf\"]', 'I applied because I need support in pursuing my tailoring and fashion designing  career. I also want to learn more in the field and I\'m hoping that any kind of support from this program can make my dream as a tailor and fashion designer possible. At the moment I have an experience in the field, I\'m just lacking the proper working tools, of which I hope this program can assist me with the tools to start working.', 'Yes', 'Momo-76234123', 'Practical Experience Under A Non-Qualified Technician', 'No', 'None', NULL, '2025-04-11 12:40:32', '2025-04-11 12:42:58'),
(392, 403, 'Carpentry', 'Self-Employed', '3 years', 'Given the chance, I would use for precise work,like assembling work easy.Moreover,it will also help me create more job opportunities  for others since work will be easier  and faster', 'No', '[\"documents\\/01JRJ0GW2HD8VA1EJ9TZ0E69FT.pdf\"]', '[\"documents\\/01JRJ0GW3B80307A5B8Y6CSYM9.jpg\"]', 'I am a young enthusiastic Swati male  ,passionate  to work and feed my family,elevate my community  through  skill.So,from this program  I would I hope to get the toolkit to openly explore the vast ideas to the world ', 'Yes', '76258254', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 12:47:35', '2025-04-11 12:47:35'),
(393, 404, 'Plumbing', 'Self-Employed', '4 years or more', 'If I were awarded a plumbing toolkit, I would use it to significantly expand my existing plumbing business. Currently, I manage to complete projects with a limited set of tools, which restricts my ability to take on larger or more complex jobs.', 'No', '[\"documents\\/01JRJ0ZNV7DCXE74BVG438P6P5.pdf\"]', '[\"documents\\/01JRJ0ZNVHPC38P0KKP0FSEXVS.pdf\"]', 'I have applied for this plumbing program because I see it as a pivotal opportunity to elevate my skills and establish a thriving plumbing business in Nhlangano. I am deeply motivated to contribute to the economic development of my community, and I believe that providing high-quality carpentry services is a vital step in that direction', 'Yes', 'Momo - 7667 3022', 'Tertiary Education', 'No', NULL, NULL, '2025-04-11 12:55:40', '2025-04-11 12:55:40'),
(394, 405, 'Sewing', 'Unemployed', 'Unemployed', 'I would start up my business and do as much work as I can as long as the customers want.', 'No', '[\"documents\\/01JRJ183Z18KDMHVMTHMWAWPA5.jpg\"]', '[\"documents\\/01JRJ18418MMY7EWRSPSY2FNV8.jpg\"]', 'I have applied here for the start up kit so that I can start doing my business ', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-11 13:00:16', '2025-04-11 13:00:16'),
(395, 406, 'Plumbing', 'Unemployed', 'Unemployed', 'A starter kit would significantly improve my life by providing me with the tools and resources necessary to work confidently and independently throughout Mbilaneni and the surrounding areas. Having my own tools would eliminate the limitations of relying on borrowed equipment, allowing me to take on a wider range of plumbing projects and build a reputable company. ', 'No', '[\"documents\\/01JRJ2JVZYQ0EE7DAZWRXG1FQM.pdf\"]', '[\"documents\\/01JRJ2JW0WH5CW0DJDR6K6TPMT.pdf\"]', 'I am committed to using the resources provided by this program to build a thriving business that creates opportunities and strengthens our community. I am ready to work hard, learn, and prove that I am a worthy recipient', 'Yes', 'M668 8688', 'Tertiary Education', 'No', NULL, NULL, '2025-04-11 13:23:37', '2025-04-11 13:23:37'),
(396, 407, 'Carpentry', 'Employed', 'Unemployed', 'I will start my workshop  nd provide jobs', 'Yes', '[\"documents\\/01JRJ31YED1ACRKCC8331PAV5W.jpg\"]', '[\"documents\\/01JRJ31YG06RSTB25FQM9KWQ9K.jpg\"]', 'I applied to this program  because I want to encourage young  girls  to join  this program.To help need people  nd also provide jobs .\n\nMy hope  is gain more knowledge  nd skills to this program.  To reduce povery in the country ', 'Yes', '76856550', 'Practical Experience Under A Qualified Technician', 'Yes', 'George Town', NULL, '2025-04-11 13:31:51', '2025-04-11 13:31:51'),
(397, 408, 'Sewing', 'Unemployed', '2 years', 'Improve the well-being of my family by staring a small business to continue generating income as a breadwinner. I will make new garment and designs and also supply uniforms for my local school uniform ', 'Yes', '[\"documents\\/01JRJ4F712NNE888E02SGZZ2VE.jpg\"]', '[\"documents\\/01JRJ4F721YMMVM4GVXFBM0RQ7.pdf\"]', 'I want to persue my dream of being a fashion designer also I want to become independent and improve my life and help my disabled father ', 'Yes', '76675231', 'Practical Experience Under A Qualified Technician', 'Yes', 'World vision', NULL, '2025-04-11 13:56:35', '2025-04-11 13:56:35'),
(398, 409, 'Welding', 'Self-Employed', '1 year or less', 'I would use it to open my own workshop and be self-employed to earn a living', 'No', '[\"documents\\/01JRJ4WN3HGJ600Z43WA2VRW2H.pdf\"]', '[\"documents\\/01JRJ4WN455PBSBBQFC8KAESPZ.pdf\"]', 'I have applied because since i graduated i wanted to be self employed but do not have tools. This then came as an opportunity for me to be self employed since currently im working under a welder in the area. I want to earn a living to sustain myself and family and employ other young people in the future once i grow my business.', 'Yes', '76667078', 'Tertiary Education', 'No', NULL, NULL, '2025-04-11 14:03:55', '2025-04-11 14:03:55'),
(399, 410, 'Sewing', 'Employed', '4 years or more', 'Sewing and opening a fabric shop', 'No', '[\"documents\\/01JRJ5QETJB6WRF751VDJ10QZE.jpg\"]', '[\"documents\\/01JRJ5QETSFD5QX284H7SQW4D6.jpg\"]', 'I want to achieve my goals of sewing opening the fabric shop and boutique.Get ride of poverty within me and helping others .I hope to gain more exposure to market and extra knowledge.Not To be hired but making my own money as a young preson', 'Yes', '62925271992', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 14:18:33', '2025-04-11 14:18:33'),
(400, 411, 'Sewing', 'Unemployed', 'Unemployed', 'I would use it profitable by sewing dresses, hats and making bags in order to have money to develop more business ventures. Also assist my community by offering sewing services.', 'No', '[\"documents\\/01JRJ5WKCE5TPKDN6237MMXP05.jpg\"]', '[\"documents\\/01JRJ5WKCP7DEGCQD48SQMTKQG.jpg\"]', 'I have applied to express my sincere interest in your program and to formally apply for support in acquiring a sewing machine. I am passionate about sewing and have been developing my skills for some time. Owning a sewing machine will greatly enhance my ability to create and learn.\nBy participating in this program and obtaining a sewing machine, I aim to further my skills, explore creative projects and contribute to my community by offering sewing services. This support will not only help me improve but also empower me to share my knowledge and skills with others.\nThank you for considering my application. I am excited about the opportunity to grow and make a positive impact through your program.\n\nSincerely\nThobekile Sibandze \nThobekile Sibandze ', 'No', NULL, 'Tertiary Education', 'No', 'None ', NULL, '2025-04-11 14:21:22', '2025-04-11 14:21:22'),
(401, 412, 'Motor Mechanic', 'Self-Employed', '1 year or less', 'I would use it to generate income by servicing motor vehicles both at the work shop and at locations that require off-site service. Having my own toolkit will eliminate the need to rent equipment allowing me to use the tools i receive and save more from the earnings from each job. ', 'No', '[\"documents\\/01JRJ83X5V1S8J11WPX8DH6WMH.jpg\",\"documents\\/01JRJ83X625KNF589JHJN124XW.jpg\"]', '[\"documents\\/01JRJ83X6PJFWAVWB5MRTHE2Z5.pdf\"]', 'I applied for the youth starter kit program because I am passionate about using my technical skills to create a sustainable source of income. With the right tools i can provide quality motor vehicle services both in on-site and off-site which increases my flexibility and number of clients I can reach. This program will give me that foundation i need to continue my small business, reduce capital requirement, and allow independent growth. I hope not to gain only tools, but the confidence and support to turn my skills into a successful venture thus also helping the community to gain from my skills.  ', 'Yes', '76458683', 'Tertiary Education', 'No', 'N/A', NULL, '2025-04-11 15:00:18', '2025-04-11 15:00:18'),
(402, 413, 'Sewing', 'Unemployed', 'Unemployed', 'I would start my own fashion and designing business.That would help me to my family with basic needs. provide ', 'No', '[\"documents\\/01JRJ88DDWJZW4M7C4KT37K4WS.pdf\"]', '[\"documents\\/01JRJ88DE3A6JF5CKN7T2W510M.pdf\"]', 'I have applied because i need assistance in obtaing sewing kit tools so that i could start my own fashion and designing  business since i posses  all the basic skills of sewing.', 'No', 'none', 'Practical Experience Under A Non-Qualified Technician', 'No', 'none', NULL, '2025-04-11 15:02:46', '2025-04-11 15:02:46'),
(403, 414, 'Electrician', 'Unemployed', 'Unemployed', 'With the skill i have obtained, i would start my own wiring business and close the gap of few electrician in my area.', 'No', '[\"documents\\/01JRJ8AXMZDP1WK86P3W1NX9P5.jpg\"]', '[\"documents\\/01JRJ8AXN8XDADQ4CA8YKW5697.pdf\"]', 'Getting this opportunity to be funded with start up tools will be the start of my employment journey. I am a form 3 drop out due to financial challenges at home, and many businesses and organisation donot hire someone who has not completed high school. When an apportunity to do the wiring course presented itself, i grabbed it with my all and i have succeeded with a certificate. My hope for this program is to get all the support and mentorship it will come with in my journey of starting a new business.', 'Yes', '76872098', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 15:04:08', '2025-04-11 15:04:08'),
(404, 415, 'Sewing', 'Employed', '1 year or less', 'If I were awarded a toolkit for my vocational skill in sewing, I would use it to significantly enhance the quality and efficiency of my work as a tailor. A well-equipped sewing toolkit would allow me to produce a wider range of garments with greater precision, professionalism, and creativity. Having the right tools—such as high-quality scissors, measuring tapes, needles, threads, tailor’s chalk, seam rippers, and most importantly, a reliable sewing machine—would empower me to bring my design ideas to life with confidence.  I would use the toolkit not only for daily tailoring tasks but also to improve turnaround time and offer better services to my clients. Currently, limited access to proper tools often slows down my process or compromises the finishing quality. With the toolkit, I would be able to handle more complex and custom orders, expand my services, and potentially introduce new clothing lines.  Furthermore, the toolkit would support my goal of mentoring other young people who are interested in learning how to sew. I believe in skill-sharing and community growth. With the right tools, I could conduct basic training workshops in my community and help others develop skills that can create income-generating opportunities for them as well.  Ultimately, receiving a sewing toolkit would not just benefit me personally—it would open doors to broader opportunities for growth, empowerment, and service to others. It would strengthen my business, build my confidence as a tailor, and contribute to the sustainability of my vocational journey.', 'No', '[\"documents\\/01JRJ8GCQZSGMJ3BQ17SHWXV17.pdf\"]', '[\"documents\\/01JRJ8GCRR78XVYNFE55Y6QNYF.pdf\"]', 'I am applying to this sewing program because I am deeply interested in developing my skills in sewing, fashion, and design. Sewing has always intrigued me—not just as a craft but as a form of self-expression, creativity, and empowerment. This program represents an incredible opportunity for me to learn from professionals, access resources I wouldn’t otherwise have, and take meaningful steps toward a future where I can turn my passion into a profession or meaningful hobby.\n\nWhat draws me most to this sewing program is its focus on skill-building, mentorship, and creative development. I believe that learning how to sew is not just about stitching fabrics—it\'s about patience, discipline, attention to detail, and creative problem-solving. These are life skills that apply to all areas of my personal and professional growth. I am especially excited about the chance to learn foundational techniques—from how to use and care for a sewing machine to reading patterns, cutting fabric, and constructing garments. This type of hands-on experience is something I have long desired, and I know it will benefit me greatly.\n\nGrowing up, I was always fascinated by how clothes were made. I would look at garments and wonder how they were pieced together. I’d even try to hand-stitch small things at home or customize clothes to make them feel more personal. However, I never had formal training or access to the proper tools and space to fully pursue this interest. This program feels like the right place to begin. It offers a space where I can learn the basics, grow in confidence, and eventually give back—by sharing my skills with others or contributing to creative projects in my community.\n\nOne of my hopes from this program is to learn how to design and create clothes not only for myself but also for my family, friends, and eventually the wider community. I come from an area where access to custom or well-made clothing can be limited, especially when working within a budget. If I can master sewing skills, I want to be able to offer affordable alterations, create garments that reflect culture and identity, and even upcycle used clothes into something fresh and unique. I believe fashion should be accessible, expressive, and sustainable—and with the knowledge gained from this program, I hope to help make that a reality in my own way.\n\nAnother major goal for me is to build discipline and consistency through this experience. Sewing requires precision, planning, and practice. By committing myself to this program, I’m also committing to personal development—learning how to manage time, complete tasks with care, and be open to feedback and improvement. These habits will serve me well in every area of my life. I also look forward to learning alongside other participants, sharing inspiration, ideas, and encouragement in a group environment. There is something powerful about growing with others who share your passion, and I believe this program fosters that kind of creative and supportive space.\n\nIn the long run, I see sewing as more than just a hobby—it could open doors to entrepreneurship, further education in fashion or design, or meaningful contributions to my community. Whether I end up launching a small clothing line, volunteering to teach others, or simply gaining the confidence to create for myself and loved ones, I know this program will provide the foundation. It’s a step forward that I am excited to take with purpose and dedication.\n\nLastly, I am drawn to the values this program represents—creativity, growth, and empowerment. These are values I truly believe in. I want to gain not only the technical skills of sewing, but also the mindset of a maker—someone who takes pride in building things from the ground up, who sees potential in materials and ideas, and who wants to create something meaningful and lasting. I am ready to learn, to work hard, and to make the most out of this opportunity.\n\nThank you for considering my application. I hope to be part of this sewing program and look forward to learning, growing, and creating in every way I can.', 'No', 'None ', 'Practical Experience Under A Qualified Technician', 'No', 'None ', NULL, '2025-04-11 15:07:08', '2025-04-11 15:07:08'),
(405, 416, 'Electrician', 'Self-Employed', 'Unemployed', 'I would use this toolkit whenever I\'m engaging in the field work. It would also help me to complete the work on given time frames as it would make it easier and faster.', 'No', '[\"documents\\/01JRJ8YH4KZ5HYQ85PNDMG31FC.jpg\"]', '[\"documents\\/01JRJ8YH4PK5XZQ7KHRNVQYT6Y.pdf\"]', '1. The reason behind me applying to this program is because it would help me benefit a lot of things like the toolkit.\n2. I believe that I would also acquire extra knowledge about the field I\'m engaging myself into.\n3. It would also help me to socialise with different people so that I can learn more about the struggles of being an electrician.\n4. Most importantly, to be a part of something that\'s bigger than me.', 'Yes', 'Momo - 78374699', 'Tertiary Education', 'No', 'None', NULL, '2025-04-11 15:14:51', '2025-04-11 15:14:51'),
