(423, 434, 'Electrician', 'Unemployed', 'Unemployed', 'I would build a strong foundation that lets me start doing more jobs for friends, family, and local clients — and from there, grow. Maybe own my own company in the near future.', 'No', '[\"documents\\/01JRK21MBGZAYTEJDEGYS9SKVH.pdf\"]', '[\"documents\\/01JRK21MBQD284RS0RRM73ZHFH.pdf\"]', 'I am applying for this programme because it provides a valuable opportunity to support my career development as an electrician. Gaining access to a starter kit would allow me to begin hands-on work, build experience, and take on jobs with the necessary tools. As someone who is passionate about electrical work and committed to building a professional career in the trade, this kit would help reduce the financial barrier of purchasing tools on my own and enable me to deliver quality work from the start. With the right equipment, I can improve my skills, serve clients more effectively, and progress towards becoming a fully independent and reliable electrician.', 'Yes', 'Momo - 78045635', 'Tertiary Education', 'No', NULL, NULL, '2025-04-11 22:33:27', '2025-04-11 22:33:27'),
