(429, 440, 'Welding', 'Unemployed', 'Unemployed', 'I would use it to improve my work as I lack necessary tools to meet market demands. The tools will assist me to make work easier and faster. I will do more welding materials to increase profits and I will be able to pathner with others in the industry. ', 'No', '[\"documents\\/01JRKDRMDDKT7BNXKDCV1NNQTD.jpg\"]', '[\"documents\\/01JRKDRME9GX5Q74MDA0T3G6NW.jpg\"]', 'I have applied for this program because I believe it will help improve my skills in welding and I will be able to do more work. I also believe it is the right platform to assist us as young people to grow our vocational skills and become independent.  I am hoping to gain the toolkit which will provide me with the necessary tools such as welding machine, hammers to name a few. I also believe I will gain more exposure in welding and learn more. I will also be able to teach other young adults the work .', 'Yes', 'Momo - 78429560', 'Practical Experience Under A Qualified Technician', 'Yes', 'Save A Soul Foundation ', NULL, '2025-04-12 01:58:15', '2025-04-12 01:58:15'),
(430, 441, 'Welding', 'Self-Employed', '4 years or more', 'If awarded the welding toolkit, I will use it to start a small welding business offering essential services like gate fabrication, furniture repairs, and creative metalwork—using the income to support myself and fund Lumisa Creatives, my social enterprise empowering blind and deaf youth in Eswatini. The toolkit will not only help me build a sustainable livelihood but also lay the foundation for inclusive skills training and income opportunities for young people with disabilities. ', 'Yes', '[\"documents\\/01JRKDSJVW7T6TPP2G6HNS7A5F.png\"]', '[\"documents\\/01JRKDSJWSERYH8NDA1XVXBF53.pdf\"]', 'My name is Simphiwe Ngubeni, and I am a passionate aspiring entrepreneur working to empower blind and deaf youth in Eswatini through a social enterprise called Lumisa Creatives. I am applying for this TVET welding program to launch a welding business that will help me generate income and fund inclusive creative and vocational training opportunities. With the right training and equipment, I aim to provide essential welding services in my community while also introducing welding as a skill for youth with disabilities. This program represents a vital step toward building a sustainable livelihood and creating long-term social impact.\n', 'No', NULL, 'Tertiary Education', 'Yes', 'Lumisa Creatives ', NULL, '2025-04-12 01:58:46', '2025-04-12 02:09:13'),
(431, 442, 'Carpentry', 'Self-Employed', 'Unemployed', 'I would definitely start a carpentry business, it has been my dream ever since I learned it through Kwakha Indvodza. Currently I managed to buy some of the tools including a Drill, Jig saw, circular saw, tape measure, level, corner square, 2 G clamps. ', 'Yes', '[\"documents\\/01JRM5MEXKQVYM9SRSSF5GT2PP.jpg\",\"documents\\/01JRMJ8EVQ3JMPKAJB964XFKWR.jpg\"]', '[\"documents\\/01JRM5MEY7T1WVWJZ4MQWSCPRH.pdf\"]', 'I hope to get support on some of the carpentry essential tools like planner, sander, router and compressor. I have a dream of recycling pallet wood to furniture and accessories like phone stands, kitchen hangers, bathroom hangers, first aid kit boxes etc.', 'No', NULL, 'Practical Experience Under A Qualified Technician', 'Yes', 'New village clean up group', NULL, '2025-04-12 08:55:24', '2025-04-12 12:36:02'),
(432, 443, 'Sewing', 'Unemployed', 'Unemployed', 'If awarded a tool kit I would start my sewing business which can help me pay for my studies since my parents are not working. I would also mentor young girls and teach them how to sew in order from them to make a leaving and shy out of drug abuse ', 'Yes', '[\"documents\\/01JRMFGEPR32YQNKAKM5W865TC.jpg\"]', '[\"documents\\/01JRMFGEQ9GH3AAEBFFWG7YATV.jpg\",\"documents\\/01JRMFGEQBWSK9V3KXD55JWZM4.jpg\"]', 'I have applied for the assistance in order to get a sewing machine which will help me earn a living and pay for my tuition fee, I am disadvantaged since my parents are not working so I fell the best way to make a living is starting my own business which will help me assist even at home. I also plan to mentor girls who have the same problems because they tend to prostituting or drug abuse', 'Yes', '78337211', 'Tertiary Education', 'No', NULL, NULL, '2025-04-12 11:47:58', '2025-04-12 11:47:58'),
(433, 444, 'Electrician', 'Unemployed', 'Unemployed', 'I want to start my small business of wiring and also look for voluntary work to gain more experience. The toolkit can also help me to do house electrical failer in my community.', 'No', '[\"documents\\/01JRPK6QKENPWZAQGHK1XYBFTN.jpg\"]', '[\"documents\\/01JRPK6QKRG66P38E2AZXE5H9T.pdf\"]', 'I have applied because I need a toolkit since I couldn\'t not afford one. The toolkit can also help me to achieve my fully potentially in electrical field since I have some tools. I hope to get the support from this program so that I can start a small business and also help ather young people around me to share the skill. Starting a small business will help me to have an income and also fight the unemployment rate. ', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-13 07:31:03', '2025-04-13 07:31:03'),
(434, 445, 'Sewing', 'Unemployed', 'Unemployed', 'If I were awarded  a toolkit, I would  use it to  start my own business.', 'No', '[\"documents\\/01JRSS6XFDXKZP6ZJGBB69X2RN.jpg\"]', '[\"documents\\/01JRSS6XHD7ANVPBD2GAQ3WC8A.jpg\"]', 'If I were awarded  a toolkit, I would  use it to  start my own business.', 'No', NULL, 'Tertiary Education', 'No', 'None.', NULL, '2025-04-14 13:13:44', '2025-04-14 13:13:44'),
(435, 446, 'Carpentry', 'Employed', '3 years', 'Start my own carpentry business', 'No', '[\"documents\\/01JVC11Y5C3V76KC1CTJBEDBXT.pdf\"]', '[\"documents\\/01JRSX2CVQGT84GNP6AN03F1JB.jpg\",\"documents\\/01JRSX2CW2X2N2D6W7MHBV9ZZ3.jpg\",\"documents\\/01JRSX2CW58GJGGAY6VJ5Z3PTN.jpg\",\"documents\\/01JRSX2CWN6HBD5XQGAM71QSY6.jpg\",\"documents\\/01JVC11Y5JJZPS3CP6CY2DRWD2.pdf\"]', 'Start a carpentry business.', 'No', 'None', 'Practical Experience Under A Qualified Technician', 'No', 'None', NULL, '2025-04-14 14:21:10', '2025-05-16 11:48:33'),
(436, 447, 'Sewing', 'Unemployed', 'Unemployed', 'I will start a sewing business and sell to customers to improve the standard of living', 'No', '[\"documents\\/01JRSXZFPGH2JNABVQ7HKXQANH.jpg\"]', '[\"documents\\/01JRSXZFQ1EGVZM8QRR4GQWWNM.jpg\",\"documents\\/01JRSXZFQJXR4HPA6VNFQV2VB4.jpg\"]', 'I have applied to improve the standard of living, once I get the toolkit I will start a sewing business,attend free market e.t.c. And be a vendor', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-14 14:37:03', '2025-04-14 14:37:03'),
(437, 448, 'Plumbing', 'Unemployed', 'Unemployed', 'What I will do with this tools is that I will be able to start my own business and it will make me to have more experience in the field of waste management. ', 'No', '[\"documents\\/01JRTBY97BVQJXWF864N9019M9.pdf\",\"documents\\/01JRVH2QT8JK241PPD0SD7ZJ8F.pdf\"]', '[\"documents\\/01JRTBY98PNYS2SMNBYV29YYYJ.pdf\",\"documents\\/01JRVH2QTW29B0A0RR0D72YD4S.pdf\"]', 'I have a Certificate in N3 water and wastewater treatment engineering which I got in 2022. So, I have learned about the installation and servicing plumbing systems and also the piping equipment and controls. My qualification and plumbing is a related course since it talks about waste, water and gases. \nWhat I will do with this tools is that I will be able to start my own business and it will make me to have more experience in the field of waste management. Currently, I have registered for a 3 months course of plumbing at IYF Eswatini and that 3 months training requires us to have our own tool kits. This will enable me to reach my goal of earning a Degree of Science in Environmental Engineering, I was once admitted for that course however, due to lack of funds I couldn’t further my studies.', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-14 18:41:04', '2025-04-15 05:30:07'),
(438, 449, 'Sewing', 'Unemployed', 'Unemployed', 'Grow my my skill into and be a fashion designer n designer a', 'No', '[\"documents\\/01JRVM9Y4732Y23WN22GRAJ50R.png\",\"documents\\/01JRW0HV7XHS25JTCR23PA5C7Y.pdf\"]', '[\"documents\\/01JRVM9Y715R33GXWED6WTD5SA.png\",\"documents\\/01JRW0HV828FDF6C635CN5JJQ2.pdf\"]', 'To better my life and to make my dream come true. ', 'Yes', '78331078', 'Tertiary Education', 'No', 'Eswatini National Youth counsel', NULL, '2025-04-15 06:26:29', '2025-04-15 10:00:31'),
(439, 450, 'Motor Mechanic', 'Unemployed', 'Unemployed', 'employ myself ', 'No', '[\"documents\\/01JRVMMX7PJNBTXZ044GT9NZM6.png\"]', '[\"documents\\/01JRVMMX96AQ4PCZVRH0J747NM.png\"]', 'I have applied from the organization seeking assistance in uplifting my Skill with tools I need and provide employment to the youth of my community.', 'No', 'None', 'Tertiary Education', 'No', 'None', NULL, '2025-04-15 06:32:28', '2025-04-15 06:32:28'),
(440, 451, 'Carpentry', 'Unemployed', '1 year or less', 'I would work well with the tools and use my skills make any wood products. I will be able to approach any work given .', 'No', '[\"documents\\/01JRVMZTQ31XGER9HJPQQ5VZRM.png\"]', '[\"documents\\/01JRVMZTQ7M14BCGBW10TV2VB7.png\"]', 'I\'m applying for this chance because I can\'t find a job and I am willing to start my own workshop and create a job for myself.', 'Yes', 'momo_78701299', 'Tertiary Education', 'No', 'None', NULL, '2025-04-15 06:38:26', '2025-04-15 06:38:26'),
(441, 452, 'Sewing', 'Self-Employed', '3 years', 'My business idea is to design and sew clothes , especially church, school, and corporate uniforms. Also, I can do all types of design that a customer ordered on that time. During the winter season, I will sew track suits for adults. Other designs like wedding dresses, Sishweshwe dresses, and sort of designs for special events. Also, because I am a tailor by profession, I will sew skirts and T-shirts to sell.', 'No', '[\"documents\\/01JSBAM91QASS0SBM6EE9X1TZ9.jpg\",\"documents\\/01JSBAM91WWCJ31SN4XXSF750R.jpg\",\"documents\\/01JSBAM91ZH5Z94KDJ7VX830KE.jpg\"]', '[\"documents\\/01JSBAM922JK4GMJC5WEB8T8QM.pdf\"]', 'I applied to ENYC to change my life and run a sewing business. I see this opportunity will help me to become an entrepreneur. To be a successful business woman and give back to my\ncommunity a helpful service instead of spending a lot of money travelling for sewing clothes. This program can build my future and my family situation can also change. When you accept\nmy request, I see myself becoming a leader in my community and sharing my skill with other people. My success can inspire young people using their skills and see opportunities in \nentrepreneurship instead of waiting for jobs that do not exist.\nI also aim to train more leaders, I want every woman and girls in my village to believe in themselves and their abilities. In this program, I hope I will gain different types of\nsewing machines to upgrade my sewing. And as I continue to run this business, I will gain more experience and gain speed, and accuracy. One day, I will fund my business so it will have its own brand and website and be available on all the social media sites. ', 'Yes', 'Momo - 78508364', 'Tertiary Education', 'Yes', 'Women In Trade And Industry (WITAD)', NULL, '2025-04-21 08:45:13', '2025-04-21 08:45:13'),
(442, 99, 'Electrician', 'Unemployed', 'Unemployed', 'With an electrician kit, I can equip myself with all the essential tools I need to start my business. It\'s a cost-effective investment that provides me with the versatility I need to tackle a variety of electrical tasks. As a recent graduate, I am excited to put my skills to work and build a successful electrical business. With an electrician kit, I can confidently take on new projects and provide high-quality service to my clients', 'Yes', '[\"documents\\/01JQTZ2VSTPFNZQYJ61KV7FYD4.jpg\"]', '[\"documents\\/01JQTZ2VSZC4G34Y2XD0Y57AKY.jpg\"]', 'I have applied for this program because I am passionate about becoming a skilled electrician and believe that it is a career path that aligns with my interests and goals.\r\nI am dedicated to learning and growing in the field of electrical work, and I believe that this program will provide me with the skills and knowledge necessary to succeed as an electrician. I am eager to apply what I learn and contribute to the electrical industry in a meaningful way.\r\nBy completing this program, I hope to gain the experience and expertise I need to launch my own electrical business.', 'Yes', 'Momo-76647092', 'Tertiary Education', 'Yes', 'Youthlet ', NULL, '2025-04-02 13:59:55', '2025-04-02 13:59:55');
